aec primum fortasse audientis servire debemus. Ex rebus enim timiditas, non ex vocabulis nascitur. Ne amores quidem sanctos a sapiente alienos esse arbitrantur. Qualem igitur hominem natura inchoavit? Quid affers, cur Thorius, cur Caius Postumius, cur omnium horum magister, Orata, non iucundissime vixerit? Duo Reges: constructio interrete. \n\n','2016-02-14 12:05:57','2016-02-14 22:53:16',NULL,NULL,0,1,0),(81,1,1,1,'Accounts',' Quarum ambarum rerum cum medicinam pollicetur, luxuriae licentiam pollicetur. Non enim quaero quid verum, sed quid cuique dicendum sit. Si quicquam extra virtutem habeatur in bonis. Sed haec nihil sane ad rem; Haec quo modo conveniant, non sane intellego. Duo Reges: constructio interrete. Quia, si mala sunt, is, qui erit in iis, beatus non erit. Omnes enim iucundum motum, quo sensus hilaretur. \n\n','2016-02-14 12:05:58','2016-02-14 22:53:17',NULL,NULL,0,1,0),(82,1,1,1,'Accounts',' Quod quidem iam fit etiam in Academia. Cur id non ita fit? Beatus autem esse in maximarum rerum timore nemo potest. Memini vero, inquam; Traditur, inquit, ab Epicuro ratio neglegendi doloris. Materiam vero rerum et copiam apud hos exilem, apud illos uberrimam reperiemus. Negabat igitur ullam esse artem, quae ipsa a se proficisceretur; Quorum sine causa fieri nihil putandum est. Duo Reges: constructio interrete. Huius ego nunc auctoritatem sequens idem faciam. Indicant pueri, in quibus ut in speculis natura cernitur. \n\n','2016-02-14 12:05:59','2016-02-14 22:53:17',NULL,NULL,0,1,0),(83,1,1,1,'Accounts',' Sit, inquam, tam facilis, quam vultis, comparatio voluptatis, quid de dolore dicemus? Cur post Tarentum ad Archytam? Ergo id est convenienter naturae vivere, a natura discedere. Non enim solum Torquatus dixit quid sentiret, sed etiam cur. \n\n','2016-02-14 12:06:00','2016-02-14 22:53:17',NULL,NULL,0,1,0),(84,1,1,1,'Accounts',' Ille vero, si insipiens-quo certe, quoniam tyrannus -, numquam beatus; Octavio fuit, cum illam severitatem in eo filio adhibuit, quem in adoptionem D. Et quidem Arcesilas tuus, etsi fuit in disserendo pertinacior, tamen noster fuit; Non enim iam stirpis bonum quaeret, sed animalis. Duo Reges: constructio interrete. Tum ille timide vel potius verecunde: Facio, inquit. Non igitur potestis voluptate omnia dirigentes aut tueri aut retinere virtutem. Hoc etsi multimodis reprehendi potest, tamen accipio, quod dant. Quis istud possit, inquit, negare? Tu vero, inquam, ducas licet, si sequetur; Quid, de quo nulla dissensio est? Videmus igitur ut conquiescere ne infantes quidem possint. \n\n','2016-02-14 21:53:12','2016-02-14 22:53:18',NULL,NULL,0,1,0),(85,1,1,1,'Accounts',' Idemne, quod iucunde? Cur post Tarentum ad Archytam? Quamvis enim depravatae non sint, pravae tamen esse possunt. Duo Reges: constructio interrete. Quem Tiberina descensio festo illo die tanto gaudio affecit, quanto L. Quamquam id quidem licebit iis existimare, qui legerint. Scaevola tribunus plebis ferret ad plebem vellentne de ea re quaeri. Eadem nunc mea adversum te oratio est. \n\n','2016-02-14 21:53:13','2016-02-14 22:53:18',NULL,NULL,0,1,0),(86,1,1,1,'Accounts',' Sed quot homines, tot sententiae; Deprehensus omnem poenam contemnet. Duo Reges: constructio interrete. \n\n','2016-02-14 21:53:13','2016-02-14 22:53:19',NULL,NULL,0,1,0),(87,1,1,1,'Accounts',' An haec ab eo non dicuntur? Quaero igitur, quo modo hae tantae commendationes a natura profectae subito a sapientia relictae sint. Non enim ipsa genuit hominem, sed accepit a natura inchoatum. Cum audissem Antiochum, Brute, ut solebam, cum M. Qui-vere falsone, quaerere mittimus-dicitur oculis se privasse; Erat enim Polemonis. Sed nimis multa. \n\n','2016-02-14 21:53:14','2016-02-14 22:53:19',NULL,NULL,0,1,0),(88,1,1,1,'Accounts',' Illud quaero, quid ei, qui in voluptate summum bonum ponat, consentaneum sit dicere. Sed haec quidem liberius ab eo dicuntur et saepius. Quod autem satis est, eo quicquid accessit, nimium est; Duo Reges: constructio interrete. Duarum enim vitarum nobis erunt instituta capienda. Ad eas enim res ab Epicuro praecepta dantur. Proclivi currit oratio. Experiamur igitur, inquit, etsi habet haec Stoicorum ratio difficilius quiddam et obscurius. \n\n','2016-02-14 21:53:15','2016-02-14 22:53:19',NULL,NULL,0,1,0),(89,1,1,1,'Accounts',' Quid autem habent admirationis, cum prope accesseris? Quid est igitur, inquit, quod requiras? Quam si explicavisset, non tam haesitaret. Iam in altera philosophiae parte. Nam Pyrrho, Aristo, Erillus iam diu abiecti. Duo Reges: constructio interrete. Hoc ne statuam quidem dicturam pater aiebat, si loqui posset. Atqui iste locus est, Piso, tibi etiam atque etiam confirmandus, inquam; \n\n','2016-02-14 21:53:16','2016-02-14 22:53:20',NULL,NULL,0,1,0),(90,1,1,1,'Accounts',' Scisse enim te quis coarguere possit? Vide igitur ne non debeas verbis nostris uti, sententiis tuis. Itaque contra est, ac dicitis; Ergo instituto veterum, quo etiam Stoici utuntur, hinc capiamus exordium. Quid ergo attinet gloriose loqui, nisi constanter loquare? Duo Reges: constructio interrete. Iam id ipsum absurdum, maximum malum neglegi. Sin aliud quid voles, postea. Hic nihil fuit, quod quaereremus. Nunc omni virtuti vitium contrario nomine opponitur. \n\n','2016-02-14 21:53:17','2016-02-14 22:53:20',NULL,NULL,0,1,0),(91,1,1,1,'Accounts',' Equidem, sed audistine modo de Carneade? Quod autem satis est, eo quicquid accessit, nimium est; Ut id aliis narrare gestiant? Ego vero volo in virtute vim esse quam maximam; Duo Reges: constructio interrete. Sed eum qui audiebant, quoad poterant, defendebant sententiam suam. \n\n','2016-02-14 21:53:17','2016-02-14 22:53:21',NULL,NULL,0,1,0),(92,1,1,1,'Accounts',' Mihi vero, inquit, placet agi subtilius et, ut ipse dixisti, pressius. Primum in nostrane potestate est, quid meminerimus? Hic ambiguo ludimur. Efficiens dici potest. Dolere malum est: in crucem qui agitur, beatus esse non potest. Nam illud vehementer repugnat, eundem beatum esse et multis malis oppressum. In quibus doctissimi illi veteres inesse quiddam caeleste et divinum putaverunt. Egone quaeris, inquit, quid sentiam? \n\n','2016-02-14 21:53:18','2016-02-14 22:53:21',NULL,NULL,0,1,0),(93,1,1,1,'Accounts',' Cur tantas regiones barbarorum pedibus obiit, tot maria transmisit? Deinde prima illa, quae in congressu solemus: Quid tu, inquit, huc? \n\n','2016-02-14 21:53:19','2016-02-14 22:53:22',NULL,NULL,0,1,0),(94,1,1,1,'Accounts',' Nam illud vehementer repugnat, eundem beatum esse et multis malis oppressum. Videmus igitur ut conquiescere ne infantes quidem possint. Duo Reges: constructio interrete. Praeteritis, inquit, gaudeo. Ita ne hoc quidem modo paria peccata sunt. Aeque enim contingit omnibus fidibus, ut incontentae sint. \n\n','2016-02-14 21:53:20','2016-02-14 22:53:22',NULL,NULL,0,1,0),(95,1,1,1,'Accounts',' Conferam avum tuum Drusum cum C. Sed ad haec, nisi molestum est, habeo quae velim. Quod ea non occurrentia fingunt, vincunt Aristonem; Sed quid minus probandum quam esse aliquem beatum nec satis beatum? Sed quanta sit alias, nunc tantum possitne esse tanta. \n\n','2016-02-14 21:53:20','2016-02-14 22:53:22',NULL,NULL,0,1,0),(96,1,1,1,'Accounts',' Tibi hoc incredibile, quod beatissimum. Nihil enim iam habes, quod ad corpus referas; Graecum enim hunc versum nostis omnes-: Suavis laborum est praeteritorum memoria. Nec vero sum nescius esse utilitatem in historia, non modo voluptatem. Atque his de rebus et splendida est eorum et illustris oratio. \n\n','2016-02-14 21:53:21','2016-02-14 22:53:23',NULL,NULL,0,1,0),(97,1,1,1,'Accounts',' Atque hoc loco similitudines eas, quibus illi uti solent, dissimillimas proferebas. Illa argumenta propria videamus, cur omnia sint paria peccata. Duo Reges: constructio interrete. Habes, inquam, Cato, formam eorum, de quibus loquor, philosophorum. Certe non potest. Tibi hoc incredibile, quod beatissimum. Nunc omni virtuti vitium contrario nomine opponitur. Quodcumque in mentem incideret, et quodcumque tamquam occurreret. Quae similitudo in genere etiam humano apparet. \n\n','2016-02-14 21:53:22','2016-02-14 22:53:23',NULL,NULL,0,1,0),(98,1,1,1,'Accounts',' Idemque diviserunt naturam hominis in animum et corpus. Tu enim ista lenius, hic Stoicorum more nos vexat. Maximas vero virtutes iacere omnis necesse est voluptate dominante. Quippe: habes enim a rhetoribus; \n\n','2016-02-14 21:53:22','2016-02-14 22:53:24',NULL,NULL,0,1,0),(99,1,1,1,'Accounts',' Facit igitur Lucius noster prudenter, qui audire de summo bono potissimum velit; Si qua in iis corrigere voluit, deteriora fecit. Huic ego, si negaret quicquam interesse ad beate vivendum quali uteretur victu, concederem, laudarem etiam; \n\n','2016-02-14 21:53:23','2016-02-14 22:53:25',NULL,NULL,0,1,0),(100,1,1,1,'Accounts',' Honesta oratio, Socratica, Platonis etiam. Ne amores quidem sanctos a sapiente alienos esse arbitrantur. Duo Reges: constructio interrete. Quae cum essent dicta, finem fecimus et ambulandi et disputandi. \n\n','2016-02-14 21:53:24','2016-02-14 22:53:25',NULL,NULL,0,1,0),(101,1,1,1,'Accounts',' Atqui iste locus est, Piso, tibi etiam atque etiam confirmandus, inquam; Sed ille, ut dixi, vitiose. Haec quo modo conveniant, non sane intellego. Quae cum magnifice primo dici viderentur, considerata minus probabantur. \n\n','2016-02-14 21:53:24','2016-02-14 22:53:25',NULL,NULL,0,1,0),(102,1,1,1,'Accounts',' Multoque hoc melius nos veriusque quam Stoici. Tum, Quintus et Pomponius cum idem se velle dixissent, Piso exorsus est. Duo Reges: constructio interrete. Huic mori optimum esse propter desperationem sapientiae, illi propter spem vivere. \n\n','2016-02-14 21:53:25','2016-02-14 22:53:26',NULL,NULL,0,1,0),(103,1,1,1,'Accounts',' Cur id non ita fit? Quorum altera prosunt, nocent altera. \n\n','2016-02-14 21:53:26','2016-02-14 22:53:26',NULL,NULL,0,1,0),(104,1,1,1,'Accounts',' Is es profecto tu. Ita relinquet duas, de quibus etiam atque etiam consideret. Duo Reges: constructio interrete. Duo enim genera quae erant, fecit tria. Quod autem satis est, eo quicquid accessit, nimium est; Quae cum magnifice primo dici viderentur, considerata minus probabantur. Animum autem reliquis rebus ita perfecit, ut corpus; Quid enim ab antiquis ex eo genere, quod ad disserendum valet, praetermissum est? \n\n','2016-02-14 21:53:27','2016-02-14 22:53:27',NULL,NULL,0,1,0),(105,1,1,1,'Accounts',' Philosophi autem in suis lectulis plerumque moriuntur. Sed ne, dum huic obsequor, vobis molestus sim. An eiusdem modi? Quae autem natura suae primae institutionis oblita est? Duo Reges: constructio interrete. Nihil opus est exemplis hoc facere longius. Cupiditates non Epicuri divisione finiebat, sed sua satietate. Quare hoc videndum est, possitne nobis hoc ratio philosophorum dare. Videamus animi partes, quarum est conspectus illustrior; Mihi enim erit isdem istis fortasse iam utendum. De hominibus dici non necesse est. Graecum enim hunc versum nostis omnes-: Suavis laborum est praeteritorum memoria. Sic enim censent, oportunitatis esse beate vivere. \n\n','2016-02-14 21:53:27','2016-02-14 22:53:27',NULL,NULL,0,1,0),(106,1,1,1,'Accounts',' Materiam vero rerum et copiam apud hos exilem, apud illos uberrimam reperiemus. Ut nemo dubitet, eorum omnia officia quo spectare, quid sequi, quid fugere debeant? Ita enim vivunt quidam, ut eorum vita refellatur oratio. Hic quoque suus est de summoque bono dissentiens dici vere Peripateticus non potest. Cupiditates non Epicuri divisione finiebat, sed sua satietate. Duo Reges: constructio interrete. Qui ita affectus, beatum esse numquam probabis; Ita multo sanguine profuso in laetitia et in victoria est mortuus. Non quam nostram quidem, inquit Pomponius iocans; \n\n','2016-02-14 21:53:28','2016-02-14 22:53:28',NULL,NULL,0,1,0),(107,1,1,1,'Accounts',' Tum ille timide vel potius verecunde: Facio, inquit. Respondeat totidem verbis. Mihi, inquam, qui te id ipsum rogavi? Scientiam pollicentur, quam non erat mirum sapientiae cupido patria esse cariorem. Duo Reges: constructio interrete. \n\n','2016-02-14 21:53:29','2016-02-14 22:53:28',NULL,NULL,0,1,0),(108,1,1,1,'Accounts',' At multis malis affectus. Vitiosum est enim in dividendo partem in genere numerare. \n\n','2016-02-14 21:53:29','2016-02-14 22:53:29',NULL,NULL,0,1,0),(109,1,1,1,'Accounts',' Tum mihi Piso: Quid ergo? Ita cum ea volunt retinere, quae superiori sententiae conveniunt, in Aristonem incidunt; Haec para/doca illi, nos admirabilia dicamus. Si id dicis, vicimus. Duo Reges: constructio interrete. Satis est ad hoc responsum. Ita credo. An eum discere ea mavis, quae cum plane perdidiceriti nihil sciat? \n\n','2016-02-14 21:53:30','2016-02-14 22:53:29',NULL,NULL,0,1,0),(110,1,1,1,'Accounts',' Qui non moveatur et offensione turpitudinis et comprobatione honestatis? Hos contra singulos dici est melius. Eadem nunc mea adversum te oratio est. Bonum valitudo: miser morbus. Duo Reges: constructio interrete. Isto modo ne improbos quidem, si essent boni viri. \n\n','2016-02-14 21:53:31','2016-02-14 22:53:29',NULL,NULL,0,1,0),(111,1,1,1,'Accounts',' Indicant pueri, in quibus ut in speculis natura cernitur. Sed haec quidem liberius ab eo dicuntur et saepius. Illa tamen simplicia, vestra versuta. Tu autem negas fortem esse quemquam posse, qui dolorem malum putet. Duo Reges: constructio interrete. \n\n','2016-02-14 21:53:31','2016-02-14 22:53:30',NULL,NULL,0,1,0),(112,1,1,1,'Accounts',' An tu me de L. An dolor longissimus quisque miserrimus, voluptatem non optabiliorem diuturnitas facit? Dic in quovis conventu te omnia facere, ne doleas. Duo Reges: constructio interrete. Nunc omni virtuti vitium contrario nomine opponitur. Ille vero, si insipiens-quo certe, quoniam tyrannus -, numquam beatus; Quod autem principium officii quaerunt, melius quam Pyrrho; Pauca mutat vel plura sane; \n\n','2016-02-14 21:53:32','2016-02-14 22:53:30',NULL,NULL,0,1,0),(113,1,1,1,'Accounts',' Ad eas enim res ab Epicuro praecepta dantur. Deinde disputat, quod cuiusque generis animantium statui deceat extremum. Atqui eorum nihil est eius generis, ut sit in fine atque extrerno bonorum. Vide, quantum, inquam, fallare, Torquate. Vestri haec verecundius, illi fortasse constantius. Duo Reges: constructio interrete. \n\n','2016-02-14 21:53:33','2016-02-14 22:53:31',NULL,NULL,0,1,0),(114,1,1,1,'Accounts',' Satis est ad hoc responsum. Non quaeritur autem quid naturae tuae consentaneum sit, sed quid disciplinae. Quos quidem tibi studiose et diligenter tractandos magnopere censeo. Dempta enim aeternitate nihilo beatior Iuppiter quam Epicurus; Duo enim genera quae erant, fecit tria. Duo Reges: constructio interrete. Si enim ad populum me vocas, eum. Idem iste, inquam, de voluptate quid sentit? \n\n','2016-02-14 21:53:34','2016-02-14 22:53:31',NULL,NULL,0,1,0),(115,1,1,1,'Accounts',' Et nemo nimium beatus est; Addidisti ad extremum etiam indoctum fuisse. Quodcumque in mentem incideret, et quodcumque tamquam occurreret. Innumerabilia dici possunt in hanc sententiam, sed non necesse est. Dicet pro me ipsa virtus nec dubitabit isti vestro beato M. Eam tum adesse, cum dolor omnis absit; Duo Reges: constructio interrete. Videamus animi partes, quarum est conspectus illustrior; Eiuro, inquit adridens, iniquum, hac quidem de re; Hoc est dicere: Non reprehenderem asotos, si non essent asoti. Quis hoc dicit? \n\n','2016-02-14 21:53:34','2016-02-14 22:53:31',NULL,NULL,0,1,0),(116,1,1,1,'Accounts',' Tamen aberramus a proposito, et, ne longius, prorsus, inquam, Piso, si ista mala sunt, placet. Atque his de rebus et splendida est eorum et illustris oratio. Sint modo partes vitae beatae. Quem Tiberina descensio festo illo die tanto gaudio affecit, quanto L. Potius inflammat, ut coercendi magis quam dedocendi esse videantur. Certe, nisi voluptatem tanti aestimaretis. \n\n','2016-02-14 21:53:35','2016-02-14 22:53:32',NULL,NULL,0,1,0),(117,1,1,1,'Accounts',' Sed ea mala virtuti magnitudine obruebantur. Si autem id non concedatur, non continuo vita beata tollitur. Utilitatis causa amicitia est quaesita. Conclusum est enim contra Cyrenaicos satis acute, nihil ad Epicurum. Duo Reges: constructio interrete. Graece donan, Latine voluptatem vocant. \n\n','2016-02-14 21:53:36','2016-02-14 22:53:32',NULL,NULL,0,1,0),(118,1,1,1,'Accounts',' Polemoni et iam ante Aristoteli ea prima visa sunt, quae paulo ante dixi. Qua ex cognitione facilior facta est investigatio rerum occultissimarum. Habes, inquam, Cato, formam eorum, de quibus loquor, philosophorum. Explanetur igitur. \n\n','2016-02-14 21:53:36','2016-02-14 22:53:33',NULL,NULL,0,1,0),(119,1,1,1,'Accounts',' Num igitur utiliorem tibi hunc Triarium putas esse posse, quam si tua sint Puteolis granaria? Quippe: habes enim a rhetoribus; Duo Reges: constructio interrete. An eum discere ea mavis, quae cum plane perdidiceriti nihil sciat? \n\n','2016-02-14 21:53:37','2016-02-14 22:53:33',NULL,NULL,0,1,0),(120,1,1,1,'Accounts',' Itaque hoc frequenter dici solet a vobis, non intellegere nos, quam dicat Epicurus voluptatem. Et hunc idem dico, inquieta sed ad virtutes et ad vitia nihil interesse. Cum praesertim illa perdiscere ludus esset. Tum ille: Tu autem cum ipse tantum librorum habeas, quos hic tandem requiris? \n\n','2016-02-14 21:53:38','2016-02-14 22:53:33',NULL,NULL,0,1,0),(121,1,1,1,'Accounts',' Dicam, inquam, et quidem discendi causa magis, quam quo te aut Epicurum reprehensum velim. Ut alios omittam, hunc appello, quem ille unum secutus est. Scientiam pollicentur, quam non erat mirum sapientiae cupido patria esse cariorem. Duo Reges: constructio interrete. Sed tempus est, si videtur, et recta quidem ad me. Memini vero, inquam; Si quidem, inquit, tollerem, sed relinquo. \n\n','2016-02-14 21:53:38','2016-02-14 22:53:34',NULL,NULL,0,1,0),(122,1,1,1,'Accounts',' Aliter enim explicari, quod quaeritur, non potest. Si quicquam extra virtutem habeatur in bonis. Ita ne hoc quidem modo paria peccata sunt. At ille pellit, qui permulcet sensum voluptate. Neque solum ea communia, verum etiam paria esse dixerunt. Utrum igitur tibi litteram videor an totas paginas commovere? Duo Reges: constructio interrete. Itaque hic ipse iam pridem est reiectus; \n\n','2016-02-14 21:53:39','2016-02-14 22:53:34',NULL,NULL,0,1,0),(123,1,1,1,'Accounts',' Tu autem negas fortem esse quemquam posse, qui dolorem malum putet. Illud dico, ea, quae dicat, praeclare inter se cohaerere. Duo Reges: constructio interrete. Dicet pro me ipsa virtus nec dubitabit isti vestro beato M. Bona autem corporis huic sunt, quod posterius posui, similiora. Scio enim esse quosdam, qui quavis lingua philosophari possint; Qua tu etiam inprudens utebare non numquam. Scaevola tribunus plebis ferret ad plebem vellentne de ea re quaeri. Sed haec omittamus; Satis est ad hoc responsum. \n\n','2016-02-14 21:53:40','2016-02-14 22:53:35',NULL,NULL,0,1,0),(124,1,1,1,'Accounts',' Si alia sentit, inquam, alia loquitur, numquam intellegam quid sentiat; Bonum valitudo: miser morbus. Est enim tanti philosophi tamque nobilis audacter sua decreta defendere. Quamquam tu hanc copiosiorem etiam soles dicere. De vacuitate doloris eadem sententia erit. Duo Reges: constructio interrete. Nunc de hominis summo bono quaeritur; Quis istum dolorem timet? \n\n','2016-02-14 21:53:41','2016-02-14 22:53:36',NULL,NULL,0,1,0),(125,1,1,1,'Accounts',' Inscite autem medicinae et gubernationis ultimum cum ultimo sapientiae comparatur. Bestiarum vero nullum iudicium puto. Itaque hic ipse iam pridem est reiectus; Ratio quidem vestra sic cogit. Duo Reges: constructio interrete. At cum de plurimis eadem dicit, tum certe de maximis. Callipho ad virtutem nihil adiunxit nisi voluptatem, Diodorus vacuitatem doloris. \n\n','2016-02-14 21:53:41','2016-02-14 22:53:36',NULL,NULL,0,1,0),(126,1,1,1,'Accounts',' Invidiosum nomen est, infame, suspectum. Dic in quovis conventu te omnia facere, ne doleas. Isto modo ne improbos quidem, si essent boni viri. Summum ením bonum exposuit vacuitatem doloris; Duo Reges: constructio interrete. Atqui iste locus est, Piso, tibi etiam atque etiam confirmandus, inquam; \n\n','2016-02-14 21:53:42','2016-02-14 22:53:37',NULL,NULL,0,1,0),(127,1,1,1,'Accounts',' Est, ut dicis, inquam. Potius inflammat, ut coercendi magis quam dedocendi esse videantur. Erit enim mecum, si tecum erit. Ego vero isti, inquam, permitto. Nihil opus est exemplis hoc facere longius. Bestiarum vero nullum iudicium puto. \n\n','2016-02-14 21:53:43','2016-02-14 22:53:37',NULL,NULL,0,1,0),(128,1,1,1,'Accounts',' Negat esse eam, inquit, propter se expetendam. Velut ego nunc moveor. Omnes enim iucundum motum, quo sensus hilaretur. Philosophi autem in suis lectulis plerumque moriuntur. Scientiam pollicentur, quam non erat mirum sapientiae cupido patria esse cariorem. Non quaeritur autem quid naturae tuae consentaneum sit, sed quid disciplinae. Satis est tibi in te, satis in legibus, satis in mediocribus amicitiis praesidii. Duo Reges: constructio interrete. Ut aliquid scire se gaudeant? \n\n','2016-02-14 21:53:44','2016-02-14 22:53:37',NULL,NULL,0,1,0),(129,1,1,1,'Accounts',' Eorum enim omnium multa praetermittentium, dum eligant aliquid, quod sequantur, quasi curta sententia; Piso, familiaris noster, et alia multa et hoc loco Stoicos irridebat: Quid enim? Hoc Hieronymus summum bonum esse dixit. Duo Reges: constructio interrete. Cum id quoque, ut cupiebat, audivisset, evelli iussit eam, qua erat transfixus, hastam. Nam Pyrrho, Aristo, Erillus iam diu abiecti. Age sane, inquam. Quis Aristidem non mortuum diligit? \n\n','2016-02-14 21:53:44','2016-02-14 22:53:38',NULL,NULL,0,1,0),(130,1,1,1,'Accounts',' Sed hoc sane concedamus. Quis animo aequo videt eum, quem inpure ac flagitiose putet vivere? Tum, Quintus et Pomponius cum idem se velle dixissent, Piso exorsus est. Quis non odit sordidos, vanos, leves, futtiles? Apparet statim, quae sint officia, quae actiones. Duo Reges: constructio interrete. Scio enim esse quosdam, qui quavis lingua philosophari possint; Compensabatur, inquit, cum summis doloribus laetitia. Quis enim redargueret? Hanc ergo intuens debet institutum illud quasi signum absolvere. \n\n','2016-02-14 21:53:45','2016-02-14 22:53:38',NULL,NULL,0,1,0),(131,1,1,1,'Accounts',' Apud ceteros autem philosophos, qui quaesivit aliquid, tacet; Atqui, inquit, si Stoicis concedis ut virtus sola, si adsit vitam efficiat beatam, concedis etiam Peripateticis. Quid vero? \n\n','2016-02-14 21:53:46','2016-02-14 22:53:39',NULL,NULL,0,1,0),(132,1,1,1,'Accounts',' Atque haec ita iustitiae propria sunt, ut sint virtutum reliquarum communia. Quae hic rei publicae vulnera inponebat, eadem ille sanabat. Quid enim est a Chrysippo praetermissum in Stoicis? Nonne videmus quanta perturbatio rerum omnium consequatur, quanta confusio? Quid enim me prohiberet Epicureum esse, si probarem, quae ille diceret? Quod si ita se habeat, non possit beatam praestare vitam sapientia. Duo Reges: constructio interrete. Sed tamen est aliquid, quod nobis non liceat, liceat illis. Istic sum, inquit. Eiuro, inquit adridens, iniquum, hac quidem de re; Hoc ne statuam quidem dicturam pater aiebat, si loqui posset. \n\n','2016-02-14 21:53:46','2016-02-14 22:53:39',NULL,NULL,0,1,0),(133,1,1,1,'Accounts',' Negat esse eam, inquit, propter se expetendam. Quae enim adhuc protulisti, popularia sunt, ego autem a te elegantiora desidero. Ergo adhuc, quantum equidem intellego, causa non videtur fuisse mutandi nominis. Quaesita enim virtus est, non quae relinqueret naturam, sed quae tueretur. Ut in geometria, prima si dederis, danda sunt omnia. Itaque dicunt nec dubitant: mihi sic usus est, tibi ut opus est facto, fac. Bonum liberi: misera orbitas. Duo Reges: constructio interrete. \n\n','2016-02-14 21:53:47','2016-02-14 22:53:39',NULL,NULL,0,1,0),(134,1,1,1,'Accounts',' Tum Piso: Quoniam igitur aliquid omnes, quid Lucius noster? Sin tantum modo ad indicia veteris memoriae cognoscenda, curiosorum. Minime vero istorum quidem, inquit. Duo Reges: constructio interrete. Teneo, inquit, finem illi videri nihil dolere. Deinde disputat, quod cuiusque generis animantium statui deceat extremum. Et ille ridens: Video, inquit, quid agas; Claudii libidini, qui tum erat summo ne imperio, dederetur. \n\n','2016-02-14 21:53:48','2016-02-14 22:53:40',NULL,NULL,0,1,0),(135,1,1,1,'Accounts',' Rhetorice igitur, inquam, nos mavis quam dialectice disputare? Ita multo sanguine profuso in laetitia et in victoria est mortuus. Sed tamen est aliquid, quod nobis non liceat, liceat illis. Illi enim inter se dissentiunt. At modo dixeras nihil in istis rebus esse, quod interesset. Duo Reges: constructio interrete. Sic enim censent, oportunitatis esse beate vivere. \n\n','2016-02-14 21:53:48','2016-02-14 22:53:40',NULL,NULL,0,1,0),(136,1,1,1,'Accounts',' Idemque diviserunt naturam hominis in animum et corpus. Sic enim censent, oportunitatis esse beate vivere. Tum Piso: Quoniam igitur aliquid omnes, quid Lucius noster? Duo Reges: constructio interrete. Hanc quoque iucunditatem, si vis, transfer in animum; \n\n','2016-02-14 21:53:49','2016-02-14 22:53:41',NULL,NULL,0,1,0),(137,1,1,1,'Accounts',' Quid sequatur, quid repugnet, vident. Scisse enim te quis coarguere possit? Quid est igitur, cur ita semper deum appellet Epicurus beatum et aeternum? \n\n','2016-02-14 21:53:50','2016-02-14 22:53:41',NULL,NULL,0,1,0),(138,1,1,1,'Accounts',' Quem ad modum quis ambulet, sedeat, qui ductus oris, qui vultus in quoque sit? Duo Reges: constructio interrete. Neque solum ea communia, verum etiam paria esse dixerunt. Multoque hoc melius nos veriusque quam Stoici. Videamus animi partes, quarum est conspectus illustrior; \n\n','2016-02-14 21:53:51','2016-02-14 22:53:42',NULL,NULL,0,1,0),(139,1,1,1,'Accounts',' Aliter enim explicari, quod quaeritur, non potest. Primum in nostrane potestate est, quid meminerimus? Expressa vero in iis aetatibus, quae iam confirmatae sunt. Duo Reges: constructio interrete. Minime vero, inquit ille, consentit. \n\n','2016-02-14 21:53:51','2016-02-14 22:53:42',NULL,NULL,0,1,0),(140,1,1,1,'Accounts',' An est aliquid per se ipsum flagitiosum, etiamsi nulla comitetur infamia? Qualem igitur hominem natura inchoavit? \n\n','2016-02-14 21:53:52','2016-02-14 22:53:42',NULL,NULL,0,1,0),(141,1,1,1,'Accounts',' Eam stabilem appellas. Sed haec quidem liberius ab eo dicuntur et saepius. Atque hoc loco similitudines eas, quibus illi uti solent, dissimillimas proferebas. Quis non odit sordidos, vanos, leves, futtiles? Habent enim et bene longam et satis litigiosam disputationem. \n\n','2016-02-14 21:53:53','2016-02-14 22:53:43',NULL,NULL,0,1,0),(142,1,1,1,'Accounts',' Nescio quo modo praetervolavit oratio. Duo Reges: constructio interrete. Itaque ab his ordiamur. Quae animi affectio suum cuique tribuens atque hanc, quam dico. Sed erat aequius Triarium aliquid de dissensione nostra iudicare. Quae contraria sunt his, malane? \n\n','2016-02-14 21:53:53','2016-02-14 22:53:43',NULL,NULL,0,1,0),(143,1,1,1,'Accounts',' Est tamen ea secundum naturam multoque nos ad se expetendam magis hortatur quam superiora omnia. Inde sermone vario sex illa a Dipylo stadia confecimus. Quamquam te quidem video minime esse deterritum. \n\n','2016-02-14 21:53:54','2016-02-14 22:53:44',NULL,NULL,0,1,0),(144,1,1,1,'Accounts',' Illi enim inter se dissentiunt. Videmus igitur ut conquiescere ne infantes quidem possint. Bestiarum vero nullum iudicium puto. Tibi hoc incredibile, quod beatissimum. Quia nec honesto quic quam honestius nec turpi turpius. Duo Reges: constructio interrete. Sed ne, dum huic obsequor, vobis molestus sim. Qualem igitur hominem natura inchoavit? Quid ergo attinet dicere: Nihil haberem, quod reprehenderem, si finitas cupiditates haberent? Isto modo, ne si avia quidem eius nata non esset. \n\n','2016-02-14 21:53:55','2016-02-14 22:53:44',NULL,NULL,0,1,0),(145,1,1,1,'Accounts',' Nos autem non solum beatae vitae istam esse oblectationem videmus, sed etiam levamentum miseriarum. Qui enim existimabit posse se miserum esse beatus non erit. Duo Reges: constructio interrete. Hoc loco tenere se Triarius non potuit. Quamvis enim depravatae non sint, pravae tamen esse possunt. Magni enim aestimabat pecuniam non modo non contra leges, sed etiam legibus partam. Nam illud vehementer repugnat, eundem beatum esse et multis malis oppressum. Tu autem negas fortem esse quemquam posse, qui dolorem malum putet. \n\n','2016-02-14 21:53:55','2016-02-14 22:53:45',NULL,NULL,0,1,0),(146,1,1,1,'Accounts',' Illi enim inter se dissentiunt. Non potes, nisi retexueris illa. Aliena dixit in physicis nec ea ipsa, quae tibi probarentur; Duo Reges: constructio interrete. Hoc dictum in una re latissime patet, ut in omnibus factis re, non teste moveamur. \n\n','2016-02-14 21:53:56','2016-02-14 22:53:45',NULL,NULL,0,1,0),(147,1,1,1,'Accounts',' Fortasse id optimum, sed ubi illud: Plus semper voluptatis? Ea possunt paria non esse. Nihil acciderat ei, quod nollet, nisi quod anulum, quo delectabatur, in mari abiecerat. Quasi ego id curem, quid ille aiat aut neget. \n\n','2016-02-14 21:53:57','2016-02-14 22:53:46',NULL,NULL,0,1,0),(148,1,1,1,'Accounts',' Mihi, inquam, qui te id ipsum rogavi? Duarum enim vitarum nobis erunt instituta capienda. Haec para/doca illi, nos admirabilia dicamus. Dici enim nihil potest verius. Illud non continuo, ut aeque incontentae. Duo Reges: constructio interrete. Eaedem enim utilitates poterunt eas labefactare atque pervertere. Quid de Platone aut de Democrito loquar? \n\n','2016-02-14 21:53:58','2016-02-14 22:53:47',NULL,NULL,0,1,0),(149,1,1,1,'Accounts',' Quae contraria sunt his, malane? Igitur neque stultorum quisquam beatus neque sapientium non beatus. Atque ab his initiis profecti omnium virtutum et originem et progressionem persecuti sunt. Id et fieri posse et saepe esse factum et ad voluptates percipiendas maxime pertinere. Duo Reges: constructio interrete. Ita relinquet duas, de quibus etiam atque etiam consideret. \n\n','2016-02-14 21:53:58','2016-02-14 22:53:47',NULL,NULL,0,1,0),(150,1,1,1,'Accounts',' Teneo, inquit, finem illi videri nihil dolere. Non pugnem cum homine, cur tantum habeat in natura boni; Varietates autem iniurasque fortunae facile veteres philosophorum praeceptis instituta vita superabat. Efficiens dici potest. Habent enim et bene longam et satis litigiosam disputationem. Ergo illi intellegunt quid Epicurus dicat, ego non intellego? Multa sunt dicta ab antiquis de contemnendis ac despiciendis rebus humanis; Duo Reges: constructio interrete. At ego quem huic anteponam non audeo dicere; \n\n','2016-02-14 21:53:59','2016-02-14 22:53:48',NULL,NULL,0,1,0),(151,1,1,1,'Accounts',' Naturales divitias dixit parabiles esse, quod parvo esset natura contenta. Maximas vero virtutes iacere omnis necesse est voluptate dominante. Sit sane ista voluptas. Nam quid possumus facere melius? Duo Reges: constructio interrete. Ut alios omittam, hunc appello, quem ille unum secutus est. \n\n','2016-02-14 21:54:00','2016-02-14 22:53:48',NULL,NULL,0,1,0),(152,1,1,1,'Accounts',' Quid, si etiam iucunda memoria est praeteritorum malorum? Neque solum ea communia, verum etiam paria esse dixerunt. Sapiens autem semper beatus est et est aliquando in dolore; Facillimum id quidem est, inquam. Duo Reges: constructio interrete. At enim hic etiam dolore. \n\n','2016-02-14 21:54:00','2016-02-14 22:53:49',NULL,NULL,0,1,0),(153,1,1,1,'Accounts',' Deinde disputat, quod cuiusque generis animantium statui deceat extremum. Ait enim se, si uratur, Quam hoc suave! dicturum. Summum ením bonum exposuit vacuitatem doloris; Duo Reges: constructio interrete. Eadem nunc mea adversum te oratio est. Etenim semper illud extra est, quod arte comprehenditur. \n\n','2016-02-14 21:54:01','2016-02-14 22:53:49',NULL,NULL,0,1,0),(154,1,1,1,'Accounts',' Non igitur de improbo, sed de callido improbo quaerimus, qualis Q. Quem Tiberina descensio festo illo die tanto gaudio affecit, quanto L. Duo Reges: constructio interrete. Idcirco enim non desideraret, quia, quod dolore caret, id in voluptate est. Utinam quidem dicerent alium alio beatiorem! Iam ruinas videres. Scientiam pollicentur, quam non erat mirum sapientiae cupido patria esse cariorem. Non est ista, inquam, Piso, magna dissensio. Quae quo sunt excelsiores, eo dant clariora indicia naturae. \n\n','2016-02-14 21:54:02','2016-02-14 22:53:49',NULL,NULL,0,1,0),(155,1,1,1,'Accounts',' Tu vero, inquam, ducas licet, si sequetur; Et quod est munus, quod opus sapientiae? At hoc in eo M. Potius inflammat, ut coercendi magis quam dedocendi esse videantur. Cum id fugiunt, re eadem defendunt, quae Peripatetici, verba. Non enim, si omnia non sequebatur, idcirco non erat ortus illinc. Quod quidem iam fit etiam in Academia. Duo Reges: constructio interrete. \n\n','2016-02-14 21:54:03','2016-02-14 22:53:50',NULL,NULL,0,1,0),(156,1,1,1,'Accounts',' Sed plane dicit quod intellegit. Ut in voluptate sit, qui epuletur, in dolore, qui torqueatur. \n\n','2016-02-14 21:54:03','2016-02-14 22:53:50',NULL,NULL,0,1,0),(157,1,1,1,'Accounts',' Sed fortuna fortis; An dubium est, quin virtus ita maximam partem optineat in rebus humanis, ut reliquas obruat? Duo Reges: constructio interrete. Primum Theophrasti, Strato, physicum se voluit; Sed quia studebat laudi et dignitati, multum in virtute processerat. At iam decimum annum in spelunca iacet. At hoc in eo M. \n\n','2016-02-14 21:54:04','2016-02-14 22:53:51',NULL,NULL,0,1,0),(158,1,1,1,'Accounts',' Tum Quintus: Est plane, Piso, ut dicis, inquit. Quid de Platone aut de Democrito loquar? Utrum igitur tibi litteram videor an totas paginas commovere? Ergo id est convenienter naturae vivere, a natura discedere. \n\n','2016-02-14 21:54:05','2016-02-14 22:53:51',NULL,NULL,0,1,0),(159,1,1,1,'Accounts',' Quae si potest singula consolando levare, universa quo modo sustinebit? Ad corpus diceres pertinere-, sed ea, quae dixi, ad corpusne refers? Putabam equidem satis, inquit, me dixisse. Cum praesertim illa perdiscere ludus esset. Nam Pyrrho, Aristo, Erillus iam diu abiecti. Mihi enim satis est, ipsis non satis. An me, inquis, tam amentem putas, ut apud imperitos isto modo loquar? Duo Reges: constructio interrete. Hoc enim identidem dicitis, non intellegere nos quam dicatis voluptatem. \n\n','2016-02-14 21:54:05','2016-02-14 22:53:52',NULL,NULL,0,1,0),(160,1,1,1,'Accounts',' Mihi vero, inquit, placet agi subtilius et, ut ipse dixisti, pressius. Videamus igitur sententias eorum, tum ad verba redeamus. An me, inquam, nisi te audire vellem, censes haec dicturum fuisse? Conferam tecum, quam cuique verso rem subicias; Duo Reges: constructio interrete. Tollitur beneficium, tollitur gratia, quae sunt vincla concordiae. Cur igitur, inquam, res tam dissimiles eodem nomine appellas? \n\n','2016-02-14 21:54:06','2016-02-14 22:53:52',NULL,NULL,0,1,0),(161,1,1,1,'Accounts',' Duo enim genera quae erant, fecit tria. Dic in quovis conventu te omnia facere, ne doleas. Utrum igitur tibi litteram videor an totas paginas commovere? Fortasse id optimum, sed ubi illud: Plus semper voluptatis? Ita nemo beato beatior. Duo Reges: constructio interrete. \n\n','2016-02-14 21:54:07','2016-02-14 22:53:52',NULL,NULL,0,1,0),(162,1,1,1,'Accounts',' Et quidem iure fortasse, sed tamen non gravissimum est testimonium multitudinis. Cuius quidem, quoniam Stoicus fuit, sententia condemnata mihi videtur esse inanitas ista verborum. Nobis aliter videtur, recte secusne, postea; Quae cum dixisset paulumque institisset, Quid est? Portenta haec esse dicit, neque ea ratione ullo modo posse vivi; Quis suae urbis conservatorem Codrum, quis Erechthei filias non maxime laudat? Duo Reges: constructio interrete. Negat esse eam, inquit, propter se expetendam. Ut in geometria, prima si dederis, danda sunt omnia. Neque enim civitas in seditione beata esse potest nec in discordia dominorum domus; \n\n','2016-02-14 21:54:08','2016-02-14 22:53:53',NULL,NULL,0,1,0),(163,1,1,1,'Accounts',' Duo Reges: constructio interrete. Dempta enim aeternitate nihilo beatior Iuppiter quam Epicurus; Ut optime, secundum naturam affectum esse possit. Age, inquies, ista parva sunt. Quos quidem tibi studiose et diligenter tractandos magnopere censeo. Apud ceteros autem philosophos, qui quaesivit aliquid, tacet; Bestiarum vero nullum iudicium puto. \n\n','2016-02-14 21:54:08','2016-02-14 22:53:53',NULL,NULL,0,1,0),(164,1,1,1,'Accounts',' Duarum enim vitarum nobis erunt instituta capienda. Sed tamen intellego quid velit. Sed ad bona praeterita redeamus. Duo Reges: constructio interrete. Post enim Chrysippum eum non sane est disputatum. Certe, nisi voluptatem tanti aestimaretis. Si verbum sequimur, primum longius verbum praepositum quam bonum. \n\n','2016-02-14 21:54:09','2016-02-14 22:53:54',NULL,NULL,0,1,0),(165,1,1,1,'Accounts',' Idem adhuc; Qui-vere falsone, quaerere mittimus-dicitur oculis se privasse; Aliter enim nosmet ipsos nosse non possumus. Ergo id est convenienter naturae vivere, a natura discedere. Bestiarum vero nullum iudicium puto. Nihil opus est exemplis hoc facere longius. Illud non continuo, ut aeque incontentae. Huius, Lyco, oratione locuples, rebus ipsis ielunior. \n\n','2016-02-14 21:54:10','2016-02-14 22:53:54',NULL,NULL,0,1,0),(166,1,1,1,'Accounts',' Contemnit enim disserendi elegantiam, confuse loquitur. Quod cum accidisset ut alter alterum necopinato videremus, surrexit statim. Virtutis, magnitudinis animi, patientiae, fortitudinis fomentis dolor mitigari solet. Scio enim esse quosdam, qui quavis lingua philosophari possint; Huius ego nunc auctoritatem sequens idem faciam. Multoque hoc melius nos veriusque quam Stoici. \n\n','2016-02-14 21:54:11','2016-02-14 22:53:54',NULL,NULL,0,1,0),(167,1,1,1,'Accounts',' Haec para/doca illi, nos admirabilia dicamus. Si longus, levis dictata sunt. Equidem etiam Epicurum, in physicis quidem, Democriteum puto. Que Manilium, ab iisque M. An eum discere ea mavis, quae cum plane perdidiceriti nihil sciat? \n\n','2016-02-14 21:54:12','2016-02-14 22:53:55',NULL,NULL,0,1,0),(168,1,1,1,'Accounts',' Videsne quam sit magna dissensio? Cur igitur easdem res, inquam, Peripateticis dicentibus verbum nullum est, quod non intellegatur? Sin kakan malitiam dixisses, ad aliud nos unum certum vitium consuetudo