sequebatur, per se ipsa curabit? Quod cum accidisset ut alter alterum necopinato videremus, surrexit statim. Qui-vere falsone, quaerere mittimus-dicitur oculis se privasse; Teneo, inquit, finem illi videri nihil dolere. Duo Reges: constructio interrete. Etenim semper illud extra est, quod arte comprehenditur. Hoc mihi cum tuo fratre convenit. Quo studio Aristophanem putamus aetatem in litteris duxisse? \n\n','2016-02-14 21:54:16','2016-02-14 22:53:58',NULL,NULL,0,1,0),(174,1,1,1,'Accounts',' Duo Reges: constructio interrete. Quae ista amicitia est? Idemque diviserunt naturam hominis in animum et corpus. Contemnit enim disserendi elegantiam, confuse loquitur. An tu me de L. Esse enim, nisi eris, non potes. Cum praesertim illa perdiscere ludus esset. Itaque nostrum est-quod nostrum dico, artis est-ad ea principia, quae accepimus. \n\n','2016-02-14 21:54:17','2016-02-14 22:53:59',NULL,NULL,0,1,0),(175,1,1,1,'Accounts',' Si enim ita est, vide ne facinus facias, cum mori suadeas. Duo Reges: constructio interrete. At hoc in eo M. Quid ei reliquisti, nisi te, quoquo modo loqueretur, intellegere, quid diceret? \n\n','2016-02-14 21:54:18','2016-02-14 22:53:59',NULL,NULL,0,1,0),(176,1,1,1,'Accounts',' Laboro autem non sine causa; Sumenda potius quam expetenda. Sed eum qui audiebant, quoad poterant, defendebant sententiam suam. Hic nihil fuit, quod quaereremus. Nam adhuc, meo fortasse vitio, quid ego quaeram non perspicis. Quod si ita se habeat, non possit beatam praestare vitam sapientia. Cum audissem Antiochum, Brute, ut solebam, cum M. Duo Reges: constructio interrete. Deinde prima illa, quae in congressu solemus: Quid tu, inquit, huc? \n\n','2016-02-14 21:54:18','2016-02-14 22:53:59',NULL,NULL,0,1,0),(177,1,1,1,'Accounts',' Quamquam te quidem video minime esse deterritum. Itaque sensibus rationem adiunxit et ratione effecta sensus non reliquit. Aliud igitur esse censet gaudere, aliud non dolere. Duo Reges: constructio interrete. Cur igitur easdem res, inquam, Peripateticis dicentibus verbum nullum est, quod non intellegatur? Hic quoque suus est de summoque bono dissentiens dici vere Peripateticus non potest. Deinde prima illa, quae in congressu solemus: Quid tu, inquit, huc? Cum id fugiunt, re eadem defendunt, quae Peripatetici, verba. De vacuitate doloris eadem sententia erit. \n\n','2016-02-14 21:54:19','2016-02-14 22:54:00',NULL,NULL,0,1,0),(178,1,1,1,'Accounts',' Qui ita affectus, beatum esse numquam probabis; Videamus animi partes, quarum est conspectus illustrior; Potius inflammat, ut coercendi magis quam dedocendi esse videantur. Neque solum ea communia, verum etiam paria esse dixerunt. Ita relinquet duas, de quibus etiam atque etiam consideret. Duo Reges: constructio interrete. Sed in rebus apertissimis nimium longi sumus. Causa autem fuit huc veniendi ut quosdam hinc libros promerem. \n\n','2016-02-14 21:54:20','2016-02-14 22:54:00',NULL,NULL,0,1,0),(179,1,1,1,'Accounts',' Quodsi vultum tibi, si incessum fingeres, quo gravior viderere, non esses tui similis; Dicet pro me ipsa virtus nec dubitabit isti vestro beato M. Duo Reges: constructio interrete. Quo igitur, inquit, modo? \n\n','2016-02-14 21:54:21','2016-02-14 22:54:01',NULL,NULL,0,1,0),(180,1,1,1,'Accounts',' Et quod est munus, quod opus sapientiae? Istam voluptatem, inquit, Epicurus ignorat? Negat enim summo bono afferre incrementum diem. Nec lapathi suavitatem acupenseri Galloni Laelius anteponebat, sed suavitatem ipsam neglegebat; Duo Reges: constructio interrete. \n\n','2016-02-14 21:54:21','2016-02-14 22:54:01',NULL,NULL,0,1,0),(181,1,1,1,'Accounts',' An potest, inquit ille, quicquam esse suavius quam nihil dolere? At iam decimum annum in spelunca iacet. Urgent tamen et nihil remittunt. Huic mori optimum esse propter desperationem sapientiae, illi propter spem vivere. Respondent extrema primis, media utrisque, omnia omnibus. Duo Reges: constructio interrete. Quia dolori non voluptas contraria est, sed doloris privatio. Quod ea non occurrentia fingunt, vincunt Aristonem; \n\n','2016-02-14 21:54:22','2016-02-14 22:54:01',NULL,NULL,0,1,0),(182,1,1,1,'Accounts',' Quem si tenueris, non modo meum Ciceronem, sed etiam me ipsum abducas licebit. Est igitur officium eius generis, quod nec in bonis ponatur nec in contrariis. Sextilio Rufo, cum is rem ad amicos ita deferret, se esse heredem Q. Confecta res esset. Oratio me istius philosophi non offendit; Quae diligentissime contra Aristonem dicuntur a Chryippo. Venit ad extremum; Duo Reges: constructio interrete. \n\n','2016-02-14 21:54:23','2016-02-14 22:54:02',NULL,NULL,0,1,0),(183,1,1,1,'Accounts',' Uterque enim summo bono fruitur, id est voluptate. Itaque primos congressus copulationesque et consuetudinum instituendarum voluntates fieri propter voluptatem; Gloriosa ostentatio in constituendo summo bono. Nos quidem Virtutes sic natae sumus, ut tibi serviremus, aliud negotii nihil habemus. Duo Reges: constructio interrete. Quod totum contra est. \n\n','2016-02-14 21:54:23','2016-02-14 22:54:02',NULL,NULL,0,1,0),(184,1,1,1,'Accounts',' Sin laboramus, quis est, qui alienae modum statuat industriae? Iubet igitur nos Pythius Apollo noscere nosmet ipsos. Quod ea non occurrentia fingunt, vincunt Aristonem; Duo Reges: constructio interrete. Uterque enim summo bono fruitur, id est voluptate. Hoc est non dividere, sed frangere. Quid, cum fictas fabulas, e quibus utilitas nulla elici potest, cum voluptate legimus? Nam Pyrrho, Aristo, Erillus iam diu abiecti. Sint modo partes vitae beatae. Aliter enim explicari, quod quaeritur, non potest. \n\n','2016-02-14 21:54:24','2016-02-14 22:54:03',NULL,NULL,0,1,0),(185,1,1,1,'Accounts',' Qui ita affectus, beatum esse numquam probabis; Sed haec nihil sane ad rem; Duo Reges: constructio interrete. Sed quid sentiat, non videtis. Sed mehercule pergrata mihi oratio tua. Primum in nostrane potestate est, quid meminerimus? Si qua in iis corrigere voluit, deteriora fecit. Gerendus est mos, modo recte sentiat. \n\n','2016-02-14 21:54:25','2016-02-14 22:54:03',NULL,NULL,0,1,0),(186,1,1,1,'Accounts',' Idem iste, inquam, de voluptate quid sentit? Nemo igitur esse beatus potest. Efficiens dici potest. \n\n','2016-02-14 21:54:26','2016-02-14 22:54:04',NULL,NULL,0,1,0),(187,1,1,1,'Accounts',' Cave putes quicquam esse verius. Simus igitur contenti his. Propter nos enim illam, non propter eam nosmet ipsos diligimus. Inscite autem medicinae et gubernationis ultimum cum ultimo sapientiae comparatur. Ut non sine causa ex iis memoriae ducta sit disciplina. \n\n','2016-02-14 21:54:26','2016-02-14 22:54:04',NULL,NULL,0,1,0),(188,1,1,1,'Accounts',' Facit igitur Lucius noster prudenter, qui audire de summo bono potissimum velit; Quo tandem modo? Haec quo modo conveniant, non sane intellego. \n\n','2016-02-14 21:54:27','2016-02-14 22:54:05',NULL,NULL,0,1,0),(189,1,1,1,'Accounts',' Sed haec in pueris; Sed eum qui audiebant, quoad poterant, defendebant sententiam suam. Legimus tamen Diogenem, Antipatrum, Mnesarchum, Panaetium, multos alios in primisque familiarem nostrum Posidonium. Tubulo putas dicere? Qualem igitur hominem natura inchoavit? Dicet pro me ipsa virtus nec dubitabit isti vestro beato M. Quae quidem sapientes sequuntur duce natura tamquam videntes; Duo Reges: constructio interrete. Quae fere omnia appellantur uno ingenii nomine, easque virtutes qui habent, ingeniosi vocantur. \n\n','2016-02-14 21:54:28','2016-02-14 22:54:05',NULL,NULL,0,1,0),(190,1,1,1,'Accounts',' Egone non intellego, quid sit don Graece, Latine voluptas? Philosophi autem in suis lectulis plerumque moriuntur. \n\n','2016-02-14 21:54:29','2016-02-14 22:54:06',NULL,NULL,0,1,0),(191,1,1,1,'Accounts',' Videamus igitur sententias eorum, tum ad verba redeamus. Quam si explicavisset, non tam haesitaret. Omnia contraria, quos etiam insanos esse vultis. Hanc quoque iucunditatem, si vis, transfer in animum; Duo Reges: constructio interrete. In his igitur partibus duabus nihil erat, quod Zeno commutare gestiret. Quid ad utilitatem tantae pecuniae? \n\n','2016-02-14 21:54:30','2016-02-14 22:54:06',NULL,NULL,0,1,0),(192,1,1,1,'Accounts',' A mene tu? Illum mallem levares, quo optimum atque humanissimum virum, Cn. Videamus igitur sententias eorum, tum ad verba redeamus. Ut non sine causa ex iis memoriae ducta sit disciplina. Nam Pyrrho, Aristo, Erillus iam diu abiecti. Duo Reges: constructio interrete. Sed ad bona praeterita redeamus. Certe nihil nisi quod possit ipsum propter se iure laudari. Omnes enim iucundum motum, quo sensus hilaretur. \n\n','2016-02-14 21:54:30','2016-02-14 22:54:06',NULL,NULL,0,1,0),(193,1,1,1,'Accounts',' Suo genere perveniant ad extremum; Diodorus, eius auditor, adiungit ad honestatem vacuitatem doloris. Virtutis, magnitudinis animi, patientiae, fortitudinis fomentis dolor mitigari solet. His enim rebus detractis negat se reperire in asotorum vita quod reprehendat. At iste non dolendi status non vocatur voluptas. Quod quidem iam fit etiam in Academia. Duo Reges: constructio interrete. Ita prorsus, inquam; \n\n','2016-02-14 21:54:31','2016-02-14 22:54:07',NULL,NULL,0,1,0),(194,1,1,1,'Accounts',' Conferam tecum, quam cuique verso rem subicias; Quarum ambarum rerum cum medicinam pollicetur, luxuriae licentiam pollicetur. In parvis enim saepe, qui nihil eorum cogitant, si quando iis ludentes minamur praecipitaturos alicunde, extimescunt. Nam illud vehementer repugnat, eundem beatum esse et multis malis oppressum. Sed nonne merninisti licere mihi ista probare, quae sunt a te dicta? Quis animo aequo videt eum, quem inpure ac flagitiose putet vivere? \n\n','2016-02-14 21:54:32','2016-02-14 22:54:07',NULL,NULL,0,1,0),(195,1,1,1,'Accounts',' An hoc usque quaque, aliter in vita? At eum nihili facit; Quae diligentissime contra Aristonem dicuntur a Chryippo. Aliter enim explicari, quod quaeritur, non potest. Videsne quam sit magna dissensio? Quae cum praeponunt, ut sit aliqua rerum selectio, naturam videntur sequi; Duo Reges: constructio interrete. An est aliquid, quod te sua sponte delectet? \n\n','2016-02-14 21:54:32','2016-02-14 22:54:08',NULL,NULL,0,1,0),(196,1,1,1,'Accounts',' Quid ergo hoc loco intellegit honestum? Bonum negas esse divitias, praeposìtum esse dicis? Qui-vere falsone, quaerere mittimus-dicitur oculis se privasse; Nec vero alia sunt quaerenda contra Carneadeam illam sententiam. Quid ergo aliud intellegetur nisi uti ne quae pars naturae neglegatur? Duo Reges: constructio interrete. Quae cum dixisset, finem ille. Suam denique cuique naturam esse ad vivendum ducem. Ea possunt paria non esse. Summae mihi videtur inscitiae. Hic ambiguo ludimur. \n\n','2016-02-14 21:54:33','2016-02-14 22:54:09',NULL,NULL,0,1,0),(197,1,1,1,'Accounts',' Quae si potest singula consolando levare, universa quo modo sustinebit? Quae quidem vel cum periculo est quaerenda vobis; Negare non possum. Nihil minus, contraque illa hereditate dives ob eamque rem laetus. Quantum Aristoxeni ingenium consumptum videmus in musicis? Sed haec quidem liberius ab eo dicuntur et saepius. Duo Reges: constructio interrete. Cur id non ita fit? Sed haec quidem liberius ab eo dicuntur et saepius. Quae cum dixisset paulumque institisset, Quid est? Ita fit cum gravior, tum etiam splendidior oratio. \n\n','2016-02-14 21:54:34','2016-02-14 22:54:09',NULL,NULL,0,1,0),(198,1,1,1,'Accounts',' Et ille ridens: Video, inquit, quid agas; Verum esto: verbum ipsum voluptatis non habet dignitatem, nec nos fortasse intellegimus. Ita graviter et severe voluptatem secrevit a bono. Rationis enim perfectio est virtus; Duo Reges: constructio interrete. Ut optime, secundum naturam affectum esse possit. \n\n','2016-02-14 21:54:35','2016-02-14 22:54:10',NULL,NULL,0,1,0),(199,1,1,1,'Accounts',' Habent enim et bene longam et satis litigiosam disputationem. Vitae autem degendae ratio maxime quidem illis placuit quieta. Ita relinquet duas, de quibus etiam atque etiam consideret. Duo Reges: constructio interrete. Quid enim necesse est, tamquam meretricem in matronarum coetum, sic voluptatem in virtutum concilium adducere? A primo, ut opinor, animantium ortu petitur origo summi boni. Apparet statim, quae sint officia, quae actiones. Graece donan, Latine voluptatem vocant. Quid, quod homines infima fortuna, nulla spe rerum gerendarum, opifices denique delectantur historia? \n\n','2016-02-14 21:54:35','2016-02-14 22:54:10',NULL,NULL,0,1,0),(200,1,1,1,'Accounts',' Quam nemo umquam voluptatem appellavit, appellat; Eam tum adesse, cum dolor omnis absit; Sed quid minus probandum quam esse aliquem beatum nec satis beatum? Duo Reges: constructio interrete. Rhetorice igitur, inquam, nos mavis quam dialectice disputare? Hoc etsi multimodis reprehendi potest, tamen accipio, quod dant. \n\n','2016-02-14 21:54:36','2016-02-14 22:54:10',NULL,NULL,0,1,0),(201,1,1,1,'Accounts',' Sed quid minus probandum quam esse aliquem beatum nec satis beatum? At modo dixeras nihil in istis rebus esse, quod interesset. Primum cur ista res digna odio est, nisi quod est turpis? Ergo illi intellegunt quid Epicurus dicat, ego non intellego? \n\n','2016-02-14 21:54:37','2016-02-14 22:54:11',NULL,NULL,0,1,0),(202,1,1,1,'Accounts',' Nam his libris eum malo quam reliquo ornatu villae delectari. Multoque hoc melius nos veriusque quam Stoici. Sed quanta sit alias, nunc tantum possitne esse tanta. Non enim ipsa genuit hominem, sed accepit a natura inchoatum. \n\n','2016-02-14 21:54:37','2016-02-14 22:54:11',NULL,NULL,0,1,0),(203,1,1,1,'Accounts',' Primum cur ista res digna odio est, nisi quod est turpis? Frater et T. Illud mihi a te nimium festinanter dictum videtur, sapientis omnis esse semper beatos; Duo Reges: constructio interrete. \n\n','2016-02-14 21:54:38','2016-02-14 22:54:12',NULL,NULL,0,1,0),(204,1,1,1,'Accounts',' Istic sum, inquit. Duo Reges: constructio interrete. De quibus cupio scire quid sentias. Servari enim iustitia nisi a forti viro, nisi a sapiente non potest. \n\n','2016-02-14 21:54:39','2016-02-14 22:54:12',NULL,NULL,0,1,0),(205,1,1,1,'Accounts',' Atque ab his initiis profecti omnium virtutum et originem et progressionem persecuti sunt. Fatebuntur Stoici haec omnia dicta esse praeclare, neque eam causam Zenoni desciscendi fuisse. Traditur, inquit, ab Epicuro ratio neglegendi doloris. In qua quid est boni praeter summam voluptatem, et eam sempiternam? \n\n','2016-02-14 21:54:40','2016-02-14 22:54:13',NULL,NULL,0,1,0),(206,1,1,1,'Accounts',' Quod si ita sit, cur opera philosophiae sit danda nescio. Efficiens dici potest. Sed id ne cogitari quidem potest quale sit, ut non repugnet ipsum sibi. At enim hic etiam dolore. Res enim concurrent contrariae. Primum quid tu dicis breve? Verum tamen cum de rebus grandioribus dicas, ipsae res verba rapiunt; Duo Reges: constructio interrete. \n\n','2016-02-14 21:54:40','2016-02-14 22:54:13',NULL,NULL,0,1,0),(207,1,1,1,'Accounts',' Quod quidem iam fit etiam in Academia. Sit hoc ultimum bonorum, quod nunc a me defenditur; De quibus cupio scire quid sentias. Quicquid porro animo cernimus, id omne oritur a sensibus; Quamquam te quidem video minime esse deterritum. Duo Reges: constructio interrete. Omnia contraria, quos etiam insanos esse vultis. At ille non pertimuit saneque fidenter: Istis quidem ipsis verbis, inquit; Ergo illi intellegunt quid Epicurus dicat, ego non intellego? Quamquam te quidem video minime esse deterritum. \n\n','2016-02-14 21:54:41','2016-02-14 22:54:14',NULL,NULL,0,1,0),(208,1,1,1,'Accounts',' Si enim ad populum me vocas, eum. Isto modo ne improbos quidem, si essent boni viri. Partim cursu et peragratione laetantur, congregatione aliae coetum quodam modo civitatis imitantur; Quamquam te quidem video minime esse deterritum. Duo Reges: constructio interrete. Itaque contra est, ac dicitis; \n\n','2016-02-14 21:54:42','2016-02-14 22:54:14',NULL,NULL,0,1,0),(209,1,1,1,'Accounts',' Atqui eorum nihil est eius generis, ut sit in fine atque extrerno bonorum. Ut in geometria, prima si dederis, danda sunt omnia. Satis est ad hoc responsum. Duo Reges: constructio interrete. Qualis ista philosophia est, quae non interitum afferat pravitatis, sed sit contenta mediocritate vitiorum? Nam Pyrrho, Aristo, Erillus iam diu abiecti. Summum ením bonum exposuit vacuitatem doloris; \n\n','2016-02-14 21:54:42','2016-02-14 22:54:14',NULL,NULL,0,1,0),(210,1,1,1,'Accounts',' Quos quidem tibi studiose et diligenter tractandos magnopere censeo. Scisse enim te quis coarguere possit? Tu vero, inquam, ducas licet, si sequetur; Duo Reges: constructio interrete. Itaque rursus eadem ratione, qua sum paulo ante usus, haerebitis. Sequitur disserendi ratio cognitioque naturae; \n\n','2016-02-14 21:54:43','2016-02-14 22:54:15',NULL,NULL,0,1,0),(211,1,1,1,'Accounts',' Ut proverbia non nulla veriora sint quam vestra dogmata. Negat enim summo bono afferre incrementum diem. Duo Reges: constructio interrete. Est autem etiam actio quaedam corporis, quae motus et status naturae congruentis tenet; \n\n','2016-02-14 21:54:44','2016-02-14 22:54:15',NULL,NULL,0,1,0),(212,1,1,1,'Accounts',' Quae cum dixisset paulumque institisset, Quid est? Nam si amitti vita beata potest, beata esse non potest. Duo Reges: constructio interrete. In qua quid est boni praeter summam voluptatem, et eam sempiternam? Tanta vis admonitionis inest in locis; Sed residamus, inquit, si placet. \n\n','2016-02-14 21:54:49','2016-02-14 22:54:16',NULL,NULL,0,1,0),(213,1,1,1,'Accounts',' Si est nihil nisi corpus, summa erunt illa: valitudo, vacuitas doloris, pulchritudo, cetera. Huic ego, si negaret quicquam interesse ad beate vivendum quali uteretur victu, concederem, laudarem etiam; Et certamen honestum et disputatio splendida! omnis est enim de virtutis dignitate contentio. Mihi, inquam, qui te id ipsum rogavi? Duo Reges: constructio interrete. \n\n','2016-02-14 21:54:50','2016-02-14 22:54:16',NULL,NULL,0,1,0),(214,1,1,1,'Accounts',' Diodorus, eius auditor, adiungit ad honestatem vacuitatem doloris. Duo Reges: constructio interrete. Nunc haec primum fortasse audientis servire debemus. Ut id aliis narrare gestiant? Contineo me ab exemplis. An eiusdem modi? \n\n','2016-02-14 21:54:51','2016-02-14 22:54:17',NULL,NULL,0,1,0),(215,1,1,1,'Accounts',' In his igitur partibus duabus nihil erat, quod Zeno commutare gestiret. Ergo opifex plus sibi proponet ad formarum quam civis excellens ad factorum pulchritudinem? Duo Reges: constructio interrete. Ad quorum et cognitionem et usum iam corroborati natura ipsa praeeunte deducimur. \n\n','2016-02-14 21:54:52','2016-02-14 22:54:17',NULL,NULL,0,1,0),(216,1,1,1,'Accounts',' Nam aliquando posse recte fieri dicunt nulla expectata nec quaesita voluptate. Prave, nequiter, turpiter cenabat; Ego quoque, inquit, didicerim libentius si quid attuleris, quam te reprehenderim. Et homini, qui ceteris animantibus plurimum praestat, praecipue a natura nihil datum esse dicemus? Duo Reges: constructio interrete. Pauca mutat vel plura sane; Tu autem negas fortem esse quemquam posse, qui dolorem malum putet. Eorum enim est haec querela, qui sibi cari sunt seseque diligunt. Sit sane ista voluptas. \n\n','2016-02-14 21:54:52','2016-02-14 22:54:17',NULL,NULL,0,1,0),(217,1,1,1,'Accounts',' Quod autem satis est, eo quicquid accessit, nimium est; Sin autem est in ea, quod quidam volunt, nihil impedit hanc nostram comprehensionem summi boni. Quid est igitur, inquit, quod requiras? Atque his de rebus et splendida est eorum et illustris oratio. \n\n','2016-02-14 21:54:53','2016-02-14 22:54:18',NULL,NULL,0,1,0),(218,1,1,1,'Accounts',' Iam contemni non poteris. Duo Reges: constructio interrete. Multa sunt dicta ab antiquis de contemnendis ac despiciendis rebus humanis; Utinam quidem dicerent alium alio beatiorem! Iam ruinas videres. Occultum facinus esse potuerit, gaudebit; Idemque diviserunt naturam hominis in animum et corpus. Videmusne ut pueri ne verberibus quidem a contemplandis rebus perquirendisque deterreantur? Haec igitur Epicuri non probo, inquam. \n\n','2016-02-14 21:54:54','2016-02-14 22:54:18',NULL,NULL,0,1,0),(219,1,1,1,'Accounts',' Tamen a proposito, inquam, aberramus. Duo enim genera quae erant, fecit tria. Praeclarae mortes sunt imperatoriae; Si de re disceptari oportet, nulla mihi tecum, Cato, potest esse dissensio. Duo Reges: constructio interrete. Ita relinquet duas, de quibus etiam atque etiam consideret. Quicquid porro animo cernimus, id omne oritur a sensibus; \n\n','2016-02-14 21:54:55','2016-02-14 22:54:19',NULL,NULL,0,1,0),(220,1,1,1,'Accounts',' Dat enim intervalla et relaxat. Inquit, dasne adolescenti veniam? Vitae autem degendae ratio maxime quidem illis placuit quieta. Hoc est non dividere, sed frangere. Apud imperitos tum illa dicta sunt, aliquid etiam coronae datum; \n\n','2016-02-14 21:54:55','2016-02-14 22:54:20',NULL,NULL,0,1,0),(221,1,1,1,'Accounts',' Quasi vero, inquit, perpetua oratio rhetorum solum, non etiam philosophorum sit. Expectoque quid ad id, quod quaerebam, respondeas. Qua tu etiam inprudens utebare non numquam. Sullae consulatum? Duo Reges: constructio interrete. Nescio quo modo praetervolavit oratio. Experiamur igitur, inquit, etsi habet haec Stoicorum ratio difficilius quiddam et obscurius. Res enim concurrent contrariae. \n\n','2016-02-14 21:54:56','2016-02-14 22:54:20',NULL,NULL,0,1,0),(222,1,1,1,'Accounts',' Est autem a te semper dictum nec gaudere quemquam nisi propter corpus nec dolere. Duo Reges: constructio interrete. Immo alio genere; Non dolere, inquam, istud quam vim habeat postea videro; Quamquam tu hanc copiosiorem etiam soles dicere. Laboro autem non sine causa; Ut in voluptate sit, qui epuletur, in dolore, qui torqueatur. Non enim, si malum est dolor, carere eo malo satis est ad bene vivendum. \n\n','2016-02-14 21:54:57','2016-02-14 22:54:21',NULL,NULL,0,1,0),(223,1,1,1,'Accounts',' Parvi enim primo ortu sic iacent, tamquam omnino sine animo sint. Duo Reges: constructio interrete. Duarum enim vitarum nobis erunt instituta capienda. \n\n','2016-02-14 21:54:57','2016-02-14 22:54:21',NULL,NULL,0,1,0),(224,1,1,1,'Accounts',' Quid de Platone aut de Democrito loquar? Sic, et quidem diligentius saepiusque ista loquemur inter nos agemusque communiter. Deinde disputat, quod cuiusque generis animantium statui deceat extremum. Praeteritis, inquit, gaudeo. Duo Reges: constructio interrete. Qui non moveatur et offensione turpitudinis et comprobatione honestatis? Beatus sibi videtur esse moriens. \n\n','2016-02-14 21:54:58','2016-02-14 22:54:22',NULL,NULL,0,1,0),(225,1,1,1,'Accounts',' Familiares nostros, credo, Sironem dicis et Philodemum, cum optimos viros, tum homines doctissimos. Atque haec coniunctio confusioque virtutum tamen a philosophis ratione quadam distinguitur. Videmusne ut pueri ne verberibus quidem a contemplandis rebus perquirendisque deterreantur? Quae quo sunt excelsiores, eo dant clariora indicia naturae. \n\n','2016-02-14 21:54:59','2016-02-14 22:54:22',NULL,NULL,0,1,0),(226,1,1,1,'Accounts',' Quando enim Socrates, qui parens philosophiae iure dici potest, quicquam tale fecit? Nihil illinc huc pervenit. Id Sextilius factum negabat. Quo studio Aristophanem putamus aetatem in litteris duxisse? Materiam vero rerum et copiam apud hos exilem, apud illos uberrimam reperiemus. Duo Reges: constructio interrete. \n\n','2016-02-14 21:54:59','2016-02-14 22:54:22',NULL,NULL,0,1,0),(227,1,1,1,'Accounts',' In quibus doctissimi illi veteres inesse quiddam caeleste et divinum putaverunt. Potius inflammat, ut coercendi magis quam dedocendi esse videantur. Ut optime, secundum naturam affectum esse possit. Ad corpus diceres pertinere-, sed ea, quae dixi, ad corpusne refers? Hic quoque suus est de summoque bono dissentiens dici vere Peripateticus non potest. Duo Reges: constructio interrete. \n\n','2016-02-14 21:55:00','2016-02-14 22:54:23',NULL,NULL,0,1,0),(228,1,1,1,'Accounts',' Itaque hic ipse iam pridem est reiectus; Ergo illi intellegunt quid Epicurus dicat, ego non intellego? Quid est, quod ab ea absolvi et perfici debeat? Quid censes in Latino fore? Dat enim intervalla et relaxat. Duo Reges: constructio interrete. Nam si propter voluptatem, quae est ista laus, quae possit e macello peti? Verum tamen cum de rebus grandioribus dicas, ipsae res verba rapiunt; Faceres tu quidem, Torquate, haec omnia; \n\n','2016-02-14 21:55:01','2016-02-14 22:54:23',NULL,NULL,0,1,0),(229,1,1,1,'Accounts',' Apparet statim, quae sint officia, quae actiones. Cuius ad naturam apta ratio vera illa et summa lex a philosophis dicitur. Erit enim mecum, si tecum erit. Duo Reges: constructio interrete. An eiusdem modi? Cur fortior sit, si illud, quod tute concedis, asperum et vix ferendum putabit? Vitae autem degendae ratio maxime quidem illis placuit quieta. Primum in nostrane potestate est, quid meminerimus? Sin laboramus, quis est, qui alienae modum statuat industriae? An hoc usque quaque, aliter in vita? \n\n','2016-02-14 21:55:02','2016-02-14 22:54:24',NULL,NULL,0,1,0),(230,1,1,1,'Accounts',' Sed ego in hoc resisto; Ut placet, inquit, etsi enim illud erat aptius, aequum cuique concedere. Multa sunt dicta ab antiquis de contemnendis ac despiciendis rebus humanis; Duo Reges: constructio interrete. Aliter enim explicari, quod quaeritur, non potest. Habent enim et bene longam et satis litigiosam disputationem. Negat esse eam, inquit, propter se expetendam. Eademne, quae restincta siti? Collatio igitur ista te nihil iuvat. Ita relinquet duas, de quibus etiam atque etiam consideret. \n\n','2016-02-14 21:55:02','2016-02-14 22:54:24',NULL,NULL,0,1,0),(231,1,1,1,'Accounts',' Quis suae urbis conservatorem Codrum, quis Erechthei filias non maxime laudat? Polycratem Samium felicem appellabant. At iam decimum annum in spelunca iacet. Dolor ergo, id est summum malum, metuetur semper, etiamsi non aderit; Quid enim de amicitia statueris utilitatis causa expetenda vides. Quonam modo? Duo Reges: constructio interrete. Illud dico, ea, quae dicat, praeclare inter se cohaerere. \n\n','2016-02-14 21:55:03','2016-02-14 22:54:25',NULL,NULL,0,1,0),(232,1,1,1,'Accounts',' Ut placet, inquit, etsi enim illud erat aptius, aequum cuique concedere. Quam illa ardentis amores excitaret sui! Cur tandem? Contineo me ab exemplis. Duo Reges: constructio interrete. Scientiam pollicentur, quam non erat mirum sapientiae cupido patria esse cariorem. Ita credo. \n\n','2016-02-14 21:55:04','2016-02-14 22:54:25',NULL,NULL,0,1,0),(233,1,1,1,'Accounts',' Duarum enim vitarum nobis erunt instituta capienda. Scisse enim te quis coarguere possit? Sic, et quidem diligentius saepiusque ista loquemur inter nos agemusque communiter. Nondum autem explanatum satis, erat, quid maxime natura vellet. Quo studio Aristophanem putamus aetatem in litteris duxisse? Sit hoc ultimum bonorum, quod nunc a me defenditur; Duo Reges: constructio interrete. \n\n','2016-02-14 21:55:04','2016-02-14 22:54:26',NULL,NULL,0,1,0),(234,1,1,1,'Accounts',' Si longus, levis. Sed ne, dum huic obsequor, vobis molestus sim. Ergo hoc quidem apparet, nos ad agendum esse natos. Maximas vero virtutes iacere omnis necesse est voluptate dominante. Facile est hoc cernere in primis puerorum aetatulis. Honesta oratio, Socratica, Platonis etiam. \n\n','2016-02-14 21:55:05','2016-02-14 22:54:26',NULL,NULL,0,1,0),(235,1,1,1,'Accounts',' Quis non odit sordidos, vanos, leves, futtiles? Sit hoc ultimum bonorum, quod nunc a me defenditur; Si autem id non concedatur, non continuo vita beata tollitur. Atqui reperies, inquit, in hoc quidem pertinacem; Qualem igitur hominem natura inchoavit? Duarum enim vitarum nobis erunt instituta capienda. Duo Reges: constructio interrete. Hoc etsi multimodis reprehendi potest, tamen accipio, quod dant. \n\n','2016-02-14 21:55:06','2016-02-14 22:54:26',NULL,NULL,0,1,0),(236,1,1,1,'Accounts',' Varietates autem iniurasque fortunae facile veteres philosophorum praeceptis instituta vita superabat. Vestri haec verecundius, illi fortasse constantius. Uterque enim summo bono fruitur, id est voluptate. Te ipsum, dignissimum maioribus tuis, voluptasne induxit, ut adolescentulus eriperes P. Neque solum ea communia, verum etiam paria esse dixerunt. Post enim Chrysippum eum non sane est disputatum. Et homini, qui ceteris animantibus plurimum praestat, praecipue a natura nihil datum esse dicemus? \n\n','2016-02-14 21:55:07','2016-02-14 22:54:27',NULL,NULL,0,1,0),(237,1,1,1,'Accounts',' Apud imperitos tum illa dicta sunt, aliquid etiam coronae datum; Videmus igitur ut conquiescere ne infantes quidem possint. Si quicquam extra virtutem habeatur in bonis. Videamus igitur sententias eorum, tum ad verba redeamus. Conferam tecum, quam cuique verso rem subicias; Illum mallem levares, quo optimum atque humanissimum virum, Cn. Duo Reges: constructio interrete. \n\n','2016-02-14 21:55:08','2016-02-14 22:54:27',NULL,NULL,0,1,0),(238,1,1,1,'Accounts',' Quis animo aequo videt eum, quem inpure ac flagitiose putet vivere? Aut, Pylades cum sis, dices te esse Orestem, ut moriare pro amico? Inde sermone vario sex illa a Dipylo stadia confecimus. Ex rebus enim timiditas, non ex vocabulis nascitur. Tum Piso: Quoniam igitur aliquid omnes, quid Lucius noster? Duo Reges: constructio interrete. Nam illud vehementer repugnat, eundem beatum esse et multis malis oppressum. Deinde dolorem quem maximum? \n\n','2016-02-14 21:55:09','2016-02-14 22:54:28',NULL,NULL,0,1,0),(239,1,1,1,'Accounts',' Hos contra singulos dici est melius. Claudii libidini, qui tum erat summo ne imperio, dederetur. Quae contraria sunt his, malane? Quae contraria sunt his, malane? \n\n','2016-02-14 21:55:09','2016-02-14 22:54:28',NULL,NULL,0,1,0),(240,1,1,1,'Accounts',' Quare conare, quaeso. Et ille ridens: Video, inquit, quid agas; Tu enim ista lenius, hic Stoicorum more nos vexat. Summum ením bonum exposuit vacuitatem doloris; Aeque enim contingit omnibus fidibus, ut incontentae sint. Quo plebiscito decreta a senatu est consuli quaestio Cn. Bonum liberi: misera orbitas. Duo Reges: constructio interrete. Memini vero, inquam; Callipho ad virtutem nihil adiunxit nisi voluptatem, Diodorus vacuitatem doloris. \n\n','2016-02-14 21:55:10','2016-02-14 22:54:28',NULL,NULL,0,1,0),(241,1,1,1,'Accounts',' Graece donan, Latine voluptatem vocant. Qui autem esse poteris, nisi te amor ipse ceperit? Non ego tecum iam ita iocabor, ut isdem his de rebus, cum L. Duo Reges: constructio interrete. An dubium est, quin virtus ita maximam partem optineat in rebus humanis, ut reliquas obruat? Non laboro, inquit, de nomine. \n\n','2016-02-14 21:55:11','2016-02-14 22:54:29',NULL,NULL,0,1,0),(242,1,1,1,'Accounts',' Quid ergo attinet dicere: Nihil haberem, quod reprehenderem, si finitas cupiditates haberent? Ita enim vivunt quidam, ut eorum vita refellatur oratio. Hoc loco tenere se Triarius non potuit. Graece donan, Latine voluptatem vocant. Sed ut iis bonis erigimur, quae expectamus, sic laetamur iis, quae recordamur. \n\n','2016-02-14 21:55:11','2016-02-14 22:54:29',NULL,NULL,0,1,0),(243,1,1,1,'Accounts',' An vero displicuit ea, quae tributa est animi virtutibus tanta praestantia? Si autem id non concedatur, non continuo vita beata tollitur. Habes, inquam, Cato, formam eorum, de quibus loquor, philosophorum. Recte, inquit, intellegis. Ne discipulum abducam, times. Nam Pyrrho, Aristo, Erillus iam diu abiecti. At iam decimum annum in spelunca iacet. Ergo adhuc, quantum equidem intellego, causa non videtur fuisse mutandi nominis. Tum mihi Piso: Quid ergo? \n\n','2016-02-14 21:55:12','2016-02-14 22:54:30',NULL,NULL,0,1,0),(244,1,1,1,'Accounts',' Duo Reges: constructio interrete. Ratio quidem vestra sic cogit. Sed quanta sit alias, nunc tantum possitne esse tanta. Quamquam id quidem licebit iis existimare, qui legerint. Si longus, levis; Quis enim confidit semper sibi illud stabile et firmum permansurum, quod fragile et caducum sit? Quid ei reliquisti, nisi te, quoquo modo loqueretur, intellegere, quid diceret? \n\n','2016-02-14 21:55:13','2016-02-14 22:54:30',NULL,NULL,0,1,0),(245,1,1,1,'Accounts',' Dici enim nihil potest verius. Sed haec in pueris; Aufert enim sensus actionemque tollit omnem. Tecum optime, deinde etiam cum mediocri amico. Idemne, quod iucunde? \n\n','2016-02-14 21:55:14','2016-02-14 22:54:31',NULL,NULL,0,1,0),(246,1,1,1,'Accounts',' Traditur, inquit, ab Epicuro ratio neglegendi doloris. Et quod est munus, quod opus sapientiae? Te ipsum, dignissimum maioribus tuis, voluptasne induxit, ut adolescentulus eriperes P. Rapior illuc, revocat autem Antiochus, nec est praeterea, quem audiamus. Qui autem esse poteris, nisi te amor ipse ceperit? Duo Reges: constructio interrete. Duarum enim vitarum nobis erunt instituta capienda. Aliud igitur esse censet gaudere, aliud non dolere. \n\n','2016-02-14 21:55:14','2016-02-14 22:54:31',NULL,NULL,0,1,0),(247,1,1,1,'Accounts',' Post enim Chrysippum eum non sane est disputatum. Expressa vero in iis aetatibus, quae iam confirmatae sunt. Duo Reges: constructio interrete. Haec quo modo conveniant, non sane intellego. \n\n','2016-02-14 21:55:15','2016-02-14 22:54:32',NULL,NULL,0,1,0),(248,1,1,1,'Accounts',' Inde igitur, inquit, ordiendum est. Non igitur potestis voluptate omnia dirigentes aut tueri aut retinere virtutem. Si id dicis, vicimus. Duo Reges: constructio interrete. Huius, Lyco, oratione locuples, rebus ipsis ielunior. Quoniam, si dis placet, ab Epicuro loqui discimus. Non quam nostram quidem, inquit Pomponius iocans; Iam id ipsum absurdum, maximum malum neglegi. \n\n','2016-02-14 21:55:16','2016-02-14 22:54:32',NULL,NULL,0,1,0),(249,1,1,1,'Accounts',' Ut proverbia non nulla veriora sint quam vestra dogmata. Consequentia exquirere, quoad sit id, quod volumus, effectum. Quamquam ab iis philosophiam et omnes ingenuas disciplinas habemus; Egone non intellego, quid sit don Graece, Latine voluptas? At negat Epicurus-hoc enim vestrum lumen estquemquam, qui honeste non vivat, iucunde posse vivere. Duo Reges: constructio interrete. Istam voluptatem perpetuam quis potest praestare sapienti? Ita prorsus, inquam; Quid ergo aliud intellegetur nisi uti ne quae pars naturae neglegatur? Multoque hoc melius nos veriusque quam Stoici. Iam contemni non poteris. \n\n','2016-02-14 21:55:16','2016-02-14 22:54:33',NULL,NULL,0,1,0),(250,1,1,1,'Accounts',' Profectus in exilium Tubulus statim nec respondere ausus; Igitur neque stultorum quisquam beatus neque sapientium non beatus. Aliter enim nosmet ipsos nosse non possumus. Sed quod proximum fuit non vidit. Deque his rebus satis multa in nostris de re publica libris sunt dicta a Laelio. Ergo illi intellegunt quid Epicurus dicat, ego non intellego? Ad eos igitur converte te, quaeso. Duo Reges: constructio interrete. Hic nihil fuit, quod quaereremus. \n\n','2016-02-14 21:55:17','2016-02-14 22:54:33',NULL,NULL,0,1,0),(251,1,1,1,'Accounts',' Nihil opus est exemplis hoc facere longius. Vide, quantum, inquam, fallare, Torquate. Hanc ergo intuens debet institutum illud quasi signum absolvere. Itaque his sapiens semper vacabit. Duo Reges: constructio interrete. Ita relinquet duas, de quibus etiam atque etiam consideret. Quam si explicavisset, non tam haesitaret. \n\n','2016-02-14 21:55:18','2016-02-14 22:54:34',NULL,NULL,0,1,0),(252,1,1,1,'Accounts',' Bona autem corporis huic sunt, quod posterius posui, similiora. Tenent mordicus. Habent enim et bene longam et satis litigiosam disputationem. Duo Reges: constructio interrete. Qui autem esse poteris, nisi te amor ipse ceperit? Quod idem cum vestri faciant, non satis magnam tribuunt inventoribus gratiam. Re mihi non aeque satisfacit, et quidem locis pluribus. Non est ista, inquam, Piso, magna dissensio. Quid est enim aliud esse versutum? Age nunc isti doceant, vel tu potius quis enim ista melius? Qua tu etiam inprudens utebare non numquam. \n\n','2016-02-14 21:55:19','2016-02-14 22:54:34',NULL,NULL,0,1,0),(253,1,1,1,'Accounts',' Mihi enim erit isdem istis fortasse iam utendum. Habes, inquam, Cato, formam eorum, de quibus loquor, philosophorum. Indicant pueri, in quibus ut in speculis natura cernitur. Vos autem cum perspicuis dubia debeatis illustrare, dubiis perspicua conamini tollere. Quod autem satis est, eo quicquid accessit, nimium est; Quid, si etiam iucunda memoria est praeteritorum malorum? \n\n','2016-02-14 21:55:19','2016-02-14 22:54:34',NULL,NULL,0,1,0),(254,1,1,1,'Accounts',' Laboro autem non sine causa; Quid est enim aliud esse versutum? Duo Reges: constructio interrete. Sequitur disserendi ratio cognitioque naturae; Quis animo aequo videt eum, quem inpure ac flagitiose putet vivere? Ille enim occurrentia nescio quae comminiscebatur; Id est enim, de quo quaerimus. \n\n','2016-02-14 21:55:20','2016-02-14 22:54:35',NULL,NULL,0,1,0),(255,1,1,1,'Accounts',' Haeret in salebra. Qua ex cognitione facilior facta est investigatio rerum occultissimarum. Indicant pueri, in quibus ut in speculis natura cernitur. Uterque enim summo bono fruitur, id est voluptate. Etenim semper illud extra est, quod arte comprehenditur. Duo Reges: constructio interrete. \n\n','2016-02-14 21:55:21','2016-02-14 22:54:35',NULL,NULL,0,1,0),(256,1,1,1,'Accounts',' Cur iustitia laudatur? Sed tu istuc dixti bene Latine, parum plane. Utrum igitur tibi litteram videor an totas paginas commovere? Mihi vero, inquit, placet agi subtilius et, ut ipse dixisti, pressius. Et quod est munus, quod opus sapientiae? Atqui haec patefactio quasi rerum opertarum, cum quid quidque sit aperitur, definitio est. Duo Reges: constructio interrete. Cave putes quicquam esse verius. \n\n','2016-02-14 21:55:21','2016-02-14 22:54:35',NULL,NULL,0,1,0),(257,1,1,1,'Accounts',' Aliter enim nosmet ipsos nosse non possumus. Duo Reges: constructio interrete. Quod ea non occurrentia fingunt, vincunt Aristonem; Non dolere, inquam, istud quam vim habeat postea videro; Ut proverbia non nulla veriora sint quam vestra dogmata. At iste non dolendi status non vocatur voluptas. \n\n','2016-02-14 21:55:22','2016-02-14 22:54:36',NULL,NULL,0,1,0),(258,1,1,1,'Accounts',' Duo Reges: constructio interrete. Quae similitudo in genere etiam humano apparet. Atqui iste locus est, Piso, tibi etiam atque etiam confirmandus, inquam; Incommoda autem et commoda-ita enim estmata et dustmata appello-communia esse voluerunt, paria noluerunt. Nunc omni virtuti vitium contrario nomine opponitur. Contineo me ab exemplis. Cum autem in quo sapienter dicimus, id a primo rectissime dicitur. Nulla profecto est, quin suam vim retineat a primo ad extremum. \n\n','2016-02-14 21:55:23','2016-02-14 22:54:36',NULL,NULL,0,1,0),(259,1,1,1,'Accounts',' Quid enim me prohiberet Epicureum esse, si probarem, quae ille diceret? Sed tempus est, si videtur, et recta quidem ad me. Quis animo aequo videt eum, quem inpure ac flagitiose putet vivere? Age sane, inquam. Apud ceteros autem philosophos, qui quaesivit aliquid, tacet; Restinguet citius, si ardentem acceperit. Duo Reges: constructio interrete. De hominibus dici non necesse est. Sed quid sentiat, non videtis. Quae quidem vel cum periculo est quaerenda vobis; \n\n','2016-02-14 21:55:24','2016-02-14 22:54:37',NULL,NULL,0,1,0),(260,1,1,1,'Accounts',' Dat enim intervalla et relaxat. Quae duo sunt, unum facit. Dic in quovis conventu te omnia facere, ne doleas. \n\n','2016-02-14 21:55:24','2016-02-14 22:54:37',NULL,NULL,0,1,0),(261,1,1,1,'Accounts',' Quamquam id quidem licebit iis existimare, qui legerint. Quid sequatur, quid repugnet, vident. Quicquid porro animo cernimus, id omne oritur a sensibus; Nunc agendum est subtilius. Tu autem negas fortem esse quemquam posse, qui dolorem malum putet. \n\n','2016-02-14 21:55:25','2016-02-14 22:54:38',NULL,NULL,0,1,0),(262,1,1,1,'Accounts',' Itaque hic ipse iam pridem est reiectus; Conferam tecum, quam cuique verso rem subicias; Quid est igitur, inquit, quod requiras? Immo alio genere; Ratio enim nostra consentit, pugnat oratio. Sed ne, dum huic obsequor, vobis molestus sim. Duo Reges: constructio interrete. Bonum negas esse divitias, praeposìtum esse dicis? \n\n','2016-02-14 21:55:26','2016-02-14 22:54:38',NULL,NULL,0,1,0),(263,1,1,1,'Accounts',' Quodsi vultum tibi, si incessum fingeres, quo gravior viderere, non esses tui similis; Quia nec honesto quic quam honestius nec turpi turpius. Ne amores quidem sanctos a sapiente alienos esse arbitrantur. Quos quidem tibi studiose et diligenter tractandos magnopere censeo. Duo Reges: constructio interrete. Quae cum dixisset paulumque institisset, Quid est? Quamquam te quidem video minime esse deterritum. Nosti, credo, illud: Nemo pius est, qui pietatem-; \n\n','2016-02-14 21:55:26','2016-02-14 22:54:39',NULL,NULL,0,1,0),(264,1,1,1,'Accounts',' Quis hoc dicit? At ille pellit, qui permulcet sensum voluptate. Scisse enim te quis coarguere possit? Ne amores quidem sanctos a sapiente alienos esse arbitrantur. Duo Reges: constructio interrete. Dici enim nihil potest verius. \n\n','2016-02-14 21:55:27','2016-02-14 22:54:39',NULL,NULL,0,1,0),(265,1,1,1,'Accounts',' Qui-vere falsone, quaerere mittimus-dicitur oculis se privasse; Sed quanta sit alias, nunc tantum possitne esse tanta. Nos commodius agimus. Summum ením bonum exposuit vacuitatem doloris; Neque enim disputari sine reprehensione nec cum iracundia aut pertinacia recte disputari potest. Huic mori optimum esse propter desperationem sapientiae, illi propter spem vivere. Duo Reges: constructio interrete. Duo enim genera quae erant, fecit tria. \n\n','2016-02-14 21:55:28','2016-02-14 22:54:39',NULL,NULL,0,1,0),(266,1,1,1,'Accounts',' Cum praesertim illa perdiscere ludus esset. Quae autem natura suae primae institutionis oblita est? Duo Reges: constructio interrete. \n\n','2016-02-14 21:55:29','2016-02-14 22:54:40',NULL,NULL,0,1,0),(267,1,1,1,'Accounts',' Quid adiuvas? Paulum, cum regem Persem captum adduceret, eodem flumine invectio? Duo Reges: constructio interrete. Quis Aristidem non mortuum diligit? At modo dixeras nihil in istis rebus esse, quod interesset. Cur deinde Metrodori liberos commendas? Ergo, si semel tristior effectus est, hilara vita amissa est? In quibus doctissimi illi veteres inesse quiddam caeleste et divinum putaverunt. \n\n','2016-02-14 21:55:29','2016-02-14 22:54:40',NULL,NULL,0,1,0),(268,1,1,1,'Accounts',' Profectus in exilium Tubulus statim nec respondere ausus; At, si voluptas esset bonum, desideraret. Sint modo partes vitae beatae. Quae sunt igitur communia vobis cum antiquis, iis sic utamur quasi concessis; Duo Reges: constructio interrete. Illum mallem levares, quo optimum atque humanissimum virum, Cn. \n\n','2016-02-14 21:55:30','2016-02-14 22:54:41',NULL,NULL,0,1,0),(269,1,1,1,'Accounts',' Quacumque enim ingredimur, in aliqua historia vestigium ponimus. Ita redarguitur ipse a sese, convincunturque scripta eius probitate ipsius ac moribus. Fortasse id optimum, sed ubi illud: Plus semper voluptatis? An dolor longissimus quisque miserrimus, voluptatem non optabiliorem diuturnitas facit? \n\n','2016-02-14 21:55:31','2016-02-14 22:54:42',NULL,NULL,0,1,0),(270,1,1,1,'Accounts',' Sed ego in hoc resisto; Eam si varietatem diceres, intellegerem, ut etiam non dicente te intellego; Ostendit pedes et pectus. Minime id quidem, inquam, alienum, multumque ad ea, quae quaerimus, explicatio tua ista profecerit. Quae quidem vel cum periculo est quaerenda vobis; Duo Reges: constructio interrete. Nam de isto magna dissensio est. Quid igitur dubitamus in tota eius natura quaerere quid sit effectum? \n\n','2016-02-14 21:55:31','2016-02-14 22:54:42',NULL,NULL,0,1,0),(271,1,1,1,'Accounts',' Negabat igitur ullam esse artem, quae ipsa a se proficisceretur; Consequentia exquirere, quoad sit id, quod volumus, effectum. Ergo ita: non posse honeste vivi, nisi honeste vivatur? Quod mihi quidem visus est, cum sciret, velle tamen confitentem audire Torquatum. Sed haec quidem liberius ab eo dicuntur et saepius. Duo Reges: constructio interrete. Earum etiam rerum, quas terra gignit, educatio quaedam et perfectio est non dissimilis animantium. \n\n','2016-02-14 21:55:32','2016-02-14 22:54:43',NULL,NULL,0,1,0),(272,1,1,1,'Accounts',' Cupit enim dícere nihil posse ad beatam vitam deesse sapienti. Dicet pro me ipsa virtus nec dubitabit isti vestro beato M. Virtutis, magnitudinis animi, patientiae, fortitudinis fomentis dolor mitigari solet. Expectoque quid ad id, quod quaerebam, respondeas. Duo Reges: constructio interrete. Quicquid porro animo cernimus, id omne oritur a sensibus; Si de re disceptari oportet, nulla mihi tecum, Cato, potest esse dissensio. \n\n','2016-02-14 21:55:33','2016-02-14 22:54:43',NULL,NULL,0,1,0),(273,1,1,1,'Accounts',' Huic mori optimum esse propter desperationem sapientiae, illi propter spem vivere. Quorum altera prosunt, nocent altera. Quod idem cum vestri faciant, non satis magnam tribuunt inventoribus gratiam. Quae cum essent dicta, discessimus. \n\n','2016-02-14 21:55:34','2016-02-14 22:54:43',NULL,NULL,0,1,0),(274,1,1,1,'Accounts',' Non est enim vitium in oratione solum, sed etiam in moribus. Nemo nostrum istius generis asotos iucunde putat vivere. Prioris generis est docilitas, memoria; Atqui reperies, inquit, in hoc quidem pertinacem; Hoc est dicere: Non reprehenderem asotos, si non essent asoti. Duo Reges: constructio interrete. Est, ut dicis, inquam. \n\n','2016-02-14 21:55:34','2016-02-14 22:54:44',NULL,NULL,0,1,0),(275,1,1,1,'Accounts',' Qui potest igitur habitare in beata vita summi mali metus? Praeteritis, inquit, gaudeo. Tecum optime, deinde etiam cum mediocri amico. Duo Reges: constructio interrete. Apparet statim, quae sint officia, quae actiones. Sed erat aequius Triarium aliquid de dissensione nostra iudicare. \n\n','2016-02-14 21:55:35','2016-02-14 22:54:44',NULL,NULL,0,1,0),(276,1,1,1,'Accounts',' Respondent extrema primis, media utrisque, omnia omnibus. Negat esse eam, inquit, propter se expetendam. Alterum significari idem, ut si diceretur, officia media omnia aut pleraque servantem vivere. Tum Torquatus: Prorsus, inquit, assentior; Duo Reges: constructio interrete. Bestiarum vero nullum iudicium puto. \n\n','2016-02-14 21:55:36','2016-02-14 22:54:45',NULL,NULL,0,1,0),(277,1,1,1,'Accounts',' Sic enim censent, oportunitatis esse beate vivere. Maximus dolor, inquit, brevis est. Naturales divitias dixit parabiles esse, quod parvo esset natura contenta. Duo Reges: constructio interrete. Hoc non est positum in nostra actione. Certe nihil nisi quod possit ipsum propter se iure laudari. Quae animi affectio suum cuique tribuens atque hanc, quam dico. Negat enim summo bono afferre incrementum diem. Istam voluptatem perpetuam quis potest praestare sapienti? Obsecro, inquit, Torquate, haec dicit Epicurus? Deinde disputat, quod cuiusque generis animantium statui deceat extremum. \n\n','2016-02-14 21:55:36','2016-02-14 22:54:45',NULL,NULL,0,1,0),(278,1,1,1,'Accounts',' Quam ob rem tandem, inquit, non satisfacit? Nonne igitur tibi videntur, inquit, mala? Et hercule-fatendum est enim, quod sentio -mirabilis est apud illos contextus rerum. Haec igitur Epicuri non probo, inquam. Duo Reges: constructio interrete. Nam adhuc, meo fortasse vitio, quid ego quaeram non perspicis. Esse enim quam vellet iniquus iustus poterat inpune. Idemne, quod iucunde? \n\n','2016-02-14 21:55:42','2016-02-14 22:54:46',NULL,NULL,0,1,0),(279,1,1,1,'Accounts',' Hoc Hieronymus summum bonum esse dixit. Sed ille, ut dixi, vitiose. Quae fere omnia appellantur uno ingenii nomine, easque virtutes qui habent, ingeniosi vocantur. Duo Reges: constructio interrete. Cur, nisi quod turpis oratio est? Hoc non est positum in nostra actione. Sic exclusis sententiis reliquorum cum praeterea nulla esse possit, haec antiquorum valeat necesse est. Graece donan, Latine voluptatem vocant. Quare attende, quaeso. Deinde disputat, quod cuiusque generis animantium statui deceat extremum. \n\n','2016-02-14 21:55:43','2016-02-14 22:54:46',NULL,NULL,0,1,0),(280,1,1,1,'Accounts',' Expectoque quid ad id, quod quaerebam, respondeas. Primum in nostrane potestate est, quid meminerimus? \n\n','2016-02-14 21:55:44','2016-02-14 22:54:46',NULL,NULL,0,1,0),(281,1,1,1,'Accounts',' Qui autem esse poteris, nisi te amor ipse ceperit? Ergo illi intellegunt quid Epicurus dicat, ego non intellego? Quae in controversiam veniunt, de iis, si placet, disseramus. Duo Reges: constructio interrete. Non minor, inquit, voluptas percipitur ex vilissimis rebus quam ex pretiosissimis. Sed tamen intellego quid velit. Erit enim mecum, si tecum erit. Tecum optime, deinde etiam cum mediocri amico. Quid enim me prohiberet Epicureum esse, si probarem, quae ille diceret? \n\n','2016-02-14 21:55:44','2016-02-14 22:54:47',NULL,NULL,0,1,0),(282,1,1,1,'Accounts',' Praeteritis, inquit, gaudeo. Claudii libidini, qui tum erat summo ne imperio, dederetur. Ut in voluptate sit, qui epuletur, in dolore, qui torqueatur. Equidem etiam Epicurum, in physicis quidem, Democriteum puto. Age, inquies, ista parva sunt. Quamvis enim depravatae non sint, pravae tamen esse possunt. Contineo me ab exemplis. \n\n','2016-02-14 21:55:45','2016-02-14 22:54:47',NULL,NULL,0,1,0),(283,1,1,1,'Accounts',' Sed ut iis bonis erigimur, quae expectamus, sic laetamur iis, quae recordamur. Duo Reges: constructio interrete. De hominibus dici non necesse est. An hoc usque quaque, aliter in vita? Itaque hic ipse iam pridem est reiectus; An ea, quae per vinitorem antea consequebatur, per se ipsa curabit? Atqui iste locus est, Piso, tibi etiam atque etiam confirmandus, inquam; \n\n','2016-02-14 21:55:46','2016-02-14 22:54:48',NULL,NULL,0,1,0),(284,1,1,1,'Accounts',' Zenonis est, inquam, hoc Stoici. Quid ad utilitatem tantae pecuniae? Longum est enim ad omnia respondere, quae a te dicta sunt. Duo Reges: constructio interrete. Graecis hoc modicum est: Leonidas, Epaminondas, tres aliqui aut quattuor; Hoc mihi cum tuo fratre convenit. Maximus dolor, inquit, brevis est. \n\n','2016-02-14 21:55:46','2016-02-14 22:54:48',NULL,NULL,0,1,0),(285,1,1,1,'Accounts',' Neque solum ea communia, verum etiam paria esse dixerunt. Dat enim intervalla et relaxat. Nam his libris eum malo quam reliquo ornatu villae delectari. Cur fortior sit, si illud, quod tute concedis, asperum et vix ferendum putabit? Ego vero isti, inquam, permitto. Duo Reges: constructio interrete. \n\n','2016-02-14 21:55:47','2016-02-14 22:54:49',NULL,NULL,0,1,0),(286,1,1,1,'Accounts',' At enim sequor utilitatem. Voluptatem cum summum bonum diceret, primum in eo ipso parum vidit, deinde hoc quoque alienum; Tum mihi Piso: Quid ergo? Nihil sane. Duo Reges: constructio interrete. Addidisti ad extremum etiam indoctum fuisse. Quacumque enim ingredimur, in aliqua historia vestigium ponimus. Hanc quoque iucunditatem, si vis, transfer in animum; Utram tandem linguam nescio? Quia dolori non voluptas contraria est, sed doloris privatio. Istam voluptatem perpetuam quis potest praestare sapienti? \n\n','2016-02-14 21:55:48','2016-02-14 22:54:49',NULL,NULL,0,1,0),(287,1,1,1,'Accounts',' Istam voluptatem, inquit, Epicurus ignorat? Fatebuntur Stoici haec omnia dicta esse praeclare, neque eam causam Zenoni desciscendi fuisse. Hoc mihi cum tuo fratre convenit. Illa videamus, quae a te de amicitia dicta sunt. Tum Piso: Quoniam igitur aliquid omnes, quid Lucius noster? Quae iam oratio non a philosopho aliquo, sed a censore opprimenda est. Non enim, si omnia non sequebatur, idcirco non erat ortus illinc. Duo Reges: constructio interrete. \n\n','2016-02-14 21:55:49','2016-02-14 22:54:49',NULL,NULL,0,1,0),(288,1,1,1,'Accounts',' Sint modo partes vitae beatae. Si quidem, inquit, tollerem, sed relinquo. Duo Reges: constructio interrete. Huius, Lyco, oratione locuples, rebus ipsis ielunior. Iam id ipsum absurdum, maximum malum neglegi. Omnes enim iucundum motum, quo sensus hilaretur. At enim sequor utilitatem. At Zeno eum non beatum modo, sed etiam divitem dicere ausus est. Quia, si mala sunt, is, qui erit in iis, beatus non erit. Non enim quaero quid verum, sed quid cuique dicendum sit. \n\n','2016-02-14 21:55:49','2016-02-14 22:54:50',NULL,NULL,0,1,0),(289,1,1,1,'Accounts',' At hoc in eo M. Et ille ridens: Video, inquit, quid agas; Quia dolori non voluptas contraria est, sed doloris privatio. Duo Reges: constructio interrete. Et ille ridens: Video, inquit, quid agas; \n\n','2016-02-14 21:55:50','2016-02-14 22:54:50',NULL,NULL,0,1,0),(290,1,1,1,'Accounts',' Tollitur beneficium, tollitur gratia, quae sunt vincla concordiae. Sed tu istuc dixti bene Latine, parum plane. Si verbum sequimur, primum longius verbum praepositum quam bonum. Hinc ceteri particulas arripere conati suam quisque videro voluit afferre sententiam. Illa videamus, quae a te de amicitia dicta sunt. Nihil enim iam habes, quod ad corpus referas; Contemnit enim disserendi elegantiam, confuse loquitur. Duo Reges: constructio interrete. Qui-vere falsone, quaerere mittimus-dicitur oculis se privasse; Perturbationes autem nulla naturae vi commoventur, omniaque ea sunt opiniones ac iudicia levitatis. \n\n','2016-02-14 21:55:51','2016-02-14 22:54:51',NULL,NULL,0,1,0),(291,1,1,1,'Accounts',' Quis suae urbis conservatorem Codrum, quis Erechthei filias non maxime laudat? Paria sunt igitur. Quicquid enim a sapientia proficiscitur, id continuo debet expletum esse omnibus suis partibus; Quorum sine causa fieri nihil putandum est. Ut scias me intellegere, primum idem esse dico voluptatem, quod ille don. Duo Reges: constructio interrete. Hoc ipsum elegantius poni meliusque potuit. \n\n','2016-02-14 21:55:51','2016-02-14 22:54:51',NULL,NULL,0,1,0),(292,1,1,1,'Accounts',' Nam et complectitur verbis, quod vult, et dicit plane, quod intellegam; Sic exclusis sententiis reliquorum cum praeterea nulla esse possit, haec antiquorum valeat necesse est. Quia dolori non voluptas contraria est, sed doloris privatio. Duo Reges: constructio interrete. An haec ab eo non dicuntur? Ad corpus diceres pertinere-, sed ea, quae dixi, ad corpusne refers? Avaritiamne minuis? Mihi enim satis est, ipsis non satis. \n\n','2016-02-14 21:55:52','2016-02-14 22:54:52',NULL,NULL,0,1,0),(293,1,1,1,'Accounts',' Quam illa ardentis amores excitaret sui! Cur tandem? Quid de Pythagora? At, si voluptas esset bonum, desideraret. Non risu potius quam oratione eiciendum? Duo Reges: constructio interrete. Res tota, Torquate, non doctorum hominum, velle post mortem epulis celebrari memoriam sui nominis. Satis est tibi in te, satis in legibus, satis in mediocribus amicitiis praesidii. Nullus est igitur cuiusquam dies natalis. \n\n','2016-02-14 21:55:53','2016-02-14 22:54:52',NULL,NULL,0,1,0),(294,1,1,1,'Accounts',' At ille pellit, qui permulcet sensum voluptate. At cum de plurimis eadem dicit, tum certe de maximis. Eam tum adesse, cum dolor omnis absit; Ergo instituto veterum, quo etiam Stoici utuntur, hinc capiamus exordium. Quae duo sunt, unum facit. Duo Reges: constructio interrete. \n\n','2016-02-14 21:55:53','2016-02-14 22:54:53',NULL,NULL,0,1,0),(295,1,1,1,'Accounts',' Nam quid possumus facere melius? Quae cum essent dicta, discessimus. Nihilo beatiorem esse Metellum quam Regulum. Quid ei reliquisti, nisi te, quoquo modo loqueretur, intellegere, quid diceret? Duo Reges: constructio interrete. Sic, et quidem diligentius saepiusque ista loquemur inter nos agemusque communiter. Quo plebiscito decreta a senatu est consuli quaestio Cn. Qui ita affectus, beatum esse numquam probabis; Potius inflammat, ut coercendi magis quam dedocendi esse videantur. \n\n','2016-02-14 21:55:54','2016-02-14 22:54:53',NULL,NULL,0,1,0),(296,1,1,1,'Accounts',' De ingenio eius in his disputationibus, non de moribus quaeritur. Profectus in exilium Tubulus statim nec respondere ausus; Respondent extrema primis, media utrisque, omnia omnibus. Duo Reges: constructio interrete. Apud imperitos tum illa dicta sunt, aliquid etiam coronae datum; Quod quidem nobis non saepe contingit. Nihil opus est exemplis hoc facere longius. Et certamen honestum et disputatio splendida! omnis est enim de virtutis dignitate contentio. \n\n','2016-02-14 21:55:55','2016-02-14 22:54:54',NULL,NULL,0,1,0),(297,1,1,1,'Accounts',' Hoc etsi multimodis reprehendi potest, tamen accipio, quod dant. Reguli reiciendam; Duo Reges: constructio interrete. Summus dolor plures dies manere non potest? Hunc vos beatum; Collige omnia, quae soletis: Praesidium amicorum. Quod autem ratione actum est, id officium appellamus. Sin laboramus, quis est, qui alienae modum statuat industriae? \n\n','2016-02-14 21:55:56','2016-02-14 22:54:54',NULL,NULL,0,1,0),(298,1,1,1,'Accounts',' Quod si ita se habeat, non possit beatam praestare vitam sapientia. Ergo illi intellegunt quid Epicurus dicat, ego non intellego? Nec vero alia sunt quaerenda contra Carneadeam illam sententiam. Perge porro; Id Sextilius factum negabat. Quicquid porro animo cernimus, id omne oritur a sensibus; \n\n','2016-02-14 21:55:56','2016-02-14 22:54:55',NULL,NULL,0,1,0),(299,1,1,1,'Accounts',' Ita similis erit ei finis boni, atque antea fuerat, neque idem tamen; Hanc ergo intuens debet institutum illud quasi signum absolvere. Sit enim idem caecus, debilis. Duo Reges: constructio interrete. \n\n','2016-02-14 21:55:57','2016-02-14 22:54:55',NULL,NULL,0,1,0),(300,1,1,1,'Accounts',' Ego vero isti, inquam, permitto. Hoc ne statuam quidem dicturam pater aiebat, si loqui posset. Saepe ab Aristotele, a Theophrasto mirabiliter est laudata per se ipsa rerum scientia; Hoc est non modo cor non habere, sed ne palatum quidem. Duo Reges: constructio interrete. \n\n','2016-02-14 21:55:58','2016-02-14 22:54:56',NULL,NULL,0,1,0),(301,1,1,1,'Accounts',' Falli igitur possumus. Qui enim voluptatem ipsam contemnunt, iis licet dicere se acupenserem maenae non anteponere. Hic nihil fuit, quod quaereremus. Confecta res esset. Duo Reges: constructio interrete. Dici enim nihil potest verius. Illa videamus, quae a te de amicitia dicta sunt. Si longus, levis; Tubulum fuisse, qua illum, cuius is condemnatus est rogatione, P. In his igitur partibus duabus nihil erat, quod Zeno commutare gestiret. \n\n','2016-02-14 21:55:58','2016-02-14 22:54:56',NULL,NULL,0,1,0),(302,1,1,1,'Accounts',' Bonum integritas corporis: misera debilitas. Videmusne ut pueri ne verberibus quidem a contemplandis rebus perquirendisque deterreantur? Isto modo ne improbos quidem, si essent boni viri. Si enim ad populum me vocas, eum. Duo Reges: constructio interrete. Hoc etsi multimodis reprehendi potest, tamen accipio, quod dant. Quae cum magnifice primo dici viderentur, considerata minus probabantur. Sit, inquam, tam facilis, quam vultis, comparatio voluptatis, quid de dolore dicemus? \n\n','2016-02-14 21:55:59','2016-02-14 22:54:57',NULL,NULL,0,1,0),(303,1,1,1,'Accounts',' Aufert enim sensus actionemque tollit omnem. Sed haec quidem liberius ab eo dicuntur et saepius. Non est igitur summum malum dolor. Quod quidem nobis non saepe contingit. Sin tantum modo ad indicia veteris memoriae cognoscenda, curiosorum. Duo Reges: constructio interrete. \n\n','2016-02-14 21:56:00','2016-02-14 22:54:57',NULL,NULL,0,1,0),(304,1,1,1,'Accounts',' Idemne potest esse dies saepius, qui semel fuit? An vero, inquit, quisquam potest probare, quod perceptfum, quod. Qui-vere falsone, quaerere mittimus-dicitur oculis se privasse; \n\n','2016-02-14 21:56:01','2016-02-14 22:54:57',NULL,NULL,0,1,0),(305,1,1,1,'Accounts',' Nam Pyrrho, Aristo, Erillus iam diu abiecti. Quid ergo aliud intellegetur nisi uti ne quae pars naturae neglegatur? Qua igitur re ab deo vincitur, si aeternitate non vincitur? Multoque hoc melius nos veriusque quam Stoici. Duo Reges: constructio interrete. Expectoque quid ad id, quod quaerebam, respondeas. Itaque fecimus. Haec para/doca illi, nos admirabilia dicamus. Ita fit cum gravior, tum etiam splendidior oratio. \n\n','2016-02-14 21:56:01','2016-02-14 22:54:58',NULL,NULL,0,1,0),(306,1,1,1,'Accounts',' Atque ab isto capite fluere necesse est omnem rationem bonorum et malorum. De malis autem et bonis ab iis animalibus, quae nondum depravata sint, ait optime iudicari. Duo Reges: constructio interrete. Et quidem, inquit, vehementer errat; Gloriosa ostentatio in constituendo summo bono. Duo enim genera quae erant, fecit tria. \n\n','2016-02-14 21:56:02','2016-02-14 22:54:58',NULL,NULL,0,1,0),(307,1,1,1,'Accounts',' Sed eum qui audiebant, quoad poterant, defendebant sententiam suam. An est aliquid, quod te sua sponte delectet? Videsne quam sit magna dissensio? Tibi hoc incredibile, quod beatissimum. Vestri haec verecundius, illi fortasse constantius. Aliter enim nosmet ipsos nosse non possumus. Ergo omni animali illud, quod appetiti positum est in eo, quod naturae est accommodatum. Duo Reges: constructio interrete. \n\n','2016-02-14 21:56:03','2016-02-14 22:54:59',NULL,NULL,0,1,0),(308,1,1,1,'Accounts',' Nam et complectitur verbis, quod vult, et dicit plane, quod intellegam; Ut proverbia non nulla veriora sint quam vestra dogmata. Nam de isto magna dissensio est. Quorum sine causa fieri nihil putandum est. -delector enim, quamquam te non possum, ut ais, corrumpere, delector, inquam, et familia vestra et nomine. \n\n','2016-02-14 21:56:03','2016-02-14 22:54:59',NULL,NULL,0,1,0),(309,1,1,1,'Accounts',' Omnes enim iucundum motum, quo sensus hilaretur. Nummus in Croesi divitiis obscuratur, pars est tamen divitiarum. Quae qui non vident, nihil umquam magnum ac cognitione dignum amaverunt. Duo Reges: constructio interrete. Et quod est munus, quod opus sapientiae? Et quod est munus, quod opus sapientiae? \n\n','2016-02-14 21:56:04','2016-02-14 22:55:00',NULL,NULL,0,1,0),(310,1,1,1,'Accounts',' Isto modo ne improbos quidem, si essent boni viri. Et ille ridens: Video, inquit, quid agas; Progredientibus autem aetatibus sensim tardeve potius quasi nosmet ipsos cognoscimus. Duo Reges: constructio interrete. \n\n','2016-02-14 21:56:05','2016-02-14 22:55:00',NULL,NULL,0,1,0),(311,1,1,1,'Accounts',' Quae cum dixisset paulumque institisset, Quid est? Si stante, hoc natura videlicet vult, salvam esse se, quod concedimus; Duo Reges: constructio interrete. Illa tamen simplicia, vestra versuta. Qualis ista philosophia est, quae non interitum afferat pravitatis, sed sit contenta mediocritate vitiorum? Theophrastus mediocriterne delectat, cum tractat locos ab Aristotele ante tractatos? \n\n','2016-02-14 21:56:06','2016-02-14 22:55:01',NULL,NULL,0,1,0),(312,1,1,1,'Accounts',' Nihil opus est exemplis hoc facere longius. Sed haec ab Antiocho, familiari nostro, dicuntur multo melius et fortius, quam a Stasea dicebantur. Est enim effectrix multarum et magnarum voluptatum. Color egregius, integra valitudo, summa gratia, vita denique conferta voluptatum omnium varietate. Octavio fuit, cum illam severitatem in eo filio adhibuit, quem in adoptionem D. Praeclare hoc quidem. Tu vero, inquam, ducas licet, si sequetur; \n\n','2016-02-14 21:56:06','2016-02-14 22:55:01',NULL,NULL,0,1,0),(313,1,1,1,'Accounts',' Mihi quidem Antiochum, quem audis, satis belle videris attendere. Ea possunt paria non esse. Verum tamen cum de rebus grandioribus dicas, ipsae res verba rapiunt; Atqui iste locus est, Piso, tibi etiam atque etiam confirmandus, inquam; Nam his libris eum malo quam reliquo ornatu villae delectari. Ita fit cum gravior, tum etiam splendidior oratio. Duo Reges: constructio interrete. Idem iste, inquam, de voluptate quid sentit? Sed eum qui audiebant, quoad poterant, defendebant sententiam suam. Quia, si mala sunt, is, qui erit in iis, beatus non erit. \n\n','2016-02-14 21:56:07','2016-02-14 22:55:01',NULL,NULL,0,1,0),(314,1,1,1,'Accounts',' Quis non odit sordidos, vanos, leves, futtiles? Quamquam tu hanc copiosiorem etiam soles dicere. Duo Reges: constructio interrete. Qui est in parvis malis. Cur tantas regiones barbarorum pedibus obiit, tot maria transmisit? Ut in voluptate sit, qui epuletur, in dolore, qui torqueatur. Quae duo sunt, unum facit. Si alia sentit, inquam, alia loquitur, numquam intellegam quid sentiat; \n\n','2016-02-14 21:56:08','2016-02-14 22:55:02',NULL,NULL,0,1,0),(315,1,1,1,'Accounts',' Neque solum ea communia, verum etiam paria esse dixerunt. Quaerimus enim finem bonorum. Nam quibus rebus efficiuntur voluptates, eae non sunt in potestate sapientis. Multoque hoc melius nos veriusque quam Stoici. Traditur, inquit, ab Epicuro ratio neglegendi doloris. Cuius ad naturam apta ratio vera illa et summa lex a philosophis dicitur. \n\n','2016-02-14 21:56:09','2016-02-14 22:55:02',NULL,NULL,0,1,0),(316,1,1,1,'Accounts',' Hoc loco tenere se Triarius non potuit. Sed in rebus apertissimis nimium longi sumus. Duo Reges: constructio interrete. Quod quidem iam fit etiam in Academia. Scaevola tribunus plebis ferret ad plebem vellentne de ea re quaeri. \n\n','2016-02-14 21:56:10','2016-02-14 22:55:03',NULL,NULL,0,1,0),(317,1,1,1,'Accounts',' Ut proverbia non nulla veriora sint quam vestra dogmata. His enim rebus detractis negat se reperire in asotorum vita quod reprehendat. An haec ab eo non dicuntur? Facit enim ille duo seiuncta ultima bonorum, quae ut essent vera, coniungi debuerunt; Rationis enim perfectio est virtus; Idem iste, inquam, de voluptate quid sentit? Potius ergo illa dicantur: turpe esse, viri non esse debilitari dolore, frangi, succumbere. \n\n','2016-02-14 21:56:11','2016-02-14 22:55:04',NULL,NULL,0,1,0),(318,1,1,1,'Accounts',' Cur haec eadem Democritus? Sed quid attinet de rebus tam apertis plura requirere? Duo Reges: constructio interrete. Aliter enim nosmet ipsos nosse non possumus. \n\n','2016-02-14 21:56:11','2016-02-14 22:55:04',NULL,NULL,0,1,0),(319,1,1,1,'Accounts',' Atqui iste locus est, Piso, tibi etiam atque etiam confirmandus, inquam; Age, inquies, ista parva sunt. Primum divisit ineleganter; Parvi enim primo ortu sic iacent, tamquam omnino sine animo sint. Nunc vides, quid faciat. Duo Reges: constructio interrete. Ergo adhuc, quantum equidem intellego, causa non videtur fuisse mutandi nominis. Nam Pyrrho, Aristo, Erillus iam diu abiecti. Idem iste, inquam, de voluptate quid sentit? \n\n','2016-02-14 21:56:12','2016-02-14 22:55:05',NULL,NULL,0,1,0),(320,1,1,1,'Accounts',' Illa videamus, quae a te de amicitia dicta sunt. Esse enim, nisi eris, non potes. Duo Reges: constructio interrete. Non autem hoc: igitur ne illud quidem. Mihi, inquam, qui te id ipsum rogavi? Illi enim inter se dissentiunt. \n\n','2016-02-14 21:56:13','2016-02-14 22:55:05',NULL,NULL,0,1,0),(321,1,1,1,'Accounts',' Et ille ridens: Video, inquit, quid agas; Quod ea non occurrentia fingunt, vincunt Aristonem; Hoc non est positum in nostra actione. Prioris generis est docilitas, memoria; Quae duo sunt, unum facit. Duo Reges: constructio interrete. Expressa vero in iis aetatibus, quae iam confirmatae sunt. Ratio quidem vestra sic cogit. Quo studio Aristophanem putamus aetatem in litteris duxisse? \n\n','2016-02-14 21:56:13','2016-02-14 22:55:05',NULL,NULL,0,1,0),(322,1,1,1,'Accounts',' Expectoque quid ad id, quod quaerebam, respondeas. Quid vero? At hoc in eo M. Habent enim et bene longam et satis litigiosam disputationem. Mihi enim satis est, ipsis non satis. Maximas vero virtutes iacere omnis necesse est voluptate dominante. Quid enim est a Chrysippo praetermissum in Stoicis? Duo Reges: constructio interrete. Illa argumenta propria videamus, cur omnia sint paria peccata. Collatio igitur ista te nihil iuvat. \n\n','2016-02-14 21:56:14','2016-02-14 22:55:06',NULL,NULL,0,1,0),(323,1,1,1,'Accounts',' An eiusdem modi? Que Manilium, ab iisque M. \n\n','2016-02-14 21:56:15','2016-02-14 22:55:06',NULL,NULL,0,1,0),(324,1,1,1,'Accounts',' Audax negotium, dicerem impudens, nisi hoc institutum postea translatum ad philosophos nostros esset. Potius ergo illa dicantur: turpe esse, viri non esse debilitari dolore, frangi, succumbere. Nec enim, dum metuit, iustus est, et certe, si metuere destiterit, non erit; Quid, quod homines infima fortuna, nulla spe rerum gerendarum, opifices denique delectantur historia? \n\n','2016-02-14 21:56:16','2016-02-14 22:55:07',NULL,NULL,0,1,0),(325,1,1,1,'Accounts',' Et ille ridens: Video, inquit, quid agas; At quicum ioca seria, ut dicitur, quicum arcana, quicum occulta omnia? Nec vero alia sunt quaerenda contra Carneadeam illam sententiam. Ergo adhuc, quantum equidem intellego, causa non videtur fuisse mutandi nominis. Illa videamus, quae a te de amicitia dicta sunt. \n\n','2016-02-14 21:56:16','2016-02-14 22:55:07',NULL,NULL,0,1,0),(326,1,1,1,'Accounts',' A mene tu? Primum cur ista res digna odio est, nisi quod est turpis? Si mala non sunt, iacet omnis ratio Peripateticorum. Illis videtur, qui illud non dubitant bonum dicere -; Non enim quaero quid verum, sed quid cuique dicendum sit. Eadem nunc mea adversum te oratio est. Duo Reges: constructio interrete. Eiuro, inquit adridens, iniquum, hac quidem de re; \n\n','2016-02-14 21:56:17','2016-02-14 22:55:08',NULL,NULL,0,1,0),(327,1,1,1,'Accounts',' Atqui reperies, inquit, in hoc quidem pertinacem; Tecum optime, deinde etiam cum mediocri amico. Sed quid attinet de rebus tam apertis plura requirere? Duo Reges: constructio interrete. Ut proverbia non nulla veriora sint quam vestra dogmata. \n\n','2016-02-14 21:56:18','2016-02-14 22:55:08',NULL,NULL,0,1,0),(328,1,1,1,'Accounts',' Ergo id est convenienter naturae vivere, a natura discedere. Duo enim genera quae erant, fecit tria. Quare ad ea primum, si videtur; Non dolere, inquam, istud quam vim habeat postea videro; Quid ergo aliud intellegetur nisi uti ne quae pars naturae neglegatur? Satis est ad hoc responsum. Sed tamen intellego quid velit. \n\n','2016-02-14 21:56:18','2016-02-14 22:55:09',NULL,NULL,0,1,0),(329,1,1,1,'Accounts',' Obsecro, inquit, Torquate, haec dicit Epicurus? Itaque sensibus rationem adiunxit et ratione effecta sensus non reliquit. Expectoque quid ad id, quod quaerebam, respondeas. Negat esse eam, inquit, propter se expetendam. Atque haec coniunctio confusioque virtutum tamen a philosophis ratione quadam distinguitur. Quid de Pythagora? \n\n','2016-02-14 21:56:19','2016-02-14 22:55:09',NULL,NULL,0,1,0),(330,1,1,1,'Accounts',' Sed haec quidem liberius ab eo dicuntur et saepius. Materiam vero rerum et copiam apud hos exilem, apud illos uberrimam reperiemus. Quamquam id quidem licebit iis existimare, qui legerint. Haec mihi videtur delicatior, ut ita dicam, molliorque ratio, quam virtutis vis gravitasque postulat. Satisne vobis videor pro meo iure in vestris auribus commentatus? Duo Reges: constructio interrete. Cupit enim dícere nihil posse ad beatam vitam deesse sapienti. Respondeat totidem verbis. \n\n','2016-02-14 21:56:20','2016-02-14 22:55:09',NULL,NULL,0,1,0),(331,1,1,1,'Accounts',' Conclusum est enim contra Cyrenaicos satis acute, nihil ad Epicurum. Cupit enim dícere nihil posse ad beatam vitam deesse sapienti. Quia, si mala sunt, is, qui erit in iis, beatus non erit. Nam adhuc, meo fortasse vitio, quid ego quaeram non perspicis. Duo Reges: constructio interrete. Illa sunt similia: hebes acies est cuipiam oculorum, corpore alius senescit; Sint modo partes vitae beatae. Re mihi non aeque satisfacit, et quidem locis pluribus. Qui igitur convenit ab alia voluptate dicere naturam proficisci, in alia summum bonum ponere? Igitur ne dolorem quidem. A mene tu? \n\n','2016-02-14 21:56:21','2016-02-14 22:55:10',NULL,NULL,0,1,0),(332,1,1,1,'Accounts',' Quid autem habent admirationis, cum prope accesseris? Nunc haec primum fortasse audientis servire debemus. Ita fit beatae vitae domina fortuna, quam Epicurus ait exiguam intervenire sapienti. Duo Reges: constructio interrete. Quid turpius quam sapientis vitam ex insipientium sermone pendere? Et quidem, inquit, vehementer errat; Cur ipse Pythagoras et Aegyptum lustravit et Persarum magos adiit? \n\n','2016-02-14 21:56:21','2016-02-14 22:55:10',NULL,NULL,0,1,0),(333,1,1,1,'Accounts',' Non est igitur voluptas bonum. Quamquam tu hanc copiosiorem etiam soles dicere. Sequitur disserendi ratio cognitioque naturae; Non modo carum sibi quemque, verum etiam vehementer carum esse? Duo Reges: constructio interrete. Si quicquam extra virtutem habeatur in bonis. Quae quidem vel cum periculo est quaerenda vobis; Quamquam haec quidem praeposita recte et reiecta dicere licebit. Ergo illi intellegunt quid Epicurus dicat, ego non intellego? \n\n','2016-02-14 21:56:22','2016-02-14 22:55:11',NULL,NULL,0,1,0),(334,1,1,1,'Accounts',' Virtutis, magnitudinis animi, patientiae, fortitudinis fomentis dolor mitigari solet. Nam ista vestra: Si gravis, brevis; Tu autem negas fortem esse quemquam posse, qui dolorem malum putet. Duo Reges: constructio interrete. Atqui reperies, inquit, in hoc quidem pertinacem; Obsecro, inquit, Torquate, haec dicit Epicurus? Illis videtur, qui illud non dubitant bonum dicere -; Proclivi currit oratio. Primum in nostrane potestate est, quid meminerimus? Sed erat aequius Triarium aliquid de dissensione nostra iudicare. Parvi enim primo ortu sic iacent, tamquam omnino sine animo sint. \n\n','2016-02-14 21:56:23','2016-02-14 22:55:11',NULL,NULL,0,1,0),(335,1,1,1,'Accounts',' Quod iam a me expectare noli. Habent enim et bene longam et satis litigiosam disputationem. Cupiditates non Epicuri divisione finiebat, sed sua satietate. Utinam quidem dicerent alium alio beatiorem! Iam ruinas videres. Ego vero volo in virtute vim esse quam maximam; At ego quem huic anteponam non audeo dicere; \n\n','2016-02-14 21:56:23','2016-02-14 22:55:11',NULL,NULL,0,1,0),(336,1,1,1,'Accounts',' Quid sequatur, quid repugnet, vident. Duo Reges: constructio interrete. Aliud igitur esse censet gaudere, aliud non dolere. Nam et complectitur verbis, quod vult, et dicit plane, quod intellegam; \n\n','2016-02-14 21:56:24','2016-02-14 22:55:12',NULL,NULL,0,1,0),(337,1,1,1,'Accounts',' Quae hic rei publicae vulnera inponebat, eadem ille sanabat. Hoc ipsum elegantius poni meliusque potuit. Qui autem esse poteris, nisi te amor ipse ceperit? Quamquam te quidem video minime esse deterritum. Honesta oratio, Socratica, Platonis etiam. Quae cum ita sint, effectum est nihil esse malum, quod turpe non sit. Duo Reges: constructio interrete. Innumerabilia dici possunt in hanc sententiam, sed non necesse est. \n\n','2016-02-14 21:56:25','2016-02-14 22:55:13',NULL,NULL,0,1,0),(338,1,1,1,'Accounts',' Quid censes in Latino fore? Esse enim quam vellet iniquus iustus poterat inpune. Duo Reges: constructio interrete. Maximas vero virtutes iacere omnis necesse est voluptate dominante. Hoc etsi multimodis reprehendi potest, tamen accipio, quod dant. Inquit, dasne adolescenti veniam? Nihilo magis. Tecum optime, deinde etiam cum mediocri amico. \n\n','2016-02-14 21:56:26','2016-02-14 22:55:13',NULL,NULL,0,1,0),(339,1,1,1,'Accounts',' Quo modo autem philosophus loquitur? Atque his de rebus et splendida est eorum et illustris oratio. Suam denique cuique naturam esse ad vivendum ducem. De illis, cum volemus. Atqui, inquam, Cato, si istud optinueris, traducas me ad te totum licebit. Duo Reges: constructio interrete. Tu autem inter haec tantam multitudinem hominum interiectam non vides nec laetantium nec dolentium? Nondum autem explanatum satis, erat, quid maxime natura vellet. Tum ille: Ain tandem? Suo genere perveniant ad extremum; \n\n','2016-02-14 21:56:26','2016-02-14 22:55:13',NULL,NULL,0,1,0),(340,1,1,1,'Accounts',' Et ille ridens: Video, inquit, quid agas; Proclivi currit oratio. Sic, et quidem diligentius saepiusque ista loquemur inter nos agemusque communiter. Levatio igitur vitiorum magna fit in iis, qui habent ad virtutem progressionis aliquantum. Duo Reges: constructio interrete. \n\n','2016-02-14 21:56:27','2016-02-14 22:55:14',NULL,NULL,0,1,0),(341,1,1,1,'Accounts',' Non est igitur voluptas bonum. Summus dolor plures dies manere non potest? Omnium enim rerum principia parva sunt, sed suis progressionibus usa augentur nec sine causa; Nunc omni virtuti vitium contrario nomine opponitur. Piso, familiaris noster, et alia multa et hoc loco Stoicos irridebat: Quid enim? Non quaero, quid dicat, sed quid convenienter possit rationi et sententiae suae dicere. Quod ea non occurrentia fingunt, vincunt Aristonem; Duo Reges: constructio interrete. \n\n','2016-02-14 21:56:28','2016-02-14 22:55:15',NULL,NULL,0,1,0),(342,1,1,1,'Accounts',' Tibi hoc incredibile, quod beatissimum. Nam, ut sint illa vendibiliora, haec uberiora certe sunt. Sic enim censent, oportunitatis esse beate vivere. Duo Reges: constructio interrete. Qui potest igitur habitare in beata vita summi mali metus? Quid est igitur, cur ita semper deum appellet Epicurus beatum et aeternum? Iam id ipsum absurdum, maximum malum neglegi. Non quam nostram quidem, inquit Pomponius iocans; \n\n','2016-02-14 21:56:28','2016-02-14 22:55:15',NULL,NULL,0,1,0),(343,1,1,1,'Accounts',' Quid, quod res alia tota est? An vero displicuit ea, quae tributa est animi virtutibus tanta praestantia? Ergo ita: non posse honeste vivi, nisi honeste vivatur? Quia nec honesto quic quam honestius nec turpi turpius. Mene ergo et Triarium dignos existimas, apud quos turpiter loquare? Duo Reges: constructio interrete. Nam prius a se poterit quisque discedere quam appetitum earum rerum, quae sibi conducant, amittere. Atque haec coniunctio confusioque virtutum tamen a philosophis ratione quadam distinguitur. \n\n','2016-02-14 21:56:29','2016-02-14 22:55:16',NULL,NULL,0,1,0),(344,1,1,1,'Accounts',' Quasi ego id curem, quid ille aiat aut neget. Quis, quaeso, illum negat et bonum virum et comem et humanum fuisse? Sed fortuna fortis; Cum audissem Antiochum, Brute, ut solebam, cum M. At multis malis affectus. Duo Reges: constructio interrete. Videmusne ut pueri ne verberibus quidem a contemplandis rebus perquirendisque deterreantur? Nemo igitur esse beatus potest. \n\n','2016-02-14 21:56:30','2016-02-14 22:55:16',NULL,NULL,0,1,0),(345,1,1,1,'Accounts',' Egone non intellego, quid sit don Graece, Latine voluptas? Non igitur potestis voluptate omnia dirigentes aut tueri aut retinere virtutem. Venit ad extremum; Ego vero volo in virtute vim esse quam maximam; Ne amores quidem sanctos a sapiente alienos esse arbitrantur. Tibi hoc incredibile, quod beatissimum. Ergo id est convenienter naturae vivere, a natura discedere. \n\n','2016-02-14 21:56:30','2016-02-14 22:55:17',NULL,NULL,0,1,0),(346,1,1,1,'Accounts',' Bonum liberi: misera orbitas. Quare hoc videndum est, possitne nobis hoc ratio philosophorum dare. Plane idem, inquit, et maxima quidem, qua fieri nulla maior potest. His singulis copiose responderi solet, sed quae perspicua sunt longa esse non debent. Quod cum dixissent, ille contra. Ita redarguitur ipse a sese, convincunturque scripta eius probitate ipsius ac moribus. \n\n','2016-02-14 21:56:31','2016-02-14 22:55:17',NULL,NULL,0,1,0),(347,1,1,1,'Accounts',' Quis non odit sordidos, vanos, leves, futtiles? Quod idem cum vestri faciant, non satis magnam tribuunt inventoribus gratiam. Hosne igitur laudas et hanc eorum, inquam, sententiam sequi nos censes oportere? Egone non intellego, quid sit don Graece, Latine voluptas? Tum mihi Piso: Quid ergo? Duo Reges: constructio interrete. Sic enim censent, oportunitatis esse beate vivere. Sin tantum modo ad indicia veteris memoriae cognoscenda, curiosorum. At modo dixeras nihil in istis rebus esse, quod interesset. Vitiosum est enim in dividendo partem in genere numerare. \n\n','2016-02-14 21:56:34','2016-02-14 22:55:17',NULL,NULL,0,1,0),(348,1,1,1,'Accounts',' Tertium autem omnibus aut maximis rebus iis, quae secundum naturam sint, fruentem vivere. Nescio quo modo praetervolavit oratio. Sit hoc ultimum bonorum, quod nunc a me defenditur; Quo studio Aristophanem putamus aetatem in litteris duxisse? Ab his oratores, ab his imperatores ac rerum publicarum principes extiterunt. Duo Reges: constructio interrete. \n\n','2016-02-14 21:56:34','2016-02-14 22:55:18',NULL,NULL,0,1,0),(349,1,1,1,'Accounts',' Ita multo sanguine profuso in laetitia et in victoria est mortuus. Ita fit beatae vitae domina fortuna, quam Epicurus ait exiguam intervenire sapienti. Atque hoc loco similitudines eas, quibus illi uti solent, dissimillimas proferebas. Ne tum quidem te respicies et cogitabis sibi quemque natum esse et suis voluptatibus? Ita ne hoc quidem modo paria peccata sunt. Mihi enim satis est, ipsis non satis. Hoc loco tenere se Triarius non potuit. Duo Reges: constructio interrete. \n\n','2016-02-14 21:56:35','2016-02-14 22:55:18',NULL,NULL,0,1,0),(350,1,1,1,'Accounts',' Quae autem natura suae primae institutionis oblita est? Est autem etiam actio quaedam corporis, quae motus et status naturae congruentis tenet; Contemnit enim disserendi elegantiam, confuse loquitur. Si alia sentit, inquam, alia loquitur, numquam intellegam quid sentiat; Etenim semper illud extra est, quod arte comprehenditur. Nihil minus, contraque illa hereditate dives ob eamque rem laetus. \n\n','2016-02-14 21:56:36','2016-02-14 22:55:19',NULL,NULL,0,1,0),(351,1,1,1,'Accounts',' Hanc quoque iucunditatem, si vis, transfer in animum; Respondent extrema primis, media utrisque, omnia omnibus. Quid ergo attinet gloriose loqui, nisi constanter loquare? Putabam equidem satis, inquit, me dixisse. Illum mallem levares, quo optimum atque humanissimum virum, Cn. Si longus, levis dictata sunt. Apud imperitos tum illa dicta sunt, aliquid etiam coronae datum; \n\n','2016-02-14 21:56:36','2016-02-14 22:55:19',NULL,NULL,0,1,0),(352,1,1,1,'Accounts',' Res enim concurrent contrariae. Et quidem Arcesilas tuus, etsi fuit in disserendo pertinacior, tamen noster fuit; Cave putes quicquam esse verius. \n\n','2016-02-14 21:56:37','2016-02-14 22:55:20',NULL,NULL,0,1,0),(353,1,1,1,'Accounts',' Quae cum magnifice primo dici viderentur, considerata minus probabantur. Non est enim vitium in oratione solum, sed etiam in moribus. Prioris generis est docilitas, memoria; Tum ille timide vel potius verecunde: Facio, inquit. Duo Reges: constructio interrete. Nunc haec primum fortasse audientis servire debemus. Sedulo, inquam, faciam. Qui est in parvis malis. \n\n','2016-02-14 21:56:39','2016-02-14 22:55:20',NULL,NULL,0,1,0),(354,1,1,1,'Accounts',' Sic consequentibus vestris sublatis prima tolluntur. Cui Tubuli nomen odio non est? Utinam quidem dicerent alium alio beatiorem! Iam ruinas videres. Duo Reges: constructio interrete. \n\n','2016-02-14 21:56:40','2016-02-14 22:55:20',NULL,NULL,0,1,0),(355,1,1,1,'Accounts',' Quae cum dixisset paulumque institisset, Quid est? Erat enim res aperta. Certe non potest. Non est igitur summum malum dolor. Ego quoque, inquit, didicerim libentius si quid attuleris, quam te reprehenderim. Duo Reges: constructio interrete. Propter nos enim illam, non propter eam nosmet ipsos diligimus. Si alia sentit, inquam, alia loquitur, numquam intellegam quid sentiat; \n\n','2016-02-14 21:56:40','2016-02-14 22:55:21',NULL,NULL,0,1,0),(356,1,1,1,'Accounts',' Primum in nostrane potestate est, quid meminerimus? Restinguet citius, si ardentem acceperit. Sed quoniam et advesperascit et mihi ad villam revertendum est, nunc quidem hactenus; Duo Reges: constructio interrete. Philosophi autem in suis lectulis plerumque moriuntur. Quid ergo aliud intellegetur nisi uti ne quae pars naturae neglegatur? Hoc ne statuam quidem dicturam pater aiebat, si loqui posset. Quae quo sunt excelsiores, eo dant clariora indicia naturae. Quid de Platone aut de Democrito loquar? \n\n','2016-02-14 21:56:41','2016-02-14 22:55:21',NULL,NULL,0,1,0),(357,1,1,1,'Accounts',' Quorum sine causa fieri nihil putandum est. Non quaeritur autem quid naturae tuae consentaneum sit, sed quid disciplinae. Ille vero, si insipiens-quo certe, quoniam tyrannus -, numquam beatus; \n\n','2016-02-14 21:56:42','2016-02-14 22:55:22',NULL,NULL,0,1,0),(358,1,1,1,'Accounts',' Unum nescio, quo modo possit, si luxuriosus sit, finitas cupiditates habere. Est enim effectrix multarum et magnarum voluptatum. Qui non moveatur et offensione turpitudinis et comprobatione honestatis? Tum Quintus: Est plane, Piso, ut dicis, inquit. Duo Reges: constructio interrete. Haec quo modo conveniant, non sane intellego. \n\n','2016-02-14 21:56:42','2016-02-14 22:55:22',NULL,NULL,0,1,0),(359,1,1,1,'Accounts',' Facile est hoc cernere in primis puerorum aetatulis. At hoc in eo M. Quod autem satis est, eo quicquid accessit, nimium est; Cum ageremus, inquit, vitae beatum et eundem supremum diem, scribebamus haec. Bonum patria: miserum exilium. Sed haec nihil sane ad rem; \n\n','2016-02-14 21:56:43','2016-02-14 22:55:23',NULL,NULL,0,1,0),(360,1,1,1,'Accounts',' Sin tantum modo ad indicia veteris memoriae cognoscenda, curiosorum. Traditur, inquit, ab Epicuro ratio neglegendi doloris. De hominibus dici non necesse est. Aut haec tibi, Torquate, sunt vituperanda aut patrocinium voluptatis repudiandum. \n\n','2016-02-14 21:56:44','2016-02-14 22:55:23',NULL,NULL,0,1,0),(361,1,1,1,'Accounts',' Oculorum, inquit Plato, est in nobis sensus acerrimus, quibus sapientiam non cernimus. An me, inquam, nisi te audire vellem, censes haec dicturum fuisse? Quamvis enim depravatae non sint, pravae tamen esse possunt. Eorum enim est haec querela, qui sibi cari sunt seseque diligunt. Duo Reges: constructio interrete. Summus dolor plures dies manere non potest? Cum ageremus, inquit, vitae beatum et eundem supremum diem, scribebamus haec. Summus dolor plures dies manere non potest? Hoc est dicere: Non reprehenderem asotos, si non essent asoti. \n\n','2016-02-14 21:56:45','2016-02-14 22:55:24',NULL,NULL,0,1,0),(362,1,1,1,'Accounts',' Quodcumque in mentem incideret, et quodcumque tamquam occurreret. Quae animi affectio suum cuique tribuens atque hanc, quam dico. Duo Reges: constructio interrete. Mihi enim satis est, ipsis non satis. \n\n','2016-02-14 21:56:45','2016-02-14 22:55:24',NULL,NULL,0,1,0),(363,1,1,1,'Accounts',' Ergo hoc quidem apparet, nos ad agendum esse natos. Eam stabilem appellas. An eum discere ea mavis, quae cum plane perdidiceriti nihil sciat? Conferam avum tuum Drusum cum C. Duo Reges: constructio interrete. Quae cum dixisset, finem ille. Omnia contraria, quos etiam insanos esse vultis. Ut proverbia non nulla veriora sint quam vestra dogmata. Quid enim de amicitia statueris utilitatis causa expetenda vides. Cum autem in quo sapienter dicimus, id a primo rectissime dicitur. \n\n','2016-02-14 21:56:46','2016-02-14 22:55:24',NULL,NULL,0,1,0),(364,1,1,1,'Accounts',' Inde igitur, inquit, ordiendum est. Non potes, nisi retexueris illa. Re mihi non aeque satisfacit, et quidem locis pluribus. In quibus doctissimi illi veteres inesse quiddam caeleste et divinum putaverunt. \n\n','2016-02-14 21:56:47','2016-02-14 22:55:25',NULL,NULL,0,1,0),(365,1,1,1,'Accounts',' Si verbum sequimur, primum longius verbum praepositum quam bonum. Vitiosum est enim in dividendo partem in genere numerare. Ita multa dicunt, quae vix intellegam. Qui enim existimabit posse se miserum esse beatus non erit. Suo genere perveniant ad extremum; Duo Reges: constructio interrete. Hoc non est positum in nostra actione. Respondent extrema primis, media utrisque, omnia omnibus. \n\n','2016-02-14 21:56:47','2016-02-14 22:55:26',NULL,NULL,0,1,0),(366,1,1,1,'Accounts',' An quod ita callida est, ut optime possit architectari voluptates? Quo studio Aristophanem putamus aetatem in litteris duxisse? An vero, inquit, quisquam potest probare, quod perceptfum, quod. Huius ego nunc auctoritatem sequens idem faciam. Qua tu etiam inprudens utebare non numquam. Duo Reges: constructio interrete. Quid ad utilitatem tantae pecuniae? \n\n','2016-02-14 21:56:48','2016-02-14 22:55:26',NULL,NULL,0,1,0),(367,1,1,1,'Accounts',' Beatus sibi videtur esse moriens. Huius ego nunc auctoritatem sequens idem faciam. Modo etiam paulum ad dexteram de via declinavi, ut ad Pericli sepulcrum accederem. Consequentia exquirere, quoad sit id, quod volumus, effectum. Duo Reges: constructio interrete. Quod idem cum vestri faciant, non satis magnam tribuunt inventoribus gratiam. Nam quid possumus facere melius? Sed quid minus probandum quam esse aliquem beatum nec satis beatum? Quae sequuntur igitur? \n\n','2016-02-14 21:56:49','2016-02-14 22:55:27',NULL,NULL,0,1,0),(368,1,1,1,'Accounts',' Quae cum praeponunt, ut sit aliqua rerum selectio, naturam videntur sequi; Ita graviter et severe voluptatem secrevit a bono. Res enim fortasse verae, certe graves, non ita tractantur, ut debent, sed aliquanto minutius. Sit enim idem caecus, debilis. Rationis enim perfectio est virtus; Nam illud vehementer repugnat, eundem beatum esse et multis malis oppressum. Cum autem in quo sapienter dicimus, id a primo rectissime dicitur. Ita cum ea volunt retinere, quae superiori sententiae conveniunt, in Aristonem incidunt; Duo Reges: constructio interrete. \n\n','2016-02-14 21:56:50','2016-02-14 22:55:27',NULL,NULL,0,1,0),(369,1,1,1,'Accounts',' Cur igitur, inquam, res tam dissimiles eodem nomine appellas? Qui autem esse poteris, nisi te amor ipse ceperit? Ad eos igitur converte te, quaeso. Duo Reges: constructio interrete. Quamquam ab iis philosophiam et omnes ingenuas disciplinas habemus; De ingenio eius in his disputationibus, non de moribus quaeritur. Velut ego nunc moveor. Familiares nostros, credo, Sironem dicis et Philodemum, cum optimos viros, tum homines doctissimos. \n\n','2016-02-14 21:56:50','2016-02-14 22:55:27',NULL,NULL,0,1,0),(370,1,1,1,'Accounts',' Quod autem in homine praestantissimum atque optimum est, id deseruit. Hoc ipsum elegantius poni meliusque potuit. Videsne quam sit magna dissensio? Quid enim possumus hoc agere divinius? Virtutis, magnitudinis animi, patientiae, fortitudinis fomentis dolor mitigari solet. Duo Reges: constructio interrete. Si stante, hoc natura videlicet vult, salvam esse se, quod concedimus; Huius, Lyco, oratione locuples, rebus ipsis ielunior. Tamen a proposito, inquam, aberramus. Sed quoniam et advesperascit et mihi ad villam revertendum est, nunc quidem hactenus; Non est enim vitium in oratione solum, sed etiam in moribus. Neque solum ea communia, verum etiam paria esse dixerunt. \n\n','2016-02-14 21:56:51','2016-02-14 22:55:28',NULL,NULL,0,1,0),(371,1,1,1,'Accounts',' Restatis igitur vos; Quae similitudo in genere etiam humano apparet. Iam doloris medicamenta illa Epicurea tamquam de narthecio proment: Si gravis, brevis; Memini vero, inquam; Habent enim et bene longam et satis litigiosam disputationem. Itaque eos id agere, ut a se dolores, morbos, debilitates repellant. Certe nihil nisi quod possit ipsum propter se iure laudari. Duo Reges: constructio interrete. \n\n','2016-02-14 21:56:52','2016-02-14 22:55:28',NULL,NULL,0,1,0),(372,1,1,1,'Accounts',' Non enim quaero quid verum, sed quid cuique dicendum sit. Fortemne possumus dicere eundem illum Torquatum? Praeclare enim Plato: Beatum, cui etiam in senectute contigerit, ut sapientiam verasque opiniones assequi possit. \n\n','2016-02-14 21:56:52','2016-02-14 22:55:29',NULL,NULL,0,1,0),(373,1,1,1,'Accounts',' Quamquam tu hanc copiosiorem etiam soles dicere. Tu autem, si tibi illa probabantur, cur non propriis verbis ea tenebas? \n\n','2016-02-14 21:56:53','2016-02-14 22:55:29',NULL,NULL,0,1,0),(374,1,1,1,'Accounts',' In eo enim positum est id, quod dicimus esse expetendum. Non est ista, inquam, Piso, magna dissensio. Septem autem illi non suo, sed populorum suffragio omnium nominati sunt. Duo Reges: constructio interrete. Ego vero volo in virtute vim esse quam maximam; Neque enim civitas in seditione beata esse potest nec in discordia dominorum domus; Transfer idem ad modestiam vel temperantiam, quae est moderatio cupiditatum rationi oboediens. \n\n','2016-02-14 21:56:54','2016-02-14 22:55:30',NULL,NULL,0,1,0),(375,1,1,1,'Accounts',' Nam quid possumus facere melius? Age nunc isti doceant, vel tu potius quis enim ista melius? Non est igitur voluptas bonum. Scisse enim te quis coarguere possit? Duo Reges: constructio interrete. Luxuriam non reprehendit, modo sit vacua infinita cupiditate et timore. Aliter enim explicari, quod quaeritur, non potest. Atque hoc loco similitudines eas, quibus illi uti solent, dissimillimas proferebas. Nosti, credo, illud: Nemo pius est, qui pietatem-; \n\n','2016-02-14 21:56:55','2016-02-14 22:55:30',NULL,NULL,0,1,0),(376,1,1,1,'Accounts',' Itaque his sapiens semper vacabit. Si longus, levis. Quamquam te quidem video minime esse deterritum. Propter nos enim illam, non propter eam nosmet ipsos diligimus. Duo Reges: constructio interrete. Sed quid sentiat, non videtis. An dubium est, quin virtus ita maximam partem optineat in rebus humanis, ut reliquas obruat? Igitur neque stultorum quisquam beatus neque sapientium non beatus. \n\n','2016-02-14 21:56:55','2016-02-14 22:55:31',NULL,NULL,0,1,0),(377,1,1,1,'Accounts',' Hoc enim constituto in philosophia constituta sunt omnia. Maximas vero virtutes iacere omnis necesse est voluptate dominante. Incommoda autem et commoda-ita enim estmata et dustmata appello-communia esse voluerunt, paria noluerunt. Tum Torquatus: Prorsus, inquit, assentior; Qui autem esse poteris, nisi te amor ipse ceperit? Cui Tubuli nomen odio non est? Equidem, sed audistine modo de Carneade? \n\n','2016-02-14 21:56:56','2016-02-14 22:55:31',NULL,NULL,0,1,0),(378,1,1,1,'Accounts',' An ea, quae per vinitorem antea consequebatur, per se ipsa curabit? Hoc non est positum in nostra actione. Itaque primos congressus copulationesque et consuetudinum instituendarum voluntates fieri propter voluptatem; Nam Pyrrho, Aristo, Erillus iam diu abiecti. Scientiam pollicentur, quam non erat mirum sapientiae cupido patria esse cariorem. Duo Reges: constructio interrete. Nunc haec primum fortasse audientis servire debemus. Hoc loco tenere se Triarius non potuit. \n\n','2016-02-14 21:56:57','2016-02-14 22:55:31',NULL,NULL,0,1,0),(379,1,1,1,'Accounts',' Quo igitur, inquit, modo? Haec para/doca illi, nos admirabilia dicamus. Res enim se praeclare habebat, et quidem in utraque parte. Duo Reges: constructio interrete. Age, inquies, ista parva sunt. Facillimum id quidem est, inquam. Claudii libidini, qui tum erat summo ne imperio, dederetur. Satisne ergo pudori consulat, si quis sine teste libidini pareat? Partim cursu et peragratione laetantur, congregatione aliae coetum quodam modo civitatis imitantur; \n\n','2016-02-14 21:56:57','2016-02-14 22:55:32',NULL,NULL,0,1,0),(380,1,1,1,'Accounts',' Hoc loco discipulos quaerere videtur, ut, qui asoti esse velint, philosophi ante fiant. Cum autem in quo sapienter dicimus, id a primo rectissime dicitur. Illi enim inter se dissentiunt. Quae contraria sunt his, malane? \n\n','2016-02-14 21:56:58','2016-02-14 22:55:32',NULL,NULL,0,1,0),(381,1,1,1,'Accounts',' Quid, si etiam iucunda memoria est praeteritorum malorum? Iam id ipsum absurdum, maximum malum neglegi. Hoc non est positum in nostra actione. Sed quot homines, tot sententiae; Duo Reges: constructio interrete. Conferam avum tuum Drusum cum C. \n\n','2016-02-14 21:56:59','2016-02-14 22:55:33',NULL,NULL,0,1,0),(382,1,1,1,'Accounts',' Multoque hoc melius nos veriusque quam Stoici. Theophrasti igitur, inquit, tibi liber ille placet de beata vita? Odium autem et invidiam facile vitabis. Duo Reges: constructio interrete. Quae cum ita sint, effectum est nihil esse malum, quod turpe non sit. Restinguet citius, si ardentem acceperit. Que Manilium, ab iisque M. \n\n','2016-02-14 21:57:00','2016-02-14 22:55:33',NULL,NULL,0,1,0),(383,1,1,1,'Accounts',' Quid enim mihi potest esse optatius quam cum Catone, omnium virtutum auctore, de virtutibus disputare? Cur iustitia laudatur? Et ais, si una littera commota sit, fore tota ut labet disciplina. Aliud igitur esse censet gaudere, aliud non dolere. Confecta res esset. Duo Reges: constructio interrete. Negat enim summo bono afferre incrementum diem. Tu autem negas fortem esse quemquam posse, qui dolorem malum putet. \n\n','2016-02-14 21:57:01','2016-02-14 22:55:34',NULL,NULL,0,1,0),(384,1,1,1,'Accounts',' Item de contrariis, a quibus ad genera formasque generum venerunt. An potest, inquit ille, quicquam esse suavius quam nihil dolere? Duo Reges: constructio interrete. Contemnit enim disserendi elegantiam, confuse loquitur. Tum mihi Piso: Quid ergo? Isto modo ne improbos quidem, si essent boni viri. Atque haec ita iustitiae propria sunt, ut sint virtutum reliquarum communia. \n\n','2016-02-14 21:57:02','2016-02-14 22:55:34',NULL,NULL,0,1,0),(385,1,1,1,'Accounts',' Mihi quidem Antiochum, quem audis, satis belle videris attendere. Hoc non est positum in nostra actione. Illi enim inter se dissentiunt. Sequitur disserendi ratio cognitioque naturae; Etenim semper illud extra est, quod arte comprehenditur. Duo Reges: constructio interrete. \n\n','2016-02-14 21:57:02','2016-02-14 22:55:34',NULL,NULL,0,1,0),(386,1,1,1,'Accounts',' Sed quot homines, tot sententiae; Cuius similitudine perspecta in formarum specie ac dignitate transitum est ad honestatem dictorum atque factorum. Tamen a proposito, inquam, aberramus. Virtutis, magnitudinis animi, patientiae, fortitudinis fomentis dolor mitigari solet. Duo Reges: constructio interrete. Immo alio genere; \n\n','2016-02-14 21:57:03','2016-02-14 22:55:35',NULL,NULL,0,1,0),(387,1,1,1,'Accounts',' In qua quid est boni praeter summam voluptatem, et eam sempiternam? Quod ea non occurrentia fingunt, vincunt Aristonem; Scientiam pollicentur, quam non erat mirum sapientiae cupido patria esse cariorem. Duo Reges: constructio interrete. Quasi ego id curem, quid ille aiat aut neget. At tu eadem ista dic in iudicio aut, si coronam times, dic in senatu. \n\n','2016-02-14 21:57:04','2016-02-14 22:55:35',NULL,NULL,0,1,0),(388,1,1,1,'Accounts',' Quid est, quod ab ea absolvi et perfici debeat? Audeo dicere, inquit. Egone non intellego, quid sit don Graece, Latine voluptas? Quae cum praeponunt, ut sit aliqua rerum selectio, naturam videntur sequi; \n\n','2016-02-14 21:57:05','2016-02-14 22:55:36',NULL,NULL,0,1,0),(389,1,1,1,'Accounts',' Ergo instituto veterum, quo etiam Stoici utuntur, hinc capiamus exordium. Sed potestne rerum maior esse dissensio? Potius inflammat, ut coercendi magis quam dedocendi esse videantur. Quis istud possit, inquit, negare? Ab hoc autem quaedam non melius quam veteres, quaedam omnino relicta. \n\n','2016-02-14 21:57:05','2016-02-14 22:55:37',NULL,NULL,0,1,0),(390,1,1,1,'Accounts',' Est, ut dicis, inquit; Hic nihil fuit, quod quaereremus. Istam voluptatem perpetuam quis potest praestare sapienti? Nec vero sum nescius esse utilitatem in historia, non modo voluptatem. Tum mihi Piso: Quid ergo? Duo Reges: constructio interrete. Videmusne ut pueri ne verberibus quidem a contemplandis rebus perquirendisque deterreantur? \n\n','2016-02-14 21:57:06','2016-02-14 22:55:37',NULL,NULL,0,1,0),(391,1,1,1,'Accounts',' Sed ad rem redeamus; Restinguet citius, si ardentem acceperit. Non enim ipsa genuit hominem, sed accepit a natura inchoatum. Sed quanta sit alias, nunc tantum possitne esse tanta. Qua ex cognitione facilior facta est investigatio rerum occultissimarum. Num quid tale Democritus? Tum Quintus: Est plane, Piso, ut dicis, inquit. Duo Reges: constructio interrete. \n\n','2016-02-14 21:57:07','2016-02-14 22:55:38',NULL,NULL,0,1,0),(392,1,1,1,'Accounts',' Erit enim instructus ad mortem contemnendam, ad exilium, ad ipsum etiam dolorem. Sed in rebus apertissimis nimium longi sumus. Cur igitur, inquam, res tam dissimiles eodem nomine appellas? Hoc simile tandem est? Duo Reges: constructio interrete. Quamquam id quidem licebit iis existimare, qui legerint. \n\n','2016-02-14 21:57:07','2016-02-14 22:55:38',NULL,NULL,0,1,0),(393,1,1,1,'Accounts',' Si stante, hoc natura videlicet vult, salvam esse se, quod concedimus; Mihi enim satis est, ipsis non satis. Atqui reperies, inquit, in hoc quidem pertinacem; Quam nemo umquam voluptatem appellavit, appellat; \n\n','2016-02-14 21:57:08','2016-02-14 22:55:39',NULL,NULL,0,1,0),(394,1,1,1,'Accounts',' Mihi, inquam, qui te id ipsum rogavi? Falli igitur possumus. Sin tantum modo ad indicia veteris memoriae cognoscenda, curiosorum. Duo Reges: constructio interrete. Quis enim potest ea, quae probabilia videantur ei, non probare? In schola desinis. Respondent extrema primis, media utrisque, omnia omnibus. Quamquam haec quidem praeposita recte et reiecta dicere licebit. Ita fit beatae vitae domina fortuna, quam Epicurus ait exiguam intervenire sapienti. \n\n','2016-02-14 21:57:09','2016-02-14 22:55:39',NULL,NULL,0,1,0),(395,1,1,1,'Accounts',' Tu vero, inquam, ducas licet, si sequetur; Quae sequuntur igitur? Non quam nostram quidem, inquit Pomponius iocans; An ea, quae per vinitorem antea consequebatur, per se ipsa curabit? Hosne igitur laudas et hanc eorum, inquam, sententiam sequi nos censes oportere? Memini vero, inquam; Si enim ad populum me vocas, eum. \n\n','2016-02-14 21:57:09','2016-02-14 22:55:39',NULL,NULL,0,1,0),(396,1,1,1,'Accounts',' Causa autem fuit huc veniendi ut quosdam hinc libros promerem. Qua ex cognitione facilior facta est investigatio rerum occultissimarum. Duo Reges: constructio interrete. Summus dolor plures dies manere non potest? Et nemo nimium beatus est; Verba tu fingas et ea dicas, quae non sentias? Atqui, inquam, Cato, si istud optinueris, traducas me ad te totum licebit. \n\n','2016-02-14 21:57:10','2016-02-14 22:55:40',NULL,NULL,0,1,0),(397,1,1,1,'Accounts',' Uterque enim summo bono fruitur, id est voluptate. Qui non moveatur et offensione turpitudinis et comprobatione honestatis? Sed quid attinet de rebus tam apertis plura requirere? Naturales divitias dixit parabiles esse, quod parvo esset natura contenta. Duo Reges: constructio interrete. Negat esse eam, inquit, propter se expetendam. Si autem id non concedatur, non continuo vita beata tollitur. Ita enim vivunt quidam, ut eorum vita refellatur oratio. Nosti, credo, illud: Nemo pius est, qui pietatem-; Rapior illuc, revocat autem Antiochus, nec est praeterea, quem audiamus. \n\n','2016-02-14 21:57:11','2016-02-14 22:55:40',NULL,NULL,0,1,0),(398,1,1,1,'Accounts',' Si longus, levis dictata sunt. Conferam avum tuum Drusum cum C. Aliter enim nosmet ipsos nosse non possumus. Atque hoc loco similitudines eas, quibus illi uti solent, dissimillimas proferebas. Duo Reges: constructio interrete. \n\n','2016-02-14 21:57:12','2016-02-14 22:55:41',NULL,NULL,0,1,0),(399,1,1,1,'Accounts',' Equidem e Cn. Mihi quidem Antiochum, quem audis, satis belle videris attendere. Certe, nisi voluptatem tanti aestimaretis. Erat enim res aperta. Istam voluptatem perpetuam quis potest praestare sapienti? Quis animo aequo videt eum, quem inpure ac flagitiose putet vivere? Duo Reges: constructio interrete. Eorum enim est haec querela, qui sibi cari sunt seseque diligunt. Quod praeceptum quia maius erat, quam ut ab homine videretur, idcirco assignatum est deo. Sed residamus, inquit, si placet. \n\n','2016-02-14 21:57:12','2016-02-14 22:55:41',NULL,NULL,0,1,0),(400,1,1,1,'Accounts',' Ita prorsus, inquam; Sic, et quidem diligentius saepiusque ista loquemur inter nos agemusque communiter. Duo Reges: constructio interrete. Si quicquam extra virtutem habeatur in bonis. Quae quidem sapientes sequuntur duce natura tamquam videntes; Quid nunc honeste dicit? Apud ceteros autem philosophos, qui quaesivit aliquid, tacet; \n\n','2016-02-14 21:57:13','2016-02-14 22:55:41',NULL,NULL,0,1,0),(401,1,1,1,'Accounts',' Primum in nostrane potestate est, quid meminerimus? Non dolere, inquam, istud quam vim habeat postea videro; Te ipsum, dignissimum maioribus tuis, voluptasne induxit, ut adolescentulus eriperes P. \n\n','2016-02-14 21:57:14','2016-02-14 22:55:42',NULL,NULL,0,1,0),(402,1,1,1,'Accounts',' De ingenio eius in his disputationibus, non de moribus quaeritur. Ut scias me intellegere, primum idem esse dico voluptatem, quod ille don. Quae hic rei publicae vulnera inponebat, eadem ille sanabat. Est, ut dicis, inquam. Quamquam id quidem, infinitum est in hac urbe; Quantum Aristoxeni ingenium consumptum videmus in musicis? Duo Reges: constructio interrete. Scaevola tribunus plebis ferret ad plebem vellentne de ea re quaeri. Quonam, inquit, modo? Illud quaero, quid ei, qui in voluptate summum bonum ponat, consentaneum sit dicere. Nec vero alia sunt quaerenda contra Carneadeam illam sententiam. \n\n','2016-02-14 21:57:14','2016-02-14 22:55:42',NULL,NULL,0,1,0),(403,1,1,1,'Accounts',' Quo plebiscito decreta a senatu est consuli quaestio Cn. A quibus propter discendi cupiditatem videmus ultimas terras esse peragratas. Facile est hoc cernere in primis puerorum aetatulis. Quid enim possumus hoc agere divinius? Duo Reges: constructio interrete. Duarum enim vitarum nobis erunt instituta capienda. Te enim iudicem aequum puto, modo quae dicat ille bene noris. \n\n','2016-02-14 21:57:15','2016-02-14 22:55:43',NULL,NULL,0,1,0),(404,1,1,1,'Accounts',' Atque his de rebus et splendida est eorum et illustris oratio. Sed fortuna fortis; Quae cum magnifice primo dici viderentur, considerata minus probabantur. Sed nonne merninisti licere mihi ista probare, quae sunt a te dicta? Quicquid porro animo cernimus, id omne oritur a sensibus; \n\n','2016-02-14 21:57:16','2016-02-14 22:55:43',NULL,NULL,0,1,0),(405,1,1,1,'Accounts',' Omnes enim iucundum motum, quo sensus hilaretur. Erit enim mecum, si tecum erit. Cave putes quicquam esse verius. Ad corpus diceres pertinere-, sed ea, quae dixi, ad corpusne refers? Fortasse id optimum, sed ubi illud: Plus semper voluptatis? Qua igitur re ab deo vincitur, si aeternitate non vincitur? Quae cum ita sint, effectum est nihil esse malum, quod turpe non sit. \n\n','2016-02-14 21:57:17','2016-02-14 22:55:44',NULL,NULL,0,1,0),(406,1,1,1,'Accounts',' Putabam equidem satis, inquit, me dixisse. Sed quae tandem ista ratio est? Duo Reges: constructio interrete. Itaque his sapiens semper vacabit. Ea possunt paria non esse. Aliter enim nosmet ipsos nosse non possumus. Et quod est munus, quod opus sapientiae? \n\n','2016-02-14 21:57:17','2016-02-14 22:55:44',NULL,NULL,0,1,0),(407,1,1,1,'Accounts',' Bonum negas esse divitias, praeposìtum esse dicis? Quae cum praeponunt, ut sit aliqua rerum selectio, naturam videntur sequi; Ad quorum et cognitionem et usum iam corroborati natura ipsa praeeunte deducimur. Haec et tu ita posuisti, et verba vestra sunt. Quorum altera prosunt, nocent altera. Nunc omni virtuti vitium contrario nomine opponitur. Sed quid ages tandem, si utilitas ab amicitia, ut fit saepe, defecerit? Duo Reges: constructio interrete. Duo enim genera quae erant, fecit tria. Respondent extrema primis, media utrisque, omnia omnibus. Quid ergo attinet dicere: Nihil haberem, quod reprehenderem, si finitas cupiditates haberent? Transfer idem ad modestiam vel temperantiam, quae est moderatio cupiditatum rationi oboediens. Fortitudinis quaedam praecepta sunt ac paene leges, quae effeminari virum vetant in dolore. \n\n','2016-02-14 21:57:18','2016-02-14 22:55:44',NULL,NULL,0,1,0),(408,1,1,1,'Accounts',' Sic, et quidem diligentius saepiusque ista loquemur inter nos agemusque communiter. Tibi hoc incredibile, quod beatissimum. Eadem nunc mea adversum te oratio est. Putabam equidem satis, inquit, me dixisse. Duo Reges: constructio interrete. \n\n','2016-02-14 21:57:19','2016-02-14 22:55:45',NULL,NULL,0,1,0),(409,1,1,1,'Accounts',' Quid ergo hoc loco intellegit honestum? Duarum enim vitarum nobis erunt instituta capienda. Omnes enim iucundum motum, quo sensus hilaretur. Quid turpius quam sapientis vitam ex insipientium sermone pendere? Nos quidem Virtutes sic natae sumus, ut tibi serviremus, aliud negotii nihil habemus. Inde igitur, inquit, ordiendum est. Duo Reges: constructio interrete. Aliter enim nosmet ipsos nosse non possumus. At cum de plurimis eadem dicit, tum certe de maximis. An est aliquid, quod te sua sponte delectet? \n\n','2016-02-14 21:57:19','2016-02-14 22:55:45',NULL,NULL,0,1,0),(410,1,1,1,'Accounts',' Videamus igitur sententias eorum, tum ad verba redeamus. Summum ením bonum exposuit vacuitatem doloris; Vide ne ista sint Manliana vestra aut maiora etiam, si imperes quod facere non possim. \n\n','2016-02-14 21:57:20','2016-02-14 22:55:46',NULL,NULL,0,1,0),(411,1,1,1,'Accounts',' Et quidem illud ipsum non nimium probo et tantum patior, philosophum loqui de cupiditatibus finiendis. Hic ambiguo ludimur. Deinde disputat, quod cuiusque generis animantium statui deceat extremum. Isto modo ne improbos quidem, si essent boni viri. Utinam quidem dicerent alium alio beatiorem! Iam ruinas videres. Duo Reges: constructio interrete. Profectus in exilium Tubulus statim nec respondere ausus; Quae similitudo in genere etiam humano apparet. \n\n','2016-02-14 21:57:21','2016-02-14 22:55:46',NULL,NULL,0,1,0),(412,1,1,1,'Accounts',' Quamquam in hac divisione rem ipsam prorsus probo, elegantiam desidero. Sic consequentibus vestris sublatis prima tolluntur. Nunc omni virtuti vitium contrario nomine opponitur. Cur igitur, inquam, res tam dissimiles eodem nomine appellas? Venit enim mihi Platonis in mentem, quem accepimus primum hic disputare solitum; Duo Reges: constructio interrete. Qua ex cognitione facilior facta est investigatio rerum occultissimarum. Prodest, inquit, mihi eo esse animo. Sumenda potius quam expetenda. Plane idem, inquit, et maxima quidem, qua fieri nulla maior potest. \n\n','2016-02-14 21:57:22','2016-02-14 22:55:47',NULL,NULL,0,1,0),(413,1,1,1,'Accounts',' Paulum, cum regem Persem captum adduceret, eodem flumine invectio? Rationis enim perfectio est virtus; Ut aliquid scire se gaudeant? Audax negotium, dicerem impudens, nisi hoc institutum postea translatum ad philosophos nostros esset. Sed ad haec, nisi molestum est, habeo quae velim. Duo Reges: constructio interrete. Sed ea mala virtuti magnitudine obruebantur. \n\n','2016-02-14 21:57:22','2016-02-14 22:55:47',NULL,NULL,0,1,0),(414,1,1,1,'Accounts',' Tu autem, si tibi illa probabantur, cur non propriis verbis ea tenebas? Duo Reges: constructio interrete. Semper enim ex eo, quod maximas partes continet latissimeque funditur, tota res appellatur. Urgent tamen et nihil remittunt. \n\n','2016-02-14 21:57:23','2016-02-14 22:55:48',NULL,NULL,0,1,0),(415,1,1,1,'Accounts',' Hoc non est positum in nostra actione. Tecum optime, deinde etiam cum mediocri amico. Cupiditates non Epicuri divisione finiebat, sed sua satietate. Atqui reperies, inquit, in hoc quidem pertinacem; Ut proverbia non nulla veriora sint quam vestra dogmata. \n\n','2016-02-14 21:57:24','2016-02-14 22:55:48',NULL,NULL,0,1,0),(416,1,1,1,'Accounts',' Scrupulum, inquam, abeunti; Nunc omni virtuti vitium contrario nomine opponitur. Nam Pyrrho, Aristo, Erillus iam diu abiecti. Nec vero alia sunt quaerenda contra Carneadeam illam sententiam. Quae sequuntur igitur? Recte, inquit, intellegis. Est enim effectrix multarum et magnarum voluptatum. Respondent extrema primis, media utrisque, omnia omnibus. Duo Reges: constructio interrete. Luxuriam non reprehendit, modo sit vacua infinita cupiditate et timore. \n\n','2016-02-14 21:57:24','2016-02-14 22:55:49',NULL,NULL,0,1,0),(417,1,1,1,'Accounts',' Iubet igitur nos Pythius Apollo noscere nosmet ipsos. Duo Reges: constructio interrete. Quid est enim aliud esse versutum? Poterat autem inpune; Cum ageremus, inquit, vitae beatum et eundem supremum diem, scribebamus haec. An vero, inquit, quisquam potest probare, quod perceptfum, quod. \n\n','2016-02-14 21:57:25','2016-02-14 22:55:49',NULL,NULL,0,1,0),(418,1,1,1,'Accounts',' Propter nos enim illam, non propter eam nosmet ipsos diligimus. Duo Reges: constructio interrete. Praeteritis, inquit, gaudeo. Nec enim, omnes avaritias si aeque avaritias esse dixerimus, sequetur ut etiam aequas esse dicamus. Si enim ad populum me vocas, eum. Cyrenaici quidem non recusant; Expressa vero in iis aetatibus, quae iam confirmatae sunt. Nihil sane. Nam illud vehementer repugnat, eundem beatum esse et multis malis oppressum. Illis videtur, qui illud non dubitant bonum dicere -; \n\n','2016-02-14 21:57:26','2016-02-14 22:55:50',NULL,NULL,0,1,0),(419,1,1,1,'Accounts',' Huic mori optimum esse propter desperationem sapientiae, illi propter spem vivere. Itaque rursus eadem ratione, qua sum paulo ante usus, haerebitis. \n\n','2016-02-14 21:57:27','2016-02-14 22:55:50',NULL,NULL,0,1,0),(420,1,1,1,'Accounts',' Ut in geometria, prima si dederis, danda sunt omnia. Simus igitur contenti his. Mihi, inquam, qui te id ipsum rogavi? Sed quod proximum fuit non vidit. Duo Reges: constructio interrete. Hoc tu nunc in illo probas. \n\n','2016-02-14 21:57:27','2016-02-14 22:55:51',NULL,NULL,0,1,0),(421,1,1,1,'Accounts',' An tu me de L. Illis videtur, qui illud non dubitant bonum dicere -; Quae cum dixisset paulumque institisset, Quid est? Quae cum praeponunt, ut sit aliqua rerum selectio, naturam videntur sequi; \n\n','2016-02-14 21:57:28','2016-02-14 22:55:51',NULL,NULL,0,1,0),(422,1,1,1,'Accounts',' Tu autem, si tibi illa probabantur, cur non propriis verbis ea tenebas? Ipse Epicurus fortasse redderet, ut Sextus Peducaeus, Sex. Quid est igitur, inquit, quod requiras? Quae duo sunt, unum facit. Duo Reges: constructio interrete. Quod idem cum vestri faciant, non satis magnam tribuunt inventoribus gratiam. Quia, si mala sunt, is, qui erit in iis, beatus non erit. Quod autem ratione actum est, id officium appellamus. \n\n','2016-02-14 21:57:29','2016-02-14 22:55:52',NULL,NULL,0,1,0),(423,1,1,1,'Accounts',' Quid, si etiam iucunda memoria est praeteritorum malorum? Si mala non sunt, iacet omnis ratio Peripateticorum. Quo plebiscito decreta a senatu est consuli quaestio Cn. Hoc enim identidem dicitis, non intellegere nos quam dicatis voluptatem. Quod quidem iam fit etiam in Academia. Duo Reges: constructio interrete. Quo modo autem optimum, si bonum praeterea nullum est? Nam si beatus umquam fuisset, beatam vitam usque ad illum a Cyro extructum rogum pertulisset. \n\n','2016-02-14 21:57:29','2016-02-14 22:55:52',NULL,NULL,0,1,0),(424,1,1,1,'Accounts',' Sed venio ad inconstantiae crimen, ne saepius dicas me aberrare; Consequens enim est et post oritur, ut dixi. Scrupulum, inquam, abeunti; Ita cum ea volunt retinere, quae superiori sententiae conveniunt, in Aristonem incidunt; Sed ad rem redeamus; \n\n','2016-02-14 21:57:30','2016-02-14 22:55:52',NULL,NULL,0,1,0),(425,1,1,1,'Accounts',' Quid ergo aliud intellegetur nisi uti ne quae pars naturae neglegatur? Summum ením bonum exposuit vacuitatem doloris; Hinc ceteri particulas arripere conati suam quisque videro voluit afferre sententiam. Utilitatis causa amicitia est quaesita. Cur igitur, inquam, res tam dissimiles eodem nomine appellas? Duo Reges: constructio interrete. Frater et T. Ergo opifex plus sibi proponet ad formarum quam civis excellens ad factorum pulchritudinem? Idcirco enim non desideraret, quia, quod dolore caret, id in voluptate est. Virtutis, magnitudinis animi, patientiae, fortitudinis fomentis dolor mitigari solet. \n\n','2016-02-14 21:57:31','2016-02-14 22:55:53',NULL,NULL,0,1,0),(426,1,1,1,'Accounts',' De malis autem et bonis ab iis animalibus, quae nondum depravata sint, ait optime iudicari. Negat esse eam, inquit, propter se expetendam. Zenonis est, inquam, hoc Stoici. Id enim volumus, id contendimus, ut officii fructus sit ipsum officium. Quam ob rem tandem, inquit, non satisfacit? Ut optime, secundum naturam affectum esse possit. Habes, inquam, Cato, formam eorum, de quibus loquor, philosophorum. Duo Reges: constructio interrete. An ea, quae per vinitorem antea consequebatur, per se ipsa curabit? Vos autem cum perspicuis dubia debeatis illustrare, dubiis perspicua conamini tollere. \n\n','2016-02-14 21:57:31','2016-02-14 22:55:53',NULL,NULL,0,1,0),(427,1,1,1,'Accounts',' Quae cum dixisset paulumque institisset, Quid est? Quaesita enim virtus est, non quae relinqueret naturam, sed quae tueretur. Mihi quidem Antiochum, quem audis, satis belle videris attendere. Quos quidem tibi studiose et diligenter tractandos magnopere censeo. Quae est igitur causa istarum angustiarum? Theophrastus mediocriterne delectat, cum tractat locos ab Aristotele ante tractatos? \n\n','2016-02-14 21:57:32','2016-02-14 22:55:54',NULL,NULL,0,1,0),(428,1,1,1,'Accounts',' Nam, ut sint illa vendibiliora, haec uberiora certe sunt. Est enim effectrix multarum et magnarum voluptatum. Sine ea igitur iucunde negat posse se vivere? Eam stabilem appellas. Mihi vero, inquit, placet agi subtilius et, ut ipse dixisti, pressius. Duo Reges: constructio interrete. Quis hoc dicit? Beatus autem esse in maximarum rerum timore nemo potest. Bonum negas esse divitias, praeposìtum esse dicis? Is es profecto tu. Parvi enim primo ortu sic iacent, tamquam omnino sine animo sint. Dolor ergo, id est summum malum, metuetur semper, etiamsi non aderit; \n\n','2016-02-14 21:57:33','2016-02-14 22:55:54',NULL,NULL,0,1,0),(429,1,1,1,'Accounts',' Nummus in Croesi divitiis obscuratur, pars est tamen divitiarum. Nunc vero a primo quidem mirabiliter occulta natura est nec perspici nec cognosci potest. Duo Reges: constructio interrete. Quod equidem non reprehendo; At coluit ipse amicitias. \n\n','2016-02-14 21:57:34','2016-02-14 22:55:55',NULL,NULL,0,1,0),(430,1,1,1,'Accounts',' Qui autem de summo bono dissentit de tota philosophiae ratione dissentit. Quicquid enim a sapientia proficiscitur, id continuo debet expletum esse omnibus suis partibus; Duo Reges: constructio interrete. Sic vester sapiens magno aliquo emolumento commotus cicuta, si opus erit, dimicabit. Nam adhuc, meo fortasse vitio, quid ego quaeram non perspicis. Quod quidem nobis non saepe contingit. \n\n','2016-02-14 21:57:34','2016-02-14 22:55:55',NULL,NULL,0,1,0),(431,1,1,1,'Accounts',' Ad eos igitur converte te, quaeso. Haec para/doca illi, nos admirabilia dicamus. Sed erat aequius Triarium aliquid de dissensione nostra iudicare. Audio equidem philosophi vocem, Epicure, sed quid tibi dicendum sit oblitus es. Iam id ipsum absurdum, maximum malum neglegi. Duo Reges: constructio interrete. \n\n','2016-02-14 21:57:35','2016-02-14 22:55:55',NULL,NULL,0,1,0),(432,1,1,1,'Accounts',' Si sapiens, ne tum quidem miser, cum ab Oroete, praetore Darei, in crucem actus est. At ille pellit, qui permulcet sensum voluptate. Nam Pyrrho, Aristo, Erillus iam diu abiecti. Quasi vero, inquit, perpetua oratio rhetorum solum, non etiam philosophorum sit. Qua tu etiam inprudens utebare non numquam. Si verbum sequimur, primum longius verbum praepositum quam bonum. Duo Reges: constructio interrete. \n\n','2016-02-14 21:57:36','2016-02-14 22:55:56',NULL,NULL,0,1,0),(433,1,1,1,'Accounts',' Cave putes quicquam esse verius. Nummus in Croesi divitiis obscuratur, pars est tamen divitiarum. Atqui haec patefactio quasi rerum opertarum, cum quid quidque sit aperitur, definitio est. Duo Reges: constructio interrete. Non quaero, quid dicat, sed quid convenienter possit rationi et sententiae suae dicere. Dulce amarum, leve asperum, prope longe, stare movere, quadratum rotundum. \n\n','2016-02-14 21:57:36','2016-02-14 22:55:56',NULL,NULL,0,1,0),(434,1,1,1,'Accounts',' Ut non sine causa ex iis memoriae ducta sit disciplina. Nemo nostrum istius generis asotos iucunde putat vivere. Duarum enim vitarum nobis erunt instituta capienda. Expressa vero in iis aetatibus, quae iam confirmatae sunt. Duo Reges: constructio interrete. Qua igitur re ab deo vincitur, si aeternitate non vincitur? Et quidem, Cato, hanc totam copiam iam Lucullo nostro notam esse oportebit; Nec vero sum nescius esse utilitatem in historia, non modo voluptatem. Rhetorice igitur, inquam, nos mavis quam dialectice disputare? Duarum enim vitarum nobis erunt instituta capienda. \n\n','2016-02-14 21:57:37','2016-02-14 22:55:57',NULL,NULL,0,1,0),(435,1,1,1,'Accounts',' Quo modo autem optimum, si bonum praeterea nullum est? Hos contra singulos dici est melius. O magnam vim ingenii causamque iustam, cur nova existeret disciplina! Perge porro. Verum tamen cum de rebus grandioribus dicas, ipsae res verba rapiunt; Isto modo, ne si avia quidem eius nata non esset. Itaque eos id agere, ut a se dolores, morbos, debilitates repellant. Consequens enim est et post oritur, ut dixi. Duo Reges: constructio interrete. Sed fortuna fortis; Scio enim esse quosdam, qui quavis lingua philosophari possint; Ita ne hoc quidem modo paria peccata sunt. \n\n','2016-02-14 21:57:38','2016-02-14 22:55:57',NULL,NULL,0,1,0),(436,1,1,1,'Accounts',' Quis hoc dicit? Hoc enim constituto in philosophia constituta sunt omnia. Huius ego nunc auctoritatem sequens idem faciam. Deinde disputat, quod cuiusque generis animantium statui deceat extremum. Omnia contraria, quos etiam insanos esse vultis. Duo Reges: constructio interrete. Invidiosum nomen est, infame, suspectum. \n\n','2016-02-14 21:57:38','2016-02-14 22:55:58',NULL,NULL,0,1,0),(437,1,1,1,'Accounts',' Quid enim me prohiberet Epicureum esse, si probarem, quae ille diceret? Bonum integritas corporis: misera debilitas. Sed ne, dum huic obsequor, vobis molestus sim. Prodest, inquit, mihi eo esse animo. Duo Reges: constructio interrete. Quae similitudo in genere etiam humano apparet. Quorum sine causa fieri nihil putandum est. Cum salvum esse flentes sui respondissent, rogavit essentne fusi hostes. \n\n','2016-02-14 21:57:39','2016-02-14 22:55:58',NULL,NULL,0,1,0),(438,1,1,1,'Accounts',' Hunc vos beatum; Apparet statim, quae sint officia, quae actiones. Quid ei reliquisti, nisi te, quoquo modo loqueretur, intellegere, quid diceret? Duo Reges: constructio interrete. \n\n','2016-02-14 21:57:40','2016-02-14 22:55:59',NULL,NULL,0,1,0),(439,1,1,1,'Accounts',' Conclusum est enim contra Cyrenaicos satis acute, nihil ad Epicurum. Quia dolori non voluptas contraria est, sed doloris privatio. Non semper, inquam; Quippe: habes enim a rhetoribus; Iam in altera philosophiae parte. Quamquam te quidem video minime esse deterritum. Duo Reges: constructio interrete. Id enim volumus, id contendimus, ut officii fructus sit ipsum officium. Confecta res esset. Est enim effectrix multarum et magnarum voluptatum. \n\n','2016-02-14 21:57:41','2016-02-14 22:55:59',NULL,NULL,0,1,0),(440,1,1,1,'Accounts',' In his igitur partibus duabus nihil erat, quod Zeno commutare gestiret. Hoc loco tenere se Triarius non potuit. Duo Reges: constructio interrete. Hoc positum in Phaedro a Platone probavit Epicurus sensitque in omni disputatione id fieri oportere. Quis suae urbis conservatorem Codrum, quis Erechthei filias non maxime laudat? Quia voluptatem hanc esse sentiunt omnes, quam sensus accipiens movetur et iucunditate quadam perfunditur. \n\n','2016-02-14 21:57:41','2016-02-14 22:56:00',NULL,NULL,0,1,0),(441,1,1,1,'Accounts',' Nam aliquando posse recte fieri dicunt nulla expectata nec quaesita voluptate. Nec lapathi suavitatem acupenseri Galloni Laelius anteponebat, sed suavitatem ipsam neglegebat; Quod ea non occurrentia fingunt, vincunt Aristonem; Si longus, levis dictata sunt. Cupiditates non Epicuri divisione finiebat, sed sua satietate. \n\n','2016-02-14 21:57:43','2016-02-14 22:56:00',NULL,NULL,0,1,0),(442,1,1,1,'Accounts',' Sic, et quidem diligentius saepiusque ista loquemur inter nos agemusque communiter. Ergo ita: non posse honeste vivi, nisi honeste vivatur? Et hunc idem dico, inquieta sed ad virtutes et ad vitia nihil interesse. Qui ita affectus, beatum esse numquam probabis; Ergo infelix una molestia, fellx rursus, cum is ipse anulus in praecordiis piscis inventus est? Hoc etsi multimodis reprehendi potest, tamen accipio, quod dant. Mihi quidem Antiochum, quem audis, satis belle videris attendere. Quos quidem tibi studiose et diligenter tractandos magnopere censeo. \n\n','2016-02-14 21:57:44','2016-02-14 22:56:01',NULL,NULL,0,1,0),(443,1,1,1,'Accounts',' Cur deinde Metrodori liberos commendas? Iam id ipsum absurdum, maximum malum neglegi. Ita prorsus, inquam; At ille non pertimuit saneque fidenter: Istis quidem ipsis verbis, inquit; Deinde prima illa, quae in congressu solemus: Quid tu, inquit, huc? \n\n','2016-02-14 21:57:45','2016-02-14 22:56:01',NULL,NULL,0,1,0),(444,1,1,1,'Accounts',' Nam de isto magna dissensio est. Quid ergo attinet gloriose loqui, nisi constanter loquare? An vero, inquit, quisquam potest probare, quod perceptfum, quod. Graece donan, Latine voluptatem vocant. Duo Reges: constructio interrete. Sed tamen est aliquid, quod nobis non liceat, liceat illis. \n\n','2016-02-14 21:57:46','2016-02-14 22:56:01',NULL,NULL,0,1,0),(445,1,1,1,'Accounts',' Duo Reges: constructio interrete. Nosti, credo, illud: Nemo pius est, qui pietatem-; Quae cum praeponunt, ut sit aliqua rerum selectio, naturam videntur sequi; Quae cum magnifice primo dici viderentur, considerata minus probabantur. Traditur, inquit, ab Epicuro ratio neglegendi doloris. \n\n','2016-02-14 21:57:46','2016-02-14 22:56:02',NULL,NULL,0,1,0),(446,1,1,1,'Accounts',' Nam, ut sint illa vendibiliora, haec uberiora certe sunt. Habent enim et bene longam et satis litigiosam disputationem. Cur post Tarentum ad Archytam? Sed quid attinet de rebus tam apertis plura requirere? Progredientibus autem aetatibus sensim tardeve potius quasi nosmet ipsos cognoscimus. Quos quidem tibi studiose et diligenter tractandos magnopere censeo. Duo Reges: constructio interrete. \n\n','2016-02-14 21:57:47','2016-02-14 22:56:02',NULL,NULL,0,1,0),(447,1,1,1,'Accounts',' Quid ei reliquisti, nisi te, quoquo modo loqueretur, intellegere, quid diceret? Nam ante Aristippus, et ille melius. Quid sequatur, quid repugnet, vident. Duo Reges: constructio interrete. Ita relinquet duas, de quibus etiam atque etiam consideret. \n\n','2016-02-14 21:57:48','2016-02-14 22:56:03',NULL,NULL,0,1,0),(448,1,1,1,'Accounts',' Comprehensum, quod cognitum non habet? Nunc omni virtuti vitium contrario nomine opponitur. Qui est in parvis malis. Duo Reges: constructio interrete. Naturales divitias dixit parabiles esse, quod parvo esset natura contenta. Sic enim maiores nostri labores non fugiendos tristissimo tamen verbo aerumnas etiam in deo nominaverunt. Restinguet citius, si ardentem acceperit. Illa argumenta propria videamus, cur omnia sint paria peccata. \n\n','2016-02-14 21:57:48','2016-02-14 22:56:03',NULL,NULL,0,1,0),(449,1,1,1,'Accounts',' Maximas vero virtutes iacere omnis necesse est voluptate dominante. Quamvis enim depravatae non sint, pravae tamen esse possunt. Itaque primos congressus copulationesque et consuetudinum instituendarum voluntates fieri propter voluptatem; Quid ergo attinet dicere: Nihil haberem, quod reprehenderem, si finitas cupiditates haberent? Videmus igitur ut conquiescere ne infantes quidem possint. Illum mallem levares, quo optimum atque humanissimum virum, Cn. \n\n','2016-02-14 21:57:49','2016-02-14 22:56:04',NULL,NULL,0,1,0),(450,1,1,1,'Accounts',' Quae cum dixisset, finem ille. At ego quem huic anteponam non audeo dicere; Tanta vis admonitionis inest in locis; Duo Reges: constructio interrete. \n\n','2016-02-14 21:57:50','2016-02-14 22:56:04',NULL,NULL,0,1,0),(451,1,1,1,'Accounts',' An me, inquam, nisi te audire vellem, censes haec dicturum fuisse? Ita enim vivunt quidam, ut eorum vita refellatur oratio. Nec lapathi suavitatem acupenseri Galloni Laelius anteponebat, sed suavitatem ipsam neglegebat; Negat enim summo bono afferre incrementum diem. Miserum hominem! Si dolor summum malum est, dici aliter non potest. Hoc enim constituto in philosophia constituta sunt omnia. Si enim ita est, vide ne facinus facias, cum mori suadeas. Collige omnia, quae soletis: Praesidium amicorum. \n\n','2016-02-14 21:57:51','2016-02-14 22:56:04',NULL,NULL,0,1,0),(452,1,1,1,'Accounts',' Si stante, hoc natura videlicet vult, salvam esse se, quod concedimus; Bonum integritas corporis: misera debilitas. Utilitatis causa amicitia est quaesita. Quis est tam dissimile homini. Quacumque enim ingredimur, in aliqua historia vestigium ponimus. Quos quidem tibi studiose et diligenter tractandos magnopere censeo. An me, inquam, nisi te audire vellem, censes haec dicturum fuisse? Iam doloris medicamenta illa Epicurea tamquam de narthecio proment: Si gravis, brevis; \n\n','2016-02-14 21:57:51','2016-02-14 22:56:05',NULL,NULL,0,1,0),(453,1,1,1,'Accounts',' Polemoni et iam ante Aristoteli ea prima visa sunt, quae paulo ante dixi. Semper enim ex eo, quod maximas partes continet latissimeque funditur, tota res appellatur. Duo Reges: constructio interrete. Illa sunt similia: hebes acies est cuipiam oculorum, corpore alius senescit; Quae cum magnifice primo dici viderentur, considerata minus probabantur. Nam memini etiam quae nolo, oblivisci non possum quae volo. Cuius quidem, quoniam Stoicus fuit, sententia condemnata mihi videtur esse inanitas ista verborum. \n\n','2016-02-14 21:57:52','2016-02-14 22:56:05',NULL,NULL,0,1,0),(454,1,1,1,'Accounts',' Quicquid porro animo cernimus, id omne oritur a sensibus; Ergo adhuc, quantum equidem intellego, causa non videtur fuisse mutandi nominis. Si longus, levis. Ita ne hoc quidem modo paria peccata sunt. Dolor ergo, id est summum malum, metuetur semper, etiamsi non aderit; Duo Reges: constructio interrete. Quod, inquit, quamquam voluptatibus quibusdam est saepe iucundius, tamen expetitur propter voluptatem. Hunc vos beatum; \n\n','2016-02-14 21:57:53','2016-02-14 22:56:06',NULL,NULL,0,1,0),(455,1,1,1,'Accounts',' Aliter enim nosmet ipsos nosse non possumus. An vero displicuit ea, quae tributa est animi virtutibus tanta praestantia? Quamquam id quidem licebit iis existimare, qui legerint. At ille pellit, qui permulcet sensum voluptate. Duo Reges: constructio interrete. Nonne videmus quanta perturbatio rerum omnium consequatur, quanta confusio? Videsne quam sit magna dissensio? \n\n','2016-02-14 21:57:53','2016-02-14 22:56:06',NULL,NULL,0,1,0),(456,1,1,1,'Accounts',' Ita multa dicunt, quae vix intellegam. Verum hoc idem saepe faciamus. Bonum integritas corporis: misera debilitas. Utilitatis causa amicitia est quaesita. Nihil enim iam habes, quod ad corpus referas; Quo modo autem optimum, si bonum praeterea nullum est? Duo Reges: constructio interrete. Quid vero? \n\n','2016-02-14 21:57:54','2016-02-14 22:56:07',NULL,NULL,0,1,0),(457,1,1,1,'Accounts',' Quibusnam praeteritis? Quae animi affectio suum cuique tribuens atque hanc, quam dico. Expressa vero in iis aetatibus, quae iam confirmatae sunt. Quid, si etiam iucunda memoria est praeteritorum malorum? Quod cum accidisset ut alter alterum necopinato videremus, surrexit statim. Omnes enim iucundum motum, quo sensus hilaretur. Mihi quidem Antiochum, quem audis, satis belle videris attendere. Duo Reges: constructio interrete. Deinde qui fit, ut ego nesciam, sciant omnes, quicumque Epicurei esse voluerunt? At ego quem huic anteponam non audeo dicere; \n\n','2016-02-14 21:57:55','2016-02-14 22:56:07',NULL,NULL,0,1,0),(458,1,1,1,'Accounts',' Quamquam haec quidem praeposita recte et reiecta dicere licebit. Non est igitur voluptas bonum. Nondum autem explanatum satis, erat, quid maxime natura vellet. Quis non odit sordidos, vanos, leves, futtiles? Duo Reges: constructio interrete. Ut optime, secundum naturam affectum esse possit. Confecta res esset. Haec quo modo conveniant, non sane intellego. \n\n','2016-02-14 21:57:55','2016-02-14 22:56:08',NULL,NULL,0,1,0),(459,1,1,1,'Accounts',' Si alia sentit, inquam, alia loquitur, numquam intellegam quid sentiat; Esse enim quam vellet iniquus iustus poterat inpune. Dat enim intervalla et relaxat. Hic ego: Pomponius quidem, inquam, noster iocari videtur, et fortasse suo iure. Duo Reges: constructio interrete. Et nemo nimium beatus est; Nam Pyrrho, Aristo, Erillus iam diu abiecti. Quid, si etiam iucunda memoria est praeteritorum malorum? Ad eos igitur converte te, quaeso. \n\n','2016-02-14 21:57:56','2016-02-14 22:56:08',NULL,NULL,0,1,0),(460,1,1,1,'Accounts',' Explanetur igitur. Si qua in iis corrigere voluit, deteriora fecit. Cupit enim dícere nihil posse ad beatam vitam deesse sapienti. Quam si explicavisset, non tam haesitaret. Ex quo intellegitur officium medium quiddam esse, quod neque in bonis ponatur neque in contrariis. Quicquid enim a sapientia proficiscitur, id continuo debet expletum esse omnibus suis partibus; \n\n','2016-02-14 21:57:57','2016-02-14 22:56:09',NULL,NULL,0,1,0),(461,1,1,1,'Accounts',' Ut in geometria, prima si dederis, danda sunt omnia. Si verbum sequimur, primum longius verbum praepositum quam bonum. Gerendus est mos, modo recte sentiat. Indicant pueri, in quibus ut in speculis natura cernitur. Duo Reges: constructio interrete. Negat esse eam, inquit, propter se expetendam. \n\n','2016-02-14 21:57:58','2016-02-14 22:56:09',NULL,NULL,0,1,0),(462,1,1,1,'Accounts',' Te ipsum, dignissimum maioribus tuis, voluptasne induxit, ut adolescentulus eriperes P. Hoc etsi multimodis reprehendi potest, tamen accipio, quod dant. Indicant pueri, in quibus ut in speculis natura cernitur. Facete M. Vitiosum est enim in dividendo partem in genere numerare. \n\n','2016-02-14 21:57:58','2016-02-14 22:56:10',NULL,NULL,0,1,0),(463,1,1,1,'Accounts',' Bonum negas esse divitias, praeposìtum esse dicis? Duo Reges: constructio interrete. Et quidem iure fortasse, sed tamen non gravissimum est testimonium multitudinis. Memini vero, inquam; At ille pellit, qui permulcet sensum voluptate. Quare conare, quaeso. Quid turpius quam sapientis vitam ex insipientium sermone pendere? Non pugnem cum homine, cur tantum habeat in natura boni; Quod non faceret, si in voluptate summum bonum poneret. \n\n','2016-02-14 21:57:59','2016-02-14 22:56:10',NULL,NULL,0,1,0),(464,1,1,1,'Accounts',' Deinde prima illa, quae in congressu solemus: Quid tu, inquit, huc? Cur tantas regiones barbarorum pedibus obiit, tot maria transmisit? Fortasse id optimum, sed ubi illud: Plus semper voluptatis? Duo Reges: constructio interrete. Praeteritis, inquit, gaudeo. \n\n','2016-02-14 21:58:00','2016-02-14 22:56:11',NULL,NULL,0,1,0),(465,1,1,1,'Accounts',' Quae quidem sapientes sequuntur duce natura tamquam videntes; Quare conare, quaeso. Iam in altera philosophiae parte. \n\n','2016-02-14 21:58:01','2016-02-14 22:56:11',NULL,NULL,0,1,0),(466,1,1,1,'Accounts',' Ita relinquet duas, de quibus etiam atque etiam consideret. Cur tantas regiones barbarorum pedibus obiit, tot maria transmisit? In quo etsi est magnus, tamen nova pleraque et perpauca de moribus. Quo tandem modo? \n\n','2016-02-14 21:58:01','2016-02-14 22:56:12',NULL,NULL,0,1,0),(467,1,1,1,'Accounts',' Bonum incolumis acies: misera caecitas. Quae in controversiam veniunt, de iis, si placet, disseramus. Nonne videmus quanta perturbatio rerum omnium consequatur, quanta confusio? At iam decimum annum in spelunca iacet. Itaque primos congressus copulationesque et consuetudinum instituendarum voluntates fieri propter voluptatem; Quae cum essent dicta, finem fecimus et ambulandi et disputandi. Duo Reges: constructio interrete. Primum in nostrane potestate est, quid meminerimus? \n\n','2016-02-14 21:58:02','2016-02-14 22:56:12',NULL,NULL,0,1,0),(468,1,1,1,'Accounts',' Quis Aristidem non mortuum diligit? Quasi ego id curem, quid ille aiat aut neget. Bonum negas esse divitias, praeposìtum esse dicis? Primum Theophrasti, Strato, physicum se voluit; Si longus, levis; Duo Reges: constructio interrete. Haec quo modo conveniant, non sane intellego. Theophrastus mediocriterne delectat, cum tractat locos ab Aristotele ante tractatos? \n\n','2016-02-14 21:58:03','2016-02-14 22:56:12',NULL,NULL,0,1,0),(469,1,1,1,'Accounts',' Quamquam te quidem video minime esse deterritum. Apud ceteros autem philosophos, qui quaesivit aliquid, tacet; Graece donan, Latine voluptatem vocant. Quid, cum fictas fabulas, e quibus utilitas nulla elici potest, cum voluptate legimus? Dulce amarum, leve asperum, prope longe, stare movere, quadratum rotundum. Cur tantas regiones barbarorum pedibus obiit, tot maria transmisit? Bonum negas esse divitias, praeposìtum esse dicis? \n\n','2016-02-14 21:58:03','2016-02-14 22:56:13',NULL,NULL,0,1,0),(470,1,1,1,'Accounts',' Nam, ut sint illa vendibiliora, haec uberiora certe sunt. Nam, ut paulo ante docui, augendae voluptatis finis est doloris omnis amotio. Duo Reges: constructio interrete. Consequatur summas voluptates non modo parvo, sed per me nihilo, si potest; Profectus in exilium Tubulus statim nec respondere ausus; Nonne videmus quanta perturbatio rerum omnium consequatur, quanta confusio? \n\n','2016-02-14 21:58:04','2016-02-14 22:56:13',NULL,NULL,0,1,0),(471,1,1,1,'Accounts',' Nunc agendum est subtilius. Peccata paria. Duo Reges: constructio interrete. Perturbationes autem nulla naturae vi commoventur, omniaque ea sunt opiniones ac iudicia levitatis. Beatus sibi videtur esse moriens. In quo etsi est magnus, tamen nova pleraque et perpauca de moribus. \n\n','2016-02-14 21:58:05','2016-02-14 22:56:14',NULL,NULL,0,1,0),(472,1,1,1,'Accounts',' Inde igitur, inquit, ordiendum est. Si mala non sunt, iacet omnis ratio Peripateticorum. Quod idem cum vestri faciant, non satis magnam tribuunt inventoribus gratiam. Quae cum praeponunt, ut sit aliqua rerum selectio, naturam videntur sequi; Haec para/doca illi, nos admirabilia dicamus. Duo Reges: constructio interrete. Tollenda est atque extrahenda radicitus. \n\n','2016-02-14 21:58:06','2016-02-14 22:56:14',NULL,NULL,0,1,0),(473,1,1,1,'Accounts',' Haec bene dicuntur, nec ego repugno, sed inter sese ipsa pugnant. Ex quo, id quod omnes expetunt, beate vivendi ratio inveniri et comparari potest. Respondent extrema primis, media utrisque, omnia omnibus. Summum a vobis bonum voluptas dicitur. An eum discere ea mavis, quae cum plane perdidiceriti nihil sciat? Duo Reges: constructio interrete. Itaque vides, quo modo loquantur, nova verba fingunt, deserunt usitata. Quod quidem iam fit etiam in Academia. \n\n','2016-02-14 21:58:06','2016-02-14 22:56:15',NULL,NULL,0,1,0),(474,1,1,1,'Accounts',' Claudii libidini, qui tum erat summo ne imperio, dederetur. Quare obscurentur etiam haec, quae secundum naturam esse dicimus, in vita beata; Ita nemo beato beatior. Deinde disputat, quod cuiusque generis animantium statui deceat extremum. Duo Reges: constructio interrete. \n\n','2016-02-14 21:58:07','2016-02-14 22:56:15',NULL,NULL,0,1,0),(475,1,1,1,'Accounts',' In his igitur partibus duabus nihil erat, quod Zeno commutare gestiret. Tecum optime, deinde etiam cum mediocri amico. Duo Reges: constructio interrete. Putabam equidem satis, inquit, me dixisse. Frater et T. Quem Tiberina descensio festo illo die tanto gaudio affecit, quanto L. Illa tamen simplicia, vestra versuta. Nam si quae sunt aliae, falsum est omnis animi voluptates esse e corporis societate. Non enim iam stirpis bonum quaeret, sed animalis. Quid enim est a Chrysippo praetermissum in Stoicis? \n\n','2016-02-14 21:58:08','2016-02-14 22:56:16',NULL,NULL,0,1,0),(476,1,1,1,'Accounts',' Eam tum adesse, cum dolor omnis absit; Sed vos squalidius, illorum vides quam niteat oratio. Duo Reges: constructio interrete. Isto modo ne improbos quidem, si essent boni viri. Ita multo sanguine profuso in laetitia et in victoria est mortuus. Hanc ergo intuens debet institutum illud quasi signum absolvere. Non dolere, inquam, istud quam vim habeat postea videro; \n\n','2016-02-14 21:58:08','2016-02-14 22:56:16',NULL,NULL,0,1,0),(477,1,1,1,'Accounts',' Sit enim idem caecus, debilis. Prave, nequiter, turpiter cenabat; Quid censes in Latino fore? Conferam tecum, quam cuique verso rem subicias; An vero, inquit, quisquam potest probare, quod perceptfum, quod. Itaque contra est, ac dicitis; \n\n','2016-02-14 21:58:09','2016-02-14 22:56:17',NULL,NULL,0,1,0),(478,1,1,1,'Accounts',' His similes sunt omnes, qui virtuti student levantur vitiis, levantur erroribus, nisi forte censes Ti. Qui non moveatur et offensione turpitudinis et comprobatione honestatis? Nam si beatus umquam fuisset, beatam vitam usque ad illum a Cyro extructum rogum pertulisset. Duo Reges: constructio interrete. Haec bene dicuntur, nec ego repugno, sed inter sese ipsa pugnant. An hoc usque quaque, aliter in vita? \n\n','2016-02-14 21:58:10','2016-02-14 22:56:17',NULL,NULL,0,1,0),(479,1,1,1,'Accounts',' Duo Reges: constructio interrete. Graecum enim hunc versum nostis omnes-: Suavis laborum est praeteritorum memoria. An vero, inquit, quisquam potest probare, quod perceptfum, quod. Invidiosum nomen est, infame, suspectum. Animum autem reliquis rebus ita perfecit, ut corpus; Non minor, inquit, voluptas percipitur ex vilissimis rebus quam ex pretiosissimis. Hoc est vim afferre, Torquate, sensibus, extorquere ex animis cognitiones verborum, quibus inbuti sumus. Nunc omni virtuti vitium contrario nomine opponitur. Si mala non sunt, iacet omnis ratio Peripateticorum. Illa tamen simplicia, vestra versuta. \n\n','2016-02-14 21:58:10','2016-02-14 22:56:17',NULL,NULL,0,1,0),(480,1,1,1,'Accounts',' Dicet pro me ipsa virtus nec dubitabit isti vestro beato M. Quare hoc videndum est, possitne nobis hoc ratio philosophorum dare. Duo Reges: constructio interrete. Sed haec omittamus; \n\n','2016-02-14 21:58:11','2016-02-14 22:56:18',NULL,NULL,0,1,0),(481,1,1,1,'Accounts',' Quod iam a me expectare noli. Duo Reges: constructio interrete. Idemne potest esse dies saepius, qui semel fuit? Et harum quidem rerum facilis est et expedita distinctio. Quodsi ipsam honestatem undique pertectam atque absolutam. Non enim solum Torquatus dixit quid sentiret, sed etiam cur. \n\n','2016-02-14 21:58:12','2016-02-14 22:56:19',NULL,NULL,0,1,0),(482,1,1,1,'Accounts',' Non quaeritur autem quid naturae tuae consentaneum sit, sed quid disciplinae. Deinde disputat, quod cuiusque generis animantium statui deceat extremum. An me, inquis, tam amentem putas, ut apud imperitos isto modo loquar? Traditur, inquit, ab Epicuro ratio neglegendi doloris. Duo Reges: constructio interrete. Sic, et quidem diligentius saepiusque ista loquemur inter nos agemusque communiter. Quia nec honesto quic quam honestius nec turpi turpius. Quae hic rei publicae vulnera inponebat, eadem ille sanabat. \n\n','2016-02-14 21:58:13','2016-02-14 22:56:19',NULL,NULL,0,1,0),(483,1,1,1,'Accounts',' Nam aliquando posse recte fieri dicunt nulla expectata nec quaesita voluptate. Summus dolor plures dies manere non potest? Minime vero istorum quidem, inquit. Bona autem corporis huic sunt, quod posterius posui, similiora. \n\n','2016-02-14 21:58:13','2016-02-14 22:56:20',NULL,NULL,0,1,0),(484,1,1,1,'Accounts',' Si longus, levis dictata sunt. Maximus dolor, inquit, brevis est. Ergo id est convenienter naturae vivere, a natura discedere. Duo Reges: constructio interrete. Tu enim ista lenius, hic Stoicorum more nos vexat. Itaque rursus eadem ratione, qua sum paulo ante usus, haerebitis. \n\n','2016-02-14 21:58:14','2016-02-14 22:56:20',NULL,NULL,0,1,0),(485,1,1,1,'Accounts',' Et quidem Arcesilas tuus, etsi fuit in disserendo pertinacior, tamen noster fuit; Eadem nunc mea adversum te oratio est. Erit enim instructus ad mortem contemnendam, ad exilium, ad ipsum etiam dolorem. Non enim iam stirpis bonum quaeret, sed animalis. Haec et tu ita posuisti, et verba vestra sunt. \n\n','2016-02-14 21:58:15','2016-02-14 22:56:21',NULL,NULL,0,1,0),(486,1,1,1,'Accounts',' Minime vero, inquit ille, consentit. Si enim ita est, vide ne facinus facias, cum mori suadeas. Bonum negas esse divitias, praeposìtum esse dicis? Sed eum qui audiebant, quoad poterant, defendebant sententiam suam. Quis istud, quaeso, nesciebat? Quid enim me prohiberet Epicureum esse, si probarem, quae ille diceret? Quae similitudo in genere etiam humano apparet. Hoc enim constituto in philosophia constituta sunt omnia. Duo Reges: constructio interrete. Non enim iam stirpis bonum quaeret, sed animalis. Stuprata per vim Lucretia a regis filio testata civis se ipsa interemit. \n\n','2016-02-14 21:58:15','2016-02-14 22:56:21',NULL,NULL,0,1,0),(487,1,1,1,'Accounts',' Que Manilium, ab iisque M. Habent enim et bene longam et satis litigiosam disputationem. Ita fit cum gravior, tum etiam splendidior oratio. Videsne quam sit magna dissensio? Graecis hoc modicum est: Leonidas, Epaminondas, tres aliqui aut quattuor; \n\n','2016-02-14 21:58:16','2016-02-14 22:56:22',NULL,NULL,0,1,0),(488,1,1,1,'Accounts',' Quid dubitas igitur mutare principia naturae? Vitae autem degendae ratio maxime quidem illis placuit quieta. Ut in geometria, prima si dederis, danda sunt omnia. Duo Reges: constructio interrete. Sextilio Rufo, cum is rem ad amicos ita deferret, se esse heredem Q. Quid de Platone aut de Democrito loquar? \n\n','2016-02-14 21:58:17','2016-02-14 22:56:22',NULL,NULL,0,1,0),(489,1,1,1,'Accounts',' At habetur! Et ego id scilicet nesciebam! Sed ut sit, etiamne post mortem coletur? Non quam nostram quidem, inquit Pomponius iocans; Nam si amitti vita beata potest, beata esse non potest. Quodsi ipsam honestatem undique pertectam atque absolutam. Quodcumque in mentem incideret, et quodcumque tamquam occurreret. Illud urgueam, non intellegere eum quid sibi dicendum sit, cum dolorem summum malum esse dixerit. Duo Reges: constructio interrete. Sic, et quidem diligentius saepiusque ista loquemur inter nos agemusque communiter. Quodsi ipsam honestatem undique pertectam atque absolutam. Et ille ridens: Video, inquit, quid agas; Haec et tu ita posuisti, et verba vestra sunt. Haec dicuntur inconstantissime. \n\n','2016-02-14 21:58:18','2016-02-14 22:56:23',NULL,NULL,0,1,0),(490,1,1,1,'Accounts',' Quid sequatur, quid repugnet, vident. Qua tu etiam inprudens utebare non numquam. Tecum optime, deinde etiam cum mediocri amico. Duo Reges: constructio interrete. \n\n','2016-02-14 21:58:18','2016-02-14 22:56:23',NULL,NULL,0,1,0),(491,1,1,1,'Accounts',' Cum ageremus, inquit, vitae beatum et eundem supremum diem, scribebamus haec. Istam voluptatem perpetuam quis potest praestare sapienti? Magni enim aestimabat pecuniam non modo non contra leges, sed etiam legibus partam. Non enim quaero quid verum, sed quid cuique dicendum sit. \n\n','2016-02-14 21:58:19','2016-02-14 22:56:24',NULL,NULL,0,1,0),(492,1,1,1,'Accounts',' Superiores tres erant, quae esse possent, quarum est una sola defensa, eaque vehementer. At certe gravius. Ita relinquet duas, de quibus etiam atque etiam consideret. Qui-vere falsone, quaerere mittimus-dicitur oculis se privasse; Hanc ergo intuens debet institutum illud quasi signum absolvere. Quamquam te quidem video minime esse deterritum. Duo Reges: constructio interrete. Cur post Tarentum ad Archytam? Tibi hoc incredibile, quod beatissimum. Huius ego nunc auctoritatem sequens idem faciam. \n\n','2016-02-14 21:58:20','2016-02-14 22:56:24',NULL,NULL,0,1,0),(493,1,1,1,'Accounts',' Si enim ad populum me vocas, eum. Huius ego nunc auctoritatem sequens idem faciam. Re mihi non aeque satisfacit, et quidem locis pluribus. Si alia sentit, inquam, alia loquitur, numquam intellegam quid sentiat; Duo Reges: constructio interrete. De hominibus dici non necesse est. \n\n','2016-02-14 21:58:20','2016-02-14 22:56:25',NULL,NULL,0,1,0),(494,1,1,1,'Accounts',' Praeclare hoc quidem. Si longus, levis dictata sunt. Quae cum praeponunt, ut sit aliqua rerum selectio, naturam videntur sequi; Cur igitur, cum de re conveniat, non malumus usitate loqui? Duo Reges: constructio interrete. Quantum Aristoxeni ingenium consumptum videmus in musicis? \n\n','2016-02-14 21:58:21','2016-02-14 22:56:25',NULL,NULL,0,1,0),(495,1,1,1,'Accounts',' Rationis enim perfectio est virtus; Cur igitur easdem res, inquam, Peripateticis dicentibus verbum nullum est, quod non intellegatur? Duarum enim vitarum nobis erunt instituta capienda. An hoc usque quaque, aliter in vita? Respondent extrema primis, media utrisque, omnia omnibus. Animum autem reliquis rebus ita perfecit, ut corpus; \n\n','2016-02-14 21:58:22','2016-02-14 22:56:25',NULL,NULL,0,1,0),(496,1,1,1,'Accounts',' Cupit enim dícere nihil posse ad beatam vitam deesse sapienti. Aut haec tibi, Torquate, sunt vituperanda aut patrocinium voluptatis repudiandum. Atqui haec patefactio quasi rerum opertarum, cum quid quidque sit aperitur, definitio est. Quare conare, quaeso. Nam illud vehementer repugnat, eundem beatum esse et multis malis oppressum. Si id dicis, vicimus. Duo Reges: constructio interrete. Cuius ad naturam apta ratio vera illa et summa lex a philosophis dicitur. \n\n','2016-02-14 21:58:22','2016-02-14 22:56:26',NULL,NULL,0,1,0),(497,1,1,1,'Accounts',' Ut pulsi recurrant? Quis istud possit, inquit, negare? Ergo, si semel tristior effectus est, hilara vita amissa est? Qui convenit? \n\n','2016-02-14 21:58:23','2016-02-14 22:56:26',NULL,NULL,0,1,0),(498,1,1,1,'Accounts',' Idemque diviserunt naturam hominis in animum et corpus. In schola desinis. Dolor ergo, id est summum malum, metuetur semper, etiamsi non aderit; Non enim, si malum est dolor, carere eo malo satis est ad bene vivendum. Duo Reges: constructio interrete. Aliter enim nosmet ipsos nosse non possumus. Quem Tiberina descensio festo illo die tanto gaudio affecit, quanto L. Hoc simile tandem est? \n\n','2016-02-14 21:58:24','2016-02-14 22:56:27',NULL,NULL,0,1,0),(499,1,1,1,'Accounts',' Nulla profecto est, quin suam vim retineat a primo ad extremum. Etenim semper illud extra est, quod arte comprehenditur. Duo enim genera quae erant, fecit tria. Duo Reges: constructio interrete. Bonum negas esse divitias, praeposìtum esse dicis? Nam si amitti vita beata potest, beata esse non potest. Indicant pueri, in quibus ut in speculis natura cernitur. Pauca mutat vel plura sane; \n\n','2016-02-14 21:58:25','2016-02-14 22:56:27',NULL,NULL,0,1,0),(500,1,1,1,'Accounts',' Quis non odit sordidos, vanos, leves, futtiles? Nihil minus, contraque illa hereditate dives ob eamque rem laetus. Aperiendum est igitur, quid sit voluptas; Duo Reges: constructio interrete. Ita relinquet duas, de quibus etiam atque etiam consideret. Quod non faceret, si in voluptate summum bonum poneret. ALIO MODO. Odium autem et invidiam facile vitabis. Quid enim est a Chrysippo praetermissum in Stoicis? Sed quot homines, tot sententiae; \n\n','2016-02-14 21:58:25','2016-02-14 22:56:27',NULL,NULL,0,1,0),(501,1,1,1,'Accounts',' Teneo, inquit, finem illi videri nihil dolere. Suo genere perveniant ad extremum; Fortasse id optimum, sed ubi illud: Plus semper voluptatis? Quis animo aequo videt eum, quem inpure ac flagitiose putet vivere? Quare hoc videndum est, possitne nobis hoc ratio philosophorum dare. Duo Reges: constructio interrete. Sed vobis voluptatum perceptarum recordatio vitam beatam facit, et quidem corpore perceptarum. Dat enim intervalla et relaxat. \n\n','2016-02-14 21:58:26','2016-02-14 22:56:28',NULL,NULL,0,1,0),(502,1,1,1,'Accounts',' Vos autem cum perspicuis dubia debeatis illustrare, dubiis perspicua conamini tollere. Cum audissem Antiochum, Brute, ut solebam, cum M. Est, ut dicis, inquit; Non quaeritur autem quid naturae tuae consentaneum sit, sed quid disciplinae. Nunc haec primum fortasse audientis servire debemus. Duo Reges: constructio interrete. Ita enim vivunt quidam, ut eorum vita refellatur oratio. \n\n','2016-02-14 21:58:27','2016-02-14 22:56:28',NULL,NULL,0,1,0),(503,1,1,1,'Accounts',' Mene ergo et Triarium dignos existimas, apud quos turpiter loquare? Bestiarum vero nullum iudicium puto. Si sapiens, ne tum quidem miser, cum ab Oroete, praetore Darei, in crucem actus est. Illa tamen simplicia, vestra versuta. Quae diligentissime contra Aristonem dicuntur a Chryippo. Duo Reges: constructio interrete. \n\n','2016-02-14 21:58:27','2016-02-14 22:56:29',NULL,NULL,0,1,0),(504,1,1,1,'Accounts',' Propter nos enim illam, non propter eam nosmet ipsos diligimus. At ille pellit, qui permulcet sensum voluptate. Varietates autem iniurasque fortunae facile veteres philosophorum praeceptis instituta vita superabat. Quod quidem nobis non saepe contingit. Si id dicis, vicimus. Ex ea difficultate illae fallaciloquae, ut ait Accius, malitiae natae sunt. \n\n','2016-02-14 21:58:28','2016-02-14 22:56:29',NULL,NULL,0,1,0),(505,1,1,1,'Accounts',' Quae quo sunt excelsiores, eo dant clariora indicia naturae. Haec et tu ita posuisti, et verba vestra sunt. \n\n','2016-02-14 21:58:29','2016-02-14 22:56:30',NULL,NULL,0,1,0),(506,1,1,1,'Accounts',' Quo plebiscito decreta a senatu est consuli quaestio Cn. Ita relinquet duas, de quibus etiam atque etiam consideret. Omnia contraria, quos etiam insanos esse vultis. Duo Reges: constructio interrete. Innumerabilia dici possunt in hanc sententiam, sed non necesse est. Hoc sic expositum dissimile est superiori. Deinde prima illa, quae in congressu solemus: Quid tu, inquit, huc? Quarum ambarum rerum cum medicinam pollicetur, luxuriae licentiam pollicetur. \n\n','2016-02-14 21:58:30','2016-02-14 22:56:30',NULL,NULL,0,1,0),(507,1,1,1,'Accounts',' Sine ea igitur iucunde negat posse se vivere? Quaesita enim virtus est, non quae relinqueret naturam, sed quae tueretur. Istic sum, inquit. At quicum ioca seria, ut dicitur, quicum arcana, quicum occulta omnia? Quorum altera prosunt, nocent altera. Istic sum, inquit. Duo Reges: constructio interrete. Sic consequentibus vestris sublatis prima tolluntur. Fatebuntur Stoici haec omnia dicta esse praeclare, neque eam causam Zenoni desciscendi fuisse. \n\n','2016-02-14 21:58:30','2016-02-14 22:56:30',NULL,NULL,0,1,0),(508,1,1,1,'Accounts',' At ego quem huic anteponam non audeo dicere; In his igitur partibus duabus nihil erat, quod Zeno commutare gestiret. Cave putes quicquam esse verius. Sed residamus, inquit, si placet. Bestiarum vero nullum iudicium puto. Invidiosum nomen est, infame, suspectum. Duo Reges: constructio interrete. Utilitatis causa amicitia est quaesita. \n\n','2016-02-14 21:58:31','2016-02-14 22:56:31',NULL,NULL,0,1,0),(509,1,1,1,'Accounts',' Qui est in parvis malis. Nunc de hominis summo bono quaeritur; Videsne quam sit magna dissensio? Duo Reges: constructio interrete. Audax negotium, dicerem impudens, nisi hoc institutum postea translatum ad philosophos nostros esset. Ita enim vivunt quidam, ut eorum vita refellatur oratio. Huius, Lyco, oratione locuples, rebus ipsis ielunior. Neque solum ea communia, verum etiam paria esse dixerunt. \n\n','2016-02-14 21:58:32','2016-02-14 22:56:32',NULL,NULL,0,1,0),(510,1,1,1,'Accounts',' Haec igitur Epicuri non probo, inquam. Mihi, inquam, qui te id ipsum rogavi? Semper enim ex eo, quod maximas partes continet latissimeque funditur, tota res appellatur. Quid est igitur, cur ita semper deum appellet Epicurus beatum et aeternum? Verba tu fingas et ea dicas, quae non sentias? Duo Reges: constructio interrete. Eiuro, inquit adridens, iniquum, hac quidem de re; \n\n','2016-02-14 21:58:32','2016-02-14 22:56:32',NULL,NULL,0,1,0),(511,1,1,1,'Accounts',' Stulti autem malorum memoria torquentur, sapientes bona praeterita grata recordatione renovata delectant. Sic enim maiores nostri labores non fugiendos tristissimo tamen verbo aerumnas etiam in deo nominaverunt. Itaque e contrario moderati aequabilesque habitus, affectiones ususque corporis apti esse ad naturam videntur. Quid ergo attinet gloriose loqui, nisi constanter loquare? Duo Reges: constructio interrete. Octavio fuit, cum illam severitatem in eo filio adhibuit, quem in adoptionem D. \n\n','2016-02-14 21:58:33','2016-02-14 22:56:33',NULL,NULL,0,1,0),(512,1,1,1,'Accounts',' Illi enim inter se dissentiunt. Quae cum essent dicta, finem fecimus et ambulandi et disputandi. Nec enim, omnes avaritias si aeque avaritias esse dixerimus, sequetur ut etiam aequas esse dicamus. Ego quoque, inquit, didicerim libentius si quid attuleris, quam te reprehenderim. Duo Reges: constructio interrete. Inde igitur, inquit, ordiendum est. \n\n','2016-02-14 21:58:34','2016-02-14 22:56:33',NULL,NULL,0,1,0),(513,1,1,1,'Accounts',' Omnia contraria, quos etiam insanos esse vultis. Quonam modo? Quid ergo attinet gloriose loqui, nisi constanter loquare? Nihil enim iam habes, quod ad corpus referas; Poterat autem inpune; \n\n','2016-02-14 21:58:35','2016-02-14 22:56:34',NULL,NULL,0,1,0),(514,1,1,1,'Accounts',' Egone non intellego, quid sit don Graece, Latine voluptas? Erat enim res aperta. Sed tamen est aliquid, quod nobis non liceat, liceat illis. Atqui perspicuum est hominem e corpore animoque constare, cum primae sint animi partes, secundae corporis. Illud urgueam, non intellegere eum quid sibi dicendum sit, cum dolorem summum malum esse dixerit. \n\n','2016-02-14 21:58:35','2016-02-14 22:56:34',NULL,NULL,0,1,0),(515,1,1,1,'Accounts',' Ut in voluptate sit, qui epuletur, in dolore, qui torqueatur. Sed virtutem ipsam inchoavit, nihil amplius. Sed venio ad inconstantiae crimen, ne saepius dicas me aberrare; Erit enim instructus ad mortem contemnendam, ad exilium, ad ipsum etiam dolorem. Igitur neque stultorum quisquam beatus neque sapientium non beatus. In quibus doctissimi illi veteres inesse quiddam caeleste et divinum putaverunt. \n\n','2016-02-14 21:58:36','2016-02-14 22:56:34',NULL,NULL,0,1,0),(516,1,1,1,'Accounts',' Nulla erit controversia. Quare conare, quaeso. Si de re disceptari oportet, nulla mihi tecum, Cato, potest esse dissensio. Haec para/doca illi, nos admirabilia dicamus. Duo Reges: constructio interrete. Expectoque quid ad id, quod quaerebam, respondeas. \n\n','2016-02-14 21:58:37','2016-02-14 22:56:35',NULL,NULL,0,1,0),(517,1,1,1,'Accounts',' Prioris generis est docilitas, memoria; Sed id ne cogitari quidem potest quale sit, ut non repugnet ipsum sibi. Atqui reperies, inquit, in hoc quidem pertinacem; Si quae forte-possumus. Duo Reges: constructio interrete. De illis, cum volemus. Sed vos squalidius, illorum vides quam niteat oratio. Quae autem natura suae primae institutionis oblita est? Atque haec ita iustitiae propria sunt, ut sint virtutum reliquarum communia. \n\n','2016-02-14 21:58:38','2016-02-14 22:56:35',NULL,NULL,0,1,0),(518,1,1,1,'Accounts',' Sextilio Rufo, cum is rem ad amicos ita deferret, se esse heredem Q. Neque solum ea communia, verum etiam paria esse dixerunt. Primum in nostrane potestate est, quid meminerimus? Illi enim inter se dissentiunt. Equidem e Cn. Cur igitur, inquam, res tam dissimiles eodem nomine appellas? Duo Reges: constructio interrete. Idemque diviserunt naturam hominis in animum et corpus. Aut unde est hoc contritum vetustate proverbium: quicum in tenebris? Hic nihil fuit, quod quaereremus. \n\n','2016-02-14 21:58:39','2016-02-14 22:56:36',NULL,NULL,0,1,0),(519,1,1,1,'Accounts',' Respondeat totidem verbis. Minime vero istorum quidem, inquit. Quantum Aristoxeni ingenium consumptum videmus in musicis? Nunc reliqua videamus, nisi aut ad haec, Cato, dicere aliquid vis aut nos iam longiores sumus. Ne in odium veniam, si amicum destitero tueri. Est enim effectrix multarum et magnarum voluptatum. \n\n','2016-02-14 21:58:39','2016-02-14 22:56:36',NULL,NULL,0,1,0),(520,1,1,1,'Accounts',' Tu enim ista lenius, hic Stoicorum more nos vexat. An vero, inquit, quisquam potest probare, quod perceptfum, quod. Sed ille, ut dixi, vitiose. In qua quid est boni praeter summam voluptatem, et eam sempiternam? \n\n','2016-02-14 21:58:40','2016-02-14 22:56:37',NULL,NULL,0,1,0),(521,1,1,1,'Accounts',' Respondeat totidem verbis. Nam illud vehementer repugnat, eundem beatum esse et multis malis oppressum. Eaedem res maneant alio modo. Duo Reges: constructio interrete. Tum Triarius: Posthac quidem, inquit, audacius. Vulgo enim dicitur: Iucundi acti labores, nec male Euripidesconcludam, si potero, Latine; Ita relinquet duas, de quibus etiam atque etiam consideret. Cum ageremus, inquit, vitae beatum et eundem supremum diem, scribebamus haec. \n\n','2016-02-14 21:58:41','2016-02-14 22:56:37',NULL,NULL,0,1,0),(522,1,1,1,'Accounts',' Quod autem principium officii quaerunt, melius quam Pyrrho; Ut placet, inquit, etsi enim illud erat aptius, aequum cuique concedere. Cur deinde Metrodori liberos commendas? Duo Reges: constructio interrete. Ad eas enim res ab Epicuro praecepta dantur. Quae hic rei publicae vulnera inponebat, eadem ille sanabat. Ipse Epicurus fortasse redderet, ut Sextus Peducaeus, Sex. \n\n','2016-02-14 21:58:41','2016-02-14 22:56:38',NULL,NULL,0,1,0),(523,1,1,1,'Accounts',' Conferam tecum, quam cuique verso rem subicias; Sic consequentibus vestris sublatis prima tolluntur. Quae cum ita sint, effectum est nihil esse malum, quod turpe non sit. Idemque diviserunt naturam hominis in animum et corpus. Nam, ut paulo ante docui, augendae voluptatis finis est doloris omnis amotio. Duo Reges: constructio interrete. \n\n','2016-02-14 21:58:42','2016-02-14 22:56:38',NULL,NULL,0,1,0),(524,1,1,1,'Accounts',' An eiusdem modi? Non enim solum Torquatus dixit quid sentiret, sed etiam cur. In quibus doctissimi illi veteres inesse quiddam caeleste et divinum putaverunt. Duo Reges: constructio interrete. \n\n','2016-02-14 21:58:44','2016-02-14 22:56:39',NULL,NULL,0,1,0),(525,1,1,1,'Accounts',' Itaque hic ipse iam pridem est reiectus; Aliter autem vobis placet. Quis est tam dissimile homini. Quae quidem sapientes sequuntur duce natura tamquam videntes; Duo Reges: constructio interrete. Nam memini etiam quae nolo, oblivisci non possum quae volo. Quam nemo umquam voluptatem appellavit, appellat; \n\n','2016-02-14 21:58:44','2016-02-14 22:56:39',NULL,NULL,0,1,0),(526,1,1,1,'Accounts',' Quo plebiscito decreta a senatu est consuli quaestio Cn. Sed ille, ut dixi, vitiose. Potius inflammat, ut coercendi magis quam dedocendi esse videantur. Cum id fugiunt, re eadem defendunt, quae Peripatetici, verba. Duo Reges: constructio interrete. Sed haec nihil sane ad rem; Non risu potius quam oratione eiciendum? Paulum, cum regem Persem captum adduceret, eodem flumine invectio? Quasi vero, inquit, perpetua oratio rhetorum solum, non etiam philosophorum sit. Etenim nec iustitia nec amicitia esse omnino poterunt, nisi ipsae per se expetuntur. \n\n','2016-02-14 21:58:46','2016-02-14 22:56:39',NULL,NULL,0,1,0),(527,1,1,1,'Accounts',' Et quod est munus, quod opus sapientiae? Id et fieri posse et saepe esse factum et ad voluptates percipiendas maxime pertinere. Quod eo liquidius faciet, si perspexerit rerum inter eas verborumne sit controversia. Ita nemo beato beatior. Conferam tecum, quam cuique verso rem subicias; Modo etiam paulum ad dexteram de via declinavi, ut ad Pericli sepulcrum accederem. Facit enim ille duo seiuncta ultima bonorum, quae ut essent vera, coniungi debuerunt; Duo Reges: constructio interrete. Hoc etsi multimodis reprehendi potest, tamen accipio, quod dant. Nam de isto magna dissensio est. \n\n','2016-02-14 21:58:47','2016-02-14 22:56:40',NULL,NULL,0,1,0),(528,1,1,1,'Accounts',' Hoc non est positum in nostra actione. Qui non moveatur et offensione turpitudinis et comprobatione honestatis? An nisi populari fama? Itaque his sapiens semper vacabit. Quid enim est a Chrysippo praetermissum in Stoicis? Idem iste, inquam, de voluptate quid sentit? \n\n','2016-02-14 21:58:47','2016-02-14 22:56:40',NULL,NULL,0,1,0),(529,1,1,1,'Accounts',' Quo modo autem optimum, si bonum praeterea nullum est? Multoque hoc melius nos veriusque quam Stoici. Nihilo beatiorem esse Metellum quam Regulum. Hoc non est positum in nostra actione. Habent enim et bene longam et satis litigiosam disputationem. Nihil opus est exemplis hoc facere longius. Duo Reges: constructio interrete. Quippe: habes enim a rhetoribus; Nam illud vehementer repugnat, eundem beatum esse et multis malis oppressum. Neque solum ea communia, verum etiam paria esse dixerunt. \n\n','2016-02-14 21:58:48','2016-02-14 22:56:41',NULL,NULL,0,1,0),(530,1,1,1,'Accounts',' Tum Piso: Quoniam igitur aliquid omnes, quid Lucius noster? Ita prorsus, inquam; Hanc ergo intuens debet institutum illud quasi signum absolvere. Sed ille, ut dixi, vitiose. Non est ista, inquam, Piso, magna dissensio. Duo Reges: constructio interrete. Minime vero, inquit ille, consentit. \n\n','2016-02-14 21:58:49','2016-02-14 22:56:41',NULL,NULL,0,1,0),(531,1,1,1,'Accounts',' Sed plane dicit quod intellegit. Vos autem cum perspicuis dubia debeatis illustrare, dubiis perspicua conamini tollere. Duo Reges: constructio interrete. Sed ad haec, nisi molestum est, habeo quae velim. Quae fere omnia appellantur uno ingenii nomine, easque virtutes qui habent, ingeniosi vocantur. Nummus in Croesi divitiis obscuratur, pars est tamen divitiarum. Quo plebiscito decreta a senatu est consuli quaestio Cn. \n\n','2016-02-14 21:58:50','2016-02-14 22:56:42',NULL,NULL,0,1,0),(532,1,1,1,'Accounts',' Sed id ne cogitari quidem potest quale sit, ut non repugnet ipsum sibi. Hoc etsi multimodis reprehendi potest, tamen accipio, quod dant. Quamquam id quidem, infinitum est in hac urbe; Quid turpius quam sapientis vitam ex insipientium sermone pendere? Aliud igitur esse censet gaudere, aliud non dolere. Duo Reges: constructio interrete. Neutrum vero, inquit ille. \n\n','2016-02-14 21:58:50','2016-02-14 22:56:42',NULL,NULL,0,1,0),(533,1,1,1,'Accounts',' Ita relinquet duas, de quibus etiam atque etiam consideret. Sed quid attinet de rebus tam apertis plura requirere? Suo genere perveniant ad extremum; At ille non pertimuit saneque fidenter: Istis quidem ipsis verbis, inquit; Ampulla enim sit necne sit, quis non iure optimo irrideatur, si laboret? Non enim ipsa genuit hominem, sed accepit a natura inchoatum. Beatus autem esse in maximarum rerum timore nemo potest. Quid dubitas igitur mutare principia naturae? \n\n','2016-02-14 21:58:51','2016-02-14 22:56:42',NULL,NULL,0,1,0),(534,1,1,1,'Accounts',' Quos nisi redarguimus, omnis virtus, omne decus, omnis vera laus deserenda est. Negare non possum. Nihil illinc huc pervenit. Expectoque quid ad id, quod quaerebam, respondeas. Disserendi artem nullam habuit. Quia nec honesto quic quam honestius nec turpi turpius. \n\n','2016-02-14 21:58:52','2016-02-14 22:56:43',NULL,NULL,0,1,0),(535,1,1,1,'Accounts',' Ita enim vivunt quidam, ut eorum vita refellatur oratio. Sit ista in Graecorum levitate perversitas, qui maledictis insectantur eos, a quibus de veritate dissentiunt. Si qua in iis corrigere voluit, deteriora fecit. Quid est, quod ab ea absolvi et perfici debeat? Duo Reges: constructio interrete. Videmusne ut pueri ne verberibus quidem a contemplandis rebus perquirendisque deterreantur? Quae cum dixisset, finem ille. Neque solum ea communia, verum etiam paria esse dixerunt. Cur tantas regiones barbarorum pedibus obiit, tot maria transmisit? \n\n','2016-02-14 21:58:52','2016-02-14 22:56:44',NULL,NULL,0,1,0),(536,1,1,1,'Accounts',' Collige omnia, quae soletis: Praesidium amicorum. Invidiosum nomen est, infame, suspectum. Aliter enim nosmet ipsos nosse non possumus. Tum Torquatus: Prorsus, inquit, assentior; Sine ea igitur iucunde negat posse se vivere? Sed eum qui audiebant, quoad poterant, defendebant sententiam suam. \n\n','2016-02-14 21:58:53','2016-02-14 22:56:44',NULL,NULL,0,1,0),(537,1,1,1,'Accounts',' Quae quidem sapientes sequuntur duce natura tamquam videntes; Cui Tubuli nomen odio non est? Satisne vobis videor pro meo iure in vestris auribus commentatus? Duo Reges: constructio interrete. Quid est, quod ab ea absolvi et perfici debeat? Et quidem iure fortasse, sed tamen non gravissimum est testimonium multitudinis. Iam in altera philosophiae parte. Quamquam id quidem, infinitum est in hac urbe; Apud ceteros autem philosophos, qui quaesivit aliquid, tacet; \n\n','2016-02-14 21:58:54','2016-02-14 22:56:45',NULL,NULL,0,1,0),(538,1,1,1,'Accounts',' Non laboro, inquit, de nomine. Dic in quovis conventu te omnia facere, ne doleas. Apparet statim, quae sint officia, quae actiones. Duo Reges: constructio interrete. Cum ageremus, inquit, vitae beatum et eundem supremum diem, scribebamus haec. Negat enim summo bono afferre incrementum diem. Omnes enim iucundum motum, quo sensus hilaretur. Quid est igitur, inquit, quod requiras? Egone non intellego, quid sit don Graece, Latine voluptas? \n\n','2016-02-14 21:58:55','2016-02-14 22:56:45',NULL,NULL,0,1,0),(539,1,1,1,'Accounts',' Non quam nostram quidem, inquit Pomponius iocans; Huius, Lyco, oratione locuples, rebus ipsis ielunior. Sic, et quidem diligentius saepiusque ista loquemur inter nos agemusque communiter. Duo Reges: constructio interrete. In quo etsi est magnus, tamen nova pleraque et perpauca de moribus. Aliud igitur esse censet gaudere, aliud non dolere. Pisone in eo gymnasio, quod Ptolomaeum vocatur, unaque nobiscum Q. Honesta oratio, Socratica, Platonis etiam. Cur ipse Pythagoras et Aegyptum lustravit et Persarum magos adiit? Mihi enim erit isdem istis fortasse iam utendum. Ita ne hoc quidem modo paria peccata sunt. \n\n','2016-02-14 21:58:56','2016-02-14 22:56:45',NULL,NULL,0,1,0),(540,1,1,1,'Accounts',' In qua si nihil est praeter rationem, sit in una virtute finis bonorum; Ad quorum et cognitionem et usum iam corroborati natura ipsa praeeunte deducimur. Nummus in Croesi divitiis obscuratur, pars est tamen divitiarum. Duo Reges: constructio interrete. Beatus autem esse in maximarum rerum timore nemo potest. Illud dico, ea, quae dicat, praeclare inter se cohaerere. \n\n','2016-02-14 21:58:56','2016-02-14 22:56:46',NULL,NULL,0,1,0),(541,1,1,1,'Accounts',' Etenim si delectamur, cum scribimus, quis est tam invidus, qui ab eo nos abducat? Non potes, nisi retexueris illa. Duo Reges: constructio interrete. Eadem nunc mea adversum te oratio est. In schola desinis. Si verbum sequimur, primum longius verbum praepositum quam bonum. \n\n','2016-02-14 21:58:57','2016-02-14 22:56:46',NULL,NULL,0,1,0),(542,1,1,1,'Accounts',' Quaerimus enim finem bonorum. Primum quid tu dicis breve? Sed ad bona praeterita redeamus. A primo, ut opinor, animantium ortu petitur origo summi boni. Duo Reges: constructio interrete. Hoc tu nunc in illo probas. Non quaeritur autem quid naturae tuae consentaneum sit, sed quid disciplinae. Bestiarum vero nullum iudicium puto. Quo plebiscito decreta a senatu est consuli quaestio Cn. \n\n','2016-02-14 21:58:58','2016-02-14 22:56:47',NULL,NULL,0,1,0),(543,1,1,1,'Accounts',' Quorum altera prosunt, nocent altera. Aut, Pylades cum sis, dices te esse Orestem, ut moriare pro amico? At iste non dolendi status non vocatur voluptas. Duo Reges: constructio interrete. Quae similitudo in genere etiam humano apparet. Quod cum ille dixisset et satis disputatum videretur, in oppidum ad Pomponium perreximus omnes. Ait enim se, si uratur, Quam hoc suave! dicturum. Quod cum accidisset ut alter alterum necopinato videremus, surrexit statim. Quid censes in Latino fore? Sint modo partes vitae beatae. An me, inquis, tam amentem putas, ut apud imperitos isto modo loquar? \n\n','2016-02-14 21:58:58','2016-02-14 22:56:47',NULL,NULL,0,1,0),(544,1,1,1,'Accounts',' Equidem, sed audistine modo de Carneade? Scisse enim te quis coarguere possit? Aut haec tibi, Torquate, sunt vituperanda aut patrocinium voluptatis repudiandum. Sed ad haec, nisi molestum est, habeo quae velim. Tum Lucius: Mihi vero ista valde probata sunt, quod item fratri puto. De vacuitate doloris eadem sententia erit. \n\n','2016-02-14 21:58:59','2016-02-14 22:56:48',NULL,NULL,0,1,0),(545,1,1,1,'Accounts',' Graecum enim hunc versum nostis omnes-: Suavis laborum est praeteritorum memoria. Quonam modo? Eam tum adesse, cum dolor omnis absit; Vos autem cum perspicuis dubia debeatis illustrare, dubiis perspicua conamini tollere. Varietates autem iniurasque fortunae facile veteres philosophorum praeceptis instituta vita superabat. Quae quidem sapientes sequuntur duce natura tamquam videntes; Bona autem corporis huic sunt, quod posterius posui, similiora. Duo Reges: constructio interrete. Tubulum fuisse, qua illum, cuius is condemnatus est rogatione, P. Habes, inquam, Cato, formam eorum, de quibus loquor, philosophorum. Huius, Lyco, oratione locuples, rebus ipsis ielunior. \n\n','2016-02-14 21:59:00','2016-02-14 22:56:48',NULL,NULL,0,1,0),(546,1,1,1,'Accounts',' Non quaeritur autem quid naturae tuae consentaneum sit, sed quid disciplinae. Quid enim est a Chrysippo praetermissum in Stoicis? Verum hoc idem saepe faciamus. Duo Reges: constructio interrete. Is ita vivebat, ut nulla tam exquisita posset inveniri voluptas, qua non abundaret. Quod quidem iam fit etiam in Academia. Sin te auctoritas commovebat, nobisne omnibus et Platoni ipsi nescio quem illum anteponebas? \n\n','2016-02-14 21:59:00','2016-02-14 22:56:48',NULL,NULL,0,1,0),(547,1,1,1,'Accounts',' Quid in isto egregio tuo officio et tanta fide-sic enim existimo-ad corpus refers? Sed ad haec, nisi molestum est, habeo quae velim. Ad eas enim res ab Epicuro praecepta dantur. Bona autem corporis huic sunt, quod posterius posui, similiora. Graecis hoc modicum est: Leonidas, Epaminondas, tres aliqui aut quattuor; \n\n','2016-02-14 21:59:01','2016-02-14 22:56:49',NULL,NULL,0,1,0),(548,1,1,1,'Accounts',' Frater et T. Itaque hic ipse iam pridem est reiectus; Duo Reges: constructio interrete. At ille pellit, qui permulcet sensum voluptate. Omnia peccata paria dicitis. Tum mihi Piso: Quid ergo? Mihi enim satis est, ipsis non satis. Experiamur igitur, inquit, etsi habet haec Stoicorum ratio difficilius quiddam et obscurius. \n\n','2016-02-14 21:59:02','2016-02-14 22:56:49',NULL,NULL,0,1,0),(549,1,1,1,'Accounts',' Summus dolor plures dies manere non potest? Tum, Quintus et Pomponius cum idem se velle dixissent, Piso exorsus est. Gerendus est mos, modo recte sentiat. Videamus animi partes, quarum est conspectus illustrior; Si quidem, inquit, tollerem, sed relinquo. Non minor, inquit, voluptas percipitur ex vilissimis rebus quam ex pretiosissimis. Duo Reges: constructio interrete. Mihi quidem Antiochum, quem audis, satis belle videris attendere. Quamquam te quidem video minime esse deterritum. Iubet igitur nos Pythius Apollo noscere nosmet ipsos. Sed tu istuc dixti bene Latine, parum plane. Quae tamen a te agetur non melior, quam illae sunt, quas interdum optines. \n\n','2016-02-14 21:59:03','2016-02-14 22:56:50',NULL,NULL,0,1,0),(550,1,1,1,'Accounts',' Ita enim vivunt quidam, ut eorum vita refellatur oratio. Sed plane dicit quod intellegit. Si quicquam extra virtutem habeatur in bonis. Tu enim ista lenius, hic Stoicorum more nos vexat. Post enim Chrysippum eum non sane est disputatum. Sic enim censent, oportunitatis esse beate vivere. \n\n','2016-02-14 21:59:04','2016-02-14 22:56:50',NULL,NULL,0,1,0),(551,1,1,1,'Accounts',' Ita redarguitur ipse a sese, convincunturque scripta eius probitate ipsius ac moribus. Facit igitur Lucius noster prudenter, qui audire de summo bono potissimum velit; Non est ista, inquam, Piso, magna dissensio. Duo Reges: constructio interrete. Quod quidem iam fit etiam in Academia. Verum hoc loco sumo verbis his eandem certe vim voluptatis Epicurum nosse quam ceteros. Inde sermone vario sex illa a Dipylo stadia confecimus. \n\n','2016-02-14 21:59:04','2016-02-14 22:56:51',NULL,NULL,0,1,0),(552,1,1,1,'Accounts',' Addidisti ad extremum etiam indoctum fuisse. Nulla profecto est, quin suam vim retineat a primo ad extremum. Eorum enim omnium multa praetermittentium, dum eligant aliquid, quod sequantur, quasi curta sententia; Etenim semper illud extra est, quod arte comprehenditur. Ad quorum et cognitionem et usum iam corroborati natura ipsa praeeunte deducimur. Duo Reges: constructio interrete. Murenam te accusante defenderem. Propter nos enim illam, non propter eam nosmet ipsos diligimus. \n\n','2016-02-14 21:59:05','2016-02-14 22:56:51',NULL,NULL,0,1,0),(553,1,1,1,'Accounts',' Nihil opus est exemplis hoc facere longius. Illa videamus, quae a te de amicitia dicta sunt. Ita ne hoc quidem modo paria peccata sunt. Hic ambiguo ludimur. Hoc ipsum elegantius poni meliusque potuit. \n\n','2016-02-14 21:59:06','2016-02-14 22:56:51',NULL,NULL,0,1,0),(554,1,1,1,'Accounts',' Utrum igitur tibi litteram videor an totas paginas commovere? Idemne potest esse dies saepius, qui semel fuit? Sic consequentibus vestris sublatis prima tolluntur. Atque haec coniunctio confusioque virtutum tamen a philosophis ratione quadam distinguitur. Duo Reges: constructio interrete. Parvi enim primo ortu sic iacent, tamquam omnino sine animo sint. Addebat etiam se in legem Voconiam iuratum contra eam facere non audere, nisi aliter amicis videretur. Etenim semper illud extra est, quod arte comprehenditur. \n\n','2016-02-14 21:59:06','2016-02-14 22:56:52',NULL,NULL,0,1,0),(555,1,1,1,'Accounts',' An hoc usque quaque, aliter in vita? Quis est tam dissimile homini. \n\n','2016-02-14 21:59:07','2016-02-14 22:56:52',NULL,NULL,0,1,0),(556,1,1,1,'Accounts',' Qua igitur re ab deo vincitur, si aeternitate non vincitur? Quod non faceret, si in voluptate summum bonum poneret. Longum est enim ad omnia respondere, quae a te dicta sunt. Cave putes quicquam esse verius. Sint ista Graecorum; Duo Reges: constructio interrete. Quos quidem tibi studiose et diligenter tractandos magnopere censeo. Sed eum qui audiebant, quoad poterant, defendebant sententiam suam. \n\n','2016-02-14 21:59:08','2016-02-14 22:56:53',NULL,NULL,0,1,0),(557,1,1,1,'Accounts',' Ita similis erit ei finis boni, atque antea fuerat, neque idem tamen; Quae sunt igitur communia vobis cum antiquis, iis sic utamur quasi concessis; Quid est enim aliud esse versutum? Scaevolam M. Ergo hoc quidem apparet, nos ad agendum esse natos. \n\n','2016-02-14 21:59:08','2016-02-14 22:56:54',NULL,NULL,0,1,0),(558,1,1,1,'Accounts',' Nonne igitur tibi videntur, inquit, mala? Quae autem natura suae primae institutionis oblita est? Ut in geometria, prima si dederis, danda sunt omnia. Quare conare, quaeso. Quis istud possit, inquit, negare? Quid est igitur, inquit, quod requiras? Utrum igitur tibi litteram videor an totas paginas commovere? Duo Reges: constructio interrete. \n\n','2016-02-14 21:59:09','2016-02-14 22:56:54',NULL,NULL,0,1,0),(559,1,1,1,'Accounts',' Quod si ita sit, cur opera philosophiae sit danda nescio. An vero displicuit ea, quae tributa est animi virtutibus tanta praestantia? An vero, inquit, quisquam potest probare, quod perceptfum, quod. Satis est ad hoc responsum. \n\n','2016-02-14 21:59:10','2016-02-14 22:56:55',NULL,NULL,0,1,0),(560,1,1,1,'Accounts',' Videamus animi partes, quarum est conspectus illustrior; Eam tum adesse, cum dolor omnis absit; Tum Triarius: Posthac quidem, inquit, audacius. Videmusne ut pueri ne verberibus quidem a contemplandis rebus perquirendisque deterreantur? Omnia contraria, quos etiam insanos esse vultis. At modo dixeras nihil in istis rebus esse, quod interesset. Nobis aliter videtur, recte secusne, postea; Duo Reges: constructio interrete. \n\n','2016-02-14 21:59:11','2016-02-14 22:56:55',NULL,NULL,0,1,0),(561,1,1,1,'Accounts',' Bestiarum vero nullum iudicium puto. Quod si ita sit, cur opera philosophiae sit danda nescio. Si quicquam extra virtutem habeatur in bonis. Eaedem enim utilitates poterunt eas labefactare atque pervertere. Non autem hoc: igitur ne illud quidem. \n\n','2016-02-14 21:59:11','2016-02-14 22:56:56',NULL,NULL,0,1,0),(562,1,1,1,'Accounts',' Ergo id est convenienter naturae vivere, a natura discedere. Quantum Aristoxeni ingenium consumptum videmus in musicis? Conferam avum tuum Drusum cum C. Magni enim aestimabat pecuniam non modo non contra leges, sed etiam legibus partam. \n\n','2016-02-14 21:59:12','2016-02-14 22:56:56',NULL,NULL,0,1,0),(563,1,1,1,'Accounts',' Indicant pueri, in quibus ut in speculis natura cernitur. Atqui iste locus est, Piso, tibi etiam atque etiam confirmandus, inquam; Nam, ut sint illa vendibiliora, haec uberiora certe sunt. Duo Reges: constructio interrete. Sed emolumenta communia esse dicuntur, recte autem facta et peccata non habentur communia. Que Manilium, ab iisque M. Indicant pueri, in quibus ut in speculis natura cernitur. Qui autem de summo bono dissentit de tota philosophiae ratione dissentit. \n\n','2016-02-14 21:59:13','2016-02-14 22:56:57',NULL,NULL,0,1,0),(564,1,1,1,'Accounts',' Isto modo ne improbos quidem, si essent boni viri. Nunc haec primum fortasse audientis servire debemus. Quid ergo aliud intellegetur nisi uti ne quae pars naturae neglegatur? Itaque sensibus rationem adiunxit et ratione effecta sensus non reliquit. \n\n','2016-02-14 21:59:13','2016-02-14 22:56:57',NULL,NULL,0,1,0),(565,1,1,1,'Accounts',' Ille enim occurrentia nescio quae comminiscebatur; Philosophi autem in suis lectulis plerumque moriuntur. Quia dolori non voluptas contraria est, sed doloris privatio. \n\n','2016-02-14 21:59:14','2016-02-14 22:56:57',NULL,NULL,0,1,0),(566,1,1,1,'Accounts',' Quibus ego vehementer assentior. Respondeat totidem verbis. Verba tu fingas et ea dicas, quae non sentias? Putabam equidem satis, inquit, me dixisse. His singulis copiose responderi solet, sed quae perspicua sunt longa esse non debent. Duo Reges: constructio interrete. Terram, mihi crede, ea lanx et maria deprimet. Ita graviter et severe voluptatem secrevit a bono. Ita prorsus, inquam; Sed in rebus apertissimis nimium longi sumus. \n\n','2016-02-14 21:59:15','2016-02-14 22:56:58',NULL,NULL,0,1,0),(567,1,1,1,'Accounts',' Rationis enim perfectio est virtus; Duo Reges: constructio interrete. Quae cum praeponunt, ut sit aliqua rerum selectio, naturam videntur sequi; Primum in nostrane potestate est, quid meminerimus? De illis, cum volemus. Intrandum est igitur in rerum naturam et penitus quid ea postulet pervidendum; An est aliquid per se ipsum flagitiosum, etiamsi nulla comitetur infamia? Negat enim summo bono afferre incrementum diem. \n\n','2016-02-14 21:59:16','2016-02-14 22:56:58',NULL,NULL,0,1,0),(568,1,1,1,'Accounts',' Quicquid porro animo cernimus, id omne oritur a sensibus; Itaque hic ipse iam pridem est reiectus; Expectoque quid ad id, quod quaerebam, respondeas. Haec para/doca illi, nos admirabilia dicamus. Non quaero, quid dicat, sed quid convenienter possit rationi et sententiae suae dicere. Duo Reges: constructio interrete. Nunc haec primum fortasse audientis servire debemus. \n\n','2016-02-14 21:59:16','2016-02-14 22:56:59',NULL,NULL,0,1,0),(569,1,1,1,'Accounts',' Summus dolor plures dies manere non potest? Cur igitur easdem res, inquam, Peripateticis dicentibus verbum nullum est, quod non intellegatur? Quae hic rei publicae vulnera inponebat, eadem ille sanabat. Qua igitur re ab deo vincitur, si aeternitate non vincitur? Illud non continuo, ut aeque incontentae. Duo Reges: constructio interrete. \n\n','2016-02-14 21:59:17','2016-02-14 22:56:59',NULL,NULL,0,1,0),(570,1,1,1,'Accounts',' Non est enim vitium in oratione solum, sed etiam in moribus. Tollitur beneficium, tollitur gratia, quae sunt vincla concordiae. Beatum, inquit. Si stante, hoc natura videlicet vult, salvam esse se, quod concedimus; \n\n','2016-02-14 21:59:18','2016-02-14 22:57:00',NULL,NULL,0,1,0),(571,1,1,1,'Accounts',' Qua ex cognitione facilior facta est investigatio rerum occultissimarum. Non quam nostram quidem, inquit Pomponius iocans; Longum est enim ad omnia respondere, quae a te dicta sunt. Mihi enim satis est, ipsis non satis. Duo Reges: constructio interrete. Recte, inquit, intellegis. Venit ad extremum; Te enim iudicem aequum puto, modo quae dicat ille bene noris. Philosophi autem in suis lectulis plerumque moriuntur. Nam Pyrrho, Aristo, Erillus iam diu abiecti. \n\n','2016-02-14 21:59:19','2016-02-14 22:57:00',NULL,NULL,0,1,0),(572,1,1,1,'Accounts',' Traditur, inquit, ab Epicuro ratio neglegendi doloris. Quid, quod homines infima fortuna, nulla spe rerum gerendarum, opifices denique delectantur historia? Ut scias me intellegere, primum idem esse dico voluptatem, quod ille don. Duo Reges: constructio interrete. Satisne ergo pudori consulat, si quis sine teste libidini pareat? Pugnant Stoici cum Peripateticis. \n\n','2016-02-14 21:59:19','2016-02-14 22:57:00',NULL,NULL,0,1,0),(573,1,1,1,'Accounts',' Tum Torquatus: Prorsus, inquit, assentior; Stulti autem malorum memoria torquentur, sapientes bona praeterita grata recordatione renovata delectant. Duo Reges: constructio interrete. Etenim semper illud extra est, quod arte comprehenditur. Nam de isto magna dissensio est. A quibus propter discendi cupiditatem videmus ultimas terras esse peragratas. \n\n','2016-02-14 21:59:20','2016-02-14 22:57:01',NULL,NULL,0,1,0),(574,1,1,1,'Accounts',' Quamquam ab iis philosophiam et omnes ingenuas disciplinas habemus; Qua tu etiam inprudens utebare non numquam. Duo Reges: constructio interrete. Istic sum, inquit. Cum autem in quo sapienter dicimus, id a primo rectissime dicitur. Quod non faceret, si in voluptate summum bonum poneret. \n\n','2016-02-14 21:59:21','2016-02-14 22:57:01',NULL,NULL,0,1,0),(575,1,1,1,'Accounts',' Habes, inquam, Cato, formam eorum, de quibus loquor, philosophorum. Quantum Aristoxeni ingenium consumptum videmus in musicis? Nihil opus est exemplis hoc facere longius. Pauca mutat vel plura sane; Ergo in utroque exercebantur, eaque disciplina effecit tantam illorum utroque in genere dicendi copiam. Octavio fuit, cum illam severitatem in eo filio adhibuit, quem in adoptionem D. \n\n','2016-02-14 21:59:21','2016-02-14 22:57:02',NULL,NULL,0,1,0),(576,1,1,1,'Accounts',' Ne amores quidem sanctos a sapiente alienos esse arbitrantur. Non quaeritur autem quid naturae tuae consentaneum sit, sed quid disciplinae. Sed potestne rerum maior esse dissensio? Duo Reges: constructio interrete. \n\n','2016-02-14 21:59:22','2016-02-14 22:57:02',NULL,NULL,0,1,0),(577,1,1,1,'Accounts',' Sed quanta sit alias, nunc tantum possitne esse tanta. Ita ne hoc quidem modo paria peccata sunt. Cur, nisi quod turpis oratio est? Non quaeritur autem quid naturae tuae consentaneum sit, sed quid disciplinae. \n\n','2016-02-14 21:59:23','2016-02-14 22:57:03',NULL,NULL,0,1,0),(578,1,1,1,'Accounts',' Sed quia studebat laudi et dignitati, multum in virtute processerat. Duo Reges: constructio interrete. Collatio igitur ista te nihil iuvat. Heri, inquam, ludis commissis ex urbe profectus veni ad vesperum. Si quae forte-possumus. Quid de Pythagora? \n\n','2016-02-14 21:59:24','2016-02-14 22:57:03',NULL,NULL,0,1,0),(579,1,1,1,'Accounts',' Ac tamen hic mallet non dolere. Sed quae tandem ista ratio est? Quamvis enim depravatae non sint, pravae tamen esse possunt. \n\n','2016-02-14 21:59:24','2016-02-14 22:57:04',NULL,NULL,0,1,0),(580,1,1,1,'Accounts',' Sed ad bona praeterita redeamus. Aliter homines, aliter philosophos loqui putas oportere? Audax negotium, dicerem impudens, nisi hoc institutum postea translatum ad philosophos nostros esset. \n\n','2016-02-14 21:59:25','2016-02-14 22:57:04',NULL,NULL,0,1,0),(581,1,1,1,'Accounts',' Quo modo autem optimum, si bonum praeterea nullum est? Scripta sane et multa et polita, sed nescio quo pacto auctoritatem oratio non habet. Profectus in exilium Tubulus statim nec respondere ausus; Qui autem de summo bono dissentit de tota philosophiae ratione dissentit. Neque enim civitas in seditione beata esse potest nec in discordia dominorum domus; Duo Reges: constructio interrete. Cum id fugiunt, re eadem defendunt, quae Peripatetici, verba. Indicant pueri, in quibus ut in speculis natura cernitur. \n\n','2016-02-14 21:59:26','2016-02-14 22:57:05',NULL,NULL,0,1,0),(582,1,1,1,'Accounts',' Cave putes quicquam esse verius. Videmus igitur ut conquiescere ne infantes quidem possint. Sed quae tandem ista ratio est? Non ego tecum iam ita iocabor, ut isdem his de rebus, cum L. Si mala non sunt, iacet omnis ratio Peripateticorum. Laboro autem non sine causa; Cur deinde Metrodori liberos commendas? At hoc in eo M. \n\n','2016-02-14 21:59:26','2016-02-14 22:57:06',NULL,NULL,0,1,0),(583,1,1,1,'Accounts',' Post enim Chrysippum eum non sane est disputatum. Nunc omni virtuti vitium contrario nomine opponitur. Qui ita affectus, beatum esse numquam probabis; Cupit enim dícere nihil posse ad beatam vitam deesse sapienti. Ita multo sanguine profuso in laetitia et in victoria est mortuus. Duo Reges: constructio interrete. Quod eo liquidius faciet, si perspexerit rerum inter eas verborumne sit controversia. \n\n','2016-02-14 21:59:27','2016-02-14 22:57:06',NULL,NULL,0,1,0),(584,1,1,1,'Accounts',' Non quaero, quid dicat, sed quid convenienter possit rationi et sententiae suae dicere. Non igitur potestis voluptate omnia dirigentes aut tueri aut retinere virtutem. Quantum Aristoxeni ingenium consumptum videmus in musicis? Fieri, inquam, Triari, nullo pacto potest, ut non dicas, quid non probes eius, a quo dissentias. Duo Reges: constructio interrete. Haec dicuntur inconstantissime. \n\n','2016-02-14 21:59:28','2016-02-14 22:57:06',NULL,NULL,0,1,0),(585,1,1,1,'Accounts',' At enim hic etiam dolore. Comprehensum, quod cognitum non habet? Semper enim ex eo, quod maximas partes continet latissimeque funditur, tota res appellatur. Nam Pyrrho, Aristo, Erillus iam diu abiecti. Quid igitur dubitamus in tota eius natura quaerere quid sit effectum? Eaedem res maneant alio modo. \n\n','2016-02-14 21:59:29','2016-02-14 22:57:07',NULL,NULL,0,1,0),(586,1,1,1,'Accounts',' Sed quid attinet de rebus tam apertis plura requirere? Scientiam pollicentur, quam non erat mirum sapientiae cupido patria esse cariorem. Virtutis, magnitudinis animi, patientiae, fortitudinis fomentis dolor mitigari solet. Unum est sine dolore esse, alterum cum voluptate. Solum praeterea formosum, solum liberum, solum civem, stultost; Duo Reges: constructio interrete. \n\n','2016-02-14 21:59:34','2016-02-14 22:57:07',NULL,NULL,0,1,0),(587,1,1,1,'Accounts',' Nam si propter voluptatem, quae est ista laus, quae possit e macello peti? Compensabatur, inquit, cum summis doloribus laetitia. Etenim semper illud extra est, quod arte comprehenditur. Non igitur potestis voluptate omnia dirigentes aut tueri aut retinere virtutem. Quod autem in homine praestantissimum atque optimum est, id deseruit. Claudii libidini, qui tum erat summo ne imperio, dederetur. Quod autem principium officii quaerunt, melius quam Pyrrho; \n\n','2016-02-14 21:59:35','2016-02-14 22:57:08',NULL,NULL,0,1,0),(588,1,1,1,'Accounts',' Respondeat totidem verbis. Sed tu istuc dixti bene Latine, parum plane. Mihi enim erit isdem istis fortasse iam utendum. Itaque nostrum est-quod nostrum dico, artis est-ad ea principia, quae accepimus. Duo Reges: constructio interrete. Nam illud vehementer repugnat, eundem beatum esse et multis malis oppressum. \n\n','2016-02-14 21:59:36','2016-02-14 22:57:08',NULL,NULL,0,1,0),(589,1,1,1,'Accounts',' Videmus igitur ut conquiescere ne infantes quidem possint. Ille enim occurrentia nescio quae comminiscebatur; Quaerimus enim finem bonorum. Etiam beatissimum? Vitiosum est enim in dividendo partem in genere numerare. Quae in controversiam veniunt, de iis, si placet, disseramus. \n\n','2016-02-14 21:59:38','2016-02-14 22:57:08',NULL,NULL,0,1,0),(590,1,1,1,'Accounts',' Nam de isto magna dissensio est. Dolor ergo, id est summum malum, metuetur semper, etiamsi non aderit; Dici enim nihil potest verius. Sed mehercule pergrata mihi oratio tua. \n\n','2016-02-14 21:59:39','2016-02-14 22:57:09',NULL,NULL,0,1,0),(591,1,1,1,'Accounts',' Nam, ut sint illa vendibiliora, haec uberiora certe sunt. Quod ea non occurrentia fingunt, vincunt Aristonem; Aeque enim contingit omnibus fidibus, ut incontentae sint. Hoc dixerit potius Ennius: Nimium boni est, cui nihil est mali. Quid autem habent admirationis, cum prope accesseris? Duo Reges: constructio interrete. \n\n','2016-02-14 21:59:40','2016-02-14 22:57:09',NULL,NULL,0,1,0),(592,1,1,1,'Accounts',' Illis videtur, qui illud non dubitant bonum dicere -; Quamquam tu hanc copiosiorem etiam soles dicere. Nos paucis ad haec additis finem faciamus aliquando; Recte dicis; \n\n','2016-02-14 21:59:41','2016-02-14 22:57:10',NULL,NULL,0,1,0),(593,1,1,1,'Accounts',' Sed erat aequius Triarium aliquid de dissensione nostra iudicare. Hanc ergo intuens debet institutum illud quasi signum absolvere. Non est ista, inquam, Piso, magna dissensio. Sed quae tandem ista ratio est? Hoc non est positum in nostra actione. At multis malis affectus. Minime vero istorum quidem, inquit. Duo Reges: constructio interrete. Nec vero sum nescius esse utilitatem in historia, non modo voluptatem. \n\n','2016-02-14 21:59:41','2016-02-14 22:57:10',NULL,NULL,0,1,0),(594,1,1,1,'Accounts',' Et quidem saepe quaerimus verbum Latinum par Graeco et quod idem valeat; Cur id non ita fit? Duo Reges: constructio interrete. Quid enim ab antiquis ex eo genere, quod ad disserendum valet, praetermissum est? Tum Quintus: Est plane, Piso, ut dicis, inquit. Ad corpus diceres pertinere-, sed ea, quae dixi, ad corpusne refers? Vulgo enim dicitur: Iucundi acti labores, nec male Euripidesconcludam, si potero, Latine; An ea, quae per vinitorem antea consequebatur, per se ipsa curabit? Ego quoque, inquit, didicerim libentius si quid attuleris, quam te reprehenderim. \n\n','2016-02-14 21:59:42','2016-02-14 22:57:11',NULL,NULL,0,1,0),(595,1,1,1,'Accounts',' Traditur, inquit, ab Epicuro ratio neglegendi doloris. Duo Reges: constructio interrete. Quae similitudo in genere etiam humano apparet. Quod iam a me expectare noli. Falli igitur possumus. Nemo nostrum istius generis asotos iucunde putat vivere. Id mihi magnum videtur. Sic consequentibus vestris sublatis prima tolluntur. \n\n','2016-02-14 21:59:43','2016-02-14 22:57:11',NULL,NULL,0,1,0),(596,1,1,1,'Accounts',' Duo enim genera quae erant, fecit tria. An potest cupiditas finiri? Quis est tam dissimile homini. Eaedem enim utilitates poterunt eas labefactare atque pervertere. Duo Reges: constructio interrete. Sed quid attinet de rebus tam apertis plura requirere? Quando enim Socrates, qui parens philosophiae iure dici potest, quicquam tale fecit? Homines optimi non intellegunt totam rationem everti, si ita res se habeat. \n\n','2016-02-14 21:59:44','2016-02-14 22:57:12',NULL,NULL,0,1,0),(597,1,1,1,'Accounts',' At negat Epicurus-hoc enim vestrum lumen estquemquam, qui honeste non vivat, iucunde posse vivere. Huius ego nunc auctoritatem sequens idem faciam. Restinguet citius, si ardentem acceperit. Hanc quoque iucunditatem, si vis, transfer in animum; Duo Reges: constructio interrete. Maximas vero virtutes iacere omnis necesse est voluptate dominante. \n\n','2016-02-14 21:59:44','2016-02-14 22:57:12',NULL,NULL,0,1,0),(598,1,1,1,'Accounts',' Cur post Tarentum ad Archytam? Quid igitur dubitamus in tota eius natura quaerere quid sit effectum? Quasi ego id curem, quid ille aiat aut neget. Istic sum, inquit. Idemque diviserunt naturam hominis in animum et corpus. Duo Reges: constructio interrete. Quamquam ab iis philosophiam et omnes ingenuas disciplinas habemus; Quae hic rei publicae vulnera inponebat, eadem ille sanabat. Virtutis, magnitudinis animi, patientiae, fortitudinis fomentis dolor mitigari solet. \n\n','2016-02-14 21:59:45','2016-02-14 22:57:12',NULL,NULL,0,1,0),(599,1,1,1,'Accounts',' At, si voluptas esset bonum, desideraret. Ergo id est convenienter naturae vivere, a natura discedere. Quid igitur dubitamus in tota eius natura quaerere quid sit effectum? Sed quanta sit alias, nunc tantum possitne esse tanta. Duo Reges: constructio interrete. Et quod est munus, quod opus sapientiae? Equidem e Cn. Illis videtur, qui illud non dubitant bonum dicere -; Sed tamen enitar et, si minus multa mihi occurrent, non fugiam ista popularia. \n\n','2016-02-14 21:59:46','2016-02-14 22:57:13',NULL,NULL,0,1,0),(600,1,1,1,'Accounts',' Aliter homines, aliter philosophos loqui putas oportere? Nam de summo mox, ut dixi, videbimus et ad id explicandum disputationem omnem conferemus. Quo plebiscito decreta a senatu est consuli quaestio Cn. Ex quo, id quod omnes expetunt, beate vivendi ratio inveniri et comparari potest. Haec quo modo conveniant, non sane intellego. Hoc tu nunc in illo probas. Duo Reges: constructio interrete. Quid ei reliquisti, nisi te, quoquo modo loqueretur, intellegere, quid diceret? \n\n','2016-02-14 21:59:46','2016-02-14 22:57:13',NULL,NULL,0,1,0),(601,1,1,1,'Accounts',' Verum tamen cum de rebus grandioribus dicas, ipsae res verba rapiunt; Inde sermone vario sex illa a Dipylo stadia confecimus. Age nunc isti doceant, vel tu potius quis enim ista melius? Omnis enim est natura diligens sui. Duo Reges: constructio interrete. Sine ea igitur iucunde negat posse se vivere? \n\n','2016-02-14 21:59:47','2016-02-14 22:57:14',NULL,NULL,0,1,0),(602,1,1,1,'Accounts',' Negat enim summo bono afferre incrementum diem. Urgent tamen et nihil remittunt. Quam ob rem tandem, inquit, non satisfacit? Duo Reges: constructio interrete. Qua ex cognitione facilior facta est investigatio rerum occultissimarum. Hic nihil fuit, quod quaereremus. Mihi enim satis est, ipsis non satis. Summus dolor plures dies manere non potest? Disserendi artem nullam habuit. Laelius clamores sofòw ille so lebat Edere compellans gumias ex ordine nostros. \n\n','2016-02-14 21:59:48','2016-02-14 22:57:14',NULL,NULL,0,1,0),(603,1,1,1,'Accounts',' Maximas vero virtutes iacere omnis necesse est voluptate dominante. Aperiendum est igitur, quid sit voluptas; Quae cum praeponunt, ut sit aliqua rerum selectio, naturam videntur sequi; Addidisti ad extremum etiam indoctum fuisse. \n\n','2016-02-14 21:59:49','2016-02-14 22:57:15',NULL,NULL,0,1,0),(604,1,1,1,'Accounts',' Ille vero, si insipiens-quo certe, quoniam tyrannus -, numquam beatus; Restinguet citius, si ardentem acceperit. Audax negotium, dicerem impudens, nisi hoc institutum postea translatum ad philosophos nostros esset. Tu enim ista lenius, hic Stoicorum more nos vexat. Scaevola tribunus plebis ferret ad plebem vellentne de ea re quaeri. Non potes, nisi retexueris illa. Potius inflammat, ut coercendi magis quam dedocendi esse videantur. Duo Reges: constructio interrete. \n\n','2016-02-14 21:59:49','2016-02-14 22:57:15',NULL,NULL,0,1,0),(605,1,1,1,'Accounts',' Cupit enim dícere nihil posse ad beatam vitam deesse sapienti. Illa tamen simplicia, vestra versuta. Praeclare enim Plato: Beatum, cui etiam in senectute contigerit, ut sapientiam verasque opiniones assequi possit. Nulla erit controversia. Post enim Chrysippum eum non sane est disputatum. Cum id quoque, ut cupiebat, audivisset, evelli iussit eam, qua erat transfixus, hastam. Istam voluptatem perpetuam quis potest praestare sapienti? Duo Reges: constructio interrete. \n\n','2016-02-14 21:59:50','2016-02-14 22:57:16',NULL,NULL,0,1,0),(606,1,1,1,'Accounts',' Inde sermone vario sex illa a Dipylo stadia confecimus. Qui autem esse poteris, nisi te amor ipse ceperit? Dici enim nihil potest verius. Hanc ergo intuens debet institutum illud quasi signum absolvere. Duarum enim vitarum nobis erunt instituta capienda. Hinc ceteri particulas arripere conati suam quisque videro voluit afferre sententiam. Duo Reges: constructio interrete. Huius, Lyco, oratione locuples, rebus ipsis ielunior. Aliud igitur esse censet gaudere, aliud non dolere. Polemoni et iam ante Aristoteli ea prima visa sunt, quae paulo ante dixi. \n\n','2016-02-14 21:59:51','2016-02-14 22:57:16',NULL,NULL,0,1,0),(607,1,1,1,'Accounts',' Bestiarum vero nullum iudicium puto. Utram tandem linguam nescio? Verba tu fingas et ea dicas, quae non sentias? Universa enim illorum ratione cum tota vestra confligendum puto. Quorum sine causa fieri nihil putandum est. Quae cum dixisset, finem ille. Non est igitur summum malum dolor. \n\n','2016-02-14 21:59:51','2016-02-14 22:57:17',NULL,NULL,0,1,0),(608,1,1,1,'Accounts',' Quid enim me prohiberet Epicureum esse, si probarem, quae ille diceret? Theophrasti igitur, inquit, tibi liber ille placet de beata vita? Cum salvum esse flentes sui respondissent, rogavit essentne fusi hostes. At quanta conantur! Mundum hunc omnem oppidum esse nostrum! Incendi igitur eos, qui audiunt, vides. Duo Reges: constructio interrete. Mihi enim erit isdem istis fortasse iam utendum. Cum autem in quo sapienter dicimus, id a primo rectissime dicitur. Sint ista Graecorum; In quibus doctissimi illi veteres inesse quiddam caeleste et divinum putaverunt. Sic enim censent, oportunitatis esse beate vivere. Facile est hoc cernere in primis puerorum aetatulis. \n\n','2016-02-14 21:59:52','2016-02-14 22:57:17',NULL,NULL,0,1,0),(609,1,1,1,'Accounts',' Id enim volumus, id contendimus, ut officii fructus sit ipsum officium. His similes sunt omnes, qui virtuti student levantur vitiis, levantur erroribus, nisi forte censes Ti. Eiuro, inquit adridens, iniquum, hac quidem de re; Hi curatione adhibita levantur in dies, valet alter plus cotidie, alter videt. Quae enim adhuc protulisti, popularia sunt, ego autem a te elegantiora desidero. Quid turpius quam sapientis vitam ex insipientium sermone pendere? Quo modo autem optimum, si bonum praeterea nullum est? Sed tu istuc dixti bene Latine, parum plane. \n\n','2016-02-14 21:59:53','2016-02-14 22:57:18',NULL,NULL,0,1,0),(610,1,1,1,'Accounts',' Non quam nostram quidem, inquit Pomponius iocans; Id Sextilius factum negabat. His enim rebus detractis negat se reperire in asotorum vita quod reprehendat. Roges enim Aristonem, bonane ei videantur haec: vacuitas doloris, divitiae, valitudo; Quid in isto egregio tuo officio et tanta fide-sic enim existimo-ad corpus refers? Duo Reges: constructio interrete. Non quaero, quid dicat, sed quid convenienter possit rationi et sententiae suae dicere. Quae similitudo in genere etiam humano apparet. Longum est enim ad omnia respondere, quae a te dicta sunt. Hoc tu nunc in illo probas. \n\n','2016-02-14 21:59:53','2016-02-14 22:57:18',NULL,NULL,0,1,0),(611,1,1,1,'Accounts',' Claudii libidini, qui tum erat summo ne imperio, dederetur. Sin laboramus, quis est, qui alienae modum statuat industriae? Traditur, inquit, ab Epicuro ratio neglegendi doloris. Eadem nunc mea adversum te oratio est. Quae cum essent dicta, discessimus. Quid enim de amicitia statueris utilitatis causa expetenda vides. \n\n','2016-02-14 21:59:54','2016-02-14 22:57:19',NULL,NULL,0,1,0),(612,1,1,1,'Accounts',' Nam illud quidem adduci vix possum, ut ea, quae senserit ille, tibi non vera videantur. Sed vobis voluptatum perceptarum recordatio vitam beatam facit, et quidem corpore perceptarum. Pollicetur certe. Duo Reges: constructio interrete. Hoc loco tenere se Triarius non potuit. Nos quidem Virtutes sic natae sumus, ut tibi serviremus, aliud negotii nihil habemus. Habes, inquam, Cato, formam eorum, de quibus loquor, philosophorum. \n\n','2016-02-14 21:59:55','2016-02-14 22:57:19',NULL,NULL,0,1,0),(613,1,1,1,'Accounts',' Sed ille, ut dixi, vitiose. Incommoda autem et commoda-ita enim estmata et dustmata appello-communia esse voluerunt, paria noluerunt. Collige omnia, quae soletis: Praesidium amicorum. Sed virtutem ipsam inchoavit, nihil amplius. \n\n','2016-02-14 21:59:56','2016-02-14 22:57:20',NULL,NULL,0,1,0),(614,1,1,1,'Accounts',' Tu vero, inquam, ducas licet, si sequetur; Restinguet citius, si ardentem acceperit. Sed virtutem ipsam inchoavit, nihil amplius. Tanta vis admonitionis inest in locis; Utinam quidem dicerent alium alio beatiorem! Iam ruinas videres. Duo Reges: constructio interrete. Immo istud quidem, inquam, quo loco quidque, nisi iniquum postulo, arbitratu meo. Quae cum magnifice primo dici viderentur, considerata minus probabantur. Quonam, inquit, modo? Aeque enim contingit omnibus fidibus, ut incontentae sint. Quid de Pythagora? Quod ea non occurrentia fingunt, vincunt Aristonem; \n\n','2016-02-14 21:59:56','2016-02-14 22:57:20',NULL,NULL,0,1,0),(615,1,1,1,'Accounts',' Sed quot homines, tot sententiae; Eademne, quae restincta siti? Graecum enim hunc versum nostis omnes-: Suavis laborum est praeteritorum memoria. Duo Reges: constructio interrete. Non enim, si omnia non sequebatur, idcirco non erat ortus illinc. Hanc quoque iucunditatem, si vis, transfer in animum; Quae similitudo in genere etiam humano apparet. \n\n','2016-02-14 21:59:57','2016-02-14 22:57:20',NULL,NULL,0,1,0),(616,1,1,1,'Accounts',' Ex quo intellegitur officium medium quiddam esse, quod neque in bonis ponatur neque in contrariis. Virtutibus igitur rectissime mihi videris et ad consuetudinem nostrae orationis vitia posuisse contraria. Odium autem et invidiam facile vitabis. Qui-vere falsone, quaerere mittimus-dicitur oculis se privasse; Duo Reges: constructio interrete. Quaero igitur, quo modo hae tantae commendationes a natura profectae subito a sapientia relictae sint. Materiam vero rerum et copiam apud hos exilem, apud illos uberrimam reperiemus. Si est nihil nisi corpus, summa erunt illa: valitudo, vacuitas doloris, pulchritudo, cetera. Nihil opus est exemplis hoc facere longius. Quae tamen a te agetur non melior, quam illae sunt, quas interdum optines. \n\n','2016-02-14 21:59:58','2016-02-14 22:57:21',NULL,NULL,0,1,0),(617,1,1,1,'Accounts',' Atqui iste locus est, Piso, tibi etiam atque etiam confirmandus, inquam; Duo Reges: constructio interrete. Sed ille, ut dixi, vitiose. Quod autem satis est, eo quicquid accessit, nimium est; An vero displicuit ea, quae tributa est animi virtutibus tanta praestantia? Nam, ut paulo ante docui, augendae voluptatis finis est doloris omnis amotio. Nam Pyrrho, Aristo, Erillus iam diu abiecti. Hoc enim identidem dicitis, non intellegere nos quam dicatis voluptatem. Cur tantas regiones barbarorum pedibus obiit, tot maria transmisit? Sed tu istuc dixti bene Latine, parum plane. Ut optime, secundum naturam affectum esse possit. Quod cum dixissent, ille contra. \n\n','2016-02-14 21:59:58','2016-02-14 22:57:21',NULL,NULL,0,1,0),(618,1,1,1,'Accounts',' Sed tamen est aliquid, quod nobis non liceat, liceat illis. Graccho, eius fere, aequalí? Duo Reges: constructio interrete. Eadem nunc mea adversum te oratio est. At certe gravius. Quae duo sunt, unum facit. Non quam nostram quidem, inquit Pomponius iocans; At certe gravius. \n\n','2016-02-14 21:59:59','2016-02-14 22:57:22',NULL,NULL,0,1,0),(619,1,1,1,'Accounts',' Qui-vere falsone, quaerere mittimus-dicitur oculis se privasse; Sed tamen est aliquid, quod nobis non liceat, liceat illis. Itaque hic ipse iam pridem est reiectus; Potius inflammat, ut coercendi magis quam dedocendi esse videantur. Luxuriam non reprehendit, modo sit vacua infinita cupiditate et timore. Quid ergo aliud intellegetur nisi uti ne quae pars naturae neglegatur? Duo Reges: constructio interrete. Hinc ceteri particulas arripere conati suam quisque videro voluit afferre sententiam. Nunc haec primum fortasse audientis servire debemus. Egone quaeris, inquit, quid sentiam? \n\n','2016-02-14 22:00:00','2016-02-14 22:57:22',NULL,NULL,0,1,0),(620,1,1,1,'Accounts',' Quae animi affectio suum cuique tribuens atque hanc, quam dico. Cum ageremus, inquit, vitae beatum et eundem supremum diem, scribebamus haec. Tubulo putas dicere? Nam, ut sint illa vendibiliora, haec uberiora certe sunt. Duo Reges: constructio interrete. Te ipsum, dignissimum maioribus tuis, voluptasne induxit, ut adolescentulus eriperes P. Quonam modo? \n\n','2016-02-14 22:00:01','2016-02-14 22:57:23',NULL,NULL,0,1,0),(621,1,1,1,'Accounts',' Quae fere omnia appellantur uno ingenii nomine, easque virtutes qui habent, ingeniosi vocantur. Non est enim vitium in oratione solum, sed etiam in moribus. Quamquam tu hanc copiosiorem etiam soles dicere. Hic ambiguo ludimur. Dolor ergo, id est summum malum, metuetur semper, etiamsi non aderit; Duo Reges: constructio interrete. Ergo illi intellegunt quid Epicurus dicat, ego non intellego? \n\n','2016-02-14 22:00:01','2016-02-14 22:57:23',NULL,NULL,0,1,0),(622,1,1,1,'Accounts',' Summum ením bonum exposuit vacuitatem doloris; Que Manilium, ab iisque M. \n\n','2016-02-14 22:00:02','2016-02-14 22:57:23',NULL,NULL,0,1,0),(623,1,1,1,'Accounts',' Cum sciret confestim esse moriendum eamque mortem ardentiore studio peteret, quam Epicurus voluptatem petendam putat. Quae autem natura suae primae institutionis oblita est? Quam nemo umquam voluptatem appellavit, appellat; In qua quid est boni praeter summam voluptatem, et eam sempiternam? At ille pellit, qui permulcet sensum voluptate. \n\n','2016-02-14 22:00:03','2016-02-14 22:57:24',NULL,NULL,0,1,0),(624,1,1,1,'Accounts',' Sed quia studebat laudi et dignitati, multum in virtute processerat. Quae sunt igitur communia vobis cum antiquis, iis sic utamur quasi concessis; Virtutis, magnitudinis animi, patientiae, fortitudinis fomentis dolor mitigari solet. Pauca mutat vel plura sane; Duo Reges: constructio interrete. Quae similitudo in genere etiam humano apparet. At, illa, ut vobis placet, partem quandam tuetur, reliquam deserit. Quamquam in hac divisione rem ipsam prorsus probo, elegantiam desidero. \n\n','2016-02-14 22:00:03','2016-02-14 22:57:25',NULL,NULL,0,1,0),(625,1,1,1,'Accounts',' At certe gravius. Huius ego nunc auctoritatem sequens idem faciam. Prodest, inquit, mihi eo esse animo. Cur fortior sit, si illud, quod tute concedis, asperum et vix ferendum putabit? Vitiosum est enim in dividendo partem in genere numerare. Duo Reges: constructio interrete. Quod autem satis est, eo quicquid accessit, nimium est; Si enim ita est, vide ne facinus facias, cum mori suadeas. \n\n','2016-02-14 22:00:04','2016-02-14 22:57:25',NULL,NULL,0,1,0),(626,1,1,1,'Accounts',' Quid est igitur, cur ita semper deum appellet Epicurus beatum et aeternum? Itaque hic ipse iam pridem est reiectus; Expectoque quid ad id, quod quaerebam, respondeas. Dic in quovis conventu te omnia facere, ne doleas. Duo Reges: constructio interrete. Hoc est non modo cor non habere, sed ne palatum quidem. \n\n','2016-02-14 22:00:05','2016-02-14 22:57:26',NULL,NULL,0,1,0),(627,1,1,1,'Accounts',' Venit ad extremum; Si quae forte-possumus. Nam si amitti vita beata potest, beata esse non potest. Efficiens dici potest. Eam stabilem appellas. Duo Reges: constructio interrete. \n\n','2016-02-14 22:00:05','2016-02-14 22:57:26',NULL,NULL,0,1,0),(628,1,1,1,'Accounts',' Videamus animi partes, quarum est conspectus illustrior; Quae hic rei publicae vulnera inponebat, eadem ille sanabat. Haec quo modo conveniant, non sane intellego. De vacuitate doloris eadem sententia erit. \n\n','2016-02-14 22:00:06','2016-02-14 22:57:27',NULL,NULL,0,1,0),(629,1,1,1,'Accounts',' Dici enim nihil potest verius. Quis non odit sordidos, vanos, leves, futtiles? Sed in rebus apertissimis nimium longi sumus. Quid enim possumus hoc agere divinius? Sequitur disserendi ratio cognitioque naturae; Quamquam tu hanc copiosiorem etiam soles dicere. Duo Reges: constructio interrete. Simus igitur contenti his. \n\n','2016-02-14 22:00:07','2016-02-14 22:57:28',NULL,NULL,0,1,0),(630,1,1,1,'Accounts',' Neque enim civitas in seditione beata esse potest nec in discordia dominorum domus; Ille incendat? Qui igitur convenit ab alia voluptate dicere naturam proficisci, in alia summum bonum ponere? Duo Reges: constructio interrete. At, si voluptas esset bonum, desideraret. Tum Piso: Quoniam igitur aliquid omnes, quid Lucius noster? Non quam nostram quidem, inquit Pomponius iocans; Quid ait Aristoteles reliquique Platonis alumni? \n\n','2016-02-14 22:00:08','2016-02-14 22:57:28',NULL,NULL,0,1,0),(631,1,1,1,'Accounts',' Uterque enim summo bono fruitur, id est voluptate. Atqui haec patefactio quasi rerum opertarum, cum quid quidque sit aperitur, definitio est. Summus dolor plures dies manere non potest? Quodcumque in mentem incideret, et quodcumque tamquam occurreret. Quasi vero, inquit, perpetua oratio rhetorum solum, non etiam philosophorum sit. Sed ego in hoc resisto; \n\n','2016-02-14 22:00:08','2016-02-14 22:57:29',NULL,NULL,0,1,0),(632,1,1,1,'Accounts',' Ut id aliis narrare gestiant? Quid enim de amicitia statueris utilitatis causa expetenda vides. \n\n','2016-02-14 22:00:09','2016-02-14 22:57:29',NULL,NULL,0,1,0),(633,1,1,1,'Accounts',' Num igitur utiliorem tibi hunc Triarium putas esse posse, quam si tua sint Puteolis granaria? Satisne ergo pudori consulat, si quis sine teste libidini pareat? Ab his oratores, ab his imperatores ac rerum publicarum principes extiterunt. Nam illud quidem adduci vix possum, ut ea, quae senserit ille, tibi non vera videantur. Primum cur ista res digna odio est, nisi quod est turpis? Duo Reges: constructio interrete. Quid turpius quam sapientis vitam ex insipientium sermone pendere? Sed tamen intellego quid velit. \n\n','2016-02-14 22:00:10','2016-02-14 22:57:29',NULL,NULL,0,1,0),(634,1,1,1,'Accounts',' Cur fortior sit, si illud, quod tute concedis, asperum et vix ferendum putabit? Aliter homines, aliter philosophos loqui putas oportere? Mihi, inquam, qui te id ipsum rogavi? Itaque haec cum illis est dissensio, cum Peripateticis nulla sane. Expectoque quid ad id, quod quaerebam, respondeas. Duo Reges: constructio interrete. \n\n','2016-02-14 22:00:10','2016-02-14 22:57:30',NULL,NULL,0,1,0),(635,1,1,1,'Accounts',' Nihil minus, contraque illa hereditate dives ob eamque rem laetus. Aut unde est hoc contritum vetustate proverbium: quicum in tenebris? Sed ne, dum huic obsequor, vobis molestus sim. Bestiarum vero nullum iudicium puto. Nec lapathi suavitatem acupenseri Galloni Laelius anteponebat, sed suavitatem ipsam neglegebat; Pauca mutat vel plura sane; \n\n','2016-02-14 22:00:11','2016-02-14 22:57:30',NULL,NULL,0,1,0),(636,1,1,1,'Accounts',' Huius, Lyco, oratione locuples, rebus ipsis ielunior. Duo Reges: constructio interrete. Conferam tecum, quam cuique verso rem subicias; Quid est enim aliud esse versutum? Ita multo sanguine profuso in laetitia et in victoria est mortuus. Ego vero volo in virtute vim esse quam maximam; Indicant pueri, in quibus ut in speculis natura cernitur. Sint modo partes vitae beatae. \n\n','2016-02-14 22:00:12','2016-02-14 22:57:31',NULL,NULL,0,1,0),(637,1,1,1,'Accounts',' Illa tamen simplicia, vestra versuta. Eam si varietatem diceres, intellegerem, ut etiam non dicente te intellego; Ut optime, secundum naturam affectum esse possit. Beatus sibi videtur esse moriens. Dolere malum est: in crucem qui agitur, beatus esse non potest. Haec dicuntur inconstantissime. Duo Reges: constructio interrete. Cur igitur, cum de re conveniat, non malumus usitate loqui? \n\n','2016-02-14 22:00:12','2016-02-14 22:57:31',NULL,NULL,0,1,0),(638,1,1,1,'Accounts',' Ille incendat? Nam si propter voluptatem, quae est ista laus, quae possit e macello peti? Nam adhuc, meo fortasse vitio, quid ego quaeram non perspicis. Multoque hoc melius nos veriusque quam Stoici. Duo Reges: constructio interrete. Sed quanta sit alias, nunc tantum possitne esse tanta. Ut nemo dubitet, eorum omnia officia quo spectare, quid sequi, quid fugere debeant? Itaque vides, quo modo loquantur, nova verba fingunt, deserunt usitata. \n\n','2016-02-14 22:00:13','2016-02-14 22:57:32',NULL,NULL,0,1,0),(639,1,1,1,'Accounts',' Sed nunc, quod agimus; Tanta vis admonitionis inest in locis; Que Manilium, ab iisque M. Non autem hoc: igitur ne illud quidem. \n\n','2016-02-14 22:00:14','2016-02-14 22:57:32',NULL,NULL,0,1,0),(640,1,1,1,'Accounts',' Paulum, cum regem Persem captum adduceret, eodem flumine invectio? Quoniam, si dis placet, ab Epicuro loqui discimus. Non enim solum Torquatus dixit quid sentiret, sed etiam cur. Quae cum essent dicta, finem fecimus et ambulandi et disputandi. Quo modo autem optimum, si bonum praeterea nullum est? Hi curatione adhibita levantur in dies, valet alter plus cotidie, alter videt. \n\n','2016-02-14 22:00:15','2016-02-14 22:57:33',NULL,NULL,0,1,0),(641,1,1,1,'Accounts',' Num igitur utiliorem tibi hunc Triarium putas esse posse, quam si tua sint Puteolis granaria? Nescio quo modo praetervolavit oratio. Nullus est igitur cuiusquam dies natalis. Beatus sibi videtur esse moriens. Duo Reges: constructio interrete. An potest, inquit ille, quicquam esse suavius quam nihil dolere? Erat enim Polemonis. Neque enim disputari sine reprehensione nec cum iracundia aut pertinacia recte disputari potest. \n\n','2016-02-14 22:00:15','2016-02-14 22:57:33',NULL,NULL,0,1,0),(642,1,1,1,'Accounts',' Quae iam oratio non a philosopho aliquo, sed a censore opprimenda est. Quod quidem nobis non saepe contingit. Deprehensus omnem poenam contemnet. Quod autem ratione actum est, id officium appellamus. Duo Reges: constructio interrete. Sextilio Rufo, cum is rem ad amicos ita deferret, se esse heredem Q. \n\n','2016-02-14 22:00:16','2016-02-14 22:57:33',NULL,NULL,0,1,0),(643,1,1,1,'Accounts',' Tu vero, inquam, ducas licet, si sequetur; An nisi populari fama? Nemo nostrum istius generis asotos iucunde putat vivere. \n\n','2016-02-14 22:00:17','2016-02-14 22:57:34',NULL,NULL,0,1,0),(644,1,1,1,'Accounts',' Quis non odit sordidos, vanos, leves, futtiles? Ergo hoc quidem apparet, nos ad agendum esse natos. Sit enim idem caecus, debilis. Duo Reges: constructio interrete. Unum est sine dolore esse, alterum cum voluptate. \n\n','2016-02-14 22:00:17','2016-02-14 22:57:34',NULL,NULL,0,1,0),(645,1,1,1,'Accounts',' Quis est, qui non oderit libidinosam, protervam adolescentiam? At ego quem huic anteponam non audeo dicere; Qui est in parvis malis. An vero displicuit ea, quae tributa est animi virtutibus tanta praestantia? \n\n','2016-02-14 22:00:18','2016-02-14 22:57:35',NULL,NULL,0,1,0),(646,1,1,1,'Accounts',' Respondent extrema primis, media utrisque, omnia omnibus. Et ille ridens: Video, inquit, quid agas; Summum a vobis bonum voluptas dicitur. \n\n','2016-02-14 22:00:19','2016-02-14 22:57:35',NULL,NULL,0,1,0),(647,1,1,1,'Accounts',' Quoniam, si dis placet, ab Epicuro loqui discimus. An me, inquam, nisi te audire vellem, censes haec dicturum fuisse? \n\n','2016-02-14 22:00:20','2016-02-14 22:57:36',NULL,NULL,0,1,0),(648,1,1,1,'Accounts',' Vitae autem degendae ratio maxime quidem illis placuit quieta. Qui est in parvis malis. Inde igitur, inquit, ordiendum est. Nihil acciderat ei, quod nollet, nisi quod anulum, quo delectabatur, in mari abiecerat. Duo Reges: constructio interrete. Respondeat totidem verbis. Quae quidem sapientes sequuntur duce natura tamquam videntes; Omnes enim iucundum motum, quo sensus hilaretur. Ne in odium veniam, si amicum destitero tueri. \n\n','2016-02-14 22:00:20','2016-02-14 22:57:36',NULL,NULL,0,1,0),(649,1,1,1,'Accounts',' Sed fortuna fortis; Sit enim idem caecus, debilis. Quid de Platone aut de Democrito loquar? Nam quibus rebus efficiuntur voluptates, eae non sunt in potestate sapientis. Est enim tanti philosophi tamque nobilis audacter sua decreta defendere. Te ipsum, dignissimum maioribus tuis, voluptasne induxit, ut adolescentulus eriperes P. Duo Reges: constructio interrete. Vitiosum est enim in dividendo partem in genere numerare. \n\n','2016-02-14 22:00:21','2016-02-14 22:57:37',NULL,NULL,0,1,0),(650,1,1,1,'Accounts',' Quis est tam dissimile homini. Illum mallem levares, quo optimum atque humanissimum virum, Cn. Tuo vero id quidem, inquam, arbitratu. Qui autem esse poteris, nisi te amor ipse ceperit? \n\n','2016-02-14 22:00:22','2016-02-14 22:57:37',NULL,NULL,0,1,0),(651,1,1,1,'Accounts',' Falli igitur possumus. Nos vero, inquit ille; Duo Reges: constructio interrete. \n\n','2016-02-14 22:00:22','2016-02-14 22:57:37',NULL,NULL,0,1,0),(652,1,1,1,'Accounts',' Sine ea igitur iucunde negat posse se vivere? Non enim iam stirpis bonum quaeret, sed animalis. Ac tamen hic mallet non dolere. Quae hic rei publicae vulnera inponebat, eadem ille sanabat. Inde igitur, inquit, ordiendum est. Duo Reges: constructio interrete. \n\n','2016-02-14 22:00:23','2016-02-14 22:57:38',NULL,NULL,0,1,0),(653,1,1,1,'Accounts',' Hoc Hieronymus summum bonum esse dixit. Habent enim et bene longam et satis litigiosam disputationem. Falli igitur possumus. Et ais, si una littera commota sit, fore tota ut labet disciplina. Sed quod proximum fuit non vidit. Duo Reges: constructio interrete. Quo tandem modo? \n\n','2016-02-14 22:00:24','2016-02-14 22:57:39',NULL,NULL,0,1,0),(654,1,1,1,'Accounts',' Id mihi magnum videtur. In his igitur partibus duabus nihil erat, quod Zeno commutare gestiret. Quod autem satis est, eo quicquid accessit, nimium est; Non enim iam stirpis bonum quaeret, sed animalis. Duo Reges: constructio interrete. Vide igitur ne non debeas verbis nostris uti, sententiis tuis. Et ille ridens: Video, inquit, quid agas; \n\n','2016-02-14 22:00:24','2016-02-14 22:57:39',NULL,NULL,0,1,0),(655,1,1,1,'Accounts',' Polycratem Samium felicem appellabant. Respondeat totidem verbis. Summum ením bonum exposuit vacuitatem doloris; Sit enim idem caecus, debilis. Verba tu fingas et ea dicas, quae non sentias? Mihi quidem Antiochum, quem audis, satis belle videris attendere. Utinam quidem dicerent alium alio beatiorem! Iam ruinas videres. Duo Reges: constructio interrete. Sed ad bona praeterita redeamus. \n\n','2016-02-14 22:00:25','2016-02-14 22:57:40',NULL,NULL,0,1,0),(656,1,1,1,'Accounts',' Ut in geometria, prima si dederis, danda sunt omnia. Ita relinquet duas, de quibus etiam atque etiam consideret. Age sane, inquam. An eum discere ea mavis, quae cum plane perdidiceriti nihil sciat? Duo Reges: constructio interrete. \n\n','2016-02-14 22:00:26','2016-02-14 22:57:40',NULL,NULL,0,1,0),(657,1,1,1,'Accounts',' Illis videtur, qui illud non dubitant bonum dicere -; Eiuro, inquit adridens, iniquum, hac quidem de re; Quis non odit sordidos, vanos, leves, futtiles? Scripta sane et multa et polita, sed nescio quo pacto auctoritatem oratio non habet. Quid enim me prohiberet Epicureum esse, si probarem, quae ille diceret? A mene tu? Duo Reges: constructio interrete. Nonne videmus quanta perturbatio rerum omnium consequatur, quanta confusio? \n\n','2016-02-14 22:00:27','2016-02-14 22:57:40',NULL,NULL,0,1,0),(658,1,1,1,'Accounts',' Quis non odit sordidos, vanos, leves, futtiles? Quonam modo? Hoc non est positum in nostra actione. Sit enim idem caecus, debilis. Ita multo sanguine profuso in laetitia et in victoria est mortuus. \n\n','2016-02-14 22:00:32','2016-02-14 22:57:41',NULL,NULL,0,1,0),(659,1,1,1,'Accounts',' Quis est, qui non oderit libidinosam, protervam adolescentiam? Efficiens dici potest. Haec quo modo conveniant, non sane intellego. Iam doloris medicamenta illa Epicurea tamquam de narthecio proment: Si gravis, brevis; Ergo illi intellegunt quid Epicurus dicat, ego non intellego? Equidem, sed audistine modo de Carneade? Conferam avum tuum Drusum cum C. Duo Reges: constructio interrete. Traditur, inquit, ab Epicuro ratio neglegendi doloris. Nunc haec primum fortasse audientis servire debemus. Nos paucis ad haec additis finem faciamus aliquando; Cur deinde Metrodori liberos commendas? \n\n','2016-02-14 22:00:33','2016-02-14 22:57:41',NULL,NULL,0,1,0),(660,1,1,1,'Accounts',' Haec para/doca illi, nos admirabilia dicamus. Estne, quaeso, inquam, sitienti in bibendo voluptas? Multoque hoc melius nos veriusque quam Stoici. Quia dolori non voluptas contraria est, sed doloris privatio. Nunc ita separantur, ut disiuncta sint, quo nihil potest esse perversius. Quod iam a me expectare noli. Duo Reges: constructio interrete. Et quod est munus, quod opus sapientiae? \n\n','2016-02-14 22:00:34','2016-02-14 22:57:42',NULL,NULL,0,1,0),(661,1,1,1,'Accounts',' Duo Reges: constructio interrete. Primum divisit ineleganter; Iubet igitur nos Pythius Apollo noscere nosmet ipsos. At hoc in eo M. Huius ego nunc auctoritatem sequens idem faciam. Quamquam te quidem video minime esse deterritum. Nam quibus rebus efficiuntur voluptates, eae non sunt in potestate sapientis. Negat esse eam, inquit, propter se expetendam. \n\n','2016-02-14 22:00:34','2016-02-14 22:57:42',NULL,NULL,0,1,0),(662,1,1,1,'Accounts',' Pollicetur certe. Quod autem in homine praestantissimum atque optimum est, id deseruit. Duo Reges: constructio interrete. Cum audissem Antiochum, Brute, ut solebam, cum M. \n\n','2016-02-14 22:00:35','2016-02-14 22:57:43',NULL,NULL,0,1,0),(663,1,1,1,'Accounts',' Cum autem in quo sapienter dicimus, id a primo rectissime dicitur. Quis est tam dissimile homini. Sed quanta sit alias, nunc tantum possitne esse tanta. Praetereo multos, in bis doctum hominem et suavem, Hieronymum, quem iam cur Peripateticum appellem nescio. Hoc enim constituto in philosophia constituta sunt omnia. Duo Reges: constructio interrete. Primum in nostrane potestate est, quid meminerimus? Quare hoc videndum est, possitne nobis hoc ratio philosophorum dare. Ne amores quidem sanctos a sapiente alienos esse arbitrantur. Nondum autem explanatum satis, erat, quid maxime natura vellet. \n\n','2016-02-14 22:00:36','2016-02-14 22:57:43',NULL,NULL,0,1,0),(664,1,1,1,'Accounts',' Sed quanta sit alias, nunc tantum possitne esse tanta. Videamus animi partes, quarum est conspectus illustrior; Quid me istud rogas? Ille vero, si insipiens-quo certe, quoniam tyrannus -, numquam beatus; Non igitur de improbo, sed de callido improbo quaerimus, qualis Q. Duo Reges: constructio interrete. Quo igitur, inquit, modo? Parvi enim primo ortu sic iacent, tamquam omnino sine animo sint. De hominibus dici non necesse est. \n\n','2016-02-14 22:00:37','2016-02-14 22:57:44',NULL,NULL,0,1,0),(665,1,1,1,'Accounts',' Tu enim ista lenius, hic Stoicorum more nos vexat. Habent enim et bene longam et satis litigiosam disputationem. Sed videbimus. Si enim ad populum me vocas, eum. Certe, nisi voluptatem tanti aestimaretis. Duo Reges: constructio interrete. Quem Tiberina descensio festo illo die tanto gaudio affecit, quanto L. An dolor longissimus quisque miserrimus, voluptatem non optabiliorem diuturnitas facit? \n\n','2016-02-14 22:00:37','2016-02-14 22:57:44',NULL,NULL,0,1,0),(666,1,1,1,'Accounts',' Quod non faceret, si in voluptate summum bonum poneret. Etiam beatissimum? Quid censes in Latino fore? Ex ea difficultate illae fallaciloquae, ut ait Accius, malitiae natae sunt. Qualem igitur hominem natura inchoavit? Duo Reges: constructio interrete. Velut ego nunc moveor. Sed haec quidem liberius ab eo dicuntur et saepius. Huius ego nunc auctoritatem sequens idem faciam. Piso igitur hoc modo, vir optimus tuique, ut scis, amantissimus. Tu vero, inquam, ducas licet, si sequetur; Hanc ergo intuens debet institutum illud quasi signum absolvere. \n\n','2016-02-14 22:00:38','2016-02-14 22:57:45',NULL,NULL,0,1,0),(667,1,1,1,'Accounts',' Tibi hoc incredibile, quod beatissimum. Non ego tecum iam ita iocabor, ut isdem his de rebus, cum L. Quae qui non vident, nihil umquam magnum ac cognitione dignum amaverunt. Sed mehercule pergrata mihi oratio tua. \n\n','2016-02-14 22:00:39','2016-02-14 22:57:45',NULL,NULL,0,1,0),(668,1,1,1,'Accounts',' Ille enim occurrentia nescio quae comminiscebatur; Graecis hoc modicum est: Leonidas, Epaminondas, tres aliqui aut quattuor; De quibus cupio scire quid sentias. Est autem etiam actio quaedam corporis, quae motus et status naturae congruentis tenet; Qui potest igitur habitare in beata vita summi mali metus? Duo Reges: constructio interrete. \n\n','2016-02-14 22:00:39','2016-02-14 22:57:45',NULL,NULL,0,1,0),(669,1,1,1,'Accounts',' Quae similitudo in genere etiam humano apparet. Graccho, eius fere, aequalí? Ego vero isti, inquam, permitto. A mene tu? Indicant pueri, in quibus ut in speculis natura cernitur. Duo Reges: constructio interrete. At ille pellit, qui permulcet sensum voluptate. Ut optime, secundum naturam affectum esse possit. Nam quid possumus facere melius? Haec quo modo conveniant, non sane intellego. \n\n','2016-02-14 22:00:40','2016-02-14 22:57:46',NULL,NULL,0,1,0),(670,1,1,1,'Accounts',' Duarum enim vitarum nobis erunt instituta capienda. Ut scias me intellegere, primum idem esse dico voluptatem, quod ille don. Hoc Hieronymus summum bonum esse dixit. Sed quid attinet de rebus tam apertis plura requirere? Apparet statim, quae sint officia, quae actiones. Duo Reges: constructio interrete. Quaesita enim virtus est, non quae relinqueret naturam, sed quae tueretur. Nunc omni virtuti vitium contrario nomine opponitur. \n\n','2016-02-14 22:00:41','2016-02-14 22:57:46',NULL,NULL,0,1,0),(671,1,1,1,'Accounts',' Bonum negas esse divitias, praeposìtum esse dicis? Dempta enim aeternitate nihilo beatior Iuppiter quam Epicurus; Nunc agendum est subtilius. Si quidem, inquit, tollerem, sed relinquo. Aufert enim sensus actionemque tollit omnem. Duo Reges: constructio interrete. Deinde disputat, quod cuiusque generis animantium statui deceat extremum. Nam quibus rebus efficiuntur voluptates, eae non sunt in potestate sapientis. Eam si varietatem diceres, intellegerem, ut etiam non dicente te intellego; Duae sunt enim res quoque, ne tu verba solum putes. Rhetorice igitur, inquam, nos mavis quam dialectice disputare? Quia dolori non voluptas contraria est, sed doloris privatio. \n\n','2016-02-14 22:00:42','2016-02-14 22:57:47',NULL,NULL,0,1,0),(672,1,1,1,'Accounts',' Ergo ita: non posse honeste vivi, nisi honeste vivatur? Utinam quidem dicerent alium alio beatiorem! Iam ruinas videres. Quid enim tanto opus est instrumento in optimis artibus comparandis? Suo genere perveniant ad extremum; \n\n','2016-02-14 22:00:42','2016-02-14 22:57:47',NULL,NULL,0,1,0),(673,1,1,1,'Accounts',' Facile est hoc cernere in primis puerorum aetatulis. Duo Reges: constructio interrete. Utram tandem linguam nescio? Heri, inquam, ludis commissis ex urbe profectus veni ad vesperum. Quae diligentissime contra Aristonem dicuntur a Chryippo. Miserum hominem! Si dolor summum malum est, dici aliter non potest. Si enim non fuit eorum iudicii, nihilo magis hoc non addito illud est iudicatum-. Ita multa dicunt, quae vix intellegam. Sed quot homines, tot sententiae; \n\n','2016-02-14 22:00:43','2016-02-14 22:57:47',NULL,NULL,0,1,0),(674,1,1,1,'Accounts',' Hoc dixerit potius Ennius: Nimium boni est, cui nihil est mali. Fortasse id optimum, sed ubi illud: Plus semper voluptatis? Duo Reges: constructio interrete. Virtutis, magnitudinis animi, patientiae, fortitudinis fomentis dolor mitigari solet. In eo enim positum est id, quod dicimus esse expetendum. Quia dolori non voluptas contraria est, sed doloris privatio. Itaque hic ipse iam pridem est reiectus; \n\n','2016-02-14 22:00:44','2016-02-14 22:57:48',NULL,NULL,0,1,0),(675,1,1,1,'Accounts',' Quis suae urbis conservatorem Codrum, quis Erechthei filias non maxime laudat? Iam in altera philosophiae parte. At enim, qua in vita est aliquid mali, ea beata esse non potest. Nam quid possumus facere melius? Cur iustitia laudatur? Quid de Platone aut de Democrito loquar? Duo Reges: constructio interrete. Ut in geometria, prima si dederis, danda sunt omnia. Minime id quidem, inquam, alienum, multumque ad ea, quae quaerimus, explicatio tua ista profecerit. Omnes enim iucundum motum, quo sensus hilaretur. Putabam equidem satis, inquit, me dixisse. Transfer idem ad modestiam vel temperantiam, quae est moderatio cupiditatum rationi oboediens. \n\n','2016-02-14 22:00:44','2016-02-14 22:57:48',NULL,NULL,0,1,0),(676,1,1,1,'Accounts',' Nonne igitur tibi videntur, inquit, mala? Tamen a proposito, inquam, aberramus. Duo Reges: constructio interrete. Item de contrariis, a quibus ad genera formasque generum venerunt. Beatus sibi videtur esse moriens. Quasi ego id curem, quid ille aiat aut neget. Ut optime, secundum naturam affectum esse possit. Quid ait Aristoteles reliquique Platonis alumni? \n\n','2016-02-14 22:00:45','2016-02-14 22:57:49',NULL,NULL,0,1,0),(677,1,1,1,'Accounts',' Respondent extrema primis, media utrisque, omnia omnibus. Vitae autem degendae ratio maxime quidem illis placuit quieta. An dubium est, quin virtus ita maximam partem optineat in rebus humanis, ut reliquas obruat? Ad corpus diceres pertinere-, sed ea, quae dixi, ad corpusne refers? Duo Reges: constructio interrete. Ipse Epicurus fortasse redderet, ut Sextus Peducaeus, Sex. \n\n','2016-02-14 22:00:46','2016-02-14 22:57:50',NULL,NULL,0,1,0),(678,1,1,1,'Accounts',' Equidem etiam Epicurum, in physicis quidem, Democriteum puto. Eadem nunc mea adversum te oratio est. Quae fere omnia appellantur uno ingenii nomine, easque virtutes qui habent, ingeniosi vocantur. Recte, inquit, intellegis. Vos autem cum perspicuis dubia debeatis illustrare, dubiis perspicua conamini tollere. Duo Reges: constructio interrete. Illa sunt similia: hebes acies est cuipiam oculorum, corpore alius senescit; \n\n','2016-02-14 22:00:47','2016-02-14 22:57:50',NULL,NULL,0,1,0),(679,1,1,1,'Accounts',' Quid de Platone aut de Democrito loquar? Item de contrariis, a quibus ad genera formasque generum venerunt. Age, inquies, ista parva sunt. Aliter homines, aliter philosophos loqui putas oportere? Quae si potest singula consolando levare, universa quo modo sustinebit? Duo Reges: constructio interrete. A quibus propter discendi cupiditatem videmus ultimas terras esse peragratas. Num quid tale Democritus? \n\n','2016-02-14 22:00:47','2016-02-14 22:57:50',NULL,NULL,0,1,0),(680,1,1,1,'Accounts',' Habes, inquam, Cato, formam eorum, de quibus loquor, philosophorum. Sed ne, dum huic obsequor, vobis molestus sim. Illa videamus, quae a te de amicitia dicta sunt. Duo Reges: constructio interrete. Huius ego nunc auctoritatem sequens idem faciam. Quae cum dixisset paulumque institisset, Quid est? \n\n','2016-02-14 22:00:48','2016-02-14 22:57:51',NULL,NULL,0,1,0),(681,1,1,1,'Accounts',' Progredientibus autem aetatibus sensim tardeve potius quasi nosmet ipsos cognoscimus. Sed haec quidem liberius ab eo dicuntur et saepius. Duo Reges: constructio interrete. Laelius clamores sofòw ille so lebat Edere compellans gumias ex ordine nostros. Eam tum adesse, cum dolor omnis absit; Nam quibus rebus efficiuntur voluptates, eae non sunt in potestate sapientis. \n\n','2016-02-14 22:00:49','2016-02-14 22:57:51',NULL,NULL,0,1,0),(682,1,1,1,'Accounts',' Suo enim quisque studio maxime ducitur. Si qua in iis corrigere voluit, deteriora fecit. Quae quo sunt excelsiores, eo dant clariora indicia naturae. Conferam tecum, quam cuique verso rem subicias; Duo Reges: constructio interrete. Sedulo, inquam, faciam. Quid ergo? Nulla profecto est, quin suam vim retineat a primo ad extremum. \n\n','2016-02-14 22:00:49','2016-02-14 22:57:52',NULL,NULL,0,1,0),(683,1,1,1,'Accounts',' Quis enim redargueret? An eiusdem modi? Conferam tecum, quam cuique verso rem subicias; Duo Reges: constructio interrete. Stoicos roga. Sed videbimus. \n\n','2016-02-14 22:00:50','2016-02-14 22:57:52',NULL,NULL,0,1,0),(684,1,1,1,'Accounts',' Quae sunt igitur communia vobis cum antiquis, iis sic utamur quasi concessis; Quid censes in Latino fore? Itaque haec cum illis est dissensio, cum Peripateticis nulla sane. Duo Reges: constructio interrete. Sine ea igitur iucunde negat posse se vivere? Deinde prima illa, quae in congressu solemus: Quid tu, inquit, huc? Diodorus, eius auditor, adiungit ad honestatem vacuitatem doloris. Sed quid minus probandum quam esse aliquem beatum nec satis beatum? Si quidem, inquit, tollerem, sed relinquo. \n\n','2016-02-14 22:00:51','2016-02-14 22:57:53',NULL,NULL,0,1,0),(685,1,1,1,'Accounts',' Dolere malum est: in crucem qui agitur, beatus esse non potest. Quorum sine causa fieri nihil putandum est. An est aliquid, quod te sua sponte delectet? At certe gravius. An potest, inquit ille, quicquam esse suavius quam nihil dolere? Id enim volumus, id contendimus, ut officii fructus sit ipsum officium. Hoc sic expositum dissimile est superiori. \n\n','2016-02-14 22:00:52','2016-02-14 22:57:53',NULL,NULL,0,1,0),(686,1,1,1,'Accounts',' In quo etsi est magnus, tamen nova pleraque et perpauca de moribus. Quid dubitas igitur mutare principia naturae? Ita enim vivunt quidam, ut eorum vita refellatur oratio. Quis non odit sordidos, vanos, leves, futtiles? Facillimum id quidem est, inquam. Duo Reges: constructio interrete. Sapiens autem semper beatus est et est aliquando in dolore; \n\n','2016-02-14 22:00:52','2016-02-14 22:57:54',NULL,NULL,0,1,0),(687,1,1,1,'Accounts',' Mihi vero, inquit, placet agi subtilius et, ut ipse dixisti, pressius. Fortasse id optimum, sed ubi illud: Plus semper voluptatis? Quippe: habes enim a rhetoribus; Vitiosum est enim in dividendo partem in genere numerare. Nunc haec primum fortasse audientis servire debemus. Quamquam in hac divisione rem ipsam prorsus probo, elegantiam desidero. Eadem nunc mea adversum te oratio est. Duo Reges: constructio interrete. Ergo adhuc, quantum equidem intellego, causa non videtur fuisse mutandi nominis. Idem iste, inquam, de voluptate quid sentit? \n\n','2016-02-14 22:00:58','2016-02-14 22:57:54',NULL,NULL,0,1,0),(688,1,1,1,'Accounts',' Aliter enim nosmet ipsos nosse non possumus. Quae contraria sunt his, malane? Quare, quoniam de primis naturae commodis satis dietum est nunc de maioribus consequentibusque videamus. Neque enim disputari sine reprehensione nec cum iracundia aut pertinacia recte disputari potest. Duo Reges: constructio interrete. Roges enim Aristonem, bonane ei videantur haec: vacuitas doloris, divitiae, valitudo; Itaque his sapiens semper vacabit. Sed fortuna fortis; \n\n','2016-02-14 22:00:59','2016-02-14 22:57:54',NULL,NULL,0,1,0),(689,1,1,1,'Accounts',' Eam tum adesse, cum dolor omnis absit; Nec vero sum nescius esse utilitatem in historia, non modo voluptatem. Sin dicit obscurari quaedam nec apparere, quia valde parva sint, nos quoque concedimus; An vero displicuit ea, quae tributa est animi virtutibus tanta praestantia? Quae hic rei publicae vulnera inponebat, eadem ille sanabat. Cum autem negant ea quicquam ad beatam vitam pertinere, rursus naturam relinquunt. \n\n','2016-02-14 22:01:00','2016-02-14 22:57:55',NULL,NULL,0,1,0),(690,1,1,1,'Accounts',' Non est ista, inquam, Piso, magna dissensio. Duo Reges: constructio interrete. Idem etiam dolorem saepe perpetiuntur, ne, si id non faciant, incidant in maiorem. Sic, et quidem diligentius saepiusque ista loquemur inter nos agemusque communiter. Quod, inquit, quamquam voluptatibus quibusdam est saepe iucundius, tamen expetitur propter voluptatem. Ita credo. Et non ex maxima parte de tota iudicabis? Haec para/doca illi, nos admirabilia dicamus. Nihil acciderat ei, quod nollet, nisi quod anulum, quo delectabatur, in mari abiecerat. Egone quaeris, inquit, quid sentiam? \n\n','2016-02-14 22:01:00','2016-02-14 22:57:55',NULL,NULL,0,1,0),(691,1,1,1,'Accounts',' Re mihi non aeque satisfacit, et quidem locis pluribus. Dicet pro me ipsa virtus nec dubitabit isti vestro beato M. Theophrasti igitur, inquit, tibi liber ille placet de beata vita? Nunc haec primum fortasse audientis servire debemus. \n\n','2016-02-14 22:01:01','2016-02-14 22:57:56',NULL,NULL,0,1,0),(692,1,1,1,'Accounts',' Ut id aliis narrare gestiant? Non laboro, inquit, de nomine. Atque his de rebus et splendida est eorum et illustris oratio. Conferam tecum, quam cuique verso rem subicias; Cur iustitia laudatur? \n\n','2016-02-14 22:01:02','2016-02-14 22:57:56',NULL,NULL,0,1,0),(693,1,1,1,'Accounts',' Haec quo modo conveniant, non sane intellego. Duo Reges: constructio interrete. Est enim tanti philosophi tamque nobilis audacter sua decreta defendere. Sed quia studebat laudi et dignitati, multum in virtute processerat. Nemo nostrum istius generis asotos iucunde putat vivere. Atqui reperies, inquit, in hoc quidem pertinacem; Ipse Epicurus fortasse redderet, ut Sextus Peducaeus, Sex. \n\n','2016-02-14 22:01:02','2016-02-14 22:57:56',NULL,NULL,0,1,0),(694,1,1,1,'Accounts',' Occultum facinus esse potuerit, gaudebit; Si enim ad populum me vocas, eum. Vos autem cum perspicuis dubia debeatis illustrare, dubiis perspicua conamini tollere. Nam, ut sint illa vendibiliora, haec uberiora certe sunt. Honesta oratio, Socratica, Platonis etiam. Duo Reges: constructio interrete. Primum cur ista res digna odio est, nisi quod est turpis? Item de contrariis, a quibus ad genera formasque generum venerunt. Estne, quaeso, inquam, sitienti in bibendo voluptas? Ita nemo beato beatior. \n\n','2016-02-14 22:01:03','2016-02-14 22:57:57',NULL,NULL,0,1,0),(695,1,1,1,'Accounts',' Omnia contraria, quos etiam insanos esse vultis. Tum mihi Piso: Quid ergo? An me, inquis, tam amentem putas, ut apud imperitos isto modo loquar? Quae quidem vel cum periculo est quaerenda vobis; Respondeat totidem verbis. Dolor ergo, id est summum malum, metuetur semper, etiamsi non aderit; Duo Reges: constructio interrete. Quid enim me prohiberet Epicureum esse, si probarem, quae ille diceret? \n\n','2016-02-14 22:01:04','2016-02-14 22:57:57',NULL,NULL,0,1,0),(696,1,1,1,'Accounts',' Scaevola tribunus plebis ferret ad plebem vellentne de ea re quaeri. Quaerimus enim finem bonorum. Non autem hoc: igitur ne illud quidem. Ut optime, secundum naturam affectum esse possit. Ergo opifex plus sibi proponet ad formarum quam civis excellens ad factorum pulchritudinem? Quos quidem tibi studiose et diligenter tractandos magnopere censeo. \n\n','2016-02-14 22:01:05','2016-02-14 22:57:58',NULL,NULL,0,1,0),(697,1,1,1,'Accounts',' Sed quid sentiat, non videtis. Duo enim genera quae erant, fecit tria. Res enim concurrent contrariae. Duo Reges: constructio interrete. Animum autem reliquis rebus ita perfecit, ut corpus; Cupit enim dícere nihil posse ad beatam vitam deesse sapienti. Nihilo beatiorem esse Metellum quam Regulum. Quae est igitur causa istarum angustiarum? Primum cur ista res digna odio est, nisi quod est turpis? Cuius ad naturam apta ratio vera illa et summa lex a philosophis dicitur. \n\n','2016-02-14 22:01:05','2016-02-14 22:57:58',NULL,NULL,0,1,0),(698,1,1,1,'Accounts',' Vitae autem degendae ratio maxime quidem illis placuit quieta. Ad corpus diceres pertinere-, sed ea, quae dixi, ad corpusne refers? At enim, qua in vita est aliquid mali, ea beata esse non potest. Huius, Lyco, oratione locuples, rebus ipsis ielunior. Nam his libris eum malo quam reliquo ornatu villae delectari. Levatio igitur vitiorum magna fit in iis, qui habent ad virtutem progressionis aliquantum. Nonne videmus quanta perturbatio rerum omnium consequatur, quanta confusio? \n\n','2016-02-14 22:01:06','2016-02-14 22:57:59',NULL,NULL,0,1,0),(699,1,1,1,'Accounts',' Claudii libidini, qui tum erat summo ne imperio, dederetur. Si quidem, inquit, tollerem, sed relinquo. Hanc ergo intuens debet institutum illud quasi signum absolvere. Duo Reges: constructio interrete. Nihil opus est exemplis hoc facere longius. Diodorus, eius auditor, adiungit ad honestatem vacuitatem doloris. \n\n','2016-02-14 22:01:07','2016-02-14 22:57:59',NULL,NULL,0,1,0),(700,1,1,1,'Accounts',' Atqui eorum nihil est eius generis, ut sit in fine atque extrerno bonorum. Sin tantum modo ad indicia veteris memoriae cognoscenda, curiosorum. Non potes, nisi retexueris illa. Nisi autem rerum natura perspecta erit, nullo modo poterimus sensuum iudicia defendere. \n\n','2016-02-14 22:01:07','2016-02-14 22:58:00',NULL,NULL,0,1,0),(701,1,1,1,'Accounts',' Quae cum dixisset, finem ille. Tum Piso: Quoniam igitur aliquid omnes, quid Lucius noster? Atqui iste locus est, Piso, tibi etiam atque etiam confirmandus, inquam; Licet hic rursus ea commemores, quae optimis verbis ab Epicuro de laude amicitiae dicta sunt. Hoc Hieronymus summum bonum esse dixit. Hoc enim constituto in philosophia constituta sunt omnia. Si longus, levis dictata sunt. Duo Reges: constructio interrete. \n\n','2016-02-14 22:01:08','2016-02-14 22:58:01',NULL,NULL,0,1,0),(702,1,1,1,'Accounts',' Quid ergo attinet gloriose loqui, nisi constanter loquare? Itaque his sapiens semper vacabit. Ergo adhuc, quantum equidem intellego, causa non videtur fuisse mutandi nominis. Vitae autem degendae ratio maxime quidem illis placuit quieta. Idque testamento cavebit is, qui nobis quasi oraculum ediderit nihil post mortem ad nos pertinere? Si qua in iis corrigere voluit, deteriora fecit. \n\n','2016-02-14 22:01:09','2016-02-14 22:58:01',NULL,NULL,0,1,0),(703,1,1,1,'Accounts',' Quamquam id quidem licebit iis existimare, qui legerint. Tum mihi Piso: Quid ergo? Inde igitur, inquit, ordiendum est. Duo Reges: constructio interrete. Quia dolori non voluptas contraria est, sed doloris privatio. Si longus, levis dictata sunt. \n\n','2016-02-14 22:01:10','2016-02-14 22:58:01',NULL,NULL,0,1,0),(704,1,1,1,'Accounts',' Et non ex maxima parte de tota iudicabis? Roges enim Aristonem, bonane ei videantur haec: vacuitas doloris, divitiae, valitudo; Nummus in Croesi divitiis obscuratur, pars est tamen divitiarum. Et quidem iure fortasse, sed tamen non gravissimum est testimonium multitudinis. Et nunc quidem quod eam tuetur, ut de vite potissimum loquar, est id extrinsecus; Duo Reges: constructio interrete. Qui-vere falsone, quaerere mittimus-dicitur oculis se privasse; \n\n','2016-02-14 22:01:10','2016-02-14 22:58:02',NULL,NULL,0,1,0),(705,1,1,1,'Accounts',' Duo Reges: constructio interrete. Ea possunt paria non esse. Quicquid porro animo cernimus, id omne oritur a sensibus; Suam denique cuique naturam esse ad vivendum ducem. \n\n','2016-02-14 22:01:11','2016-02-14 22:58:02',NULL,NULL,0,1,0),(706,1,1,1,'Accounts',' Non semper, inquam; Nam aliquando posse recte fieri dicunt nulla expectata nec quaesita voluptate. In eo enim positum est id, quod dicimus esse expetendum. Quod si ita sit, cur opera philosophiae sit danda nescio. Quis enim potest ea, quae probabilia videantur ei, non probare? Duo Reges: constructio interrete. Piso igitur hoc modo, vir optimus tuique, ut scis, amantissimus. Apparet statim, quae sint officia, quae actiones. Quare hoc videndum est, possitne nobis hoc ratio philosophorum dare. \n\n','2016-02-14 22:01:12','2016-02-14 22:58:03',NULL,NULL,0,1,0),(707,1,1,1,'Accounts',' Si quidem, inquit, tollerem, sed relinquo. Occultum facinus esse potuerit, gaudebit; Haec bene dicuntur, nec ego repugno, sed inter sese ipsa pugnant. Proclivi currit oratio. Atqui iste locus est, Piso, tibi etiam atque etiam confirmandus, inquam; \n\n','2016-02-14 22:01:12','2016-02-14 22:58:03',NULL,NULL,0,1,0),(708,1,1,1,'Accounts',' Cui Tubuli nomen odio non est? Idemne, quod iucunde? Sin kakan malitiam dixisses, ad aliud nos unum certum vitium consuetudo Latina traduceret. Quem Tiberina descensio festo illo die tanto gaudio affecit, quanto L. Experiamur igitur, inquit, etsi habet haec Stoicorum ratio difficilius quiddam et obscurius. Laboro autem non sine causa; Duo Reges: constructio interrete. Expressa vero in iis aetatibus, quae iam confirmatae sunt. Ut in geometria, prima si dederis, danda sunt omnia. Quae hic rei publicae vulnera inponebat, eadem ille sanabat. \n\n','2016-02-14 22:01:13','2016-02-14 22:58:04',NULL,NULL,0,1,0),(709,1,1,1,'Accounts',' Ita ne hoc quidem modo paria peccata sunt. Urgent tamen et nihil remittunt. Duo Reges: constructio interrete. Potius ergo illa dicantur: turpe esse, viri non esse debilitari dolore, frangi, succumbere. Quis enim potest ea, quae probabilia videantur ei, non probare? Occultum facinus esse potuerit, gaudebit; Itaque haec cum illis est dissensio, cum Peripateticis nulla sane. Sed quod proximum fuit non vidit. \n\n','2016-02-14 22:01:14','2016-02-14 22:58:04',NULL,NULL,0,1,0),(710,1,1,1,'Accounts',' Quamquam ab iis philosophiam et omnes ingenuas disciplinas habemus; Huius ego nunc auctoritatem sequens idem faciam. Summus dolor plures dies manere non potest? Utrum igitur tibi litteram videor an totas paginas commovere? Plane idem, inquit, et maxima quidem, qua fieri nulla maior potest. Ergo opifex plus sibi proponet ad formarum quam civis excellens ad factorum pulchritudinem? Duo Reges: constructio interrete. Quis enim potest ea, quae probabilia videantur ei, non probare? Non autem hoc: igitur ne illud quidem. Paulum, cum regem Persem captum adduceret, eodem flumine invectio? \n\n','2016-02-14 22:01:14','2016-02-14 22:58:04',NULL,NULL,0,1,0),(711,1,1,1,'Accounts',' Cur igitur, inquam, res tam dissimiles eodem nomine appellas? At quicum ioca seria, ut dicitur, quicum arcana, quicum occulta omnia? Quae quo sunt excelsiores, eo dant clariora indicia naturae. Duo Reges: constructio interrete. Ille vero, si insipiens-quo certe, quoniam tyrannus -, numquam beatus; Vitae autem degendae ratio maxime quidem illis placuit quieta. Duarum enim vitarum nobis erunt instituta capienda. \n\n','2016-02-14 22:01:15','2016-02-14 22:58:05',NULL,NULL,0,1,0),(712,1,1,1,'Accounts',' Ac ne plura complectar-sunt enim innumerabilia-, bene laudata virtus voluptatis aditus intercludat necesse est. At modo dixeras nihil in istis rebus esse, quod interesset. Et quod est munus, quod opus sapientiae? Duo Reges: constructio interrete. Nonne igitur tibi videntur, inquit, mala? An tu me de L. Etiam beatissimum? Hoc non est positum in nostra actione. \n\n','2016-02-14 22:01:16','2016-02-14 22:58:05',NULL,NULL,0,1,0),(713,1,1,1,'Accounts',' Sed quot homines, tot sententiae; Quamquam tu hanc copiosiorem etiam soles dicere. \n\n','2016-02-14 22:01:17','2016-02-14 22:58:06',NULL,NULL,0,1,0),(714,1,1,1,'Accounts',' Apparet statim, quae sint officia, quae actiones. Nihilo beatiorem esse Metellum quam Regulum. Primum in nostrane potestate est, quid meminerimus? Itaque eos id agere, ut a se dolores, morbos, debilitates repellant. Quid dubitas igitur mutare principia naturae? Cur igitur, inquam, res tam dissimiles eodem nomine appellas? Traditur, inquit, ab Epicuro ratio neglegendi doloris. \n\n','2016-02-14 22:01:17','2016-02-14 22:58:06',NULL,NULL,0,1,0),(715,1,1,1,'Accounts',' Non autem hoc: igitur ne illud quidem. Bonum negas esse divitias, praeposìtum esse dicis? In eo enim positum est id, quod dicimus esse expetendum. Negabat igitur ullam esse artem, quae ipsa a se proficisceretur; \n\n','2016-02-14 22:01:18','2016-02-14 22:58:06',NULL,NULL,0,1,0),(716,1,1,1,'Accounts',' Isto modo ne improbos quidem, si essent boni viri. Sed tu istuc dixti bene Latine, parum plane. Quod cum accidisset ut alter alterum necopinato videremus, surrexit statim. Idemne potest esse dies saepius, qui semel fuit? Nam Pyrrho, Aristo, Erillus iam diu abiecti. Ut in geometria, prima si dederis, danda sunt omnia. Duo Reges: constructio interrete. Ne in odium veniam, si amicum destitero tueri. Quis Aristidem non mortuum diligit? Duo enim genera quae erant, fecit tria. \n\n','2016-02-14 22:01:19','2016-02-14 22:58:07',NULL,NULL,0,1,0),(717,1,1,1,'Accounts',' Nonne igitur tibi videntur, inquit, mala? Aliter homines, aliter philosophos loqui putas oportere? Primum divisit ineleganter; Ego vero volo in virtute vim esse quam maximam; Duo Reges: constructio interrete. Id et fieri posse et saepe esse factum et ad voluptates percipiendas maxime pertinere. Dempta enim aeternitate nihilo beatior Iuppiter quam Epicurus; Videmusne ut pueri ne verberibus quidem a contemplandis rebus perquirendisque deterreantur? \n\n','2016-02-14 22:01:19','2016-02-14 22:58:07',NULL,NULL,0,1,0),(718,1,1,1,'Accounts',' Multoque hoc melius nos veriusque quam Stoici. Voluptatem cum summum bonum diceret, primum in eo ipso parum vidit, deinde hoc quoque alienum; Quis est tam dissimile homini. Num igitur utiliorem tibi hunc Triarium putas esse posse, quam si tua sint Puteolis granaria? Ratio quidem vestra sic cogit. Magna laus. Ait enim se, si uratur, Quam hoc suave! dicturum. \n\n','2016-02-14 22:01:20','2016-02-14 22:58:08',NULL,NULL,0,1,0),(719,1,1,1,'Accounts',' Nec tamen ille erat sapiens quis enim hoc aut quando aut ubi aut unde? Quod non faceret, si in voluptate summum bonum poneret. Duo Reges: constructio interrete. \n\n','2016-02-14 22:01:21','2016-02-14 22:58:08',NULL,NULL,0,1,0),(720,1,1,1,'Accounts',' Non enim, si omnia non sequebatur, idcirco non erat ortus illinc. Duo Reges: constructio interrete. Nihil enim iam habes, quod ad corpus referas; \n\n','2016-02-14 22:01:22','2016-02-14 22:58:09',NULL,NULL,0,1,0),(721,1,1,1,'Accounts',' Respondent extrema primis, media utrisque, omnia omnibus. Contemnit enim disserendi elegantiam, confuse loquitur. Scisse enim te quis coarguere possit? Quae tamen a te agetur non melior, quam illae sunt, quas interdum optines. Satis est ad hoc responsum. Aliter enim nosmet ipsos nosse non possumus. Sed ut iis bonis erigimur, quae expectamus, sic laetamur iis, quae recordamur. Fortasse id optimum, sed ubi illud: Plus semper voluptatis? Duo Reges: constructio interrete. \n\n','2016-02-14 22:01:22','2016-02-14 22:58:09',NULL,NULL,0,1,0),(722,1,1,1,'Accounts',' Sed emolumenta communia esse dicuntur, recte autem facta et peccata non habentur communia. Beatus autem esse in maximarum rerum timore nemo potest. Nunc haec primum fortasse audientis servire debemus. Nihil acciderat ei, quod nollet, nisi quod anulum, quo delectabatur, in mari abiecerat. Itaque his sapiens semper vacabit. Duo Reges: constructio interrete. \n\n','2016-02-14 22:01:23','2016-02-14 22:58:10',NULL,NULL,0,1,0),(723,1,1,1,'Accounts',' Omnia contraria, quos etiam insanos esse vultis. Eaedem res maneant alio modo. Respondent extrema primis, media utrisque, omnia omnibus. Ita redarguitur ipse a sese, convincunturque scripta eius probitate ipsius ac moribus. Duo Reges: constructio interrete. Eam tum adesse, cum dolor omnis absit; Animum autem reliquis rebus ita perfecit, ut corpus; Habes, inquam, Cato, formam eorum, de quibus loquor, philosophorum. Comprehensum, quod cognitum non habet? Quae autem natura suae primae institutionis oblita est? \n\n','2016-02-14 22:01:24','2016-02-14 22:58:10',NULL,NULL,0,1,0),(724,1,1,1,'Accounts',' Cur tantas regiones barbarorum pedibus obiit, tot maria transmisit? De vacuitate doloris eadem sententia erit. Quando enim Socrates, qui parens philosophiae iure dici potest, quicquam tale fecit? Res enim se praeclare habebat, et quidem in utraque parte. Quo modo autem optimum, si bonum praeterea nullum est? Quod si ita sit, cur opera philosophiae sit danda nescio. Duo Reges: constructio interrete. \n\n','2016-02-14 22:01:24','2016-02-14 22:58:10',NULL,NULL,0,1,0),(725,1,1,1,'Accounts',' Ille vero, si insipiens-quo certe, quoniam tyrannus -, numquam beatus; Quod si ita sit, cur opera philosophiae sit danda nescio. Duo Reges: constructio interrete. Quid iudicant sensus? Non quam nostram quidem, inquit Pomponius iocans; Quod mihi quidem visus est, cum sciret, velle tamen confitentem audire Torquatum. \n\n','2016-02-14 22:01:25','2016-02-14 22:58:11',NULL,NULL,0,1,0),(726,1,1,1,'Accounts',' Vide igitur ne non debeas verbis nostris uti, sententiis tuis. Quis non odit sordidos, vanos, leves, futtiles? Nam his libris eum malo quam reliquo ornatu villae delectari. Nunc ita separantur, ut disiuncta sint, quo nihil potest esse perversius. Respondeat totidem verbis. Duo Reges: constructio interrete. \n\n','2016-02-14 22:01:26','2016-02-14 22:58:12',NULL,NULL,0,1,0),(727,1,1,1,'Accounts',' Verum tamen cum de rebus grandioribus dicas, ipsae res verba rapiunt; Mihi vero, inquit, placet agi subtilius et, ut ipse dixisti, pressius. Progredientibus autem aetatibus sensim tardeve potius quasi nosmet ipsos cognoscimus. Est enim effectrix multarum et magnarum voluptatum. Ita enim vivunt quidam, ut eorum vita refellatur oratio. Quamvis enim depravatae non sint, pravae tamen esse possunt. \n\n','2016-02-14 22:01:27','2016-02-14 22:58:12',NULL,NULL,0,1,0),(728,1,1,1,'Accounts',' Cum autem in quo sapienter dicimus, id a primo rectissime dicitur. At iam decimum annum in spelunca iacet. Videmus igitur ut conquiescere ne infantes quidem possint. Primum cur ista res digna odio est, nisi quod est turpis? Teneo, inquit, finem illi videri nihil dolere. A primo, ut opinor, animantium ortu petitur origo summi boni. Duo Reges: constructio interrete. Virtutis, magnitudinis animi, patientiae, fortitudinis fomentis dolor mitigari solet. Ad eas enim res ab Epicuro praecepta dantur. \n\n','2016-02-14 22:01:27','2016-02-14 22:58:13',NULL,NULL,0,1,0),(729,1,1,1,'Accounts',' Quid autem habent admirationis, cum prope accesseris? Est enim tanti philosophi tamque nobilis audacter sua decreta defendere. Sed quid minus probandum quam esse aliquem beatum nec satis beatum? Hoc ipsum elegantius poni meliusque potuit. Quae quidem vel cum periculo est quaerenda vobis; Duo Reges: constructio interrete. Ergo, inquit, tibi Q. Egone non intellego, quid sit don Graece, Latine voluptas? Tum mihi Piso: Quid ergo? \n\n','2016-02-14 22:01:28','2016-02-14 22:58:13',NULL,NULL,0,1,0),(730,1,1,1,'Accounts',' Nondum autem explanatum satis, erat, quid maxime natura vellet. Quantam rem agas, ut Circeis qui habitet totum hunc mundum suum municipium esse existimet? Quod autem satis est, eo quicquid accessit, nimium est; \n\n','2016-02-14 22:01:29','2016-02-14 22:58:13',NULL,NULL,0,1,0),(731,1,1,1,'Accounts',' Scaevola tribunus plebis ferret ad plebem vellentne de ea re quaeri. Stulti autem malorum memoria torquentur, sapientes bona praeterita grata recordatione renovata delectant. Qui autem de summo bono dissentit de tota philosophiae ratione dissentit. At enim hic etiam dolore. Quid ait Aristoteles reliquique Platonis alumni? Nam, ut paulo ante docui, augendae voluptatis finis est doloris omnis amotio. \n\n','2016-02-14 22:01:29','2016-02-14 22:58:14',NULL,NULL,0,1,0),(732,1,1,1,'Accounts',' Quarum ambarum rerum cum medicinam pollicetur, luxuriae licentiam pollicetur. Inde igitur, inquit, ordiendum est. At hoc in eo M. Superiores tres erant, quae esse possent, quarum est una sola defensa, eaque vehementer. Quod cum dixissent, ille contra. Quae sequuntur igitur? Idem iste, inquam, de voluptate quid sentit? Duo Reges: constructio interrete. \n\n','2016-02-14 22:01:30','2016-02-14 22:58:14',NULL,NULL,0,1,0),(733,1,1,1,'Accounts',' Ut alios omittam, hunc appello, quem ille unum secutus est. Satis est ad hoc responsum. Quis est tam dissimile homini. Illa argumenta propria videamus, cur omnia sint paria peccata. Duo Reges: constructio interrete. \n\n','2016-02-14 22:01:31','2016-02-14 22:58:15',NULL,NULL,0,1,0),(734,1,1,1,'Accounts',' Ille enim occurrentia nescio quae comminiscebatur; Beatum, inquit. Est, ut dicis, inquam. Aliter enim explicari, quod quaeritur, non potest. Nam quibus rebus efficiuntur voluptates, eae non sunt in potestate sapientis. \n\n','2016-02-14 22:01:32','2016-02-14 22:58:15',NULL,NULL,0,1,0),(735,1,1,1,'Accounts',' Sin dicit obscurari quaedam nec apparere, quia valde parva sint, nos quoque concedimus; Inde igitur, inquit, ordiendum est. Vulgo enim dicitur: Iucundi acti labores, nec male Euripidesconcludam, si potero, Latine; Et quidem iure fortasse, sed tamen non gravissimum est testimonium multitudinis. Non dolere, inquam, istud quam vim habeat postea videro; Quamvis enim depravatae non sint, pravae tamen esse possunt. \n\n','2016-02-14 22:01:32','2016-02-14 22:58:16',NULL,NULL,0,1,0),(736,1,1,1,'Accounts',' Quid enim est a Chrysippo praetermissum in Stoicis? Maximas vero virtutes iacere omnis necesse est voluptate dominante. Nihil opus est exemplis hoc facere longius. Quaesita enim virtus est, non quae relinqueret naturam, sed quae tueretur. Etsi qui potest intellegi aut cogitari esse aliquod animal, quod se oderit? Duo Reges: constructio interrete. \n\n','2016-02-14 22:01:33','2016-02-14 22:58:16',NULL,NULL,0,1,0),(737,1,1,1,'Accounts',' Vide, quantum, inquam, fallare, Torquate. Portenta haec esse dicit, neque ea ratione ullo modo posse vivi; Quis istum dolorem timet? Neminem videbis ita laudatum, ut artifex callidus comparandarum voluptatum diceretur. Duo Reges: constructio interrete. Apparet statim, quae sint officia, quae actiones. Terram, mihi crede, ea lanx et maria deprimet. \n\n','2016-02-14 22:01:34','2016-02-14 22:58:17',NULL,NULL,0,1,0),(738,1,1,1,'Accounts',' Tum ille: Tu autem cum ipse tantum librorum habeas, quos hic tandem requiris? Equidem e Cn. Quid dubitas igitur mutare principia naturae? \n\n','2016-02-14 22:01:34','2016-02-14 22:58:17',NULL,NULL,0,1,0),(739,1,1,1,'Accounts',' Tria genera bonorum; Atque ab isto capite fluere necesse est omnem rationem bonorum et malorum. Quibus rebus vita consentiens virtutibusque respondens recta et honesta et constans et naturae congruens existimari potest. Hoc enim constituto in philosophia constituta sunt omnia. Fortasse id optimum, sed ubi illud: Plus semper voluptatis? At Zeno eum non beatum modo, sed etiam divitem dicere ausus est. Duo Reges: constructio interrete. \n\n','2016-02-14 22:01:35','2016-02-14 22:58:18',NULL,NULL,0,1,0),(740,1,1,1,'Accounts',' Tecum optime, deinde etiam cum mediocri amico. Expressa vero in iis aetatibus, quae iam confirmatae sunt. At, illa, ut vobis placet, partem quandam tuetur, reliquam deserit. Cur tantas regiones barbarorum pedibus obiit, tot maria transmisit? Duo Reges: constructio interrete. Nisi autem rerum natura perspecta erit, nullo modo poterimus sensuum iudicia defendere. \n\n','2016-02-14 22:01:37','2016-02-14 22:58:18',NULL,NULL,0,1,0),(741,1,1,1,'Accounts',' Nam ante Aristippus, et ille melius. Haec para/doca illi, nos admirabilia dicamus. In schola desinis. Polycratem Samium felicem appellabant. Beatus autem esse in maximarum rerum timore nemo potest. \n\n','2016-02-14 22:01:37','2016-02-14 22:58:18',NULL,NULL,0,1,0),(742,1,1,1,'Accounts',' Quae cum praeponunt, ut sit aliqua rerum selectio, naturam videntur sequi; Quam illa ardentis amores excitaret sui! Cur tandem? Satis est tibi in te, satis in legibus, satis in mediocribus amicitiis praesidii. Duo Reges: constructio interrete. Hoc loco tenere se Triarius non potuit. \n\n','2016-02-14 22:01:38','2016-02-14 22:58:19',NULL,NULL,0,1,0),(743,1,1,1,'Accounts',' Atque haec ita iustitiae propria sunt, ut sint virtutum reliquarum communia. Quis enim potest ea, quae probabilia videantur ei, non probare? Hoc loco tenere se Triarius non potuit. Quid, quod res alia tota est? Plane idem, inquit, et maxima quidem, qua fieri nulla maior potest. De hominibus dici non necesse est. \n\n','2016-02-14 22:01:39','2016-02-14 22:58:19',NULL,NULL,0,1,0),(744,1,1,1,'Accounts',' Quasi vero, inquit, perpetua oratio rhetorum solum, non etiam philosophorum sit. Quae contraria sunt his, malane? An ea, quae per vinitorem antea consequebatur, per se ipsa curabit? Quae quidem vel cum periculo est quaerenda vobis; Quis est tam dissimile homini. Duo Reges: constructio interrete. \n\n','2016-02-14 22:01:40','2016-02-14 22:58:20',NULL,NULL,0,1,0),(745,1,1,1,'Accounts',' Rationis enim perfectio est virtus; Quod ea non occurrentia fingunt, vincunt Aristonem; Sed haec quidem liberius ab eo dicuntur et saepius. Utrum igitur tibi litteram videor an totas paginas commovere? Omnia contraria, quos etiam insanos esse vultis. Est, ut dicis, inquam. Non quam nostram quidem, inquit Pomponius iocans; At certe gravius. Duo Reges: constructio interrete. \n\n','2016-02-14 22:01:40','2016-02-14 22:58:20',NULL,NULL,0,1,0),(746,1,1,1,'Accounts',' Naturales divitias dixit parabiles esse, quod parvo esset natura contenta. Consequentia exquirere, quoad sit id, quod volumus, effectum. Videamus igitur sententias eorum, tum ad verba redeamus. Quos quidem tibi studiose et diligenter tractandos magnopere censeo. Duo Reges: constructio interrete. \n\n','2016-02-14 22:01:41','2016-02-14 22:58:21',NULL,NULL,0,1,0),(747,1,1,1,'Accounts',' Expectoque quid ad id, quod quaerebam, respondeas. Quid enim me prohiberet Epicureum esse, si probarem, quae ille diceret? An nisi populari fama? Huius ego nunc auctoritatem sequens idem faciam. Quae qui non vident, nihil umquam magnum ac cognitione dignum amaverunt. Duo Reges: constructio interrete. Te ipsum, dignissimum maioribus tuis, voluptasne induxit, ut adolescentulus eriperes P. \n\n','2016-02-14 22:01:42','2016-02-14 22:58:21',NULL,NULL,0,1,0),(748,1,1,1,'Accounts',' Quam ob rem tandem, inquit, non satisfacit? Ne vitationem quidem doloris ipsam per se quisquam in rebus expetendis putavit, nisi etiam evitare posset. Duo Reges: constructio interrete. Quae diligentissime contra Aristonem dicuntur a Chryippo. Quae in controversiam veniunt, de iis, si placet, disseramus. Haec para/doca illi, nos admirabilia dicamus. \n\n','2016-02-14 22:01:43','2016-02-14 22:58:21',NULL,NULL,0,1,0),(749,1,1,1,'Accounts',' Duo Reges: constructio interrete. Nummus in Croesi divitiis obscuratur, pars est tamen divitiarum. Nec tamen ille erat sapiens quis enim hoc aut quando aut ubi aut unde? An vero, inquit, quisquam potest probare, quod perceptfum, quod. Et harum quidem rerum facilis est et expedita distinctio. Omnia contraria, quos etiam insanos esse vultis. \n\n','2016-02-14 22:01:43','2016-02-14 22:58:22',NULL,NULL,0,1,0),(750,1,1,1,'Accounts',' Sint modo partes vitae beatae. Nam si propter voluptatem, quae est ista laus, quae possit e macello peti? \n\n','2016-02-14 22:01:44','2016-02-14 22:58:23',NULL,NULL,0,1,0),(751,1,1,1,'Accounts',' Vidit Homerus probari fabulam non posse, si cantiunculis tantus irretitus vir teneretur; Facillimum id quidem est, inquam. Zenonis est, inquam, hoc Stoici. Quae cum dixisset paulumque institisset, Quid est? Duo Reges: constructio interrete. Tum ille: Tu autem cum ipse tantum librorum habeas, quos hic tandem requiris? Consequentia exquirere, quoad sit id, quod volumus, effectum. Iam in altera philosophiae parte. Quae autem natura suae primae institutionis oblita est? Laboro autem non sine causa; Qui-vere falsone, quaerere mittimus-dicitur oculis se privasse; \n\n','2016-02-14 22:01:45','2016-02-14 22:58:23',NULL,NULL,0,1,0),(752,1,1,1,'Accounts',' Non potes, nisi retexueris illa. Quid est enim aliud esse versutum? Quo tandem modo? At cum de plurimis eadem dicit, tum certe de maximis. Quo plebiscito decreta a senatu est consuli quaestio Cn. Quod autem ratione actum est, id officium appellamus. Duo Reges: constructio interrete. Qui autem esse poteris, nisi te amor ipse ceperit? \n\n','2016-02-14 22:01:45','2016-02-14 22:58:24',NULL,NULL,0,1,0),(753,1,1,1,'Accounts',' Quo modo autem philosophus loquitur? Ac tamen hic mallet non dolere. Haec dicuntur fortasse ieiunius; Ut alios omittam, hunc appello, quem ille unum secutus est. \n\n','2016-02-14 22:01:46','2016-02-14 22:58:24',NULL,NULL,0,1,0),(754,1,1,1,'Accounts',' Utrum igitur tibi litteram videor an totas paginas commovere? Hic, qui utrumque probat, ambobus debuit uti, sicut facit re, neque tamen dividit verbis. Quamvis enim depravatae non sint, pravae tamen esse possunt. Quamquam ab iis philosophiam et omnes ingenuas disciplinas habemus; Tuo vero id quidem, inquam, arbitratu. Illa videamus, quae a te de amicitia dicta sunt. \n\n','2016-02-14 22:01:47','2016-02-14 22:58:25',NULL,NULL,0,1,0),(755,1,1,1,'Accounts',' Quid enim possumus hoc agere divinius? Quod quidem nobis non saepe contingit. Hoc enim constituto in philosophia constituta sunt omnia. Non quam nostram quidem, inquit Pomponius iocans; Sed utrum hortandus es nobis, Luci, inquit, an etiam tua sponte propensus es? Quae enim adhuc protulisti, popularia sunt, ego autem a te elegantiora desidero. \n\n','2016-02-14 22:01:48','2016-02-14 22:58:25',NULL,NULL,0,1,0),(756,1,1,1,'Accounts',' Materiam vero rerum et copiam apud hos exilem, apud illos uberrimam reperiemus. Habes, inquam, Cato, formam eorum, de quibus loquor, philosophorum. Causa autem fuit huc veniendi ut quosdam hinc libros promerem. Est enim tanti philosophi tamque nobilis audacter sua decreta defendere. Potius ergo illa dicantur: turpe esse, viri non esse debilitari dolore, frangi, succumbere. Duo Reges: constructio interrete. Et non ex maxima parte de tota iudicabis? At Zeno eum non beatum modo, sed etiam divitem dicere ausus est. Quamvis enim depravatae non sint, pravae tamen esse possunt. Paria sunt igitur. Haec para/doca illi, nos admirabilia dicamus. \n\n','2016-02-14 22:01:48','2016-02-14 22:58:25',NULL,NULL,0,1,0),(757,1,1,1,'Accounts',' Solum praeterea formosum, solum liberum, solum civem, stultost; Sed nonne merninisti licere mihi ista probare, quae sunt a te dicta? Qui convenit? Eaedem res maneant alio modo. Duo Reges: constructio interrete. Sed tamen est aliquid, quod nobis non liceat, liceat illis. Theophrastus mediocriterne delectat, cum tractat locos ab Aristotele ante tractatos? Beatus sibi videtur esse moriens. A primo, ut opinor, animantium ortu petitur origo summi boni. Quo modo autem optimum, si bonum praeterea nullum est? Et ille ridens: Video, inquit, quid agas; \n\n','2016-02-14 22:01:49','2016-02-14 22:58:26',NULL,NULL,0,1,0),(758,1,1,1,'Accounts',' Prave, nequiter, turpiter cenabat; Quod si ita sit, cur opera philosophiae sit danda nescio. Primum in nostrane potestate est, quid meminerimus? Duo Reges: constructio interrete. Itaque contra est, ac dicitis; Graecum enim hunc versum nostis omnes-: Suavis laborum est praeteritorum memoria. Expectoque quid ad id, quod quaerebam, respondeas. Teneo, inquit, finem illi videri nihil dolere. \n\n','2016-02-14 22:01:50','2016-02-14 22:58:26',NULL,NULL,0,1,0),(759,1,1,1,'Accounts',' Restatis igitur vos; Quorum sine causa fieri nihil putandum est. Illum mallem levares, quo optimum atque humanissimum virum, Cn. Illa sunt similia: hebes acies est cuipiam oculorum, corpore alius senescit; Illud quaero, quid ei, qui in voluptate summum bonum ponat, consentaneum sit dicere. Quid turpius quam sapientis vitam ex insipientium sermone pendere? Igitur neque stultorum quisquam beatus neque sapientium non beatus. Duo Reges: constructio interrete. \n\n','2016-02-14 22:01:50','2016-02-14 22:58:27',NULL,NULL,0,1,0),(760,1,1,1,'Accounts',' Haec et tu ita posuisti, et verba vestra sunt. Nam aliquando posse recte fieri dicunt nulla expectata nec quaesita voluptate. Estne, quaeso, inquam, sitienti in bibendo voluptas? Quis enim est, qui non videat haec esse in natura rerum tria? Duo Reges: constructio interrete. Nos commodius agimus. Videamus igitur sententias eorum, tum ad verba redeamus. \n\n','2016-02-14 22:01:51','2016-02-14 22:58:27',NULL,NULL,0,1,0),(761,1,1,1,'Accounts',' Disserendi artem nullam habuit. Et certamen honestum et disputatio splendida! omnis est enim de virtutis dignitate contentio. Atque hoc loco similitudines eas, quibus illi uti solent, dissimillimas proferebas. Duo Reges: constructio interrete. Hoc est non modo cor non habere, sed ne palatum quidem. Neminem videbis ita laudatum, ut artifex callidus comparandarum voluptatum diceretur. Dic in quovis conventu te omnia facere, ne doleas. \n\n','2016-02-14 22:01:52','2016-02-14 22:58:28',NULL,NULL,0,1,0),(762,1,1,1,'Accounts',' Ubi ut eam caperet aut quando? Non potes, nisi retexueris illa. Quod si ita se habeat, non possit beatam praestare vitam sapientia. Duo Reges: constructio interrete. Prodest, inquit, mihi eo esse animo. Si verbum sequimur, primum longius verbum praepositum quam bonum. Omnia contraria, quos etiam insanos esse vultis. Sin laboramus, quis est, qui alienae modum statuat industriae? \n\n','2016-02-14 22:01:52','2016-02-14 22:58:28',NULL,NULL,0,1,0),(763,1,1,1,'Accounts',' Nam et complectitur verbis, quod vult, et dicit plane, quod intellegam; Minime vero, inquit ille, consentit. Huius ego nunc auctoritatem sequens idem faciam. Estne, quaeso, inquam, sitienti in bibendo voluptas? Profectus in exilium Tubulus statim nec respondere ausus; Graecis hoc modicum est: Leonidas, Epaminondas, tres aliqui aut quattuor; \n\n','2016-02-14 22:01:53','2016-02-14 22:58:29',NULL,NULL,0,1,0),(764,1,1,1,'Accounts',' Callipho ad virtutem nihil adiunxit nisi voluptatem, Diodorus vacuitatem doloris. In quibus doctissimi illi veteres inesse quiddam caeleste et divinum putaverunt. Gerendus est mos, modo recte sentiat. Duo Reges: constructio interrete. Nec vero alia sunt quaerenda contra Carneadeam illam sententiam. Respondeat totidem verbis. Morbo gravissimo affectus, exul, orbus, egens, torqueatur eculeo: quem hunc appellas, Zeno? Atque hoc loco similitudines eas, quibus illi uti solent, dissimillimas proferebas. Claudii libidini, qui tum erat summo ne imperio, dederetur. \n\n','2016-02-14 22:01:54','2016-02-14 22:58:29',NULL,NULL,0,1,0),(765,1,1,1,'Accounts',' Eorum enim omnium multa praetermittentium, dum eligant aliquid, quod sequantur, quasi curta sententia; Quem Tiberina descensio festo illo die tanto gaudio affecit, quanto L. Hanc ergo intuens debet institutum illud quasi signum absolvere. Quis animo aequo videt eum, quem inpure ac flagitiose putet vivere? Negare non possum. Videamus animi partes, quarum est conspectus illustrior; \n\n','2016-02-14 22:01:55','2016-02-14 22:58:29',NULL,NULL,0,1,0),(766,1,1,1,'Accounts',' Nam quid possumus facere melius? Non est igitur voluptas bonum. Deinde dolorem quem maximum? Paulum, cum regem Persem captum adduceret, eodem flumine invectio? Scaevola tribunus plebis ferret ad plebem vellentne de ea re quaeri. Quonam, inquit, modo? Duo Reges: constructio interrete. Ab hoc autem quaedam non melius quam veteres, quaedam omnino relicta. Comprehensum, quod cognitum non habet? Eam tum adesse, cum dolor omnis absit; \n\n','2016-02-14 22:01:55','2016-02-14 22:58:30',NULL,NULL,0,1,0),(767,1,1,1,'Accounts',' In motu et in statu corporis nihil inest, quod animadvertendum esse ipsa natura iudicet? Sed venio ad inconstantiae crimen, ne saepius dicas me aberrare; Sin laboramus, quis est, qui alienae modum statuat industriae? Et ille ridens: Video, inquit, quid agas; Quacumque enim ingredimur, in aliqua historia vestigium ponimus. Consequentia exquirere, quoad sit id, quod volumus, effectum. Duo Reges: constructio interrete. Ad quorum et cognitionem et usum iam corroborati natura ipsa praeeunte deducimur. Nec lapathi suavitatem acupenseri Galloni Laelius anteponebat, sed suavitatem ipsam neglegebat; Quorum altera prosunt, nocent altera. Tu vero, inquam, ducas licet, si sequetur; Invidiosum nomen est, infame, suspectum. \n\n','2016-02-14 22:01:56','2016-02-14 22:58:30',NULL,NULL,0,1,0),(768,1,1,1,'Accounts',' Quid igitur, inquit, eos responsuros putas? Ut in voluptate sit, qui epuletur, in dolore, qui torqueatur. Quid ergo hoc loco intellegit honestum? Duo Reges: constructio interrete. Tu autem negas fortem esse quemquam posse, qui dolorem malum putet. An tu me de L. Sed ego in hoc resisto; Optime, inquam. Nunc ita separantur, ut disiuncta sint, quo nihil potest esse perversius. Hoc dixerit potius Ennius: Nimium boni est, cui nihil est mali. \n\n','2016-02-14 22:01:57','2016-02-14 22:58:31',NULL,NULL,0,1,0),(769,1,1,1,'Accounts',' Callipho ad virtutem nihil adiunxit nisi voluptatem, Diodorus vacuitatem doloris. Conferam tecum, quam cuique verso rem subicias; Sin kakan malitiam dixisses, ad aliud nos unum certum vitium consuetudo Latina traduceret. Si enim ad populum me vocas, eum. \n\n','2016-02-14 22:01:57','2016-02-14 22:58:32',NULL,NULL,0,1,0),(770,1,1,1,'Accounts',' Ergo illi intellegunt quid Epicurus dicat, ego non intellego? Sin aliud quid voles, postea. Quia nec honesto quic quam honestius nec turpi turpius. Duo Reges: constructio interrete. Huius ego nunc auctoritatem sequens idem faciam. Quae cum ita sint, effectum est nihil esse malum, quod turpe non sit. Qua ex cognitione facilior facta est investigatio rerum occultissimarum. Sed finge non solum callidum eum, qui aliquid improbe faciat, verum etiam praepotentem, ut M. \n\n','2016-02-14 22:01:58','2016-02-14 22:58:32',NULL,NULL,0,1,0),(771,1,1,1,'Accounts',' Summae mihi videtur inscitiae. Nunc haec primum fortasse audientis servire debemus. Utrum igitur tibi litteram videor an totas paginas commovere? Claudii libidini, qui tum erat summo ne imperio, dederetur. Tu enim ista lenius, hic Stoicorum more nos vexat. Duo Reges: constructio interrete. Istam voluptatem perpetuam quis potest praestare sapienti? \n\n','2016-02-14 22:01:59','2016-02-14 22:58:33',NULL,NULL,0,1,0),(772,1,1,1,'Accounts',' Apparet statim, quae sint officia, quae actiones. Omnes enim iucundum motum, quo sensus hilaretur. Haec quo modo conveniant, non sane intellego. Haec et tu ita posuisti, et verba vestra sunt. \n\n','2016-02-14 22:02:00','2016-02-14 22:58:33',NULL,NULL,0,1,0),(773,1,1,1,'Accounts',' Quasi ego id curem, quid ille aiat aut neget. Duo Reges: constructio interrete. Sit hoc ultimum bonorum, quod nunc a me defenditur; Efficiens dici potest. Summum ením bonum exposuit vacuitatem doloris; Quod si ita se habeat, non possit beatam praestare vitam sapientia. \n\n','2016-02-14 22:02:00','2016-02-14 22:58:34',NULL,NULL,0,1,0),(774,1,1,1,'Accounts',' Itaque his sapiens semper vacabit. Cuius similitudine perspecta in formarum specie ac dignitate transitum est ad honestatem dictorum atque factorum. Duo Reges: constructio interrete. Cupiditates non Epicuri divisione finiebat, sed sua satietate. Aut, Pylades cum sis, dices te esse Orestem, ut moriare pro amico? \n\n','2016-02-14 22:02:01','2016-02-14 22:58:35',NULL,NULL,0,1,0),(775,1,1,1,'Accounts',' Hi curatione adhibita levantur in dies, valet alter plus cotidie, alter videt. Cur id non ita fit? Non potes, nisi retexueris illa. Non enim, si omnia non sequebatur, idcirco non erat ortus illinc. Sed in rebus apertissimis nimium longi sumus. Nihil enim hoc differt. \n\n','2016-02-14 22:02:02','2016-02-14 22:58:35',NULL,NULL,0,1,0),(776,1,1,1,'Accounts',' Re mihi non aeque satisfacit, et quidem locis pluribus. Bona autem corporis huic sunt, quod posterius posui, similiora. At iam decimum annum in spelunca iacet. Familiares nostros, credo, Sironem dicis et Philodemum, cum optimos viros, tum homines doctissimos. Duo Reges: constructio interrete. Illa argumenta propria videamus, cur omnia sint paria peccata. \n\n','2016-02-14 22:02:03','2016-02-14 22:58:35',NULL,NULL,0,1,0),(777,1,1,1,'Accounts',' Ab hoc autem quaedam non melius quam veteres, quaedam omnino relicta. Tu vero, inquam, ducas licet, si sequetur; Duo Reges: constructio interrete. Cupiditates non Epicuri divisione finiebat, sed sua satietate. Nam si amitti vita beata potest, beata esse non potest. Duo enim genera quae erant, fecit tria. \n\n','2016-02-14 22:02:03','2016-02-14 22:58:36',NULL,NULL,0,1,0),(778,1,1,1,'Accounts',' An vero displicuit ea, quae tributa est animi virtutibus tanta praestantia? Theophrasti igitur, inquit, tibi liber ille placet de beata vita? Satisne vobis videor pro meo iure in vestris auribus commentatus? Si quicquam extra virtutem habeatur in bonis. Ac tamen hic mallet non dolere. Multa sunt dicta ab antiquis de contemnendis ac despiciendis rebus humanis; Duo Reges: constructio interrete. Quod cum accidisset ut alter alterum necopinato videremus, surrexit statim. Sed quid attinet de rebus tam apertis plura requirere? Itaque his sapiens semper vacabit. \n\n','2016-02-14 22:02:04','2016-02-14 22:58:36',NULL,NULL,0,1,0),(779,1,1,1,'Accounts',' Maximas vero virtutes iacere omnis necesse est voluptate dominante. Roges enim Aristonem, bonane ei videantur haec: vacuitas doloris, divitiae, valitudo; Equidem e Cn. Duo Reges: constructio interrete. Traditur, inquit, ab Epicuro ratio neglegendi doloris. Hanc quoque iucunditatem, si vis, transfer in animum; Nunc omni virtuti vitium contrario nomine opponitur. Naturales divitias dixit parabiles esse, quod parvo esset natura contenta. Quare, quoniam de primis naturae commodis satis dietum est nunc de maioribus consequentibusque videamus. \n\n','2016-02-14 22:02:05','2016-02-14 22:58:37',NULL,NULL,0,1,0),(780,1,1,1,'Accounts',' Vide, quaeso, rectumne sit. Quis non odit sordidos, vanos, leves, futtiles? An hoc usque quaque, aliter in vita? Hanc ergo intuens debet institutum illud quasi signum absolvere. Collige omnia, quae soletis: Praesidium amicorum. Duo Reges: constructio interrete. \n\n','2016-02-14 22:02:05','2016-02-14 22:58:37',NULL,NULL,0,1,0),(781,1,1,1,'Accounts',' Sed ad haec, nisi molestum est, habeo quae velim. Quis est enim, in quo sit cupiditas, quin recte cupidus dici possit? Duo Reges: constructio interrete. Prioris generis est docilitas, memoria; \n\n','2016-02-14 22:02:06','2016-02-14 22:58:38',NULL,NULL,0,1,0),(782,1,1,1,'Accounts',' Qui convenit? Ut proverbia non nulla veriora sint quam vestra dogmata. Cupiditates non Epicuri divisione finiebat, sed sua satietate. Quid enim de amicitia statueris utilitatis causa expetenda vides. Disserendi artem nullam habuit. \n\n','2016-02-14 22:02:07','2016-02-14 22:58:38',NULL,NULL,0,1,0),(783,1,1,1,'Accounts',' Hoc est dicere: Non reprehenderem asotos, si non essent asoti. Oratio me istius philosophi non offendit; Duo Reges: constructio interrete. Eam si varietatem diceres, intellegerem, ut etiam non dicente te intellego; Quis Aristidem non mortuum diligit? Sed haec ab Antiocho, familiari nostro, dicuntur multo melius et fortius, quam a Stasea dicebantur. Recte dicis; \n\n','2016-02-14 22:02:08','2016-02-14 22:58:38',NULL,NULL,0,1,0),(784,1,1,1,'Accounts',' Serpere anguiculos, nare anaticulas, evolare merulas, cornibus uti videmus boves, nepas aculeis. Id enim volumus, id contendimus, ut officii fructus sit ipsum officium. Quare hoc videndum est, possitne nobis hoc ratio philosophorum dare. Aliter homines, aliter philosophos loqui putas oportere? Quid igitur dubitamus in tota eius natura quaerere quid sit effectum? Duo Reges: constructio interrete. Sed fortuna fortis; At iam decimum annum in spelunca iacet. Similiter sensus, cum accessit ad naturam, tuetur illam quidem, sed etiam se tuetur; Inquit, dasne adolescenti veniam? \n\n','2016-02-14 22:02:09','2016-02-14 22:58:39',NULL,NULL,0,1,0),(785,1,1,1,'Accounts',' Animi enim quoque dolores percipiet omnibus partibus maiores quam corporis. Habes, inquam, Cato, formam eorum, de quibus loquor, philosophorum. Proclivi currit oratio. Duo Reges: constructio interrete. Stulti autem malorum memoria torquentur, sapientes bona praeterita grata recordatione renovata delectant. \n\n','2016-02-14 22:02:10','2016-02-14 22:58:39',NULL,NULL,0,1,0),(786,1,1,1,'Accounts',' Cupiditates non Epicuri divisione finiebat, sed sua satietate. Eam tum adesse, cum dolor omnis absit; Nam quid possumus facere melius? Non igitur bene. Quid in isto egregio tuo officio et tanta fide-sic enim existimo-ad corpus refers? Duo Reges: constructio interrete. Quonam, inquit, modo? \n\n','2016-02-14 22:02:10','2016-02-14 22:58:40',NULL,NULL,0,1,0),(787,1,1,1,'Accounts',' Quam ob rem tandem, inquit, non satisfacit? Callipho ad virtutem nihil adiunxit nisi voluptatem, Diodorus vacuitatem doloris. Duo Reges: constructio interrete. Expressa vero in iis aetatibus, quae iam confirmatae sunt. Tollenda est atque extrahenda radicitus. Quarum ambarum rerum cum medicinam pollicetur, luxuriae licentiam pollicetur. Theophrasti igitur, inquit, tibi liber ille placet de beata vita? Graece donan, Latine voluptatem vocant. \n\n','2016-02-14 22:02:11','2016-02-14 22:58:40',NULL,NULL,0,1,0),(788,1,1,1,'Accounts',' Beatus autem esse in maximarum rerum timore nemo potest. Quamquam tu hanc copiosiorem etiam soles dicere. Comprehensum, quod cognitum non habet? Isto modo ne improbos quidem, si essent boni viri. Inde igitur, inquit, ordiendum est. Teneo, inquit, finem illi videri nihil dolere. Duo Reges: constructio interrete. \n\n','2016-02-14 22:02:12','2016-02-14 22:58:41',NULL,NULL,0,1,0),(789,1,1,1,'Accounts',' An est aliquid, quod te sua sponte delectet? Tamen a proposito, inquam, aberramus. Que Manilium, ab iisque M. Itaque rursus eadem ratione, qua sum paulo ante usus, haerebitis. At certe gravius. Nunc haec primum fortasse audientis servire debemus. Duo Reges: constructio interrete. Quod si ita se habeat, non possit beatam praestare vitam sapientia. Universa enim illorum ratione cum tota vestra confligendum puto. Quo tandem modo? \n\n','2016-02-14 22:02:12','2016-02-14 22:58:41',NULL,NULL,0,1,0),(790,1,1,1,'Accounts',' Deinde disputat, quod cuiusque generis animantium statui deceat extremum. Sed ad bona praeterita redeamus. Praetereo multos, in bis doctum hominem et suavem, Hieronymum, quem iam cur Peripateticum appellem nescio. Cum id quoque, ut cupiebat, audivisset, evelli iussit eam, qua erat transfixus, hastam. Quae quo sunt excelsiores, eo dant clariora indicia naturae. \n\n','2016-02-14 22:02:13','2016-02-14 22:58:41',NULL,NULL,0,1,0),(791,1,1,1,'Accounts',' Quamquam haec quidem praeposita recte et reiecta dicere licebit. Duo Reges: constructio interrete. Maximus dolor, inquit, brevis est. Quis enim redargueret? Quasi ego id curem, quid ille aiat aut neget. At ego quem huic anteponam non audeo dicere; Suam denique cuique naturam esse ad vivendum ducem. \n\n','2016-02-14 22:02:14','2016-02-14 22:58:42',NULL,NULL,0,1,0),(792,1,1,1,'Accounts',' Quis enim potest ea, quae probabilia videantur ei, non probare? Si longus, levis dictata sunt. Hi curatione adhibita levantur in dies, valet alter plus cotidie, alter videt. Non enim, si omnia non sequebatur, idcirco non erat ortus illinc. Duo Reges: constructio interrete. Ab hoc autem quaedam non melius quam veteres, quaedam omnino relicta. \n\n','2016-02-14 22:02:14','2016-02-14 22:58:42',NULL,NULL,0,1,0),(793,1,1,1,'Accounts',' Quod autem in homine praestantissimum atque optimum est, id deseruit. Sed quia studebat laudi et dignitati, multum in virtute processerat. Quamquam tu hanc copiosiorem etiam soles dicere. Ergo hoc quidem apparet, nos ad agendum esse natos. Quia nec honesto quic quam honestius nec turpi turpius. Quis animo aequo videt eum, quem inpure ac flagitiose putet vivere? Is es profecto tu. Nam si amitti vita beata potest, beata esse non potest. Duo Reges: constructio interrete. \n\n','2016-02-14 22:02:15','2016-02-14 22:58:43',NULL,NULL,0,1,0),(794,1,1,1,'Accounts',' Igitur neque stultorum quisquam beatus neque sapientium non beatus. Sine ea igitur iucunde negat posse se vivere? \n\n','2016-02-14 22:02:16','2016-02-14 22:58:43',NULL,NULL,0,1,0),(795,1,1,1,'Accounts',' Non est igitur summum malum dolor. Et non ex maxima parte de tota iudicabis? Bestiarum vero nullum iudicium puto. Cetera illa adhibebat, quibus demptis negat se Epicurus intellegere quid sit bonum. \n\n','2016-02-14 22:02:17','2016-02-14 22:58:43',NULL,NULL,0,1,0),(796,1,1,1,'Accounts',' Quod ea non occurrentia fingunt, vincunt Aristonem; Duo Reges: constructio interrete. Nam Pyrrho, Aristo, Erillus iam diu abiecti. \n\n','2016-02-14 22:02:17','2016-02-14 22:58:44',NULL,NULL,0,1,0),(797,1,1,1,'Accounts',' Quamquam te quidem video minime esse deterritum. Duo Reges: constructio interrete. Itaque hic ipse iam pridem est reiectus; An potest, inquit ille, quicquam esse suavius quam nihil dolere? \n\n','2016-02-14 22:02:18','2016-02-14 22:58:44',NULL,NULL,0,1,0),(798,1,1,1,'Accounts',' Post enim Chrysippum eum non sane est disputatum. Quae quo sunt excelsiores, eo dant clariora indicia naturae. Nam bonum ex quo appellatum sit, nescio, praepositum ex eo credo, quod praeponatur aliis. Negat esse eam, inquit, propter se expetendam. Duo Reges: constructio interrete. Nam et complectitur verbis, quod vult, et dicit plane, quod intellegam; Quae cum dixisset paulumque institisset, Quid est? \n\n','2016-02-14 22:02:19','2016-02-14 22:58:45',NULL,NULL,0,1,0),(799,1,1,1,'Accounts',' Si sapiens, ne tum quidem miser, cum ab Oroete, praetore Darei, in crucem actus est. Equidem, sed audistine modo de Carneade? Primum divisit ineleganter; Aliter enim nosmet ipsos nosse non possumus. Duo Reges: constructio interrete. \n\n','2016-02-14 22:02:20','2016-02-14 22:58:46',NULL,NULL,0,1,0),(800,1,1,1,'Accounts',' Sed tamen intellego quid velit. Hoc mihi cum tuo fratre convenit. Habent enim et bene longam et satis litigiosam disputationem. Quod idem cum vestri faciant, non satis magnam tribuunt inventoribus gratiam. Que Manilium, ab iisque M. Nam memini etiam quae nolo, oblivisci non possum quae volo. Num igitur eum postea censes anxio animo aut sollicito fuisse? \n\n','2016-02-14 22:02:21','2016-02-14 22:58:46',NULL,NULL,0,1,0),(801,1,1,1,'Accounts',' Ut necesse sit omnium rerum, quae natura vigeant, similem esse finem, non eundem. Eaedem res maneant alio modo. \n\n','2016-02-14 22:02:21','2016-02-14 22:58:47',NULL,NULL,0,1,0),(802,1,1,1,'Accounts',' Vide, ne etiam menses! nisi forte eum dicis, qui, simul atque arripuit, interficit. Tamen a proposito, inquam, aberramus. Utinam quidem dicerent alium alio beatiorem! Iam ruinas videres. \n\n','2016-02-14 22:02:22','2016-02-14 22:58:47',NULL,NULL,0,1,0),(803,1,1,1,'Accounts',' Sed eum qui audiebant, quoad poterant, defendebant sententiam suam. Non autem hoc: igitur ne illud quidem. Eam si varietatem diceres, intellegerem, ut etiam non dicente te intellego; Quid ei reliquisti, nisi te, quoquo modo loqueretur, intellegere, quid diceret? \n\n','2016-02-14 22:02:23','2016-02-14 22:58:47',NULL,NULL,0,1,0),(804,1,1,1,'Accounts',' Eaedem res maneant alio modo. Virtutis, magnitudinis animi, patientiae, fortitudinis fomentis dolor mitigari solet. Oratio me istius philosophi non offendit; Facile est hoc cernere in primis puerorum aetatulis. Itaque vides, quo modo loquantur, nova verba fingunt, deserunt usitata. \n\n','2016-02-14 22:02:24','2016-02-14 22:58:48',NULL,NULL,0,1,0),(805,1,1,1,'Accounts',' Sed ne, dum huic obsequor, vobis molestus sim. Cur igitur, cum de re conveniat, non malumus usitate loqui? Indicant pueri, in quibus ut in speculis natura cernitur. Quorum sine causa fieri nihil putandum est. Duo Reges: constructio interrete. Ut scias me intellegere, primum idem esse dico voluptatem, quod ille don. \n\n','2016-02-14 22:02:25','2016-02-14 22:58:48',NULL,NULL,0,1,0),(806,1,1,1,'Accounts',' Idemne potest esse dies saepius, qui semel fuit? Plane idem, inquit, et maxima quidem, qua fieri nulla maior potest. Videmus igitur ut conquiescere ne infantes quidem possint. Universa enim illorum ratione cum tota vestra confligendum puto. Hic ego: Pomponius quidem, inquam, noster iocari videtur, et fortasse suo iure. Esse enim, nisi eris, non potes. Duo Reges: constructio interrete. \n\n','2016-02-14 22:02:25','2016-02-14 22:58:49',NULL,NULL,0,1,0),(807,1,1,1,'Accounts',' Color egregius, integra valitudo, summa gratia, vita denique conferta voluptatum omnium varietate. Sed tamen intellego quid velit. An potest cupiditas finiri? Quod vestri non item. Quid enim est a Chrysippo praetermissum in Stoicis? Duo Reges: constructio interrete. Sed tamen omne, quod de re bona dilucide dicitur, mihi praeclare dici videtur. Sed erat aequius Triarium aliquid de dissensione nostra iudicare. Aliter enim nosmet ipsos nosse non possumus. Atque haec coniunctio confusioque virtutum tamen a philosophis ratione quadam distinguitur. \n\n','2016-02-14 22:02:26','2016-02-14 22:58:49',NULL,NULL,0,1,0),(808,1,1,1,'Accounts',' Te enim iudicem aequum puto, modo quae dicat ille bene noris. Certe nihil nisi quod possit ipsum propter se iure laudari. Mihi quidem Antiochum, quem audis, satis belle videris attendere. At multis se probavit. Duo Reges: constructio interrete. Illa sunt similia: hebes acies est cuipiam oculorum, corpore alius senescit; \n\n','2016-02-14 22:02:27','2016-02-14 22:58:50',NULL,NULL,0,1,0),(809,1,1,1,'Accounts',' Quodcumque in mentem incideret, et quodcumque tamquam occurreret. Sint modo partes vitae beatae. Quod autem principium officii quaerunt, melius quam Pyrrho; Nam aliquando posse recte fieri dicunt nulla expectata nec quaesita voluptate. Urgent tamen et nihil remittunt. Summus dolor plures dies manere non potest? \n\n','2016-02-14 22:02:27','2016-02-14 22:58:50',NULL,NULL,0,1,0),(810,1,1,1,'Accounts',' Non igitur bene. Quo modo? Sin laboramus, quis est, qui alienae modum statuat industriae? Quod autem principium officii quaerunt, melius quam Pyrrho; Dicimus aliquem hilare vivere; Ut enim consuetudo loquitur, id solum dicitur honestum, quod est populari fama gloriosum. Duo Reges: constructio interrete. Graece donan, Latine voluptatem vocant. Non laboro, inquit, de nomine. Idcirco enim non desideraret, quia, quod dolore caret, id in voluptate est. \n\n','2016-02-14 22:02:28','2016-02-14 22:58:50',NULL,NULL,0,1,0),(811,1,1,1,'Accounts',' Itaque primos congressus copulationesque et consuetudinum instituendarum voluntates fieri propter voluptatem; Itaque his sapiens semper vacabit. Duo Reges: constructio interrete. Illud quaero, quid ei, qui in voluptate summum bonum ponat, consentaneum sit dicere. Primum cur ista res digna odio est, nisi quod est turpis? Eam stabilem appellas. \n\n','2016-02-14 22:02:29','2016-02-14 22:58:51',NULL,NULL,0,1,0),(812,1,1,1,'Accounts',' Quacumque enim ingredimur, in aliqua historia vestigium ponimus. Nam ante Aristippus, et ille melius. Duo Reges: constructio interrete. Istic sum, inquit. Si de re disceptari oportet, nulla mihi tecum, Cato, potest esse dissensio. Omnis enim est natura diligens sui. \n\n','2016-02-14 22:02:29','2016-02-14 22:58:51',NULL,NULL,0,1,0),(813,1,1,1,'Accounts',' Cur igitur, inquam, res tam dissimiles eodem nomine appellas? Quis est tam dissimile homini. Quodsi ipsam honestatem undique pertectam atque absolutam. Vitae autem degendae ratio maxime quidem illis placuit quieta. Qui non moveatur et offensione turpitudinis et comprobatione honestatis? Duo Reges: constructio interrete. Septem autem illi non suo, sed populorum suffragio omnium nominati sunt. \n\n','2016-02-14 22:02:30','2016-02-14 22:58:52',NULL,NULL,0,1,0),(814,1,1,1,'Accounts',' Nonne videmus quanta perturbatio rerum omnium consequatur, quanta confusio? Quis enim redargueret? Duo Reges: constructio interrete. At cum de plurimis eadem dicit, tum certe de maximis. Sed vos squalidius, illorum vides quam niteat oratio. Negare non possum. Esse enim quam vellet iniquus iustus poterat inpune. Quod mihi quidem visus est, cum sciret, velle tamen confitentem audire Torquatum. \n\n','2016-02-14 22:02:31','2016-02-14 22:58:52',NULL,NULL,0,1,0),(815,1,1,1,'Accounts',' Vitae autem degendae ratio maxime quidem illis placuit quieta. Quamquam in hac divisione rem ipsam prorsus probo, elegantiam desidero. Quae ista amicitia est? Duo Reges: constructio interrete. Quem Tiberina descensio festo illo die tanto gaudio affecit, quanto L. Videmus igitur ut conquiescere ne infantes quidem possint. Nihil opus est exemplis hoc facere longius. Quas enim kakaw Graeci appellant, vitia malo quam malitias nominare. \n\n','2016-02-14 22:02:32','2016-02-14 22:58:53',NULL,NULL,0,1,0),(816,1,1,1,'Accounts',' Primum cur ista res digna odio est, nisi quod est turpis? Si quicquam extra virtutem habeatur in bonis. Vestri haec verecundius, illi fortasse constantius. Duo Reges: constructio interrete. Atqui iste locus est, Piso, tibi etiam atque etiam confirmandus, inquam; Quo tandem modo? \n\n','2016-02-14 22:02:32','2016-02-14 22:58:53',NULL,NULL,0,1,0),(817,1,1,1,'Accounts',' Traditur, inquit, ab Epicuro ratio neglegendi doloris. Duae sunt enim res quoque, ne tu verba solum putes. Teneo, inquit, finem illi videri nihil dolere. Sed quid sentiat, non videtis. Quid de Platone aut de Democrito loquar? Duo Reges: constructio interrete. Illa sunt similia: hebes acies est cuipiam oculorum, corpore alius senescit; Quid igitur, inquit, eos responsuros putas? Primum divisit ineleganter; Vide igitur ne non debeas verbis nostris uti, sententiis tuis. Sed quot homines, tot sententiae; Atque haec ita iustitiae propria sunt, ut sint virtutum reliquarum communia. Quaesita enim virtus est, non quae relinqueret naturam, sed quae tueretur. \n\n','2016-02-14 22:02:33','2016-02-14 22:58:53',NULL,NULL,0,1,0),(818,1,1,1,'Accounts',' Minime vero istorum quidem, inquit. Primum in nostrane potestate est, quid meminerimus? Ego vero volo in virtute vim esse quam maximam; Hic nihil fuit, quod quaereremus. Propter nos enim illam, non propter eam nosmet ipsos diligimus. Duo Reges: constructio interrete. \n\n','2016-02-14 22:02:34','2016-02-14 22:58:54',NULL,NULL,0,1,0),(819,1,1,1,'Accounts',' Qua ex cognitione facilior facta est investigatio rerum occultissimarum. Ut optime, secundum naturam affectum esse possit. Quod autem in homine praestantissimum atque optimum est, id deseruit. Nam aliquando posse recte fieri dicunt nulla expectata nec quaesita voluptate. At ille pellit, qui permulcet sensum voluptate. Semper enim ita adsumit aliquid, ut ea, quae prima dederit, non deserat. \n\n','2016-02-14 22:02:34','2016-02-14 22:58:54',NULL,NULL,0,1,0),(820,1,1,1,'Accounts',' Pauca mutat vel plura sane; Quae animi affectio suum cuique tribuens atque hanc, quam dico. Mihi quidem Antiochum, quem audis, satis belle videris attendere. Quorum altera prosunt, nocent altera. Nam aliquando posse recte fieri dicunt nulla expectata nec quaesita voluptate. \n\n','2016-02-14 22:02:35','2016-02-14 22:58:55',NULL,NULL,0,1,0),(821,1,1,1,'Accounts',' Cur deinde Metrodori liberos commendas? Quae diligentissime contra Aristonem dicuntur a Chryippo. Theophrastus mediocriterne delectat, cum tractat locos ab Aristotele ante tractatos? Ita multo sanguine profuso in laetitia et in victoria est mortuus. Nummus in Croesi divitiis obscuratur, pars est tamen divitiarum. Quod autem meum munus dicis non equidem recuso, sed te adiungo socium. \n\n','2016-02-14 22:02:36','2016-02-14 22:58:55',NULL,NULL,0,1,0),(822,1,1,1,'Accounts',' Sed quae tandem ista ratio est? Ergo id est convenienter naturae vivere, a natura discedere. Ut in geometria, prima si dederis, danda sunt omnia. Bonum negas esse divitias, praeposìtum esse dicis? Duo Reges: constructio interrete. Quid de Platone aut de Democrito loquar? Negat enim summo bono afferre incrementum diem. Nos cum te, M. \n\n','2016-02-14 22:02:36','2016-02-14 22:58:56',NULL,NULL,0,1,0),(823,1,1,1,'Accounts',' Oculorum, inquit Plato, est in nobis sensus acerrimus, quibus sapientiam non cernimus. Plane idem, inquit, et maxima quidem, qua fieri nulla maior potest. Haec para/doca illi, nos admirabilia dicamus. Duo Reges: constructio interrete. Quid enim possumus hoc agere divinius? Duarum enim vitarum nobis erunt instituta capienda. \n\n','2016-02-14 22:02:37','2016-02-14 22:58:56',NULL,NULL,0,1,0),(824,1,1,1,'Accounts',' Sed residamus, inquit, si placet. Scisse enim te quis coarguere possit? Quod autem satis est, eo quicquid accessit, nimium est; Innumerabilia dici possunt in hanc sententiam, sed non necesse est. Huius ego nunc auctoritatem sequens idem faciam. Quamquam ab iis philosophiam et omnes ingenuas disciplinas habemus; \n\n','2016-02-14 22:02:38','2016-02-14 22:58:57',NULL,NULL,0,1,0),(825,1,1,1,'Accounts',' Utinam quidem dicerent alium alio beatiorem! Iam ruinas videres. Materiam vero rerum et copiam apud hos exilem, apud illos uberrimam reperiemus. Quae autem natura suae primae institutionis oblita est? Quare obscurentur etiam haec, quae secundum naturam esse dicimus, in vita beata; Duo Reges: constructio interrete. Quae duo sunt, unum facit. \n\n','2016-02-14 22:02:39','2016-02-14 22:58:57',NULL,NULL,0,1,0),(826,1,1,1,'Accounts',' Sed ille, ut dixi, vitiose. Rhetorice igitur, inquam, nos mavis quam dialectice disputare? Quod totum contra est. Duo Reges: constructio interrete. Quamquam ab iis philosophiam et omnes ingenuas disciplinas habemus; Nec vero alia sunt quaerenda contra Carneadeam illam sententiam. Quae cum dixisset paulumque institisset, Quid est? Suo enim quisque studio maxime ducitur. Huius ego nunc auctoritatem sequens idem faciam. Oratio me istius philosophi non offendit; \n\n','2016-02-14 22:02:39','2016-02-14 22:58:58',NULL,NULL,0,1,0),(827,1,1,1,'Accounts',' Si quicquam extra virtutem habeatur in bonis. Atqui haec patefactio quasi rerum opertarum, cum quid quidque sit aperitur, definitio est. Sed quot homines, tot sententiae; Si longus, levis; Conferam tecum, quam cuique verso rem subicias; Duo Reges: constructio interrete. Expressa vero in iis aetatibus, quae iam confirmatae sunt. \n\n','2016-02-14 22:02:40','2016-02-14 22:58:58',NULL,NULL,0,1,0),(828,1,1,1,'Accounts',' Quae quidem vel cum periculo est quaerenda vobis; Id est enim, de quo quaerimus. Quibusnam praeteritis? Hoc enim constituto in philosophia constituta sunt omnia. Estne, quaeso, inquam, sitienti in bibendo voluptas? Verba tu fingas et ea dicas, quae non sentias? Duo Reges: constructio interrete. Cum id fugiunt, re eadem defendunt, quae Peripatetici, verba. \n\n','2016-02-14 22:02:41','2016-02-14 22:58:59',NULL,NULL,0,1,0),(829,1,1,1,'Accounts',' Aut haec tibi, Torquate, sunt vituperanda aut patrocinium voluptatis repudiandum. Confecta res esset. Quo modo autem optimum, si bonum praeterea nullum est? Ego vero volo in virtute vim esse quam maximam; Si mala non sunt, iacet omnis ratio Peripateticorum. \n\n','2016-02-14 22:02:41','2016-02-14 22:58:59',NULL,NULL,0,1,0),(830,1,1,1,'Accounts',' Longum est enim ad omnia respondere, quae a te dicta sunt. Prioris generis est docilitas, memoria; Cuius ad naturam apta ratio vera illa et summa lex a philosophis dicitur. \n\n','2016-02-14 22:02:42','2016-02-14 22:58:59',NULL,NULL,0,1,0),(831,1,1,1,'Accounts',' Et hunc idem dico, inquieta sed ad virtutes et ad vitia nihil interesse. Conferam tecum, quam cuique verso rem subicias; Terram, mihi crede, ea lanx et maria deprimet. Non quam nostram quidem, inquit Pomponius iocans; \n\n','2016-02-14 22:02:43','2016-02-14 22:59:00',NULL,NULL,0,1,0),(832,1,1,1,'Accounts',' Respondent extrema primis, media utrisque, omnia omnibus. Semper enim ex eo, quod maximas partes continet latissimeque funditur, tota res appellatur. Qui enim existimabit posse se miserum esse beatus non erit. Iam in altera philosophiae parte. Quid enim necesse est, tamquam meretricem in matronarum coetum, sic voluptatem in virtutum concilium adducere? Duo Reges: constructio interrete. At iste non dolendi status non vocatur voluptas. Quid ad utilitatem tantae pecuniae? \n\n','2016-02-14 22:02:43','2016-02-14 22:59:00',NULL,NULL,0,1,0),(833,1,1,1,'Accounts',' Non enim, si omnia non sequebatur, idcirco non erat ortus illinc. Naturales divitias dixit parabiles esse, quod parvo esset natura contenta. Nam Pyrrho, Aristo, Erillus iam diu abiecti. Luxuriam non reprehendit, modo sit vacua infinita cupiditate et timore. Sed id ne cogitari quidem potest quale sit, ut non repugnet ipsum sibi. De ingenio eius in his disputationibus, non de moribus quaeritur. Nihil ad rem! Ne sit sane; Duo Reges: constructio interrete. Indicant pueri, in quibus ut in speculis natura cernitur. \n\n','2016-02-14 22:02:44','2016-02-14 22:59:01',NULL,NULL,0,1,0),(834,1,1,1,'Accounts',' Nosti, credo, illud: Nemo pius est, qui pietatem-; Sic enim censent, oportunitatis esse beate vivere. Deinde prima illa, quae in congressu solemus: Quid tu, inquit, huc? Satisne vobis videor pro meo iure in vestris auribus commentatus? Scaevolam M. Ut scias me intellegere, primum idem esse dico voluptatem, quod ille don. \n\n','2016-02-14 22:02:45','2016-02-14 22:59:01',NULL,NULL,0,1,0),(835,1,1,1,'Accounts',' Stoici scilicet. Quae qui non vident, nihil umquam magnum ac cognitione dignum amaverunt. \n\n','2016-02-14 22:02:46','2016-02-14 22:59:02',NULL,NULL,0,1,0),(836,1,1,1,'Accounts',' Quamquam in hac divisione rem ipsam prorsus probo, elegantiam desidero. Omnes enim iucundum motum, quo sensus hilaretur. Sed quanta sit alias, nunc tantum possitne esse tanta. Vide igitur ne non debeas verbis nostris uti, sententiis tuis. Mihi, inquam, qui te id ipsum rogavi? Me igitur ipsum ames oportet, non mea, si veri amici futuri sumus. \n\n','2016-02-14 22:02:46','2016-02-14 22:59:02',NULL,NULL,0,1,0),(837,1,1,1,'Accounts',' Illum mallem levares, quo optimum atque humanissimum virum, Cn. Itaque rursus eadem ratione, qua sum paulo ante usus, haerebitis. An eum discere ea mavis, quae cum plane perdidiceriti nihil sciat? Qua igitur re ab deo vincitur, si aeternitate non vincitur? \n\n','2016-02-14 22:02:47','2016-02-14 22:59:03',NULL,NULL,0,1,0),(838,1,1,1,'Accounts',' Praeteritis, inquit, gaudeo. Non modo carum sibi quemque, verum etiam vehementer carum esse? Beatus sibi videtur esse moriens. Quae cum ita sint, effectum est nihil esse malum, quod turpe non sit. Bona autem corporis huic sunt, quod posterius posui, similiora. Duo Reges: constructio interrete. \n\n','2016-02-14 22:02:48','2016-02-14 22:59:03',NULL,NULL,0,1,0),(839,1,1,1,'Accounts',' Ergo hoc quidem apparet, nos ad agendum esse natos. Sed in rebus apertissimis nimium longi sumus. Commoda autem et incommoda in eo genere sunt, quae praeposita et reiecta diximus; Sin aliud quid voles, postea. Quamquam haec quidem praeposita recte et reiecta dicere licebit. Non enim iam stirpis bonum quaeret, sed animalis. Duo Reges: constructio interrete. \n\n','2016-02-14 22:02:48','2016-02-14 22:59:03',NULL,NULL,0,1,0),(840,1,1,1,'Accounts',' Sed ego in hoc resisto; Aliter homines, aliter philosophos loqui putas oportere? Gloriosa ostentatio in constituendo summo bono. Negat enim summo bono afferre incrementum diem. Duo Reges: constructio interrete. Nam quibus rebus efficiuntur voluptates, eae non sunt in potestate sapientis. Aliter enim nosmet ipsos nosse non possumus. \n\n','2016-02-14 22:02:49','2016-02-14 22:59:04',NULL,NULL,0,1,0),(841,1,1,1,'Accounts',' Si autem id non concedatur, non continuo vita beata tollitur. Illa sunt similia: hebes acies est cuipiam oculorum, corpore alius senescit; Cur id non ita fit? Duo Reges: constructio interrete. Quam ob rem tandem, inquit, non satisfacit? Ergo hoc quidem apparet, nos ad agendum esse natos. Quamquam tu hanc copiosiorem etiam soles dicere. Quid autem habent admirationis, cum prope accesseris? \n\n','2016-02-14 22:02:50','2016-02-14 22:59:04',NULL,NULL,0,1,0),(842,1,1,1,'Accounts',' Illum mallem levares, quo optimum atque humanissimum virum, Cn. Tu enim ista lenius, hic Stoicorum more nos vexat. Tum Piso: Quoniam igitur aliquid omnes, quid Lucius noster? Sextilio Rufo, cum is rem ad amicos ita deferret, se esse heredem Q. Hoc est vim afferre, Torquate, sensibus, extorquere ex animis cognitiones verborum, quibus inbuti sumus. Sed ad bona praeterita redeamus. Duo Reges: constructio interrete. \n\n','2016-02-14 22:02:51','2016-02-14 22:59:05',NULL,NULL,0,1,0),(843,1,1,1,'Accounts',' Quae diligentissime contra Aristonem dicuntur a Chryippo. Voluptatem cum summum bonum diceret, primum in eo ipso parum vidit, deinde hoc quoque alienum; Introduci enim virtus nullo modo potest, nisi omnia, quae leget quaeque reiciet, unam referentur ad summam. Eadem fortitudinis ratio reperietur. Duo Reges: constructio interrete. Quis enim redargueret? Sed eum qui audiebant, quoad poterant, defendebant sententiam suam. Quid iudicant sensus? At, si voluptas esset bonum, desideraret. Sed tamen enitar et, si minus multa mihi occurrent, non fugiam ista popularia. \n\n','2016-02-14 22:02:52','2016-02-14 22:59:05',NULL,NULL,0,1,0),(844,1,1,1,'Accounts',' Cetera illa adhibebat, quibus demptis negat se Epicurus intellegere quid sit bonum. Quia nec honesto quic quam honestius nec turpi turpius. Putabam equidem satis, inquit, me dixisse. Duo Reges: constructio interrete. Facile est hoc cernere in primis puerorum aetatulis. Ita prorsus, inquam; Mihi enim erit isdem istis fortasse iam utendum. Haec quo modo conveniant, non sane intellego. \n\n','2016-02-14 22:02:53','2016-02-14 22:59:06',NULL,NULL,0,1,0),(845,1,1,1,'Accounts',' Quo modo autem optimum, si bonum praeterea nullum est? Haec quo modo conveniant, non sane intellego. Illud dico, ea, quae dicat, praeclare inter se cohaerere. Ut non sine causa ex iis memoriae ducta sit disciplina. Quae iam oratio non a philosopho aliquo, sed a censore opprimenda est. Duo Reges: constructio interrete. \n\n','2016-02-14 22:02:54','2016-02-14 22:59:06',NULL,NULL,0,1,0),(846,1,1,1,'Accounts',' Ut in geometria, prima si dederis, danda sunt omnia. Sed tamen est aliquid, quod nobis non liceat, liceat illis. Utilitatis causa amicitia est quaesita. His similes sunt omnes, qui virtuti student levantur vitiis, levantur erroribus, nisi forte censes Ti. Claudii libidini, qui tum erat summo ne imperio, dederetur. \n\n','2016-02-14 22:02:54','2016-02-14 22:59:07',NULL,NULL,0,1,0),(847,1,1,1,'Accounts',' Legimus tamen Diogenem, Antipatrum, Mnesarchum, Panaetium, multos alios in primisque familiarem nostrum Posidonium. Ita multa dicunt, quae vix intellegam. Sed tamen omne, quod de re bona dilucide dicitur, mihi praeclare dici videtur. Ergo opifex plus sibi proponet ad formarum quam civis excellens ad factorum pulchritudinem? Duo Reges: constructio interrete. Ita relinquet duas, de quibus etiam atque etiam consideret. \n\n','2016-02-14 22:02:55','2016-02-14 22:59:07',NULL,NULL,0,1,0),(848,1,1,1,'Accounts',' Progredientibus autem aetatibus sensim tardeve potius quasi nosmet ipsos cognoscimus. Itaque eos id agere, ut a se dolores, morbos, debilitates repellant. Ergo illi intellegunt quid Epicurus dicat, ego non intellego? Quem Tiberina descensio festo illo die tanto gaudio affecit, quanto L. Duo Reges: constructio interrete. Quid igitur dubitamus in tota eius natura quaerere quid sit effectum? \n\n','2016-02-14 22:02:56','2016-02-14 22:59:08',NULL,NULL,0,1,0),(849,1,1,1,'Accounts',' De vacuitate doloris eadem sententia erit. Idem iste, inquam, de voluptate quid sentit? Duo Reges: constructio interrete. Videmus igitur ut conquiescere ne infantes quidem possint. Quantum Aristoxeni ingenium consumptum videmus in musicis? Maximas vero virtutes iacere omnis necesse est voluptate dominante. Istam voluptatem, inquit, Epicurus ignorat? Itaque in rebus minime obscuris non multus est apud eos disserendi labor. \n\n','2016-02-14 22:02:57','2016-02-14 22:59:08',NULL,NULL,0,1,0),(850,1,1,1,'Accounts',' Ita ne hoc quidem modo paria peccata sunt. Illud dico, ea, quae dicat, praeclare inter se cohaerere. Nonne igitur tibi videntur, inquit, mala? Cum id fugiunt, re eadem defendunt, quae Peripatetici, verba. Duo Reges: constructio interrete. Expectoque quid ad id, quod quaerebam, respondeas. Sed in rebus apertissimis nimium longi sumus. \n\n','2016-02-14 22:02:57','2016-02-14 22:59:09',NULL,NULL,0,1,0),(851,1,1,1,'Accounts',' Placet igitur tibi, Cato, cum res sumpseris non concessas, ex illis efficere, quod velis? Sed in rebus apertissimis nimium longi sumus. Quibusnam praeteritis? Duo Reges: constructio interrete. An nisi populari fama? Estne, quaeso, inquam, sitienti in bibendo voluptas? Inscite autem medicinae et gubernationis ultimum cum ultimo sapientiae comparatur. \n\n','2016-02-14 22:02:58','2016-02-14 22:59:09',NULL,NULL,0,1,0),(852,1,1,1,'Accounts',' Graecum enim hunc versum nostis omnes-: Suavis laborum est praeteritorum memoria. In qua quid est boni praeter summam voluptatem, et eam sempiternam? Nemo nostrum istius generis asotos iucunde putat vivere. Iubet igitur nos Pythius Apollo noscere nosmet ipsos. Hoc loco tenere se Triarius non potuit. Ut in voluptate sit, qui epuletur, in dolore, qui torqueatur. \n\n','2016-02-14 22:02:59','2016-02-14 22:59:10',NULL,NULL,0,1,0),(853,1,1,1,'Accounts',' An me, inquis, tam amentem putas, ut apud imperitos isto modo loquar? Ergo illi intellegunt quid Epicurus dicat, ego non intellego? Hoc est non modo cor non habere, sed ne palatum quidem. Duo Reges: constructio interrete. Iam id ipsum absurdum, maximum malum neglegi. \n\n','2016-02-14 22:02:59','2016-02-14 22:59:10',NULL,NULL,0,1,0),(854,1,1,1,'Accounts',' Quantum Aristoxeni ingenium consumptum videmus in musicis? Huius, Lyco, oratione locuples, rebus ipsis ielunior. Aut haec tibi, Torquate, sunt vituperanda aut patrocinium voluptatis repudiandum. Idem iste, inquam, de voluptate quid sentit? Duo Reges: constructio interrete. Hoc ne statuam quidem dicturam pater aiebat, si loqui posset. Nunc haec primum fortasse audientis servire debemus. Sed ego in hoc resisto; \n\n','2016-02-14 22:03:00','2016-02-14 22:59:11',NULL,NULL,0,1,0),(855,1,1,1,'Accounts',' Quid, cum fictas fabulas, e quibus utilitas nulla elici potest, cum voluptate legimus? Graecum enim hunc versum nostis omnes-: Suavis laborum est praeteritorum memoria. Potius inflammat, ut coercendi magis quam dedocendi esse videantur. Quo modo autem optimum, si bonum praeterea nullum est? Quamquam ab iis philosophiam et omnes ingenuas disciplinas habemus; Videsne quam sit magna dissensio? Itaque his sapiens semper vacabit. Duo Reges: constructio interrete. \n\n','2016-02-14 22:03:01','2016-02-14 22:59:11',NULL,NULL,0,1,0),(856,1,1,1,'Accounts',' Dolere malum est: in crucem qui agitur, beatus esse non potest. Sed ad bona praeterita redeamus. Sed haec in pueris; Nihil opus est exemplis hoc facere longius. Duo Reges: constructio interrete. Primum quid tu dicis breve? Nam ante Aristippus, et ille melius. Haec quo modo conveniant, non sane intellego. Sed quoniam et advesperascit et mihi ad villam revertendum est, nunc quidem hactenus; Quae cum dixisset paulumque institisset, Quid est? Ne in odium veniam, si amicum destitero tueri. Itaque a sapientia praecipitur se ipsam, si usus sit, sapiens ut relinquat. \n\n','2016-02-14 22:03:02','2016-02-14 22:59:11',NULL,NULL,0,1,0),(857,1,1,1,'Accounts',' Et quidem saepe quaerimus verbum Latinum par Graeco et quod idem valeat; Quam si explicavisset, non tam haesitaret. Ubi ut eam caperet aut quando? Quos nisi redarguimus, omnis virtus, omne decus, omnis vera laus deserenda est. Quae fere omnia appellantur uno ingenii nomine, easque virtutes qui habent, ingeniosi vocantur. Non igitur de improbo, sed de callido improbo quaerimus, qualis Q. Duo Reges: constructio interrete. Sint ista Graecorum; Hoc mihi cum tuo fratre convenit. \n\n','2016-02-14 22:03:02','2016-02-14 22:59:12',NULL,NULL,0,1,0),(858,1,1,1,'Accounts',' Ait enim se, si uratur, Quam hoc suave! dicturum. Bonum incolumis acies: misera caecitas. Erit enim mecum, si tecum erit. Si stante, hoc natura videlicet vult, salvam esse se, quod concedimus; Et quidem, inquit, vehementer errat; Servari enim iustitia nisi a forti viro, nisi a sapiente non potest. In quibus doctissimi illi veteres inesse quiddam caeleste et divinum putaverunt. Duo Reges: constructio interrete. Fatebuntur Stoici haec omnia dicta esse praeclare, neque eam causam Zenoni desciscendi fuisse. Totum autem id externum est, et quod externum, id in casu est. Sed ad haec, nisi molestum est, habeo quae velim. \n\n','2016-02-14 22:03:03','2016-02-14 22:59:12',NULL,NULL,0,1,0),(859,1,1,1,'Accounts',' Quasi ego id curem, quid ille aiat aut neget. Si longus, levis dictata sunt. \n\n','2016-02-14 22:03:04','2016-02-14 22:59:13',NULL,NULL,0,1,0),(860,1,1,1,'Accounts',' Nosti, credo, illud: Nemo pius est, qui pietatem-; Hi curatione adhibita levantur in dies, valet alter plus cotidie, alter videt. Sed quid attinet de rebus tam apertis plura requirere? Comprehensum, quod cognitum non habet? Cuius quidem, quoniam Stoicus fuit, sententia condemnata mihi videtur esse inanitas ista verborum. Sequitur disserendi ratio cognitioque naturae; \n\n','2016-02-14 22:03:05','2016-02-14 22:59:13',NULL,NULL,0,1,0),(861,1,1,1,'Accounts',' Multoque hoc melius nos veriusque quam Stoici. Non potes, nisi retexueris illa. Aliter homines, aliter philosophos loqui putas oportere? \n\n','2016-02-14 22:03:05','2016-02-14 22:59:13',NULL,NULL,0,1,0),(862,1,1,1,'Accounts',' Re mihi non aeque satisfacit, et quidem locis pluribus. Sit enim idem caecus, debilis. Nunc de hominis summo bono quaeritur; Et quidem, Cato, hanc totam copiam iam Lucullo nostro notam esse oportebit; Tum Quintus: Est plane, Piso, ut dicis, inquit. \n\n','2016-02-14 22:03:06','2016-02-14 22:59:14',NULL,NULL,0,1,0),(863,1,1,1,'Accounts',' Satisne ergo pudori consulat, si quis sine teste libidini pareat? Quod autem meum munus dicis non equidem recuso, sed te adiungo socium. Haeret in salebra. Tu vero, inquam, ducas licet, si sequetur; Duo Reges: constructio interrete. Heri, inquam, ludis commissis ex urbe profectus veni ad vesperum. Quid enim de amicitia statueris utilitatis causa expetenda vides. Non igitur bene. \n\n','2016-02-14 22:03:07','2016-02-14 22:59:14',NULL,NULL,0,1,0),(864,1,1,1,'Accounts',' An haec ab eo non dicuntur? Idemne potest esse dies saepius, qui semel fuit? Facile est hoc cernere in primis puerorum aetatulis. Illud dico, ea, quae dicat, praeclare inter se cohaerere. Et quidem, Cato, hanc totam copiam iam Lucullo nostro notam esse oportebit; Duo Reges: constructio interrete. Verba tu fingas et ea dicas, quae non sentias? Omnes enim iucundum motum, quo sensus hilaretur. Cum id quoque, ut cupiebat, audivisset, evelli iussit eam, qua erat transfixus, hastam. \n\n','2016-02-14 22:03:07','2016-02-14 22:59:15',NULL,NULL,0,1,0),(865,1,1,1,'Accounts',' At ille pellit, qui permulcet sensum voluptate. Sed mehercule pergrata mihi oratio tua. Dicet pro me ipsa virtus nec dubitabit isti vestro beato M. Callipho ad virtutem nihil adiunxit nisi voluptatem, Diodorus vacuitatem doloris. Habes, inquam, Cato, formam eorum, de quibus loquor, philosophorum. Duo Reges: constructio interrete. Istam voluptatem, inquit, Epicurus ignorat? Unum est sine dolore esse, alterum cum voluptate. \n\n','2016-02-14 22:03:08','2016-02-14 22:59:15',NULL,NULL,0,1,0),(866,1,1,1,'Accounts',' Fatebuntur Stoici haec omnia dicta esse praeclare, neque eam causam Zenoni desciscendi fuisse. Tecum optime, deinde etiam cum mediocri amico. Et ais, si una littera commota sit, fore tota ut labet disciplina. Quid de Platone aut de Democrito loquar? Etenim semper illud extra est, quod arte comprehenditur. Duo Reges: constructio interrete. \n\n','2016-02-14 22:03:09','2016-02-14 22:59:15',NULL,NULL,0,1,0),(867,1,1,1,'Accounts',' Tu autem, si tibi illa probabantur, cur non propriis verbis ea tenebas? Tu enim ista lenius, hic Stoicorum more nos vexat. Negat enim summo bono afferre incrementum diem. Quare conare, quaeso. Duo Reges: constructio interrete. Primum divisit ineleganter; Non autem hoc: igitur ne illud quidem. Cur post Tarentum ad Archytam? Hinc ceteri particulas arripere conati suam quisque videro voluit afferre sententiam. \n\n','2016-02-14 22:03:10','2016-02-14 22:59:16',NULL,NULL,0,1,0),(868,1,1,1,'Accounts',' Traditur, inquit, ab Epicuro ratio neglegendi doloris. Quid, si etiam iucunda memoria est praeteritorum malorum? Summus dolor plures dies manere non potest? Quae diligentissime contra Aristonem dicuntur a Chryippo. Semper enim ex eo, quod maximas partes continet latissimeque funditur, tota res appellatur. Quippe: habes enim a rhetoribus; Duo Reges: constructio interrete. Te enim iudicem aequum puto, modo quae dicat ille bene noris. Estne, quaeso, inquam, sitienti in bibendo voluptas? Nunc omni virtuti vitium contrario nomine opponitur. \n\n','2016-02-14 22:03:10','2016-02-14 22:59:16',NULL,NULL,0,1,0),(869,1,1,1,'Accounts',' Et nemo nimium beatus est; Idemne, quod iucunde? Non autem hoc: igitur ne illud quidem. Rapior illuc, revocat autem Antiochus, nec est praeterea, quem audiamus. \n\n','2016-02-14 22:03:11','2016-02-14 22:59:17',NULL,NULL,0,1,0),(870,1,1,1,'Accounts',' Uterque enim summo bono fruitur, id est voluptate. Nam si amitti vita beata potest, beata esse non potest. Duo Reges: constructio interrete. Sed tamen omne, quod de re bona dilucide dicitur, mihi praeclare dici videtur. Tecum optime, deinde etiam cum mediocri amico. Omnes enim iucundum motum, quo sensus hilaretur. Cur tantas regiones barbarorum pedibus obiit, tot maria transmisit? Quamquam te quidem video minime esse deterritum. \n\n','2016-02-14 22:03:12','2016-02-14 22:59:18',NULL,NULL,0,1,0),(871,1,1,1,'Accounts',' Nam ista vestra: Si gravis, brevis; Nummus in Croesi divitiis obscuratur, pars est tamen divitiarum. Duo Reges: constructio interrete. Cui Tubuli nomen odio non est? Igitur neque stultorum quisquam beatus neque sapientium non beatus. Philosophi autem in suis lectulis plerumque moriuntur. \n\n','2016-02-14 22:03:12','2016-02-14 22:59:18',NULL,NULL,0,1,0),(872,1,1,1,'Accounts',' Satis est ad hoc responsum. Amicitiam autem adhibendam esse censent, quia sit ex eo genere, quae prosunt. Duo Reges: constructio interrete. Deinde prima illa, quae in congressu solemus: Quid tu, inquit, huc? Hoc mihi cum tuo fratre convenit. Omnia contraria, quos etiam insanos esse vultis. Haec et tu ita posuisti, et verba vestra sunt. \n\n','2016-02-14 22:03:13','2016-02-14 22:59:19',NULL,NULL,0,1,0),(873,1,1,1,'Accounts',' Summum ením bonum exposuit vacuitatem doloris; Nam quibus rebus efficiuntur voluptates, eae non sunt in potestate sapientis. Si quae forte-possumus. Aut haec tibi, Torquate, sunt vituperanda aut patrocinium voluptatis repudiandum. Zenonis est, inquam, hoc Stoici. Habent enim et bene longam et satis litigiosam disputationem. Nec lapathi suavitatem acupenseri Galloni Laelius anteponebat, sed suavitatem ipsam neglegebat; \n\n','2016-02-14 22:03:14','2016-02-14 22:59:19',NULL,NULL,0,1,0),(874,1,1,1,'Accounts',' Quod quidem iam fit etiam in Academia. Quae animi affectio suum cuique tribuens atque hanc, quam dico. \n\n','2016-02-14 22:03:15','2016-02-14 22:59:19',NULL,NULL,0,1,0),(875,1,1,1,'Accounts',' Comprehensum, quod cognitum non habet? Alterum significari idem, ut si diceretur, officia media omnia aut pleraque servantem vivere. An potest cupiditas finiri? Quos nisi redarguimus, omnis virtus, omne decus, omnis vera laus deserenda est. Vide, quaeso, rectumne sit. Itaque fecimus. Quis enim potest ea, quae probabilia videantur ei, non probare? Duo Reges: constructio interrete. \n\n','2016-02-14 22:03:15','2016-02-14 22:59:20',NULL,NULL,0,1,0),(876,1,1,1,'Accounts',' Nunc de hominis summo bono quaeritur; Ne in odium veniam, si amicum destitero tueri. An vero, inquit, quisquam potest probare, quod perceptfum, quod. Quo plebiscito decreta a senatu est consuli quaestio Cn. Illud non continuo, ut aeque incontentae. Summus dolor plures dies manere non potest? Duo Reges: constructio interrete. \n\n','2016-02-14 22:03:16','2016-02-14 22:59:20',NULL,NULL,0,1,0),(877,1,1,1,'Accounts',' Idemne potest esse dies saepius, qui semel fuit? Qui enim voluptatem ipsam contemnunt, iis licet dicere se acupenserem maenae non anteponere. Sed quanta sit alias, nunc tantum possitne esse tanta. Quid ergo attinet gloriose loqui, nisi constanter loquare? Mihi quidem Antiochum, quem audis, satis belle videris attendere. Duo Reges: constructio interrete. Nam et complectitur verbis, quod vult, et dicit plane, quod intellegam; Ipse Epicurus fortasse redderet, ut Sextus Peducaeus, Sex. Aliter homines, aliter philosophos loqui putas oportere? \n\n','2016-02-14 22:03:17','2016-02-14 22:59:21',NULL,NULL,0,1,0),(878,1,1,1,'Accounts',' His singulis copiose responderi solet, sed quae perspicua sunt longa esse non debent. Aliter enim nosmet ipsos nosse non possumus. Satis est tibi in te, satis in legibus, satis in mediocribus amicitiis praesidii. Quare ad ea primum, si videtur; Duo Reges: constructio interrete. An hoc usque quaque, aliter in vita? Ad quorum et cognitionem et usum iam corroborati natura ipsa praeeunte deducimur. Bona autem corporis huic sunt, quod posterius posui, similiora. Sin laboramus, quis est, qui alienae modum statuat industriae? \n\n','2016-02-14 22:03:17','2016-02-14 22:59:21',NULL,NULL,0,1,0),(879,1,1,1,'Accounts',' Semper enim ex eo, quod maximas partes continet latissimeque funditur, tota res appellatur. Nec lapathi suavitatem acupenseri Galloni Laelius anteponebat, sed suavitatem ipsam neglegebat; Iis igitur est difficilius satis facere, qui se Latina scripta dicunt contemnere. At enim hic etiam dolore. Duo Reges: constructio interrete. Igitur neque stultorum quisquam beatus neque sapientium non beatus. Istam voluptatem perpetuam quis potest praestare sapienti? Mihi enim satis est, ipsis non satis. Cuius ad naturam apta ratio vera illa et summa lex a philosophis dicitur. Sed ego in hoc resisto; \n\n','2016-02-14 22:03:18','2016-02-14 22:59:22',NULL,NULL,0,1,0),(880,1,1,1,'Accounts',' A mene tu? At iam decimum annum in spelunca iacet. Itaque primos congressus copulationesque et consuetudinum instituendarum voluntates fieri propter voluptatem; Duo Reges: constructio interrete. Sed quoniam et advesperascit et mihi ad villam revertendum est, nunc quidem hactenus; Obsecro, inquit, Torquate, haec dicit Epicurus? Expectoque quid ad id, quod quaerebam, respondeas. Hic ambiguo ludimur. Negat enim summo bono afferre incrementum diem. Huius, Lyco, oratione locuples, rebus ipsis ielunior. Quid ergo attinet gloriose loqui, nisi constanter loquare? \n\n','2016-02-14 22:03:19','2016-02-14 22:59:22',NULL,NULL,0,1,0),(881,1,1,1,'Accounts',' Rhetorice igitur, inquam, nos mavis quam dialectice disputare? Ut alios omittam, hunc appello, quem ille unum secutus est. Quantum Aristoxeni ingenium consumptum videmus in musicis? Transfer idem ad modestiam vel temperantiam, quae est moderatio cupiditatum rationi oboediens. Duo Reges: constructio interrete. Hoc non est positum in nostra actione. Ita multo sanguine profuso in laetitia et in victoria est mortuus. Sed fac ista esse non inportuna; \n\n','2016-02-14 22:03:20','2016-02-14 22:59:22',NULL,NULL,0,1,0),(882,1,1,1,'Accounts',' Sed videbimus. Consequens enim est et post oritur, ut dixi. Immo alio genere; Quid nunc honeste dicit? \n\n','2016-02-14 22:03:20','2016-02-14 22:59:23',NULL,NULL,0,1,0),(883,1,1,1,'Accounts',' Hic ambiguo ludimur. Itaque quantum adiit periculum! ad honestatem enim illum omnem conatum suum referebat, non ad voluptatem. Nemo igitur esse beatus potest. At ille pellit, qui permulcet sensum voluptate. Sin te auctoritas commovebat, nobisne omnibus et Platoni ipsi nescio quem illum anteponebas? Tum mihi Piso: Quid ergo? Eam stabilem appellas. Duo Reges: constructio interrete. \n\n','2016-02-14 22:03:21','2016-02-14 22:59:23',NULL,NULL,0,1,0),(884,1,1,1,'Accounts',' Ad corpus diceres pertinere-, sed ea, quae dixi, ad corpusne refers? Conferam tecum, quam cuique verso rem subicias; Ad eas enim res ab Epicuro praecepta dantur. Duo Reges: constructio interrete. Quae diligentissime contra Aristonem dicuntur a Chryippo. Quamquam haec quidem praeposita recte et reiecta dicere licebit. Si est nihil nisi corpus, summa erunt illa: valitudo, vacuitas doloris, pulchritudo, cetera. Hoc ipsum elegantius poni meliusque potuit. Quem si tenueris, non modo meum Ciceronem, sed etiam me ipsum abducas licebit. Itaque contra est, ac dicitis; Utilitatis causa amicitia est quaesita. Gerendus est mos, modo recte sentiat. \n\n','2016-02-14 22:03:22','2016-02-14 22:59:24',NULL,NULL,0,1,0),(885,1,1,1,'Accounts',' Tecum optime, deinde etiam cum mediocri amico. Sed quid minus probandum quam esse aliquem beatum nec satis beatum? Mihi vero, inquit, placet agi subtilius et, ut ipse dixisti, pressius. \n\n','2016-02-14 22:03:22','2016-02-14 22:59:24',NULL,NULL,0,1,0),(886,1,1,1,'Accounts',' Quodsi ipsam honestatem undique pertectam atque absolutam. Ita multo sanguine profuso in laetitia et in victoria est mortuus. Habes, inquam, Cato, formam eorum, de quibus loquor, philosophorum. Quae cum essent dicta, finem fecimus et ambulandi et disputandi. Duo Reges: constructio interrete. Ego vero isti, inquam, permitto. Ita graviter et severe voluptatem secrevit a bono. Primum in nostrane potestate est, quid meminerimus? \n\n','2016-02-14 22:03:23','2016-02-14 22:59:25',NULL,NULL,0,1,0),(887,1,1,1,'Accounts',' Non igitur de improbo, sed de callido improbo quaerimus, qualis Q. A primo, ut opinor, animantium ortu petitur origo summi boni. Illud quaero, quid ei, qui in voluptate summum bonum ponat, consentaneum sit dicere. Maximas vero virtutes iacere omnis necesse est voluptate dominante. Cum autem in quo sapienter dicimus, id a primo rectissime dicitur. Nemo igitur esse beatus potest. Ad eas enim res ab Epicuro praecepta dantur. Duo Reges: constructio interrete. Sed tamen intellego quid velit. Est enim effectrix multarum et magnarum voluptatum. \n\n','2016-02-14 22:03:24','2016-02-14 22:59:25',NULL,NULL,0,1,0),(888,1,1,1,'Accounts',' Duo Reges: constructio interrete. Igitur ne dolorem quidem. Quam nemo umquam voluptatem appellavit, appellat; At coluit ipse amicitias. Teneo, inquit, finem illi videri nihil dolere. Quem si tenueris, non modo meum Ciceronem, sed etiam me ipsum abducas licebit. Qui convenit? Illud non continuo, ut aeque incontentae. \n\n','2016-02-14 22:03:25','2016-02-14 22:59:25',NULL,NULL,0,1,0),(889,1,1,1,'Accounts',' Primum in nostrane potestate est, quid meminerimus? Itaque his sapiens semper vacabit. Tum Piso: Quoniam igitur aliquid omnes, quid Lucius noster? Sic, et quidem diligentius saepiusque ista loquemur inter nos agemusque communiter. Si quicquam extra virtutem habeatur in bonis. Ergo instituto veterum, quo etiam Stoici utuntur, hinc capiamus exordium. \n\n','2016-02-14 22:03:25','2016-02-14 22:59:26',NULL,NULL,0,1,0),(890,1,1,1,'Accounts',' Illa sunt similia: hebes acies est cuipiam oculorum, corpore alius senescit; An hoc usque quaque, aliter in vita? Igitur neque stultorum quisquam beatus neque sapientium non beatus. Traditur, inquit, ab Epicuro ratio neglegendi doloris. Aliter homines, aliter philosophos loqui putas oportere? Quod si ita sit, cur opera philosophiae sit danda nescio. Duo Reges: constructio interrete. Sic, et quidem diligentius saepiusque ista loquemur inter nos agemusque communiter. \n\n','2016-02-14 22:03:26','2016-02-14 22:59:26',NULL,NULL,0,1,0),(891,1,1,1,'Accounts',' Nondum autem explanatum satis, erat, quid maxime natura vellet. Bonum negas esse divitias, praeposìtum esse dicis? Ex quo, id quod omnes expetunt, beate vivendi ratio inveniri et comparari potest. Inde sermone vario sex illa a Dipylo stadia confecimus. Illa videamus, quae a te de amicitia dicta sunt. Illa argumenta propria videamus, cur omnia sint paria peccata. Dolere malum est: in crucem qui agitur, beatus esse non potest. Duo Reges: constructio interrete. Nemo igitur esse beatus potest. \n\n','2016-02-14 22:03:27','2016-02-14 22:59:27',NULL,NULL,0,1,0),(892,1,1,1,'Accounts',' Non enim quaero quid verum, sed quid cuique dicendum sit. Rapior illuc, revocat autem Antiochus, nec est praeterea, quem audiamus. Quid ergo attinet gloriose loqui, nisi constanter loquare? Illi enim inter se dissentiunt. Huius ego nunc auctoritatem sequens idem faciam. Tu vero, inquam, ducas licet, si sequetur; \n\n','2016-02-14 22:03:27','2016-02-14 22:59:27',NULL,NULL,0,1,0),(893,1,1,1,'Accounts',' Sed haec quidem liberius ab eo dicuntur et saepius. Quem si tenueris, non modo meum Ciceronem, sed etiam me ipsum abducas licebit. Quantum Aristoxeni ingenium consumptum videmus in musicis? Bonum integritas corporis: misera debilitas. Quamquam id quidem licebit iis existimare, qui legerint. \n\n','2016-02-14 22:03:28','2016-02-14 22:59:28',NULL,NULL,0,1,0),(894,1,1,1,'Accounts',' Sed virtutem ipsam inchoavit, nihil amplius. Tum mihi Piso: Quid ergo? Sed fortuna fortis; Sed tamen est aliquid, quod nobis non liceat, liceat illis. Ut pulsi recurrant? Non minor, inquit, voluptas percipitur ex vilissimis rebus quam ex pretiosissimis. At iste non dolendi status non vocatur voluptas. Duo Reges: constructio interrete. Haec quo modo conveniant, non sane intellego. Si enim ad populum me vocas, eum. Ego quoque, inquit, didicerim libentius si quid attuleris, quam te reprehenderim. \n\n','2016-02-14 22:03:29','2016-02-14 22:59:28',NULL,NULL,0,1,0),(895,1,1,1,'Accounts',' Eadem nunc mea adversum te oratio est. Hoc etsi multimodis reprehendi potest, tamen accipio, quod dant. \n\n','2016-02-14 22:03:30','2016-02-14 22:59:29',NULL,NULL,0,1,0),(896,1,1,1,'Accounts',' Quid ergo aliud intellegetur nisi uti ne quae pars naturae neglegatur? Qua ex cognitione facilior facta est investigatio rerum occultissimarum. Laelius clamores sofòw ille so lebat Edere compellans gumias ex ordine nostros. Addidisti ad extremum etiam indoctum fuisse. Te ipsum, dignissimum maioribus tuis, voluptasne induxit, ut adolescentulus eriperes P. Duo Reges: constructio interrete. Sed residamus, inquit, si placet. \n\n','2016-02-14 22:03:30','2016-02-14 22:59:29',NULL,NULL,0,1,0),(897,1,1,1,'Accounts',' Sed quot homines, tot sententiae; Hoc mihi cum tuo fratre convenit. Aliter autem vobis placet. Duo Reges: constructio interrete. Hoc sic expositum dissimile est superiori. Aliter homines, aliter philosophos loqui putas oportere? \n\n','2016-02-14 22:03:31','2016-02-14 22:59:30',NULL,NULL,0,1,0),(898,1,1,1,'Accounts',' Ego vero volo in virtute vim esse quam maximam; Sed haec quidem liberius ab eo dicuntur et saepius. Quis enim redargueret? Duo enim genera quae erant, fecit tria. Quo modo autem optimum, si bonum praeterea nullum est? Disserendi artem nullam habuit. \n\n','2016-02-14 22:03:32','2016-02-14 22:59:30',NULL,NULL,0,1,0),(899,1,1,1,'Accounts',' Paria sunt igitur. Quasi ego id curem, quid ille aiat aut neget. Quis istud possit, inquit, negare? Itaque contra est, ac dicitis; \n\n','2016-02-14 22:03:32','2016-02-14 22:59:31',NULL,NULL,0,1,0),(900,1,1,1,'Accounts',' Cur tantas regiones barbarorum pedibus obiit, tot maria transmisit? Quid in isto egregio tuo officio et tanta fide-sic enim existimo-ad corpus refers? Mihi quidem Antiochum, quem audis, satis belle videris attendere. Si verbum sequimur, primum longius verbum praepositum quam bonum. In qua quid est boni praeter summam voluptatem, et eam sempiternam? Duo Reges: constructio interrete. Tu autem negas fortem esse quemquam posse, qui dolorem malum putet. Claudii libidini, qui tum erat summo ne imperio, dederetur. \n\n','2016-02-14 22:03:33','2016-02-14 22:59:31',NULL,NULL,0,1,0),(901,1,1,1,'Accounts',' Varietates autem iniurasque fortunae facile veteres philosophorum praeceptis instituta vita superabat. Duo Reges: constructio interrete. Non ego tecum iam ita iocabor, ut isdem his de rebus, cum L. Gloriosa ostentatio in constituendo summo bono. Illa tamen simplicia, vestra versuta. Non dolere, inquam, istud quam vim habeat postea videro; \n\n','2016-02-14 22:03:34','2016-02-14 22:59:32',NULL,NULL,0,1,0),(902,1,1,1,'Accounts',' Totum autem id externum est, et quod externum, id in casu est. Ergo hoc quidem apparet, nos ad agendum esse natos. Octavio fuit, cum illam severitatem in eo filio adhibuit, quem in adoptionem D. Ut optime, secundum naturam affectum esse possit. Duo Reges: constructio interrete. Nam Pyrrho, Aristo, Erillus iam diu abiecti. Et quidem, inquit, vehementer errat; Quid est, quod ab ea absolvi et perfici debeat? De ingenio eius in his disputationibus, non de moribus quaeritur. \n\n','2016-02-14 22:03:35','2016-02-14 22:59:32',NULL,NULL,0,1,0),(903,1,1,1,'Accounts',' Sin tantum modo ad indicia veteris memoriae cognoscenda, curiosorum. Numquam facies. Mihi, inquam, qui te id ipsum rogavi? Videsne quam sit magna dissensio? \n\n','2016-02-14 22:03:35','2016-02-14 22:59:33',NULL,NULL,0,1,0),(904,1,1,1,'Accounts',' Et ille ridens: Video, inquit, quid agas; Quae autem natura suae primae institutionis oblita est? Ergo adhuc, quantum equidem intellego, causa non videtur fuisse mutandi nominis. Duo Reges: constructio interrete. Sed ad rem redeamus; Itaque nostrum est-quod nostrum dico, artis est-ad ea principia, quae accepimus. Minime vero istorum quidem, inquit. Illa tamen simplicia, vestra versuta. Quid sequatur, quid repugnet, vident. Aliter homines, aliter philosophos loqui putas oportere? Levatio igitur vitiorum magna fit in iis, qui habent ad virtutem progressionis aliquantum. Poterat autem inpune; Sed quanta sit alias, nunc tantum possitne esse tanta. \n\n','2016-02-14 22:03:36','2016-02-14 22:59:33',NULL,NULL,0,1,0),(905,1,1,1,'Accounts',' Quae autem natura suae primae institutionis oblita est? Istam voluptatem perpetuam quis potest praestare sapienti? Non igitur potestis voluptate omnia dirigentes aut tueri aut retinere virtutem. Duo Reges: constructio interrete. Nos commodius agimus. Quid enim de amicitia statueris utilitatis causa expetenda vides. Est enim effectrix multarum et magnarum voluptatum. Nec mihi illud dixeris: Haec enim ipsa mihi sunt voluptati, et erant illa Torquatis. Qui est in parvis malis. Maximus dolor, inquit, brevis est. \n\n','2016-02-14 22:03:37','2016-02-14 22:59:34',NULL,NULL,0,1,0),(906,1,1,1,'Accounts',' Hoc est dicere: Non reprehenderem asotos, si non essent asoti. Sed vos squalidius, illorum vides quam niteat oratio. Si enim ita est, vide ne facinus facias, cum mori suadeas. Ego vero isti, inquam, permitto. Ita fit cum gravior, tum etiam splendidior oratio. Inde igitur, inquit, ordiendum est. \n\n','2016-02-14 22:03:37','2016-02-14 22:59:34',NULL,NULL,0,1,0),(907,1,1,1,'Accounts',' Cum id fugiunt, re eadem defendunt, quae Peripatetici, verba. Sic, et quidem diligentius saepiusque ista loquemur inter nos agemusque communiter. Tum mihi Piso: Quid ergo? Erit enim mecum, si tecum erit. Duo Reges: constructio interrete. \n\n','2016-02-14 22:03:38','2016-02-14 22:59:34',NULL,NULL,0,1,0),(908,1,1,1,'Accounts',' Negat enim summo bono afferre incrementum diem. Quod quidem iam fit etiam in Academia. Vide, quantum, inquam, fallare, Torquate. Non est ista, inquam, Piso, magna dissensio. Color egregius, integra valitudo, summa gratia, vita denique conferta voluptatum omnium varietate. Igitur ne dolorem quidem. Duo Reges: constructio interrete. Verum hoc loco sumo verbis his eandem certe vim voluptatis Epicurum nosse quam ceteros. Sed ille, ut dixi, vitiose. Nec tamen ille erat sapiens quis enim hoc aut quando aut ubi aut unde? Ratio quidem vestra sic cogit. Sed fac ista esse non inportuna; \n\n','2016-02-14 22:03:39','2016-02-14 22:59:35',NULL,NULL,0,1,0),(909,1,1,1,'Accounts',' Non minor, inquit, voluptas percipitur ex vilissimis rebus quam ex pretiosissimis. Itaque hic ipse iam pridem est reiectus; Conferam tecum, quam cuique verso rem subicias; Nam diligi et carum esse iucundum est propterea, quia tutiorem vitam et voluptatem pleniorem efficit. Sed haec quidem liberius ab eo dicuntur et saepius. Duo Reges: constructio interrete. \n\n','2016-02-14 22:03:40','2016-02-14 22:59:35',NULL,NULL,0,1,0),(910,1,1,1,'Accounts',' Si quicquam extra virtutem habeatur in bonis. Satis est ad hoc responsum. Quid, quod homines infima fortuna, nulla spe rerum gerendarum, opifices denique delectantur historia? Duo Reges: constructio interrete. Tubulo putas dicere? Nam aliquando posse recte fieri dicunt nulla expectata nec quaesita voluptate. Cur post Tarentum ad Archytam? Ut in geometria, prima si dederis, danda sunt omnia. Eorum enim omnium multa praetermittentium, dum eligant aliquid, quod sequantur, quasi curta sententia; Hoc etsi multimodis reprehendi potest, tamen accipio, quod dant. \n\n','2016-02-14 22:03:40','2016-02-14 22:59:36',NULL,NULL,0,1,0),(911,1,1,1,'Accounts',' Teneo, inquit, finem illi videri nihil dolere. Hoc ne statuam quidem dicturam pater aiebat, si loqui posset. Verba tu fingas et ea dicas, quae non sentias? An eum discere ea mavis, quae cum plane perdidiceriti nihil sciat? Primum divisit ineleganter; Duo Reges: constructio interrete. Hic quoque suus est de summoque bono dissentiens dici vere Peripateticus non potest. Nunc haec primum fortasse audientis servire debemus. \n\n','2016-02-14 22:03:41','2016-02-14 22:59:36',NULL,NULL,0,1,0),(912,1,1,1,'Accounts',' Qua ex cognitione facilior facta est investigatio rerum occultissimarum. Duo Reges: constructio interrete. Ait enim se, si uratur, Quam hoc suave! dicturum. Scisse enim te quis coarguere possit? An me, inquis, tam amentem putas, ut apud imperitos isto modo loquar? Age nunc isti doceant, vel tu potius quis enim ista melius? Urgent tamen et nihil remittunt. \n\n','2016-02-14 22:03:42','2016-02-14 22:59:37',NULL,NULL,0,1,0),(913,1,1,1,'Accounts',' Igitur ne dolorem quidem. Nonne videmus quanta perturbatio rerum omnium consequatur, quanta confusio? In schola desinis. Nec enim, dum metuit, iustus est, et certe, si metuere destiterit, non erit; Duo Reges: constructio interrete. Iis igitur est difficilius satis facere, qui se Latina scripta dicunt contemnere. Qui non moveatur et offensione turpitudinis et comprobatione honestatis? \n\n','2016-02-14 22:03:42','2016-02-14 22:59:37',NULL,NULL,0,1,0),(914,1,1,1,'Accounts',' Earum etiam rerum, quas terra gignit, educatio quaedam et perfectio est non dissimilis animantium. Praeclare hoc quidem. Sed nonne merninisti licere mihi ista probare, quae sunt a te dicta? Familiares nostros, credo, Sironem dicis et Philodemum, cum optimos viros, tum homines doctissimos. Nunc agendum est subtilius. Etenim semper illud extra est, quod arte comprehenditur. Bonum incolumis acies: misera caecitas. \n\n','2016-02-14 22:03:43','2016-02-14 22:59:38',NULL,NULL,0,1,0),(915,1,1,1,'Accounts',' Hic quoque suus est de summoque bono dissentiens dici vere Peripateticus non potest. Quo tandem modo? Ad eos igitur converte te, quaeso. Est autem etiam actio quaedam corporis, quae motus et status naturae congruentis tenet; Ut proverbia non nulla veriora sint quam vestra dogmata. \n\n','2016-02-14 22:03:44','2016-02-14 22:59:38',NULL,NULL,0,1,0),(916,1,1,1,'Accounts',' Illud quaero, quid ei, qui in voluptate summum bonum ponat, consentaneum sit dicere. Hoc est dicere: Non reprehenderem asotos, si non essent asoti. Primum divisit ineleganter; Quibus ego vehementer assentior. Quarum ambarum rerum cum medicinam pollicetur, luxuriae licentiam pollicetur. Estne, quaeso, inquam, sitienti in bibendo voluptas? \n\n','2016-02-14 22:03:44','2016-02-14 22:59:39',NULL,NULL,0,1,0),(917,1,1,1,'Accounts',' Itaque contra est, ac dicitis; Virtutis, magnitudinis animi, patientiae, fortitudinis fomentis dolor mitigari solet. Qui autem de summo bono dissentit de tota philosophiae ratione dissentit. Hoc ipsum elegantius poni meliusque potuit. Ita nemo beato beatior. \n\n','2016-02-14 22:03:45','2016-02-14 22:59:39',NULL,NULL,0,1,0),(918,1,1,1,'Accounts',' Sed ut iis bonis erigimur, quae expectamus, sic laetamur iis, quae recordamur. Illud dico, ea, quae dicat, praeclare inter se cohaerere. Quacumque enim ingredimur, in aliqua historia vestigium ponimus. Atqui reperies, inquit, in hoc quidem pertinacem; Nos commodius agimus. Duo Reges: constructio interrete. \n\n','2016-02-14 22:03:46','2016-02-14 22:59:40',NULL,NULL,0,1,0),(919,1,1,1,'Accounts',' An eiusdem modi? Tum mihi Piso: Quid ergo? Quid ad utilitatem tantae pecuniae? Sed haec quidem liberius ab eo dicuntur et saepius. Eiuro, inquit adridens, iniquum, hac quidem de re; Facete M. Duo Reges: constructio interrete. Quid enim de amicitia statueris utilitatis causa expetenda vides. Virtutis, magnitudinis animi, patientiae, fortitudinis fomentis dolor mitigari solet. Est autem etiam actio quaedam corporis, quae motus et status naturae congruentis tenet; Quid est igitur, cur ita semper deum appellet Epicurus beatum et aeternum? \n\n','2016-02-14 22:03:47','2016-02-14 22:59:41',NULL,NULL,0,1,0),(920,1,1,1,'Accounts',' Igitur ne dolorem quidem. Neminem videbis ita laudatum, ut artifex callidus comparandarum voluptatum diceretur. Dici enim nihil potest verius. Duo Reges: constructio interrete. Eorum enim est haec querela, qui sibi cari sunt seseque diligunt. \n\n','2016-02-14 22:03:47','2016-02-14 22:59:41',NULL,NULL,0,1,0),(921,1,1,1,'Accounts',' Ut id aliis narrare gestiant? Nam Metrodorum non puto ipsum professum, sed, cum appellaretur ab Epicuro, repudiare tantum beneficium noluisse; Miserum hominem! Si dolor summum malum est, dici aliter non potest. Itaque in rebus minime obscuris non multus est apud eos disserendi labor. Illum mallem levares, quo optimum atque humanissimum virum, Cn. Duo Reges: constructio interrete. Ex quo, id quod omnes expetunt, beate vivendi ratio inveniri et comparari potest. At certe gravius. \n\n','2016-02-14 22:03:48','2016-02-14 22:59:42',NULL,NULL,0,1,0),(922,1,1,1,'Accounts',' Tu vero, inquam, ducas licet, si sequetur; Hoc loco tenere se Triarius non potuit. Cur post Tarentum ad Archytam? Efficiens dici potest. Etsi qui potest intellegi aut cogitari esse aliquod animal, quod se oderit? Duo Reges: constructio interrete. Tum Piso: Quoniam igitur aliquid omnes, quid Lucius noster? Ex ea difficultate illae fallaciloquae, ut ait Accius, malitiae natae sunt. Nunc haec primum fortasse audientis servire debemus. Quod quidem iam fit etiam in Academia. \n\n','2016-02-14 22:03:49','2016-02-14 22:59:42',NULL,NULL,0,1,0),(923,1,1,1,'Accounts',' Levatio igitur vitiorum magna fit in iis, qui habent ad virtutem progressionis aliquantum. Nobis aliter videtur, recte secusne, postea; Duo Reges: constructio interrete. De malis autem et bonis ab iis animalibus, quae nondum depravata sint, ait optime iudicari. \n\n','2016-02-14 22:03:49','2016-02-14 22:59:42',NULL,NULL,0,1,0),(924,1,1,1,'Accounts',' Equidem e Cn. Quae cum magnifice primo dici viderentur, considerata minus probabantur. Ut pulsi recurrant? Sed tempus est, si videtur, et recta quidem ad me. Re mihi non aeque satisfacit, et quidem locis pluribus. \n\n','2016-02-14 22:03:50','2016-02-14 22:59:43',NULL,NULL,0,1,0),(925,1,1,1,'Accounts',' Fatebuntur Stoici haec omnia dicta esse praeclare, neque eam causam Zenoni desciscendi fuisse. Bonum integritas corporis: misera debilitas. Laboro autem non sine causa; Quo modo autem optimum, si bonum praeterea nullum est? Non pugnem cum homine, cur tantum habeat in natura boni; Habes, inquam, Cato, formam eorum, de quibus loquor, philosophorum. Quid iudicant sensus? Duo Reges: constructio interrete. \n\n','2016-02-14 22:03:51','2016-02-14 22:59:43',NULL,NULL,0,1,0),(926,1,1,1,'Accounts',' Hos contra singulos dici est melius. Nam, ut sint illa vendibiliora, haec uberiora certe sunt. Quo plebiscito decreta a senatu est consuli quaestio Cn. \n\n','2016-02-14 22:03:52','2016-02-14 22:59:44',NULL,NULL,0,1,0),(927,1,1,1,'Accounts',' Nummus in Croesi divitiis obscuratur, pars est tamen divitiarum. Roges enim Aristonem, bonane ei videantur haec: vacuitas doloris, divitiae, valitudo; Duo Reges: constructio interrete. Nec lapathi suavitatem acupenseri Galloni Laelius anteponebat, sed suavitatem ipsam neglegebat; Dici enim nihil potest verius. Ita fit cum gravior, tum etiam splendidior oratio. Color egregius, integra valitudo, summa gratia, vita denique conferta voluptatum omnium varietate. Quo modo autem philosophus loquitur? Primum in nostrane potestate est, quid meminerimus? Tecum optime, deinde etiam cum mediocri amico. Unum est sine dolore esse, alterum cum voluptate. Cur post Tarentum ad Archytam? \n\n','2016-02-14 22:03:52','2016-02-14 22:59:44',NULL,NULL,0,1,0),(928,1,1,1,'Accounts',' Cur igitur, cum de re conveniat, non malumus usitate loqui? Animi enim quoque dolores percipiet omnibus partibus maiores quam corporis. Restinguet citius, si ardentem acceperit. Cum id fugiunt, re eadem defendunt, quae Peripatetici, verba. \n\n','2016-02-14 22:03:53','2016-02-14 22:59:45',NULL,NULL,0,1,0),(929,1,1,1,'Accounts',' Qui autem de summo bono dissentit de tota philosophiae ratione dissentit. Recte, inquit, intellegis. Ex eorum enim scriptis et institutis cum omnis doctrina liberalis, omnis historia. An eum discere ea mavis, quae cum plane perdidiceriti nihil sciat? Sed quanta sit alias, nunc tantum possitne esse tanta. Duo Reges: constructio interrete. Neque enim civitas in seditione beata esse potest nec in discordia dominorum domus; Quo tandem modo? \n\n','2016-02-14 22:03:54','2016-02-14 22:59:45',NULL,NULL,0,1,0),(930,1,1,1,'Accounts',' Tollenda est atque extrahenda radicitus. Utrum igitur tibi litteram videor an totas paginas commovere? Duo Reges: constructio interrete. Facile est hoc cernere in primis puerorum aetatulis. Non autem hoc: igitur ne illud quidem. Nondum autem explanatum satis, erat, quid maxime natura vellet. \n\n','2016-02-14 22:03:54','2016-02-14 22:59:45',NULL,NULL,0,1,0),(931,1,1,1,'Accounts',' Quia nec honesto quic quam honestius nec turpi turpius. Duo Reges: constructio interrete. Naturales divitias dixit parabiles esse, quod parvo esset natura contenta. Expectoque quid ad id, quod quaerebam, respondeas. Traditur, inquit, ab Epicuro ratio neglegendi doloris. Apparet statim, quae sint officia, quae actiones. \n\n','2016-02-14 22:03:55','2016-02-14 22:59:46',NULL,NULL,0,1,0),(932,1,1,1,'Accounts',' De hominibus dici non necesse est. Sed quid attinet de rebus tam apertis plura requirere? Cur deinde Metrodori liberos commendas? Scientiam pollicentur, quam non erat mirum sapientiae cupido patria esse cariorem. De quibus cupio scire quid sentias. Quae fere omnia appellantur uno ingenii nomine, easque virtutes qui habent, ingeniosi vocantur. Duo Reges: constructio interrete. Illud urgueam, non intellegere eum quid sibi dicendum sit, cum dolorem summum malum esse dixerit. \n\n','2016-02-14 22:03:56','2016-02-14 22:59:46',NULL,NULL,0,1,0),(933,1,1,1,'Accounts',' Consequentia exquirere, quoad sit id, quod volumus, effectum. Duo Reges: constructio interrete. Cur post Tarentum ad Archytam? Quis enim potest ea, quae probabilia videantur ei, non probare? Que Manilium, ab iisque M. Quo modo? Quid de Platone aut de Democrito loquar? Quae est igitur causa istarum angustiarum? Quo modo autem optimum, si bonum praeterea nullum est? Eadem nunc mea adversum te oratio est. \n\n','2016-02-14 22:03:57','2016-02-14 22:59:47',NULL,NULL,0,1,0),(934,1,1,1,'Accounts',' Ait enim se, si uratur, Quam hoc suave! dicturum. Quod idem cum vestri faciant, non satis magnam tribuunt inventoribus gratiam. Quicquid porro animo cernimus, id omne oritur a sensibus; Duo Reges: constructio interrete. Quae cum dixisset, finem ille. \n\n','2016-02-14 22:03:58','2016-02-14 22:59:47',NULL,NULL,0,1,0),(935,1,1,1,'Accounts',' Qui enim existimabit posse se miserum esse beatus non erit. Quia nec honesto quic quam honestius nec turpi turpius. Haec et tu ita posuisti, et verba vestra sunt. Quae tamen a te agetur non melior, quam illae sunt, quas interdum optines. Duo Reges: constructio interrete. Inde sermone vario sex illa a Dipylo stadia confecimus. Qui autem esse poteris, nisi te amor ipse ceperit? Sed plane dicit quod intellegit. Habes, inquam, Cato, formam eorum, de quibus loquor, philosophorum. Videmusne ut pueri ne verberibus quidem a contemplandis rebus perquirendisque deterreantur? \n\n','2016-02-14 22:03:59','2016-02-14 22:59:48',NULL,NULL,0,1,0),(936,1,1,1,'Accounts',' Apud imperitos tum illa dicta sunt, aliquid etiam coronae datum; Ut id aliis narrare gestiant? Quid enim mihi potest esse optatius quam cum Catone, omnium virtutum auctore, de virtutibus disputare? Nemo igitur esse beatus potest. Expectoque quid ad id, quod quaerebam, respondeas. Sed id ne cogitari quidem potest quale sit, ut non repugnet ipsum sibi. Quo igitur, inquit, modo? Duo Reges: constructio interrete. Nec hoc ille non vidit, sed verborum magnificentia est et gloria delectatus. \n\n','2016-02-14 22:03:59','2016-02-14 22:59:48',NULL,NULL,0,1,0),(937,1,1,1,'Accounts',' Facile est hoc cernere in primis puerorum aetatulis. Age nunc isti doceant, vel tu potius quis enim ista melius? Duo Reges: constructio interrete. Nam Metrodorum non puto ipsum professum, sed, cum appellaretur ab Epicuro, repudiare tantum beneficium noluisse; \n\n','2016-02-14 22:04:00','2016-02-14 22:59:48',NULL,NULL,0,1,0),(938,1,1,1,'Accounts',' Qua ex cognitione facilior facta est investigatio rerum occultissimarum. Quibusnam praeteritis? Sed plane dicit quod intellegit. Quo plebiscito decreta a senatu est consuli quaestio Cn. Duo Reges: constructio interrete. \n\n','2016-02-14 22:04:01','2016-02-14 22:59:49',NULL,NULL,0,1,0),(939,1,1,1,'Accounts',' Qua tu etiam inprudens utebare non numquam. Consequatur summas voluptates non modo parvo, sed per me nihilo, si potest; Age nunc isti doceant, vel tu potius quis enim ista melius? Minime vero istorum quidem, inquit. \n\n','2016-02-14 22:04:01','2016-02-14 22:59:49',NULL,NULL,0,1,0),(940,1,1,1,'Accounts',' Quamquam te quidem video minime esse deterritum. Respondeat totidem verbis. Quid turpius quam sapientis vitam ex insipientium sermone pendere? Est enim effectrix multarum et magnarum voluptatum. Sin aliud quid voles, postea. Duo Reges: constructio interrete. \n\n','2016-02-14 22:04:02','2016-02-14 22:59:50',NULL,NULL,0,1,0),(941,1,1,1,'Accounts',' At certe gravius. Verum tamen cum de rebus grandioribus dicas, ipsae res verba rapiunt; Quod mihi quidem visus est, cum sciret, velle tamen confitentem audire Torquatum. Quae cum dixisset, finem ille. Duo Reges: constructio interrete. Satis est ad hoc responsum. \n\n','2016-02-14 22:04:03','2016-02-14 22:59:50',NULL,NULL,0,1,0),(942,1,1,1,'Accounts',' Falli igitur possumus. Itaque his sapiens semper vacabit. Atque haec coniunctio confusioque virtutum tamen a philosophis ratione quadam distinguitur. Non est igitur voluptas bonum. \n\n','2016-02-14 22:04:04','2016-02-14 22:59:51',NULL,NULL,0,1,0),(943,1,1,1,'Accounts',' An eum discere ea mavis, quae cum plane perdidiceriti nihil sciat? Et nemo nimium beatus est; Quae cum dixisset paulumque institisset, Quid est? Nemo igitur esse beatus potest. Istam voluptatem perpetuam quis potest praestare sapienti? Beatus sibi videtur esse moriens. \n\n','2016-02-14 22:04:04','2016-02-14 22:59:52',NULL,NULL,0,1,0),(944,1,1,1,'Accounts',' Itaque contra est, ac dicitis; Estne, quaeso, inquam, sitienti in bibendo voluptas? Si autem id non concedatur, non continuo vita beata tollitur. Sapiens autem semper beatus est et est aliquando in dolore; Quae sunt igitur communia vobis cum antiquis, iis sic utamur quasi concessis; Venit enim mihi Platonis in mentem, quem accepimus primum hic disputare solitum; Aeque enim contingit omnibus fidibus, ut incontentae sint. Duo Reges: constructio interrete. \n\n','2016-02-14 22:04:05','2016-02-14 22:59:52',NULL,NULL,0,1,0),(945,1,1,1,'Accounts',' Contineo me ab exemplis. Qui potest igitur habitare in beata vita summi mali metus? Quid enim mihi potest esse optatius quam cum Catone, omnium virtutum auctore, de virtutibus disputare? Utilitatis causa amicitia est quaesita. Addidisti ad extremum etiam indoctum fuisse. \n\n','2016-02-14 22:04:06','2016-02-14 22:59:52',NULL,NULL,0,1,0),(946,1,1,1,'Accounts',' Quam tu ponis in verbis, ego positam in re putabam. Immo alio genere; Quod iam a me expectare noli. Consequatur summas voluptates non modo parvo, sed per me nihilo, si potest; At, illa, ut vobis placet, partem quandam tuetur, reliquam deserit. Duo Reges: constructio interrete. Progredientibus autem aetatibus sensim tardeve potius quasi nosmet ipsos cognoscimus. Sed haec quidem liberius ab eo dicuntur et saepius. Qua tu etiam inprudens utebare non numquam. Sin aliud quid voles, postea. Post enim Chrysippum eum non sane est disputatum. Quo tandem modo? \n\n','2016-02-14 22:04:07','2016-02-14 22:59:53',NULL,NULL,0,1,0),(947,1,1,1,'Accounts',' Cur, nisi quod turpis oratio est? Sit enim idem caecus, debilis. Nam prius a se poterit quisque discedere quam appetitum earum rerum, quae sibi conducant, amittere. Duo Reges: constructio interrete. \n\n','2016-02-14 22:04:08','2016-02-14 22:59:53',NULL,NULL,0,1,0),(948,1,1,1,'Accounts',' Multoque hoc melius nos veriusque quam Stoici. Quae est igitur causa istarum angustiarum? Non est ista, inquam, Piso, magna dissensio. Duo Reges: constructio interrete. Deinde prima illa, quae in congressu solemus: Quid tu, inquit, huc? An eiusdem modi? Semper enim ita adsumit aliquid, ut ea, quae prima dederit, non deserat. Respondent extrema primis, media utrisque, omnia omnibus. Quod autem ratione actum est, id officium appellamus. \n\n','2016-02-14 22:04:08','2016-02-14 22:59:54',NULL,NULL,0,1,0),(949,1,1,1,'Accounts',' Quae quidem sapientes sequuntur duce natura tamquam videntes; Hoc est non dividere, sed frangere. Ita enim vivunt quidam, ut eorum vita refellatur oratio. Nummus in Croesi divitiis obscuratur, pars est tamen divitiarum. Duo Reges: constructio interrete. Praeterea sublata cognitione et scientia tollitur omnis ratio et vitae degendae et rerum gerendarum. Paulum, cum regem Persem captum adduceret, eodem flumine invectio? \n\n','2016-02-14 22:04:09','2016-02-14 22:59:54',NULL,NULL,0,1,0),(950,1,1,1,'Accounts',' Venit ad extremum; Itaque eos id agere, ut a se dolores, morbos, debilitates repellant. Duo Reges: constructio interrete. Itaque a sapientia praecipitur se ipsam, si usus sit, sapiens ut relinquat. Aufert enim sensus actionemque tollit omnem. Qua igitur re ab deo vincitur, si aeternitate non vincitur? Sed vobis voluptatum perceptarum recordatio vitam beatam facit, et quidem corpore perceptarum. Vide, ne etiam menses! nisi forte eum dicis, qui, simul atque arripuit, interficit. Illa tamen simplicia, vestra versuta. Hoc tu nunc in illo probas. Consequens enim est et post oritur, ut dixi. Quod ea non occurrentia fingunt, vincunt Aristonem; \n\n','2016-02-14 22:04:10','2016-02-14 22:59:55',NULL,NULL,0,1,0),(951,1,1,1,'Accounts',' Non igitur potestis voluptate omnia dirigentes aut tueri aut retinere virtutem. Primum Theophrasti, Strato, physicum se voluit; Summus dolor plures dies manere non potest? Habes, inquam, Cato, formam eorum, de quibus loquor, philosophorum. Recte, inquit, intellegis. Vos autem cum perspicuis dubia debeatis illustrare, dubiis perspicua conamini tollere. Duo Reges: constructio interrete. Tertium autem omnibus aut maximis rebus iis, quae secundum naturam sint, fruentem vivere. \n\n','2016-02-14 22:04:10','2016-02-14 22:59:55',NULL,NULL,0,1,0),(952,1,1,1,'Accounts',' Ergo ita: non posse honeste vivi, nisi honeste vivatur? Huius, Lyco, oratione locuples, rebus ipsis ielunior. Videamus igitur sententias eorum, tum ad verba redeamus. Post enim Chrysippum eum non sane est disputatum. Duo Reges: constructio interrete. Sed ut iis bonis erigimur, quae expectamus, sic laetamur iis, quae recordamur. Egone quaeris, inquit, quid sentiam? Consequatur summas voluptates non modo parvo, sed per me nihilo, si potest; Quo studio Aristophanem putamus aetatem in litteris duxisse? Quis negat? \n\n','2016-02-14 22:04:11','2016-02-14 22:59:55',NULL,NULL,0,1,0),(953,1,1,1,'Accounts',' Non laboro, inquit, de nomine. Igitur neque stultorum quisquam beatus neque sapientium non beatus. Eam si varietatem diceres, intellegerem, ut etiam non dicente te intellego; Partim cursu et peragratione laetantur, congregatione aliae coetum quodam modo civitatis imitantur; Duo Reges: constructio interrete. An hoc usque quaque, aliter in vita? Tu quidem reddes; At certe gravius. \n\n','2016-02-14 22:04:13','2016-02-14 22:59:56',NULL,NULL,0,1,0),(954,1,1,1,'Accounts',' Beatus autem esse in maximarum rerum timore nemo potest. Sed tu istuc dixti bene Latine, parum plane. Miserum hominem! Si dolor summum malum est, dici aliter non potest. Philosophi autem in suis lectulis plerumque moriuntur. \n\n','2016-02-14 22:04:13','2016-02-14 22:59:56',NULL,NULL,0,1,0),(955,1,1,1,'Accounts',' Fatebuntur Stoici haec omnia dicta esse praeclare, neque eam causam Zenoni desciscendi fuisse. Vide igitur ne non debeas verbis nostris uti, sententiis tuis. Quos nisi redarguimus, omnis virtus, omne decus, omnis vera laus deserenda est. Maximus dolor, inquit, brevis est. \n\n','2016-02-14 22:04:14','2016-02-14 22:59:57',NULL,NULL,0,1,0),(956,1,1,1,'Accounts',' Sed ad haec, nisi molestum est, habeo quae velim. Quae cum dixisset paulumque institisset, Quid est? An vero displicuit ea, quae tributa est animi virtutibus tanta praestantia? Non autem hoc: igitur ne illud quidem. \n\n','2016-02-14 22:04:15','2016-02-14 22:59:57',NULL,NULL,0,1,0),(957,1,1,1,'Accounts',' Prave, nequiter, turpiter cenabat; Inde sermone vario sex illa a Dipylo stadia confecimus. Summum ením bonum exposuit vacuitatem doloris; Haec dicuntur fortasse ieiunius; Quid est igitur, inquit, quod requiras? Duo Reges: constructio interrete. \n\n','2016-02-14 22:04:15','2016-02-14 22:59:58',NULL,NULL,0,1,0),(958,1,1,1,'Accounts',' Equidem, sed audistine modo de Carneade? Hoc Hieronymus summum bonum esse dixit. An hoc usque quaque, aliter in vita? Ita similis erit ei finis boni, atque antea fuerat, neque idem tamen; Quae contraria sunt his, malane? Neutrum vero, inquit ille. \n\n','2016-02-14 22:04:16','2016-02-14 22:59:58',NULL,NULL,0,1,0),(959,1,1,1,'Accounts',' Quas enim kakaw Graeci appellant, vitia malo quam malitias nominare. Poterat autem inpune; Duo Reges: constructio interrete. Ac tamen hic mallet non dolere. Quid ergo attinet gloriose loqui, nisi constanter loquare? Neque solum ea communia, verum etiam paria esse dixerunt. Potius inflammat, ut coercendi magis quam dedocendi esse videantur. An hoc usque quaque, aliter in vita? \n\n','2016-02-14 22:04:17','2016-02-14 22:59:59',NULL,NULL,0,1,0),(960,1,1,1,'Accounts',' Hi curatione adhibita levantur in dies, valet alter plus cotidie, alter videt. Rhetorice igitur, inquam, nos mavis quam dialectice disputare? Pugnant Stoici cum Peripateticis. Sed nonne merninisti licere mihi ista probare, quae sunt a te dicta? Duo Reges: constructio interrete. Istam voluptatem, inquit, Epicurus ignorat? \n\n','2016-02-14 22:04:18','2016-02-14 22:59:59',NULL,NULL,0,1,0),(961,1,1,1,'Accounts',' Teneo, inquit, finem illi videri nihil dolere. Si quicquam extra virtutem habeatur in bonis. Aufert enim sensus actionemque tollit omnem. Quamquam haec quidem praeposita recte et reiecta dicere licebit. Egone non intellego, quid sit don Graece, Latine voluptas? \n\n','2016-02-14 22:04:18','2016-02-14 22:59:59',NULL,NULL,0,1,0),(962,1,1,1,'Accounts',' Ut in voluptate sit, qui epuletur, in dolore, qui torqueatur. Iam id ipsum absurdum, maximum malum neglegi. Duo Reges: constructio interrete. Varietates autem iniurasque fortunae facile veteres philosophorum praeceptis instituta vita superabat. Nam bonum ex quo appellatum sit, nescio, praepositum ex eo credo, quod praeponatur aliis. Dolor ergo, id est summum malum, metuetur semper, etiamsi non aderit; Et quidem, inquit, vehementer errat; Tu enim ista lenius, hic Stoicorum more nos vexat. \n\n','2016-02-14 22:04:19','2016-02-14 23:00:00',NULL,NULL,0,1,0),(963,1,1,1,'Accounts',' Quis enim confidit semper sibi illud stabile et firmum permansurum, quod fragile et caducum sit? Collige omnia, quae soletis: Praesidium amicorum. Ab hoc autem quaedam non melius quam veteres, quaedam omnino relicta. Duo Reges: constructio interrete. Nec vero intermittunt aut admirationem earum rerum, quae sunt ab antiquis repertae, aut investigationem novarum. Sed in rebus apertissimis nimium longi sumus. At Zeno eum non beatum modo, sed etiam divitem dicere ausus est. Apud imperitos tum illa dicta sunt, aliquid etiam coronae datum; \n\n','2016-02-14 22:04:20','2016-02-14 23:00:00',NULL,NULL,0,1,0),(964,1,1,1,'Accounts',' Quid autem habent admirationis, cum prope accesseris? Quis Aristidem non mortuum diligit? Sin te auctoritas commovebat, nobisne omnibus et Platoni ipsi nescio quem illum anteponebas? Itaque quantum adiit periculum! ad honestatem enim illum omnem conatum suum referebat, non ad voluptatem. Quamquam te quidem video minime esse deterritum. Duo Reges: constructio interrete. \n\n','2016-02-14 22:04:20','2016-02-14 23:00:01',NULL,NULL,0,1,0),(965,1,1,1,'Accounts',' Sed quanta sit alias, nunc tantum possitne esse tanta. Quis est tam dissimile homini. Sed mehercule pergrata mihi oratio tua. Duo Reges: constructio interrete. \n\n','2016-02-14 22:04:21','2016-02-14 23:00:01',NULL,NULL,0,1,0),(966,1,1,1,'Accounts',' Scisse enim te quis coarguere possit? Bonum patria: miserum exilium. Ex rebus enim timiditas, non ex vocabulis nascitur. Duarum enim vitarum nobis erunt instituta capienda. Non enim quaero quid verum, sed quid cuique dicendum sit. Nec vero sum nescius esse utilitatem in historia, non modo voluptatem. Duo Reges: constructio interrete. Vitiosum est enim in dividendo partem in genere numerare. Sed ad rem redeamus; An dolor longissimus quisque miserrimus, voluptatem non optabiliorem diuturnitas facit? Quamquam haec quidem praeposita recte et reiecta dicere licebit. \n\n','2016-02-14 22:04:22','2016-02-14 23:00:02',NULL,NULL,0,1,0),(967,1,1,1,'Accounts',' Simus igitur contenti his. Hos contra singulos dici est melius. Uterque enim summo bono fruitur, id est voluptate. Quod non faceret, si in voluptate summum bonum poneret. Duo Reges: constructio interrete. Haec dicuntur inconstantissime. Quia nec honesto quic quam honestius nec turpi turpius. Pugnant Stoici cum Peripateticis. \n\n','2016-02-14 22:04:23','2016-02-14 23:00:03',NULL,NULL,0,1,0),(968,1,1,1,'Accounts',' Quae tamen a te agetur non melior, quam illae sunt, quas interdum optines. Sine ea igitur iucunde negat posse se vivere? Si longus, levis dictata sunt. Ita multo sanguine profuso in laetitia et in victoria est mortuus. Traditur, inquit, ab Epicuro ratio neglegendi doloris. Ita relinquet duas, de quibus etiam atque etiam consideret. Duo Reges: constructio interrete. Ita cum ea volunt retinere, quae superiori sententiae conveniunt, in Aristonem incidunt; \n\n','2016-02-14 22:04:23','2016-02-14 23:00:03',NULL,NULL,0,1,0),(969,1,1,1,'Accounts',' Est enim effectrix multarum et magnarum voluptatum. Ut non sine causa ex iis memoriae ducta sit disciplina. Sin te auctoritas commovebat, nobisne omnibus et Platoni ipsi nescio quem illum anteponebas? Heri, inquam, ludis commissis ex urbe profectus veni ad vesperum. Duo Reges: constructio interrete. Ego vero volo in virtute vim esse quam maximam; \n\n','2016-02-14 22:04:24','2016-02-14 23:00:03',NULL,NULL,0,1,0),(970,1,1,1,'Accounts',' Quamquam non negatis nos intellegere quid sit voluptas, sed quid ille dicat. Duo Reges: constructio interrete. An eum locum libenter invisit, ubi Demosthenes et Aeschines inter se decertare soliti sunt? Si verbum sequimur, primum longius verbum praepositum quam bonum. An potest, inquit ille, quicquam esse suavius quam nihil dolere? Erat enim Polemonis. Sed ille, ut dixi, vitiose. Quod ea non occurrentia fingunt, vincunt Aristonem; \n\n','2016-02-14 22:04:25','2016-02-14 23:00:04',NULL,NULL,0,1,0),(971,1,1,1,'Accounts',' Nullus est igitur cuiusquam dies natalis. Huius, Lyco, oratione locuples, rebus ipsis ielunior. Duae sunt enim res quoque, ne tu verba solum putes. Num quid tale Democritus? Sed eum qui audiebant, quoad poterant, defendebant sententiam suam. Duo Reges: constructio interrete. Nam quid possumus facere melius? \n\n','2016-02-14 22:04:25','2016-02-14 23:00:04',NULL,NULL,0,1,0),(972,1,1,1,'Accounts',' Atqui reperies, inquit, in hoc quidem pertinacem; Sed haec nihil sane ad rem; Dulce amarum, leve asperum, prope longe, stare movere, quadratum rotundum. Si quidem, inquit, tollerem, sed relinquo. Utram tandem linguam nescio? Duo Reges: constructio interrete. Re mihi non aeque satisfacit, et quidem locis pluribus. \n\n','2016-02-14 22:04:26','2016-02-14 23:00:05',NULL,NULL,0,1,0),(973,1,1,1,'Accounts',' Rhetorice igitur, inquam, nos mavis quam dialectice disputare? Nihil ad rem! Ne sit sane; Vestri haec verecundius, illi fortasse constantius. Quod quidem iam fit etiam in Academia. Duo Reges: constructio interrete. Non potes, nisi retexueris illa. \n\n','2016-02-14 22:04:27','2016-02-14 23:00:05',NULL,NULL,0,1,0),(974,1,1,1,'Accounts',' Aufert enim sensus actionemque tollit omnem. Tum Torquatus: Prorsus, inquit, assentior; Igitur neque stultorum quisquam beatus neque sapientium non beatus. Apud ceteros autem philosophos, qui quaesivit aliquid, tacet; Iam id ipsum absurdum, maximum malum neglegi. Si sapiens, ne tum quidem miser, cum ab Oroete, praetore Darei, in crucem actus est. Nihilo beatiorem esse Metellum quam Regulum. Duo Reges: constructio interrete. \n\n','2016-02-14 22:04:28','2016-02-14 23:00:06',NULL,NULL,0,1,0),(975,1,1,1,'Accounts',' Quod autem principium officii quaerunt, melius quam Pyrrho; Quare hoc videndum est, possitne nobis hoc ratio philosophorum dare. Iubet igitur nos Pythius Apollo noscere nosmet ipsos. Duo Reges: constructio interrete. Moriatur, inquit. Sed vobis voluptatum perceptarum recordatio vitam beatam facit, et quidem corpore perceptarum. \n\n','2016-02-14 22:04:28','2016-02-14 23:00:06',NULL,NULL,0,1,0),(976,1,1,1,'Accounts',' Occultum facinus esse potuerit, gaudebit; Quod ea non occurrentia fingunt, vincunt Aristonem; Scio enim esse quosdam, qui quavis lingua philosophari possint; Est, ut dicis, inquam. \n\n','2016-02-14 22:04:29','2016-02-14 23:00:07',NULL,NULL,0,1,0),(977,1,1,1,'Accounts',' Haec dicuntur inconstantissime. Qui-vere falsone, quaerere mittimus-dicitur oculis se privasse; Quod idem cum vestri faciant, non satis magnam tribuunt inventoribus gratiam. Duo Reges: constructio interrete. Quod eo liquidius faciet, si perspexerit rerum inter eas verborumne sit controversia. Quid dubitas igitur mutare principia naturae? \n\n','2016-02-14 22:04:30','2016-02-14 23:00:07',NULL,NULL,0,1,0),(978,1,1,1,'Accounts',' Laboro autem non sine causa; Hoc etsi multimodis reprehendi potest, tamen accipio, quod dant. Illa argumenta propria videamus, cur omnia sint paria peccata. Si quicquam extra virtutem habeatur in bonis. At ego quem huic anteponam non audeo dicere; Duo Reges: constructio interrete. Septem autem illi non suo, sed populorum suffragio omnium nominati sunt. Quis enim redargueret? Vos autem cum perspicuis dubia debeatis illustrare, dubiis perspicua conamini tollere. Sit hoc ultimum bonorum, quod nunc a me defenditur; Sed non alienum est, quo facilius vis verbi intellegatur, rationem huius verbi faciendi Zenonis exponere. \n\n','2016-02-14 22:04:30','2016-02-14 23:00:07',NULL,NULL,0,1,0),(979,1,1,1,'Accounts',' An quod ita callida est, ut optime possit architectari voluptates? Scio enim esse quosdam, qui quavis lingua philosophari possint; Eadem fortitudinis ratio reperietur. Scaevola tribunus plebis ferret ad plebem vellentne de ea re quaeri. Duo Reges: constructio interrete. A primo, ut opinor, animantium ortu petitur origo summi boni. \n\n','2016-02-14 22:04:31','2016-02-14 23:00:08',NULL,NULL,0,1,0),(980,1,1,1,'Accounts',' Sin tantum modo ad indicia veteris memoriae cognoscenda, curiosorum. Maximus dolor, inquit, brevis est. Dic in quovis conventu te omnia facere, ne doleas. De illis, cum volemus. At iam decimum annum in spelunca iacet. Sin te auctoritas commovebat, nobisne omnibus et Platoni ipsi nescio quem illum anteponebas? Duo Reges: constructio interrete. Quod quidem iam fit etiam in Academia. Aliter homines, aliter philosophos loqui putas oportere? Non pugnem cum homine, cur tantum habeat in natura boni; Inde sermone vario sex illa a Dipylo stadia confecimus. \n\n','2016-02-14 22:04:32','2016-02-14 23:00:08',NULL,NULL,0,1,0),(981,1,1,1,'Accounts',' Age, inquies, ista parva sunt. Nonne videmus quanta perturbatio rerum omnium consequatur, quanta confusio? Hoc ipsum elegantius poni meliusque potuit. Ut scias me intellegere, primum idem esse dico voluptatem, quod ille don. Duo Reges: constructio interrete. Multoque hoc melius nos veriusque quam Stoici. Itaque haec cum illis est dissensio, cum Peripateticis nulla sane. \n\n','2016-02-14 22:04:32','2016-02-14 23:00:09',NULL,NULL,0,1,0),(982,1,1,1,'Accounts',' Claudii libidini, qui tum erat summo ne imperio, dederetur. Minime vero, inquit ille, consentit. Deinde prima illa, quae in congressu solemus: Quid tu, inquit, huc? Nec vero alia sunt quaerenda contra Carneadeam illam sententiam. Sedulo, inquam, faciam. Aliud igitur esse censet gaudere, aliud non dolere. Duo Reges: constructio interrete. Sed vobis voluptatum perceptarum recordatio vitam beatam facit, et quidem corpore perceptarum. \n\n','2016-02-14 22:04:33','2016-02-14 23:00:09',NULL,NULL,0,1,0),(983,1,1,1,'Accounts',' At cum de plurimis eadem dicit, tum certe de maximis. Facillimum id quidem est, inquam. Pauca mutat vel plura sane; Videmus igitur ut conquiescere ne infantes quidem possint. Duo Reges: constructio interrete. Hinc ceteri particulas arripere conati suam quisque videro voluit afferre sententiam. Quamquam tu hanc copiosiorem etiam soles dicere. Si longus, levis dictata sunt. Tuo vero id quidem, inquam, arbitratu. Nam et complectitur verbis, quod vult, et dicit plane, quod intellegam; \n\n','2016-02-14 22:04:34','2016-02-14 23:00:09',NULL,NULL,0,1,0),(984,1,1,1,'Accounts',' At certe gravius. Non modo carum sibi quemque, verum etiam vehementer carum esse? Faceres tu quidem, Torquate, haec omnia; Bona autem corporis huic sunt, quod posterius posui, similiora. An tu me de L. Haec quo modo conveniant, non sane intellego. Neque solum ea communia, verum etiam paria esse dixerunt. \n\n','2016-02-14 22:04:35','2016-02-14 23:00:10',NULL,NULL,0,1,0),(985,1,1,1,'Accounts',' Quae cum dixisset paulumque institisset, Quid est? Sed quid sentiat, non videtis. Habent enim et bene longam et satis litigiosam disputationem. Etsi ea quidem, quae adhuc dixisti, quamvis ad aetatem recte isto modo dicerentur. \n\n','2016-02-14 22:04:35','2016-02-14 23:00:10',NULL,NULL,0,1,0),(986,1,1,1,'Accounts',' Negat enim summo bono afferre incrementum diem. Tu autem negas fortem esse quemquam posse, qui dolorem malum putet. Propter nos enim illam, non propter eam nosmet ipsos diligimus. Duo Reges: constructio interrete. Tu autem negas fortem esse quemquam posse, qui dolorem malum putet. Neutrum vero, inquit ille. \n\n','2016-02-14 22:04:36','2016-02-14 23:00:11',NULL,NULL,0,1,0),(987,1,1,1,'Accounts',' Idem iste, inquam, de voluptate quid sentit? Etenim semper illud extra est, quod arte comprehenditur. Nihil acciderat ei, quod nollet, nisi quod anulum, quo delectabatur, in mari abiecerat. Atqui reperies, inquit, in hoc quidem pertinacem; Sed nimis multa. Ex quo, id quod omnes expetunt, beate vivendi ratio inveniri et comparari potest. Duo Reges: constructio interrete. Commoda autem et incommoda in eo genere sunt, quae praeposita et reiecta diximus; Dulce amarum, leve asperum, prope longe, stare movere, quadratum rotundum. Tibi hoc incredibile, quod beatissimum. \n\n','2016-02-14 22:04:37','2016-02-14 23:00:11',NULL,NULL,0,1,0),(988,1,1,1,'Accounts',' Tu autem, si tibi illa probabantur, cur non propriis verbis ea tenebas? Erat enim Polemonis. Indicant pueri, in quibus ut in speculis natura cernitur. Quid dubitas igitur mutare principia naturae? \n\n','2016-02-14 22:04:37','2016-02-14 23:00:12',NULL,NULL,0,1,0),(989,1,1,1,'Accounts',' Quis non odit sordidos, vanos, leves, futtiles? Nam, ut sint illa vendibiliora, haec uberiora certe sunt. Nam ista vestra: Si gravis, brevis; Age, inquies, ista parva sunt. Quicquid porro animo cernimus, id omne oritur a sensibus; Quid, cum fictas fabulas, e quibus utilitas nulla elici potest, cum voluptate legimus? Idque testamento cavebit is, qui nobis quasi oraculum ediderit nihil post mortem ad nos pertinere? Duo Reges: constructio interrete. \n\n','2016-02-14 22:04:38','2016-02-14 23:00:12',NULL,NULL,0,1,0),(990,1,1,1,'Accounts',' Quasi ego id curem, quid ille aiat aut neget. Quid censes in Latino fore? Prodest, inquit, mihi eo esse animo. Suam denique cuique naturam esse ad vivendum ducem. Contemnit enim disserendi elegantiam, confuse loquitur. Nunc omni virtuti vitium contrario nomine opponitur. Ad corpus diceres pertinere-, sed ea, quae dixi, ad corpusne refers? Hoc loco tenere se Triarius non potuit. \n\n','2016-02-14 22:04:39','2016-02-14 23:00:13',NULL,NULL,0,1,0),(991,1,1,1,'Accounts',' Quamquam tu hanc copiosiorem etiam soles dicere. Sed quia studebat laudi et dignitati, multum in virtute processerat. Sed vos squalidius, illorum vides quam niteat oratio. Quae diligentissime contra Aristonem dicuntur a Chryippo. Nec vero alia sunt quaerenda contra Carneadeam illam sententiam. Quid enim de amicitia statueris utilitatis causa expetenda vides. \n\n','2016-02-14 22:04:40','2016-02-14 23:00:14',NULL,NULL,0,1,0),(992,1,1,1,'Accounts',' Quam nemo umquam voluptatem appellavit, appellat; Inde sermone vario sex illa a Dipylo stadia confecimus. Quippe: habes enim a rhetoribus; Duo Reges: constructio interrete. Luxuriam non reprehendit, modo sit vacua infinita cupiditate et timore. Haec quo modo conveniant, non sane intellego. \n\n','2016-02-14 22:04:40','2016-02-14 23:00:14',NULL,NULL,0,1,0),(993,1,1,1,'Accounts',' Negabat igitur ullam esse artem, quae ipsa a se proficisceretur; Duo Reges: constructio interrete. Mihi quidem Antiochum, quem audis, satis belle videris attendere. Nam Pyrrho, Aristo, Erillus iam diu abiecti. \n\n','2016-02-14 22:04:41','2016-02-14 23:00:15',NULL,NULL,0,1,0),(994,1,1,1,'Accounts',' Cum praesertim illa perdiscere ludus esset. Quo plebiscito decreta a senatu est consuli quaestio Cn. Quid ergo aliud intellegetur nisi uti ne quae pars naturae neglegatur? Num igitur utiliorem tibi hunc Triarium putas esse posse, quam si tua sint Puteolis granaria? Duo Reges: constructio interrete. Primum quid tu dicis breve? \n\n','2016-02-14 22:04:42','2016-02-14 23:00:15',NULL,NULL,0,1,0),(995,1,1,1,'Accounts',' Illa sunt similia: hebes acies est cuipiam oculorum, corpore alius senescit; Non dolere, inquam, istud quam vim habeat postea videro; At cum de plurimis eadem dicit, tum certe de maximis. Duo Reges: constructio interrete. Ita graviter et severe voluptatem secrevit a bono. Quid, quod homines infima fortuna, nulla spe rerum gerendarum, opifices denique delectantur historia? At, si voluptas esset bonum, desideraret. Stoicos roga. \n\n','2016-02-14 22:04:43','2016-02-14 23:00:15',NULL,NULL,0,1,0),(996,1,1,1,'Accounts',' Claudii libidini, qui tum erat summo ne imperio, dederetur. Neque enim disputari sine reprehensione nec cum iracundia aut pertinacia recte disputari potest. Tibi hoc incredibile, quod beatissimum. Duo Reges: constructio interrete. Haec para/doca illi, nos admirabilia dicamus. Itaque ab his ordiamur. Collatio igitur ista te nihil iuvat. Gracchum patrem non beatiorem fuisse quam fillum, cum alter stabilire rem publicam studuerit, alter evertere. \n\n','2016-02-14 22:04:43','2016-02-14 23:00:16',NULL,NULL,0,1,0),(997,1,1,1,'Accounts',' Nosti, credo, illud: Nemo pius est, qui pietatem-; Terram, mihi crede, ea lanx et maria deprimet. Duo Reges: constructio interrete. Deinde disputat, quod cuiusque generis animantium statui deceat extremum. An tu me de L. Illud quaero, quid ei, qui in voluptate summum bonum ponat, consentaneum sit dicere. Qua ex cognitione facilior facta est investigatio rerum occultissimarum. Hoc non est positum in nostra actione. Mihi enim satis est, ipsis non satis. Odium autem et invidiam facile vitabis. \n\n','2016-02-14 22:04:44','2016-02-14 23:00:16',NULL,NULL,0,1,0),(998,1,1,1,'Accounts',' Est, ut dicis, inquam. Sit hoc ultimum bonorum, quod nunc a me defenditur; Duo Reges: constructio interrete. \n\n','2016-02-14 22:04:45','2016-02-14 23:00:17',NULL,NULL,0,1,0),(999,1,1,1,'Accounts',' Quod ea non occurrentia fingunt, vincunt Aristonem; Istam voluptatem, inquit, Epicurus ignorat? Nonne igitur tibi videntur, inquit, mala? Hoc est non modo cor non habere, sed ne palatum quidem. Duo Reges: constructio interrete. At quicum ioca seria, ut dicitur, quicum arcana, quicum occulta omnia? Cuius ad naturam apta ratio vera illa et summa lex a philosophis dicitur. \n\n','2016-02-14 22:04:45','2016-02-14 23:00:17',NULL,NULL,0,1,0),(1000,1,1,1,'Accounts',' An ea, quae per vinitorem antea consequebatur, per se ipsa curabit? Unum nescio, quo modo possit, si luxuriosus sit, finitas cupiditates habere. Age nunc isti doceant, vel tu potius quis enim ista melius? \n\n','2016-02-14 22:04:46','2016-02-14 23:00:17',NULL,NULL,0,1,0),(1001,1,1,1,'Accounts',' Animum autem reliquis rebus ita perfecit, ut corpus; Itaque sensibus rationem adiunxit et ratione effecta sensus non reliquit. Quis suae urbis conservatorem Codrum, quis Erechthei filias non maxime laudat? Quod autem satis est, eo quicquid accessit, nimium est; Itaque sensibus rationem adiunxit et ratione effecta sensus non reliquit. \n\n','2016-02-14 22:04:47','2016-02-14 23:00:18',NULL,NULL,0,1,0),(1002,1,1,1,'Accounts',' Itaque hic ipse iam pridem est reiectus; Conclusum est enim contra Cyrenaicos satis acute, nihil ad Epicurum. Hanc quoque iucunditatem, si vis, transfer in animum; \n\n','2016-02-14 22:04:48','2016-02-14 23:00:18',NULL,NULL,0,1,0),(1003,1,1,1,'Accounts',' Quorum sine causa fieri nihil putandum est. Itaque in rebus minime obscuris non multus est apud eos disserendi labor. Ego vero volo in virtute vim esse quam maximam; Nam adhuc, meo fortasse vitio, quid ego quaeram non perspicis. Et quidem saepe quaerimus verbum Latinum par Graeco et quod idem valeat; Quem si tenueris, non modo meum Ciceronem, sed etiam me ipsum abducas licebit. \n\n','2016-02-14 22:04:48','2016-02-14 23:00:19',NULL,NULL,0,1,0),(1004,1,1,1,'Accounts',' Ego vero volo in virtute vim esse quam maximam; Quam ob rem tandem, inquit, non satisfacit? Hoc loco tenere se Triarius non potuit. Que Manilium, ab iisque M. Tubulum fuisse, qua illum, cuius is condemnatus est rogatione, P. Tecum optime, deinde etiam cum mediocri amico. Duo Reges: constructio interrete. Sed fortuna fortis; Quis Aristidem non mortuum diligit? Et quidem iure fortasse, sed tamen non gravissimum est testimonium multitudinis. Estne, quaeso, inquam, sitienti in bibendo voluptas? \n\n','2016-02-14 22:04:49','2016-02-14 23:00:19',NULL,NULL,0,1,0),(1005,1,1,1,'Accounts',' Ita ne hoc quidem modo paria peccata sunt. Ut alios omittam, hunc appello, quem ille unum secutus est. Non est enim vitium in oratione solum, sed etiam in moribus. Et harum quidem rerum facilis est et expedita distinctio. \n\n','2016-02-14 22:04:50','2016-02-14 23:00:19',NULL,NULL,0,1,0),(1006,1,1,1,'Accounts',' At cum de plurimis eadem dicit, tum certe de maximis. Nam quibus rebus efficiuntur voluptates, eae non sunt in potestate sapientis. Quae cum praeponunt, ut sit aliqua rerum selectio, naturam videntur sequi; Traditur, inquit, ab Epicuro ratio neglegendi doloris. Etsi qui potest intellegi aut cogitari esse aliquod animal, quod se oderit? Aliter enim nosmet ipsos nosse non possumus. \n\n','2016-02-14 22:04:50','2016-02-14 23:00:20',NULL,NULL,0,1,0),(1007,1,1,1,'Accounts',' Vestri haec verecundius, illi fortasse constantius. Efficiens dici potest. Cur fortior sit, si illud, quod tute concedis, asperum et vix ferendum putabit? Mihi, inquam, qui te id ipsum rogavi? Quippe: habes enim a rhetoribus; Scio enim esse quosdam, qui quavis lingua philosophari possint; \n\n','2016-02-14 22:04:51','2016-02-14 23:00:20',NULL,NULL,0,1,0),(1008,1,1,1,'Accounts',' Nulla profecto est, quin suam vim retineat a primo ad extremum. Hoc dixerit potius Ennius: Nimium boni est, cui nihil est mali. Nec vero hoc oratione solum, sed multo magis vita et factis et moribus comprobavit. Duo Reges: constructio interrete. Nec lapathi suavitatem acupenseri Galloni Laelius anteponebat, sed suavitatem ipsam neglegebat; \n\n','2016-02-14 22:04:52','2016-02-14 23:00:21',NULL,NULL,0,1,0),(1009,1,1,1,'Accounts',' Quod autem satis est, eo quicquid accessit, nimium est; Sic enim censent, oportunitatis esse beate vivere. Et quod est munus, quod opus sapientiae? Scisse enim te quis coarguere possit? Omnes enim iucundum motum, quo sensus hilaretur. Duo Reges: constructio interrete. \n\n','2016-02-14 22:04:53','2016-02-14 23:00:21',NULL,NULL,0,1,0),(1010,1,1,1,'Accounts',' Atque hoc loco similitudines eas, quibus illi uti solent, dissimillimas proferebas. Quorum sine causa fieri nihil putandum est. Qui autem esse poteris, nisi te amor ipse ceperit? Isto modo, ne si avia quidem eius nata non esset. Hic ambiguo ludimur. Scaevola tribunus plebis ferret ad plebem vellentne de ea re quaeri. Qui-vere falsone, quaerere mittimus-dicitur oculis se privasse; Itaque mihi non satis videmini considerare quod iter sit naturae quaeque progressio. Duo Reges: constructio interrete. Fortasse id optimum, sed ubi illud: Plus semper voluptatis? Cum autem in quo sapienter dicimus, id a primo rectissime dicitur. \n\n','2016-02-14 22:04:53','2016-02-14 23:00:22',NULL,NULL,0,1,0),(1011,1,1,1,'Accounts',' Quis animo aequo videt eum, quem inpure ac flagitiose putet vivere? Gloriosa ostentatio in constituendo summo bono. At, si voluptas esset bonum, desideraret. Et ille ridens: Video, inquit, quid agas; Putabam equidem satis, inquit, me dixisse. Duo Reges: constructio interrete. \n\n','2016-02-14 22:04:54','2016-02-14 23:00:22',NULL,NULL,0,1,0),(1012,1,1,1,'Accounts',' Hoc tu nunc in illo probas. Qui ita affectus, beatum esse numquam probabis; Duo Reges: constructio interrete. In his igitur partibus duabus nihil erat, quod Zeno commutare gestiret. Itaque vides, quo modo loquantur, nova verba fingunt, deserunt usitata. Apud imperitos tum illa dicta sunt, aliquid etiam coronae datum; Bonum patria: miserum exilium. Recte, inquit, intellegis. \n\n','2016-02-14 22:04:55','2016-02-14 23:00:23',NULL,NULL,0,1,0),(1013,1,1,1,'Accounts',' Duo Reges: constructio interrete. Cum id fugiunt, re eadem defendunt, quae Peripatetici, verba. Honesta oratio, Socratica, Platonis etiam. Sed tu istuc dixti bene Latine, parum plane. Quae cum magnifice primo dici viderentur, considerata minus probabantur. Qui ita affectus, beatum esse numquam probabis; \n\n','2016-02-14 22:04:55','2016-02-14 23:00:23',NULL,NULL,0,1,0),(1014,1,1,1,'Accounts',' Tum ille: Tu autem cum ipse tantum librorum habeas, quos hic tandem requiris? Nondum autem explanatum satis, erat, quid maxime natura vellet. Quod vestri non item. Si quidem, inquit, tollerem, sed relinquo. Sed in rebus apertissimis nimium longi sumus. Duo Reges: constructio interrete. \n\n','2016-02-14 22:04:56','2016-02-14 23:00:24',NULL,NULL,0,1,0),(1015,1,1,1,'Accounts',' Si enim ita est, vide ne facinus facias, cum mori suadeas. Illis videtur, qui illud non dubitant bonum dicere -; Tria genera cupiditatum, naturales et necessariae, naturales et non necessariae, nec naturales nec necessariae. Duo Reges: constructio interrete. Quae cum praeponunt, ut sit aliqua rerum selectio, naturam videntur sequi; Falli igitur possumus. Ille vero, si insipiens-quo certe, quoniam tyrannus -, numquam beatus; Eam tum adesse, cum dolor omnis absit; Tum Quintus: Est plane, Piso, ut dicis, inquit. An potest, inquit ille, quicquam esse suavius quam nihil dolere? \n\n','2016-02-14 22:04:57','2016-02-14 23:00:25',NULL,NULL,0,1,0),(1016,1,1,1,'Accounts',' Non igitur de improbo, sed de callido improbo quaerimus, qualis Q. Et non ex maxima parte de tota iudicabis? Quid enim est a Chrysippo praetermissum in Stoicis? Duo Reges: constructio interrete. Nec tamen ullo modo summum pecudis bonum et hominis idem mihi videri potest. Restinguet citius, si ardentem acceperit. \n\n','2016-02-14 22:04:58','2016-02-14 23:00:25',NULL,NULL,0,1,0),(1017,1,1,1,'Accounts',' Fortasse id optimum, sed ubi illud: Plus semper voluptatis? Illud non continuo, ut aeque incontentae. Quid ergo attinet dicere: Nihil haberem, quod reprehenderem, si finitas cupiditates haberent? Iam enim adesse poterit. Istic sum, inquit. Re mihi non aeque satisfacit, et quidem locis pluribus. \n\n','2016-02-14 22:04:58','2016-02-14 23:00:25',NULL,NULL,0,1,0),(1018,1,1,1,'Accounts',' Egone quaeris, inquit, quid sentiam? Ut placet, inquit, etsi enim illud erat aptius, aequum cuique concedere. Ut id aliis narrare gestiant? Duo Reges: constructio interrete. Aeque enim contingit omnibus fidibus, ut incontentae sint. Expectoque quid ad id, quod quaerebam, respondeas. \n\n','2016-02-14 22:04:59','2016-02-14 23:00:26',NULL,NULL,0,1,0),(1019,1,1,1,'Accounts',' Quod non faceret, si in voluptate summum bonum poneret. Deinde disputat, quod cuiusque generis animantium statui deceat extremum. Ergo ita: non posse honeste vivi, nisi honeste vivatur? Scrupulum, inquam, abeunti; Te enim iudicem aequum puto, modo quae dicat ille bene noris. Non dolere, inquam, istud quam vim habeat postea videro; Duo Reges: constructio interrete. Ille enim occurrentia nescio quae comminiscebatur; Gloriosa ostentatio in constituendo summo bono. Hoc mihi cum tuo fratre convenit. \n\n','2016-02-14 22:05:00','2016-02-14 23:00:26',NULL,NULL,0,1,0),(1020,1,1,1,'Accounts',' Quando enim Socrates, qui parens philosophiae iure dici potest, quicquam tale fecit? Itaque hic ipse iam pridem est reiectus; Sed quod proximum fuit non vidit. Nulla profecto est, quin suam vim retineat a primo ad extremum. Duo Reges: constructio interrete. Ad corpus diceres pertinere-, sed ea, quae dixi, ad corpusne refers? Est, ut dicis, inquit; Cur fortior sit, si illud, quod tute concedis, asperum et vix ferendum putabit? Nihil opus est exemplis hoc facere longius. \n\n','2016-02-14 22:05:00','2016-02-14 23:00:27',NULL,NULL,0,1,0),(1021,1,1,1,'Accounts',' Duo Reges: constructio interrete. Mihi enim satis est, ipsis non satis. Si longus, levis; Ut id aliis narrare gestiant? Sit hoc ultimum bonorum, quod nunc a me defenditur; Primum in nostrane potestate est, quid meminerimus? Deinde qui fit, ut ego nesciam, sciant omnes, quicumque Epicurei esse voluerunt? Itaque nostrum est-quod nostrum dico, artis est-ad ea principia, quae accepimus. Egone non intellego, quid sit don Graece, Latine voluptas? Itaque haec cum illis est dissensio, cum Peripateticis nulla sane. Cur tantas regiones barbarorum pedibus obiit, tot maria transmisit? \n\n','2016-02-14 22:05:01','2016-02-14 23:00:27',NULL,NULL,0,1,0),(1022,1,1,1,'Accounts',' Huius ego nunc auctoritatem sequens idem faciam. Ita multa dicunt, quae vix intellegam. Teneo, inquit, finem illi videri nihil dolere. Nos commodius agimus. Duo Reges: constructio interrete. Sine ea igitur iucunde negat posse se vivere? \n\n','2016-02-14 22:05:02','2016-02-14 23:00:27',NULL,NULL,0,1,0),(1023,1,1,1,'Accounts',' Quod ea non occurrentia fingunt, vincunt Aristonem; Et quidem iure fortasse, sed tamen non gravissimum est testimonium multitudinis. Non minor, inquit, voluptas percipitur ex vilissimis rebus quam ex pretiosissimis. Gloriosa ostentatio in constituendo summo bono. \n\n','2016-02-14 22:05:02','2016-02-14 23:00:28',NULL,NULL,0,1,0),(1024,1,1,1,'Accounts',' Cum id quoque, ut cupiebat, audivisset, evelli iussit eam, qua erat transfixus, hastam. Eam tum adesse, cum dolor omnis absit; Sic consequentibus vestris sublatis prima tolluntur. Hoc etsi multimodis reprehendi potest, tamen accipio, quod dant. Nunc ita separantur, ut disiuncta sint, quo nihil potest esse perversius. Murenam te accusante defenderem. Sed fortuna fortis; Duo Reges: constructio interrete. \n\n','2016-02-14 22:05:03','2016-02-14 23:00:28',NULL,NULL,0,1,0),(1025,1,1,1,'Accounts',' At multis se probavit. Isto modo ne improbos quidem, si essent boni viri. Quodcumque in mentem incideret, et quodcumque tamquam occurreret. Diodorus, eius auditor, adiungit ad honestatem vacuitatem doloris. Neque enim civitas in seditione beata esse potest nec in discordia dominorum domus; Sed ad bona praeterita redeamus. Duo Reges: constructio interrete. Sed eum qui audiebant, quoad poterant, defendebant sententiam suam. Ad eas enim res ab Epicuro praecepta dantur. \n\n','2016-02-14 22:05:04','2016-02-14 23:00:29',NULL,NULL,0,1,0),(1026,1,1,1,'Accounts',' Non quam nostram quidem, inquit Pomponius iocans; Hoc dixerit potius Ennius: Nimium boni est, cui nihil est mali. Expectoque quid ad id, quod quaerebam, respondeas. \n\n','2016-02-14 22:05:05','2016-02-14 23:00:29',NULL,NULL,0,1,0),(1027,1,1,1,'Accounts',' Nihil enim iam habes, quod ad corpus referas; Itaque eos id agere, ut a se dolores, morbos, debilitates repellant. Quamquam id quidem licebit iis existimare, qui legerint. Duo Reges: constructio interrete. Non enim, si omnia non sequebatur, idcirco non erat ortus illinc. Quantum Aristoxeni ingenium consumptum videmus in musicis? Egone quaeris, inquit, quid sentiam? Fortemne possumus dicere eundem illum Torquatum? Quare conare, quaeso. Quid ergo aliud intellegetur nisi uti ne quae pars naturae neglegatur? \n\n','2016-02-14 22:05:06','2016-02-14 23:00:30',NULL,NULL,0,1,0),(1028,1,1,1,'Accounts',' Tuo vero id quidem, inquam, arbitratu. Quis non odit sordidos, vanos, leves, futtiles? Duo Reges: constructio interrete. Erat enim Polemonis. Honesta oratio, Socratica, Platonis etiam. \n\n','2016-02-14 22:05:07','2016-02-14 23:00:30',NULL,NULL,0,1,0),(1029,1,1,1,'Accounts',' Neutrum vero, inquit ille. Ita cum ea volunt retinere, quae superiori sententiae conveniunt, in Aristonem incidunt; Dicet pro me ipsa virtus nec dubitabit isti vestro beato M. Quorum sine causa fieri nihil putandum est. Duo Reges: constructio interrete. Quae cum praeponunt, ut sit aliqua rerum selectio, naturam videntur sequi; Videamus igitur sententias eorum, tum ad verba redeamus. Audeo dicere, inquit. \n\n','2016-02-14 22:05:08','2016-02-14 23:00:31',NULL,NULL,0,1,0),(1030,1,1,1,'Accounts',' Quam nemo umquam voluptatem appellavit, appellat; At cum de plurimis eadem dicit, tum certe de maximis. Ait enim se, si uratur, Quam hoc suave! dicturum. Duo Reges: constructio interrete. At eum nihili facit; Ea, quae dialectici nunc tradunt et docent, nonne ab illis instituta sunt aut inventa sunt? Multoque hoc melius nos veriusque quam Stoici. \n\n','2016-02-14 22:05:08','2016-02-14 23:00:31',NULL,NULL,0,1,0),(1031,1,1,1,'Accounts',' Equidem, sed audistine modo de Carneade? Duo Reges: constructio interrete. Perge porro; Ita nemo beato beatior. Isto modo ne improbos quidem, si essent boni viri. \n\n','2016-02-14 22:05:09','2016-02-14 23:00:31',NULL,NULL,0,1,0),(1032,1,1,1,'Accounts',' Servari enim iustitia nisi a forti viro, nisi a sapiente non potest. At negat Epicurus-hoc enim vestrum lumen estquemquam, qui honeste non vivat, iucunde posse vivere. Ab hoc autem quaedam non melius quam veteres, quaedam omnino relicta. Ad quorum et cognitionem et usum iam corroborati natura ipsa praeeunte deducimur. Duo Reges: constructio interrete. Propter nos enim illam, non propter eam nosmet ipsos diligimus. \n\n','2016-02-14 22:05:10','2016-02-14 23:00:32',NULL,NULL,0,1,0),(1033,1,1,1,'Accounts',' Tollenda est atque extrahenda radicitus. Summus dolor plures dies manere non potest? Mihi enim erit isdem istis fortasse iam utendum. Ne amores quidem sanctos a sapiente alienos esse arbitrantur. Haec para/doca illi, nos admirabilia dicamus. Duo Reges: constructio interrete. Quod ea non occurrentia fingunt, vincunt Aristonem; Hoc est dicere: Non reprehenderem asotos, si non essent asoti. Non est igitur voluptas bonum. \n\n','2016-02-14 22:05:10','2016-02-14 23:00:32',NULL,NULL,0,1,0),(1034,1,1,1,'Accounts',' In qua quid est boni praeter summam voluptatem, et eam sempiternam? At cum de plurimis eadem dicit, tum certe de maximis. Unum nescio, quo modo possit, si luxuriosus sit, finitas cupiditates habere. Habes, inquam, Cato, formam eorum, de quibus loquor, philosophorum. Qua ex cognitione facilior facta est investigatio rerum occultissimarum. Age, inquies, ista parva sunt. \n\n','2016-02-14 22:05:11','2016-02-14 23:00:33',NULL,NULL,0,1,0),(1035,1,1,1,'Accounts',' Aliter enim explicari, quod quaeritur, non potest. Quaerimus enim finem bonorum. Omnis enim est natura diligens sui. Duo Reges: constructio interrete. Traditur, inquit, ab Epicuro ratio neglegendi doloris. Videamus animi partes, quarum est conspectus illustrior; Illa sunt similia: hebes acies est cuipiam oculorum, corpore alius senescit; Est enim effectrix multarum et magnarum voluptatum. \n\n','2016-02-14 22:05:12','2016-02-14 23:00:33',NULL,NULL,0,1,0),(1036,1,1,1,'Accounts',' Quod vestri non item. Cum salvum esse flentes sui respondissent, rogavit essentne fusi hostes. Sed eum qui audiebant, quoad poterant, defendebant sententiam suam. Duo Reges: constructio interrete. \n\n','2016-02-14 22:05:13','2016-02-14 23:00:33',NULL,NULL,0,1,0),(1037,1,1,1,'Accounts',' Quid enim de amicitia statueris utilitatis causa expetenda vides. Si longus, levis; Ergo instituto veterum, quo etiam Stoici utuntur, hinc capiamus exordium. Teneo, inquit, finem illi videri nihil dolere. Beatus sibi videtur esse moriens. Ita multo sanguine profuso in laetitia et in victoria est mortuus. Duo Reges: constructio interrete. \n\n','2016-02-14 22:05:13','2016-02-14 23:00:34',NULL,NULL,0,1,0),(1038,1,1,1,'Accounts',' Negat enim summo bono afferre incrementum diem. Itaque his sapiens semper vacabit. Si est nihil nisi corpus, summa erunt illa: valitudo, vacuitas doloris, pulchritudo, cetera. Duo Reges: constructio interrete. Ab his oratores, ab his imperatores ac rerum publicarum principes extiterunt. Tenent mordicus. Sic enim censent, oportunitatis esse beate vivere. \n\n','2016-02-14 22:05:14','2016-02-14 23:00:34',NULL,NULL,0,1,0),(1039,1,1,1,'Accounts',' Itaque rursus eadem ratione, qua sum paulo ante usus, haerebitis. Utilitatis causa amicitia est quaesita. Varietates autem iniurasque fortunae facile veteres philosophorum praeceptis instituta vita superabat. Negat esse eam, inquit, propter se expetendam. Duo Reges: constructio interrete. Suam denique cuique naturam esse ad vivendum ducem. Quos quidem tibi studiose et diligenter tractandos magnopere censeo. Non quam nostram quidem, inquit Pomponius iocans; Eadem nunc mea adversum te oratio est. Hoc est non modo cor non habere, sed ne palatum quidem. \n\n','2016-02-14 22:05:15','2016-02-14 23:00:35',NULL,NULL,0,1,0),(1040,1,1,1,'Accounts',' Huius ego nunc auctoritatem sequens idem faciam. Duo Reges: constructio interrete. Bona autem corporis huic sunt, quod posterius posui, similiora. Hoc tu nunc in illo probas. \n\n','2016-02-14 22:05:15','2016-02-14 23:00:36',NULL,NULL,0,1,0),(1041,1,1,1,'Accounts',' Semper enim ita adsumit aliquid, ut ea, quae prima dederit, non deserat. Non autem hoc: igitur ne illud quidem. Omnis enim est natura diligens sui. Quod autem meum munus dicis non equidem recuso, sed te adiungo socium. Restinguet citius, si ardentem acceperit. Duo Reges: constructio interrete. Primum in nostrane potestate est, quid meminerimus? Quamquam te quidem video minime esse deterritum. Primum cur ista res digna odio est, nisi quod est turpis? Huic mori optimum esse propter desperationem sapientiae, illi propter spem vivere. Si quicquam extra virtutem habeatur in bonis. \n\n','2016-02-14 22:05:16','2016-02-14 23:00:36',NULL,NULL,0,1,0),(1042,1,1,1,'Accounts',' Esse enim quam vellet iniquus iustus poterat inpune. Si quae forte-possumus. Quae duo sunt, unum facit. Re mihi non aeque satisfacit, et quidem locis pluribus. Duo Reges: constructio interrete. Ut id aliis narrare gestiant? Is es profecto tu. Iam id ipsum absurdum, maximum malum neglegi. \n\n','2016-02-14 22:05:17','2016-02-14 23:00:37',NULL,NULL,0,1,0),(1043,1,1,1,'Accounts',' Odium autem et invidiam facile vitabis. Quod non faceret, si in voluptate summum bonum poneret. Restinguet citius, si ardentem acceperit. Quid est, quod ab ea absolvi et perfici debeat? Duo Reges: constructio interrete. Magni enim aestimabat pecuniam non modo non contra leges, sed etiam legibus partam. Cum audissem Antiochum, Brute, ut solebam, cum M. Eaedem enim utilitates poterunt eas labefactare atque pervertere. \n\n','2016-02-14 22:05:18','2016-02-14 23:00:37',NULL,NULL,0,1,0),(1044,1,1,1,'Accounts',' Quis animo aequo videt eum, quem inpure ac flagitiose putet vivere? Videamus animi partes, quarum est conspectus illustrior; At quicum ioca seria, ut dicitur, quicum arcana, quicum occulta omnia? Fatebuntur Stoici haec omnia dicta esse praeclare, neque eam causam Zenoni desciscendi fuisse. Quo igitur, inquit, modo? Ut proverbia non nulla veriora sint quam vestra dogmata. Duo Reges: constructio interrete. \n\n','2016-02-14 22:05:18','2016-02-14 23:00:38',NULL,NULL,0,1,0),(1045,1,1,1,'Accounts',' At iam decimum annum in spelunca iacet. Qui enim existimabit posse se miserum esse beatus non erit. Sed nonne merninisti licere mihi ista probare, quae sunt a te dicta? Respondent extrema primis, media utrisque, omnia omnibus. Nummus in Croesi divitiis obscuratur, pars est tamen divitiarum. Duo Reges: constructio interrete. Praeclare hoc quidem. Quare ad ea primum, si videtur; Quis enim potest ea, quae probabilia videantur ei, non probare? Nec tamen ullo modo summum pecudis bonum et hominis idem mihi videri potest. \n\n','2016-02-14 22:05:19','2016-02-14 23:00:38',NULL,NULL,0,1,0),(1046,1,1,1,'Accounts',' Hos contra singulos dici est melius. Sed quod proximum fuit non vidit. Nihilo magis. Tum Quintus: Est plane, Piso, ut dicis, inquit. Idem iste, inquam, de voluptate quid sentit? Qua tu etiam inprudens utebare non numquam. Portenta haec esse dicit, neque ea ratione ullo modo posse vivi; \n\n','2016-02-14 22:05:20','2016-02-14 23:00:39',NULL,NULL,0,1,0),(1047,1,1,1,'Accounts',' Quamvis enim depravatae non sint, pravae tamen esse possunt. Primum in nostrane potestate est, quid meminerimus? Ex ea difficultate illae fallaciloquae, ut ait Accius, malitiae natae sunt. Cuius quidem, quoniam Stoicus fuit, sententia condemnata mihi videtur esse inanitas ista verborum. \n\n','2016-02-14 22:05:20','2016-02-14 23:00:39',NULL,NULL,0,1,0),(1048,1,1,1,'Accounts',' Cur, nisi quod turpis oratio est? Mihi enim satis est, ipsis non satis. Nec vero alia sunt quaerenda contra Carneadeam illam sententiam. Quae cum ita sint, effectum est nihil esse malum, quod turpe non sit. Duo Reges: constructio interrete. Ut in geometria, prima si dederis, danda sunt omnia. Beatus sibi videtur esse moriens. \n\n','2016-02-14 22:05:21','2016-02-14 23:00:39',NULL,NULL,0,1,0),(1049,1,1,1,'Accounts',' Laboro autem non sine causa; Illis videtur, qui illud non dubitant bonum dicere -; Quam ob rem tandem, inquit, non satisfacit? Hoc etsi multimodis reprehendi potest, tamen accipio, quod dant. \n\n','2016-02-14 22:05:22','2016-02-14 23:00:40',NULL,NULL,0,1,0),(1050,1,1,1,'Accounts',' Quid loquor de nobis, qui ad laudem et ad decus nati, suscepti, instituti sumus? Satisne ergo pudori consulat, si quis sine teste libidini pareat? Apud ceteros autem philosophos, qui quaesivit aliquid, tacet; Sed in rebus apertissimis nimium longi sumus. Duo Reges: constructio interrete. Graecum enim hunc versum nostis omnes-: Suavis laborum est praeteritorum memoria. \n\n','2016-02-14 22:05:23','2016-02-14 23:00:40',NULL,NULL,0,1,0),(1051,1,1,1,'Accounts',' Quamquam haec quidem praeposita recte et reiecta dicere licebit. Utilitatis causa amicitia est quaesita. Faceres tu quidem, Torquate, haec omnia; Quod si ita sit, cur opera philosophiae sit danda nescio. Duo Reges: constructio interrete. Quid enim est a Chrysippo praetermissum in Stoicis? Ratio quidem vestra sic cogit. Immo istud quidem, inquam, quo loco quidque, nisi iniquum postulo, arbitratu meo. Nam quibus rebus efficiuntur voluptates, eae non sunt in potestate sapientis. \n\n','2016-02-14 22:05:23','2016-02-14 23:00:41',NULL,NULL,0,1,0),(1052,1,1,1,'Accounts',' Mihi quidem Antiochum, quem audis, satis belle videris attendere. Videmusne ut pueri ne verberibus quidem a contemplandis rebus perquirendisque deterreantur? Qui-vere falsone, quaerere mittimus-dicitur oculis se privasse; Duo Reges: constructio interrete. Iam id ipsum absurdum, maximum malum neglegi. Compensabatur, inquit, cum summis doloribus laetitia. Quae cum ita sint, effectum est nihil esse malum, quod turpe non sit. Qui convenit? \n\n','2016-02-14 22:05:24','2016-02-14 23:00:41',NULL,NULL,0,1,0),(1053,1,1,1,'Accounts',' Aliter homines, aliter philosophos loqui putas oportere? Ita multa dicunt, quae vix intellegam. Hinc ceteri particulas arripere conati suam quisque videro voluit afferre sententiam. Equidem e Cn. Atque his de rebus et splendida est eorum et illustris oratio. \n\n','2016-02-14 22:05:25','2016-02-14 23:00:42',NULL,NULL,0,1,0),(1054,1,1,1,'Accounts',' Certe, nisi voluptatem tanti aestimaretis. Parvi enim primo ortu sic iacent, tamquam omnino sine animo sint. Laelius clamores sofòw ille so lebat Edere compellans gumias ex ordine nostros. \n\n','2016-02-14 22:05:25','2016-02-14 23:00:42',NULL,NULL,0,1,0),(1055,1,1,1,'Accounts',' Apud ceteros autem philosophos, qui quaesivit aliquid, tacet; Is ita vivebat, ut nulla tam exquisita posset inveniri voluptas, qua non abundaret. An vero displicuit ea, quae tributa est animi virtutibus tanta praestantia? Hoc loco tenere se Triarius non potuit. Nec enim, dum metuit, iustus est, et certe, si metuere destiterit, non erit; Ita fit cum gravior, tum etiam splendidior oratio. Duo Reges: constructio interrete. Paulum, cum regem Persem captum adduceret, eodem flumine invectio? \n\n','2016-02-14 22:05:26','2016-02-14 23:00:42',NULL,NULL,0,1,0),(1056,1,1,1,'Accounts',' Summus dolor plures dies manere non potest? Non minor, inquit, voluptas percipitur ex vilissimis rebus quam ex pretiosissimis. Itaque primos congressus copulationesque et consuetudinum instituendarum voluntates fieri propter voluptatem; Duo Reges: constructio interrete. \n\n','2016-02-14 22:05:27','2016-02-14 23:00:43',NULL,NULL,0,1,0),(1057,1,1,1,'Accounts',' Sic enim censent, oportunitatis esse beate vivere. Quid ergo hoc loco intellegit honestum? Et hunc idem dico, inquieta sed ad virtutes et ad vitia nihil interesse. Tecum optime, deinde etiam cum mediocri amico. Oculorum, inquit Plato, est in nobis sensus acerrimus, quibus sapientiam non cernimus. Bona autem corporis huic sunt, quod posterius posui, similiora. Duo Reges: constructio interrete. Huius ego nunc auctoritatem sequens idem faciam. Et quidem illud ipsum non nimium probo et tantum patior, philosophum loqui de cupiditatibus finiendis. Ergo adhuc, quantum equidem intellego, causa non videtur fuisse mutandi nominis. \n\n','2016-02-14 22:05:27','2016-02-14 23:00:43',NULL,NULL,0,1,0),(1058,1,1,1,'Accounts',' Nam cui proposito sit conservatio sui, necesse est huic partes quoque sui caras suo genere laudabiles. Quid ei reliquisti, nisi te, quoquo modo loqueretur, intellegere, quid diceret? Quae animi affectio suum cuique tribuens atque hanc, quam dico. Quam ob rem tandem, inquit, non satisfacit? Consequens enim est et post oritur, ut dixi. Ea possunt paria non esse. Nunc ita separantur, ut disiuncta sint, quo nihil potest esse perversius. Nihil opus est exemplis hoc facere longius. Cetera illa adhibebat, quibus demptis negat se Epicurus intellegere quid sit bonum. Duo Reges: constructio interrete. Quae cum dixisset paulumque institisset, Quid est? Atqui reperies, inquit, in hoc quidem pertinacem; \n\n','2016-02-14 22:05:30','2016-02-14 23:00:44',NULL,NULL,0,1,0),(1059,1,1,1,'Accounts',' Terram, mihi crede, ea lanx et maria deprimet. Nihilo magis. Nonne igitur tibi videntur, inquit, mala? Ita multa dicunt, quae vix intellegam. Ratio enim nostra consentit, pugnat oratio. Haec para/doca illi, nos admirabilia dicamus. Duo Reges: constructio interrete. Si longus, levis dictata sunt. \n\n','2016-02-14 22:05:31','2016-02-14 23:00:44',NULL,NULL,0,1,0),(1060,1,1,1,'Accounts',' Deinde disputat, quod cuiusque generis animantium statui deceat extremum. Rhetorice igitur, inquam, nos mavis quam dialectice disputare? Etsi qui potest intellegi aut cogitari esse aliquod animal, quod se oderit? Aliter enim nosmet ipsos nosse non possumus. Duo Reges: constructio interrete. Non autem hoc: igitur ne illud quidem. Atque hoc loco similitudines eas, quibus illi uti solent, dissimillimas proferebas. De vacuitate doloris eadem sententia erit. Hic nihil fuit, quod quaereremus. Ait enim se, si uratur, Quam hoc suave! dicturum. Fortasse id optimum, sed ubi illud: Plus semper voluptatis? In his igitur partibus duabus nihil erat, quod Zeno commutare gestiret. Quid autem habent admirationis, cum prope accesseris? \n\n','2016-02-14 22:05:31','2016-02-14 23:00:45',NULL,NULL,0,1,0),(1061,1,1,1,'Accounts',' Nam illud vehementer repugnat, eundem beatum esse et multis malis oppressum. Atque ab isto capite fluere necesse est omnem rationem bonorum et malorum. Atque hoc loco similitudines eas, quibus illi uti solent, dissimillimas proferebas. Mihi, inquam, qui te id ipsum rogavi? Ut alios omittam, hunc appello, quem ille unum secutus est. Sine ea igitur iucunde negat posse se vivere? Duo Reges: constructio interrete. \n\n','2016-02-14 22:05:32','2016-02-14 23:00:45',NULL,NULL,0,1,0),(1062,1,1,1,'Accounts',' Color egregius, integra valitudo, summa gratia, vita denique conferta voluptatum omnium varietate. At quanta conantur! Mundum hunc omnem oppidum esse nostrum! Incendi igitur eos, qui audiunt, vides. \n\n','2016-02-14 22:05:33','2016-02-14 23:00:46',NULL,NULL,0,1,0),(1063,1,1,1,'Accounts',' Suam denique cuique naturam esse ad vivendum ducem. Non quam nostram quidem, inquit Pomponius iocans; Quae autem natura suae primae institutionis oblita est? Aut, Pylades cum sis, dices te esse Orestem, ut moriare pro amico? Duo Reges: constructio interrete. Quae qui non vident, nihil umquam magnum ac cognitione dignum amaverunt. Iam doloris medicamenta illa Epicurea tamquam de narthecio proment: Si gravis, brevis; An quod ita callida est, ut optime possit architectari voluptates? Duarum enim vitarum nobis erunt instituta capienda. Tum ille timide vel potius verecunde: Facio, inquit. A primo, ut opinor, animantium ortu petitur origo summi boni. \n\n','2016-02-14 22:05:34','2016-02-14 23:00:47',NULL,NULL,0,1,0),(1064,1,1,1,'Accounts',' Universa enim illorum ratione cum tota vestra confligendum puto. Itaque hic ipse iam pridem est reiectus; Intellegi quidem, ut propter aliam quampiam rem, verbi gratia propter voluptatem, nos amemus; \n\n','2016-02-14 22:05:34','2016-02-14 23:00:47',NULL,NULL,0,1,0),(1065,1,1,1,'Accounts',' Minime vero istorum quidem, inquit. Mihi, inquam, qui te id ipsum rogavi? Tenent mordicus. Itaque ad tempus ad Pisonem omnes. Ergo adhuc, quantum equidem intellego, causa non videtur fuisse mutandi nominis. \n\n','2016-02-14 22:05:35','2016-02-14 23:00:48',NULL,NULL,0,1,0),(1066,1,1,1,'Accounts',' Est igitur officium eius generis, quod nec in bonis ponatur nec in contrariis. Duae sunt enim res quoque, ne tu verba solum putes. Quod non faceret, si in voluptate summum bonum poneret. Odium autem et invidiam facile vitabis. Atque ab isto capite fluere necesse est omnem rationem bonorum et malorum. Duo Reges: constructio interrete. Ego vero volo in virtute vim esse quam maximam; Si sapiens, ne tum quidem miser, cum ab Oroete, praetore Darei, in crucem actus est. \n\n','2016-02-14 22:05:36','2016-02-14 23:00:48',NULL,NULL,0,1,0),(1067,1,1,1,'Accounts',' Ex quo, id quod omnes expetunt, beate vivendi ratio inveniri et comparari potest. Idemne, quod iucunde? An me, inquam, nisi te audire vellem, censes haec dicturum fuisse? Duo Reges: constructio interrete. Torquatus, is qui consul cum Cn. Summus dolor plures dies manere non potest? Si verbum sequimur, primum longius verbum praepositum quam bonum. Quod quidem iam fit etiam in Academia. Non enim, si omnia non sequebatur, idcirco non erat ortus illinc. \n\n','2016-02-14 22:05:36','2016-02-14 23:00:49',NULL,NULL,0,1,0),(1068,1,1,1,'Accounts',' Habes, inquam, Cato, formam eorum, de quibus loquor, philosophorum. Ne amores quidem sanctos a sapiente alienos esse arbitrantur. Pisone in eo gymnasio, quod Ptolomaeum vocatur, unaque nobiscum Q. Quamquam tu hanc copiosiorem etiam soles dicere. Si quicquam extra virtutem habeatur in bonis. Duo Reges: constructio interrete. Ut aliquid scire se gaudeant? Restatis igitur vos; Omnes enim iucundum motum, quo sensus hilaretur. Non risu potius quam oratione eiciendum? \n\n','2016-02-14 22:05:37','2016-02-14 23:00:49',NULL,NULL,0,1,0),(1069,1,1,1,'Accounts',' Quid nunc honeste dicit? Roges enim Aristonem, bonane ei videantur haec: vacuitas doloris, divitiae, valitudo; Apud imperitos tum illa dicta sunt, aliquid etiam coronae datum; Ego quoque, inquit, didicerim libentius si quid attuleris, quam te reprehenderim. Nummus in Croesi divitiis obscuratur, pars est tamen divitiarum. Nunc haec primum fortasse audientis servire debemus. Haec dicuntur fortasse ieiunius; Duo Reges: constructio interrete. \n\n','2016-02-14 22:05:38','2016-02-14 23:00:50',NULL,NULL,0,1,0),(1070,1,1,1,'Accounts',' Tu autem negas fortem esse quemquam posse, qui dolorem malum putet. Quamvis enim depravatae non sint, pravae tamen esse possunt. Tum Quintus: Est plane, Piso, ut dicis, inquit. Multoque hoc melius nos veriusque quam Stoici. Quis est tam dissimile homini. Collatio igitur is