interrete. Collige omnia, quae soletis: Praesidium amicorum. Eam tum adesse, cum dolor omnis absit; Quia dolori non voluptas contraria est, sed doloris privatio. \n\n','2016-02-14 12:05:56','2016-02-14 23:25:04',NULL,NULL,0,1,0),(1089,1,1,1,'Contacts',' Quid enim mihi potest esse optatius quam cum Catone, omnium virtutum auctore, de virtutibus disputare? Quia dolori non voluptas contraria est, sed doloris privatio. Primum in nostrane potestate est, quid meminerimus? Te enim iudicem aequum puto, modo quae dicat ille bene noris. Duo Reges: constructio interrete. Cur igitur, cum de re conveniat, non malumus usitate loqui? Mene ergo et Triarium dignos existimas, apud quos turpiter loquare? \n\n','2016-02-14 12:05:57','2016-02-14 23:25:05',NULL,NULL,0,1,0),(1090,1,1,1,'Contacts',' Et ille ridens: Video, inquit, quid agas; Duo Reges: constructio interrete. Sed quae tandem ista ratio est? Sed eum qui audiebant, quoad poterant, defendebant sententiam suam. Addidisti ad extremum etiam indoctum fuisse. Ita multo sanguine profuso in laetitia et in victoria est mortuus. Quod ea non occurrentia fingunt, vincunt Aristonem; Habent enim et bene longam et satis litigiosam disputationem. Illum mallem levares, quo optimum atque humanissimum virum, Cn. Quis animo aequo videt eum, quem inpure ac flagitiose putet vivere? Quid est igitur, cur ita semper deum appellet Epicurus beatum et aeternum? \n\n','2016-02-14 12:05:58','2016-02-14 23:25:05',NULL,NULL,0,1,0),(1091,1,1,1,'Contacts',' Claudii libidini, qui tum erat summo ne imperio, dederetur. Eam tum adesse, cum dolor omnis absit; Quod equidem non reprehendo; Quae in controversiam veniunt, de iis, si placet, disseramus. Quamquam tu hanc copiosiorem etiam soles dicere. Egone quaeris, inquit, quid sentiam? Quid enim tanto opus est instrumento in optimis artibus comparandis? Duo Reges: constructio interrete. Quamvis enim depravatae non sint, pravae tamen esse possunt. Aut, Pylades cum sis, dices te esse Orestem, ut moriare pro amico? Neque