mine appellas? Mihi, inquam, qui te id ipsum rogavi? Sic enim censent, oportunitatis esse beate vivere. Nam, ut sint illa vendibiliora, haec uberiora certe sunt. \n\n','2016-02-14 21:53:13','2016-02-14 23:25:08',NULL,NULL,0,1,0),(1096,1,1,1,'Contacts',' Facillimum id quidem est, inquam. Nondum autem explanatum satis, erat, quid maxime natura vellet. Quid enim tanto opus est instrumento in optimis artibus comparandis? Hoc loco tenere se Triarius non potuit. Duo Reges: constructio interrete. Quis animo aequo videt eum, quem inpure ac flagitiose putet vivere? Id est enim, de quo quaerimus. \n\n','2016-02-14 21:53:14','2016-02-14 23:25:08',NULL,NULL,0,1,0),(1097,1,1,1,'Contacts',' Ego vero volo in virtute vim esse quam maximam; Hoc ne statuam quidem dicturam pater aiebat, si loqui posset. Laelius clamores sofòw ille so lebat Edere compellans gumias ex ordine nostros. Duo Reges: constructio interrete. An tu me de L. Ergo adhuc, quantum equidem intellego, causa non videtur fuisse mutandi nominis. Quid de Platone aut de Democrito loquar? \n\n','2016-02-14 21:53:15','2016-02-14 23:25:09',NULL,NULL,0,1,0),(1098,1,1,1,'Contacts',' Ita similis erit ei finis boni, atque antea fuerat, neque idem tamen; Quamquam ab iis philosophiam et omnes ingenuas disciplinas habemus; Dat enim intervalla et relaxat. Duo Reges: constructio interrete. Piso, familiaris noster, et alia multa et hoc loco Stoicos irridebat: Quid enim? Nec tamen ullo modo summum pecudis bonum et hominis idem mihi videri potest. \n\n','2016-02-14 21:53:15','2016-02-14 23:25:09',NULL,NULL,0,1,0),(1099,1,1,1,'Accounts','','2016-02-14 23:25:10','2016-02-14 23:25:10',NULL,NULL,0,1,0),(1100,1,1,1,'Contacts',' Urgent tamen et nihil remittunt. Contemnit enim disserendi elegantiam, confuse loquitur. Iubet igitur nos Pythius Apollo noscere nosmet ipsos. Quis enim redargueret? Id enim natura desiderat. \n\n','2016-02-14 21:53:16','2016-02-14 23:25:10',NULL,NULL,0,1,0),(1101,1,1,1,'Contacts',' Pauca mutat vel plura sane; Sextilio Rufo, cum is rem ad amicos ita deferret, se esse heredem Q. Haec quo modo conveniant, non sane intellego. Sed erat aequius Triarium aliquid de dissensione nostra iudicare. Sed quanta sit alias, nunc tantum possitne esse tanta. Duo Reges: constructio interrete. Mihi, inquam, qui te id ipsum rogavi? Polemoni et iam ante Aristoteli ea prima visa sunt, quae paulo ante dixi. \n\n','2016-02-14 21:53:17','2016-02-14 23:25:11',NULL,NULL,0,1,0),(1102,1,1,1,'Contacts',' Quid est enim aliud esse versutum? Isto modo, ne si avia quidem eius nata non esset. Mihi enim satis est, ipsis non satis. Cum autem in quo sapienter dicimus, id a primo rectissime dicitur. Istic sum, inquit. Tibi hoc incredibile, quod beatissimum. \n\n','2016-02-14 21:53:18','2016-02-14 23:25:11',NULL,NULL,0,1,0),(1103,1,1,1,'Accounts','','2016-02-14 23:25:12','2016-02-14 23:25:12',NULL,NULL,0,1,0),(1104,1,1,1,'Contacts',' Qui potest igitur habitare in beata vita summi mali metus? Verum hoc idem saepe faciamus. Nondum autem explanatum satis, erat, quid maxime natura vellet. Nihilo magis. Duo Reges: constructio interrete. Dulce amarum, leve asperum, prope longe, stare movere, quadratum rotundum. Sed quid attinet de rebus tam apertis plura requirere? Nunc haec primum fortasse audientis servire debemus. Sapiens autem semper beatus est et est aliquando in dolore; Si stante, hoc natura videlicet vult, salvam esse se, quod concedimus; \n\n','2016-02-14 21:53:18','2016-02-14 23:25:12',NULL,NULL,0,1,0),(1105,1,1,1,'Accounts','','2016-02-14 23:25:13','2016-02-14 23:25:13',NULL,NULL,0,1,0),(1106,1,1,1,'Contacts',' Negabat igitur ullam esse artem, quae ipsa a se proficisceretur; An potest cupiditas finiri? Item de contrariis, a quibus ad genera formasque generum venerunt. Duo Reges: constructio interrete. Traditur, inquit, ab Epicuro ratio neglegendi doloris. Ad corpus diceres pertinere-, sed ea, quae dixi, ad corpusne refers? \n\n','2016-02-14 21:53:19','2016-02-14 23:25:13',NULL,NULL,0,1,0),(1107,1,1,1,'Contacts',' Quamquam ab iis philosophiam et omnes ingenuas disciplinas habemus; Ne amores quidem sanctos a sapiente alienos esse arbitrantur. Sed in rebus apertissimis nimium longi sumus. Duo Reges: constructio interrete. Negat esse eam, inquit, propter se expetendam. Sequitur disserendi ratio cognitioque naturae; Venit enim mihi Platonis in mentem, quem accepimus primum hic disputare solitum; Quid enim me prohiberet Epicureum esse, si probarem, quae ille diceret? Neutrum vero, inquit ille. \n\n','2016-02-14 21:53:20','2016-02-14 23:25:14',NULL,NULL,0,1,0),(1108,1,1,1,'Contacts',' Miserum hominem! Si dolor summum malum est, dici aliter non potest. Quid sequatur, quid repugnet, vident. Ad eas enim res ab Epicuro praecepta dantur. Hi curatione adhibita levantur in dies, valet alter plus cotidie, alter videt. Bonum negas esse divitias, praeposìtum esse dicis? Duo Reges: constructio interrete. Haec bene dicuntur, nec ego repugno, sed inter sese ipsa pugnant. Universa enim illorum ratione cum tota vestra confligendum puto. Immo videri fortasse. Res enim fortasse verae, certe graves, non ita tractantur, ut debent, sed aliquanto minutius. \n\n','2016-02-14 21:53:21','2016-02-14 23:25:14',NULL,NULL,0,1,0),(1109,1,1,1,'Contacts',' Quae quo sunt excelsiores, eo dant clariora indicia naturae. Non est igitur summum malum dolor. Verum hoc idem saepe faciamus. Aliter enim explicari, quod quaeritur, non potest. Duo Reges: constructio interrete. Minime vero istorum quidem, inquit. Quae cum praeponunt, ut sit aliqua rerum selectio, naturam videntur sequi; \n\n','2016-02-14 21:53:21','2016-02-14 23:25:15',NULL,NULL,0,1,0),(1110,1,1,1,'Contacts',' Quantum Aristoxeni ingenium consumptum videmus in musicis? Licet hic rursus ea commemores, quae optimis verbis ab Epicuro de laude amicitiae dicta sunt. Itaque contra est, ac dicitis; Illud dico, ea, quae dicat, praeclare inter se cohaerere. Quod autem principium officii quaerunt, melius quam Pyrrho; Cur post Tarentum ad Archytam? \n\n','2016-02-14 21:53:22','2016-02-14 23:25:15',NULL,NULL,0,1,0),(1111,1,1,1,'Contacts',' Quamquam ab iis philosophiam et omnes ingenuas disciplinas habemus; Num igitur eum postea censes anxio animo aut sollicito fuisse? Nihil sane. Duo Reges: constructio interrete. In quibus doctissimi illi veteres inesse quiddam caeleste et divinum putaverunt. Dicimus aliquem hilare vivere; Ut placet, inquit, etsi enim illud erat aptius, aequum cuique concedere. Dolor ergo, id est summum malum, metuetur semper, etiamsi non aderit; Sed ne, dum huic obsequor, vobis molestus sim. \n\n','2016-02-14 21:53:23','2016-02-14 23:25:16',NULL,NULL,0,1,0),(1112,1,1,1,'Accounts','','2016-02-14 23:25:16','2016-02-14 23:25:16',NULL,NULL,0,1,0),(1113,1,1,1,'Contacts',' Portenta haec esse dicit, neque ea ratione ullo modo posse vivi; Quae cum praeponunt, ut sit aliqua rerum selectio, naturam videntur sequi; Nam his libris eum malo quam reliquo ornatu villae delectari. Nam illud vehementer repugnat, eundem beatum esse et multis malis oppressum. Nunc haec primum fortasse audientis servire debemus. Duo Reges: constructio interrete. \n\n','2016-02-14 21:53:23','2016-02-14 23:25:17',NULL,NULL,0,1,0),(1114,1,1,1,'Accounts','','2016-02-14 23:25:17','2016-02-14 23:25:17',NULL,NULL,0,1,0),(1115,1,1,1,'Contacts',' Tecum optime, deinde etiam cum mediocri amico. Facete M. Dic in quovis conventu te omnia facere, ne doleas. Atqui iste locus est, Piso, tibi etiam atque etiam confirmandus, inquam; Quid ergo hoc loco intellegit honestum? Duo Reges: constructio interrete. Illud non continuo, ut aeque incontentae. Haec igitur Epicuri non probo, inquam. \n\n','2016-02-14 21:53:24','2016-02-14 23:25:18',NULL,NULL,0,1,0),(1116,1,1,1,'Contacts',' Tecum optime, deinde etiam cum mediocri amico. Duo Reges: constructio interrete. Iam id ipsum absurdum, maximum malum neglegi. \n\n','2016-02-14 21:53:25','2016-02-14 23:25:19',NULL,NULL,0,1,0),(1117,1,1,1,'Contacts',' Hoc dixerit potius Ennius: Nimium boni est, cui nihil est mali. Est enim tanti philosophi tamque nobilis audacter sua decreta defendere. Quo invento omnis ab eo quasi capite de summo bono et malo disputatio ducitur. Duo Reges: constructio interrete. Cur id non ita fit? Rhetorice igitur, inquam, nos mavis quam dialectice disputare? \n\n','2016-02-14 21:53:25','2016-02-14 23:25:19',NULL,NULL,0,1,0),(1118,1,1,1,'Contacts',' Itaque sensibus rationem adiunxit et ratione effecta sensus non reliquit. In qua quid est boni praeter summam voluptatem, et eam sempiternam? Tria genera bonorum; Duo Reges: constructio interrete. Tecum optime, deinde etiam cum mediocri amico. Videamus animi partes, quarum est conspectus illustrior; \n\n','2016-02-14 21:53:26','2016-02-14 23:25:20',NULL,NULL,0,1,0),(1119,1,1,1,'Contacts',' Illum mallem levares, quo optimum atque humanissimum virum, Cn. Videsne ut, quibus summa est in voluptate, perspicuum sit quid iis faciendum sit aut non faciendum? Non enim solum Torquatus dixit quid sentiret, sed etiam cur. Quae cum dixisset, finem ille. Facillimum id quidem est, inquam. \n\n','2016-02-14 21:53:27','2016-02-14 23:25:20',NULL,NULL,0,1,0),(1120,1,1,1,'Contacts',' Cur tantas regiones barbarorum pedibus obiit, tot maria transmisit? Non igitur potestis voluptate omnia dirigentes aut tueri aut retinere virtutem. Beatus autem esse in maximarum rerum timore nemo potest. Eiuro, inquit adridens, iniquum, hac quidem de re; \n\n','2016-02-14 21:53:28','2016-02-14 23:25:21',NULL,NULL,0,1,0),(1121,1,1,1,'Contacts',' Quo tandem modo? Atque ab his initiis profecti omnium virtutum et originem et progressionem persecuti sunt. Tu vero, inquam, ducas licet, si sequetur; Satis est ad hoc responsum. Claudii libidini, qui tum erat summo ne imperio, dederetur. Quasi vero, inquit, perpetua oratio rhetorum solum, non etiam philosophorum sit. Recte, inquit, intellegis. Duo Reges: constructio interrete. \n\n','2016-02-14 21:53:28','2016-02-14 23:25:21',NULL,NULL,0,1,0),(1122,1,1,1,'Contacts',' Quid, quod homines infima fortuna, nulla spe rerum gerendarum, opifices denique delectantur historia? At eum nihili facit; Mihi quidem Antiochum, quem audis, satis belle videris attendere. Illa tamen simplicia, vestra versuta. Primum Theophrasti, Strato, physicum se voluit; Duo Reges: constructio interrete. Sed utrum hortandus es nobis, Luci, inquit, an etiam tua sponte propensus es? Si quicquam extra virtutem habeatur in bonis. \n\n','2016-02-14 21:53:29','2016-02-14 23:25:22',NULL,NULL,0,1,0),(1123,1,1,1,'Contacts',' Quae fere omnia appellantur uno ingenii nomine, easque virtutes qui habent, ingeniosi vocantur. Id Sextilius factum negabat. Sed quanta sit alias, nunc tantum possitne esse tanta. Duo Reges: constructio interrete. Quid turpius quam sapientis vitam ex insipientium sermone pendere? Facit enim ille duo seiuncta ultima bonorum, quae ut essent vera, coniungi debuerunt; Nam quid possumus facere melius? Cur igitur, inquam, res tam dissimiles eodem nomine appellas? \n\n','2016-02-14 21:53:30','2016-02-14 23:25:22',NULL,NULL,0,1,0),(1124,1,1,1,'Accounts','','2016-02-14 23:25:23','2016-02-14 23:25:23',NULL,NULL,0,1,0),(1125,1,1,1,'Contacts',' Incommoda autem et commoda-ita enim estmata et dustmata appello-communia esse voluerunt, paria noluerunt. Sed ut iis bonis erigimur, quae expectamus, sic laetamur iis, quae recordamur. Nunc ita separantur, ut disiuncta sint, quo nihil potest esse perversius. Quae quo sunt excelsiores, eo dant clariora indicia naturae. \n\n','2016-02-14 21:53:30','2016-02-14 23:25:23',NULL,NULL,0,1,0),(1126,1,1,1,'Contacts',' Hoc tu nunc in illo probas. In quibus doctissimi illi veteres inesse quiddam caeleste et divinum putaverunt. Nummus in Croesi divitiis obscuratur, pars est tamen divitiarum. Si longus, levis dictata sunt. \n\n','2016-02-14 21:53:31','2016-02-14 23:25:24',NULL,NULL,0,1,0),(1127,1,1,1,'Accounts','','2016-02-14 23:25:24','2016-02-14 23:25:24',NULL,NULL,0,1,0),(1128,1,1,1,'Contacts',' Erat enim Polemonis. Quid enim est a Chrysippo praetermissum in Stoicis? Aeque enim contingit omnibus fidibus, ut incontentae sint. Tria genera bonorum; Quae fere omnia appellantur uno ingenii nomine, easque virtutes qui habent, ingeniosi vocantur. Estne, quaeso, inquam, sitienti in bibendo voluptas? Duo Reges: constructio interrete. Videamus animi partes, quarum est conspectus illustrior; Immo alio genere; Aufert enim sensus actionemque tollit omnem. \n\n','2016-02-14 21:53:32','2016-02-14 23:25:24',NULL,NULL,0,1,0),(1129,1,1,1,'Contacts',' Ubi ut eam caperet aut quando? Quid ergo aliud intellegetur nisi uti ne quae pars naturae neglegatur? Itaque haec cum illis est dissensio, cum Peripateticis nulla sane. Idem iste, inquam, de voluptate quid sentit? \n\n','2016-02-14 21:53:33','2016-02-14 23:25:25',NULL,NULL,0,1,0),(1130,1,1,1,'Contacts',' Illa videamus, quae a te de amicitia dicta sunt. Cuius ad naturam apta ratio vera illa et summa lex a philosophis dicitur. Duo Reges: constructio interrete. Qui non moveatur et offensione turpitudinis et comprobatione honestatis? Eadem nunc mea adversum te oratio est. Tum ille timide vel potius verecunde: Facio, inquit. \n\n','2016-02-14 21:53:33','2016-02-14 23:25:25',NULL,NULL,0,1,0),(1131,1,1,1,'Contacts',' Ut nemo dubitet, eorum omnia officia quo spectare, quid sequi, quid fugere debeant? Hoc non est positum in nostra actione. Obsecro, inquit, Torquate, haec dicit Epicurus? At iam decimum annum in spelunca iacet. Quae quidem vel cum periculo est quaerenda vobis; Quamquam ab iis philosophiam et omnes ingenuas disciplinas habemus; Duo Reges: constructio interrete. \n\n','2016-02-14 21:53:34','2016-02-14 23:25:26',NULL,NULL,0,1,0),(1132,1,1,1,'Contacts',' Sic, et quidem diligentius saepiusque ista loquemur inter nos agemusque communiter. Terram, mihi crede, ea lanx et maria deprimet. Duo Reges: constructio interrete. At enim hic etiam dolore. Nam Pyrrho, Aristo, Erillus iam diu abiecti. Qualem igitur hominem natura inchoavit? Animi enim quoque dolores percipiet omnibus partibus maiores quam corporis. Inde sermone vario sex illa a Dipylo stadia confecimus. \n\n','2016-02-14 21:53:35','2016-02-14 23:25:26',NULL,NULL,0,1,0),(1133,1,1,1,'Contacts',' Duo enim genera quae erant, fecit tria. Quod quidem iam fit etiam in Academia. Quae cum essent dicta, discessimus. Sed quot homines, tot sententiae; Vide, quaeso, rectumne sit. Eaedem res maneant alio modo. Duo Reges: constructio interrete. Si verbum sequimur, primum longius verbum praepositum quam bonum. Illa videamus, quae a te de amicitia dicta sunt. Hoc loco tenere se Triarius non potuit. \n\n','2016-02-14 21:53:35','2016-02-14 23:25:27',NULL,NULL,0,1,0),(1134,1,1,1,'Contacts',' Si qua in iis corrigere voluit, deteriora fecit. Primum cur ista res digna odio est, nisi quod est turpis? Sic, et quidem diligentius saepiusque ista loquemur inter nos agemusque communiter. Eaedem enim utilitates poterunt eas labefactare atque pervertere. Duo Reges: constructio interrete. Si verbum sequimur, primum longius verbum praepositum quam bonum. Si verbum sequimur, primum longius verbum praepositum quam bonum. Mihi enim erit isdem istis fortasse iam utendum. Vitiosum est enim in dividendo partem in genere numerare. Atque haec ita iustitiae propria sunt, ut sint virtutum reliquarum communia. Sapiens autem semper beatus est et est aliquando in dolore; Atqui reperies, inquit, in hoc quidem pertinacem; \n\n','2016-02-14 21:53:36','2016-02-14 23:25:27',NULL,NULL,0,1,0),(1135,1,1,1,'Contacts',' Sit enim idem caecus, debilis. Non est ista, inquam, Piso, magna dissensio. Causa autem fuit huc veniendi ut quosdam hinc libros promerem. Ego quoque, inquit, didicerim libentius si quid attuleris, quam te reprehenderim. Qui autem diffidet perpetuitati bonorum suorum, timeat necesse est, ne aliquando amissis illis sit miser. Deinde disputat, quod cuiusque generis animantium statui deceat extremum. Si enim ita est, vide ne facinus facias, cum mori suadeas. Duo Reges: constructio interrete. Duo enim genera quae erant, fecit tria. \n\n','2016-02-14 21:53:37','2016-02-14 23:2