onstructio interrete. Quae quidem sapientes sequuntur duce natura tamquam videntes; Sed tamen intellego quid velit. Nec lapathi suavitatem acupenseri Galloni Laelius anteponebat, sed suavitatem ipsam neglegebat; \n\n','2016-02-14 21:55:25','2016-02-14 23:26:50',NULL,NULL,0,1,0),(1294,1,1,1,'Contacts',' Si stante, hoc natura videlicet vult, salvam esse se, quod concedimus; Ad quorum et cognitionem et usum iam corroborati natura ipsa praeeunte deducimur. Huius ego nunc auctoritatem sequens idem faciam. Duo Reges: constructio interrete. At, si voluptas esset bonum, desideraret. Omnis enim est natura diligens sui. Nam Pyrrho, Aristo, Erillus iam diu abiecti. Huic mori optimum esse propter desperationem sapientiae, illi propter spem vivere. \n\n','2016-02-14 21:55:26','2016-02-14 23:26:51',NULL,NULL,0,1,0),(1295,1,1,1,'Contacts',' Quam ob rem tandem, inquit, non satisfacit? Apparet statim, quae sint officia, quae actiones. Hoc tu nunc in illo probas. Vitiosum est enim in dividendo partem in genere numerare. \n\n','2016-02-14 21:55:27','2016-02-14 23:26:51',NULL,NULL,0,1,0),(1296,1,1,1,'Contacts',' Sed ad rem redeamus; Unum est sine dolore esse, alterum cum voluptate. Cur deinde Metrodori liberos commendas? Haec bene dicuntur, nec ego repugno, sed inter sese ipsa pugnant. Sint modo partes vitae beatae. Contemnit enim disserendi elegantiam, confuse loquitur. Ita relinquet duas, de quibus etiam atque etiam consideret. Nemo nostrum istius generis asotos iucunde putat vivere. Duo Reges: constructio interrete. An est aliquid, quod te sua sponte delectet? \n\n','2016-02-14 21:55:27','2016-02-14 23:26:51',NULL,NULL,0,1,0),(1297,1,1,1,'Contacts',' Si enim ad populum me vocas, eum. Venit enim mihi Platonis in mentem, quem accepimus primum hic disputare solitum; Duo Reges: constructio interrete. \n\n','2016-02-14 21:55:28','2016-02-14 23:26:52',NULL,NULL,0,1,0),(1298,1,1,1,'Contacts',' Haec dicuntur fortasse ieiunius; Hunc vos beatum; Serpere anguiculos, nare anaticulas, evolare merulas, cornibus uti videmus boves, nepas aculeis. Cur ipse Pythagoras et Aegyptum lustravit et Persarum magos adiit? \n\n','2016-02-14 21:55:29','2016-02-14 23:26:52',NULL,NULL,0,1,0),(1299,1,1,1,'Contacts',' Sed tamen est aliquid, quod nobis non liceat, liceat illis. Aliter homines, aliter philosophos loqui putas oportere? Quae cum dixisset, finem ille. Duo Reges: constructio interrete. Ergo in gubernando nihil, in officio plurimum interest, quo in genere peccetur. Si longus, levis. Quam ob rem tandem, inquit, non satisfacit? Ergo, inquit, tibi Q. Progredientibus autem aetatibus sensim tardeve potius quasi nosmet ipsos cognoscimus. Beatum, inquit. \n\n','2016-02-14 21:55:30','2016-02-14 23:26:53',NULL,NULL,0,1,0),(1300,1,1,1,'Contacts',' Hoc est non dividere, sed frangere. Ergo, inquit, tibi Q. Nihil opus est exemplis hoc facere longius. \n\n','2016-02-14 21:55:30','2016-02-14 23:26:53',NULL,NULL,0,1,0),(1301,1,1,1,'Contacts',' An hoc usque quaque, aliter in vita? Qua igitur re ab deo vincitur, si aeternitate non vincitur? Quis Aristidem non mortuum diligit? Universa enim illorum ratione cum tota vestra confligendum puto. Si mala non sunt, iacet omnis ratio Peripateticorum. Quid nunc honeste dicit? \n\n','2016-02-14 21:55:31','2016-02-14 23:26:54',NULL,NULL,0,1,0),(1302,1,1,1,'Contacts',' Ut proverbia non nulla veriora sint quam vestra dogmata. Sed ego in hoc resisto; Sint modo partes vitae beatae. Sed tamen intellego quid velit. Duo Reges: constructio interrete. Esse enim quam vellet iniquus iustus poterat inpune. \n\n','2016-02-14 21:55:32','2016-02-14 23:26:54',NULL,NULL,0,1,0),(1303,1,1,1,'Accounts','','2016-02-14 23:26:55','2016-02-14 23:26:55',NULL,NULL,0,1,0),(1304,1,1,1,'Contacts',' An hoc usque quaque, aliter in vita? Restinguet citius, si ardentem acceperit. Suo genere perveniant ad extremum; Quae quidem sapientes sequuntur duce natura tamquam videntes; Cur tantas regiones barbarorum pedibus obiit, tot maria transmisit? An hoc usque quaque, aliter in vita? Duo Reges: constructio interrete. Estne, quaeso, inquam, sitienti in bibendo voluptas? \n\n','2016-02-14 21:55:32','2016-02-14 23:26:55',NULL,NULL,0,1,0),(1305,1,1,1,'Contacts',' Duo Reges: constructio interrete. Quod quidem nobis non saepe contingit. In his igitur partibus duabus nihil erat, quod Zeno commutare gestiret. Post enim Chrysippum eum non sane est disputatum. Id mihi magnum videtur. His similes sunt omnes, qui virtuti student levantur vitiis, levantur erroribus, nisi forte censes Ti. Hanc ergo intuens debet institutum illud quasi signum absolvere. Quodsi ipsam honestatem undique pertectam atque absolutam. Verba tu fingas et ea dicas, quae non sentias? Quae cum essent dicta, finem fecimus et ambulandi et disputandi. Saepe ab Aristotele, a Theophrasto mirabiliter est laudata per se ipsa rerum scientia; \n\n','2016-02-14 21:55:33','2016-02-14 23:26:56',NULL,NULL,0,1,0),(1306,1,1,1,'Accounts','','2016-02-14 23:26:56','2016-02-14 23:26:56',NULL,NULL,0,1,0),(1307,1,1,1,'Contacts',' Modo etiam paulum ad dexteram de via declinavi, ut ad Pericli sepulcrum accederem. Nemo nostrum istius generis asotos iucunde putat vivere. Bestiarum vero nullum iudicium puto. Potius inflammat, ut coercendi magis quam dedocendi esse videantur. \n\n','2016-02-14 21:55:34','2016-02-14 23:26:57',NULL,NULL,0,1,0),(1308,1,1,1,'Contacts',' Etsi qui potest intellegi aut cogitari esse aliquod animal, quod se oderit? Duo enim genera quae erant, fecit tria. Nulla profecto est, quin suam vim retineat a primo ad extremum. Restinguet citius, si ardentem acceperit. Non autem hoc: igitur ne illud quidem. Duo Reges: constructio interrete. Quae hic rei publicae vulnera inponebat, eadem ille sanabat. Non potes, nisi retexueris illa. Quod quidem iam fit etiam in Academia. Sed quid ages tandem, si utilitas ab amicitia, ut fit saepe, defecerit? \n\n','2016-02-14 21:55:35','2016-02-14 23:26:58',NULL,NULL,0,1,0),(1309,1,1,1,'Accounts','','2016-02-14 23:26:58','2016-02-14 23:26:58',NULL,NULL,0,1,0),(1310,1,1,1,'Contacts',' Itaque sensibus rationem adiunxit et ratione effecta sensus non reliquit. Ut nemo dubitet, eorum omnia officia quo spectare, quid sequi, quid fugere debeant? Is ita vivebat, ut nulla tam exquisita posset inveniri voluptas, qua non abundaret. Tamen a proposito, inquam, aberramus. Sed nunc, quod agimus; Duo Reges: constructio interrete. Quia, si mala sunt, is, qui erit in iis, beatus non erit. Hoc Hieronymus summum bonum esse dixit. Deinde disputat, quod cuiusque generis animantium statui deceat extremum. \n\n','2016-02-14 21:55:35','2016-02-14 23:26:59',NULL,NULL,0,1,0),(1311,1,1,1,'Contacts',' Itaque a sapientia praecipitur se ipsam, si usus sit, sapiens ut relinquat. Cyrenaici quidem non recusant; Quod autem principium officii quaerunt, melius quam Pyrrho; Quae contraria sunt his, malane? Quae cum dixisset paulumque institisset, Quid est? Duo Reges: constructio interrete. Qui non moveatur et offensione turpitudinis et comprobatione honestatis? \n\n','2016-02-14 21:55:36','2016-02-14 23:26:59',NULL,NULL,0,1,0),(1312,1,1,1,'Contacts',' Praeclare hoc quidem. Haec para/doca illi, nos admirabilia dicamus. Ne amores quidem sanctos a sapiente alienos esse arbitrantur. Quis hoc dicit? Duo Reges: constructio interrete. \n\n','2016-02-14 21:55:42','2016-02-14 23:27:00',NULL,NULL,0,1,0),(1313,1,1,1,'Contacts',' Esse enim, nisi eris, non potes. Ego vero isti, inquam, permitto. Ait enim se, si uratur, Quam hoc suave! dicturum. Quod autem principium officii quaerunt, melius quam Pyrrho; Utinam quidem dicerent alium alio beatiorem! Iam ruinas videres. Duo Reges: constructio interrete. Bonum liberi: misera orbitas. Quae quidem sapientes sequuntur duce natura tamquam videntes; Sed quid minus probandum quam esse aliquem beatum nec satis beatum? \n\n','2016-02-14 21:55:42','2016-02-14 23:27:00',NULL,NULL,0,1,0),(1314,1,1,1,'Contacts',' Ab his oratores, ab his imperatores ac rerum publicarum principes extiterunt. Sed tamen est aliquid, quod nobis non liceat, liceat illis. Illa argumenta propria videamus, cur omnia sint paria peccata. Terram, mihi crede, ea lanx et maria deprimet. Hoc enim identidem dicitis, non intellegere nos quam dicatis voluptatem. Qua ex cognitione facilior facta est investigatio rerum occultissimarum. Quod, inquit, quamquam voluptatibus quibusdam est saepe iucundius, tamen expetitur propter voluptatem. Duo Reges: constructio interrete. Non modo carum sibi quemque, verum etiam vehementer carum esse? Virtutis, magnitudinis animi, patientiae, fortitudinis fomentis dolor mitigari solet. \n\n','2016-02-14 21:55:43','2016-02-14 23:27:01',NULL,NULL,0,1,0),(1315,1,1,1,'Contacts',' Qui enim existimabit posse se miserum esse beatus non erit. Idemque diviserunt naturam hominis in animum et corpus. Ne amores quidem sanctos a sapiente alienos esse arbitrantur. Sed virtutem ipsam inchoavit, nihil amplius. Restinguet citius, si ardentem acceperit. Nam ante Aristippus, et ille melius. Duo Reges: constructio interrete. \n\n','2016-02-14 21:55:44','2016-02-14 23:27:02',NULL,NULL,0,1,0),(1316,1,1,1,'Accounts','','2016-02-14 23:27:02','2016-02-14 23:27:02',NULL,NULL,0,1,0),(1317,1,1,1,'Contacts',' Proclivi currit oratio. Quid enim? Torquatus, is qui consul cum Cn. Sed residamus, inquit, si placet. Itaque hic ipse iam pridem est reiectus; Itaque si aut requietem natura non quaereret aut eam posset alia quadam ratione consequi. Heri, inquam, ludis commissis ex urbe profectus veni ad vesperum. Istam voluptatem perpetuam quis potest praestare sapienti? Duo Reges: constructio interrete. \n\n','2016-02-14 21:55:45','2016-02-14 23:27:02',NULL,NULL,0,1,0),(1318,1,1,1,'Accounts','','2016-02-14 23:27:03','2016-02-14 23:27:03',NULL,NULL,0,1,0),(1319,1,1,1,'Contacts',' Cyrenaici quidem non recusant; Videmus igitur ut conquiescere ne infantes quidem possint. Simus igitur contenti his. Piso igitur hoc modo, vir optimus tuique, ut scis, amantissimus. Duo Reges: constructio interrete. Nec hoc ille non vidit, sed verborum magnificentia est