e quid sentit? Eaedem enim utilitates poterunt eas labefactare atque pervertere. Quae duo sunt, unum facit. Duo Reges: constructio interrete. Pisone in eo gymnasio, quod Ptolomaeum vocatur, unaque nobiscum Q. \n\n','2016-02-14 21:55:48','2016-02-14 23:27:06',NULL,NULL,0,1,0),(1325,1,1,1,'Contacts',' Maximas vero virtutes iacere omnis necesse est voluptate dominante. Si enim ad populum me vocas, eum. Proclivi currit oratio. Deinde prima illa, quae in congressu solemus: Quid tu, inquit, huc? Sed ego in hoc resisto; Dicet pro me ipsa virtus nec dubitabit isti vestro beato M. Duo Reges: constructio interrete. Reguli reiciendam; \n\n','2016-02-14 21:55:49','2016-02-14 23:27:06',NULL,NULL,0,1,0),(1326,1,1,1,'Accounts','','2016-02-14 23:27:07','2016-02-14 23:27:07',NULL,NULL,0,1,0),(1327,1,1,1,'Contacts',' Nec hoc ille non vidit, sed verborum magnificentia est et gloria delectatus. Addidisti ad extremum etiam indoctum fuisse. Respondent extrema primis, media utrisque, omnia omnibus. Omnia contraria, quos etiam insanos esse vultis. Quid de Pythagora? \n\n','2016-02-14 21:55:50','2016-02-14 23:27:07',NULL,NULL,0,1,0),(1328,1,1,1,'Contacts',' Quod praeceptum quia maius erat, quam ut ab homine videretur, idcirco assignatum est deo. Duo Reges: constructio interrete. Quo modo autem philosophus loquitur? Conferam tecum, quam cuique verso rem subicias; Bonum incolumis acies: misera caecitas. Hoc loco tenere se Triarius non potuit. Atqui pugnantibus et contrariis studiis consiliisque semper utens nihil quieti videre, nihil tranquilli potest. \n\n','2016-02-14 21:55:50','2016-02-14 23:27:08',NULL,NULL,0,1,0),(1329,1,1,1,'Contacts',' Si qua in iis corrigere voluit, deteriora fecit. Beatus autem esse in maximarum rerum timore nemo potest. An est aliquid per se ipsum flagitiosum, etiamsi nulla comitetur infamia? Sed ego in hoc resisto; Eodem modo is enim tibi nemo dabit, quod, expetendum sit, id esse laudabile. Qua igitur re ab deo vincitur, si aeternitate non vincitur? Cur igitur easdem res, inquam, Peripateticis dicentibus verbum nullum est, quod non intellegatur? Duo Reges: constructio interrete. Negabat igitur ullam esse artem, quae ipsa a se proficisceretur; Sed ea mala virtuti magnitudine obruebantur. \n\n','2016-02-14 21:55:51','2016-02-14 23:27:09',NULL,NULL,0,1,0),(1330,1,1,1,'Contacts',' Si quidem, inquit, tollerem, sed relinquo. Quare obscurentur etiam haec, quae secundum naturam esse dicimus, in vita beata; Ut non sine causa ex iis memoriae ducta sit disciplina. At quicum ioca seria, ut dicitur, quicum arcana, quicum occulta omnia? Ita enim vivunt quidam, ut eorum vita refellatur oratio. \n\n','2016-02-14 21:55:52','2016-02-14 23:27:09',NULL,NULL,0,1,0),(1331,1,1,1,'Contacts',' Quae cum dixisset paulumque institisset, Quid est? Non autem hoc: igitur ne illud quidem. Facile est hoc cernere in primis puerorum aetatulis. Duo Reges: constructio interrete. Hoc est non dividere, sed frangere. Satis est tibi in te, satis in legibus, satis in mediocribus amicitiis praesidii. At ille non pertimuit saneque fidenter: Istis quidem ipsis verbis, inquit; Consequentia exquirere, quoad sit id, quod volumus, effectum. Suo genere perveniant ad extremum; Ego vero volo in virtute vim esse quam maximam; Quae quidem vel cum periculo est quaerenda vobis; \n\n','2016-02-14 21:55:52','2016-02-14 23:27:10',NULL,NULL,0,1,0),(1332,1,1,1,'Contacts',' Quia dolori non voluptas contraria est, sed doloris privatio. Videamus animi partes, quarum est conspectus illustrior; Quis enim redargueret? Nos paucis ad haec additis finem faciamus aliquando; Aliter homines, aliter philosophos loqui putas oportere? Expectoque quid ad id, quod quaerebam, respondeas. Nos cum te, M. Duo Reges: constructio interrete. Et harum quidem rerum facilis est et expedita distinctio. Quid ergo attinet gloriose loqui, nisi constanter loquare? \n\n','2016-02-14 21:55:53','2016-02-14 23:27:10',NULL,NULL,0,1,0),(1333,1,1,1,'Contacts',' Qua ex cognitione facilior facta est investigatio rerum occulti