stimabit posse se miserum esse beatus non erit. Sed potestne rerum maior esse dissensio? \n\n','2016-02-14 21:56:17','2016-02-14 23:27:29',NULL,NULL,0,1,0),(1370,1,1,1,'Contacts',' Hoc loco discipulos quaerere videtur, ut, qui asoti esse velint, philosophi ante fiant. Sic vester sapiens magno aliquo emolumento commotus cicuta, si opus erit, dimicabit. Ex ea difficultate illae fallaciloquae, ut ait Accius, malitiae natae sunt. Sine ea igitur iucunde negat posse se vivere? Et non ex maxima parte de tota iudicabis? Peccata paria. Duo Reges: constructio interrete. Quod autem ratione actum est, id officium appellamus. An eiusdem modi? \n\n','2016-02-14 21:56:17','2016-02-14 23:27:30',NULL,NULL,0,1,0),(1371,1,1,1,'Contacts',' Non quaero, quid dicat, sed quid convenienter possit rationi et sententiae suae dicere. Negat esse eam, inquit, propter se expetendam. Indicant pueri, in quibus ut in speculis natura cernitur. Non enim solum Torquatus dixit quid sentiret, sed etiam cur. Duo Reges: constructio interrete. Quid censes in Latino fore? \n\n','2016-02-14 21:56:18','2016-02-14 23:27:31',NULL,NULL,0,1,0),(1372,1,1,1,'Contacts',' An ea, quae per vinitorem antea consequebatur, per se ipsa curabit? Cur iustitia laudatur? Primum cur ista res digna odio est, nisi quod est turpis? Nummus in Croesi divitiis obscuratur, pars est tamen divitiarum. Cur post Tarentum ad Archytam? Callipho ad virtutem nihil adiunxit nisi voluptatem, Diodorus vacuitatem doloris. Duo Reges: constructio interrete. \n\n','2016-02-14 21:56:19','2016-02-14 23:27:32',NULL,NULL,0,1,0),(1373,1,1,1,'Contacts',' Quae duo sunt, unum facit. Tertium autem omnibus aut maximis rebus iis, quae secundum naturam sint, fruentem vivere. Sed ea mala virtuti magnitudine obruebantur. Idem adhuc; Suo genere perveniant ad extremum; \n\n','2016-02-14 21:56:20','2016-02-14 23:27:32',NULL,NULL,0,1,0),(1374,1,1,1,'Accounts','','2016-02-14 23:27:33','2016-02-14 23:27:33',NULL,NULL,0,1,0),(1375,1,1,1,'Contacts',' Plane idem, inquit, e