2016-02-14 21:56:22','2016-02-14 23:27:34',NULL,NULL,0,1,0),(1379,1,1,1,'Contacts',' Tu quidem reddes; Habes, inquam, Cato, formam eorum, de quibus loquor, philosophorum. Quae cum dixisset paulumque institisset, Quid est? Itaque mihi non satis videmini considerare quod iter sit naturae quaeque progressio. \n\n','2016-02-14 21:56:23','2016-02-14 23:27:35',NULL,NULL,0,1,0),(1380,1,1,1,'Contacts',' Omnes enim iucundum motum, quo sensus hilaretur. Minime vero, inquit ille, consentit. Atqui reperies, inquit, in hoc quidem pertinacem; Minime vero, inquit ille, consentit. \n\n','2016-02-14 21:56:24','2016-02-14 23:27:35',NULL,NULL,0,1,0),(1381,1,1,1,'Contacts',' Sic consequentibus vestris sublatis prima tolluntur. Esse enim quam vellet iniquus iustus poterat inpune. Summum a vobis bonum voluptas dicitur. Verba tu fingas et ea dicas, quae non sentias? Quas enim kakaw Graeci appellant, vitia malo quam malitias nominare. Quod iam a me expectare noli. \n\n','2016-02-14 21:56:24','2016-02-14 23:27:36',NULL,NULL,0,1,0),(1382,1,1,1,'Contacts',' Si stante, hoc natura videlicet vult, salvam esse se, quod concedimus; Duo Reges: constructio interrete. \n\n','2016-02-14 21:56:25','2016-02-14 23:27:36',NULL,NULL,0,1,0),(1383,1,1,1,'Contacts',' Innumerabilia dici possunt in hanc sententiam, sed non necesse est. Nam illud vehementer repugnat, eundem beatum esse et multis malis oppressum. \n\n','2016-02-14 21:56:26','2016-02-14 23:27:37',NULL,NULL,0,1,0),(1384,1,1,1,'Contacts',' Nos quidem Virtutes sic natae sumus, ut tibi serviremus, aliud negotii nihil habemus. Putabam equidem satis, inquit, me dixisse. Qua ex cognitione facilior facta est investigatio rerum occultissimarum. Quam illa ardentis amores excitaret sui! Cur tandem? Si alia sentit, inquam, alia loquitur, numquam intellegam quid sentiat; Cur deinde Metrodori liberos commendas? Duo Reges: constructio interrete. Quis hoc dicit? Vulgo enim dicitur: Iucundi acti labores, nec male Euripidesconcludam, si potero, Latine; \n\n','2016-