 Reges: constructio interrete. Age nunc isti doceant, vel tu potius quis enim ista melius? Quis enim est, qui non videat haec esse in natura rerum tria? Tu vero, inquam, ducas licet, si sequetur; Quae in controversiam veniunt, de iis, si placet, disseramus. Ergo instituto veterum, quo etiam Stoici utuntur, hinc capiamus exordium. Non est igitur summum malum dolor. Quae cum dixisset, finem ille. Unum est sine dolore esse, alterum cum voluptate. Atqui pugnantibus et contrariis studiis consiliisque semper utens nihil quieti videre, nihil tranquilli potest. Aliter homines, aliter philosophos loqui putas oportere? Si longus, levis. \n\n','2016-02-14 21:57:19','2016-02-14 23:28:16',NULL,NULL,0,1,0),(1458,1,1,1,'Contacts',' Quae diligentissime contra Aristonem dicuntur a Chryippo. Ut placet, inquit, etsi enim illud erat aptius, aequum cuique concedere. Itaque primos congressus copulationesque et consuetudinum instituendarum voluntates fieri propter voluptatem; Quis istum dolorem timet? Qui autem esse poteris, nisi te amor ipse ceperit? Quae autem natura suae primae institutionis oblita est? \n\n','2016-02-14 21:57:20','2016-02-14 23:28:16',NULL,NULL,0,1,0),(1459,1,1,1,'Accounts','','2016-02-14 23:28:17','2016-02-14 23:28:17',NULL,NULL,0,1,0),(1460,1,1,1,'Contacts',' Quae cum praeponunt, ut sit aliqua rerum selectio, naturam videntur sequi; Mihi enim satis est, ipsis non satis. Non quam nostram quidem, inquit Pomponius iocans; Aperiendum est igitur, quid sit voluptas; Quod autem principium officii quaerunt, melius quam Pyrrho; Quid enim de amicitia statueris utilitatis causa expetenda vides. Quodsi ipsam honestatem undique pertectam atque absolutam. Ergo id est convenienter naturae vivere, a natura discedere. \n\n','2016-02-14 21:57:21','2016-02-14 23:28:17',NULL,NULL,0,1,0),(1461,1,1,1,'Contacts',' Vide, quantum, inquam, fallare, Torquate. De vacuitate doloris eadem sententia erit. De quibus cupio scire quid sentias. Aliter enim nosmet ipsos nosse non possumus. Nummus in C