ptas, sed quid ille dicat. Quid enim est a Chrysippo praetermissum in Stoicis? Haec bene dicuntur, nec ego repugno, sed inter sese ipsa pugnant. Non dolere, inquam, istud quam vim habeat postea videro; \n\n','2016-02-14 21:57:27','2016-02-14 23:28:23',NULL,NULL,0,1,0),(1472,1,1,1,'Contacts',' Quis istum dolorem timet? Tamen a proposito, inquam, aberramus. Inde sermone vario sex illa a Dipylo stadia confecimus. Quamquam haec quidem praeposita recte et reiecta dicere licebit. Non enim, si omnia non sequebatur, idcirco non erat ortus illinc. Duo Reges: constructio interrete. Et nemo nimium beatus est; \n\n','2016-02-14 21:57:28','2016-02-14 23:28:23',NULL,NULL,0,1,0),(1473,1,1,1,'Contacts',' Urgent tamen et nihil remittunt. Quod ea non occurrentia fingunt, vincunt Aristonem; Quod iam a me expectare noli. Scio enim esse quosdam, qui quavis lingua philosophari possint; Ad eos igitur converte te, quaeso. Duo Reges: constructio interrete. Ergo instituto veterum, quo etiam Stoici utuntur, hinc capiamus exordium. \n\n','2016-02-14 21:57:28','2016-02-14 23:28:24',NULL,NULL,0,1,0),(1474,1,1,1,'Contacts',' Sed haec nihil sane ad rem; Nihil illinc huc pervenit. Ita relinquet duas, de quibus etiam atque etiam consideret. Teneo, inquit, finem illi videri nihil dolere. Dic in quovis conventu te omnia facere, ne doleas. \n\n','2016-02-14 21:57:29','2016-02-14 23:28:24',NULL,NULL,0,1,0),(1475,1,1,1,'Contacts',' Atque haec coniunctio confusioque virtutum tamen a philosophis ratione quadam distinguitur. Non quam nostram quidem, inquit Pomponius iocans; Longum est enim ad omnia respondere, quae a te dicta sunt. Nos cum te, M. \n\n','2016-02-14 21:57:30','2016-02-14 23:28:25',NULL,NULL,0,1,0),(1476,1,1,1,'Contacts',' Etenim semper illud extra est, quod arte comprehenditur. Cur igitur, inquam, res tam dissimiles eodem nomine appellas? Tu vero, inquam, ducas licet, si sequetur; Quod quidem iam fit etiam in Academia. Sed non sunt in eo genere tantae commoditates corporis tamque productae temporibus tamque multae. Hoc non est positum in nostra actione. Duo Reges: constructio interrete. Quacumque enim ingredimur, in aliqua historia vestigium ponimus. \n\n','2016-02-14 21:57:30','2016-02-14 23:28:25',NULL,NULL,0,1,0),(1477,1,1,1,'Contacts',' Mihi, inquam, qui te id ipsum rogavi? Duo Reges: constructio interrete. Tollenda est atque extrahenda radicitus. Nam ista vestra: Si gravis, brevis; Si verbum sequimur, primum longius verbum praepositum quam bonum. Nemo nostrum istius generis asotos iucunde putat vivere. Illud dico, ea, quae dicat, praeclare inter se cohaerere. De ingenio eius in his disputationibus, non de moribus quaeritur. \n\n','2016-02-14 21:57:31','2016-02-14 23:28:26',NULL,NULL,0,1,0),(1478,1,1,1,'Contacts',' Eam si varietatem diceres, intellegerem, ut etiam non dicente te intellego; Mihi quidem Antiochum, quem audis, satis belle videris attendere. Quae cum essent dicta, discessimus. Nam si amitti vita beata potest, beata esse non potest. Unum nescio, quo modo possit, si luxuriosus sit, finitas cupiditates habere. Duo Reges: constructio interrete. \n\n','2016-02-14 21:57:32','2016-02-14 23:28:27',NULL,NULL,0,1,0),(1479,1,1,1,'Contacts',' Nondum autem explanatum satis, erat, quid maxime natura vellet. Si quicquam extra virtutem habeatur in bonis. Nam si propter voluptatem, quae est ista laus, quae possit e macello peti? Immo istud quidem, inquam, quo loco quidque, nisi iniquum postulo, arbitratu meo. \n\n','2016-02-14 21:57:33','2016-02-14 23:28:27',NULL,NULL,0,1,0),(1480,1,1,1,'Contacts',' Uterque enim summo bono fruitur, id est voluptate. Duo Reges: constructio interrete. Quem Tiberina descensio festo illo die tanto gaudio affecit, quanto L. Itaque fecimus. \n\n','2016-02-14 21:57:33','2016-02-14 23:28:28',NULL,NULL,0,1,0),(1481,1,1,1,'Contacts',' Dic in quovis conventu te omnia facere, ne doleas. Illud quaero, quid ei, qui in voluptate summum bonum ponat, consentaneum sit dicere. Duo Reges: constructio interrete. Universa enim illorum ratione cum tota vestra confligendum puto. Te ipsum, dignissimum maioribus tuis, voluptasne induxit, ut adolescentulus eriperes P. Faceres tu quidem, Torquate, haec omnia; Ait enim se, si uratur, Quam hoc suave! dicturum. \n\n','2016-02-14 21:57:34','2016-02-14 23:28:28',NULL,NULL,0,1,0),(1482,1,1,1,'Contacts',' Conferam avum tuum Drusum cum C. Sed tamen intellego quid velit. Ergo id est convenienter naturae vivere, a natura discedere. Satis est ad hoc responsum. Ut placet, inquit, etsi enim illud erat aptius, aequum cuique concedere. Quibusnam praeteritis? Duo Reges: constructio interrete. In qua quid est boni praeter summam voluptatem, et eam sempiternam? \n\n','2016-02-14 21:57:35','2016-02-14 23:28:28',NULL,NULL,0,1,0),(1483,1,1,1,'Accounts','','2016-02-14 23:28:29','2016-02-14 23:28:29',NULL,NULL,0,1,0),(1484,1,1,1,'Contacts',' Age nunc isti doceant, vel tu potius quis enim ista melius? Eiuro, inquit adridens, iniquum, hac quidem de re; Traditur, inquit, ab Epicuro ratio neglegendi doloris. Quae in controversiam veniunt, de iis, si placet, disseramus. Aliter enim explicari, quod quaeritur, non potest. Possumusne ergo in vita summum bonum dicere, cum id ne in cena quidem posse videamur? \n\n','2016-02-14 21:57:35','2016-02-14 23:28:29',NULL,NULL,0,1,0),(1485,1,1,1,'Contacts',' Habent enim et bene longam et satis litigiosam disputationem. At multis malis affectus. Quid censes in Latino fore? Iam id ipsum absurdum, maximum malum neglegi. \n\n','2016-02-14 21:57:36','2016-02-14 23:28:30',NULL,NULL,0,1,0),(1486,1,1,1,'Contacts',' At ille pellit, qui permulcet sensum voluptate. Callipho ad virtutem nihil adiunxit nisi voluptatem, Diodorus vacuitatem doloris. Quis animo aequo videt eum, quem inpure ac flagitiose putet vivere? Duo Reges: constructio interrete. \n\n','2016-02-14 21:57:37','2016-02-14 23:28:30',NULL,NULL,0,1,0),(1487,1,1,1,'Contacts',' Refert tamen, quo modo. Quod quidem nobis non saepe contingit. Si qua in iis corrigere voluit, deteriora fecit. Hoc etsi multimodis reprehendi potest, tamen accipio, quod dant. Duo Reges: constructio interrete. Ita graviter et severe voluptatem secrevit a bono. Huius, Lyco, oratione locuples, rebus ipsis ielunior. Qui autem esse poteris, nisi te amor ipse ceperit? Dolere malum est: in crucem qui agitur, beatus esse non potest. Quod autem in homine praestantissimum atque optimum est, id deseruit. \n\n','2016-02-14 21:57:37','2016-02-14 23:28:31',NULL,NULL,0,1,0),(1488,1,1,1,'Contacts',' Quid autem habent admirationis, cum prope accesseris? Sed quid attinet de rebus tam apertis plura requirere? Ergo illi intellegunt quid Epicurus dicat, ego non intellego? Duo Reges: constructio interrete. Qui autem de summo bono dissentit de tota philosophiae ratione dissentit. Sit enim idem caecus, debilis. \n\n','2016-02-14 21:57:38','2016-02-14 23:28:31',NULL,NULL,0,1,0),(1489,1,1,1,'Contacts',' Cum id fugiunt, re eadem defendunt, quae Peripatetici, verba. Magna laus. Sed fac ista esse non inportuna; Nihil opus est exemplis hoc facere longius. Duo Reges: constructio interrete. Terram, mihi crede, ea lanx et maria deprimet. Ut pulsi recurrant? Quae similitudo in genere etiam humano apparet. Post enim Chrysippum eum non sane est disputatum. Murenam te accusante defenderem. Num quid tale Democritus? Sic enim censent, oportunitatis esse beate vivere. \n\n','2016-02-14 21:57:39','2016-02-14 23:28:32',NULL,NULL,0,1,0),(1490,1,1,1,'Contacts',' Ita enim vivunt quidam, ut eorum vita refellatur oratio. Duo Reges: constructio interrete. Non est igitur voluptas bonum. Duarum enim vitarum nobis erunt instituta capienda. Quid censes in Latino fore? Facillimum id quidem est, inquam. \n\n','2016-02-14 21:57:40','2016-02-14 23:28:32',NULL,NULL,0,1,0),(1491,1,1,1,'Contacts',' Si sapiens, ne tum quidem miser, cum ab Oroete, praetore Darei, in crucem actus est. Duo enim genera quae erant, fecit tria. Quis hoc dicit? Quod autem meum munus dicis non equidem recuso, sed te adiungo socium. At ille pellit, qui permulcet sensum voluptate. Sed quanta sit alias, nunc tantum possitne esse tanta. Hic ambiguo ludimur. Duo Reges: constructio interrete. \n\n','2016-02-14 21:57:40','2016-02-14 23:28:33',NULL,NULL,0,1,0),(1492,1,1,1,'Contacts',' Aufert enim sensus actionemque tollit omnem. Nulla erit controversia. Beatus autem esse in maximarum rerum timore nemo potest. Nam et complectitur verbis, quod vult, et dicit plane, quod intellegam; Nos vero, inquit ille; \n\n','2016-02-14 21:57:41','2016-02-14 23:28:33',NULL,NULL,0,1,0),(1493,1,1,1,'Contacts',' Eadem nunc mea adversum te oratio est. Qua ex cognitione facilior facta est investigatio rerum occultissimarum. Qui non moveatur et offensione turpitudinis et comprobatione honestatis? Habes, inquam, Cato, formam eorum, de quibus loquor, philosophorum. Semper enim ex eo, quod maximas partes continet latissimeque funditur, tota res appellatur. Vitiosum est enim in dividendo partem in genere numerare. \n\n','2016-02-14 21:57:42','2016-02-14 23:28:34',NULL,NULL,0,1,0),(1494,1,1,1,'Contacts',' Bonum valitudo: miser morbus. Illi enim inter se dissentiunt. Et harum quidem rerum facilis est et expedita distinctio. Quis contra in illa aetate pudorem, constantiam, etiamsi sua nihil intersit, non tamen diligat? Tum Torquatus: Prorsus, inquit, assentior; Hoc non est positum in nostra actione. Quae sequuntur igitur? Minime vero, inquit ille, consentit. \n\n','2016-02-14 21:57:44','2016-02-14 23:28:34',NULL,NULL,0,1,0),(1495,1,1,1,'Contacts',' Quid enim de amicitia statueris utilitatis causa expetenda vides. Vos autem cum perspicuis dubia debeatis illustrare, dubiis perspicua conamini tollere. Rhetorice igitur, inquam, nos mavis quam dialectice disputare? Duo Reges: constructio interrete. Nunc ita separantur, ut disiuncta sint, quo nihil potest esse perversius. Nec vero intermittunt aut admirationem earum rerum, quae sunt ab antiquis repertae, aut investigationem novarum. \n\n','2016-02-14 21:57:44','2016-02-14 23:28:35',NULL,NULL,0,1,0),(1496,1,1,1,'Contacts',' Mihi quidem Antiochum, quem audis, satis belle videris attendere. Sin tantum modo ad indicia veteris memoriae cognoscenda, curiosorum. Suam denique cuique naturam esse ad vivendum ducem. Atqui, inquit, si Stoicis concedis ut virtus sola, si adsit vitam efficiat beatam, concedis etiam Peripateticis. Haec bene dicuntur, nec ego repugno, sed inter sese ipsa pugnant. Obsecro, inquit, Torquate, haec dicit Epicurus? Duo Reges: constructio interrete. Memini me adesse P. At cum de plurimis eadem dicit, tum certe de maximis. Neque enim disputari sine reprehensione nec cum iracundia aut pertinacia recte disputari potest. \n\n','2016-02-14 21:57:45','2016-02-14 23:28:35',NULL,NULL,0,1,0),(1497,1,1,1,'Contacts',' An nisi populari fama? Quod si ita se habeat, non possit beatam praestare vitam sapientia. Expressa vero in iis aetatibus, quae iam confirmatae sunt. Habent enim et bene longam et satis litigiosam disputationem. Duo Reges: constructio interrete. Non est igitur voluptas bonum. \n\n','2016-02-14 21:57:46','2016-02-14 23:28:36',NULL,NULL,0,1,0),(1498,1,1,1,'Contacts',' Sic, et quidem diligentius saepiusque ista loquemur inter nos agemusque communiter. Praetereo multos, in bis doctum hominem et suavem, Hieronymum, quem iam cur Peripateticum appellem nescio. Immo videri fortasse. Duo Reges: constructio interrete. Est autem etiam actio quaedam corporis, quae motus et status naturae congruentis tenet; Sed fac ista esse non inportuna; Graecum enim hunc versum nostis omnes-: Suavis laborum est praeteritorum memoria. Eaedem enim utilitates poterunt eas labefactare atque pervertere. \n\n','2016-02-14 21:57:47','2016-02-14 23:28:36',NULL,NULL,0,1,0),(1499,1,1,1,'Contacts',' Tuo vero id quidem, inquam, arbitratu. Quamquam tu hanc copiosiorem etiam soles dicere. Cum id quoque, ut cupiebat, audivisset, evelli iussit eam, qua erat transfixus, hastam. Mihi vero, inquit, placet agi subtilius et, ut ipse dixisti, pressius. Duo Reges: constructio interrete. Animum autem reliquis rebus ita perfecit, ut corpus; \n\n','2016-02-14 21:57:47','2016-02-14 23:28:37',NULL,NULL,0,1,0),(1500,1,1,1,'Contacts',' Quis est tam dissimile homini. Cur ipse Pythagoras et Aegyptum lustravit et Persarum magos adiit? Videamus animi partes, quarum est conspectus illustrior; Bonum incolumis acies: misera caecitas. \n\n','2016-02-14 21:57:48','2016-02-14 23:28:38',NULL,NULL,0,1,0),(1501,1,1,1,'Accounts','','2016-02-14 23:28:38','2016-02-14 23:28:38',NULL,NULL,0,1,0),(1502,1,1,1,'Contacts',' Primum Theophrasti, Strato, physicum se voluit; Istam voluptatem, inquit, Epicurus ignorat? Non quaeritur autem quid naturae tuae consentaneum sit, sed quid disciplinae. Nam et complectitur verbis, quod vult, et dicit plane, quod intellegam; Sed residamus, inquit, si placet. Duo Reges: constructio interrete. Respondent extrema primis, media utrisque, omnia omnibus. Expectoque quid ad id, quod quaerebam, respondeas. \n\n','2016-02-14 21:57:49','2016-02-14 23:28:39',NULL,NULL,0,1,0),(1503,1,1,1,'Contacts',' Fortemne possumus dicere eundem illum Torquatum? Paulum, cum regem Persem captum adduceret, eodem flumine invectio? Quis enim potest ea, quae probabilia videantur ei, non probare? Duo Reges: constructio interrete. An ea, quae per vinitorem antea consequebatur, per se ipsa curabit? Experiamur igitur, inquit, etsi habet haec Stoicorum ratio difficilius quiddam et obscurius. Vulgo enim dicitur: Iucundi acti labores, nec male Euripidesconcludam, si potero, Latine; \n\n','2016-02-14 21:57:49','2016-02-14 23:28:39',NULL,NULL,0,1,0),(1504,1,1,1,'Contacts',' Ita graviter et severe voluptatem secrevit a bono. At iam decimum annum in spelunca iacet. Duo Reges: constructio interrete. Quacumque enim ingredimur, in aliqua historia vestigium ponimus. Quae diligentissime contra Aristonem dicuntur a Chryippo. Restinguet citius, si ardentem acceperit. \n\n','2016-02-14 21:57:50','2016-02-14 23:28:40',NULL,NULL,0,1,0),(1505,1,1,1,'Contacts',' Quod si ita sit, cur opera philosophiae sit danda nescio. Eadem nunc mea adversum te oratio est. Quam ob rem tandem, inquit, non satisfacit? Duo Reges: constructio interrete. Si longus, levis dictata sunt. Summum ením bonum exposuit vacuitatem doloris; Qua tu etiam inprudens utebare non numquam. Iam id ipsum absurdum, maximum malum neglegi. \n\n','2016-02-14 21:57:51','2016-02-14 23:28:40',NULL,NULL,0,1,0),(1506,1,1,1,'Contacts',' Terram, mihi crede, ea lanx et maria deprimet. Nondum autem explanatum satis, erat, quid maxime natura vellet. Non quam nostram quidem, inquit Pomponius iocans; Duo Reges: constructio interrete. Verum tamen cum de rebus grandioribus dicas, ipsae res verba rapiunt; \n\n','2016-02-14 21:57:52','2016-02-14 23:28:41',NULL,NULL,0,1,0),(1507,1,1,1,'Contacts',' Cur deinde Metrodori liberos commendas? Quod ea non occurrentia fingunt, vincunt Aristonem; Quod quidem iam fit etiam in Academia. Duo Reges: constructio interrete. \n\n','2016-02-14 21:57:52','2016-02-14 23:28:41',NULL,NULL,0,1,0),(1508,1,1,1,'Contacts',' Quae diligentissime contra Aristonem dicuntur a Chryippo. Atque hoc loco similitudines eas, quibus illi uti solent, dissimillimas proferebas. Duo Reges: constructio interrete. Roges enim Aristonem, bonane ei videantur haec: vacuitas doloris, divitiae, valitudo; Quid est igitur, cur ita semper deum appellet Epicurus beatum et aeternum? Duo enim genera quae erant, fecit tria. At multis malis affectus. \n\n','2016-02-14 21:57:53','2016-02-14 23:28:42',NULL,NULL,0,1,0),(1509,1,1,1,'Contacts',' Hanc quoque iucunditatem, si vis, transfer in animum; Itaque vides, quo modo loquantur, nova verba fingunt, deserunt usitata. Ne in odium veniam, si amicum destitero tueri. Aliud igitur esse censet gaudere, aliud non dolere. Quod non faceret, si in voluptate summum bonum poneret. Duo Reges: constructio interrete. Huic mori optimum esse propter desperationem sapientiae, illi propter spem vivere. Nos commodius agimus. Dulce amarum, leve asperum, prope longe, stare movere, quadratum rotundum. Quamquam haec quidem pra