. \n\n','2016-02-14 22:02:03','2016-02-14 23:31:47',NULL,NULL,0,1,0),(1865,1,1,1,'Contacts',' Quid autem habent admirationis, cum prope accesseris? Quid turpius quam sapientis vitam ex insipientium sermone pendere? Aperiendum est igitur, quid sit voluptas; Quae qui non vident, nihil umquam magnum ac cognitione dignum amaverunt. Ita cum ea volunt retinere, quae superiori sententiae conveniunt, in Aristonem incidunt; Iam in altera philosophiae parte. Respondent extrema primis, media utrisque, omnia omnibus. Duo Reges: constructio interrete. Egone non intellego, quid sit don Graece, Latine voluptas? \n\n','2016-02-14 22:02:04','2016-02-14 23:31:47',NULL,NULL,0,1,0),(1866,1,1,1,'Contacts',' Sic exclusis sententiis reliquorum cum praeterea nulla esse possit, haec antiquorum valeat necesse est. Quam si explicavisset, non tam haesitaret. Non quam nostram quidem, inquit Pomponius iocans; Et quidem iure fortasse, sed tamen non gravissimum est testimonium multitudinis. Qua tu etiam inprudens utebare non numquam. Teneo, inquit, finem illi videri nihil dolere. Sin laboramus, quis est, qui alienae modum statuat industriae? Duo Reges: constructio interrete. Sed ne, dum huic obsequor, vobis molestus sim. Expectoque quid ad id, quod quaerebam, respondeas. Nam quid possumus facere melius? \n\n','2016-02-14 22:02:04','2016-02-14 23:31:48',NULL,NULL,0,1,0),(1867,1,1,1,'Contacts',' Tecum optime, deinde etiam cum mediocri amico. Claudii libidini, qui tum erat summo ne imperio, dederetur. Homines optimi non intellegunt totam rationem everti, si ita res se habeat. Stoici autem, quod finem bonorum in una virtute ponunt, similes sunt illorum; Est, ut dicis, inquit; De vacuitate doloris eadem sententia erit. Duo Reges: constructio interrete. Pollicetur certe. Si enim ad populum me vocas, eum. Traditur, inquit, ab Epicuro ratio neglegendi doloris. Atqui eorum nihil est eius generis, ut sit in fine atque extrerno bonorum. Quasi ego id curem, quid ille aiat aut neget. \n\n','2016-02-14 22:02:05','2016-02-14 23:31:49',NULL,NULL,0,1,0),(1868,1,1,1,'Contacts',' Audeo dicere, inquit. Et hunc idem dico, inquieta sed ad virtutes et ad vitia nihil interesse. Satisne igitur videor vim verborum tenere, an sum etiam nunc vel Graece loqui vel Latine docendus? Idemque diviserunt naturam hominis in animum et corpus. Nam de isto magna dissensio est. Duo Reges: constructio interrete. Quis est enim, in quo sit cupiditas, quin recte cupidus dici possit? Sin tantum modo ad indicia veteris memoriae cognoscenda, curiosorum. \n\n','2016-02-14 22:02:06','2016-02-14 23:31:49',NULL,NULL,0,1,0),(1869,1,1,1,'Contacts',' Ex ea difficultate illae fallaciloquae, ut ait Accius, malitiae natae sunt. Nam ante Aristippus, et ille melius. Quia nec honesto quic quam honestius nec turpi turpius. Addidisti ad extremum etiam indoctum fuisse. Sint modo partes vitae beatae. Verum tamen cum de rebus grandioribus dicas, ipsae res verba rapiunt; Duo Reges: constructio interrete. Iam doloris medicamenta illa Epicurea tamquam de narthecio proment: Si gravis, brevis; Aliena dixit in physicis nec ea ipsa, quae tibi probarentur; \n\n','2016-02-14 22:02:07','2016-02-14 23:31:50',NULL,NULL,0,1,0),(1870,1,1,1,'Contacts',' Si qua in iis corrigere voluit, deteriora fecit. Sin autem eos non probabat, quid attinuit cum iis, quibuscum re concinebat, verbis discrepare? Sed quot homines, tot sententiae; Ac tamen hic mallet non dolere. Ita enim vivunt quidam, ut eorum vita refellatur oratio. \n\n','2016-02-14 22:02:08','2016-02-14 23:31:50',NULL,NULL,0,1,0),(1871,1,1,1,'Contacts',' Quid enim possumus hoc agere divinius? Quid de Platone aut de Democrito loquar? Hanc ergo intuens debet institutum illud quasi signum absolvere. Est igitur officium eius generis, quod nec in bonis ponatur nec in contrariis. Quo igitur, inquit, modo? Duo Reges: constructio interrete. Nos paucis ad haec additis finem faciamus aliquando; Quamquam tu hanc copiosiorem etiam soles dicere. \n\n','2016-02-14 22:02:08','2016-02-14 23:31:50',NULL,NULL,0,1,0),(1872,1,1,1,'Contacts',' Iis igitur est difficilius satis facere, qui se Latina scripta dicunt contemnere. Quae autem natura suae primae institutionis oblita est? Sed erat aequius Triarium aliquid de dissensione nostra iudicare. Duo Reges: constructio interrete. Universa enim illorum ratione cum tota vestra confligendum puto. Sin aliud quid voles, postea. Dolere malum est: in crucem qui agitur, beatus esse non potest. \n\n','2016-02-14 22:02:09','2016-02-14 23:31:51',NULL,NULL,0,1,0),(1873,1,1,1,'Contacts',' Te ipsum, dignissimum maioribus tuis, voluptasne induxit, ut adolescentulus eriperes P. At, si voluptas esset bonum, desideraret. Duo Reges: constructio interrete. Atqui iste locus est, Piso, tibi etiam atque etiam confirmandus, inquam; Tecum optime, deinde etiam cum mediocri amico. Aliter enim nosmet ipsos nosse non possumus. Que Manilium, ab iisque M. Nam et complectitur verbis, quod vult, et dicit plane, quod intellegam; \n\n','2016-02-14 22:02:10','2016-02-14 23:31:51',NULL,NULL,0,1,0),(1874,1,1,1,'Contacts',' Quia nec honesto quic quam honestius nec turpi turpius. An vero displicuit ea, quae tributa est animi virtutibus tanta praestantia? Quid ait Aristoteles reliquique Platonis alumni? Atque hoc loco similitudines eas, quibus illi uti solent, dissimillimas proferebas. Duo Reges: constructio interrete. At certe gravius. Id quaeris, inquam, in quo, utrum respondero, verses te huc atque illuc necesse est. Quia nec honesto quic quam honestius nec turpi turpius. \n\n','2016-02-14 22:02:11','2016-02-14 23:31:52',NULL,NULL,0,1,0),(1875,1,1,1,'Accounts','','2016-02-14 23:31:52','2016-02-14 23:31:52',NULL,NULL,0,1,0),(1876,1,1,1,'Contacts',' An tu me de L. Tubulo putas dicere? Tum ille: Ain tandem? Duo Reges: constructio interrete. \n\n','2016-02-14 22:02:11','2016-02-14 23:31:53',NULL,NULL,0,1,0),(1877,1,1,1,'Accounts','','2016-02-14 23:31:53','2016-02-14 23:31:53',NULL,NULL,0,1,0),(1878,1,1,1,'Contacts',' Nunc omni virtuti vitium contrario nomine opponitur. Progredientibus autem aetatibus sensim tardeve potius quasi nosmet ipsos cognoscimus. Tamen a proposito, inquam, aberramus. Profectus in exilium Tubulus statim nec respondere ausus; Quae similitudo in genere etiam humano apparet. Non laboro, inquit, de nomine. \n\n','2016-02-14 22:02:12','2016-02-14 23:31:54',NULL,NULL,0,1,0),(1879,1,1,1,'Contacts',' Nam, ut sint illa vendibiliora, haec uberiora certe sunt. Sin tantum modo ad indicia veteris memoriae cognoscenda, curiosorum. Putabam equidem satis, inquit, me dixisse. Si longus, levis. Sed haec omittamus; Duo Reges: constructio interrete. Illa videamus, quae a te de amicitia dicta sunt. Quae in controversiam veniunt, de iis, si placet, disseramus. Quam nemo umquam voluptatem appellavit, appellat; Suo enim quisque studio maxime ducitur. \n\n','2016-02-14 22:02:13','2016-02-14 23:31:54',NULL,NULL,0,1,0),(1880,1,1,1,'Contacts',' Apud ceteros autem philosophos, qui quaesivit aliquid, tacet; Quamquam id quidem, infinitum est in hac urbe; Quo plebiscito decreta a senatu est consuli quaestio Cn. Quamquam haec quidem praeposita recte et reiecta dicere licebit. Nunc de hominis summo bono quaeritur; Quod ea non occurrentia fingunt, vincunt Aristonem; \n\n','2016-02-14 22:02:13','2016-02-14 23:31:55',NULL,NULL,0,1,0),(1881,1,1,1,'Contacts',' Quae cum dixisset paulumque institisset, Quid est? Tamen a proposito, inquam, aberramus. Et harum quidem rerum facilis est et expedita distinctio. Verum tamen cum de rebus grandioribus dicas, ipsae res verba rapiunt; Et quidem Arcesilas tuus, etsi fuit in disserendo pertinacior, tamen noster fuit; Mihi vero, inquit, placet agi subtilius et, ut ipse dixisti, pressius. \n\n','2016-02-14 22:02:14','2016-02-14 23:31:55',NULL,NULL,0,1,0),(1882,1,1,1,'Contacts',' At iam decimum annum in spelunca iacet. Quid enim tanto opus est instrumento in optimis artibus comparandis? \n\n','2016-02-14 22:02:15','2016-02-14 23:31:56',NULL,NULL,0,1,0),(1883,1,1,1,'Contacts',' Neque solum ea communia, verum etiam paria esse dixerunt. Terram, mihi crede, ea lanx et maria deprimet. In qua quid est boni praeter summam voluptatem, et eam sempiternam? Cur post Tarentum ad Archytam? Ego vero isti, inquam, permitto. Quae contraria sunt his, malane? Nondum autem explanatum satis, erat, quid maxime natura vellet. Duo Reges: constructio interrete. Itaque hic ipse iam pridem est reiectus; Quae diligentissime contra Aristonem dicuntur a Chryippo. \n\n','2016-02-14 22:02:15','2016-02-14 23:31:57',NULL,NULL,0,1,0),(1884,1,1,1,'Accounts','','2016-02-14 23:31:57','2016-02-14 23:31:57',NULL,NULL,0,1,0),(1885,1,1,1,'Contacts',' Nos cum te, M. Legimus tamen Diogenem, Antipatrum, Mnesarchum, Panaetium, multos alios in primisque familiarem nostrum Posidonium. Sic consequentibus vestris sublatis prima tolluntur. \n\n','2016-02-14 22:02:16','2016-02-14 23:31:58',NULL,NULL,0,1,0),(1886,1,1,1,'Contacts',' Nam quid possumus facere melius? Nam, ut sint illa vendibiliora, haec uberiora certe sunt. Duo Reges: constructio interrete. In his igitur partibus duabus nihil erat, quod Zeno commutare gestiret. Nemo igitur esse beatus potest. \n\n','2016-02-14 22:02:17','2016-02-14 23:31:58',NULL,NULL,0,1,0),(1887,1,1,1,'Contacts',' Quod cum accidisset ut alter alterum necopinato videremus, surrexit statim. Quicquid porro animo cernimus, id omne oritur a sensibus; Ac tamen hic mallet non dolere. Mihi, inquam, qui te id ipsum rogavi? Si quicquam extra virtutem habeatur in bonis. \n\n','2016-02-14 22:02:18','2016-02-14 23:31:59',NULL,NULL,0,1,0),(1888,1,1,1,'Contacts',' Videamus animi partes, quarum est conspectus illustrior; Quid ad utilitatem tantae pecuniae? Familiares nostros, credo, Sironem dicis et Philodemum, cum optimos viros, tum homines doctissimos. Quod autem principium officii quaerunt, melius quam Pyrrho; Age, inquies, ista parva sunt. Duo Reges: constructio interrete. \n\n','2016-02-14 22:02:19','2016-02-14 23:31:59',NULL,NULL,0,1,0),(1889,1,1,1,'Contacts',' Estne, quaeso, inquam, sitienti in bibendo voluptas? Quid enim possumus hoc agere divinius? Duo Reges: constructio interrete. Quod ea non occurrentia fingunt, vincunt Aristonem; Quid de Platone aut de Democrito loquar? Isto modo ne improbos quidem, si essent boni viri. Invidiosum nomen est, infame, suspectum. Non potes, nisi retexueris illa. Sint modo partes vitae beatae. Quicquid porro animo cernimus, id omne oritur a sensibus; \n\n','2016-02-14 22:02:20','2016-02-14 23:32:00',NULL,NULL,0,1,0),(1890,1,1,1,'Accounts','','2016-02-14 23:32:00','2016-02-14 23:32:00',NULL,NULL,0,1,0),(1891,1,1,1,'Contacts',' Cum autem in quo sapienter dicimus, id a primo rectissime dicitur. Tu enim ista lenius, hic Stoicorum more nos vexat. Duo Reges: constructio interrete. Quam si explicavisset, non tam haesitaret. Hoc dixerit potius Ennius: Nimium boni est, cui nihil est mali. Quod autem satis est, eo quicquid accessit, nimium est; Nunc haec primum fortasse audientis servire debemus. Vitae autem degendae ratio maxime quidem illis placuit quieta. Non enim, si omnia non sequebatur, idcirco non erat ortus illinc. Ex quo, id quod omnes expetunt, beate vivendi ratio inveniri et comparari potest. \n\n','2016-02-14 22:02:20','2016-02-14 23:32:01',NULL,NULL,0,1,0),(1892,1,1,1,'Contacts',' Cuius quidem, quoniam Stoicus fuit, sententia condemnata mihi videtur esse inanitas ista verborum. Quae in controversiam veniunt, de iis, si placet, disseramus. Habent enim et bene longam et satis litigiosam disputationem. Eaedem enim utilitates poterunt eas labefactare atque pervertere. Duo Reges: constructio interrete. Non est ista, inquam, Piso, magna dissensio. \n\n','2016-02-14 22:02:21','2016-02-14 23:32:01',NULL,NULL,0,1,0),(1893,1,1,1,'Contacts',' An me, inquam, nisi te audire vellem, censes haec dicturum fuisse? Idem iste, inquam, de voluptate quid sentit? Quae contraria sunt his, malane? Ut necesse sit omnium rerum, quae natura vigeant, similem esse finem, non eundem. Quorum altera prosunt, nocent altera. Duo Reges: constructio i