crementum diem. Huius ego nunc auctoritatem sequens idem faciam. Duo Reges: constructio interrete. \n\n','2016-02-14 22:05:16','2016-02-14 23:34:21',NULL,NULL,0,1,0),(2161,1,1,1,'Contacts',' Est, ut dicis, inquit; Quis non odit sordidos, vanos, leves, futtiles? Ad eas enim res ab Epicuro praecepta dantur. Negat esse eam, inquit, propter se expetendam. Ille vero, si insipiens-quo certe, quoniam tyrannus -, numquam beatus; Duo Reges: constructio interrete. Nonne videmus quanta perturbatio rerum omnium consequatur, quanta confusio? Memini me adesse P. \n\n','2016-02-14 22:05:17','2016-02-14 23:34:22',NULL,NULL,0,1,0),(2162,1,1,1,'Contacts',' Quare conare, quaeso. Rapior illuc, revocat autem Antiochus, nec est praeterea, quem audiamus. Aliter homines, aliter philosophos loqui putas oportere? Sed tempus est, si videtur, et recta quidem ad me. Ita credo. Duo Reges: constructio interrete. Quo modo autem optimum, si bonum praeterea nullum est? Ut placet, inquit, etsi enim illud erat aptius, aequum cuique concedere. \n\n','2016-02-14 22:05:18','2016-02-14 23:34:22',NULL,NULL,0,1,0),(2163,1,1,1,'Contacts',' Sapientem locupletat ipsa natura, cuius divitias Epicurus parabiles esse docuit. Quasi vero, inquit, perpetua oratio rhetorum solum, non etiam philosophorum sit. Sed ad rem redeamus; In qua quid est boni praeter summam voluptatem, et eam sempiternam? \n\n','2016-02-14 22:05:19','2016-02-14 23:34:23',NULL,NULL,0,1,0),(2164,1,1,1,'Contacts',' Non enim solum Torquatus dixit quid sentiret, sed etiam cur. Nam de summo mox, ut dixi, videbimus et ad id explicandum disputationem omnem conferemus. Respondent extrema primis, media utrisque, omnia omnibus. Quid autem habent admirationis, cum prope accesseris? Collatio igitur ista te nihil iuvat. Expectoque quid ad id, quod quaerebam, respondeas. Non est igitur voluptas bonum. Duo Reges: constructio interrete. Bonum patria: miserum exilium. Quodsi vultum tibi, si incessum fingeres, quo gravior viderere, non esses tui similis; Sed utru