1,1,1,'Contacts',' Beatus sibi videtur esse moriens. Familiares nostros, credo, Sironem dicis et Philodemum, cum optimos viros, tum homines doctissimos. Summum ením bonum exposuit vacuitatem doloris; Quamquam id quidem licebit iis existimare, qui legerint. An vero, inquit, quisquam potest probare, quod perceptfum, quod. Bona autem corporis huic sunt, quod posterius posui, similiora. Ex quo illud efficitur, qui bene cenent omnis libenter cenare, qui libenter, non continuo bene. Duo Reges: constructio interrete. \n\n','2016-02-14 22:05:22','2016-02-14 23:34:26',NULL,NULL,0,1,0),(2170,1,1,1,'Contacts',' Universa enim illorum ratione cum tota vestra confligendum puto. Audeo dicere, inquit. \n\n','2016-02-14 22:05:23','2016-02-14 23:34:26',NULL,NULL,0,1,0),(2171,1,1,1,'Contacts',' Quid, si etiam iucunda memoria est praeteritorum malorum? Nummus in Croesi divitiis obscuratur, pars est tamen divitiarum. Mihi, inquam, qui te id ipsum rogavi? Vitiosum est enim in dividendo partem in genere numerare. Apud imperitos tum illa dicta sunt, aliquid etiam coronae datum; Duo Reges: constructio interrete. Hoc ille tuus non vult omnibusque ex rebus voluptatem quasi mercedem exigit. Materiam vero rerum et copiam apud hos exilem, apud illos uberrimam reperiemus. Recte, inquit, intellegis. Hoc etsi multimodis reprehendi potest, tamen accipio, quod dant. \n\n','2016-02-14 22:05:24','2016-02-14 23:34:27',NULL,NULL,0,1,0),(2172,1,1,1,'Contacts',' Summum ením bonum exposuit vacuitatem doloris; Non minor, inquit, voluptas percipitur ex vilissimis rebus quam ex pretiosissimis. Sed ad haec, nisi molestum est, habeo quae velim. Omnia contraria, quos etiam insanos esse vultis. Et quod est munus, quod opus sapientiae? Duo Reges: constructio interrete. Immo vero, inquit, ad beatissime vivendum parum est, ad beate vero satis. Mihi enim satis est, ipsis non satis. \n\n','2016-02-14 22:05:24','2016-02-14 23:34:27',NULL,NULL,0,1,0),(2173,1,1,1,'Contacts',' Satisne vobis videor pro meo iure in vestris auribus commentatus? Graccho, eius fere, aequalí? At quicum ioca seria, ut dicitur, quicum arcana, quicum occulta omnia? Ego quoque, inquit, didicerim libentius si quid attuleris, quam te reprehenderim. Aliter enim nosmet ipsos nosse non possumus. Duo Reges: constructio interrete. Sed quanta sit alias, nunc tantum possitne esse tanta. Sed fac ista esse non inportuna; Habes, inquam, Cato, formam eorum, de quibus loquor, philosophorum. Neutrum vero, inquit ille. \n\n','2016-02-14 22:05:25','2016-02-14 23:34:28',NULL,NULL,0,1,0),(2174,1,1,1,'Contacts',' Ergo in utroque exercebantur, eaque disciplina effecit tantam illorum utroque in genere dicendi copiam. Equidem soleo etiam quod uno Graeci, si aliter non possum, idem pluribus verbis exponere. Fortitudinis quaedam praecepta sunt ac paene leges, quae effeminari virum vetant in dolore. Duo Reges: constructio interrete. Cur deinde Metrodori liberos commendas? Itaque mihi non satis videmini considerare quod iter sit naturae quaeque progressio. Quacumque enim ingredimur, in aliqua historia vestigium ponimus. Semper enim ita adsumit aliquid, ut ea, quae prima dederit, non deserat. Quae contraria sunt his, malane? \n\n','2016-02-14 22:05:26','2016-02-14 23:34:28',NULL,NULL,0,1,0),(2175,1,1,1,'Contacts',' Quo modo autem philosophus loquitur? Idemne, quod iucunde? Quos quidem tibi studiose et diligenter tractandos magnopere censeo. \n\n','2016-02-14 22:05:26','2016-02-14 23:34:29',NULL,NULL,0,1,0),(2176,1,1,1,'Contacts',' Qua ex cognitione facilior facta est investigatio rerum occultissimarum. Vitae autem degendae ratio maxime quidem illis placuit quieta. Cum id quoque, ut cupiebat, audivisset, evelli iussit eam, qua erat transfixus, hastam. Iam id ipsum absurdum, maximum malum neglegi. Quam si explicavisset, non tam haesitaret. At multis se probavit. Duo Reges: constructio interrete. Partim cursu et peragratione laetantur, congregatione aliae coetum quodam modo civitatis imitantur; De quibus cupio scire quid sentias. \n\n','2016-02-14 22:05:27','2016-02-14 23:34:29',NULL,NULL,0,1,0),(2177,1,1,1,'Contacts',' Conferam tecum, quam cuique verso rem subicias; Tollenda est atque extrahenda radicitus. Ita redarguitur ipse a sese, convincunturque scripta eius probitate ipsius ac moribus. Ergo instituto veterum, quo etiam Stoici utuntur, hinc capiamus exordium. Maximas vero virtutes iacere omnis necesse est voluptate dominante. Ratio quidem vestra sic cogit. Duo Reges: constructio interrete. \n\n','2016-02-14 22:05:28','2016-02-14 23:34:30',NULL,NULL,0,1,0),(2178,1,1,1,'Accounts','','2016-02-14 23:34:30','2016-02-14 23:34:30',NULL,NULL,0,1,0),(2179,1,1,1,'Contacts',' Nummus in Croesi divitiis obscuratur, pars est tamen divitiarum. Proclivi currit oratio. Quamquam id quidem, infinitum est in hac urbe; Quae quidem vel cum periculo est quaerenda vobis; Duo Reges: constructio interrete. Cur id non ita fit? Illi enim inter se dissentiunt. Bona autem corporis huic sunt, quod posterius posui, similiora. \n\n','2016-02-14 22:05:30','2016-02-14 23:34:31',NULL,NULL,0,1,0),(2180,1,1,1,'Contacts',' Dici enim nihil potest verius. Intellegi quidem, ut propter aliam quampiam rem, verbi gratia propter voluptatem, nos amemus; Certe, nisi voluptatem tanti aestimaretis. Quid ergo attinet gloriose loqui, nisi constanter loquare? Videmus igitur ut conquiescere ne infantes quidem possint. Duo Reges: constructio interrete. Ergo instituto veterum, quo etiam Stoici utuntur, hinc capiamus exordium. Quis Aristidem non mortuum diligit? Quis Aristidem non mortuum diligit? \n\n','2016-02-14 22:05:31','2016-02-14 23:34:32',NULL,NULL,0,1,0),(2181,1,1,1,'Contacts',' Aut haec tibi, Torquate, sunt vituperanda aut patrocinium voluptatis repudiandum. Ab his oratores, ab his imperatores ac rerum publicarum principes extiterunt. Illa videamus, quae a te de amicitia dicta sunt. Pauca mutat vel plura sane; Scio enim esse quosdam, qui quavis lingua philosophari possint; Nam Pyrrho, Aristo, Erillus iam diu abiecti. \n\n','2016-02-14 22:05:32','2016-02-14 23:34:33',NULL,NULL,0,1,0),(2182,1,1,1,'Contacts',' Cuius ad naturam apta ratio vera illa et summa lex a philosophis dicitur. Dic in quovis conventu te omnia facere, ne doleas. Tollenda est atque extrahenda radicitus. Sed tu istuc dixti bene Latine, parum plane. Naturales divitias dixit parabiles esse, quod parvo esset natura contenta. Duo Reges: constructio interrete. \n\n','2016-02-14 22:05:33','2016-02-14 23:34:33',NULL,NULL,0,1,0),(2183,1,1,1,'Contacts',' Tum Piso: Quoniam igitur aliquid omnes, quid Lucius noster? Duo Reges: constructio interrete. Quare conare, quaeso. Te ipsum, dignissimum maioribus tuis, voluptasne induxit, ut adolescentulus eriperes P. \n\n','2016-02-14 22:05:33','2016-02-14 23:34:34',NULL,NULL,0,1,0),(2184,1,1,1,'Contacts',' Nam diligi et carum esse iucundum est propterea, quia tutiorem vitam et voluptatem pleniorem efficit. Et ille ridens: Video, inquit, quid agas; Proclivi currit oratio. Illud non continuo, ut aeque incontentae. Quod autem principium officii quaerunt, melius quam Pyrrho; \n\n','2016-02-14 22:05:34','2016-02-14 23:34:34',NULL,NULL,0,1,0),(2185,1,1,1,'Contacts',' Minime vero istorum quidem, inquit. Si enim ad populum me vocas, eum. In qua si nihil est praeter rationem, sit in una virtute finis bonorum; Quae in controversiam veniunt, de iis, si placet, disseramus. Tu vero, inquam, ducas licet, si sequetur; Non laboro, inquit, de nomine. Duo Reges: constructio interrete. Quamquam haec quidem praeposita recte et reiecta dicere licebit. \n\n','2016-02-14 22:05:35','2016-02-14 23:34:34',NULL,NULL,0,1,0),(2186,1,1,1,'Contacts',' Equidem etiam Epicurum, in physicis quidem, Democriteum puto. Philosophi autem in suis lectulis plerumque moriuntur. Igitur neque stultorum quisquam beatus neque sapientium non beatus. Cur post Tarentum ad Archytam? Idcirco enim non desideraret, quia, quod dolore caret, id in voluptate est. Duo Reges: constructio interrete. \n\n','2016-02-14 22:05:35','2016-02-14 23:34:35',NULL,NULL,0,1,0),(2187,1,1,1,'Contacts',' Cur tantas regiones barbarorum pedibus obiit, tot maria transmisit? Ne amores quidem sanctos a sapiente alienos esse arbitrantur. \n\n','2016-02-14 22:05:36','2016-02-14 23:34:35',NULL,NULL,0,1,0),(2188,1,1,1,'Accounts','','2016-02-14 23:34:36','2016-02-14 23:34:36',NULL,NULL,0,1,0),(2189,1,1,1,'Contacts',' Quae quidem sapientes sequuntur duce natura tamquam videntes; Illum mallem levares, quo optimum atque humanissimum virum, Cn. Duo Reges: constructio interrete. Qua tu etiam inprudens utebare non numquam. Erit enim mecum, si tecum erit. Quod ea non occurrentia fingunt, vincunt Aristonem; \n\n','2016-02-14 22:05:37','2016-02-14 23:34:36',NULL,NULL,0,1,0),(2190,1,1,1,'Contacts',' At modo dixeras nihil in istis rebus esse, quod interesset. Atque his de rebus et splendida est eorum et illustris oratio. Ut id aliis narrare gestiant? Dolere malum est: in crucem qui agitur, beatus esse non potest. \n\n','2016-02-14 22:05:38','2016-02-14 23:34:37',NULL,NULL,0,1,0),(2191,1,1,1,'Contacts',' Nam illud vehementer repugnat, eundem beatum esse et multis malis oppressum. An vero displicuit ea, quae tributa est animi virtutibus tanta praestantia? Qui potest igitur habitare in beata vita summi mali metus? Stulti autem malorum memoria torquentur, sapientes bona praeterita grata recordatione renovata delectant. Satisne vobis videor pro meo iure in vestris auribus commentatus? Duo Reges: constructio interrete. Ad eas enim res ab Epicuro praecepta dantur. Collatio igitur ista te nihil iuvat. Eadem nunc mea adversum te oratio est. Ut in voluptate sit, qui epuletur, in dolore, qui torqueatur. \n\n','2016-02-14 22:05:38','2016-02-14 23:34:37',NULL,NULL,0,1,0),(2192,1,1,1,'Contacts',' Quos nisi redarguimus, omnis virtus, omne decus, omnis vera laus deserenda est. Sin autem eos non probabat, quid attinuit cum iis, quibuscum re concinebat, verbis discrepare? Quo modo autem optimum, si bonum praeterea nullum est? Id Sextilius factum negabat. Duo Reges: constructio interrete. Tum mihi Piso: Quid ergo? Cur tantas regiones barbarorum pedibus obiit, tot maria transmisit? Quae quidem sapientes sequuntur duce natura tamquam videntes; Quod idem cum vestri faciant, non satis magnam tribuunt inventoribus gratiam. Nobis Heracleotes ille Dionysius flagitiose descivisse videtur a Stoicis propter oculorum dolorem. \n\n','2016-02-14 22:05:45','2016-02-14 23:34:38',NULL,NULL,0,1,0),(2193,1,1,1,'Contacts',' At coluit ipse amicitias. Restatis igitur vos; Quod si ita se habeat, non possit beatam praestare vitam sapientia. Ea, quae dialectici nunc tradunt et docent, nonne ab illis instituta sunt aut inventa sunt? Duo Reges: constructio interrete. Etenim semper illud extra est, quod arte comprehenditur. Illa argumenta propria videamus, cur omnia sint paria peccata. Eaedem res maneant alio modo. \n\n','2016-02-14 22:05:46','2016-02-14 23:34:39',NULL,NULL,0,1,0),(2194,1,1,1,'Contacts',' Solum praeterea formosum, solum liberum, solum civem, stultost; An, partus ancillae sitne in fructu habendus, disseretur inter principes civitatis, P. Quorum altera prosunt, nocent altera. Qui autem de summo bono dissentit de tota philosophiae ratione dissentit. Sed haec nihil sane ad rem; Suo enim quisque studio maxime ducitur. Non est igitur voluptas bonum. \n\n','2016-02-14 22:05:47','2016-02-14 23:34:39',NULL,NULL,0,1,0),(2195,1,1,1,'Contacts',' Nec lapathi suavitatem acupenseri Galloni Laelius anteponebat, sed suavitatem ipsam neglegebat; Sed haec quidem liberius ab eo dicuntur et saepius. Zenonis est, inquam, hoc Stoici. Ostendit pedes et pectus. \n\n','2016-02-14 22:05:47','2016-02-14 23:34:40',NULL,NULL,0,1,0),(2196,1,1,1,'Contacts',' Habent enim et bene longam et satis litigiosam disputationem. Si longus, levis dictata sunt. \n\n','2016-02-14 22:05:48','2016-02-14 23:34:40',NULL,NULL,0,1,0),(2197,1,1,1,'Contacts',' Cur igitur, inquam, res tam dissimiles eodem nomine appellas? Omnia contraria, quos etiam insanos esse vultis. Nihilo beatiorem esse Metellum quam Regulum. Utinam quidem dicerent alium alio beatiorem! Iam ruinas videres. Materiam vero rerum et copiam apud hos exilem, apud illos uberrimam reperiemus. Qua tu etiam inprudens utebare non numquam. Sed quanta sit alias, nunc tantum possitne esse tanta. Duo Reges: constructio interrete. \n\n','2016-02-14 22:05:49','2016-02-14 23:34:41',NULL,NULL,0,1,0),(2198,1,1,1,'Contacts',' An quod ita callida est, ut optime possit architectari voluptates? Quod autem in homine praestantissimum atque optimum est, id deseruit. Cuius quidem, quoniam Stoicus fuit, sententia condemnata mihi videtur esse inanitas ista verborum. Primum quid tu dicis breve? Quod autem ratione actum est, id officium appellamus. \n\n','2016-02-14 22:05:50','2016-02-14 23:34:41',NULL,NULL,0,1,0),(2199,1,1,1,'Contacts',' Innumerabilia dici possunt in hanc sententiam, sed non necesse est. Qui autem esse poteris, nisi te amor ipse ceperit? Neque solum ea communia, verum etiam paria esse dixerunt. Duo Reges: constructio interrete. \n\n','2016-02-14 22:05:50','2016-02-14 23:34:42',NULL,NULL,0,1,0),(2200,1,1,1,'Contacts',' Contineo me ab exemplis. Nam si propter voluptatem, quae est ista laus, quae possit e macello peti? Duo Reges: constructio interrete. Non potes, nisi retexueris illa. Qui non moveatur et offensione turpitudinis et comprobatione honestatis? Quis est, qui non oderit libidinosam, protervam adolescentiam? \n\n','2016-02-14 22:05:51','2016-02-14 23:34:42',NULL,NULL,0,1,0),(2201,1,1,1,'Contacts',' Quamquam haec quidem praeposita recte et reiecta dicere licebit. Dempta enim aeternitate nihilo beatior Iuppiter quam Epicurus; Minime vero istorum quidem, inquit. Non autem hoc: igitur ne illud quidem. Ut optime, secundum naturam affectum esse possit. Si longus, levis. Duo Reges: constructio interrete. Haec quo modo conveniant, non sane intellego. Sed ea mala virtuti magnitudine obruebantur. In schola desinis. Hic ambiguo ludimur. \n\n','2016-02-14 22:05:52','2016-02-14 23:34:43',NULL,NULL,0,1,0),(2202,1,1,1,'Contacts',' Sed quanta sit alias, nunc tantum possitne esse tanta. Omnia contraria, quos etiam insanos esse vultis. Duo Reges: constructio interrete. Hoc non est positum in nostra actione. Ita nemo beato beatior. Suo enim quisque studio maxime ducitur. \n\n','2016-02-14 22:05:52','2016-02-14 23:34:43',NULL,NULL,0,1,0),(2203,1,1,1,'Contacts',' Nescio quo modo praetervolavit oratio. Non semper, inquam; Sed ego in hoc resisto; Ex quo, id quod omnes expetunt, beate vivendi ratio inveniri et comparari potest. Duo Reges: constructio interrete. Hoc etsi multimodis reprehendi potest, tamen accipio, quod dant. \n\n','2016-02-14 22:05:53','2016-02-14 23:34:44',NULL,NULL,0,1,0),(2204,1,1,1,'Contacts',' Sed eum qui audiebant, quoad poterant, defendebant sententiam suam. Et harum quidem rerum facilis est et expedita distinctio. Duo Reges: constructio interrete. Gerendus est mos, modo recte sentiat. Quis enim redargueret? Memini vero, inquam; Omnes enim iucundum motum, quo sensus hilaretur. Tria genera bonorum; \n\n','2016-02-14 22:05:54','2016-02-14 23:34:44',NULL,NULL,0,1,0),(2205,1,1,1,'Contacts',' Quae autem natura suae primae institutionis oblita est? Est autem etiam actio quaedam corporis, quae motus et status naturae congruentis tenet; Eadem nunc mea adversum te oratio est. Ego vero volo in virtute vim esse quam maximam; Nam si propter voluptatem, quae est ista laus, quae possit e macello peti? \n\n','2016-02-14 22:05:55','2016-02-14 23:34:45',NULL,NULL,0,1,0),(2206,1,1,1,'Leads',' Proclivi currit oratio. Duo Reges: constructio interrete. Facit igitur Lucius noster prudenter, qui audire de summo bono potissimum velit; Negat enim summo bono afferre incrementum diem. Et si turpitudinem fugimus in statu et motu corporis, quid est cur pulchritudinem non sequamur? In his igitur partibus duabus nihil erat, quod Zeno commutare gestiret. \n\n','2016-02-14 13:17:01','2016-02-14 23:49:53',NULL,NULL,0,1,0),(2207,1,1,1,'Leads',' Prioris generis est docilitas, memoria; Ecce aliud simile dissimile. Habent enim et bene longam et satis litigiosam disputationem. Haec et tu ita posuisti, et verba vestra sunt. \n\n','2016-02-14 13:16:58','2016-02-14 23:49:54',NULL,NULL,0,1,0),(2208,1,1,1,'Leads',' Bonum integritas corporis: misera debilitas. Nec tamen ullo modo summum pecudis bonum et hominis idem mihi videri potest. Quoniam, si dis placet, ab Epicuro loqui discimus. Non igitur bene. Quas enim kakaw Graeci appellant, vitia malo quam malitias nominare. \n\n','2016-02-14 13:17:00','2016-02-14 23:49:54',NULL,NULL,0,1,0),(2209,1,1,1,'Leads',' Sed nimis multa. Duo Reges: constructio interrete. Sed venio ad inconstantiae crimen, ne saepius dicas me aberrare; Quem si tenueris, non modo meum Ciceronem, sed etiam me ipsum abducas licebit. Ergo illi intellegunt quid Epicurus dicat, ego non intellego? Itaque primos congressus copulationesque et consuetudinum instituendarum voluntates fieri propter voluptatem; \n\n','2016-02-14 13:16:57','2016-02-14 23:49:55',NULL,NULL,0,1,0),(2210,1,1,1,'Leads',' Isto modo ne improbos quidem, si essent boni viri. Quae hic rei publicae vulnera inponebat, eadem ille sanabat. Unum est sine dolore esse, alterum cum voluptate. Recte, inquit, intellegis. Cum salvum esse flentes sui respondissent, rogavit essentne fusi hostes. Duo Reges: constructio interrete. An potest, inquit ille, quicquam esse suavius quam nihil dolere? Sumenda potius quam expetenda. \n\n','2016-02-14 13:16:59','2016-02-14 23:49:55',NULL,NULL,0,1,0),(2211,1,1,1,'Leads',' Quae diligentissime contra Aristonem dicuntur a Chryippo. Sed ille, ut dixi, vitiose. Quid est enim aliud esse versutum? Si quidem, inquit, tollerem, sed relinquo. Tum mihi Piso: Quid ergo? \n\n','2016-02-14 13:16:57','2016-02-14 23:49:55',NULL,NULL,0,1,0),(2212,1,1,1,'Leads',' Si enim ad populum me vocas, eum. Nunc de hominis summo bono quaeritur; Igitur neque stultorum quisquam beatus neque sapientium non beatus. Nam memini etiam quae nolo, oblivisci non possum quae volo. \n\n','2016-02-14 13:17:01','2016-02-14 23:49:56',NULL,NULL,0,1,0),(2213,1,1,1,'Leads',' Quae hic rei publicae vulnera inponebat, eadem ille sanabat. Sullae consulatum? Duo Reges: constructio interrete. Quia dolori non voluptas contraria est, sed doloris privatio. Non enim solum Torquatus dixit quid sentiret, sed etiam cur. Ergo et avarus erit, sed finite, et adulter, verum habebit modum, et luxuriosus eodem modo. Non enim ipsa genuit hominem, sed accepit a natura inchoatum. Etenim nec iustitia nec amicitia esse omnino poterunt, nisi ipsae per se expetuntur. Heri, inquam, ludis commissis ex urbe profectus veni ad vesperum. Tum mihi Piso: Quid ergo? \n\n','2016-02-14 13:16:58','2016-02-14 23:49:56',NULL,NULL,0,1,0),(2214,1,1,1,'Leads',' Sed nimis multa. Effluit igitur voluptas corporis et prima quaeque avolat saepiusque relinquit causam paenitendi quam recordandi. Ergo adhuc, quantum equidem intellego, causa non videtur fuisse mutandi nominis. Huius, Lyco, oratione locuples, rebus ipsis ielunior. Res enim fortasse verae, certe graves, non ita tractantur, ut debent, sed aliquanto minutius. Sed haec omittamus; Tum ille: Ain tandem? Duo Reges: constructio interrete. Quid est, quod ab ea absolvi et perfici debeat? Intellegi quidem, ut propter aliam quampiam rem, verbi gratia propter voluptatem, nos amemus; \n\n','2016-02-14 13:16:59','2016-02-14 23:49:57',NULL,NULL,0,1,0),(2215,1,1,1,'Leads',' Superiores tres erant, quae esse possent, quarum est una sola defensa, eaque vehementer. Minime vero istorum quidem, inquit. Duo Reges: constructio interrete. Quod mihi quidem visus est, cum sciret, velle tamen confitentem audire Torquatum. Non quam nostram quidem, inquit Pomponius iocans; Sed quid minus probandum quam esse aliquem beatum nec satis beatum? Eadem nunc mea adversum te oratio est. Atqui reperies, inquit, in hoc quidem pertinacem; Quam si explicavisset, non tam haesitaret. Nemo nostrum istius generis asotos iucunde putat vivere. \n\n','2016-02-14 13:16:59','2016-02-14 23:49:57',NULL,NULL,0,1,0),(2216,1,1,1,'Vendors',' Quaesita enim virtus est, non quae relinqueret naturam, sed quae tueretur. Tu enim ista lenius, hic Stoicorum more nos vexat. Refert tamen, quo modo. Dic in quovis conventu te omnia facere, ne doleas. Duo Reges: constructio interrete. Ego quoque, inquit, didicerim libentius si quid attuleris, quam te reprehenderim. Nihil ad rem! Ne sit sane; Dempta enim aeternitate nihilo beatior Iuppiter quam Epicurus; Non est ista, inquam, Piso, magna dissensio. Iam in altera philosophiae parte. \n\n','2016-02-14 08:45:28','2016-02-14 23:52:05',NULL,NULL,0,1,0),(2217,1,1,1,'Vendors',' Satis est tibi in te, satis in legibus, satis in mediocribus amicitiis praesidii. Non enim, si omnia non sequebatur, idcirco non erat ortus illinc. Minime vero istorum quidem, inquit. Sed ut iis bonis erigimur, quae expectamus, sic laetamur iis, quae recordamur. Nec vero alia sunt quaerenda contra Carneadeam illam sententiam. At ille pellit, qui permulcet sensum voluptate. Duo Reges: constructio interrete. \n\n','2016-02-14 08:45:29','2016-02-14 23:52:06',NULL,NULL,0,1,0),(2218,1,1,1,'Vendors',' Certe, nisi voluptatem tanti aestimaretis. Non quam nostram quidem, inquit Pomponius iocans; \n\n','2016-02-14 08:45:29','2016-02-14 23:52:06',NULL,NULL,0,1,0),(2219,1,1,1,'Vendors',' Ita nemo beato beatior. Tanti autem aderant vesicae et torminum morbi, ut nihil ad eorum magnitudinem posset accedere. Tecum optime, deinde etiam cum mediocri amico. Duo Reges: constructio interrete. Hoc est non dividere, sed frangere. Satisne vobis videor pro meo iure in vestris auribus commentatus? Ut enim consuetudo loquitur, id solum dicitur honestum, quod est populari fama gloriosum. Egone quaeris, inquit, quid sentiam? Summus dolor plures dies manere non potest? Conferam avum tuum Drusum cum C. \n\n','2016-02-14 08:45:29','2016-02-14 23:52:06',NULL,NULL,0,1,0),(2220,1,1,1,'Vendors',' Pauca mutat vel plura sane; Quae diligentissime contra Aristonem dicuntur a Chryippo. Nihil illinc huc pervenit. Sint modo partes vitae beatae. Duo Reges: constructio interrete. Qui ita affectus, beatum esse numquam probabis; Immo istud quidem, inquam, quo loco quidque, nisi iniquum postulo, arbitratu meo. Quid enim possumus hoc agere divinius? Habent enim et bene longam et satis litigiosam disputationem. Facile est hoc cernere in primis puerorum aetatulis. An haec ab eo non dicuntur? \n\n','2016-02-14 08:45:30','2016-02-14 23:52:07',NULL,NULL,0,1,0),(2221,1,1,1,'Vendors',' Nam de isto magna dissensio est. Ita enim vivunt quidam, ut eorum vita refellatur oratio. Duo Reges: constructio interrete. Nam adhuc, meo fortasse vitio, quid ego quaeram non perspicis. Maximus dolor, inquit, brevis est. Ego quoque, inquit, didicerim libentius si quid attuleris, quam te reprehenderim. \n\n','2016-02-14 08:45:30','2016-02-14 23:52:07',NULL,NULL,0,1,0),(2222,1,1,1,'Vendors',' Potius inflammat, ut coercendi magis quam dedocendi esse videantur. Duo enim genera quae erant, fecit tria. Duo enim genera quae erant, fecit tria. Prioris generis est docilitas, memoria; Sed quid sentiat, non videtis. Eam tum adesse, cum dolor omnis absit; Sed id ne cogitari quidem potest quale sit, ut non repugnet ipsum sibi. Duo Reges: constructio interrete. At modo dixeras nihil in istis rebus esse, quod interesset. \n\n','2016-02-14 08:45:31','2016-02-14 23:52:07',NULL,NULL,0,1,0),(2223,1,1,1,'Vendors',' Habes, inquam, Cato, formam eorum, de quibus loquor, philosophorum. Tu autem negas fortem esse quemquam posse, qui dolorem malum putet. Dempta enim aeternitate nihilo beatior Iuppiter quam Epicurus; Quae in controversiam veniunt, de iis, si placet, disseramus. Duo Reges: constructio interrete. Tecum optime, deinde etiam cum mediocri amico. Sed ille, ut dixi, vitiose. A primo, ut opinor, animantium ortu petitur origo summi boni. \n\n','2016-02-14 08:45:31','2016-02-14 23:52:08',NULL,NULL,0,1,0),(2224,1,1,1,'Vendors',' Hoc ne statuam quidem dicturam pater aiebat, si loqui posset. Si est nihil nisi corpus, summa erunt illa: valitudo, vacuitas doloris, pulchritudo, cetera. Quoniam, si dis placet, ab Epicuro loqui discimus. Restincta enim sitis stabilitatem voluptatis habet, inquit, illa autem voluptas ipsius restinctionis in motu est. Duo Reges: constructio interrete. Nihil acciderat ei, quod nollet, nisi quod anulum, quo delectabatur, in mari abiecerat. Primum cur ista res digna odio est, nisi quod est turpis? Age nunc isti doceant, vel tu potius quis enim ista melius? Nosti, credo, illud: Nemo pius est, qui pietatem-; Hoc loco tenere se Triarius non potuit. \n\n','2016-02-14 08:45:31','2016-02-14 23:52:08',NULL,NULL,0,1,0),(2225,1,1,1,'Vendors',' Rationis enim perfectio est virtus; Nam ista vestra: Si gravis, brevis; Tum ille timide vel potius verecunde: Facio, inquit. Ex rebus enim timiditas, non ex vocabulis nascitur. An ea, quae per vinitorem antea consequebatur, per se ipsa curabit? Duo Reges: constructio interrete. Plane idem, inquit, et maxima quidem, qua fieri nulla maior potest. Invidiosum nomen est, infame, suspectum. Dolor ergo, id est summum malum, metuetur semper, etiamsi non aderit; Nosti, credo, illud: Nemo pius est, qui pietatem-; \n\n','2016-02-14 08:45:32','2016-02-14 23:52:08',NULL,NULL,0,1,0),(2226,1,1,1,'Vendors',' Verum tamen cum de rebus grandioribus dicas, ipsae res verba rapiunt; Fortasse id optimum, sed ubi illud: Plus semper voluptatis? Et quod est munus, quod opus sapientiae? Duo Reges: constructio interrete. Aeque enim contingit omnibus fidibus, ut incontentae sint. Mihi quidem Antiochum, quem audis, satis belle videris attendere. Quod si ita sit, cur opera philosophiae sit danda nescio. Conferam tecum, quam cuique verso rem subicias; Graecum enim hunc versum nostis omnes-: Suavis laborum est praeteritorum memoria. \n\n','2016-02-14 08:45:32','2016-02-14 23:52:08',NULL,NULL,0,1,0),(2227,1,1,1,'Vendors',' Negat enim summo bono afferre incrementum diem. Audeo dicere, inquit. Quid enim de amicitia statueris utilitatis causa expetenda vides. Est autem etiam actio quaedam corporis, quae motus et status naturae congruentis tenet; Duo Reges: constructio interrete. Quid ad utilitatem tantae pecuniae? \n\n','2016-02-14 08:45:32','2016-02-14 23:52:09',NULL,NULL,0,1,0),(2228,1,1,1,'Vendors',' Paulum, cum regem Persem captum adduceret, eodem flumine invectio? Ita multo sanguine profuso in laetitia et in victoria est mortuus. Duo Reges: constructio interrete. Illa videamus, quae a te de amicitia dicta sunt. Perge porro; Apud ceteros autem philosophos, qui quaesivit aliquid, tacet; Pauca mutat vel plura sane; Utram tandem linguam nescio? \n\n','2016-02-14 08:45:33','2016-02-14 23:52:09',NULL,NULL,0,1,0),(2229,1,1,1,'Vendors',' Esse enim quam vellet iniquus iustus poterat inpune. Scrupulum, inquam, abeunti; Iam contemni non poteris. Non laboro, inquit, de nomine. Stoici autem, quod finem bonorum in una virtute ponunt, similes sunt illorum; Duo Reges: constructio interrete. Non potes, nisi retexueris illa. \n\n','2016-02-14 08:45:33','2016-02-14 23:52:09',NULL,NULL,0,1,0),(2230,1,1,1,'Vendors',' Sed in rebus apertissimis nimium longi sumus. Nam si quae sunt aliae, falsum est omnis animi voluptates esse e corporis societate. Duo Reges: constructio interrete. Ad quorum et cognitionem et usum iam corroborati natura ipsa praeeunte deducimur. At cum de plurimis eadem dicit, tum certe de maximis. Quid enim necesse est, tamquam meretricem in matronarum coetum, sic voluptatem in virtutum concilium adducere? At ille pellit, qui permulcet sensum voluptate. Idemne, quod iucunde? \n\n','2016-02-14 08:45:34','2016-02-14 23:52:10',NULL,NULL,0,1,0),(2231,1,1,1,'Vendors',' Immo vero, inquit, ad beatissime vivendum parum est, ad beate vero satis. Sed mehercule pergrata mihi oratio tua. An ea, quae per vinitorem antea consequebatur, per se ipsa curabit? Cui Tubuli nomen odio non est? Nam quid possumus facere melius? Duo Reges: constructio interrete. Atqui iste locus est, Piso, tibi etiam atque etiam confirmandus, inquam; Ad quorum et cognitionem et usum iam corroborati natura ipsa praeeunte deducimur. Quid, quod res alia tota est? \n\n','2016-02-14 08:45:34','2016-02-14 23:52:10',NULL,NULL,0,1,0),(2232,1,1,1,'Vendors',' Tu vero, inquam, ducas licet, si sequetur; Quae quo sunt excelsiores, eo dant clariora indicia naturae. Quid de Platone aut de Democrito loquar? Eademne, quae restincta siti? \n\n','2016-02-14 08:45:34','2016-02-14 23:52:10',NULL,NULL,0,1,0),(2233,1,1,1,'Vendors',' Deinde disputat, quod cuiusque generis animantium statui deceat extremum. Proclivi currit oratio. Si enim ad populum me vocas, eum. Quamquam ab iis philosophiam et omnes ingenuas disciplinas habemus; Duo Reges: constructio interrete. Nec vero intermittunt aut admirationem earum rerum, quae sunt ab antiquis repertae, aut investigationem novarum. Sic enim censent, oportunitatis esse beate vivere. Nummus in Croesi divitiis obscuratur, pars est tamen divitiarum. \n\n','2016-02-14 08:45:35','2016-02-14 23:52:11',NULL,NULL,0,1,0),(2234,1,1,1,'Vendors',' Ergo ita: non posse honeste vivi, nisi honeste vivatur? Nihil illinc huc pervenit. Vos autem cum perspicuis dubia debeatis illustrare, dubiis perspicua conamini tollere. Te ipsum, dignissimum maioribus tuis, voluptasne induxit, ut adolescentulus eriperes P. Isto modo ne improbos quidem, si essent boni viri. Haec et tu ita posuisti, et verba vestra sunt. Sed quid attinet de rebus tam apertis plura requirere? Nosti, credo, illud: Nemo pius est, qui pietatem-; \n\n','2016-02-14 08:45:35','2016-02-14 23:52:11',NULL,NULL,0,1,0),(2235,1,1,1,'Vendors',' Quae sequuntur igitur? Quid censes in Latino fore? Duo Reges: constructio interrete. Istam voluptatem perpetuam quis potest praestare sapienti? Nam aliquando posse recte fieri dicunt nulla expectata nec quaesita voluptate. \n\n','2016-02-14 08:45:35','2016-02-14 23:52:11',NULL,NULL,0,1,0),(2236,1,1,1,'Vendors',' Quae cum dixisset, finem ille. Ut scias me intellegere, primum idem esse dico voluptatem, quod ille don. Scaevolam M. Neque solum ea communia, verum etiam paria esse dixerunt. Ergo hoc quidem apparet, nos ad agendum esse natos. Sed mehercule pergrata mihi oratio tua. Duo Reges: constructio interrete. Iam id ipsum absurdum, maximum malum neglegi. Quod quidem iam fit etiam in Academia. Tamen a proposito, inquam, aberramus. \n\n','2016-02-14 08:45:36','2016-02-14 23:52:11',NULL,NULL,0,1,0),(2237,1,1,1,'Vendors',' Septem autem illi non suo, sed populorum suffragio omnium nominati sunt. Certe non potest. Atque haec ita iustitiae propria sunt, ut sint virtutum reliquarum communia. Quam tu ponis in verbis, ego positam in re putabam. Qui ita affectus, beatum esse numquam probabis; Duo Reges: constructio interrete. Isto modo, ne si avia quidem eius nata non esset. Quis hoc dicit? Nam si amitti vita beata potest, beata esse non potest. Ergo hoc quidem apparet, nos ad agendum esse natos. \n\n','2016-02-14 08:45:36','2016-02-14 23:52:12',NULL,NULL,0,1,0),(2238,1,1,1,'Vendors',' Tum Triarius: Posthac quidem, inquit, audacius. Duo Reges: constructio interrete. Quarum ambarum rerum cum medicinam pollicetur, luxuriae licentiam pollicetur. Consequens enim est et post oritur, ut dixi. Atqui reperies, inquit, in hoc quidem pertinacem; Omnes enim iucundum motum, quo sensus hilaretur. \n\n','2016-02-14 08:45:36','2016-02-14 23:52:12',NULL,NULL,0,1,0),(2239,1,1,1,'Vendors',' Duae sunt enim res quoque, ne tu verba solum putes. Est enim tanti philosophi tamque nobilis audacter sua decreta defendere. Duae sunt enim res quoque, ne tu verba solum putes. Duo Reges: constructio interrete. Ego quoque, inquit, didicerim libentius si quid attuleris, quam te reprehenderim. \n\n','2016-02-14 08:45:37','2016-02-14 23:52:13',NULL,NULL,0,1,0),(2240,1,1,1,'Vendors',' Quid ergo hoc loco intellegit honestum? Nunc omni virtuti vitium contrario nomine opponitur. Mihi, inquam, qui te id ipsum rogavi? Age, inquies, ista parva sunt. Duo Reges: constructio interrete. Ita similis erit ei finis boni, atque antea fuerat, neque idem tamen; Quodsi ipsam honestatem undique pertectam atque absolutam. Cum praesertim illa perdiscere ludus esset. \n\n','2016-02-14 08:45:37','2016-02-14 23:52:13',NULL,NULL,0,1,0),(2241,1,1,1,'Vendors',' Eaedem res maneant alio modo. Potius inflammat, ut coercendi magis quam dedocendi esse videantur. Legimus tamen Diogenem, Antipatrum, Mnesarchum, Panaetium, multos alios in primisque familiarem nostrum Posidonium. Hoc etsi multimodis reprehendi potest, tamen accipio, quod dant. \n\n','2016-02-14 08:45:37','2016-02-14 23:52:14',NULL,NULL,0,1,0),(2242,1,1,1,'Vendors',' Oratio me istius philosophi non offendit; Quod si ita se habeat, non possit beatam praestare vitam sapientia. \n\n','2016-02-14 08:45:38','2016-02-14 23:52:14',NULL,NULL,0,1,0),(2243,1,1,1,'Vendors',' Dempta enim aeternitate nihilo beatior Iuppiter quam Epicurus; Inde sermone vario sex illa a Dipylo stadia confecimus. Duo Reges: constructio interrete. Hoc enim constituto in philosophia constituta sunt omnia. Hoc simile tandem est? Quid, cum fictas fabulas, e quibus utilitas nulla elici potest, cum voluptate legimus? Si quicquam extra virtutem habeatur in bonis. Nec vero intermittunt aut admirationem earum rerum, quae sunt ab antiquis repertae, aut investigationem novarum. Sed nimis multa. An est aliquid, quod te sua sponte delectet? Quid ait Aristoteles reliquique Platonis alumni? \n\n','2016-02-14 08:45:38','2016-02-14 23:52:14',NULL,NULL,0,1,0),(2244,1,1,1,'Vendors',' Sed tu istuc dixti bene Latine, parum plane. Sed eum qui audiebant, quoad poterant, defendebant sententiam suam. Atqui reperies, inquit, in hoc quidem pertinacem; Hic nihil fuit, quod quaereremus. Duo Reges: constructio interrete. Eademne, quae restincta siti? Nam his libris eum malo quam reliquo ornatu villae delectari. Sed ille, ut dixi, vitiose. Esse enim quam vellet iniquus iustus poterat inpune. \n\n','2016-02-14 08:45:38','2016-02-14 23:52:14',NULL,NULL,0,1,0),(2245,1,1,1,'Vendors',' Graece donan, Latine voluptatem vocant. Dat enim intervalla 