 debilitates repellant. Hinc ceteri particulas arripere conati suam quisque videro voluit afferre sententiam. Quo modo? Potius inflammat, ut coercendi magis quam dedocendi esse videantur. Quis contra in illa aetate pudorem, constantiam, etiamsi sua nihil intersit, non tamen diligat? Negat esse eam, inquit, propter se expetendam. Ab hoc autem quaedam non melius quam veteres, quaedam omnino relicta. Universa enim illorum ratione cum tota vestra confligendum puto. \n\n','2016-02-14 08:45:40','2016-02-14 23:52:16',NULL,NULL,0,1,0),(2251,1,1,1,'Vendors',' Ego quoque, inquit, didicerim libentius si quid attuleris, quam te reprehenderim. Parvi enim primo ortu sic iacent, tamquam omnino sine animo sint. Utinam quidem dicerent alium alio beatiorem! Iam ruinas videres. Quod vestri non item. Tuo vero id quidem, inquam, arbitratu. Quis est, qui non oderit libidinosam, protervam adolescentiam? Ne in odium veniam, si amicum destitero tueri. Duo Reges: constructio interrete. An quod ita callida est, ut optime possit architectari voluptates? Apud imperitos tum illa dicta sunt, aliquid etiam coronae datum; Aliter homines, aliter philosophos loqui putas oportere? Qui ita affectus, beatum esse numquam probabis; \n\n','2016-02-14 08:45:41','2016-02-14 23:52:17',NULL,NULL,0,1,0),(2252,1,1,1,'Vendors',' Certe, nisi voluptatem tanti aestimaretis. Tum ille timide vel potius verecunde: Facio, inquit. Duo Reges: constructio interrete. Tollenda est atque extrahenda radicitus. \n\n','2016-02-14 08:45:41','2016-02-14 23:52:17',NULL,NULL,0,1,0),(2253,1,1,1,'Vendors',' Atque haec coniunctio confusioque virtutum tamen a philosophis ratione quadam distinguitur. Quod si ita est, sequitur id ipsum, quod te velle video, omnes semper beatos esse sapientes. Atqui reperies, inquit, in hoc quidem pertinacem; Omnia contraria, quos etiam insanos esse vultis. Duo Reges: constructio interrete. Qua ex cognitione facilior facta est investigatio rerum occultissimarum. Itaque his sapiens semper vacabit. Nihilne te delectat umquam -video, quicum loquar-, te igitur, Torquate, ipsum per se nihil delectat? \n\n','2016-02-14 08:45:41','2016-02-14 23:52:17',NULL,NULL,0,1,0),(2254,1,1,1,'Vendors',' Quid est igitur, cur ita semper deum appellet Epicurus beatum et aeternum? Atqui pugnantibus et contrariis studiis consiliisque semper utens nihil quieti videre, nihil tranquilli potest. Omnia contraria, quos etiam insanos esse vultis. Ne amores quidem sanctos a sapiente alienos esse arbitrantur. Eadem nunc mea adversum te oratio est. \n\n','2016-02-14 08:45:42','2016-02-14 23:52:18',NULL,NULL,0,1,0),(2255,1,1,1,'Vendors',' Videamus animi partes, quarum est conspectus illustrior; In qua quid est boni praeter summam voluptatem, et eam sempiternam? Et quidem iure fortasse, sed tamen non gravissimum est testimonium multitudinis. Inquit, dasne adolescenti veniam? Duo Reges: constructio interrete. Sed haec nihil sane ad rem; \n\n','2016-02-14 08:45:42','2016-02-14 23:52:18',NULL,NULL,0,1,0),(2256,1,1,1,'Vendors',' Sed tamen intellego quid velit. Quoniam, si dis placet, ab Epicuro loqui discimus. Quid enim de amicitia statueris utilitatis causa expetenda vides. Duo Reges: constructio interrete. Nam de isto magna dissensio est. \n\n','2016-02-14 08:45:42','2016-02-14 23:52:18',NULL,NULL,0,1,0),(2257,1,1,1,'Vendors',' Eadem nunc mea adversum te oratio est. Utinam quidem dicerent alium alio beatiorem! Iam ruinas videres. Quid sequatur, quid repugnet, vident. Cum ageremus, inquit, vitae beatum et eundem supremum diem, scribebamus haec. Cupiditates non Epicuri divisione finiebat, sed sua satietate. Duo Reges: constructio interrete. Sed haec quidem liberius ab eo dicuntur et saepius. Non potes, nisi retexueris illa. Sed virtutem ipsam inchoavit, nihil amplius. Quae cum praeponunt, ut sit aliqua rerum selectio, naturam videntur sequi; Non semper, inquam; Sed quid attinet de rebus tam apertis plura requirere? Primum quid tu dicis breve? \n\n','2016-02-14 08:45:43','2016-02-14 23:52:19',NULL,NULL,0,1,0),(2258,1,1,1,'Vendors',' Solum praeterea formosum, solum liberum, solum civem, stultost; Propter nos enim illam, non propter eam nosmet ipsos diligimus. Nam, ut sint illa vendibiliora, haec uberiora certe sunt. Septem autem illi non suo, sed populorum suffragio omnium nominati sunt. Ut in geometria, prima si dederis, danda sunt omnia. At negat Epicurus-hoc enim vestrum lumen estquemquam, qui honeste non vivat, iucunde posse vivere. \n\n','2016-02-14 08:45:43','2016-02-14 23:52:19',NULL,NULL,0,1,0),(2259,1,1,1,'Vendors',' Cur igitur, cum de re conveniat, non malumus usitate loqui? Hosne igitur laudas et hanc eorum, inquam, sententiam sequi nos censes oportere? Tibi hoc incredibile, quod beatissimum. Utrum igitur tibi litteram videor an totas paginas commovere? Videmusne ut pueri ne verberibus quidem a contemplandis rebus perquirendisque deterreantur? Istam voluptatem perpetuam quis potest praestare sapienti? Unum est sine dolore esse, alterum cum voluptate. Duo Reges: constructio interrete. \n\n','2016-02-14 08:45:43','2016-02-14 23:52:19',NULL,NULL,0,1,0),(2260,1,1,1,'Vendors',' Hoc loco tenere se Triarius non potuit. Universa enim illorum ratione cum tota vestra confligendum puto. Terram, mihi crede, ea lanx et maria deprimet. Item de contrariis, a quibus ad genera formasque generum venerunt. \n\n','2016-02-14 08:45:44','2016-02-14 23:52:19',NULL,NULL,0,1,0),(2261,1,1,1,'Vendors',' Duo enim genera quae erant, fecit tria. Ita enim vivunt quidam, ut eorum vita refellatur oratio. Cetera illa adhibebat, quibus demptis negat se Epicurus intellegere quid sit bonum. Idem iste, inquam, de voluptate quid sentit? Duo Reges: constructio interrete. Estne, quaeso, inquam, sitienti in bibendo voluptas? Primum in nostrane potestate est, quid meminerimus? Videmus igitur ut conquiescere ne infantes quidem possint. Qui convenit? \n\n','2016-02-14 08:45:44','2016-02-14 23:52:20',NULL,NULL,0,1,0),(2262,1,1,1,'Vendors',' Suo enim quisque studio maxime ducitur. Quae qui non vident, nihil umquam magnum ac cognitione dignum amaverunt. Quid enim possumus hoc agere divinius? Ita graviter et severe voluptatem secrevit a bono. \n\n','2016-02-14 08:45:44','2016-02-14 23:52:20',NULL,NULL,0,1,0),(2263,1,1,1,'Vendors',' Equidem e Cn. Et quidem saepe quaerimus verbum Latinum par Graeco et quod idem valeat; Philosophi autem in suis lectulis plerumque moriuntur. Scaevola tribunus plebis ferret ad plebem vellentne de ea re quaeri. Ita credo. Cur, nisi quod turpis oratio est? Nunc omni virtuti vitium contrario nomine opponitur. Duo Reges: constructio interrete. Bonum liberi: misera orbitas. Ait enim se, si uratur, Quam hoc suave! dicturum. \n\n','2016-02-14 08:45:45','2016-02-14 23:52:20',NULL,NULL,0,1,0),(2264,1,1,1,'Vendors',' Ergo illi intellegunt quid Epicurus dicat, ego non intellego? Octavio fuit, cum illam severitatem in eo filio adhibuit, quem in adoptionem D. Sed haec omittamus; Quis enim potest ea, quae probabilia videantur ei, non probare? Primum in nostrane potestate est, quid meminerimus? Recte dicis; Duo Reges: constructio interrete. Qui-vere falsone, quaerere mittimus-dicitur oculis se privasse; Quo studio Aristophanem putamus aetatem in litteris duxisse? Quid, si etiam iucunda memoria est praeteritorum malorum? \n\n','2016-02-14 08:45:45','2016-02-14 23:52:21',NULL,NULL,0,1,0),(2265,1,1,1,'Vendors',' Qui non moveatur et offensione turpitudinis et comprobatione honestatis? Stoicos roga. Ut enim consuetudo loquitur, id solum dicitur honestum, quod est populari fama gloriosum. An eum discere ea mavis, quae cum plane perdidiceriti nihil sciat? Ita enim vivunt quidam, ut eorum vita refellatur oratio. Sed nunc, quod agimus; Quid, si etiam iucunda memoria est praeteritorum malorum? \n\n','2016-02-14 08:45:51','2016-02-14 23:52:21',NULL,NULL,0,1,0),(2266,1,1,1,'Vendors',' Ut nemo dubitet, eorum omnia officia quo spectare, quid sequi, quid fugere debeant? Nec vero sum nescius esse utilitatem in historia, non modo voluptatem. Hic nihil fuit, quod quaereremus. Hos contra singulos dici est melius. Virtutis, magnitudinis animi, patientiae, fortitudinis fomentis dolor mitigari solet. \n\n','2016-02-14 08:45:51','2016-02-14 23:52:21',NULL,NULL,0,1,0),(2267,1,1,1,'Vendors',' Roges enim Aristonem, bonane ei videantur haec: vacuitas doloris, divitiae, valitudo; Id et fieri posse et saepe esse factum et ad voluptates percipiendas maxime pertinere. Ergo hoc quidem apparet, nos ad agendum esse natos. \n\n','2016-02-14 08:45:51','2016-02-14 23:52:22',NULL,NULL,0,1,0),(2268,1,1,1,'Vendors',' Itaque quantum adiit periculum! ad honestatem enim illum omnem conatum suum referebat, non ad voluptatem. Ergo hoc quidem apparet, nos ad agendum esse natos. Sin eam, quam Hieronymus, ne fecisset idem, ut voluptatem illam Aristippi in prima commendatione poneret. Duo Reges: constructio interrete. \n\n','2016-02-14 08:45:51','2016-02-14 23:52:22',NULL,NULL,0,1,0),(2269,1,1,1,'Vendors',' Duo Reges: constructio interrete. Nonne videmus quanta perturbatio rerum omnium consequatur, quanta confusio? Vide, quantum, inquam, fallare, Torquate. Deinde prima illa, quae in congressu solemus: Quid tu, inquit, huc? Varietates autem iniurasque fortunae facile veteres philosophorum praeceptis instituta vita superabat. Re mihi non aeque satisfacit, et quidem locis pluribus. Scio enim esse quosdam, qui quavis lingua philosophari possint; \n\n','2016-02-14 08:45:52','2016-02-14 23:52:22',NULL,NULL,0,1,0),(2270,1,1,1,'Vendors',' Potius inflammat, ut coercendi magis quam dedocendi esse videantur. Propter nos enim illam, non propter eam nosmet ipsos diligimus. Idem iste, inquam, de voluptate quid sentit? Idemne, quod iucunde? Summum ením bonum exposuit vacuitatem doloris; Sit hoc ultimum bonorum, quod nunc a me defenditur; Duo Reges: constructio interrete. \n\n','2016-02-14 08:45:52','2016-02-14 23:52:23',NULL,NULL,0,1,0),(2271,1,1,1,'Vendors',' Deinde prima illa, quae in congressu solemus: Quid tu, inquit, huc? Quae autem natura suae primae institutionis oblita est? Duo Reges: constructio interrete. Si enim ita est, vide ne facinus facias, cum mori suadeas. Respondent extrema primis, media utrisque, omnia omnibus. Graecum enim hunc versum nostis omnes-: Suavis laborum est praeteritorum memoria. \n\n','2016-02-14 08:45:53','2016-02-14 23:52:23',NULL,NULL,0,1,0),(2272,1,1,1,'Vendors',' Dic in quovis conventu te omnia facere, ne doleas. Tubulo putas dicere? Idcirco enim non desideraret, quia, quod dolore caret, id in voluptate est. Duo Reges: constructio interrete. Quod autem principium officii quaerunt, melius quam Pyrrho; Haec para/doca illi, nos admirabilia dicamus. Non enim solum Torquatus dixit quid sentiret, sed etiam cur. Primum in nostrane potestate est, quid meminerimus? Duae sunt enim res quoque, ne tu verba solum putes. His similes sunt omnes, qui virtuti student levantur vitiis, levantur erroribus, nisi forte censes Ti. \n\n','2016-02-14 08:45:53','2016-02-14 23:52:23',NULL,NULL,0,1,0),(2273,1,1,1,'Vendors',' Quid enim possumus hoc agere divinius? Est igitur officium eius generis, quod nec in bonis ponatur nec in contrariis. Quae cum dixisset paulumque institisset, Quid est? Etsi ea quidem, quae adhuc dixisti, quamvis ad aetatem recte isto modo dicerentur. Hoc tu nunc in illo probas. Tum mihi Piso: Quid ergo? \n\n','2016-02-14 08:45:54','2016-02-14 23:52:24',NULL,NULL,0,1,0),(2274,1,1,1,'Vendors',' Igitur neque stultorum quisquam beatus neque sapientium non beatus. Neminem videbis ita laudatum, ut artifex callidus comparandarum voluptatum diceretur. Cur igitur easdem res, inquam, Peripateticis dicentibus verbum nullum est, quod non intellegatur? Intellegi quidem, ut propter aliam quampiam rem, verbi gratia propter voluptatem, nos amemus; Est tamen ea secundum naturam multoque nos ad se expetendam magis hortatur quam superiora omnia. Duo Reges: constructio interrete. \n\n','2016-02-14 08:45:54','2016-02-14 23:52:24',NULL,NULL,0,1,0),(2275,1,1,1,'Vendors',' Dolere malum est: in crucem qui agitur, beatus esse non potest. An hoc usque quaque, aliter in vita? In schola desinis. At multis malis affectus. Et hercule-fatendum est enim, quod sentio -mirabilis est apud illos contextus rerum. Sed residamus, inquit, si placet. Duo Reges: constructio interrete. \n\n','2016-02-14 08:45:55','2016-02-14 23:52:25',NULL,NULL,0,1,0),(2276,1,1,1,'Vendors',' Quae diligentissime contra Aristonem dicuntur a Chryippo. Est, ut dicis, inquit; Ut aliquid scire se gaudeant? Conferam tecum, quam cuique verso rem subicias; Morbo gravissimo affectus, exul, orbus, egens, torqueatur eculeo: quem hunc appellas, Zeno? Et quidem, Cato, hanc totam copiam iam Lucullo nostro notam esse oportebit; \n\n','2016-02-14 08:45:56','2016-02-14 23:52:25',NULL,NULL,0,1,0),(2277,1,1,1,'Vendors',' Neque solum ea communia, verum etiam paria esse dixerunt. Duo Reges: constructio interrete. At ille pellit, qui permulcet sensum voluptate. Ut proverbia non nulla veriora sint quam vestra dogmata. Quid enim tanto opus est instrumento in optimis artibus comparandis? Itaque primos congressus copulationesque et consuetudinum instituendarum voluntates fieri propter voluptatem; \n\n','2016-02-14 08:45:56','2016-02-14 23:52:25',NULL,NULL,0,1,0),(2278,1,1,1,'Vendors',' Collige omnia, quae soletis: Praesidium amicorum. Quae cum dixisset paulumque institisset, Quid est? Duo Reges: constructio interrete. Erit enim instructus ad mortem contemnendam, ad exilium, ad ipsum etiam dolorem. Eorum enim est haec querela, qui sibi cari sunt seseque diligunt. Verum hoc idem saepe faciamus. \n\n','2016-02-14 08:45:57','2016-02-14 23:52:26',NULL,NULL,0,1,0),(2279,1,1,1,'Vendors',' Et quidem iure fortasse, sed tamen non gravissimum est testimonium multitudinis. Quid ait Aristoteles reliquique Platonis alumni? Paria sunt igitur. Duo Reges: constructio interrete. Cur igitur, inquam, res tam dissimiles eodem nomine appellas? Nihilo beatiorem esse Metellum quam Regulum. Nemo nostrum istius generis asotos iucunde putat vivere. Iubet igitur nos Pythius Apollo noscere nosmet ipsos. Re mihi non aeque satisfacit, et quidem locis pluribus. \n\n','2016-02-14 08:45:57','2016-02-14 23:52:26',NULL,NULL,0,1,0),(2280,1,1,1,'Vendors',' Cur tantas regiones barbarorum pedibus obiit, tot maria transmisit? Et quod est munus, quod opus sapientiae? Nam his libris eum malo quam reliquo ornatu villae delectari. Neque enim disputari sine reprehensione nec cum iracundia aut pertinacia recte disputari potest. Illa sunt similia: hebes acies est cuipiam oculorum, corpore alius senescit; Negabat igitur ullam esse artem, quae ipsa a se proficisceretur; Duo Reges: constructio interrete. Nihil illinc huc pervenit. \n\n','2016-02-14 08:45:57','2016-02-14 23:52:26',NULL,NULL,0,1,0),(2281,1,1,1,'Vendors',' Itaque contra est, ac dicitis; Sed erat aequius Triarium aliquid de dissensione nostra iudicare. Non enim solum Torquatus dixit quid sentiret, sed etiam cur. Quaesita enim virtus est, non quae relinqueret naturam, sed quae tueretur. Primum cur ista res digna odio est, nisi quod est turpis? Terram, mihi crede, ea lanx et maria deprimet. Hoc mihi cum tuo fratre convenit. \n\n','2016-02-14 08:45:58','2016-02-14 23:52:27',NULL,NULL,0,1,0),(2282,1,1,1,'Vendors',' Sic consequentibus vestris sublatis prima tolluntur. Non semper, inquam; Potius ergo illa dicantur: turpe esse, viri non esse debilitari dolore, frangi, succumbere. Cur iustitia laudatur? Duo Reges: constructio interrete. Quae diligentissime contra Aristonem dicuntur a Chryippo. Hos contra singulos dici est melius. Quae fere omnia appellantur uno ingenii nomine, easque virtutes qui habent, ingeniosi vocantur. Sed emolumenta communia esse dicuntur, recte autem facta et peccata non habentur communia. \n\n','2016-02-14 08:45:58','2016-02-14 23:52:27',NULL,NULL,0,1,0),(2283,1,1,1,'Vendors',' Duo Reges: constructio interrete. Occultum facinus esse potuerit, gaudebit; Cum id quoque, ut cupiebat, audivisset, evelli iussit eam, qua erat transfixus, hastam. Quicquid porro animo cernimus, id omne oritur a sensibus; Unum est sine dolore esse, alterum cum voluptate. Progredientibus autem aetatibus sensim tardeve potius quasi nosmet ipsos cognoscimus. Sed vobis voluptatum perceptarum recordatio vitam beatam facit, et quidem corpore perceptarum. Atque hoc loco similitudines eas, quibus illi uti solent, dissimillimas proferebas. In quibus doctissimi illi veteres inesse quiddam caeleste et divinum putaverunt. Re mihi non aeque satisfacit, et quidem locis pluribus. Cur igitur, inquam, res tam dissimiles eodem nomine appellas? Mihi, inquam, qui te id ipsum rogavi? \n\n','2016-02-14 08:45:58','2016-02-14 23:52:27',NULL,NULL,0,1,0),(2284,1,1,1,'Vendors',' Apparet statim, quae sint officia, quae actiones. Illum mallem levares, quo optimum atque humanissimum virum, Cn. Haec para/doca illi, nos admirabilia dicamus. Si de re disceptari oportet, nulla mihi tecum, Cato, potest esse dissensio. An potest cupiditas finiri? Bonum integritas corporis: misera debilitas. Duo Reges: constructio interrete. Post enim Chrysippum eum non sane est disputatum. Multoque hoc melius nos veriusque quam Stoici. Torquatus, is qui consul cum Cn. \n\n','2016-02-14 08:45:59','2016-02-14 23:52:27',NULL,NULL,0,1,0),(2285,1,1,1,'Vendors',' Quid ergo hoc loco intellegit honestum? Ego quoque, inquit, didicerim libentius si quid attuleris, quam te reprehenderim. An me, inquam, nisi te audire vellem, censes haec dicturum fuisse? Quae cum essent dicta, finem fecimus et ambulandi et disputandi. Duo Reges: constructio interrete. Illa videamus, quae a te de amicitia dicta sunt. Quid ergo aliud intellegetur nisi uti ne quae pars naturae neglegatur? Claudii libidini, qui tum erat summo ne imperio, dederetur. Quasi ego id curem, quid ille aiat aut neget. Cur igitur, inquam, res tam dissimiles eodem nomine appellas? \n\n','2016-02-14 08:45:59','2016-02-14 23:52:28',NULL,NULL,0,1,0),(2286,1,1,1,'Vendors',' Atqui reperies, inquit, in hoc quidem pertinacem; Sed quot homines, tot sententiae; Dicimus aliquem hilare vivere; Duo Reges: constructio interrete. Sed tamen est aliquid, quod nobis non liceat, liceat illis. Quid ei reliquisti, nisi te, quoquo modo loqueretur, intellegere, quid diceret? Quia nec honesto quic quam honestius nec turpi turpius. Hoc sic expositum dissimile est superiori. Respondent extrema primis, media utrisque, omnia omnibus. \n\n','2016-02-14 08:45:59','2016-02-14 23:52:28',NULL,NULL,0,1,0),(2287,1,1,1,'Vendors',' In eo enim positum est id, quod dicimus esse expetendum. Si enim ad populum me vocas, eum. Ab his oratores, ab his imperatores ac rerum publicarum principes extiterunt. Tum Torquatus: Prorsus, inquit, assentior; A primo, ut opinor, animantium ortu petitur origo summi boni. \n\n','2016-02-14 08:46:00','2016-02-14 23:52:28',NULL,NULL,0,1,0),(2288,1,1,1,'Vendors',' Quid, si etiam iucunda memoria est praeteritorum malorum? De malis autem et bonis ab iis animalibus, quae nondum depravata sint, ait optime iudicari. Verba tu fingas et ea dicas, quae non sentias? Duo Reges: constructio interrete. Ergo hoc quidem apparet, nos ad agendum esse natos. Post enim Chrysippum eum non sane est disputatum. Sed quid sentiat, non videtis. Sed quae tandem ista ratio est? Sed ego in hoc resisto; Qui autem esse poteris, nisi te amor ipse ceperit? \n\n','2016-02-14 08:46:00','2016-02-14 23:52:29',NULL,NULL,0,1,0),(2289,1,1,1,'Vendors',' Hoc loco tenere se Triarius non potuit. Minime vero istorum quidem, inquit. Et hercule-fatendum est enim, quod sentio -mirabilis est apud illos contextus rerum. Videsne, ut haec concinant? Mihi, inquam, qui te id ipsum rogavi? Duo Reges: constructio interrete. Sed tu istuc dixti bene Latine, parum plane. Qui potest igitur habitare in beata vita summi mali metus? \n\n','2016-02-14 08:46:00','2016-02-14 23:52:29',NULL,NULL,0,1,0),(2290,1,1,1,'Vendors',' Non igitur bene. Qualem igitur hominem natura inchoavit? Utram tandem linguam nescio? De ingenio eius in his disputationibus, non de moribus quaeritur. Quia dolori non voluptas contraria est, sed doloris privatio. Honesta oratio, Socratica, Platonis etiam. Diodorus, eius auditor, adiungit ad honestatem vacuitatem doloris. \n\n','2016-02-14 08:46:01','2016-02-14 23:52:29',NULL,NULL,0,1,0),(2291,1,1,1,'Vendors',' Itaque contra est, ac dicitis; Deinde prima illa, quae in congressu solemus: Quid tu, inquit, huc? Quae cum magnifice primo dici viderentur, considerata minus probabantur. Bona autem corporis huic sunt, quod posterius posui, similiora. Duo Reges: constructio interrete. Sed quid attinet de rebus tam apertis plura requirere? Nunc ita separantur, ut disiuncta sint, quo nihil potest esse perversius. Primum Theophrasti, Strato, physicum se voluit; Huic ego, si negaret quicquam interesse ad beate vivendum quali uteretur victu, concederem, laudarem etiam; Ratio enim nostra consentit, pugnat oratio. \n\n','2016-02-14 08:46:01','2016-02-14 23:52:29',NULL,NULL,0,1,0),(2292,1,1,1,'Vendors',' Qua tu etiam inprudens utebare non numquam. Est enim effectrix multarum et magnarum voluptatum. Haec quo modo conveniant, non sane intellego. Tu vero, inquam, ducas licet, si sequetur; Sed hoc sane concedamus. Duo Reges: constructio interrete. Certe non potest. \n\n','2016-02-14 08:46:01','2016-02-14 23:52:30',NULL,NULL,0,1,0),(2293,1,1,1,'Vendors',' Sint modo partes vitae beatae. Videsne, ut haec concinant? Sed haec omittamus; Duo Reges: constructio interrete. An est aliquid per se ipsum flagitiosum, etiamsi nulla comitetur infamia? Dempta enim aeternitate nihilo beatior Iuppiter quam Epicurus; Si verbum sequimur, primum longius verbum praepositum quam bonum. Conferam tecum, quam cuique verso rem subicias; Eadem nunc mea adversum te oratio est. Aliter homines, aliter philosophos loqui putas oportere? \n\n','2016-02-14 08:46:02','2016-02-14 23:52:30',NULL,NULL,0,1,0),(2294,1,1,1,'Vendors',' Itaque eos id agere, ut a se dolores, morbos, debilitates repellant. Luxuriam non reprehendit, modo sit vacua infinita cupiditate et timore. Erat enim Polemonis. Quid ergo hoc loco intellegit honestum? Negat esse eam, inquit, propter se expetendam. Duo Reges: constructio interrete. \n\n','2016-02-14 08:46:02','2016-02-14 23:52:30',NULL,NULL,0,1,0),(2295,1,1,1,'Vendors',' Aliter enim explicari, quod quaeritur, non potest. Diodorus, eius auditor, adiungit ad honestatem vacuitatem doloris. \n\n','2016-02-14 08:46:02','2016-02-14 23:52:31',NULL,NULL,0,1,0),(2296,1,1,1,'Vendors',' Ne amores quidem sanctos a sapiente alienos esse arbitrantur. Isto modo, ne si avia quidem eius nata non esset. Et quidem iure fortasse, sed tamen non gravissimum est testimonium multitudinis. Roges enim Aristonem, bonane ei videantur haec: vacuitas doloris, divitiae, valitudo; Duo Reges: constructio interrete. Sed haec quidem liberius ab eo dicuntur et saepius. Quid, quod homines infima fortuna, nulla spe rerum gerendarum, opifices denique delectantur historia? \n\n','2016-02-14 08:46:03','2016-02-14 23:52:31',NULL,NULL,0,1,0),(2297,1,1,1,'Vendors',' Primum in nostrane potestate est, quid meminerimus? Rhetorice igitur, inquam, nos mavis quam dialectice disputare? Iam enim adesse poterit. Quodsi ipsam honestatem undique pertectam atque absolutam. \n\n','2016-02-14 08:46:03','2016-02-14 23:52:31',NULL,NULL,0,1,0),(2298,1,1,1,'Vendors',' In quibus doctissimi illi veteres inesse quiddam caeleste et divinum putaverunt. Et ille ridens: Video, inquit, quid agas; Et quod est munus, quod opus sapientiae? At modo dixeras nihil in istis rebus esse, quod interesset. Duo Reges: constructio interrete. Est enim effectrix multarum et magnarum voluptatum. Quamquam id quidem licebit iis existimare, qui legerint. Quod cum dixissent, ille contra. An tu me de L. Naturales divitias dixit parabiles esse, quod parvo esset natura contenta. Immo alio genere; Nam si propter voluptatem, quae est ista laus, quae possit e macello peti? \n\n','2016-02-14 08:46:03','2016-02-14 23:52:32',NULL,NULL,0,1,0),(2299,1,1,1,'Vendors',' Illud dico, ea, quae dicat, praeclare inter se cohaerere. Hoc ne statuam quidem dicturam pater aiebat, si loqui posset. Est autem officium, quod ita factum est, ut eius facti probabilis ratio reddi possit. Duarum enim vitarum nobis erunt instituta capienda. Duo Reges: constructio interrete. An est aliquid, quod te sua sponte delectet? Sed quid attinet de rebus tam apertis plura requirere? \n\n','2016-02-14 08:46:04','2016-02-14 23:52:32',NULL,NULL,0,1,0),(2300,1,1,1,'Vendors',' Huius ego nunc auctoritatem sequens idem faciam. At enim hic etiam dolore. Res enim se praeclare habebat, et quidem in utraque parte. Isto modo ne improbos quidem, si essent boni viri. Ego vero isti, inquam, permitto. Sin aliud quid voles, postea. \n\n','2016-02-14 08:46:04','2016-02-14 23:52:32',NULL,NULL,0,1,0),(2301,1,1,1,'Vendors',' Huius ego nunc auctoritatem sequens idem faciam. Paulum, cum regem Persem captum adduceret, eodem flumine invectio? Neminem videbis ita laudatum, ut artifex callidus comparandarum voluptatum diceretur. Duo Reges: constructio interrete. \n\n','2016-02-14 08:46:04','2016-02-14 23:52:33',NULL,NULL,0,1,0),(2302,1,1,1,'Vendors',' Cum ageremus, inquit, vitae beatum et eundem supremum diem, scribebamus haec. Consequens enim est et post oritur, ut dixi. Quia nec honesto quic quam honestius nec turpi turpius. Duo Reges: constructio interrete. Quis animo aequo videt eum, quem inpure ac flagitiose putet vivere? Sit hoc ultimum bonorum, quod nunc a me defenditur; \n\n','2016-02-14 08:46:05','2016-02-14 23:52:33',NULL,NULL,0,1,0),(2303,1,1,1,'Vendors',' Quod eo liquidius faciet, si perspexerit rerum inter eas verborumne sit controversia. Hos contra singulos dici est melius. Nunc omni virtuti vitium contrario nomine opponitur. Ergo illi intellegunt quid Epicurus dicat, ego non intellego? Hosne igitur laudas et hanc eorum, inquam, sententiam sequi nos censes oportere? An est aliquid per se ipsum flagitiosum, etiamsi nulla comitetur infamia? An eum discere ea mavis, quae cum plane perdidiceriti nihil sciat? Duo Reges: constructio interrete. Sed quoniam et advesperascit et mihi ad villam revertendum est, nunc quidem hactenus; Sed tamen omne, quod de re bona dilucide dicitur, mihi praeclare dici videtur. \n\n','2016-02-14 08:46:05','2016-02-14 23:52:33',NULL,NULL,0,1,0),(2304,1,1,1,'Vendors',' Non quaeritur autem quid naturae tuae consentaneum sit, sed quid disciplinae. Nemo nostrum istius generis asotos iucunde putat vivere. Septem autem illi non suo, sed populorum suffragio omnium nominati sunt. Sumenda potius quam expetenda. Hoc loco tenere se Triarius non potuit. Duo Reges: constructio interrete. Stoicos roga. Facile est hoc cernere in primis puerorum aetatulis. Sed quae tandem ista ratio est? Ergo adhuc, quantum equidem intellego, causa non videtur fuisse mutandi nominis. Num igitur utiliorem tibi hunc Triarium putas esse posse, quam si tua sint Puteolis granaria? Virtutis, magnitudinis animi, patientiae, fortitudinis fomentis dolor mitigari solet. \n\n','2016-02-14 08:46:05','2016-02-14 23:52:34',NULL,NULL,0,1,0),(2305,1,1,1,'Vendors',' Utinam quidem dicerent alium alio beatiorem! Iam ruinas videres. Sic enim maiores nostri labores non fugiendos tristissimo tamen verbo aerumnas etiam in deo nominaverunt. Est enim effectrix multarum et magnarum voluptatum. Cum ageremus, inquit, vitae beatum et eundem supremum diem, scribebamus haec. Quam illa ardentis amores excitaret sui! Cur tandem? \n\n','2016-02-14 08:46:06','2016-02-14 23:52:34',NULL,NULL,0,1,0),(2306,1,1,1,'Vendors',' Qui autem esse poteris, nisi te amor ipse ceperit? Comprehensum, quod cognitum non habet? Quis negat? Nam aliquando posse recte fieri dicunt nulla expectata nec quaesita voluptate. \n\n','2016-02-14 08:46:06','2016-02-14 23:52:34',NULL,NULL,0,1,0),(2307,1,1,1,'Vendors',' Atque haec ita iustitiae propria sunt, ut sint virtutum reliquarum communia. At iam decimum annum in spelunca iacet. Summus dolor plures dies manere non potest? Ut in geometria, prima si dederis, danda sunt omnia. Ille incendat? Non enim, si omnia non sequebatur, idcirco non erat ortus illinc. \n\n','2016-02-14 08:46:06','2016-02-14 23:52:35',NULL,NULL,0,1,0),(2308,1,1,1,'Vendors',' Eam tum adesse, cum dolor omnis absit; Quam ob rem tandem, inquit, non satisfacit? Satis est tibi in te, satis in legibus, satis in mediocribus amicitiis praesidii. Duo Reges: constructio interrete. Si qua in iis corrigere voluit, deteriora fecit. Ego quoque, inquit, didicerim libentius si quid attuleris, quam te reprehenderim. Semper enim ex eo, quod maximas partes continet latissimeque funditur, tota res appellatur. Tollenda est atque extrahenda radicitus. At eum nihili facit; Te enim iudicem aequum puto, modo quae dicat ille bene noris. \n\n','2016-02-14 08:46:07','2016-02-14 23:52:36',NULL,NULL,0,1,0),(2309,1,1,1,'Vendors',' Quam nemo umquam voluptatem appellavit, appellat; An potest, inquit ille, quicquam esse suavius quam nihil dolere? Consequens enim est et post oritur, ut dixi. Duo Reges: constructio interrete. Vitiosum est enim in dividendo partem in genere numerare. Is es profecto tu. Si est nihil nisi corpus, summa erunt illa: valitudo, vacuitas doloris, pulchritudo, cetera. Et quod est munus, quod opus sapientiae? \n\n','2016-02-14 08:46:07','2016-02-14 23:52:36',NULL,NULL,0,1,0),(2310,1,1,1,'Vendors',' Nec lapathi suavitatem acupenseri Galloni Laelius anteponebat, sed suavitatem ipsam neglegebat; Quid dubitas igitur mutare principia naturae? Isto modo ne improbos quidem, si essent boni viri. Quamquam id quidem, infinitum est in hac urbe; \n\n','2016-02-14 08:46:07','2016-02-14 23:52:36',NULL,NULL,0,1,0),(2311,1,1,1,'Vendors',' Nihil opus est exemplis hoc facere longius. Duo Reges: constructio interrete. Itaque contra est, ac dicitis; Facit enim ille duo seiuncta ultima bonorum, quae ut essent vera, coniungi debuerunt; Potius inflammat, ut coercendi magis quam dedocendi esse videantur. Mihi, inquam, qui te id ipsum rogavi? \n\n','2016-02-14 08:46:08','2016-02-14 23:52:37',NULL,NULL,0,1,0),(2312,1,1,1,'Vendors',' Haec et tu ita posuisti, et verba vestra sunt. Videmusne ut pueri ne verberibus quidem a contemplandis rebus perquirendisque deterreantur? Duo Reges: constructio interrete. Cur ipse Pythagoras et Aegyptum lustravit et Persarum magos adiit? Quamquam id quidem, infinitum est in hac urbe; Aliud igitur esse censet gaudere, aliud non dolere. Et tamen ego a philosopho, si afferat eloquentiam, non asperner, si non habeat, non admodum flagitem. Quod idem cum vestri faciant, non satis magnam tribuunt inventoribus gratiam. Teneo, inquit, finem illi videri nihil dolere. Qua tu etiam inprudens utebare non numquam. Haec para/doca illi, nos admirabilia dicamus. Potius ergo illa dicantur: turpe esse, viri non esse debilitari dolore, frangi, succumbere. \n\n','2016-02-14 08:46:08','2016-02-14 23:52:37',NULL,NULL,0,1,0),(2313,1,1,1,'Vendors',' Si mala non sunt, iacet omnis ratio Peripateticorum. Quodcumque in mentem incideret, et quodcumque tamquam occurreret. Ex ea difficultate illae fallaciloquae, ut ait Accius, malitiae natae sunt. Quid est, quod ab ea absolvi et perfici debeat? Duo Reges: constructio interrete. Quid ergo attinet gloriose loqui, nisi constanter loquare? Suo genere perveniant ad extremum; Rationis enim perfectio est virtus; \n\n','2016-02-14 08:46:08','2016-02-14 23:52:37',NULL,NULL,0,1,0),(2314,1,1,1,'Vendors',' Mihi enim erit isdem istis fortasse iam utendum. Quae diligentissime contra Aristonem dicuntur a Chryippo. Hinc ceteri particulas arripere conati suam quisque videro voluit afferre sententiam. Dolere malum est: in crucem qui agitur, beatus esse non potest. Cur tantas regiones barbarorum pedibus obiit, tot maria transmisit? Aliter homines, aliter philosophos loqui putas oportere? Duo Reges: constructio interrete. Certe nihil nisi quod possit ipsum propter se iure laudari. Semper enim ex eo, quod maximas partes continet latissimeque funditur, tota res appellatur. Quae diligentissime contra Aristonem dicuntur a Chryippo. \n\n','2016-02-14 08:46:09','2016-02-14 23:52:38',NULL,NULL,0,1,0),(2315,1,1,1,'Vendors',' Ut pulsi recurrant? Hoc tu nunc in illo probas. Odium autem et invidiam facile vitabis. Cur post Tarentum ad Archytam? \n\n','2016-02-14 08:46:09','2016-02-14 23:52:38',NULL,NULL,0,1,0),(2316,1,1,1,'Vendors',' Collige omnia, quae soletis: Praesidium amicorum. Conclusum est enim contra Cyrenaicos satis acute, nihil ad Epicurum. Qui autem de summo bono dissentit de tota philosophiae ratione dissentit. Duo Reges: constructio interrete. At certe gravius. Haec quo modo conveniant, non sane intellego. Non quam nostram quidem, inquit Pomponius iocans; Re mihi non aeque satisfacit, et quidem locis pluribus. \n\n','2016-02-14 08:46:09','2016-02-14 23:52:38',NULL,NULL,0,1,0),(2317,1,1,1,'Vendors',' Vide, quaeso, rectumne sit. Duo Reges: constructio interrete. \n\n','2016-02-14 08:46:10','2016-02-14 23:52:39',NULL,NULL,0,1,0),(2318,1,1,1,'Vendors',' Diodorus, eius auditor, adiungit ad honestatem vacuitatem doloris. Levatio igitur vitiorum magna fit in iis, qui habent ad virtutem progressionis aliquantum. Illa tamen simplicia, vestra versuta. Beatus sibi videtur esse moriens. Ergo id est convenienter naturae vivere, a natura discedere. Quis est, qui non oderit libidinosam, protervam adolescentiam? Non ego tecum iam ita iocabor, ut isdem his de rebus, cum L. His enim rebus detractis negat se reperire in asotorum vita quod reprehendat. \n\n','2016-02-14 08:46:10','2016-02-14 23:52:39',NULL,NULL,0,1,0),(2319,1,1,1,'Vendors',' Et nunc quidem quod eam tuetur, ut de vite potissimum loquar, est id extrinsecus; Quid ad utilitatem tantae pecuniae? Duo Reges: constructio interrete. Hoc loco tenere se Triarius non potuit. Non quam nostram quidem, inquit Pomponius iocans; Ac tamen hic mallet non dolere. Vide, quantum, inquam, fallare, Torquate. Age, inquies, ista parva sunt. \n\n','2016-02-14 08:46:10','2016-02-14 23:52:39',NULL,NULL,0,1,0),(2320,1,1,1,'Vendors',' Et quod est munus, quod opus sapientiae? Restatis igitur vos; In his igitur partibus duabus nihil erat, quod Zeno commutare gestiret. Te enim iudicem aequum puto, modo quae dicat ille bene noris. Verba tu fingas et ea dicas, quae non sentias? Est autem etiam actio quaedam corporis, quae motus et status naturae congruentis tenet; Duo Reges: constructio interrete. Quos quidem tibi studiose et diligenter tractandos magnopere censeo. \n\n','2016-02-14 08:46:11','2016-02-14 23:52:40',NULL,NULL,0,1,0),(2321,1,1,1,'Vendors',' Qualem igitur hominem natura inchoavit? Quia, si mala sunt, is, qui erit in iis, beatus non erit. Hoc ille tuus non vult omnibusque ex rebus voluptatem quasi mercedem exigit. Tu enim ista lenius, hic Stoicorum more nos vexat. Tum Piso: Quoniam igitur aliquid omnes, quid Lucius noster? Qua tu etiam inprudens utebare non numquam. Duo Reges: constructio interrete. Quod cum accidisset ut alter alterum necopinato videremus, surrexit statim. Id mihi magnum videtur. \n\n','2016-02-14 08:46:11','2016-02-14 23:52:40',NULL,NULL,0,1,0),(2322,1,1,1,'Vendors',' Universa enim illorum ratione cum tota vestra confligendum puto. Restatis igitur vos; Aliter homines, aliter philosophos loqui putas oportere? Si enim ita est, vide ne facinus facias, cum mori suadeas. Duo Reges: constructio interrete. Sed ego in hoc resisto; Hoc non est positum in nostra actione. Ut placet, inquit, etsi enim illud erat aptius, aequum cuique concedere. Summus dolor plures dies manere non potest? Teneo, inquit, finem illi videri nihil dolere. \n\n','2016-02-14 08:46:11','2016-02-14 23:52:40',NULL,NULL,0,1,0),(2323,1,1,1,'Vendors',' Isto modo ne improbos quidem, si essent boni viri. Et hercule-fatendum est enim, quod sentio -mirabilis est apud illos contextus rerum. Parvi enim primo ortu sic iacent, tamquam omnino sine animo sint. Duo Reges: constructio interrete. Quantum Aristoxeni ingenium consumptum videmus in musicis? Ratio enim nostra consentit, pugnat oratio. Quare conare, quaeso. \n\n','2016-02-14 08:46:12','2016-02-14 23:52:41',NULL,NULL,0,1,0),(2324,1,1,1,'Vendors',' Quae autem natura suae primae institutionis oblita est? Quid enim est a Chrysippo praetermissum in Stoicis? De vacuitate doloris eadem sententia erit. Cur haec eadem Democritus? Duo Reges: constructio interrete. Haec igitur Epicuri non probo, inquam. At cum de plurimis eadem dicit, tum certe de maximis. Est enim tanti philosophi tamque nobilis audacter sua decreta defendere. In eo enim positum est id, quod dicimus esse expetendum. Qua tu etiam inprudens utebare non numquam. \n\n','2016-02-14 08:46:12','2016-02-14 23:52:41',NULL,NULL,0,1,0),(2325,1,1,1,'Vendors',' Si enim ad populum me vocas, eum. Duo Reges: constructio interrete. Duo enim genera quae erant, fecit tria. Quid censes in Latino fore? Si mala non sunt, iacet omnis ratio Peripateticorum. Age sane, inquam. Teneo, inquit, finem illi videri nihil dolere. Claudii libidini, qui tum erat summo ne imperio, dederetur. \n\n','2016-02-14 08:46:12','2016-02-14 23:52:41',NULL,NULL,0,1,0),(2326,1,1,1,'Vendors',' Est enim effectrix multarum et magnarum voluptatum. Tecum optime, deinde etiam cum mediocri amico. Duo Reges: constructio interrete. Ad corpus diceres pertinere-, sed ea, quae dixi, ad corpusne refers? Quid censes in Latino fore? Re mihi non aeque satisfacit, et quidem locis pluribus. An vero, inquit, quisquam potest probare, quod perceptfum, quod. Ecce aliud simile dissimile. \n\n','2016-02-14 08:46:13','2016-02-14 23:52:42',NULL,NULL,0,1,0),(2327,1,1,1,'Vendors',' Ut placet, inquit, etsi enim illud erat aptius, aequum cuique concedere. Nam si propter voluptatem, quae est ista laus, quae possit e macello peti? Suam denique cuique naturam esse ad vivendum ducem. Sin aliud quid voles, postea. Mihi, inquam, qui te id ipsum rogavi? Sin aliud quid voles, postea. Sed ego in hoc resisto; Duo Reges: constructio interrete. Erit enim mecum, si tecum erit. \n\n','2016-02-14 08:46:13','2016-02-14 23:52:42',NULL,NULL,0,1,0),(2328,1,1,1,'Vendors',' Mihi enim satis est, ipsis non satis. Aufert enim sensus actionemque tollit omnem. Age, inquies, ista parva sunt. Duo Reges: constructio interrete. Si longus, levis dictata sunt. Tubulo putas dicere? Satis est tibi in te, satis in legibus, satis in mediocribus amicitiis praesidii. Cur deinde Metrodori liberos commendas? Haec quo modo conveniant, non sane intellego. Est autem etiam actio quaedam corporis, quae motus et status naturae congruentis tenet; Sed mehercule pergrata mihi oratio tua. \n\n','2016-02-14 08:46:13','2016-02-14 23:52:42',NULL,NULL,0,1,0),(2329,1,1,1,'Vendors',' Sed ego in hoc resisto; Quid ad utilitatem tantae pecuniae? Re mihi non aeque satisfacit, et quidem locis pluribus. Dicimus aliquem hilare vivere; Duo Reges: constructio interrete. Ita ne hoc quidem modo paria peccata sunt. Inde sermone vario sex illa a Dipylo stadia confecimus. Quamquam ab iis philosophiam et omnes ingenuas disciplinas habemus; \n\n','2016-02-14 08:46:14','2016-02-14 23:52:43',NULL,NULL,0,1,0),(2330,1,1,1,'Vendors',' Haec et tu ita posuisti, et verba vestra sunt. Venit enim mihi Platonis in mentem, quem accepimus primum hic disputare solitum; Quam illa ardentis amores excitaret sui! Cur tandem? Piso igitur hoc modo, vir optimus tuique, ut scis, amantissimus. Nulla profecto est, quin suam vim retineat a primo ad extremum. Duo Reges: constructio interrete. \n\n','2016-02-14 08:46:14','2016-02-14 23:52:43',NULL,NULL,0,1,0),(2331,1,1,1,'Vendors',' Mihi, inquam, qui te id ipsum rogavi? Egone quaeris, inquit, quid sentiam? Duo Reges: constructio interrete. Quid ei reliquisti, nisi te, quoquo modo loqueretur, intellegere, quid diceret? Et quod est munus, quod opus sapientiae? Et quod est munus, quod opus sapientiae? \n\n','2016-02-14 08:46:14','2016-02-14 23:52:43',NULL,NULL,0,1,0),(2332,1,1,1,'Vendors',' His similes sunt omnes, qui virtuti student levantur vitiis, levantur erroribus, nisi forte censes Ti. Sed ea mala virtuti magnitudine obruebantur. Ut proverbia non nulla veriora sint quam vestra dogmata. Duo Reges: constructio interrete. Si stante, hoc natura videlicet vult, salvam esse se, quod concedimus; \n\n','2016-02-14 08:46:15','2016-02-14 23:52:44',NULL,NULL,0,1,0),(2333,1,1,1,'Vendors',' Suo genere perveniant ad extremum; Nondum autem explanatum satis, erat, quid maxime natura vellet. Eorum enim est haec querela, qui sibi cari sunt seseque diligunt. In qua si nihil est praeter rationem, sit in una virtute finis bonorum; Quamquam haec quidem praeposita recte et reiecta dicere licebit. Qui convenit? \n\n','2016-02-14 08:46:15','2016-02-14 23:52:44',NULL,NULL,0,1,0),(2334,1,1,1,'Vendors',' Et quidem iure fortasse, sed tamen non gravissimum est testimonium multitudinis. Hoc Hieronymus summum bonum esse dixit. Itaque primos congressus copulationesque et consuetudinum instituendarum voluntates fieri propter voluptatem; Praetereo multos, in bis doctum hominem et suavem, Hieronymum, quem iam cur Peripateticum appellem nescio. Apud ceteros autem philosophos, qui quaesivit aliquid, tacet; Ille incendat? Duo Reges: constructio interrete. Expressa vero in iis aetatibus, quae iam confirmatae sunt. Primum in nostrane potestate est, quid meminerimus? Non risu potius quam oratione eiciendum? Neutrum vero, inquit ille. \n\n','2016-02-14 08:46:15','2016-02-14 23:52:44',NULL,NULL,0,1,0),(2335,1,1,1,'Vendors',' Id et fieri posse et saepe esse factum et ad voluptates percipiendas maxime pertinere. Tu vero, inquam, ducas licet, si sequetur; Duo Reges: constructio interrete. Quamquam te quidem video minime esse deterritum. \n\n','2016-02-14 08:46:16','2016-02-14 23:52:45',NULL,NULL,0,1,0),(2336,1,1,1,'Vendors',' Tamen a proposito, inquam, aberramus. Itaque hic ipse iam pridem est reiectus; Eadem fortitudinis ratio reperietur. Nullum inveniri verbum potest quod magis idem declaret Latine, quod Graece, quam declarat voluptas. \n\n','2016-02-14 08:46:16','2016-02-14 23:52:45',NULL,NULL,0,1,0),(2337,1,1,1,'Vendors',' Sic enim censent, oportunitatis esse beate vivere. Te enim iudicem aequum puto, modo quae dicat ille bene noris. Scientiam pollicentur, quam non erat mirum sapientiae cupido patria esse cariorem. Duo Reges: constructio interrete. Quid enim tanto opus est instrumento in optimis artibus comparandis? Ut alios omittam, hunc appello, quem ille unum secutus est. At iam decimum annum in spelunca iacet. \n\n','2016-02-14 08:46:16','2016-02-14 23:52:45',NULL,NULL,0,1,0),(2338,1,1,1,'Vendors',' Nullum inveniri verbum potest quod magis idem declaret Latine, quod Graece, quam declarat voluptas. Negat enim summo bono afferre incrementum diem. Quis non odit sordidos, vanos, leves, futtiles? Quamquam ab iis philosophiam et omnes ingenuas disciplinas habemus; Erat enim res aperta. Traditur, inquit, ab Epicuro ratio neglegendi doloris. Summum ením bonum exposuit vacuitatem doloris; Duo Reges: constructio interrete. \n\n','2016-02-14 08:46:17','2016-02-14 23:52:45',NULL,NULL,0,1,0),(2339,1,1,1,'Vendors',' Aliud igitur esse censet gaudere, aliud non dolere. Quam tu ponis in verbis, ego positam in re putabam. Quem si tenueris, non modo meum Ciceronem, sed etiam me ipsum abducas licebit. Magni enim aestimabat pecuniam non modo non contra leges, sed etiam legibus partam. Duo Reges: constructio interrete. Num igitur utiliorem tibi hunc Triarium putas esse posse, quam si tua sint Puteolis granaria? \n\n','2016-02-14 08:46:17','2016-02-14 23:52:46',NULL,NULL,0,1,0),(2340,1,1,1,'Vendors',' Sed ego in hoc resisto; Sin eam, quam Hieronymus, ne fecisset idem, ut voluptatem illam Aristippi in prima commendatione poneret. Suo enim quisque studio maxime ducitur. Tibi hoc incredibile, quod beatissimum. At eum nihili facit; Satis est tibi in te, satis in legibus, satis in mediocribus amicitiis praesidii. Duo Reges: constructio interrete. Quid de Pythagora? \n\n','2016-02-14 08:46:17','2016-02-14 23:52:46',NULL,NULL,0,1,0),(2341,1,1,1,'Vendors',' Eademne, quae restincta siti? Mihi quidem Antiochum, quem audis, satis belle videris attendere. Idemne potest esse dies saepius, qui semel fuit? His similes sunt omnes, qui virtuti student levantur vitiis, levantur erroribus, nisi forte censes Ti. Ipse Epicurus fortasse redderet, ut Sextus Peducaeus, Sex. Nobis Heracleotes ille Dionysius flagitiose descivisse videtur a Stoicis propter oculorum dolorem. Duo Reges: constructio interrete. Omnia contraria, quos etiam insanos esse vultis. \n\n','2016-02-14 08:46:18','2016-02-14 23:52:47',NULL,NULL,0,1,0),(2342,1,1,1,'Vendors',' Ratio quidem vestra sic cogit. An dubium est, quin virtus ita maximam partem optineat in rebus humanis, ut reliquas obruat? Quodsi ipsam honestatem undique pertectam atque absolutam. Omnis enim est natura diligens sui. Illud urgueam, non intellegere eum quid sibi dicendum sit, cum dolorem summum malum esse dixerit. Duo Reges: constructio interrete. In schola desinis. Sed haec quidem liberius ab eo dicuntur et saepius. Quia nec honesto quic quam honestius nec turpi turpius. Quam ob rem tandem, inquit, non satisfacit? \n\n','2016-02-14 08:46:18','2016-02-14 23:52:47',NULL,NULL,0,1,0),(2343,1,1,1,'Vendors',' Etenim nec iustitia nec amicitia esse omnino poterunt, nisi ipsae per se expetuntur. Esse enim quam vellet iniquus iustus poterat inpune. Traditur, inquit, ab Epicuro ratio neglegendi doloris. Quae cum essent dicta, discessimus. Sed utrum hortandus es nobis, Luci, inquit, an etiam tua sponte propensus es? Idem etiam dolorem saepe perpetiuntur, ne, si id non faciant, incidant in maiorem. Duo Reges: constructio interrete. \n\n','2016-02-14 08:46:18','2016-02-14 23:52:47',NULL,NULL,0,1,0),(2344,1,1,1,'Vendors',' Neque solum ea communia, verum etiam paria esse dixerunt. Ut placet, inquit, etsi enim illud erat aptius, aequum cuique concedere. Qua tu etiam inprudens utebare non numquam. Aliter homines, aliter philosophos loqui putas oportere? Cur, nisi quod turpis oratio est? Unum nescio, quo modo possit, si luxuriosus sit, finitas cupiditates habere. Hoc non est positum in nostra actione. Ergo ita: non posse honeste vivi, nisi honeste vivatur? \n\n','2016-02-14 08:46:19','2016-02-14 23:52:48',NULL,NULL,0,1,0),(2345,1,1,1,'Vendors',' Quid affers, cur Thorius, cur Caius Postumius, cur omnium horum magister, Orata, non iucundissime vixerit? Zenonis est, inquam, hoc Stoici. Qui-vere falsone, quaerere mittimus-dicitur oculis se privasse; Indicant pueri, in quibus ut in speculis natura cernitur. Illa argumenta propria videamus, cur omnia sint paria peccata. \n\n','2016-02-14 08:46:19','2016-02-14 23:52:48',NULL,NULL,0,1,0),(2346,1,1,1,'Vendors',' Obsecro, inquit, Torquate, haec dicit Epicurus? Mihi, inquam, qui te id ipsum rogavi? Sed quanta sit alias, nunc tantum possitne esse tanta. Non est ista, inquam, Piso, magna dissensio. \n\n','2016-02-14 08:46:19','2016-02-14 23:52:48',NULL,NULL,0,1,0),(2347,1,1,1,'Vendors',' Tubulum fuisse, qua illum, cuius is condemnatus est rogatione, P. Nihil minus, contraque illa hereditate dives ob eamque rem laetus. Itaque rursus eadem ratione, qua sum paulo ante usus, haerebitis. Duo Reges: constructio interrete. Septem autem illi non suo, sed populorum suffragio omnium nominati sunt. Inde sermone vario sex illa a Dipylo stadia confecimus. \n\n','2016-02-14 08:46:20','2016-02-14 23:52:49',NULL,NULL,0,1,0),(2348,1,1,1,'Vendors',' Suam denique cuique naturam esse ad vivendum ducem. Hoc non est positum in nostra actione. Quamquam ab iis philosophiam et omnes ingenuas disciplinas habemus; Duo Reges: constructio interrete. Quod totum contra est. Est enim effectrix multarum et magnarum voluptatum. Ita credo. Non igitur de improbo, sed de callido improbo quaerimus, qualis Q. Ego vero isti, inquam, permitto. \n\n','2016-02-14 08:46:20','2016-02-14 23:52:49',NULL,NULL,0,1,0),(2349,1,1,1,'Vendors',' Sed in rebus apertissimis nimium longi sumus. Ex rebus enim timiditas, non ex vocabulis nascitur. Sed ad illum redeo. Potius inflammat, ut coercendi magis quam dedocendi esse videantur. Age sane, inquam. Mihi enim satis est, ipsis non satis. Duo Reges: constructio interrete. Inde sermone vario sex illa a Dipylo stadia confecimus. Ita graviter et severe voluptatem secrevit a bono. \n\n','2016-02-14 08:46:20','2016-02-14 23:52:49',NULL,NULL,0,1,0),(2350,1,1,1,'Vendors',' Quod si ita sit, cur opera philosophiae sit danda nescio. Duo Reges: constructio interrete. \n\n','2016-02-14 08:46:21','2016-02-14 23:52:50',NULL,NULL,0,1,0),(2351,1,1,1,'Vendors',' Eadem nunc mea adversum te oratio est. Duo enim genera quae erant, fecit tria. Quo modo autem optimum, si bonum praeterea nullum est? Apparet statim, quae sint officia, quae actiones. At eum nihili facit; Duo Reges: constructio interrete. \n\n','2016-02-14 08:46:21','2016-02-14 23:52:50',NULL,NULL,0,1,0),(2352,1,1,1,'Vendors',' Honesta oratio, Socratica, Platonis etiam. Non quaero, quid dicat, sed quid convenienter possit rationi et sententiae suae dicere. In eo enim positum est id, quod dicimus esse expetendum. Deinde dolorem quem maximum? Verum tamen cum de rebus grandioribus dicas, ipsae res verba rapiunt; Negare non possum. Quid dubitas igitur mutare principia naturae? Aliter homines, aliter philosophos loqui putas oportere? \n\n','2016-02-14 08:46:21','2016-02-14 23:52:50',NULL,NULL,0,1,0),(2353,1,1,1,'Vendors',' Universa enim illorum ratione cum tota vestra confligendum puto. Quos nisi redarguimus, omnis virtus, omne decus, omnis vera laus deserenda est. Ut optime, secundum naturam affectum esse possit. Ab his oratores, ab his imperatores ac rerum publicarum principes extiterunt. Duo Reges: constructio interrete. Scientiam pollicentur, quam non erat mirum sapientiae cupido patria esse cariorem. Tum Torquatus: Prorsus, inquit, assentior; Quid censes in Latino fore? At modo dixeras nihil in istis rebus esse, quod interesset. Poterat autem inpune; \n\n','2016-02-14 08:46:22','2016-02-14 23:52:50',NULL,NULL,0,1,0),(2354,1,1,1,'Vendors',' Quod cum accidisset ut alter alterum necopinato videremus, surrexit statim. Suo enim quisque studio maxime ducitur. Duo Reges: constructio interrete. Respondent extrema primis, media utrisque, omnia omnibus. \n\n','2016-02-14 08:46:22','2016-02-14 23:52:51',NULL,NULL,0,1,0),(2355,1,1,1,'Vendors',' Idemne potest esse dies saepius, qui semel fuit? Duo Reges: constructio interrete. Quid ait Aristoteles reliquique Platonis alumni? Quod si ita se habeat, non possit beatam praestare vitam sapientia. Hoc est dicere: Non reprehenderem asotos, si non essent asoti. \n\n','2016-02-14 08:46:22','2016-02-14 23:52:51',NULL,NULL,0,1,0),(2356,1,1,1,'Vendors',' Unum nescio, quo modo possit, si luxuriosus sit, finitas cupiditates habere. At certe gravius. Non semper, inquam; Duo Reges: constructio interrete. Sed eum qui audiebant, quoad poterant, defendebant sententiam suam. An quod ita callida est, ut optime possit architectari voluptates? Quaesita enim virtus est, non quae relinqueret naturam, sed quae tueretur. Vitiosum est enim in dividendo partem in genere numerare. Negat enim summo bono afferre incrementum diem. \n\n','2016-02-14 08:46:23','2016-02-14 23:52:51',NULL,NULL,0,1,0),(2357,1,1,1,'Vendors',' Si longus, levis. Non igitur potestis voluptate omnia dirigentes aut tueri aut retinere virtutem. Verba tu fingas et ea dicas, quae non sentias? Duo Reges: constructio interrete. Teneo, inquit, finem illi videri nihil dolere. Eam tum adesse, cum dolor omnis absit; Nec tamen ille erat sapiens quis enim hoc aut quando aut ubi aut unde? \n\n','2016-02-14 08:46:23','2016-02-14 23:52:52',NULL,NULL,0,1,0),(2358,1,1,1,'Vendors',' At quicum ioca seria, ut dicitur, quicum arcana, quicum occulta omnia? Inde sermone vario sex illa a Dipylo stadia confecimus. Satisne vobis videor pro meo iure in vestris auribus commentatus? Nunc ita separantur, ut disiuncta sint, quo nihil potest esse perversius. Duo Reges: constructio interrete. Ut id aliis narrare gestiant? Causa autem fuit huc veniendi ut quosdam hinc libros promerem. Nobis Heracleotes ille Dionysius flagitiose descivisse videtur a Stoicis propter oculorum dolorem. \n\n','2016-02-14 08:46:23','2016-02-14 23:52:52',NULL,NULL,0,1,0),(2359,1,1,1,'Vendors',' Ab his oratores, ab his imperatores ac rerum publicarum principes extiterunt. Quamquam id quidem licebit iis existimare, qui legerint. Nihil acciderat ei, quod nollet, nisi quod anulum, quo delectabatur, in mari abiecerat. Quae similitudo in genere etiam humano apparet. Duo Reges: constructio interrete. Sed tamen intellego quid velit. Sed id ne cogitari quidem potest quale sit, ut non repugnet ipsum sibi. \n\n','2016-02-14 08:46:24','2016-02-14 23:52:52',NULL,NULL,0,1,0),(2360,1,1,1,'Vendors',' Quamquam te quidem video minime esse deterritum. Hoc est dicere: Non reprehenderem asotos, si non essent asoti. Fortasse id optimum, sed ubi illud: Plus semper voluptatis? Equidem etiam Epicurum, in physicis quidem, Democriteum puto. Perturbationes autem nulla naturae vi commoventur, omniaque ea sunt opiniones ac iudicia levitatis. Duo Reges: constructio interrete. Quod si ita se habeat, non possit beatam praestare vitam sapientia. Inscite autem medicinae et gubernationis ultimum cum ultimo sapientiae comparatur. \n\n','2016-02-14 08:46:24','2016-02-14 23:52:53',NULL,NULL,0,1,0),(2361,1,1,1,'Vendors',' Non pugnem cum homine, cur tantum habeat in natura boni; Dulce amarum, leve asperum, prope longe, stare movere, quadratum rotundum. Bonum incolumis acies: misera caecitas. Quod si ita se habeat, non possit beatam praestare vitam sapientia. Quem ad modum quis ambulet, sedeat, qui ductus oris, qui vultus in quoque sit? Qua tu etiam inprudens utebare non numquam. Hoc mihi cum tuo fratre convenit. Duo Reges: constructio interrete. Sedulo, inquam, faciam. Quae si potest singula consolando levare, universa quo modo sustinebit? An tu me de L. \n\n','2016-02-14 08:46:24','2016-02-14 23:52:53',NULL,NULL,0,1,0),(2362,1,1,1,'Vendors',' Quia dolori non voluptas contraria est, sed doloris privatio. Quis est tam dissimile homini. Nummus in Croesi divitiis obscuratur, pars est tamen divitiarum. Non enim solum Torquatus dixit quid sentiret, sed etiam cur. Duo Reges: constructio interrete. \n\n','2016-02-14 08:46:25','2016-02-14 23:52:53',NULL,NULL,0,1,0),(2363,1,1,1,'Vendors',' Quis suae urbis conservatorem Codrum, quis Erechthei filias non maxime laudat? Sin aliud quid voles, postea. Duo Reges: constructio interrete. Idem iste, inquam, de voluptate quid sentit? Sed quoniam et advesperascit et mihi ad villam revertendum est, nunc quidem hactenus; Hoc etsi multimodis reprehendi potest, tamen accipio, quod dant. \n\n','2016-02-14 08:46:25','2016-02-14 23:52:54',NULL,NULL,0,1,0),(2364,1,1,1,'Vendors',' At enim, qua in vita est aliquid mali, ea beata esse non potest. Sed ad bona praeterita redeamus. Sed videbimus. Quare obscurentur etiam haec, quae secundum naturam esse dicimus, in vita beata; Duo Reges: constructio interrete. Quod equidem non reprehendo; \n\n','2016-02-14 08:46:25','2016-02-14 23:52:54',NULL,NULL,0,1,0),(2365,1,1,1,'Vendors',' Ab hoc autem quaedam non melius quam veteres, quaedam omnino relicta. Quamquam id quidem licebit iis existimare, qui legerint. Iubet igitur nos Pythius Apollo noscere nosmet ipsos. Negat enim summo bono afferre incrementum diem. Ita fit cum gravior, tum etiam splendidior oratio. \n\n','2016-02-14 08:46:26','2016-02-14 23:52:54',NULL,NULL,0,1,0),(2366,1,1,1,'Vendors',' Cur, nisi quod turpis oratio est? Sed haec in pueris; Conclusum est enim contra Cyrenaicos satis acute, nihil ad Epicurum. Duo Reges: constructio interrete. Tum ille timide vel potius verecunde: Facio, inquit. Hinc ceteri particulas arripere conati suam quisque videro voluit afferre sententiam. Quam illa ardentis amores excitaret sui! Cur tandem? Scio enim esse quosdam, qui quavis lingua philosophari possint; \n\n','2016-02-14 08:46:26','2016-02-14 23:52:54',NULL,NULL,0,1,0),(2367,1,1,1,'Vendors',' Sed haec quidem liberius ab eo dicuntur et saepius. Neque solum ea communia, verum etiam paria esse dixerunt. Partim cursu et peragratione laetantur, congregatione aliae coetum quodam modo civitatis imitantur; Aliena dixit in physicis nec ea ipsa, quae tibi probarentur; Septem autem illi non suo, sed populorum suffragio omnium nominati sunt. Immo videri fortasse. Duo Reges: constructio interrete. \n\n','2016-02-14 08:46:26','2016-02-14 23:52:55',NULL,NULL,0,1,0),(2368,1,1,1,'Vendors',' Deinde disputat, quod cuiusque generis animantium statui deceat extremum. An vero, inquit, quisquam potest probare, quod perceptfum, quod. Age, inquies, ista parva sunt. Fortasse id optimum, sed ubi illud: Plus semper voluptatis? Duo Reges: constructio interrete. \n\n','2016-02-14 08:46:27','2016-02-14 23:52:55',NULL,NULL,0,1,0),(2369,1,1,1,'Vendors',' Post enim Chrysippum eum non sane est disputatum. Quis hoc dicit? Quare conare, quaeso. Philosophi autem in suis lectulis plerumque moriuntur. Ego vero isti, inquam, permitto. \n\n','2016-02-14 08:46:27','2016-02-14 23:52:55',NULL,NULL,0,1,0),(2370,1,1,1,'Vendors',' Duae sunt enim res quoque, ne tu verba solum putes. Tantum dico, magis fuisse vestrum agere Epicuri diem natalem, quam illius testamento cavere ut ageretur. Multoque hoc melius nos veriusque quam Stoici. \n\n','2016-02-14 08:46:27','2016-02-14 23:52:56',NULL,NULL,0,1,0),(2371,1,1,1,'Vendors',' Ab his oratores, ab his imperatores ac rerum publicarum principes extiterunt. Sed quid minus probandum quam esse aliquem beatum nec satis beatum? Cum id fugiunt, re eadem defendunt, quae Peripatetici, verba. Qui non moveatur et offensione turpitudinis et comprobatione honestatis? Illis videtur, qui illud non dubitant bonum dicere -; Duo Reges: constructio interrete. Quae diligentissime contra Aristonem dicuntur a Chryippo. \n\n','2016-02-14 08:46:28','2016-02-14 23:52:56',NULL,NULL,0,1,0),(2372,1,1,1,'Vendors',' Sit hoc ultimum bonorum, quod nunc a me defenditur; Erit enim instructus ad mortem contemnendam, ad exilium, ad ipsum etiam dolorem. Iam enim adesse poterit. Nec hoc ille non vidit, sed verborum magnificentia est et gloria delectatus. Octavio fuit, cum illam severitatem in eo filio adhibuit, quem in adoptionem D. Duo Reges: constructio interrete. Quis animo aequo videt eum, quem inpure ac flagitiose putet vivere? Vide, ne etiam menses! nisi forte eum dicis, qui, simul atque arripuit, interficit. Nam de isto magna dissensio est. Quae contraria sunt his, malane? Si longus, levis; Sed vos squalidius, illorum vides quam niteat oratio. \n\n','2016-02-14 08:46:28','2016-02-14 23:52:56',NULL,NULL,0,1,0),(2373,1,1,1,'Vendors',' Quis hoc dicit? Tria genera bonorum; \n\n','2016-02-14 08:46:28','2016-02-14 23:52:56',NULL,NULL,0,1,0),(2374,1,1,1,'Vendors',' Fortemne possumus dicere eundem illum Torquatum? Familiares nostros, credo, Sironem dicis et Philodemum, cum optimos viros, tum homines doctissimos. Easdemne res? Hoc enim constituto in philosophia constituta sunt omnia. Summae mihi videtur inscitiae. Summum ením bonum exposuit vacuitatem doloris; Duo Reges: constructio interrete. Nobis aliter videtur, recte secusne, postea; \n\n','2016-02-14 08:46:29','2016-02-14 23:52:57',NULL,NULL,0,1,0),(2375,1,1,1,'Vendors',' Nam si propter voluptatem, quae est ista laus, quae possit e macello peti? An potest, inquit ille, quicquam esse suavius quam nihil dolere? Cupit enim dícere nihil posse ad beatam vitam deesse sapienti. Sed haec quidem liberius ab eo dicuntur et saepius. Duo Reges: constructio interrete. Atque ab his initiis profecti omnium virtutum et originem et progressionem persecuti sunt. Istam voluptatem perpetuam quis potest praestare sapienti? \n\n','2016-02-14 08:46:29','2016-02-14 23:52:58',NULL,NULL,0,1,0),(2376,1,1,1,'Vendors',' Aliud igitur esse censet gaudere, aliud non dolere. Itaque hic ipse iam pridem est reiectus; Duo Reges: constructio interrete. Eam tum adesse, cum dolor omnis absit; \n\n','2016-02-14 08:46:29','2016-02-14 23:52:58',NULL,NULL,0,1,0),(2377,1,1,1,'Vendors',' Haec et tu ita posuisti, et verba vestra sunt. Nonne videmus quanta perturbatio rerum omnium consequatur, quanta confusio? \n\n','2016-02-14 08:46:30','2016-02-14 23:52:59',NULL,NULL,0,1,0),(2378,1,1,1,'Vendors',' Diodorus, eius auditor, adiungit ad honestatem vacuitatem doloris. Quo tandem modo? Cum salvum esse flentes sui respondissent, rogavit essentne fusi hostes. Non igitur de improbo, sed de callido improbo quaerimus, qualis Q. Duo Reges: constructio interrete. A mene tu? Atqui reperies, inquit, in hoc quidem pertinacem; Reguli reiciendam; \n\n','2016-02-14 08:46:30','2016-02-14 23:52:59',NULL,NULL,0,1,0),(2379,1,1,1,'Vendors',' Venit ad extremum; Re mihi non aeque satisfacit, et quidem locis pluribus. Videamus animi partes, quarum est conspectus illustrior; Illum mallem levares, quo optimum atque humanissimum virum, Cn. Dicam, inquam, et quidem discendi causa magis, quam quo te aut Epicurum reprehensum velim. Duo Reges: constructio interrete. Negat esse eam, inquit, propter se expetendam. \n\n','2016-02-14 08:46:30','2016-02-14 23:52:59',NULL,NULL,0,1,0),(2380,1,1,1,'Vendors',' Atqui reperies, inquit, in hoc quidem pertinacem; Ait enim se, si uratur, Quam hoc suave! dicturum. Idemne potest esse dies saepius, qui semel fuit? Huius, Lyco, oratione locuples, rebus ipsis ielunior. Duo Reges: constructio interrete. Istic sum, inquit. \n\n','2016-02-14 08:46:31','2016-02-14 23:52:59',NULL,NULL,0,1,0),(2381,1,1,1,'Vendors',' Ergo opifex plus sibi proponet ad formarum quam civis excellens ad factorum pulchritudinem? An hoc usque quaque, aliter in vita? Inde igitur, inquit, ordiendum est. Tu quidem reddes; Poterat autem inpune; Quorum sine causa fieri nihil putandum est. Duo Reges: constructio interrete. Duo enim genera quae erant, fecit tria. An nisi populari fama? \n\n','2016-02-14 08:46:31','2016-02-14 23:53:00',NULL,NULL,0,1,0),(2382,1,1,1,'Vendors',' Non est enim vitium in oratione solum, sed etiam in moribus. Duo Reges: constructio interrete. Bonum negas esse divitias, praeposìtum esse dicis? Nunc de hominis summo bono quaeritur; Quae autem natura suae primae institutionis oblita est? Gerendus est mos, modo recte sentiat. \n\n','2016-02-14 08:46:31','2016-02-14 23:53:00',NULL,NULL,0,1,0),(2383,1,1,1,'Vendors',' Aut, Pylades cum sis, dices te esse Orestem, ut moriare pro amico? Apud imperitos tum illa dicta sunt, aliquid etiam coronae datum; Non est igitur summum malum dolor. Ut enim consuetudo loquitur, id solum dicitur honestum, quod est populari fama gloriosum. Non quam nostram quidem, inquit Pomponius iocans; Cur id non ita fit? Sed ad bona praeterita redeamus. \n\n','2016-02-14 08:46:32','2016-02-14 23:53:00',NULL,NULL,0,1,0),(2384,1,1,1,'Vendors',' Nam quibus rebus efficiuntur voluptates, eae non sunt in potestate sapientis. Mihi quidem Antiochum, quem audis, satis belle videris attendere. Quo modo autem philosophus loquitur? Etsi ea quidem, quae adhuc dixisti, quamvis ad aetatem recte isto modo dicerentur. Quid autem habent admirationis, cum prope accesseris? Quam nemo umquam voluptatem appellavit, appellat; \n\n','2016-02-14 08:46:32','2016-02-14 23:53:01',NULL,NULL,0,1,0),(2385,1,1,1,'Vendors',' Multa sunt dicta ab antiquis de contemnendis ac despiciendis rebus humanis; Dulce amarum, leve asperum, prope longe, stare movere, quadratum rotundum. Duo Reges: constructio interrete. Sed residamus, inquit, si placet. \n\n','2016-02-14 08:46:32','2016-02-14 23:53:01',NULL,NULL,0,1,0),(2386,1,1,1,'Vendors',' Quid enim est a Chrysippo praetermissum in Stoicis? Quodsi vultum tibi, si incessum fingeres, quo gravior viderere, non esses tui similis; Quae sunt igitur communia vobis cum antiquis, iis sic utamur quasi concessis; Ut in geometria, prima si dederis, danda sunt omnia. Itaque his sapiens semper vacabit. Duo Reges: constructio interrete. Universa enim illorum ratione cum tota vestra confligendum puto. Illa tamen simplicia, vestra versuta. \n\n','2016-02-14 08:46:33','2016-02-14 23:53:01',NULL,NULL,0,1,0),(2387,1,1,1,'Vendors',' Ego quoque, inquit, didicerim libentius si quid attuleris, quam te reprehenderim. Cur, nisi quod turpis oratio est? Eorum enim omnium multa praetermittentium, dum eligant aliquid, quod sequantur, quasi curta sententia; Sed quae tandem ista ratio est? Duo Reges: constructio interrete. Quod quidem iam fit etiam in Academia. \n\n','2016-02-14 08:46:33','2016-02-14 23:53:02',NULL,NULL,0,1,0),(2388,1,1,1,'Vendors',' Bona autem corporis huic sunt, quod posterius posui, similiora. Quae similitudo in genere etiam humano apparet. Aut, Pylades cum sis, dices te esse Orestem, ut moriare pro amico? Quid, quod homines infima fortuna, nulla spe rerum gerendarum, opifices denique delectantur historia? In schola desinis. Quarum ambarum rerum cum medicinam pollicetur, luxuriae licentiam pollicetur. \n\n','2016-02-14 08:46:33','2016-02-14 23:53:02',NULL,NULL,0,1,0),(2389,1,1,1,'Vendors',' Nonne igitur tibi videntur, inquit, mala? Conferam tecum, quam cuique verso rem subicias; Quid ei reliquisti, nisi te, quoquo modo loqueretur, intellegere, quid diceret? Pudebit te, inquam, illius tabulae, quam Cleanthes sane commode verbis depingere solebat. Deprehensus omnem poenam contemnet. Duo Reges: constructio interrete. Etenim nec iustitia nec amicitia esse omnino poterunt, nisi ipsae per se expetuntur. Transfer idem ad modestiam vel temperantiam, quae est moderatio cupiditatum rationi oboediens. Recte dicis; An ea, quae per vinitorem antea consequebatur, per se ipsa curabit? Ut placet, inquit, etsi enim illud erat aptius, aequum cuique concedere. \n\n','2016-02-14 08:46:34','2016-02-14 23:53:02',NULL,NULL,0,1,0),(2390,1,1,1,'Vendors',' Invidiosum nomen est, infame, suspectum. Nonne videmus quanta perturbatio rerum omnium consequatur, quanta confusio? Certe non potest. Huius ego nunc auctoritatem sequens idem faciam. Duo Reges: constructio interrete. Sic, et quidem diligentius saepiusque ista loquemur inter nos agemusque communiter. Quid de Platone aut de Democrito loquar? \n\n','2016-02-14 08:46:34','2016-02-14 23:53:03',NULL,NULL,0,1,0),(2391,1,1,1,'Vendors',' Quod autem in homine praestantissimum atque optimum est, id deseruit. Non dolere, inquam, istud quam vim habeat postea videro; Fortemne possumus dicere eundem illum Torquatum? Cur haec eadem Democritus? \n\n','2016-02-14 08:46:34','2016-02-14 23:53:03',NULL,NULL,0,1,0),(2392,1,1,1,'Vendors',' Mihi, inquam, qui te id ipsum rogavi? Iam id ipsum absurdum, maximum malum neglegi. Quorum sine causa fieri nihil putandum est. Ergo in utroque exercebantur, eaque disciplina effecit tantam illorum utroque in genere dicendi copiam. Duo Reges: constructio interrete. Quam illa ardentis amores excitaret sui! Cur tandem? Multoque hoc melius nos veriusque quam Stoici. Non enim solum Torquatus dixit quid sentiret, sed etiam cur. Tum Quintus: Est plane, Piso, ut dicis, inquit. \n\n','2016-02-14 08:46:35','2016-02-14 23:53:03',NULL,NULL,0,1,0),(2393,1,1,1,'Vendors',' Quorum sine causa fieri nihil putandum est. Quid, cum fictas fabulas, e quibus utilitas nulla elici potest, cum voluptate legimus? Rapior illuc, revocat autem Antiochus, nec est praeterea, quem audiamus. Quamquam ab iis philosophiam et omnes ingenuas disciplinas habemus; Duo Reges: constructio interrete. Tollenda est atque extrahenda radicitus. Dic in quovis conventu te omnia facere, ne doleas. Atqui reperies, inquit, in hoc quidem pertinacem; Mihi enim satis est, ipsis non satis. Negat enim summo bono afferre incrementum diem. \n\n','2016-02-14 08:46:35','2016-02-14 23:53:03',NULL,NULL,0,1,0),(2394,1,1,1,'Vendors',' Consequentia exquirere, quoad sit id, quod volumus, effectum. Habent enim et bene longam et satis litigiosam disputationem. Duo Reges: constructio interrete. Dicimus aliquem hilare vivere; Honesta oratio, Socratica, Platonis etiam. Quae duo sunt, unum facit. Octavio fuit, cum illam severitatem in eo filio adhibuit, quem in adoptionem D. \n\n','2016-02-14 08:46:35','2016-02-14 23:53:04',NULL,NULL,0,1,0),(2395,1,1,1,'Vendors',' Nihil illinc huc pervenit. Animum autem reliquis rebus ita perfecit, ut corpus; Comprehensum, quod cognitum non habet? Duo Reges: constructio interrete. Atqui iste locus est, Piso, tibi etiam atque etiam confirmandus, inquam; Cur tantas regiones barbarorum pedibus obiit, tot maria transmisit? Haec quo modo conveniant, non sane intellego. \n\n','2016-02-14 08:46:36','2016-02-14 23:53:04',NULL,NULL,0,1,0),(2396,1,1,1,'Vendors',' His enim rebus detractis negat se reperire in asotorum vita quod reprehendat. Atque ab his initiis profecti omnium virtutum et originem et progressionem persecuti sunt. Sed potestne rerum maior esse dissensio? Quod autem satis est, eo quicquid accessit, nimium est; Qui non moveatur et offensione turpitudinis et comprobatione honestatis? Duo Reges: constructio interrete. Tubulum fuisse, qua illum, cuius is condemnatus est rogatione, P. Atque ab isto capite fluere necesse est omnem rationem bonorum et malorum. \n\n','2016-02-14 08:46:36','2016-02-14 23:53:04',NULL,NULL,0,1,0),(2397,1,1,1,'Vendors',' Quod autem principium officii quaerunt, melius quam Pyrrho; Solum praeterea formosum, solum liberum, solum civem, stultost; Expressa vero in iis aetatibus, quae iam confirmatae sunt. Piso igitur hoc modo, vir optimus tuique, ut scis, amantissimus. Scrupulum, inquam, abeunti; Duo Reges: constructio interrete. \n\n','2016-02-14 08:46:36','2016-02-14 23:53:05',NULL,NULL,0,1,0),(2398,1,1,1,'Vendors',' Non minor, inquit, voluptas percipitur ex vilissimis rebus quam ex pretiosissimis. Sapientem locupletat ipsa natura, cuius divitias Epicurus parabiles esse docuit. Cur tantas regiones barbarorum pedibus obiit, tot maria transmisit? Neque enim civitas in seditione beata esse potest nec in discordia dominorum domus; Quae duo sunt, unum facit. Duo Reges: constructio interrete. Quam si explicavisset, non tam haesitaret. Qualis ista philosophia est, quae non interitum afferat pravitatis, sed sit contenta mediocritate vitiorum? Nunc haec primum fortasse audientis servire debemus. Atque hoc loco similitudines eas, quibus illi uti solent, dissimillimas proferebas. \n\n','2016-02-14 08:46:37','2016-02-14 23:53:05',NULL,NULL,0,1,0),(2399,1,1,1,'Vendors',' Non quaeritur autem quid naturae tuae consentaneum sit, sed quid disciplinae. Vitae autem degendae ratio maxime quidem illis placuit quieta. Profectus in exilium Tubulus statim nec respondere ausus; Traditur, inquit, ab Epicuro ratio neglegendi doloris. Duo Reges: constructio interrete. Itaque his sapiens semper vacabit. Velut ego nunc moveor. Summum a vobis bonum voluptas dicitur. \n\n','2016-02-14 08:46:37','2016-02-14 23:53:05',NULL,NULL,0,1,0),(2400,1,1,1,'Vendors',' Nummus in Croesi divitiis obscuratur, pars est tamen divitiarum. Avaritiamne minuis? Duo Reges: constructio interrete. Atqui eorum nihil est eius generis, ut sit in fine atque extrerno bonorum. Quis istum dolorem timet? Quo modo autem optimum, si bonum praeterea nullum est? \n\n','2016-02-14 08:46:37','2016-02-14 23:53:05',NULL,NULL,0,1,0),(2401,1,1,1,'Vendors',' Atqui reperies, inquit, in hoc quidem pertinacem; Nam ista vestra: Si gravis, brevis; Ut optime, secundum naturam affectum esse possit. Quae quidem sapientes sequuntur duce natura tamquam videntes; At ille pellit, qui permulcet sensum voluptate. Sed in rebus apertissimis nimium longi sumus. Duo Reges: constructio interrete. \n\n','2016-02-14 08:46:38','2016-02-14 23:53:06',NULL,NULL,0,1,0),(2402,1,1,1,'Vendors',' Qui autem de summo bono dissentit de tota philosophiae ratione dissentit. Immo videri fortasse. Varietates autem iniurasque fortunae facile veteres philosophorum praeceptis instituta vita superabat. Sic enim censent, oportunitatis esse beate vivere. Si quicquam extra virtutem habeatur in bonis. In quibus doctissimi illi veteres inesse quiddam caeleste et divinum putaverunt. \n\n','2016-02-14 08:46:38','2016-02-14 23:53:06',NULL,NULL,0,1,0),(2403,1,1,1,'Vendors',' Hoc simile tandem est? Sed in rebus apertissimis nimium longi sumus. Quid de Platone aut de Democrito loquar? Varietates autem iniurasque fortunae facile veteres philosophorum praeceptis instituta vita superabat. Inde sermone vario sex illa a Dipylo stadia confecimus. \n\n','2016-02-14 08:46:38','2016-02-14 23:53:06',NULL,NULL,0,1,0),(2404,1,1,1,'Vendors',' Qualem igitur hominem natura inchoavit? Atqui eorum nihil est eius generis, ut sit in fine atque extrerno bonorum. Nihil illinc huc pervenit. Cave putes quicquam esse verius. \n\n','2016-02-14 08:46:39','2016-02-14 23:53:07',NULL,NULL,0,1,0),(2405,1,1,1,'Vendors',' Equidem etiam Epicurum, in physicis quidem, Democriteum puto. Dici enim nihil potest verius. Cuius ad naturam apta ratio vera illa et summa lex a philosophis dicitur. Nihil enim iam habes, quod ad corpus referas; Aliter enim nosmet ipsos nosse non possumus. Duo Reges: constructio interrete. \n\n','2016-02-14 08:46:39','2016-02-14 23:53:07',NULL,NULL,0,1,0),(2406,1,1,1,'Vendors',' Quod vestri non item. Quodcumque in mentem incideret, et quodcumque tamquam occurreret. Eademne, quae restincta siti? Te enim iudicem aequum puto, modo quae dicat ille bene noris. Pauca mutat vel plura sane; Duo Reges: constructio interrete. Consequens enim est et post oritur, ut dixi. Nam de summo mox, ut dixi, videbimus et ad id explicandum disputationem omnem conferemus. Si longus, levis dictata sunt. Qui autem de summo bono dissentit de tota philosophiae ratione dissentit. \n\n','2016-02-14 08:46:39','2016-02-14 23:53:07',NULL,NULL,0,1,0),(2407,1,1,1,'Vendors',' Diodorus, eius auditor, adiungit ad honestatem vacuitatem doloris. Sic, et quidem diligentius saepiusque ista loquemur inter nos agemusque communiter. Utrum igitur tibi litteram videor an totas paginas commovere? Hanc quoque iucunditatem, si vis, transfer in animum; Bonum incolumis acies: misera caecitas. Deinde disputat, quod cuiusque generis animantium statui deceat extremum. Duo Reges: constructio interrete. Quae cum dixisset paulumque institisset, Quid est? Nunc haec primum fortasse audientis servire debemus. Faceres tu quidem, Torquate, haec omnia; \n\n','2016-02-14 08:46:40','2016-02-14 23:53:08',NULL,NULL,0,1,0),(2408,1,1,1,'Vendors',' Sine ea igitur iucunde negat posse se vivere? Quaesita enim virtus est, non quae relinqueret naturam, sed quae tueretur. Duo Reges: constructio interrete. Quae fere omnia appellantur uno ingenii nomine, easque virtutes qui habent, ingeniosi vocantur. \n\n','2016-02-14 08:46:40','2016-02-14 23:53:08',NULL,NULL,0,1,0),(2409,1,1,1,'Vendors',' Deinde dolorem quem maximum? Quid, quod res alia tota est? Apparet statim, quae sint officia, quae actiones. Praeclare hoc quidem. Odium autem et invidiam facile vitabis. Ut nemo dubitet, eorum omnia officia quo spectare, quid sequi, quid fugere debeant? Quid igitur dubitamus in tota eius natura quaerere quid sit effectum? Quae hic rei publicae vulnera inponebat, eadem ille sanabat. Duo Reges: constructio interrete. Vitae autem degendae ratio maxime quidem illis placuit quieta. \n\n','2016-02-14 08:46:40','2016-02-14 23:53:08',NULL,NULL,0,1,0),(2410,1,1,1,'Vendors',' Sed haec nihil sane ad rem; Certe, nisi voluptatem tanti aestimaretis. Aliter homines, aliter philosophos loqui putas oportere? Quae tamen a te agetur non melior, quam illae sunt, quas interdum optines. Nos quidem Virtutes sic natae sumus, ut tibi serviremus, aliud negotii nihil habemus. \n\n','2016-02-14 08:46:41','2016-02-14 23:53:09',NULL,NULL,0,1,0),(2411,1,1,1,'Vendors',' Solum praeterea formosum, solum liberum, solum civem, stultost; Quodcumque in mentem incideret, et quodcumque tamquam occurreret. Summae mihi videtur inscitiae. \n\n','2016-02-14 08:46:41','2016-02-14 23:53:10',NULL,NULL,0,1,0),(2412,1,1,1,'Vendors',' Gracchum patrem non beatiorem fuisse quam fillum, cum alter stabilire rem publicam studuerit, alter evertere. Non enim iam stirpis bonum quaeret, sed animalis. Atque hoc loco similitudines eas, quibus illi uti solent, dissimillimas proferebas. Zenonis est, inquam, hoc Stoici. Duo Reges: constructio interrete. At ille pellit, qui permulcet sensum voluptate. Quid nunc honeste dicit? Nec vero sum nescius esse utilitatem in historia, non modo voluptatem. Summus dolor plures dies manere non potest? \n\n','2016-02-14 08:46:41','2016-02-14 23:53:10',NULL,NULL,0,1,0),(2413,1,1,1,'Vendors',' Duarum enim vitarum nobis erunt instituta capienda. Non semper, inquam; Multoque hoc melius nos veriusque quam Stoici. Dolere malum est: in crucem qui agitur, beatus esse non potest. Hoc enim constituto in philosophia constituta sunt omnia. Ad corpus diceres pertinere-, sed ea, quae dixi, ad corpusne refers? Duo Reges: constructio interrete. An vero, inquit, quisquam potest probare, quod perceptfum, quod. Mene ergo et Triarium dignos existimas, apud quos turpiter loquare? Sed ego in hoc resisto; Diodorus, eius auditor, adiungit ad honestatem vacuitatem doloris. Itaque haec cum illis est dissensio, cum Peripateticis nulla sane. \n\n','2016-02-14 08:46:42','2016-02-14 23:53:10',NULL,NULL,0,1,0),(2414,1,1,1,'Vendors',' Quid ei reliquisti, nisi te, quoquo modo loqueretur, intellegere, quid diceret? Nec lapathi suavitatem acupenseri Galloni Laelius anteponebat, sed suavitatem ipsam neglegebat; Sed id ne cogitari quidem potest quale sit, ut non repugnet ipsum sibi. Idem iste, inquam, de voluptate quid sentit? An ea, quae per vinitorem antea consequebatur, per se ipsa curabit? \n\n','2016-02-14 08:46:42','2016-02-14 23:53:11',NULL,NULL,0,1,0),(2415,1,1,1,'Vendors',' Uterque enim summo bono fruitur, id est voluptate. Quae autem natura suae primae institutionis oblita est? Hoc simile tandem est? Haeret in salebra. Duo Reges: constructio interrete. At certe gravius. Post enim Chrysippum eum non sane est disputatum. Sin laboramus, quis est, qui alienae modum statuat industriae? \n\n','2016-02-14 08:46:42','2016-02-14 23:53:11',NULL,NULL,0,1,0),(2416,1,1,1,'Vendors',' Si enim ad populum me vocas, eum. Tollenda est atque extrahenda radicitus. Videamus igitur sententias eorum, tum ad verba redeamus. Duo Reges: constructio interrete. Quamquam tu hanc copiosiorem etiam soles dicere. Minime vero, inquit ille, consentit. \n\n','2016-02-14 08:46:43','2016-02-14 23:53:11',NULL,NULL,0,1,0),(2417,1,1,1,'Vendors',' Duo Reges: constructio interrete. Apparet statim, quae sint officia, quae actiones. Videamus animi partes, quarum est conspectus illustrior; Quis hoc dicit? Vitiosum est enim in dividendo partem in genere numerare. \n\n','2016-02-14 08:46:43','2016-02-14 23:53:11',NULL,NULL,0,1,0),(2418,1,1,1,'Vendors',' At ego quem huic anteponam non audeo dicere; Invidiosum nomen est, infame, suspectum. Quippe: habes enim a rhetoribus; Duo Reges: constructio interrete. Hinc ceteri particulas arripere conati suam quisque videro voluit afferre sententiam. At iste non dolendi status non vocatur voluptas. Honesta oratio, Socratica, Platonis etiam. \n\n','2016-02-14 08:46:43','2016-02-14 23:53:12',NULL,NULL,0,1,0),(2419,1,1,1,'Vendors',' Quod quidem iam fit etiam in Academia. Non semper, inquam; Duo Reges: constructio interrete. At eum nihili facit; Ergo ita: non posse honeste vivi, nisi honeste vivatur? Theophrastus mediocriterne delectat, cum tractat locos ab Aristotele ante tractatos? Res enim concurrent contrariae. Sed ad bona praeterita redeamus. Nam et complectitur verbis, quod vult, et dicit plane, quod intellegam; Qua tu etiam inprudens utebare non numquam. \n\n','2016-02-14 08:46:44','2016-02-14 23:53:12',NULL,NULL,0,1,0),(2420,1,1,1,'Vendors',' Ad corpus diceres pertinere-, sed ea, quae dixi, ad corpusne refers? Vide ne ista sint Manliana vestra aut maiora etiam, si imperes quod facere non possim. Duo Reges: constructio interrete. De illis, cum volemus. \n\n','2016-02-14 08:46:44','2016-02-14 23:53:12',NULL,NULL,0,1,0),(2421,1,1,1,'Vendors',' Qui ita affectus, beatum esse numquam probabis; At negat Epicurus-hoc enim vestrum lumen estquemquam, qui honeste non vivat, iucunde posse vivere. Quare attende, quaeso. Licet hic rursus ea commemores, quae optimis verbis ab Epicuro de laude amicitiae dicta sunt. Qua ex cognitione facilior facta est investigatio rerum occultissimarum. Duo Reges: constructio interrete. Quonam, inquit, modo? Egone quaeris, inquit, quid sentiam? Atqui, inquam, Cato, si istud optinueris, traducas me ad te totum licebit. Hoc ipsum elegantius poni meliusque potuit. \n\n','2016-02-14 08:46:44','2016-02-14 23:53:13',NULL,NULL,0,1,0),(2422,1,1,1,'Vendors',' Longum est enim ad omnia respondere, quae a te dicta sunt. Velut ego nunc moveor. Quod autem satis est, eo quicquid accessit, nimium est; Bonum valitudo: miser morbus. Deinde disputat, quod cuiusque generis animantium statui deceat extremum. \n\n','2016-02-14 08:46:45','2016-02-14 23:53:13',NULL,NULL,0,1,0),(2423,1,1,1,'Vendors',' Ac tamen hic mallet non dolere. An me, inquam, nisi te audire vellem, censes haec dicturum fuisse? Expectoque quid ad id, quod quaerebam, respondeas. \n\n','2016-02-14 08:46:45','2016-02-14 23:53:13',NULL,NULL,0,1,0),(2424,1,1,1,'Vendors',' Quod si ita se habeat, non possit beatam praestare vitam sapientia. Non dolere, inquam, istud quam vim habeat postea videro; Et quidem iure fortasse, sed tamen non gravissimum est testimonium multitudinis. \n\n','2016-02-14 08:46:45','2016-02-14 23:53:14',NULL,NULL,0,1,0),(2425,1,1,1,'Vendors',' Quem si tenueris, non modo meum Ciceronem, sed etiam me ipsum abducas licebit. Hoc etsi multimodis reprehendi potest, tamen accipio, quod dant. Heri, inquam, ludis commissis ex urbe profectus veni ad vesperum. \n\n','2016-02-14 08:46:46','2016-02-14 23:53:14',NULL,NULL,0,1,0),(2426,1,1,1,'Vendors',' Hoc loco tenere se Triarius non potuit. Huius, Lyco, oratione locuples, rebus ipsis ielunior. Hoc enim constituto in philosophia constituta sunt omnia. Quae quidem sapientes sequuntur duce natura tamquam videntes; Duo Reges: constructio interrete. Istam voluptatem, inquit, Epicurus ignorat? \n\n','2016-02-14 08:46:46','2016-02-14 23:53:14',NULL,NULL,0,1,0),(2427,1,1,1,'Vendors',' Quae hic rei publicae vulnera inponebat, eadem ille sanabat. Quis non odit sordidos, vanos, leves, futtiles? Duo Reges: constructio interrete. Illa videamus, quae a te de amicitia dicta sunt. Cetera illa adhibebat, quibus demptis negat se Epicurus intellegere quid sit bonum. Aliter homines, aliter philosophos loqui putas oportere? Quae fere omnia appellantur uno ingenii nomine, easque virtutes qui habent, ingeniosi vocantur. Iam id ipsum absurdum, maximum malum neglegi. Theophrasti igitur, inquit, tibi liber ille placet de beata vita? Cupiditates non Epicuri divisione finiebat, sed sua satietate. Duarum enim vitarum nobis erunt instituta capienda. \n\n','2016-02-14 08:46:46','2016-02-14 23:53:15',NULL,NULL,0,1,0),(2428,1,1,1,'Vendors',' Partim cursu et peragratione laetantur, congregatione aliae coetum quodam modo civitatis imitantur; A quibus propter discendi cupiditatem videmus ultimas terras esse peragratas. Hoc loco tenere se Triarius non potuit. Atqui iste locus est, Piso, tibi etiam atque etiam confirmandus, inquam; Non enim, si omnia non sequebatur, idcirco non erat ortus illinc. Hoc non est positum in nostra actione. Tecum optime, deinde etiam cum mediocri amico. Duo Reges: constructio interrete. Quid, si non sensus modo ei sit datus, verum etiam animus hominis? Nunc haec primum fortasse audientis servire debemus. \n\n','2016-02-14 08:46:47','2016-02-14 23:53:15',NULL,NULL,0,1,0),(2429,1,1,1,'Vendors',' Qui enim voluptatem ipsam contemnunt, iis licet dicere se acupenserem maenae non anteponere. Duo Reges: constructio interrete. Laboro autem non sine causa; Et quidem, inquit, vehementer errat; Fortasse id optimum, sed ubi illud: Plus semper voluptatis? Videmusne ut pueri ne verberibus quidem a contemplandis rebus perquirendisque deterreantur? Cupiditates non Epicuri divisione finiebat, sed sua satietate. Ex rebus enim timiditas, non ex vocabulis nascitur. Mihi quidem Antiochum, quem audis, satis belle videris attendere. \n\n','2016-02-14 08:46:47','2016-02-14 23:53:15',NULL,NULL,0,1,0);
INSERT INTO `vtiger_crmentity` VALUES (2430,1,1,1,'Vendors',' Quamquam tu hanc copiosiorem etiam soles dicere. An ea, quae per vinitorem antea consequebatur, per se ipsa curabit? Duo Reges: constructio interrete. Illud dico, ea, quae dicat, praeclare inter se cohaerere. Si autem id non concedatur, non continuo vita beata tollitur. Nondum autem explanatum satis, erat, quid maxime natura vellet. Nosti, credo, illud: Nemo pius est, qui pietatem-; At certe gravius. Hoc dixerit potius Ennius: Nimium boni est, cui nihil est mali. Ita prorsus, inquam; Quod si ita se habeat, non possit beatam praestare vitam sapientia. Quare conare, quaeso. \n\n','2016-02-14 08:46:48','2016-02-14 23:53:15',NULL,NULL,0,1,0),(2431,1,1,1,'Vendors',' Sed tempus est, si videtur, et recta quidem ad me. In qua si nihil est praeter rationem, sit in una virtute finis bonorum; \n\n','2016-02-14 08:46:48','2016-02-14 23:53:16',NULL,NULL,0,1,0),(2432,1,1,1,'Vendors',' Ne discipulum abducam, times. Quia nec honesto quic quam honestius nec turpi turpius. Sed haec in pueris; Duo Reges: constructio interrete. Sed tempus est, si videtur, et recta quidem ad me. Ergo hoc quidem apparet, nos ad agendum esse natos. Pauca mutat vel plura sane; \n\n','2016-02-14 08:46:48','2016-02-14 23:53:16',NULL,NULL,0,1,0),(2433,1,1,1,'Vendors',' Ut in geometria, prima si dederis, danda sunt omnia. Iam enim adesse poterit. Duo Reges: constructio interrete. Haec para/doca illi, nos admirabilia dicamus. Quae animi affectio suum cuique tribuens atque hanc, quam dico. \n\n','2016-02-14 08:46:48','2016-02-14 23:53:16',NULL,NULL,0,1,0),(2434,1,1,1,'Vendors',' Illis videtur, qui illud non dubitant bonum dicere -; Summum ením bonum exposuit vacuitatem doloris; Tecum optime, deinde etiam cum mediocri amico. \n\n','2016-02-14 08:46:49','2016-02-14 23:53:17',NULL,NULL,0,1,0),(2435,1,1,1,'Vendors',' Sed residamus, inquit, si placet. Duo Reges: constructio interrete. Unum est sine dolore esse, alterum cum voluptate. Quantum Aristoxeni ingenium consumptum videmus in musicis? Et ille ridens: Video, inquit, quid agas; Quid nunc honeste dicit? Quare attende, quaeso. \n\n','2016-02-14 08:46:49','2016-02-14 23:53:17',NULL,NULL,0,1,0),(2436,1,1,1,'Vendors',' Sin laboramus, quis est, qui alienae modum statuat industriae? Murenam te accusante defenderem. Id est enim, de quo quaerimus. An haec ab eo non dicuntur? Non autem hoc: igitur ne illud quidem. Duo Reges: constructio interrete. Habent enim et bene longam et satis litigiosam disputationem. Iam id ipsum absurdum, maximum malum neglegi. Totum autem id externum est, et quod externum, id in casu est. \n\n','2016-02-14 08:46:49','2016-02-14 23:53:17',NULL,NULL,0,1,0),(2437,1,1,1,'Vendors',' Teneo, inquit, finem illi videri nihil dolere. Sed ille, ut dixi, vitiose. Non minor, inquit, voluptas percipitur ex vilissimis rebus quam ex pretiosissimis. Quae tamen a te agetur non melior, quam illae sunt, quas interdum optines. Quid enim de amicitia statueris utilitatis causa expetenda vides. An ea, quae per vinitorem antea consequebatur, per se ipsa curabit? Duo Reges: constructio interrete. Deinde disputat, quod cuiusque generis animantium statui deceat extremum. Nulla erit controversia. Nam diligi et carum esse iucundum est propterea, quia tutiorem vitam et voluptatem pleniorem efficit. At ille non pertimuit saneque fidenter: Istis quidem ipsis verbis, inquit; \n\n','2016-02-14 08:46:50','2016-02-14 23:53:18',NULL,NULL,0,1,0),(2438,1,1,1,'Vendors',' Quantum Aristoxeni ingenium consumptum videmus in musicis? Quamquam tu hanc copiosiorem etiam soles dicere. Itaque e contrario moderati aequabilesque habitus, affectiones ususque corporis apti esse ad naturam videntur. Dolor ergo, id est summum malum, metuetur semper, etiamsi non aderit; Duo Reges: constructio interrete. Sed vos squalidius, illorum vides quam niteat oratio. Qui autem de summo bono dissentit de tota philosophiae ratione dissentit. Summum a vobis bonum voluptas dicitur. \n\n','2016-02-14 08:46:50','2016-02-14 23:53:18',NULL,NULL,0,1,0),(2439,1,1,1,'Vendors',' Quae enim adhuc protulisti, popularia sunt, ego autem a te elegantiora desidero. Idem iste, inquam, de voluptate quid sentit? Ne amores quidem sanctos a sapiente alienos esse arbitrantur. Quasi ego id curem, quid ille aiat aut neget. \n\n','2016-02-14 08:46:50','2016-02-14 23:53:18',NULL,NULL,0,1,0),(2440,1,1,1,'Vendors',' Beatus autem esse in maximarum rerum timore nemo potest. Duo Reges: constructio interrete. Nam si propter voluptatem, quae est ista laus, quae possit e macello peti? Hanc quoque iucunditatem, si vis, transfer in animum; At iste non dolendi status non vocatur voluptas. Qui est in parvis malis. Sequitur disserendi ratio cognitioque naturae; Tamen a proposito, inquam, aberramus. Quod ea non occurrentia fingunt, vincunt Aristonem; \n\n','2016-02-14 08:46:51','2016-02-14 23:53:19',NULL,NULL,0,1,0),(2441,1,1,1,'Vendors',' Bonum incolumis acies: misera caecitas. Naturales divitias dixit parabiles esse, quod parvo esset natura contenta. Duo Reges: constructio interrete. Non enim iam stirpis bonum quaeret, sed animalis. Quid ad utilitatem tantae pecuniae? Compensabatur, inquit, cum summis doloribus laetitia. Est enim tanti philosophi tamque nobilis audacter sua decreta defendere. Ita relinquet duas, de quibus etiam atque etiam consideret. \n\n','2016-02-14 08:46:51','2016-02-14 23:53:19',NULL,NULL,0,1,0),(2442,1,1,1,'Vendors',' Virtutibus igitur rectissime mihi videris et ad consuetudinem nostrae orationis vitia posuisse contraria. Incommoda autem et commoda-ita enim estmata et dustmata appello-communia esse voluerunt, paria noluerunt. \n\n','2016-02-14 08:46:51','2016-02-14 23:53:19',NULL,NULL,0,1,0),(2443,1,1,1,'Vendors',' Hinc ceteri particulas arripere conati suam quisque videro voluit afferre sententiam. Nec vero alia sunt quaerenda contra Carneadeam illam sententiam. Quae cum dixisset paulumque institisset, Quid est? Duo Reges: constructio interrete. Indicant pueri, in quibus ut in speculis natura cernitur. Videamus igitur sententias eorum, tum ad verba redeamus. \n\n','2016-02-14 08:46:52','2016-02-14 23:53:20',NULL,NULL,0,1,0),(2444,1,1,1,'Vendors',' Quis animo aequo videt eum, quem inpure ac flagitiose putet vivere? Duo Reges: constructio interrete. Aut haec tibi, Torquate, sunt vituperanda aut patrocinium voluptatis repudiandum. Nunc haec primum fortasse audientis servire debemus. Universa enim illorum ratione cum tota vestra confligendum puto. \n\n','2016-02-14 08:46:52','2016-02-14 23:53:20',NULL,NULL,0,1,0),(2445,1,1,1,'Vendors',' Nondum autem explanatum satis, erat, quid maxime natura vellet. Quae cum dixisset, finem ille. \n\n','2016-02-14 08:46:52','2016-02-14 23:53:21',NULL,NULL,0,1,0),(2446,1,1,1,'Vendors',' Illud quaero, quid ei, qui in voluptate summum bonum ponat, consentaneum sit dicere. An est aliquid, quod te sua sponte delectet? Duo Reges: constructio interrete. Eadem fortitudinis ratio reperietur. Sed ego in hoc resisto; An vero, inquit, quisquam potest probare, quod perceptfum, quod. \n\n','2016-02-14 08:46:53','2016-02-14 23:53:21',NULL,NULL,0,1,0),(2447,1,1,1,'Vendors',' Si qua in iis corrigere voluit, deteriora fecit. Non est igitur voluptas bonum. Ergo adhuc, quantum equidem intellego, causa non videtur fuisse mutandi nominis. Suo enim quisque studio maxime ducitur. Duo Reges: constructio interrete. Ubi ut eam caperet aut quando? \n\n','2016-02-14 08:46:53','2016-02-14 23:53:21',NULL,NULL,0,1,0),(2448,1,1,1,'Vendors',' Nunc agendum est subtilius. Iubet igitur nos Pythius Apollo noscere nosmet ipsos. Duo Reges: constructio interrete. Vide, quantum, inquam, fallare, Torquate. Itaque ab his ordiamur. At enim, qua in vita est aliquid mali, ea beata esse non potest. \n\n','2016-02-14 08:46:53','2016-02-14 23:53:22',NULL,NULL,0,1,0),(2449,1,1,1,'Vendors',' Cum autem in quo sapienter dicimus, id a primo rectissime dicitur. Et quidem illud ipsum non nimium probo et tantum patior, philosophum loqui de cupiditatibus finiendis. Ergo instituto veterum, quo etiam Stoici utuntur, hinc capiamus exordium. Duo Reges: constructio interrete. Verba tu fingas et ea dicas, quae non sentias? Pugnant Stoici cum Peripateticis. At modo dixeras nihil in istis rebus esse, quod interesset. Mihi, inquam, qui te id ipsum rogavi? Illa videamus, quae a te de amicitia dicta sunt. \n\n','2016-02-14 08:46:54','2016-02-14 23:53:22',NULL,NULL,0,1,0),(2450,1,1,1,'Vendors',' Sed quid minus probandum quam esse aliquem beatum nec satis beatum? Naturales divitias dixit parabiles esse, quod parvo esset natura contenta. Conclusum est enim contra Cyrenaicos satis acute, nihil ad Epicurum. Duo Reges: constructio interrete. Ne discipulum abducam, times. Quae quidem vel cum periculo est quaerenda vobis; Respondent extrema primis, media utrisque, omnia omnibus. Sed quoniam et advesperascit et mihi ad villam revertendum est, nunc quidem hactenus; \n\n','2016-02-14 08:46:54','2016-02-14 23:53:22',NULL,NULL,0,1,0),(2451,1,1,1,'Vendors',' Quorum sine causa fieri nihil putandum est. Quam tu ponis in verbis, ego positam in re putabam. Maximus dolor, inquit, brevis est. Sed nunc, quod agimus; Cur id non ita fit? Duo Reges: constructio interrete. Claudii libidini, qui tum erat summo ne imperio, dederetur. Quid enim ab antiquis ex eo genere, quod ad disserendum valet, praetermissum est? \n\n','2016-02-14 08:46:54','2016-02-14 23:53:23',NULL,NULL,0,1,0),(2452,1,1,1,'Vendors',' Quaesita enim virtus est, non quae relinqueret naturam, sed quae tueretur. In qua quid est boni praeter summam voluptatem, et eam sempiternam? Si est nihil nisi corpus, summa erunt illa: valitudo, vacuitas doloris, pulchritudo, cetera. Eiuro, inquit adridens, iniquum, hac quidem de re; Materiam vero rerum et copiam apud hos exilem, apud illos uberrimam reperiemus. Quod eo liquidius faciet, si perspexerit rerum inter eas verborumne sit controversia. \n\n','2016-02-14 08:46:55','2016-02-14 23:53:23',NULL,NULL,0,1,0),(2453,1,1,1,'Vendors',' Illis videtur, qui illud non dubitant bonum dicere -; Summus dolor plures dies manere non potest? Ergo instituto veterum, quo etiam Stoici utuntur, hinc capiamus exordium. Efficiens dici potest. Nihil minus, contraque illa hereditate dives ob eamque rem laetus. Et ille ridens: Video, inquit, quid agas; \n\n','2016-02-14 08:46:55','2016-02-14 23:53:23',NULL,NULL,0,1,0),(2454,1,1,1,'Vendors',' Quis Pullum Numitorium Fregellanum, proditorem, quamquam rei publicae nostrae profuit, non odit? Non est igitur voluptas bonum. Illis videtur, qui illud non dubitant bonum dicere -; Nihil enim hoc differt. Illud dico, ea, quae dicat, praeclare inter se cohaerere. Duo Reges: constructio interrete. \n\n','2016-02-14 08:46:55','2016-02-14 23:53:24',NULL,NULL,0,1,0),(2455,1,1,1,'Vendors',' Sit enim idem caecus, debilis. Duarum enim vitarum nobis erunt instituta capienda. Tertium autem omnibus aut maximis rebus iis, quae secundum naturam sint, fruentem vivere. Quid enim possumus hoc agere divinius? Et quidem, inquit, vehementer errat; Duo Reges: constructio interrete. Quare ad ea primum, si videtur; \n\n','2016-02-14 08:46:56','2016-02-14 23:53:24',NULL,NULL,0,1,0),(2456,1,1,1,'Vendors',' Non dolere, inquam, istud quam vim habeat postea videro; Vide, quantum, inquam, fallare, Torquate. Recte, inquit, intellegis. \n\n','2016-02-14 08:46:56','2016-02-14 23:53:24',NULL,NULL,0,1,0),(2457,1,1,1,'Vendors',' Ea, quae dialectici nunc tradunt et docent, nonne ab illis instituta sunt aut inventa sunt? Ut in voluptate sit, qui epuletur, in dolore, qui torqueatur. Quod ea non occurrentia fingunt, vincunt Aristonem; Duo Reges: constructio interrete. \n\n','2016-02-14 08:46:56','2016-02-14 23:53:24',NULL,NULL,0,1,0),(2458,1,1,1,'Vendors',' Quamquam haec quidem praeposita recte et reiecta dicere licebit. Illa argumenta propria videamus, cur omnia sint paria peccata. Quaerimus enim finem bonorum. Sapiens autem semper beatus est et est aliquando in dolore; Quare si potest esse beatus is, qui est in asperis reiciendisque rebus, potest is quoque esse. Duo Reges: constructio interrete. Quae si potest singula consolando levare, universa quo modo sustinebit? Videamus igitur sententias eorum, tum ad verba redeamus. \n\n','2016-02-14 08:46:57','2016-02-14 23:53:25',NULL,NULL,0,1,0),(2459,1,1,1,'Vendors',' Restatis igitur vos; Quod si ita se habeat, non possit beatam praestare vitam sapientia. Neminem videbis ita laudatum, ut artifex callidus comparandarum voluptatum diceretur. Duo Reges: constructio interrete. Quam ob rem tandem, inquit, non satisfacit? Si stante, hoc natura videlicet vult, salvam esse se, quod concedimus; Respondent extrema primis, media utrisque, omnia omnibus. Si mala non sunt, iacet omnis ratio Peripateticorum. \n\n','2016-02-14 08:46:57','2016-02-14 23:53:25',NULL,NULL,0,1,0),(2460,1,1,1,'Vendors',' Poterat autem inpune; Quid est enim aliud esse versutum? Quicquid porro animo cernimus, id omne oritur a sensibus; Quae hic rei publicae vulnera inponebat, eadem ille sanabat. Quae animi affectio suum cuique tribuens atque hanc, quam dico. Ne in odium veniam, si amicum destitero tueri. Duo Reges: constructio interrete. Atque his de rebus et splendida est eorum et illustris oratio. \n\n','2016-02-14 08:46:57','2016-02-14 23:53:25',NULL,NULL,0,1,0),(2461,1,1,1,'Vendors',' Isto modo ne improbos quidem, si essent boni viri. At iam decimum annum in spelunca iacet. Nos cum te, M. Sed tamen omne, quod de re bona dilucide dicitur, mihi praeclare dici videtur. Ita relinquet duas, de quibus etiam atque etiam consideret. Non modo carum sibi quemque, verum etiam vehementer carum esse? Duo Reges: constructio interrete. An quod ita callida est, ut optime possit architectari voluptates? Praetereo multos, in bis doctum hominem et suavem, Hieronymum, quem iam cur Peripateticum appellem nescio. Non est igitur voluptas bonum. Habes, inquam, Cato, formam eorum, de quibus loquor, philosophorum. \n\n','2016-02-14 08:46:58','2016-02-14 23:53:26',NULL,NULL,0,1,0),(2462,1,1,1,'Vendors',' Audio equidem philosophi vocem, Epicure, sed quid tibi dicendum sit oblitus es. Ita relinquet duas, de quibus etiam atque etiam consideret. \n\n','2016-02-14 08:46:58','2016-02-14 23:53:26',NULL,NULL,0,1,0),(2463,1,1,1,'Vendors',' Qui ita affectus, beatum esse numquam probabis; Dicet pro me ipsa virtus nec dubitabit isti vestro beato M. Ille vero, si insipiens-quo certe, quoniam tyrannus -, numquam beatus; Tibi hoc incredibile, quod beatissimum. Erat enim Polemonis. Longum est enim ad omnia respondere, quae a te dicta sunt. \n\n','2016-02-14 08:46:58','2016-02-14 23:53:26',NULL,NULL,0,1,0),(2464,1,1,1,'Vendors',' Aperiendum est igitur, quid sit voluptas; Traditur, inquit, ab Epicuro ratio neglegendi doloris. Illa argumenta propria videamus, cur omnia sint paria peccata. Sed quanta sit alias, nunc tantum possitne esse tanta. Duo Reges: constructio interrete. Consequentia exquirere, quoad sit id, quod volumus, effectum. Si mala non sunt, iacet omnis ratio Peripateticorum. \n\n','2016-02-14 08:46:59','2016-02-14 23:53:27',NULL,NULL,0,1,0),(2465,1,1,1,'Vendors',' Videmusne ut pueri ne verberibus quidem a contemplandis rebus perquirendisque deterreantur? Non enim iam stirpis bonum quaeret, sed animalis. \n\n','2016-02-14 08:46:59','2016-02-14 23:53:27',NULL,NULL,0,1,0),(2466,1,1,1,'Vendors',' Esse enim, nisi eris, non potes. Hoc Hieronymus summum bonum esse dixit. Sed haec quidem liberius ab eo dicuntur et saepius. Non est igitur summum malum dolor. Dic in quovis conventu te omnia facere, ne doleas. Sed quid ages tandem, si utilitas ab amicitia, ut fit saepe, defecerit? \n\n','2016-02-14 08:47:00','2016-02-14 23:53:49',NULL,NULL,0,1,0),(2467,1,1,1,'Vendors',' Iam in altera philosophiae parte. Callipho ad virtutem nihil adiunxit nisi voluptatem, Diodorus vacuitatem doloris. Quo modo autem philosophus loquitur? Cur post Tarentum ad Archytam? Octavio fuit, cum illam severitatem in eo filio adhibuit, quem in adoptionem D. Ut aliquid scire se gaudeant? Duo Reges: constructio interrete. Mihi, inquam, qui te id ipsum rogavi? \n\n','2016-02-14 08:47:00','2016-02-14 23:53:49',NULL,NULL,0,1,0),(2468,1,1,1,'Vendors',' Ratio enim nostra consentit, pugnat oratio. Quod si ita se habeat, non possit beatam praestare vitam sapientia. Non est enim vitium in oratione solum, sed etiam in moribus. Sedulo, inquam, faciam. Hoc ne statuam quidem dicturam pater aiebat, si loqui posset. Duo Reges: constructio interrete. \n\n','2016-02-14 08:47:00','2016-02-14 23:53:50',NULL,NULL,0,1,0),(2469,1,1,1,'Vendors',' Bonum integritas corporis: misera debilitas. Ergo ita: non posse honeste vivi, nisi honeste vivatur? An potest, inquit ille, quicquam esse suavius quam nihil dolere? Duo Reges: constructio interrete. An ea, quae per vinitorem antea consequebatur, per se ipsa curabit? Itaque ad tempus ad Pisonem omnes. \n\n','2016-02-14 08:47:01','2016-02-14 23:53:50',NULL,NULL,0,1,0),(2470,1,1,1,'Vendors',' Huius, Lyco, oratione locuples, rebus ipsis ielunior. Duo Reges: constructio interrete. Tum Torquatus: Prorsus, inquit, assentior; Teneo, inquit, finem illi videri nihil dolere. Prioris generis est docilitas, memoria; Sed haec quidem liberius ab eo dicuntur et saepius. Collatio igitur ista te nihil iuvat. Quid igitur dubitamus in tota eius natura quaerere quid sit effectum? An est aliquid per se ipsum flagitiosum, etiamsi nulla comitetur infamia? \n\n','2016-02-14 08:47:01','2016-02-14 23:53:50',NULL,NULL,0,1,0),(2471,1,1,1,'Vendors',' Nam de isto magna dissensio est. Sit sane ista voluptas. Negat esse eam, inquit, propter se expetendam. Est, ut dicis, inquit; An eum discere ea mavis, quae cum plane perdidiceriti nihil sciat? Apud ceteros autem philosophos, qui quaesivit aliquid, tacet; \n\n','2016-02-14 08:47:01','2016-02-14 23:53:50',NULL,NULL,0,1,0),(2472,1,1,1,'Vendors',' Eaedem res maneant alio modo. Bonum incolumis acies: misera caecitas. Idemne, quod iucunde? Aliter homines, aliter philosophos loqui putas oportere? Haec dicuntur inconstantissime. Quae qui non vident, nihil umquam magnum ac cognitione dignum amaverunt. Non est enim vitium in oratione solum, sed etiam in moribus. Hoc simile tandem est? \n\n','2016-02-14 08:47:02','2016-02-14 23:53:51',NULL,NULL,0,1,0),(2473,1,1,1,'Vendors',' Quod autem ratione actum est, id officium appellamus. Tibi hoc incredibile, quod beatissimum. Sed residamus, inquit, si placet. Quare attende, quaeso. Nondum autem explanatum satis, erat, quid maxime natura vellet. Terram, mihi crede, ea lanx et maria deprimet. \n\n','2016-02-14 08:47:02','2016-02-14 23:53:51',NULL,NULL,0,1,0),(2474,1,1,1,'Vendors',' Quae cum dixisset paulumque institisset, Quid est? Sic enim censent, oportunitatis esse beate vivere. Atque his de rebus et splendida est eorum et illustris oratio. Quicquid porro animo cernimus, id omne oritur a sensibus; \n\n','2016-02-14 08:47:02','2016-02-14 23:53:51',NULL,NULL,0,1,0),(2475,1,1,1,'Vendors',' Ita prorsus, inquam; Atque haec coniunctio confusioque virtutum tamen a philosophis ratione quadam distinguitur. At iam decimum annum in spelunca iacet. Quare hoc videndum est, possitne nobis hoc ratio philosophorum dare. An vero, inquit, quisquam potest probare, quod perceptfum, quod. Duo Reges: constructio interrete. \n\n','2016-02-14 08:47:03','2016-02-14 23:53:52',NULL,NULL,0,1,0),(2476,1,1,1,'Vendors',' Memini vero, inquam; Sed haec nihil sane ad rem; Te ipsum, dignissimum maioribus tuis, voluptasne induxit, ut adolescentulus eriperes P. \n\n','2016-02-14 08:47:03','2016-02-14 23:53:52',NULL,NULL,0,1,0),(2477,1,1,1,'Vendors',' Sit hoc ultimum bonorum, quod nunc a me defenditur; Quis non odit sordidos, vanos, leves, futtiles? Qualis ista philosophia est, quae non interitum afferat pravitatis, sed sit contenta mediocritate vitiorum? Tenent mordicus. Sin dicit obscurari quaedam nec apparere, quia valde parva sint, nos quoque concedimus; Scaevola tribunus plebis ferret ad plebem vellentne de ea re quaeri. \n\n','2016-02-14 08:47:03','2016-02-14 23:53:52',NULL,NULL,0,1,0),(2478,1,1,1,'Vendors',' Ita credo. Duo Reges: constructio interrete. Faceres tu quidem, Torquate, haec omnia; Fatebuntur Stoici haec omnia dicta esse praeclare, neque eam causam Zenoni desciscendi fuisse. \n\n','2016-02-14 08:47:04','2016-02-14 23:53:53',NULL,NULL,0,1,0),(2479,1,1,1,'Vendors',' Si longus, levis. Beatus sibi videtur esse moriens. Illis videtur, qui illud non dubitant bonum dicere -; Theophrastus mediocriterne delectat, cum tractat locos ab Aristotele ante tractatos? Et quod est munus, quod opus sapientiae? Duo Reges: constructio interrete. \n\n','2016-02-14 08:47:04','2016-02-14 23:53:53',NULL,NULL,0,1,0),(2480,1,1,1,'Vendors',' Nec hoc ille non vidit, sed verborum magnificentia est et gloria delectatus. Duo Reges: constructio interrete. \n\n','2016-02-14 08:47:04','2016-02-14 23:53:53',NULL,NULL,0,1,0),(2481,1,1,1,'Vendors',' Restinguet citius, si ardentem acceperit. Vestri haec verecundius, illi fortasse constantius. Inquit, dasne adolescenti veniam? Quamquam te quidem video minime esse deterritum. Sin laboramus, quis est, qui alienae modum statuat industriae? Duo Reges: constructio interrete. Ita ne hoc quidem modo paria peccata sunt. \n\n','2016-02-14 08:47:05','2016-02-14 23:53:54',NULL,NULL,0,1,0),(2482,1,1,1,'Vendors',' Eiuro, inquit adridens, iniquum, hac quidem de re; Tertium autem omnibus aut maximis rebus iis, quae secundum naturam sint, fruentem vivere. Erat enim Polemonis. Quis istud, quaeso, nesciebat? Nos paucis ad haec additis finem faciamus aliquando; Duo Reges: constructio interrete. Tum ille timide vel potius verecunde: Facio, inquit. Potius inflammat, ut coercendi magis quam dedocendi esse videantur. Nec vero alia sunt quaerenda contra Carneadeam illam sententiam. \n\n','2016-02-14 08:47:05','2016-02-14 23:53:54',NULL,NULL,0,1,0),(2483,1,1,1,'Vendors',' Summae mihi videtur inscitiae. An tu me de L. Atque hoc loco similitudines eas, quibus illi uti solent, dissimillimas proferebas. Qua tu etiam inprudens utebare non numquam. Duo Reges: constructio interrete. Mihi quidem Antiochum, quem audis, satis belle videris attendere. Universa enim illorum ratione cum tota vestra confligendum puto. \n\n','2016-02-14 08:47:05','2016-02-14 23:53:54',NULL,NULL,0,1,0),(2484,1,1,1,'Vendors',' Quod autem in homine praestantissimum atque optimum est, id deseruit. Quacumque enim ingredimur, in aliqua historia vestigium ponimus. Duo Reges: constructio interrete. At hoc in eo M. Quid autem habent admirationis, cum prope accesseris? \n\n','2016-02-14 08:47:06','2016-02-14 23:53:55',NULL,NULL,0,1,0),(2485,1,1,1,'Vendors',' Hoc mihi cum tuo fratre convenit. Facillimum id quidem est, inquam. Negat enim summo bono afferre incrementum diem. Negat enim summo bono afferre incrementum diem. Unum est sine dolore esse, alterum cum voluptate. Duo Reges: constructio interrete. At enim hic etiam dolore. Que Manilium, ab iisque M. Quarum ambarum rerum cum medicinam pollicetur, luxuriae licentiam pollicetur. \n\n','2016-02-14 08:47:06','2016-02-14 23:53:55',NULL,NULL,0,1,0),(2486,1,1,1,'Vendors',' Pisone in eo gymnasio, quod Ptolomaeum vocatur, unaque nobiscum Q. Itaque hic ipse iam pridem est reiectus; Sed haec nihil sane ad rem; Pauca mutat vel plura sane; Hoc loco tenere se Triarius non potuit. Duo Reges: constructio interrete. Ratio enim nostra consentit, pugnat oratio. Non autem hoc: igitur ne illud quidem. \n\n','2016-02-14 08:47:06','2016-02-14 23:53:55',NULL,NULL,0,1,0),(2487,1,1,1,'Vendors',' Dic in quovis conventu te omnia facere, ne doleas. Eam tum adesse, cum dolor omnis absit; Ac tamen hic mallet non dolere. Theophrastus mediocriterne delectat, cum tractat locos ab Aristotele ante tractatos? Septem autem illi non suo, sed populorum suffragio omnium nominati sunt. Mihi quidem Antiochum, quem audis, satis belle videris attendere. \n\n','2016-02-14 08:47:07','2016-02-14 23:53:56',NULL,NULL,0,1,0),(2488,1,1,1,'Vendors',' Semovenda est igitur voluptas, non solum ut recta sequamini, sed etiam ut loqui deceat frugaliter. Ita fit cum gravior, tum etiam splendidior oratio. Facete M. Primum divisit ineleganter; Eadem nunc mea adversum te oratio est. Duo Reges: constructio interrete. Hunc vos beatum; Minime vero, inquit ille, consentit. Sed quot homines, tot sententiae; \n\n','2016-02-14 08:47:07','2016-02-14 23:53:56',NULL,NULL,0,1,0),(2489,1,1,1,'Vendors',' Quid igitur dubitamus in tota eius natura quaerere quid sit effectum? Negat enim summo bono afferre incrementum diem. Universa enim illorum ratione cum tota vestra confligendum puto. Duo Reges: constructio interrete. Atqui haec patefactio quasi rerum opertarum, cum quid quidque sit aperitur, definitio est. Haec bene dicuntur, nec ego repugno, sed inter sese ipsa pugnant. \n\n','2016-02-14 08:47:07','2016-02-14 23:53:56',NULL,NULL,0,1,0),(2490,1,1,1,'Vendors',' Primum quid tu dicis breve? An eum discere ea mavis, quae cum plane perdidiceriti nihil sciat? Sed quid attinet de rebus tam apertis plura requirere? Quae hic rei publicae vulnera inponebat, eadem ille sanabat. Quos quidem tibi studiose et diligenter tractandos magnopere censeo. Duo Reges: constructio interrete. Equidem, sed audistine modo de Carneade? Stoicos roga. Negat enim summo bono afferre incrementum diem. Facillimum id quidem est, inquam. \n\n','2016-02-14 08:47:08','2016-02-14 23:53:56',NULL,NULL,0,1,0),(2491,1,1,1,'Vendors',' Cave putes quicquam esse verius. At hoc in eo M. Istam voluptatem perpetuam quis potest praestare sapienti? Duo Reges: constructio interrete. Quoniam, si dis placet, ab Epicuro loqui discimus. Causa autem fuit huc veniendi ut quosdam hinc libros promerem. \n\n','2016-02-14 08:47:08','2016-02-14 23:53:57',NULL,NULL,0,1,0),(2492,1,1,1,'Vendors',' Sed tamen intellego quid velit. Te ipsum, dignissimum maioribus tuis, voluptasne induxit, ut adolescentulus eriperes P. Et hunc idem dico, inquieta sed ad virtutes et ad vitia nihil interesse. Duo Reges: constructio interrete. Miserum hominem! Si dolor summum malum est, dici aliter non potest. \n\n','2016-02-14 08:47:08','2016-02-14 23:53:57',NULL,NULL,0,1,0),(2493,1,1,1,'Vendors',' Haec igitur Epicuri non probo, inquam. Intellegi quidem, ut propter aliam quampiam rem, verbi gratia propter voluptatem, nos amemus; Istam voluptatem perpetuam quis potest praestare sapienti? Huic mori optimum esse propter desperationem sapientiae, illi propter spem vivere. Illa argumenta propria videamus, cur omnia sint paria peccata. Conferam tecum, quam cuique verso rem subicias; Duo Reges: constructio interrete. An ea, quae per vinitorem antea consequebatur, per se ipsa curabit? \n\n','2016-02-14 08:47:09','2016-02-14 23:53:57',NULL,NULL,0,1,0),(2494,1,1,1,'Vendors',' Si autem id non concedatur, non continuo vita beata tollitur. Audax negotium, dicerem impudens, nisi hoc institutum postea translatum ad philosophos nostros esset. Dici enim nihil potest verius. Tum Piso: Quoniam igitur aliquid omnes, quid Lucius noster? Inde igitur, inquit, ordiendum est. Facillimum id quidem est, inquam. \n\n','2016-02-14 08:47:09','2016-02-14 23:53:58',NULL,NULL,0,1,0),(2495,1,1,1,'Vendors',' Si enim ad populum me vocas, eum. Itaque nostrum est-quod nostrum dico, artis est-ad ea principia, quae accepimus. Quid autem habent admirationis, cum prope accesseris? Et quidem illud ipsum non nimium probo et tantum patior, philosophum loqui de cupiditatibus finiendis. Scientiam pollicentur, quam non erat mirum sapientiae cupido patria esse cariorem. Duo Reges: constructio interrete. \n\n','2016-02-14 08:47:09','2016-02-14 23:53:58',NULL,NULL,0,1,0),(2496,1,1,1,'Vendors',' Longum est enim ad omnia respondere, quae a te dicta sunt. Quae cum essent dicta, finem fecimus et ambulandi et disputandi. Quantum Aristoxeni ingenium consumptum videmus in musicis? Sin laboramus, quis est, qui alienae modum statuat industriae? Nunc haec primum fortasse audientis servire debemus. Faceres tu quidem, Torquate, haec omnia; Duo Reges: constructio interrete. Non minor, inquit, voluptas percipitur ex vilissimis rebus quam ex pretiosissimis. \n\n','2016-02-14 08:47:10','2016-02-14 23:53:58',NULL,NULL,0,1,0),(2497,1,1,1,'Vendors',' Hic nihil fuit, quod quaereremus. Quacumque enim ingredimur, in aliqua historia vestigium ponimus. Si qua in iis corrigere voluit, deteriora fecit. Huius, Lyco, oratione locuples, rebus ipsis ielunior. \n\n','2016-02-14 08:47:10','2016-02-14 23:53:59',NULL,NULL,0,1,0),(2498,1,1,1,'Vendors',' Nos paucis ad haec additis finem faciamus aliquando; Illa argumenta propria videamus, cur omnia sint paria peccata. Fortasse id optimum, sed ubi illud: Plus semper voluptatis? Ergo adhuc, quantum equidem intellego, causa non videtur fuisse mutandi nominis. Ego vero isti, inquam, permitto. Sed nimis multa. \n\n','2016-02-14 08:47:10','2016-02-14 23:53:59',NULL,NULL,0,1,0),(2499,1,1,1,'Vendors',' Theophrasti igitur, inquit, tibi liber ille placet de beata vita? Igitur neque stultorum quisquam beatus neque sapientium non beatus. Duo Reges: constructio interrete. Non autem hoc: igitur ne illud quidem. Vitae autem degendae ratio maxime quidem illis placuit quieta. Quodcumque in mentem incideret, et quodcumque tamquam occurreret. Et ille ridens: Video, inquit, quid agas; Quamvis enim depravatae non sint, pravae tamen esse possunt. Illud non continuo, ut aeque incontentae. \n\n','2016-02-14 08:47:11','2016-02-14 23:53:59',NULL,NULL,0,1,0),(2500,1,1,1,'Vendors',' Eiuro, inquit adridens, iniquum, hac quidem de re; At, illa, ut vobis placet, partem quandam tuetur, reliquam deserit. Apparet statim, quae sint officia, quae actiones. Duo Reges: constructio interrete. Quis istud, quaeso, nesciebat? Nam aliquando posse recte fieri dicunt nulla expectata nec quaesita voluptate. Quid ei reliquisti, nisi te, quoquo modo loqueretur, intellegere, quid diceret? Hoc loco tenere se Triarius non potuit. \n\n','2016-02-14 08:47:11','2016-02-14 23:54:00',NULL,NULL,0,1,0),(2501,1,1,1,'Vendors',' Quod quidem iam fit etiam in Academia. Cur tantas regiones barbarorum pedibus obiit, tot maria transmisit? Cur igitur, inquam, res tam dissimiles eodem nomine appellas? Atqui iste locus est, Piso, tibi etiam atque etiam confirmandus, inquam; Beatus autem esse in maximarum rerum timore nemo potest. Unum est sine dolore esse, alterum cum voluptate. Duo Reges: constructio interrete. \n\n','2016-02-14 08:47:11','2016-02-14 23:54:00',NULL,NULL,0,1,0),(2502,1,1,1,'Vendors',' Tubulo putas dicere? Expressa vero in iis aetatibus, quae iam confirmatae sunt. Sequitur disserendi ratio cognitioque naturae; Duo Reges: constructio interrete. Duo enim genera quae erant, fecit tria. \n\n','2016-02-14 08:47:12','2016-02-14 23:54:00',NULL,NULL,0,1,0),(2503,1,1,1,'Vendors',' Et quidem, inquit, vehementer errat; Quonam modo? Ad corpus diceres pertinere-, sed ea, quae dixi, ad corpusne refers? Est igitur officium eius generis, quod nec in bonis ponatur nec in contrariis. Obsecro, inquit, Torquate, haec dicit Epicurus? Duo Reges: constructio interrete. Quid ad utilitatem tantae pecuniae? Illum mallem levares, quo optimum atque humanissimum virum, Cn. Primum Theophrasti, Strato, physicum se voluit; Potius inflammat, ut coercendi magis quam dedocendi esse videantur. \n\n','2016-02-14 08:47:12','2016-02-14 23:54:00',NULL,NULL,0,1,0),(2504,1,1,1,'Vendors',' Frater et T. Qui est in parvis malis. Sine ea igitur iucunde negat posse se vivere? Rationis enim perfectio est virtus; Duo Reges: constructio interrete. Quod non faceret, si in voluptate summum bonum poneret. \n\n','2016-02-14 08:47:12','2016-02-14 23:54:01',NULL,NULL,0,1,0),(2505,1,1,1,'Vendors',' Tecum optime, deinde etiam cum mediocri amico. Nam quibus rebus efficiuntur voluptates, eae non sunt in potestate sapientis. Quamquam tu hanc copiosiorem etiam soles dicere. \n\n','2016-02-14 08:47:13','2016-02-14 23:54:01',NULL,NULL,0,1,0),(2506,1,1,1,'Vendors',' Non quam nostram quidem, inquit Pomponius iocans; Non autem hoc: igitur ne illud quidem. Venit ad extremum; Ergo illi intellegunt quid Epicurus dicat, ego non intellego? Non modo carum sibi quemque, verum etiam vehementer carum esse? \n\n','2016-02-14 08:47:13','2016-02-14 23:54:01',NULL,NULL,0,1,0),(2507,1,1,1,'Vendors',' Sed residamus, inquit, si placet. Traditur, inquit, ab Epicuro ratio neglegendi doloris. Quid de Platone aut de Democrito loquar? Parvi enim primo ortu sic iacent, tamquam omnino sine animo sint. Ac tamen hic mallet non dolere. Duo Reges: constructio interrete. An dolor longissimus quisque miserrimus, voluptatem non optabiliorem diuturnitas facit? Quonam, inquit, modo? Bonum patria: miserum exilium. Ut placet, inquit, etsi enim illud erat aptius, aequum cuique concedere. \n\n','2016-02-14 08:47:13','2016-02-14 23:54:02',NULL,NULL,0,1,0),(2508,1,1,1,'Vendors',' Equidem e Cn. Hoc dixerit potius Ennius: Nimium boni est, cui nihil est mali. Iam id ipsum absurdum, maximum malum neglegi. Haec para/doca illi, nos admirabilia dicamus. Certe non potest. \n\n','2016-02-14 08:47:14','2016-02-14 23:54:02',NULL,NULL,0,1,0),(2509,1,1,1,'Vendors',' Sed erat aequius Triarium aliquid de dissensione nostra iudicare. Praeclarae mortes sunt imperatoriae; A mene tu? Illum mallem levares, quo optimum atque humanissimum virum, Cn. Duo Reges: constructio interrete. Itaque primos congressus copulationesque et consuetudinum instituendarum voluntates fieri propter voluptatem; Peccata paria. Quodsi ipsam honestatem undique pertectam atque absolutam. Quamvis enim depravatae non sint, pravae tamen esse possunt. Respondent extrema primis, media utrisque, omnia omnibus. \n\n','2016-02-14 08:47:14','2016-02-14 23:54:02',NULL,NULL,0,1,0),(2510,1,1,1,'Vendors',' Res enim concurrent contrariae. An haec ab eo non dicuntur? Iam id ipsum absurdum, maximum malum neglegi. Dolor ergo, id est summum malum, metuetur semper, etiamsi non aderit; Paupertas si malum est, mendicus beatus esse nemo potest, quamvis sit sapiens. \n\n','2016-02-14 08:47:14','2016-02-14 23:54:03',NULL,NULL,0,1,0),(2511,1,1,1,'Vendors',' An hoc usque quaque, aliter in vita? Sed haec nihil sane ad rem; Cum praesertim illa perdiscere ludus esset. Sed utrum hortandus es nobis, Luci, inquit, an etiam tua sponte propensus es? Nec vero alia sunt quaerenda contra Carneadeam illam sententiam. Duo Reges: constructio interrete. Semper enim ita adsumit aliquid, ut ea, quae prima dederit, non deserat. Quae in controversiam veniunt, de iis, si placet, disseramus. Rhetorice igitur, inquam, nos mavis quam dialectice disputare? \n\n','2016-02-14 08:47:15','2016-02-14 23:54:03',NULL,NULL,0,1,0),(2512,1,1,1,'Vendors',' Non modo carum sibi quemque, verum etiam vehementer carum esse? Eadem nunc mea adversum te oratio est. Duo Reges: constructio interrete. Ergo illi intellegunt quid Epicurus dicat, ego non intellego? Longum est enim ad omnia respondere, quae a te dicta sunt. Re mihi non aeque satisfacit, et quidem locis pluribus. Quare ad ea primum, si videtur; Nam si propter voluptatem, quae est ista laus, quae possit e macello peti? Quod iam a me expectare noli. \n\n','2016-02-14 08:47:15','2016-02-14 23:54:03',NULL,NULL,0,1,0),(2513,1,1,1,'Vendors',' Nec hoc ille non vidit, sed verborum magnificentia est et gloria delectatus. Quam ob rem tandem, inquit, non satisfacit? Duo enim genera quae erant, fecit tria. Quamquam ab iis philosophiam et omnes ingenuas disciplinas habemus; Post enim Chrysippum eum non sane est disputatum. Ita ne hoc quidem modo paria peccata sunt. Hoc ne statuam quidem dicturam pater aiebat, si loqui posset. Nam de isto magna dissensio est. Duo Reges: constructio interrete. \n\n','2016-02-14 08:47:15','2016-02-14 23:54:04',NULL,NULL,0,1,0),(2514,1,1,1,'Vendors',' Nunc omni virtuti vitium contrario nomine opponitur. Quo plebiscito decreta a senatu est consuli quaestio Cn. Quid ei reliquisti, nisi te, quoquo modo loqueretur, intellegere, quid diceret? Vide, quantum, inquam, fallare, Torquate. Eorum enim est haec querela, qui sibi cari sunt seseque diligunt. Sed finge non solum callidum eum, qui aliquid improbe faciat, verum etiam praepotentem, ut M. Duo Reges: constructio interrete. Itaque hic ipse iam pridem est reiectus; Quod vestri quidem vel optime disputant, nihil opus esse eum, qui philosophus futurus sit, scire litteras. \n\n','2016-02-14 08:47:16','2016-02-14 23:54:04',NULL,NULL,0,1,0),(2515,1,1,1,'Vendors',' Istam voluptatem perpetuam quis potest praestare sapienti? Non quam nostram quidem, inquit Pomponius iocans; Hanc ergo intuens debet institutum illud quasi signum absolvere. Eadem nunc mea adversum te oratio est. Duo Reges: constructio interrete. Habent enim et bene longam et satis litigiosam disputationem. \n\n','2016-02-14 08:47:16','2016-02-14 23:54:04',NULL,NULL,0,1,0),(2516,1,1,1,'Vendors',' Istam voluptatem perpetuam quis potest praestare sapienti? Nam, ut sint illa vendibiliora, haec uberiora certe sunt. Id enim volumus, id contendimus, ut officii fructus sit ipsum officium. Collige omnia, quae soletis: Praesidium amicorum. In his igitur partibus duabus nihil erat, quod Zeno commutare gestiret. Si qua in iis corrigere voluit, deteriora fecit. \n\n','2016-02-14 08:47:16','2016-02-14 23:54:05',NULL,NULL,0,1,0),(2517,1,1,1,'Vendors',' Ex eorum enim scriptis et institutis cum omnis doctrina liberalis, omnis historia. Bonum negas esse divitias, praeposìtum esse dicis? At ille non pertimuit saneque fidenter: Istis quidem ipsis verbis, inquit; Progredientibus autem aetatibus sensim tardeve potius quasi nosmet ipsos cognoscimus. Sequitur disserendi ratio cognitioque naturae; Suo enim quisque studio maxime ducitur. Duo Reges: constructio interrete. Nulla profecto est, quin suam vim retineat a primo ad extremum. \n\n','2016-02-14 08:47:17','2016-02-14 23:54:05',NULL,NULL,0,1,0),(2518,1,1,1,'Vendors',' Cur id non ita fit? Si quidem, inquit, tollerem, sed relinquo. Sed in rebus apertissimis nimium longi sumus. Expressa vero in iis aetatibus, quae iam confirmatae sunt. Apparet statim, quae sint officia, quae actiones. \n\n','2016-02-14 08:47:17','2016-02-14 23:54:05',NULL,NULL,0,1,0),(2519,1,1,1,'Vendors',' Virtutis, magnitudinis animi, patientiae, fortitudinis fomentis dolor mitigari solet. Consequentia exquirere, quoad sit id, quod volumus, effectum. Quo modo autem optimum, si bonum praeterea nullum est? Sed ad bona praeterita redeamus. Theophrasti igitur, inquit, tibi liber ille placet de beata vita? Parvi enim primo ortu sic iacent, tamquam omnino sine animo sint. Duo Reges: constructio interrete. Si verbum sequimur, primum longius verbum praepositum quam bonum. \n\n','2016-02-14 08:47:17','2016-02-14 23:54:06',NULL,NULL,0,1,0),(2520,1,1,1,'Vendors',' An hoc usque quaque, aliter in vita? Sed ea mala virtuti magnitudine obruebantur. Huius ego nunc auctoritatem sequens idem faciam. Tu vero, inquam, ducas licet, si sequetur; Non igitur potestis voluptate omnia dirigentes aut tueri aut retinere virtutem. Tu vero, inquam, ducas licet, si sequetur; Duo Reges: constructio interrete. Est igitur officium eius generis, quod nec in bonis ponatur nec in contrariis. \n\n','2016-02-14 08:47:18','2016-02-14 23:54:06',NULL,NULL,0,1,0),(2521,1,1,1,'Vendors',' Non autem hoc: igitur ne illud quidem. Duo Reges: constructio interrete. Superiores tres erant, quae esse possent, quarum est una sola defensa, eaque vehementer. Hos contra singulos dici est melius. At ille pellit, qui permulcet sensum voluptate. Etsi ea quidem, quae adhuc dixisti, quamvis ad aetatem recte isto modo dicerentur. Conferam tecum, quam cuique verso rem subicias; Sed erat aequius Triarium aliquid de dissensione nostra iudicare. Sed erat aequius Triarium aliquid de dissensione nostra iudicare. \n\n','2016-02-14 08:47:18','2016-02-14 23:54:06',NULL,NULL,0,1,0),(2522,1,1,1,'Vendors',' Illud dico, ea, quae dicat, praeclare inter se cohaerere. Itaque sensibus rationem adiunxit et ratione effecta sensus non reliquit. Quae similitudo in genere etiam humano apparet. Vulgo enim dicitur: Iucundi acti labores, nec male Euripidesconcludam, si potero, Latine; Haec quo modo conveniant, non sane intellego. \n\n','2016-02-14 08:47:18','2016-02-14 23:54:07',NULL,NULL,0,1,0),(2523,1,1,1,'Vendors',' Quae contraria sunt his, malane? Itaque nostrum est-quod nostrum dico, artis est-ad ea principia, quae accepimus. Sed plane dicit quod intellegit. Qui autem esse poteris, nisi te amor ipse ceperit? Quia dolori non voluptas contraria est, sed doloris privatio. Duo Reges: constructio interrete. \n\n','2016-02-14 08:47:19','2016-02-14 23:54:07',NULL,NULL,0,1,0),(2524,1,1,1,'Vendors',' Itaque ad tempus ad Pisonem omnes. Diodorus, eius auditor, adiungit ad honestatem vacuitatem doloris. Respondent extrema primis, media utrisque, omnia omnibus. \n\n','2016-02-14 08:47:19','2016-02-14 23:54:07',NULL,NULL,0,1,0),(2525,1,1,1,'Vendors',' Tenesne igitur, inquam, Hieronymus Rhodius quid dicat esse summum bonum, quo putet omnia referri oportere? Comprehensum, quod cognitum non habet? Cum ageremus, inquit, vitae beatum et eundem supremum diem, scribebamus haec. Non quaero, quid dicat, sed quid convenienter possit rationi et sententiae suae dicere. Hoc loco tenere se Triarius non potuit. Duo Reges: constructio interrete. \n\n','2016-02-14 08:47:19','2016-02-14 23:54:08',NULL,NULL,0,1,0),(2526,1,1,1,'Vendors',' Cur deinde Metrodori liberos commendas? Quis est tam dissimile homini. Equidem, sed audistine modo de Carneade? Vitae autem degendae ratio maxime quidem illis placuit quieta. Duo Reges: constructio interrete. Vide ne ista sint Manliana vestra aut maiora etiam, si imperes quod facere non possim. \n\n','2016-02-14 08:47:20','2016-02-14 23:54:08',NULL,NULL,0,1,0),(2527,1,1,1,'Vendors',' Sin tantum modo ad indicia veteris memoriae cognoscenda, curiosorum. Nos quidem Virtutes sic natae sumus, ut tibi serviremus, aliud negotii nihil habemus. Quaesita enim virtus est, non quae relinqueret naturam, sed quae tueretur. Si enim ad populum me vocas, eum. Sed fortuna fortis; Duo Reges: constructio interrete. Praeteritis, inquit, gaudeo. Inscite autem medicinae et gubernationis ultimum cum ultimo sapientiae comparatur. Tubulo putas dicere? Post enim Chrysippum eum non sane est disputatum. \n\n','2016-02-14 08:47:20','2016-02-14 23:54:08',NULL,NULL,0,1,0),(2528,1,1,1,'Vendors',' Qui non moveatur et offensione turpitudinis et comprobatione honestatis? Quare conare, quaeso. Quae cum praeponunt, ut sit aliqua rerum selectio, naturam videntur sequi; Duo Reges: constructio interrete. Respondent extrema primis, media utrisque, omnia omnibus. Quod cum dixissent, ille contra. Non est ista, inquam, Piso, magna dissensio. Nunc omni virtuti vitium contrario nomine opponitur. Igitur neque stultorum quisquam beatus neque sapientium non beatus. Sed in rebus apertissimis nimium longi sumus. Maximas vero virtutes iacere omnis necesse est voluptate dominante. \n\n','2016-02-14 08:47:20','2016-02-14 23:54:09',NULL,NULL,0,1,0),(2529,1,1,1,'Vendors',' Eadem fortitudinis ratio reperietur. Facile est hoc cernere in primis puerorum aetatulis. Uterque enim summo bono fruitur, id est voluptate. Et quidem, inquit, vehementer errat; Duo Reges: constructio interrete. Hoc etsi multimodis reprehendi potest, tamen accipio, quod dant. Illa tamen simplicia, vestra versuta. Sint modo partes vitae beatae. His singulis copiose responderi solet, sed quae perspicua sunt longa esse non debent. \n\n','2016-02-14 08:47:21','2016-02-14 23:54:09',NULL,NULL,0,1,0),(2530,1,1,1,'Vendors',' Non quam nostram quidem, inquit Pomponius iocans; Aliter enim explicari, quod quaeritur, non potest. Atque haec ita iustitiae propria sunt, ut sint virtutum reliquarum communia. Deinde dolorem quem maximum? At certe gravius. Hoc etsi multimodis reprehendi potest, tamen accipio, quod dant. Duo Reges: constructio interrete. Tum ille timide vel potius verecunde: Facio, inquit. \n\n','2016-02-14 08:47:21','2016-02-14 23:54:09',NULL,NULL,0,1,0),(2531,1,1,1,'Vendors',' Potius inflammat, ut coercendi magis quam dedocendi esse videantur. Nihil sane. Illa sunt similia: hebes acies est cuipiam oculorum, corpore alius senescit; Est enim effectrix multarum et magnarum voluptatum. Nos vero, inquit ille; Duo Reges: constructio interrete. Est igitur officium eius generis, quod nec in bonis ponatur nec in contrariis. Graece donan, Latine voluptatem vocant. Non pugnem cum homine, cur tantum habeat in natura boni; \n\n','2016-02-14 08:47:21','2016-02-14 23:54:09',NULL,NULL,0,1,0),(2532,1,1,1,'Vendors',' Habes, inquam, Cato, formam eorum, de quibus loquor, philosophorum. Quid autem habent admirationis, cum prope accesseris? Age sane, inquam. Nam his libris eum malo quam reliquo ornatu villae delectari. Duo Reges: constructio interrete. Quid nunc honeste dicit? Sint modo partes vitae beatae. Est igitur officium eius generis, quod nec in bonis ponatur nec in contrariis. \n\n','2016-02-14 08:47:22','2016-02-14 23:54:10',NULL,NULL,0,1,0),(2533,1,1,1,'Vendors',' Quod equidem non reprehendo; In his igitur partibus duabus nihil erat, quod Zeno commutare gestiret. Duo Reges: constructio interrete. Duo enim genera quae erant, fecit tria. Suo genere perveniant ad extremum; Restatis igitur vos; Nam si beatus umquam fuisset, beatam vitam usque ad illum a Cyro extructum rogum pertulisset. \n\n','2016-02-14 08:47:22','2016-02-14 23:54:10',NULL,NULL,0,1,0),(2534,1,1,1,'Vendors',' Non igitur de improbo, sed de callido improbo quaerimus, qualis Q. Itaque eos id agere, ut a se dolores, morbos, debilitates repellant. Duo Reges: constructio interrete. Utinam quidem dicerent alium alio beatiorem! Iam ruinas videres. Si autem id non concedatur, non continuo vita beata tollitur. \n\n','2016-02-14 08:47:23','2016-02-14 23:54:10',NULL,NULL,0,1,0),(2535,1,1,1,'Vendors',' Nosti, credo, illud: Nemo pius est, qui pietatem-; Ergo hoc quidem apparet, nos ad agendum esse natos. Id mihi magnum videtur. Egone quaeris, inquit, quid sentiam? Ad eas enim res ab Epicuro praecepta dantur. Quae duo sunt, unum facit. Duo Reges: constructio interrete. Sed ad rem redeamus; \n\n','2016-02-14 08:47:23','2016-02-14 23:54:11',NULL,NULL,0,1,0),(2536,1,1,1,'Vendors',' Ergo opifex plus sibi proponet ad formarum quam civis excellens ad factorum pulchritudinem? Quid, quod res alia tota est? At quicum ioca seria, ut dicitur, quicum arcana, quicum occulta omnia? Duo Reges: constructio interrete. Nam diligi et carum esse iucundum est propterea, quia tutiorem vitam et voluptatem pleniorem efficit. Comprehensum, quod cognitum non habet? Quae qui non vident, nihil umquam magnum ac cognitione dignum amaverunt. Pauca mutat vel plura sane; \n\n','2016-02-14 08:47:23','2016-02-14 23:54:11',NULL,NULL,0,1,0),(2537,1,1,1,'Vendors',' Nosti, credo, illud: Nemo pius est, qui pietatem-; Duo Reges: constructio interrete. Saepe ab Aristotele, a Theophrasto mirabiliter est laudata per se ipsa rerum scientia; Sed eum qui audiebant, quoad poterant, defendebant sententiam suam. Quodsi ipsam honestatem undique pertectam atque absolutam. Ego quoque, inquit, didicerim libentius si quid attuleris, quam te reprehenderim. \n\n','2016-02-14 08:47:24','2016-02-14 23:54:11',NULL,NULL,0,1,0),(2538,1,1,1,'Vendors',' Quonam, inquit, modo? Animi enim quoque dolores percipiet omnibus partibus maiores quam corporis. Duo Reges: constructio interrete. Nam adhuc, meo fortasse vitio, quid ego quaeram non perspicis. \n\n','2016-02-14 08:47:24','2016-02-14 23:54:11',NULL,NULL,0,1,0),(2539,1,1,1,'Vendors',' Sumenda potius quam expetenda. Sed plane dicit quod intellegit. Sed erat aequius Triarium aliquid de dissensione nostra iudicare. Duo Reges: constructio interrete. Videamus animi partes, quarum est conspectus illustrior; Roges enim Aristonem, bonane ei videantur haec: vacuitas doloris, divitiae, valitudo; Aliter homines, aliter philosophos loqui putas oportere? Apud ceteros autem philosophos, qui quaesivit aliquid, tacet; \n\n','2016-02-14 08:47:24','2016-02-14 23:54:12',NULL,NULL,0,1,0),(2540,1,1,1,'Vendors',' Non est ista, inquam, Piso, magna dissensio. Sed haec nihil sane ad rem; Quid est igitur, inquit, quod requiras? Quid enim possumus hoc agere divinius? Duo Reges: constructio interrete. Quodcumque in mentem incideret, et quodcumque tamquam occurreret. Quae in controversiam veniunt, de iis, si placet, disseramus. Nihilne est in his rebus, quod dignum libero aut indignum esse ducamus? \n\n','2016-02-14 08:47:25','2016-02-14 23:54:12',NULL,NULL,0,1,0),(2541,1,1,1,'Vendors',' Sed quanta sit alias, nunc tantum possitne esse tanta. Duo Reges: constructio interrete. \n\n','2016-02-14 08:47:25','2016-02-14 23:54:12',NULL,NULL,0,1,0),(2542,1,1,1,'Vendors',' Sed eum qui audiebant, quoad poterant, defendebant sententiam suam. An tu me de L. Septem autem illi non suo, sed populorum suffragio omnium nominati sunt. Ergo id est convenienter naturae vivere, a natura discedere. Duo Reges: constructio interrete. Quid, si non sensus modo ei sit datus, verum etiam animus hominis? Nondum autem explanatum satis, erat, quid maxime natura vellet. \n\n','2016-02-14 08:47:25','2016-02-14 23:54:13',NULL,NULL,0,1,0),(2543,1,1,1,'Vendors',' Oratio me istius philosophi non offendit; Quae diligentissime contra Aristonem dicuntur a Chryippo. Huius ego nunc auctoritatem sequens idem faciam. Duo Reges: constructio interrete. Et quidem iure fortasse, sed tamen non gravissimum est testimonium multitudinis. Qui autem esse poteris, nisi te amor ipse ceperit? Illa videamus, quae a te de amicitia dicta sunt. At enim hic etiam dolore. \n\n','2016-02-14 08:47:26','2016-02-14 23:54:13',NULL,NULL,0,1,0),(2544,1,1,1,'Vendors',' Equidem etiam Epicurum, in physicis quidem, Democriteum puto. Non autem hoc: igitur ne illud quidem. Nunc ita separantur, ut disiuncta sint, quo nihil potest esse perversius. Qua tu etiam inprudens utebare non numquam. Duo Reges: constructio interrete. Tollenda est atque extrahenda radicitus. Utinam quidem dicerent alium alio beatiorem! Iam ruinas videres. Quis suae urbis conservatorem Codrum, quis Erechthei filias non maxime laudat? Et certamen honestum et disputatio splendida! omnis est enim de virtutis dignitate contentio. \n\n','2016-02-14 08:47:26','2016-02-14 23:54:13',NULL,NULL,0,1,0),(2545,1,1,1,'Vendors',' Ergo hoc quidem apparet, nos ad agendum esse natos. Modo etiam paulum ad dexteram de via declinavi, ut ad Pericli sepulcrum accederem. Igitur ne dolorem quidem. Dat enim intervalla et relaxat. Quonam, inquit, modo? Alterum significari idem, ut si diceretur, officia media omnia aut pleraque servantem vivere. Duo Reges: constructio interrete. Hoc loco tenere se Triarius non potuit. \n\n','2016-02-14 08:47:26','2016-02-14 23:54:14',NULL,NULL,0,1,0),(2546,1,1,1,'Vendors',' Sin autem est in ea, quod quidam volunt, nihil impedit hanc nostram comprehensionem summi boni. Cyrenaici quidem non recusant; Duo Reges: constructio interrete. Qui est in parvis malis. Aliter homines, aliter philosophos loqui putas oportere? Hic quoque suus est de summoque bono dissentiens dici vere Peripateticus non potest. Sic enim censent, oportunitatis esse beate vivere. Sed haec quidem liberius ab eo dicuntur et saepius. Videmusne ut pueri ne verberibus quidem a contemplandis rebus perquirendisque deterreantur? At ille pellit, qui permulcet sensum voluptate. Nulla erit controversia. Non laboro, inquit, de nomine. \n\n','2016-02-14 08:47:27','2016-02-14 23:54:14',NULL,NULL,0,1,0),(2547,1,1,1,'Vendors',' Nunc ita separantur, ut disiuncta sint, quo nihil potest esse perversius. Quae cum dixisset paulumque institisset, Quid est? Mihi vero, inquit, placet agi subtilius et, ut ipse dixisti, pressius. Hoc loco discipulos quaerere videtur, ut, qui asoti esse velint, philosophi ante fiant. Utilitatis causa amicitia est quaesita. \n\n','2016-02-14 08:47:27','2016-02-14 23:54:14',NULL,NULL,0,1,0),(2548,1,1,1,'Vendors',' Tollitur beneficium, tollitur gratia, quae sunt vincla concordiae. Duo Reges: constructio interrete. \n\n','2016-02-14 08:47:27','2016-02-14 23:54:15',NULL,NULL,0,1,0),(2549,1,1,1,'Vendors',' Sed nunc, quod agimus; Sit hoc ultimum bonorum, quod nunc a me defenditur; Ergo id est convenienter naturae vivere, a natura discedere. Huius ego nunc auctoritatem sequens idem faciam. Sed haec quidem liberius ab eo dicuntur et saepius. Duo Reges: constructio interrete. \n\n','2016-02-14 08:47:28','2016-02-14 23:54:15',NULL,NULL,0,1,0),(2550,1,1,1,'Vendors',' Sextilio Rufo, cum is rem ad amicos ita deferret, se esse heredem Q. Si verbum sequimur, primum longius verbum praepositum quam bonum. Vide igitur ne non debeas verbis nostris uti, sententiis tuis. Ergo, si semel tristior effectus est, hilara vita amissa est? De ingenio eius in his disputationibus, non de moribus quaeritur. Suam denique cuique naturam esse ad vivendum ducem. Duo Reges: constructio interrete. Quod quidem nobis non saepe contingit. Quamvis enim depravatae non sint, pravae tamen esse possunt. Quarum ambarum rerum cum medicinam pollicetur, luxuriae licentiam pollicetur. \n\n','2016-02-14 08:47:28','2016-02-14 23:54:16',NULL,NULL,0,1,0),(2551,1,1,1,'Vendors',' Non modo carum sibi quemque, verum etiam vehementer carum esse? Nunc ita separantur, ut disiuncta sint, quo nihil potest esse perversius. Nam memini etiam quae nolo, oblivisci non possum quae volo. Sin tantum modo ad indicia veteris memoriae cognoscenda, curiosorum. Duo Reges: constructio interrete. Quod autem principium officii quaerunt, melius quam Pyrrho; \n\n','2016-02-14 08:47:28','2016-02-14 23:54:16',NULL,NULL,0,1,0),(2552,1,1,1,'Vendors',' Itaque quantum adiit periculum! ad honestatem enim illum omnem conatum suum referebat, non ad voluptatem. Sapiens autem semper beatus est et est aliquando in dolore; Age, inquies, ista parva sunt. Non laboro, inquit, de nomine. Nummus in Croesi divitiis obscuratur, pars est tamen divitiarum. Tu vero, inquam, ducas licet, si sequetur; Duo Reges: constructio interrete. Hoc etsi multimodis reprehendi potest, tamen accipio, quod dant. \n\n','2016-02-14 08:47:29','2016-02-14 23:54:16',NULL,NULL,0,1,0),(2553,1,1,1,'Vendors',' Neque enim disputari sine reprehensione nec cum iracundia aut pertinacia recte disputari potest. Deinde prima illa, quae in congressu solemus: Quid tu, inquit, huc? Hi curatione adhibita levantur in dies, valet alter plus cotidie, alter videt. Duo Reges: constructio interrete. Idemne potest esse dies saepius, qui semel fuit? Sin kakan malitiam dixisses, ad aliud nos unum certum vitium consuetudo Latina traduceret. Stulti autem malorum memoria torquentur, sapientes bona praeterita grata recordatione renovata delectant. Equidem etiam Epicurum, in physicis quidem, Democriteum puto. \n\n','2016-02-14 08:47:29','2016-02-14 23:54:17',NULL,NULL,0,1,0),(2554,1,1,1,'Vendors',' Si quicquam extra virtutem habeatur in bonis. An quod ita callida est, ut optime possit architectari voluptates? Vos autem cum perspicuis dubia debeatis illustrare, dubiis perspicua conamini tollere. Cupit enim dícere nihil posse ad beatam vitam deesse sapienti. Nihil opus est exemplis hoc facere longius. Aliter autem vobis placet. Terram, mihi crede, ea lanx et maria deprimet. Faceres tu quidem, Torquate, haec omnia; \n\n','2016-02-14 08:47:29','2016-02-14 23:54:17',NULL,NULL,0,1,0),(2555,1,1,1,'Vendors',' Nam et complectitur verbis, quod vult, et dicit plane, quod intellegam; Quae ista amicitia est? At ille pellit, qui permulcet sensum voluptate. \n\n','2016-02-14 08:47:30','2016-02-14 23:54:17',NULL,NULL,0,1,0),(2556,1,1,1,'Vendors',' Nam si propter voluptatem, quae est ista laus, quae possit e macello peti? Nihilo beatiorem esse Metellum quam Regulum. Nam ista vestra: Si gravis, brevis; Duo enim genera quae erant, fecit tria. Satis est tibi in te, satis in legibus, satis in mediocribus amicitiis praesidii. Ratio enim nostra consentit, pugnat oratio. \n\n','2016-02-14 08:47:30','2016-02-14 23:54:18',NULL,NULL,0,1,0),(2557,1,1,1,'Vendors',' Tum Quintus: Est plane, Piso, ut dicis, inquit. Si de re disceptari oportet, nulla mihi tecum, Cato, potest esse dissensio. Qui potest igitur habitare in beata vita summi mali metus? Expectoque quid ad id, quod quaerebam, respondeas. Quem si tenueris, non modo meum Ciceronem, sed etiam me ipsum abducas licebit. Satisne vobis videor pro meo iure in vestris auribus commentatus? Duo Reges: constructio interrete. Theophrastus mediocriterne delectat, cum tractat locos ab Aristotele ante tractatos? Si enim ita est, vide ne facinus facias, cum mori suadeas. Cur post Tarentum ad Archytam? Eam tum adesse, cum dolor omnis absit; \n\n','2016-02-14 08:47:30','2016-02-14 23:54:18',NULL,NULL,0,1,0),(2558,1,1,1,'Vendors',' An eiusdem modi? Dicam, inquam, et quidem discendi causa magis, quam quo te aut Epicurum reprehensum velim. Sed virtutem ipsam inchoavit, nihil amplius. Ad corpus diceres pertinere-, sed ea, quae dixi, ad corpusne refers? Sed ad bona praeterita redeamus. Duo Reges: constructio interrete. Quamvis enim depravatae non sint, pravae tamen esse possunt. \n\n','2016-02-14 08:47:31','2016-02-14 23:54:18',NULL,NULL,0,1,0),(2559,1,1,1,'Vendors',' Itaque vides, quo modo loquantur, nova verba fingunt, deserunt usitata. Sin tantum modo ad indicia veteris memoriae cognoscenda, curiosorum. Quid ad utilitatem tantae pecuniae? Sed tamen intellego quid velit. Equidem e Cn. Duo Reges: constructio interrete. \n\n','2016-02-14 08:47:31','2016-02-14 23:54:19',NULL,NULL,0,1,0),(2560,1,1,1,'Vendors',' Quem si tenueris, non modo meum Ciceronem, sed etiam me ipsum abducas licebit. Nam si amitti vita beata potest, beata esse non potest. Sed vos squalidius, illorum vides quam niteat oratio. Tum Quintus: Est plane, Piso, ut dicis, inquit. Ita enim vivunt quidam, ut eorum vita refellatur oratio. An est aliquid, quod te sua sponte delectet? Utrum igitur tibi litteram videor an totas paginas commovere? Duo Reges: constructio interrete. \n\n','2016-02-14 08:47:31','2016-02-14 23:54:19',NULL,NULL,0,1,0),(2561,1,1,1,'Vendors',' Sed haec in pueris; Facile est hoc cernere in primis puerorum aetatulis. Egone quaeris, inquit, quid sentiam? Illi enim inter se dissentiunt. Haec para/doca illi, nos admirabilia dicamus. Duo Reges: constructio interrete. Sed erat aequius Triarium aliquid de dissensione nostra iudicare. \n\n','2016-02-14 08:47:32','2016-02-14 23:54:19',NULL,NULL,0,1,0),(2562,1,1,1,'Vendors',' Quis Pullum Numitorium Fregellanum, proditorem, quamquam rei publicae nostrae profuit, non odit? Rhetorice igitur, inquam, nos mavis quam dialectice disputare? Quis hoc dicit? Graecum enim hunc versum nostis omnes-: Suavis laborum est praeteritorum memoria. Universa enim illorum ratione cum tota vestra confligendum puto. Ut placet, inquit, etsi enim illud erat aptius, aequum cuique concedere. Cum audissem Antiochum, Brute, ut solebam, cum M. Duo Reges: constructio interrete. \n\n','2016-02-14 08:47:32','2016-02-14 23:54:20',NULL,NULL,0,1,0),(2563,1,1,1,'Vendors',' At, illa, ut vobis placet, partem quandam tuetur, reliquam deserit. Quid ei reliquisti, nisi te, quoquo modo loqueretur, intellegere, quid diceret? Sit hoc ultimum bonorum, quod nunc a me defenditur; Sed quod proximum fuit non vidit. Addidisti ad extremum etiam indoctum fuisse. \n\n','2016-02-14 08:47:32','2016-02-14 23:54:20',NULL,NULL,0,1,0),(2564,1,1,1,'Vendors',' Theophrastus mediocriterne delectat, cum tractat locos ab Aristotele ante tractatos? Quacumque enim ingredimur, in aliqua historia vestigium ponimus. Profectus in exilium Tubulus statim nec respondere ausus; Materiam vero rerum et copiam apud hos exilem, apud illos uberrimam reperiemus. Sed ego in hoc resisto; Sit hoc ultimum bonorum, quod nunc a me defenditur; Duo Reges: constructio interrete. Me igitur ipsum ames oportet, non mea, si veri amici futuri sumus. Sin tantum modo ad indicia veteris memoriae cognoscenda, curiosorum. Nihil enim hoc differt. Quis est enim, in quo sit cupiditas, quin recte cupidus dici possit? \n\n','2016-02-14 08:47:33','2016-02-14 23:54:20',NULL,NULL,0,1,0),(2565,1,1,1,'Vendors',' Vide, ne etiam menses! nisi forte eum dicis, qui, simul atque arripuit, interficit. Hoc loco tenere se Triarius non potuit. Nihil enim hoc differt. Non igitur bene. Eam stabilem appellas. Unum nescio, quo modo possit, si luxuriosus sit, finitas cupiditates habere. Duo Reges: constructio interrete. \n\n','2016-02-14 08:47:33','2016-02-14 23:54:20',NULL,NULL,0,1,0),(2566,1,1,1,'Vendors',' Equidem soleo etiam quod uno Graeci, si aliter non possum, idem pluribus verbis exponere. Scaevola tribunus plebis ferret ad plebem vellentne de ea re quaeri. Utram tandem linguam nescio? Quae diligentissime contra Aristonem dicuntur a Chryippo. Duo Reges: constructio interrete. Igitur ne dolorem quidem. Hoc non est positum in nostra actione. \n\n','2016-02-14 08:47:33','2016-02-14 23:54:21',NULL,NULL,0,1,0),(2567,1,1,1,'Vendors',' Duo Reges: constructio interrete. Et quod est munus, quod opus sapientiae? Sed venio ad inconstantiae crimen, ne saepius dicas me aberrare; Is ita vivebat, ut nulla tam exquisita posset inveniri voluptas, qua non abundaret. \n\n','2016-02-14 08:47:34','2016-02-14 23:54:21',NULL,NULL,0,1,0),(2568,1,1,1,'Vendors',' Velut ego nunc moveor. Illum mallem levares, quo optimum atque humanissimum virum, Cn. Sed erat aequius Triarium aliquid de dissensione nostra iudicare. Scientiam pollicentur, quam non erat mirum sapientiae cupido patria esse cariorem. Non laboro, inquit, de nomine. Duo Reges: constructio interrete. Vide, quantum, inquam, fallare, Torquate. Satis est ad hoc responsum. Inscite autem medicinae et gubernationis ultimum cum ultimo sapientiae comparatur. Collige omnia, quae soletis: Praesidium amicorum. Ergo illi intellegunt quid Epicurus dicat, ego non intellego? In qua quid est boni praeter summam voluptatem, et eam sempiternam? \n\n','2016-02-14 08:47:34','2016-02-14 23:54:21',NULL,NULL,0,1,0),(2569,1,1,1,'Vendors',' Quod non faceret, si in voluptate summum bonum poneret. At iam decimum annum in spelunca iacet. Naturales divitias dixit parabiles esse, quod parvo esset natura contenta. Itaque et manendi in vita et migrandi ratio omnis iis rebus, quas supra dixi, metienda. Duo Reges: constructio interrete. Cur ipse Pythagoras et Aegyptum lustravit et Persarum magos adiit? Familiares nostros, credo, Sironem dicis et Philodemum, cum optimos viros, tum homines doctissimos. An est aliquid, quod te sua sponte delectet? Scio enim esse quosdam, qui quavis lingua philosophari possint; Sed quid attinet de rebus tam apertis plura requirere? \n\n','2016-02-14 08:47:34','2016-02-14 23:54:22',NULL,NULL,0,1,0),(2570,1,1,1,'Vendors',' Id mihi magnum videtur. Sed plane dicit quod intellegit. Videmusne ut pueri ne verberibus quidem a contemplandis rebus perquirendisque deterreantur? Quia nec honesto quic quam honestius nec turpi turpius. Ea possunt paria non esse. Duo Reges: constructio interrete. Est, ut dicis, inquit; Primum in nostrane potestate est, quid meminerimus? \n\n','2016-02-14 08:47:35','2016-02-14 23:54:22',NULL,NULL,0,1,0),(2571,1,1,1,'Vendors',' Quis enim potest ea, quae probabilia videantur ei, non probare? Duo Reges: constructio interrete. Erat enim Polemonis. Qui non moveatur et offensione turpitudinis et comprobatione honestatis? Et quod est munus, quod opus sapientiae? Negat enim summo bono afferre incrementum diem. Prodest, inquit, mihi eo esse animo. Ergo, inquit, tibi Q. \n\n','2016-02-14 08:47:35','2016-02-14 23:54:22',NULL,NULL,0,1,0),(2572,1,1,1,'Vendors',' Ita graviter et severe voluptatem secrevit a bono. Quis hoc dicit? Cum id fugiunt, re eadem defendunt, quae Peripatetici, verba. Duo Reges: constructio interrete. Quis Aristidem non mortuum diligit? Sed ad haec, nisi molestum est, habeo quae velim. Tum ille timide vel potius verecunde: Facio, inquit. Summum ením bonum exposuit vacuitatem doloris; \n\n','2016-02-14 08:47:35','2016-02-14 23:54:23',NULL,NULL,0,1,0),(2573,1,1,1,'Vendors',' Sed quid minus probandum quam esse aliquem beatum nec satis beatum? Sit enim idem caecus, debilis. Tollitur beneficium, tollitur gratia, quae sunt vincla concordiae. In his igitur partibus duabus nihil erat, quod Zeno commutare gestiret. \n\n','2016-02-14 08:47:36','2016-02-14 23:54:23',NULL,NULL,0,1,0),(2574,1,1,1,'Vendors',' Audeo dicere, inquit. Ex eorum enim scriptis et institutis cum omnis doctrina liberalis, omnis historia. Graecis hoc modicum est: Leonidas, Epaminondas, tres aliqui aut quattuor; Qui non moveatur et offensione turpitudinis et comprobatione honestatis? Non est igitur summum malum dolor. Nullum inveniri verbum potest quod magis idem declaret Latine, quod Graece, quam declarat voluptas. Duo Reges: constructio interrete. \n\n','2016-02-14 08:47:36','2016-02-14 23:54:23',NULL,NULL,0,1,0),(2575,1,1,1,'Vendors',' Certe non potest. Expressa vero in iis aetatibus, quae iam confirmatae sunt. Nonne igitur tibi videntur, inquit, mala? Duo Reges: constructio interrete. Nosti, credo, illud: Nemo pius est, qui pietatem-; \n\n','2016-02-14 08:47:36','2016-02-14 23:54:24',NULL,NULL,0,1,0),(2576,1,1,1,'Vendors',' Sed quid attinet de rebus tam apertis plura requirere? Multa sunt dicta ab antiquis de contemnendis ac despiciendis rebus humanis; Tum Piso: Quoniam igitur aliquid omnes, quid Lucius noster? Duo Reges: constructio interrete. Sapiens autem semper beatus est et est aliquando in dolore; Quid ergo aliud intellegetur nisi uti ne quae pars naturae neglegatur? In qua quid est boni praeter summam voluptatem, et eam sempiternam? Quod si ita se habeat, non possit beatam praestare vitam sapientia. Istam voluptatem perpetuam quis potest praestare sapienti? Atque his de rebus et splendida est eorum et illustris oratio. \n\n','2016-02-14 08:47:37','2016-02-14 23:54:24',NULL,NULL,0,1,0),(2577,1,1,1,'Vendors',' Occultum facinus esse potuerit, gaudebit; Nam, ut sint illa vendibiliora, haec uberiora certe sunt. Urgent tamen et nihil remittunt. Nonne videmus quanta perturbatio rerum omnium consequatur, quanta confusio? \n\n','2016-02-14 08:47:37','2016-02-14 23:54:24',NULL,NULL,0,1,0),(2578,1,1,1,'Vendors',' Non enim, si omnia non sequebatur, idcirco non erat ortus illinc. Hoc Hieronymus summum bonum esse dixit. Quae quo sunt excelsiores, eo dant clariora indicia naturae. Huius ego nunc auctoritatem sequens idem faciam. Oratio me istius philosophi non offendit; Experiamur igitur, inquit, etsi habet haec Stoicorum ratio difficilius quiddam et obscurius. Duo Reges: constructio interrete. \n\n','2016-02-14 08:47:37','2016-02-14 23:54:25',NULL,NULL,0,1,0),(2579,1,1,1,'Vendors',' Efficiens dici potest. Quo plebiscito decreta a senatu est consuli quaestio Cn. Age sane, inquam. Sed potestne rerum maior esse dissensio? Duo Reges: constructio interrete. Comprehensum, quod cognitum non habet? Ergo illi intellegunt quid Epicurus dicat, ego non intellego? Qua ex cognitione facilior facta est investigatio rerum occultissimarum. Quid autem habent admirationis, cum prope accesseris? Homines optimi non intellegunt totam rationem everti, si ita res se habeat. \n\n','2016-02-14 08:47:38','2016-02-14 23:54:25',NULL,NULL,0,1,0),(2580,1,1,1,'Vendors',' Quacumque enim ingredimur, in aliqua historia vestigium ponimus. Duo Reges: constructio interrete. Quaerimus enim finem bonorum. Illud non continuo, ut aeque incontentae. An hoc usque quaque, aliter in vita? Bestiarum vero nullum iudicium puto. Luxuriam non reprehendit, modo sit vacua infinita cupiditate et timore. Esse enim, nisi eris, non potes. Sed quot homines, tot sententiae; Philosophi autem in suis lectulis plerumque moriuntur. Primum divisit ineleganter; Quid iudicant sensus? \n\n','2016-02-14 08:47:38','2016-02-14 23:54:25',NULL,NULL,0,1,0),(2581,1,1,1,'Vendors',' Innumerabilia dici possunt in hanc sententiam, sed non necesse est. Quodsi ipsam honestatem undique pertectam atque absolutam. Quid, quod res alia tota est? Vide, ne etiam menses! nisi forte eum dicis, qui, simul atque arripuit, interficit. \n\n','2016-02-14 08:47:39','2016-02-14 23:54:26',NULL,NULL,0,1,0),(2582,1,1,1,'Vendors',' Causa autem fuit huc veniendi ut quosdam hinc libros promerem. Sin tantum modo ad indicia veteris memoriae cognoscenda, curiosorum. Hoc non est positum in nostra actione. Aperiendum est igitur, quid sit voluptas; \n\n','2016-02-14 08:47:39','2016-02-14 23:54:26',NULL,NULL,0,1,0),(2583,1,1,1,'Vendors',' Duo Reges: constructio interrete. Mihi vero, inquit, placet agi subtilius et, ut ipse dixisti, pressius. Isto modo, ne si avia quidem eius nata non esset. Haec dicuntur fortasse ieiunius; Tum Quintus: Est plane, Piso, ut dicis, inquit. Duo enim genera quae erant, fecit tria. Addidisti ad extremum etiam indoctum fuisse. Contemnit enim disserendi elegantiam, confuse loquitur. Haec para/doca illi, nos admirabilia dicamus. Nulla profecto est, quin suam vim retineat a primo ad extremum. \n\n','2016-02-14 08:47:39','2016-02-14 23:54:26',NULL,NULL,0,1,0),(2584,1,1,1,'Vendors',' Qui ita affectus, beatum esse numquam probabis; Et quidem, inquit, vehementer errat; Isto modo ne improbos quidem, si essent boni viri. Nam quibus rebus efficiuntur voluptates, eae non sunt in potestate sapientis. Quod autem magnum dolorem brevem, longinquum levem esse dicitis, id non intellego quale sit. Duo Reges: constructio interrete. Quae cum dixisset paulumque institisset, Quid est? Cur, nisi quod turpis oratio est? Quis istum dolorem timet? \n\n','2016-02-14 08:47:40','2016-02-14 23:54:27',NULL,NULL,0,1,0),(2585,1,1,1,'Vendors',' Quo studio Aristophanem putamus aetatem in litteris duxisse? Habent enim et bene longam et satis litigiosam disputationem. Sic enim maiores nostri labores non fugiendos tristissimo tamen verbo aerumnas etiam in deo nominaverunt. Duo Reges: constructio interrete. Sin eam, quam Hieronymus, ne fecisset idem, ut voluptatem illam Aristippi in prima commendatione poneret. Si verbum sequimur, primum longius verbum praepositum quam bonum. Primum in nostrane potestate est, quid meminerimus? Quos quidem tibi studiose et diligenter tractandos magnopere censeo. \n\n','2016-02-14 08:47:40','2016-02-14 23:54:27',NULL,NULL,0,1,0),(2586,1,1,1,'Vendors',' Quare attende, quaeso. Velut ego nunc moveor. Maximas vero virtutes iacere omnis necesse est voluptate dominante. \n\n','2016-02-14 08:47:40','2016-02-14 23:54:28',NULL,NULL,0,1,0),(2587,1,1,1,'Vendors',' Beatus sibi videtur esse moriens. Quae iam oratio non a philosopho aliquo, sed a censore opprimenda est. \n\n','2016-02-14 08:47:41','2016-02-14 23:54:28',NULL,NULL,0,1,0),(2588,1,1,1,'Vendors',' Faceres tu quidem, Torquate, haec omnia; Tollenda est atque extrahenda radicitus. Et hercule-fatendum est enim, quod sentio -mirabilis est apud illos contextus rerum. Expressa vero in iis aetatibus, quae iam confirmatae sunt. Dolor ergo, id est summum malum, metuetur semper, etiamsi non aderit; Duo Reges: constructio interrete. Ergo adhuc, quantum equidem intellego, causa non videtur fuisse mutandi nominis. Quem Tiberina descensio festo illo die tanto gaudio affecit, quanto L. \n\n','2016-02-14 08:47:41','2016-02-14 23:54:28',NULL,NULL,0,1,0),(2589,1,1,1,'Vendors',' Hoc etsi multimodis reprehendi potest, tamen accipio, quod dant. Quid enim est a Chrysippo praetermissum in Stoicis? De hominibus dici non necesse est. Et nemo nimium beatus est; Huius, Lyco, oratione locuples, rebus ipsis ielunior. \n\n','2016-02-14 08:47:41','2016-02-14 23:54:29',NULL,NULL,0,1,0),(2590,1,1,1,'Vendors',' Quis Aristidem non mortuum diligit? Habes, inquam, Cato, formam eorum, de quibus loquor, philosophorum. Et nemo nimium beatus est; Non modo carum sibi quemque, verum etiam vehementer carum esse? Sic enim censent, oportunitatis esse beate vivere. Et quod est munus, quod opus sapientiae? \n\n','2016-02-14 08:47:42','2016-02-14 23:54:29',NULL,NULL,0,1,0),(2591,1,1,1,'Vendors',' Fatebuntur Stoici haec omnia dicta esse praeclare, neque eam causam Zenoni desciscendi fuisse. Atque his de rebus et splendida est eorum et illustris oratio. Sic consequentibus vestris sublatis prima tolluntur. Quae animi affectio suum cuique tribuens atque hanc, quam dico. Num igitur eum postea censes anxio animo aut sollicito fuisse? Tum mihi Piso: Quid ergo? Duo Reges: constructio interrete. Sin laboramus, quis est, qui alienae modum statuat industriae? Si enim ita est, vide ne facinus facias, cum mori suadeas. Indicant pueri, in quibus ut in speculis natura cernitur. Nunc agendum est subtilius. \n\n','2016-02-14 08:47:42','2016-02-14 23:54:29',NULL,NULL,0,1,0),(2592,1,1,1,'Vendors',' Mihi enim satis est, ipsis non satis. Audax negotium, dicerem impudens, nisi hoc institutum postea translatum ad philosophos nostros esset. Atqui iste locus est, Piso, tibi etiam atque etiam confirmandus, inquam; \n\n','2016-02-14 08:47:42','2016-02-14 23:54:29',NULL,NULL,0,1,0),(2593,1,1,1,'Vendors',' Saepe ab Aristotele, a Theophrasto mirabiliter est laudata per se ipsa rerum scientia; Neque enim civitas in seditione beata esse potest nec in discordia dominorum domus; Facit enim ille duo seiuncta ultima bonorum, quae ut essent vera, coniungi debuerunt; Istam voluptatem perpetuam quis potest praestare sapienti? Quae diligentissime contra Aristonem dicuntur a Chryippo. \n\n','2016-02-14 08:47:43','2016-02-14 23:54:30',NULL,NULL,0,1,0),(2594,1,1,1,'Vendors',' Non igitur de improbo, sed de callido improbo quaerimus, qualis Q. Sed eum qui audiebant, quoad poterant, defendebant sententiam suam. Hoc loco discipulos quaerere videtur, ut, qui asoti esse velint, philosophi ante fiant. Duae sunt enim res quoque, ne tu verba solum putes. Estne, quaeso, inquam, sitienti in bibendo voluptas? Omnis enim est natura diligens sui. Nondum autem explanatum satis, erat, quid maxime natura vellet. \n\n','2016-02-14 08:47:43','2016-02-14 23:54:30',NULL,NULL,0,1,0),(2595,1,1,1,'Vendors',' Miserum hominem! Si dolor summum malum est, dici aliter non potest. Cetera illa adhibebat, quibus demptis negat se Epicurus intellegere quid sit bonum. Quos quidem tibi studiose et diligenter tractandos magnopere censeo. Erit enim mecum, si tecum erit. Huius, Lyco, oratione locuples, rebus ipsis ielunior. Duo Reges: constructio interrete. Scio enim esse quosdam, qui quavis lingua philosophari possint; Quaesita enim virtus est, non quae relinqueret naturam, sed quae tueretur. Iam enim adesse poterit. Quid ergo attinet dicere: Nihil haberem, quod reprehenderem, si finitas cupiditates haberent? Itaque his sapiens semper vacabit. At ille pellit, qui permulcet sensum voluptate. \n\n','2016-02-14 08:47:43','2016-02-14 23:54:30',NULL,NULL,0,1,0),(2596,1,1,1,'Vendors',' De ingenio eius in his disputationibus, non de moribus quaeritur. Si qua in iis corrigere voluit, deteriora fecit. Quod quidem iam fit etiam in Academia. Bonum valitudo: miser morbus. Itaque mihi non satis videmini considerare quod iter sit naturae quaeque progressio. Cupit enim dícere nihil posse ad beatam vitam deesse sapienti. Duo Reges: constructio interrete. \n\n','2016-02-14 08:47:44','2016-02-14 23:54:31',NULL,NULL,0,1,0),(2597,1,1,1,'Vendors',' Ita relinquet duas, de quibus etiam atque etiam consideret. Quid de Pythagora? Vide, quantum, inquam, fallare, Torquate. Aliter enim nosmet ipsos nosse non possumus. Ab his oratores, ab his imperatores ac rerum publicarum principes extiterunt. Itaque contra est, ac dicitis; Minime vero istorum quidem, inquit. Duo Reges: constructio interrete. Quicquid porro animo cernimus, id omne oritur a sensibus; Traditur, inquit, ab Epicuro ratio neglegendi doloris. \n\n','2016-02-14 08:47:44','2016-02-14 23:54:31',NULL,NULL,0,1,0),(2598,1,1,1,'Vendors',' Esse enim quam vellet iniquus iustus poterat inpune. Quorum altera prosunt, nocent altera. Est enim effectrix multarum et magnarum voluptatum. Maximas vero virtutes iacere omnis necesse est voluptate dominante. Quae sunt igitur communia vobis cum antiquis, iis sic utamur quasi concessis; Quid ergo? Duo Reges: constructio interrete. \n\n','2016-02-14 08:47:44','2016-02-14 23:54:31',NULL,NULL,0,1,0),(2599,1,1,1,'Vendors',' Traditur, inquit, ab Epicuro ratio neglegendi doloris. Mihi enim erit isdem istis fortasse iam utendum. Laboro autem non sine causa; Vide, quantum, inquam, fallare, Torquate. \n\n','2016-02-14 08:47:45','2016-02-14 23:54:31',NULL,NULL,0,1,0),(2600,1,1,1,'Vendors',' Beatus autem esse in maximarum rerum timore nemo potest. Non quam nostram quidem, inquit Pomponius iocans; Duo Reges: constructio interrete. At certe gravius. Hoc loco discipulos quaerere videtur, ut, qui asoti esse velint, philosophi ante fiant. Hoc tu nunc in illo probas. Ne amores quidem sanctos a sapiente alienos esse arbitrantur. Sed residamus, inquit, si placet. Non est igitur summum malum dolor. \n\n','2016-02-14 08:47:45','2016-02-14 23:54:32',NULL,NULL,0,1,0),(2601,1,1,1,'Vendors',' At enim hic etiam dolore. Nihil sane. Confecta res esset. Nemo nostrum istius generis asotos iucunde putat vivere. Duo Reges: constructio interrete. Si enim ita est, vide ne facinus facias, cum mori suadeas. Illum mallem levares, quo optimum atque humanissimum virum, Cn. Videamus animi partes, quarum est conspectus illustrior; Nam quibus rebus efficiuntur voluptates, eae non sunt in potestate sapientis. Sin aliud quid voles, postea. Dic in quovis conventu te omnia facere, ne doleas. \n\n','2016-02-14 08:47:45','2016-02-14 23:54:32',NULL,NULL,0,1,0),(2602,1,1,1,'Vendors',' Iam enim adesse poterit. Deinde prima illa, quae in congressu solemus: Quid tu, inquit, huc? Quae duo sunt, unum facit. Sed tu istuc dixti bene Latine, parum plane. Maximas vero virtutes iacere omnis necesse est voluptate dominante. Duo Reges: constructio interrete. \n\n','2016-02-14 08:47:46','2016-02-14 23:54:32',NULL,NULL,0,1,0),(2603,1,1,1,'Vendors',' Ergo hoc quidem apparet, nos ad agendum esse natos. Sed ad rem redeamus; Sint modo partes vitae beatae. Cur tantas regiones barbarorum pedibus obiit, tot maria transmisit? Et quidem iure fortasse, sed tamen non gravissimum est testimonium multitudinis. Nunc omni virtuti vitium contrario nomine opponitur. \n\n','2016-02-14 08:47:46','2016-02-14 23:54:33',NULL,NULL,0,1,0),(2604,1,1,1,'Vendors',' An eiusdem modi? Occultum facinus esse potuerit, gaudebit; Quonam, inquit, modo? Universa enim illorum ratione cum tota vestra confligendum puto. Hoc loco tenere se Triarius non potuit. Mihi, inquam, qui te id ipsum rogavi? \n\n','2016-02-14 08:47:46','2016-02-14 23:54:33',NULL,NULL,0,1,0),(2605,1,1,1,'Vendors',' Sed emolumenta communia esse dicuntur, recte autem facta et peccata non habentur communia. Duo Reges: constructio interrete. Quaerimus enim finem bonorum. Id quaeris, inquam, in quo, utrum respondero, verses te huc atque illuc necesse est. Nec vero alia sunt quaerenda contra Carneadeam illam sententiam. Mihi enim satis est, ipsis non satis. \n\n','2016-02-14 08:47:47','2016-02-14 23:54:33',NULL,NULL,0,1,0),(2606,1,1,1,'Vendors',' An eiusdem modi? Si quicquam extra virtutem habeatur in bonis. Si quicquam extra virtutem habeatur in bonis. Duo Reges: constructio interrete. Equidem, sed audistine modo de Carneade? Sit hoc ultimum bonorum, quod nunc a me defenditur; Summus dolor plures dies manere non potest? Ergo illi intellegunt quid Epicurus dicat, ego non intellego? \n\n','2016-02-14 08:47:47','2016-02-14 23:54:34',NULL,NULL,0,1,0),(2607,1,1,1,'Vendors',' Sit hoc ultimum bonorum, quod nunc a me defenditur; Zenonis est, inquam, hoc Stoici. Eademne, quae restincta siti? Itaque hic ipse iam pridem est reiectus; Isto modo ne improbos quidem, si essent boni viri. Nemo igitur esse beatus potest. Duo Reges: constructio interrete. Non igitur bene. Quamquam ab iis philosophiam et omnes ingenuas disciplinas habemus; Portenta haec esse dicit, neque ea ratione ullo modo posse vivi; Quid autem habent admirationis, cum prope accesseris? \n\n','2016-02-14 08:47:47','2016-02-14 23:54:34',NULL,NULL,0,1,0),(2608,1,1,1,'Vendors',' Nec enim, dum metuit, iustus est, et certe, si metuere destiterit, non erit; Itaque haec cum illis est dissensio, cum Peripateticis nulla sane. Duo Reges: constructio interrete. Re mihi non aeque satisfacit, et quidem locis pluribus. Atqui eorum nihil est eius generis, ut sit in fine atque extrerno bonorum. Et quidem iure fortasse, sed tamen non gravissimum est testimonium multitudinis. Tu autem, si tibi illa probabantur, cur non propriis verbis ea tenebas? Placet igitur tibi, Cato, cum res sumpseris non concessas, ex illis efficere, quod velis? \n\n','2016-02-14 08:47:48','2016-02-14 23:54:34',NULL,NULL,0,1,0),(2609,1,1,1,'Vendors',' Quid dubitas igitur mutare principia naturae? Summum a vobis bonum voluptas dicitur. Quod autem satis est, eo quicquid accessit, nimium est; At enim, qua in vita est aliquid mali, ea beata esse non potest. \n\n','2016-02-14 08:47:48','2016-02-14 23:54:34',NULL,NULL,0,1,0),(2610,1,1,1,'Vendors',' Non quaero, quid dicat, sed quid convenienter possit rationi et sententiae suae dicere. Ergo in gubernando nihil, in officio plurimum interest, quo in genere peccetur. Duo Reges: constructio interrete. Id Sextilius factum negabat. Quodsi ipsam honestatem undique pertectam atque absolutam. Ut optime, secundum naturam affectum esse possit. Et non ex maxima parte de tota iudicabis? Aliter enim nosmet ipsos nosse non possumus. \n\n','2016-02-14 08:47:49','2016-02-14 23:54:35',NULL,NULL,0,1,0),(2611,1,1,1,'Vendors',' Nam de summo mox, ut dixi, videbimus et ad id explicandum disputationem omnem conferemus. Sic enim censent, oportunitatis esse beate vivere. Duo Reges: constructio interrete. Sic enim censent, oportunitatis esse beate vivere. Conferam tecum, quam cuique verso rem subicias; Potius inflammat, ut coercendi magis quam dedocendi esse videantur. \n\n','2016-02-14 08:47:49','2016-02-14 23:54:35',NULL,NULL,0,1,0),(2612,1,1,1,'Vendors',' Sed haec quidem liberius ab eo dicuntur et saepius. Non est ista, inquam, Piso, magna dissensio. Quo modo autem optimum, si bonum praeterea nullum est? Dempta enim aeternitate nihilo beatior Iuppiter quam Epicurus; Duo Reges: constructio interrete. Cur deinde Metrodori liberos commendas? An potest, inquit ille, quicquam esse suavius quam nihil dolere? Expressa vero in iis aetatibus, quae iam confirmatae sunt. Quodsi ipsam honestatem undique pertectam atque absolutam. Illud quaero, quid ei, qui in voluptate summum bonum ponat, consentaneum sit dicere. Aliter homines, aliter philosophos loqui putas oportere? \n\n','2016-02-14 08:47:49','2016-02-14 23:54:35',NULL,NULL,0,1,0),(2613,1,1,1,'Vendors',' Ut pulsi recurrant? Atqui haec patefactio quasi rerum opertarum, cum quid quidque sit aperitur, definitio est. Quorum sine causa fieri nihil putandum est. Quis Aristidem non mortuum diligit? Quia nec honesto quic quam honestius nec turpi turpius. \n\n','2016-02-14 08:47:50','2016-02-14 23:54:36',NULL,NULL,0,1,0),(2614,1,1,1,'Vendors',' Nam quid possumus facere melius? Tertium autem omnibus aut maximis rebus iis, quae secundum naturam sint, fruentem vivere. Vide igitur ne non debeas verbis nostris uti, sententiis tuis. Universa enim illorum ratione cum tota vestra confligendum puto. Aliena dixit in physicis nec ea ipsa, quae tibi probarentur; Duo Reges: constructio interrete. Roges enim Aristonem, bonane ei videantur haec: vacuitas doloris, divitiae, valitudo; Nondum autem explanatum satis, erat, quid maxime natura vellet. \n\n','2016-02-14 08:47:50','2016-02-14 23:54:36',NULL,NULL,0,1,0),(2615,1,1,1,'Vendors',' Facit enim ille duo seiuncta ultima bonorum, quae ut essent vera, coniungi debuerunt; Quare attende, quaeso. Cur id non ita fit? Vitae autem degendae ratio maxime quidem illis placuit quieta. Duo Reges: constructio interrete. Si stante, hoc natura videlicet vult, salvam esse se, quod concedimus; \n\n','2016-02-14 08:47:50','2016-02-14 23:54:36',NULL,NULL,0,1,0),(2616,1,1,1,'Products',' Quis non odit sordidos, vanos, leves, futtiles? Dicet pro me ipsa virtus nec dubitabit isti vestro beato M. Stuprata per vim Lucretia a regis filio testata civis se ipsa interemit. Ea possunt paria non esse. Ut id aliis narrare gestiant? Duo Reges: constructio interrete. Idem fecisset Epicurus, si sententiam hanc, quae nunc Hieronymi est, coniunxisset cum Aristippi vetere sententia. Frater et T. \n\n','2016-02-14 12:07:14','2016-02-14 23:55:58',NULL,NULL,0,1,0),(2617,1,1,1,'Products',' Eam tum adesse, cum dolor omnis absit; Non igitur bene. Quid ergo attinet gloriose loqui, nisi constanter loquare? Quid dubitas igitur mutare principia naturae? Atqui eorum nihil est eius generis, ut sit in fine atque extrerno bonorum. Immo vero, inquit, ad beatissime vivendum parum est, ad beate vero satis. \n\n','2016-02-14 12:07:15','2016-02-14 23:55:58',NULL,NULL,0,1,0),(2618,1,1,1,'Products',' Id enim natura desiderat. Non igitur de improbo, sed de callido improbo quaerimus, qualis Q. Praeteritis, inquit, gaudeo. Quod autem in homine praestantissimum atque optimum est, id deseruit. \n\n','2016-02-14 12:07:15','2016-02-14 23:55:59',NULL,NULL,0,1,0),(2619,1,1,1,'Products',' Cupiditates non Epicuri divisione finiebat, sed sua satietate. Quid ergo attinet gloriose loqui, nisi constanter loquare? Bonum incolumis acies: misera caecitas. Eam stabilem appellas. Bonum valitudo: miser morbus. Sin laboramus, quis est, qui alienae modum statuat industriae? Iubet igitur nos Pythius Apollo noscere nosmet ipsos. Duo Reges: constructio interrete. \n\n','2016-02-14 12:07:15','2016-02-14 23:55:59',NULL,NULL,0,1,0),(2620,1,1,1,'Products',' Erit enim instructus ad mortem contemnendam, ad exilium, ad ipsum etiam dolorem. In qua quid est boni praeter summam voluptatem, et eam sempiternam? Quid de Platone aut de Democrito loquar? Ita relinquet duas, de quibus etiam atque etiam consideret. Haec igitur Epicuri non probo, inquam. Duo Reges: constructio interrete. Negat enim summo bono afferre incrementum diem. Illi enim inter se dissentiunt. Aliud igitur esse censet gaudere, aliud non dolere. Quare ad ea primum, si videtur; Comprehensum, quod cognitum non habet? \n\n','2016-02-14 12:07:16','2016-02-14 23:55:59',NULL,NULL,0,1,0),(2621,1,1,1,'Products',' Quamvis enim depravatae non sint, pravae tamen esse possunt. Qua tu etiam inprudens utebare non numquam. At enim sequor utilitatem. Sed plane dicit quod intellegit. Non autem hoc: igitur ne illud quidem. Duo Reges: constructio interrete. Suo enim quisque studio maxime ducitur. Universa enim illorum ratione cum tota vestra confligendum puto. Quae similitudo in genere etiam humano apparet. Sed plane dicit quod intellegit. \n\n','2016-02-14 12:07:16','2016-02-14 23:56:00',NULL,NULL,0,1,0),(2622,1,1,1,'Products',' Consequentia exquirere, quoad sit id, quod volumus, effectum. Quid enim est a Chrysippo praetermissum in Stoicis? Sed erat aequius Triarium aliquid de dissensione nostra iudicare. Aliter homines, aliter philosophos loqui putas oportere? \n\n','2016-02-14 12:07:16','2016-02-14 23:56:00',NULL,NULL,0,1,0),(2623,1,1,1,'Products',' Quem Tiberina descensio festo illo die tanto gaudio affecit, quanto L. Totum autem id externum est, et quod externum, id in casu est. Cur post Tarentum ad Archytam? Expectoque quid ad id, quod quaerebam, respondeas. \n\n','2016-02-14 12:07:17','2016-02-14 23:56:00',NULL,NULL,0,1,0),(2624,1,1,1,'Products',' Eiuro, inquit adridens, iniquum, hac quidem de re; Age nunc isti doceant, vel tu potius quis enim ista melius? Virtutis, magnitudinis animi, patientiae, fortitudinis fomentis dolor mitigari solet. Quo plebiscito decreta a senatu est consuli quaestio Cn. Quae cum essent dicta, discessimus. Deinde prima illa, quae in congressu solemus: Quid tu, inquit, huc? Servari enim iustitia nisi a forti viro, nisi a sapiente non potest. Duo Reges: constructio interrete. An ea, quae per vinitorem antea consequebatur, per se ipsa curabit? Tum Piso: Atqui, Cicero, inquit, ista studia, si ad imitandos summos viros spectant, ingeniosorum sunt; \n\n','2016-02-14 12:07:17','2016-02-14 23:56:01',NULL,NULL,0,1,0),(2625,1,1,1,'Products',' Ut optime, secundum naturam affectum esse possit. Paulum, cum regem Persem captum adduceret, eodem flumine invectio? Sin laboramus, quis est, qui alienae modum statuat industriae? Duo Reges: constructio interrete. Si longus, levis dictata sunt. Verba tu fingas et ea dicas, quae non sentias? Qui autem esse poteris, nisi te amor ipse ceperit? Nam et complectitur verbis, quod vult, et dicit plane, quod intellegam; Pisone in eo gymnasio, quod Ptol