us, comparandam et cognitionem habent faciliorem. \n\n','2016-02-15 22:35:54','2016-02-15 00:01:22',NULL,NULL,0,1,0),(2719,1,1,1,'HelpDesk',' Si quicquam extra virtutem habeatur in bonis. Nam aliquando posse recte fieri dicunt nulla expectata nec quaesita voluptate. Quod quidem iam fit etiam in Academia. At iam decimum annum in spelunca iacet. Rationis enim perfectio est virtus; Duo Reges: constructio interrete. \n\n','2016-02-15 22:35:54','2016-02-15 00:01:23',NULL,NULL,0,1,0),(2720,1,1,1,'HelpDesk',' Quem Tiberina descensio festo illo die tanto gaudio affecit, quanto L. Quid est igitur, cur ita semper deum appellet Epicurus beatum et aeternum? Si quicquam extra virtutem habeatur in bonis. Cum audissem Antiochum, Brute, ut solebam, cum M. Ita graviter et severe voluptatem secrevit a bono. Magna laus. Duo Reges: constructio interrete. \n\n','2016-02-15 22:35:54','2016-02-15 00:01:23',NULL,NULL,0,1,0),(2721,1,1,1,'HelpDesk',' Sed quod proximum fuit non vidit. Quare attende, quaeso. Neque enim civitas in seditione beata esse potest nec in discordia dominorum domus; Videsne quam sit magna dissensio? Duo Reges: constructio interrete. An dolor longissimus quisque miserrimus, voluptatem non optabiliorem diuturnitas facit? Compensabatur, inquit, cum summis doloribus laetitia. Nunc de hominis summo bono quaeritur; An dolor longissimus quisque miserrimus, voluptatem non optabiliorem diuturnitas facit? Quod non faceret, si in voluptate summum bonum poneret. Quo modo autem philosophus loquitur? Illum mallem levares, quo optimum atque humanissimum virum, Cn. \n\n','2016-02-15 22:35:55','2016-02-15 00:01:24',NULL,NULL,0,1,0),(2722,1,1,1,'HelpDesk',' Quamquam haec quidem praeposita recte et reiecta dicere licebit. Age, inquies, ista parva sunt. Iis igitur est difficilius satis facere, qui se Latina scripta dicunt contemnere. Te enim iudicem aequum puto, modo quae dicat ille bene noris. Ita fit beatae vitae domina fortuna, quam Epicurus ait exiguam intervenire sapienti. Duo Reges: