,'2016-02-15 08:32:32','2016-02-15 08:32:32',NULL,NULL,0,1,0),(4057,1,1,1,'InventoryDetails','','2016-02-15 08:32:33','2016-02-15 08:32:33',NULL,NULL,0,1,0),(4058,1,1,1,'InventoryDetails','','2016-02-15 08:32:33','2016-02-15 08:32:33',NULL,NULL,0,1,0),(4059,1,1,1,'InventoryDetails','','2016-02-15 08:32:33','2016-02-15 08:32:33',NULL,NULL,0,1,0),(4060,1,1,1,'InventoryDetails','','2016-02-15 08:32:33','2016-02-15 08:32:33',NULL,NULL,0,1,0),(4061,1,1,1,'InventoryDetails','','2016-02-15 08:32:34','2016-02-15 08:32:34',NULL,NULL,0,1,0),(4062,1,1,1,'Assets',' Neque solum ea communia, verum etiam paria esse dixerunt. Si quicquam extra virtutem habeatur in bonis. Stoicos roga. A primo, ut opinor, animantium ortu petitur origo summi boni. \n\n','2016-01-26 09:15:44','2016-02-15 09:36:15',NULL,NULL,0,1,0),(4063,1,1,1,'Assets',' Sin laboramus, quis est, qui alienae modum statuat industriae? Nunc omni virtuti vitium contrario nomine opponitur. Itaque eos id agere, ut a se dolores, morbos, debilitates repellant. Duo Reges: constructio interrete. Illa argumenta propria videamus, cur omnia sint paria peccata. Et ais, si una littera commota sit, fore tota ut labet disciplina. Et ille ridens: Video, inquit, quid agas; \n\n','2016-01-26 09:15:44','2016-02-15 09:36:16',NULL,NULL,0,1,0),(4064,1,1,1,'Accounts','','2016-02-15 09:36:16','2016-02-15 09:36:16',NULL,NULL,0,1,0),(4065,1,1,1,'Assets',' Atque haec ita iustitiae propria sunt, ut sint virtutum reliquarum communia. Te ipsum, dignissimum maioribus tuis, voluptasne induxit, ut adolescentulus eriperes P. Tum Piso: Quoniam igitur aliquid omnes, quid Lucius noster? Negare non possum. Habent enim et bene longam et satis litigiosam disputationem. Itaque his sapiens semper vacabit. \n\n','2016-01-26 09:15:45','2016-02-15 09:36:17',NULL,NULL,0,1,0),(4066,1,1,1,'Assets',' Nunc ita separantur, ut disiuncta sint, quo nihil potest esse perversius. Neque enim disputari sine reprehensione nec cum iracundia aut pertinacia recte disputari potest. De vacuitate doloris eadem sententia erit. Inde sermone vario sex illa a Dipylo stadia confecimus. Qui est in parvis malis. Non potes, nisi retexueris illa. Duo Reges: constructio interrete. Magna laus. Callipho ad virtutem nihil adiunxit nisi voluptatem, Diodorus vacuitatem doloris. Tu enim ista lenius, hic Stoicorum more nos vexat. At eum nihili facit; \n\n','2016-01-26 09:15:46','2016-02-15 09:36:17',NULL,NULL,0,1,0),(4067,1,1,1,'Accounts','','2016-02-15 09:36:17','2016-02-15 09:36:17',NULL,NULL,0,1,0),(4068,1,1,1,'Assets',' Quae si potest singula consolando levare, universa quo modo sustinebit? Nam Pyrrho, Aristo, Erillus iam diu abiecti. Sapiens autem semper beatus est et est aliquando in dolore; Duo Reges: constructio interrete. O magnam vim ingenii causamque iustam, cur nova existeret disciplina! Perge porro. Laelius clamores sofòw ille so lebat Edere compellans gumias ex ordine nostros. Ut optime, secundum naturam affectum esse possit. Cum autem negant ea quicquam ad beatam vitam pertinere, rursus naturam relinquunt. \n\n','2016-01-26 09:15:46','2016-02-15 09:36:18',NULL,NULL,0,1,0),(4069,1,1,1,'Assets',' Quae rursus dum sibi evelli ex ordine nolunt, horridiores evadunt, asperiores, duriores et oratione et moribus. Odium autem et invidiam facile vitabis. Portenta haec esse dicit, neque ea ratione ullo modo posse vivi; Quo studio Aristophanem putamus aetatem in litteris duxisse? Duo Reges: constructio interrete. An eum discere ea mavis, quae cum plane perdidiceriti nihil sciat? \n\n','2016-01-26 09:15:46','2016-02-15 09:36:18',NULL,NULL,0,1,0),(4070,1,1,1,'Assets',' Hanc ergo intuens debet institutum illud quasi signum absolvere. Ergo et avarus erit, sed finite, et adulter, verum habebit modum, et luxuriosus eodem modo. Tollitur beneficium, tollitur gratia, quae sunt vincla concordiae. Qui-vere falsone, quaerere mittimus-dicitur oculis se privasse; Duo Reges: constructio interrete. Gerendus est mos, modo recte sentiat. Nam adhuc, meo fortasse vitio, quid ego quaeram non perspicis. Nam et a te perfici istam disputationem volo, nec tua mihi oratio longa videri potest. \n\n','2016-01-26 09:15:47','2016-02-15 09:36:18',NULL,NULL,0,1,0),(4071,1,1,1,'Assets',' Graccho, eius fere, aequalí? Hoc est dicere: Non reprehenderem asotos, si non essent asoti. Haec dicuntur inconstantissime. Satis est ad hoc responsum. Ita multo sanguine profuso in laetitia et in victoria est mortuus. Duo Reges: constructio interrete. Aliter enim nosmet ipsos nosse non possumus. Quid enim est a Chrysippo praetermissum in Stoicis? \n\n','2016-01-26 09:15:47','2016-02-15 09:36:18',NULL,NULL,0,1,0),(4072,1,1,1,'Assets',' Consequentia exquirere, quoad sit id, quod volumus, effectum. Etenim semper illud extra est, quod arte comprehenditur. Tecum optime, deinde etiam cum mediocri amico. Rapior illuc, revocat autem Antiochus, nec est praeterea, quem audiamus. Duo Reges: constructio interrete. \n\n','2016-01-26 09:15:48','2016-02-15 09:36:19',NULL,NULL,0,1,0),(4073,1,1,1,'Accounts','','2016-02-15 09:36:19','2016-02-15 09:36:19',NULL,NULL,0,1,0),(4074,1,1,1,'Assets',' Hoc mihi cum tuo fratre convenit. Sed residamus, inquit, si placet. Quid igitur dubitamus in tota eius natura quaerere quid sit effectum? Qui-vere falsone, quaerere mittimus-dicitur oculis se privasse; Id Sextilius factum negabat. Duo Reges: constructio interrete. Sin laboramus, quis est, qui alienae modum statuat industriae? Virtutis, magnitudinis animi, patientiae, fortitudinis fomentis dolor mitigari solet. Quis est tam dissimile homini. Sine ea igitur iucunde negat posse se vivere? Sed vos squalidius, illorum vides quam niteat oratio. \n\n','2016-01-26 09:15:48','2016-02-15 09:36:19',NULL,NULL,0,1,0),(4075,1,1,1,'Assets',' Non igitur de improbo, sed de callido improbo quaerimus, qualis Q. Equidem, sed audistine modo de Carneade? Sed tamen est aliquid, quod nobis non liceat, liceat illis. Ut in voluptate sit, qui epuletur, in dolore, qui torqueatur. Ita multa dicunt, quae vix intellegam. Consequentia exquirere, quoad sit id, quod volumus, effectum. Duo Reges: constructio interrete. Haec dicuntur inconstantissime. Ut pulsi recurrant? Aliter homines, aliter philosophos loqui putas oportere? Urgent tamen et nihil remittunt. His singulis copiose responderi solet, sed quae perspicua sunt longa esse non debent. \n\n','2016-01-26 09:15:48','2016-02-15 09:36:20',NULL,NULL,0,1,0),(4076,1,1,1,'Assets',' Non est igitur summum malum dolor. De vacuitate doloris eadem sententia erit. Sed ad illum redeo. Sit hoc ultimum bonorum, quod nunc a me defenditur; Quo studio Aristophanem putamus aetatem in litteris duxisse? Quod idem cum vestri faciant, non satis magnam tribuunt inventoribus gratiam. \n\n','2016-01-26 09:15:49','2016-02-15 09:36:20',NULL,NULL,0,1,0),(4077,1,1,1,'Assets',' Res enim se praeclare habebat, et quidem in utraque parte. Longum est enim ad omnia respondere, quae a te dicta sunt. Roges enim Aristonem, bonane ei videantur haec: vacuitas doloris, divitiae, valitudo; Quod totum contra est. Quamquam in hac divisione rem ipsam prorsus probo, elegantiam desidero. Ut in voluptate sit, qui epuletur, in dolore, qui torqueatur. Duo Reges: constructio interrete. Non enim iam stirpis bonum quaeret, sed animalis. \n\n','2016-01-26 09:15:49','2016-02-15 09:36:21',NULL,NULL,0,1,0),(4078,1,1,1,'Assets',' An vero, inquit, quisquam potest probare, quod perceptfum, quod. Quod autem satis est, eo quicquid accessit, nimium est; Tollitur beneficium, tollitur gratia, quae sunt vincla concordiae. Expectoque quid ad id, quod quaerebam, respondeas. Quid est igitur, inquit, quod requiras? \n\n','2016-01-26 09:15:49','2016-02-15 09:36:21',NULL,NULL,0,1,0),(4079,1,1,1,'Accounts','','2016-02-15 09:36:22','2016-02-15 09:36:22',NULL,NULL,0,1,0),(4080,1,1,1,'Assets',' Cum autem negant ea quicquam ad beatam vitam pertinere, rursus naturam relinquunt. Parvi enim primo ortu sic iacent, tamquam omnino sine animo sint. Non est ista, inquam, Piso, magna dissensio. Compensabatur, inquit, cum summis doloribus laetitia. Est enim tanti philosophi tamque nobilis audacter sua decreta defendere. An dubium est, quin virtus ita maximam partem optineat in rebus humanis, ut reliquas obruat? \n\n','2016-01-26 09:15:50','2016-02-15 09:36:22',NULL,NULL,0,1,0),(4081,1,1,1,'Assets',' Et nunc quidem quod eam tuetur, ut de vite potissimum loquar, est id extrinsecus; Quae quidem sapientes sequuntur duce natura tamquam videntes; Hic nihil fuit, quod quaereremus. Quacumque enim ingredimur, in aliqua historia vestigium ponimus. Scio enim esse quosdam, qui quavis lingua philosophari possint; Duo Reges: constructio interrete. Idem iste, inquam, de voluptate quid sentit? Hanc ergo intuens debet institutum illud quasi signum absolvere. Non est enim vitium in oratione solum, sed etiam in moribus. Mihi enim satis est, ipsis non satis. Ergo ita: non posse honeste vivi, nisi honeste vivatur? Universa enim illorum ratione cum tota vestra confligendum puto. \n\n','2016-01-26 09:15:50','2016-02-15 09:36:23',NULL,NULL,0,1,0),(4082,1,1,1,'Assets',' Cum ageremus, inquit, vitae beatum et eundem supremum diem, scribebamus haec. Ergo id est convenienter naturae vivere, a natura discedere. At hoc in eo M. Bonum incolumis acies: misera caecitas. Quod cum dixissent, ille contra. Duo Reges: constructio interrete. \n\n','2016-01-26 09:15:50','2016-02-15 09:36:23',NULL,NULL,0,1,0),(4083,1,1,1,'Accounts','','2016-02-15 09:36:23','2016-02-15 09:36:23',NULL,NULL,0,1,0),(4084,1,1,1,'Assets',' Itaque in rebus minime obscuris non multus est apud eos disserendi labor. Quod ea non occurrentia fingunt, vincunt Aristonem; Nullum inveniri verbum potest quod magis idem declaret Latine, quod Graece, quam declarat voluptas. Certe, nisi voluptatem tanti aestimaretis. Nam, ut sint illa vendibiliora, haec uberiora certe sunt. Hoc dictum in una re latissime patet, ut in omnibus factis re, non teste moveamur. \n\n','2016-01-26 09:15:51','2016-02-15 09:36:24',NULL,NULL,0,1,0),(4085,1,1,1,'Assets',' Philosophi autem in suis lectulis plerumque moriuntur. Qua tu etiam inprudens utebare non numquam. Primum Theophrasti, Strato, physicum se voluit; Nos autem non solum beatae vitae istam esse oblectationem videmus, sed etiam levamentum miseriarum. An ea, quae per vinitorem antea consequebatur, per se ipsa curabit? \n\n','2016-01-26 09:15:51','2016-02-15 09:36:24',NULL,NULL,0,1,0),(4086,1,1,1,'Assets',' Hoc etsi multimodis reprehendi potest, tamen accipio, quod dant. Tu enim ista lenius, hic Stoicorum more nos vexat. Facit igitur Lucius noster prudenter, qui audire de summo bono potissimum velit; Polemoni et iam ante Aristoteli ea prima visa sunt, quae paulo ante dixi. Duo Reges: constructio interrete. Utilitatis causa amicitia est quaesita. \n\n','2016-01-26 09:15:51','2016-02-15 09:36:24',NULL,NULL,0,1,0),(4087,1,1,1,'Assets',' Oculorum, inquit Plato, est in nobis sensus acerrimus, quibus sapientiam non cernimus. Quicquid enim a sapientia proficiscitur, id continuo debet expletum esse omnibus suis partibus; Tanta vis admonitionis inest in locis; Ergo hoc quidem apparet, nos ad agendum esse natos. \n\n','2016-01-26 09:15:52','2016-02-15 09:36:25',NULL,NULL,0,1,0),(4088,1,1,1,'Assets',' Omnis enim est natura diligens sui. Hoc loco tenere se Triarius non potuit. Parvi enim primo ortu sic iacent, tamquam omnino sine animo sint. Qua tu etiam inprudens utebare non numquam. Que Manilium, ab iisque M. \n\n','2016-01-26 09:15:52','2016-02-15 09:36:25',NULL,NULL,0,1,0),(4089,1,1,1,'Assets',' Polycratem Samium felicem appellabant. Varietates autem iniurasque fortunae facile veteres philosophorum praeceptis instituta vita superabat. Quod quidem nobis non saepe contingit. Bonum liberi: misera orbitas. Sed quid sentiat, non videtis. Summus dolor plures dies manere non potest? Non semper, inquam; \n\n','2016-01-26 09:15:52','2016-02-15 09:36:25',NULL,NULL,0,1,0),(4090,1,1,1,'Assets',' Aperiendum est igitur, quid sit voluptas; Quamquam in hac divisione rem ipsam prorsus probo, elegantiam desidero. Tum Torquatus: Prorsus, inquit, assentior; Itaque hic ipse iam pridem est reiectus; \n\n','2016-01-26 09:15:53','2016-02-15 09:36:26',NULL,NULL,0,1,0),(4091,1,1,1,'Assets',' Quorum sine causa fieri nihil putandum est. Me igitur ipsum ames oportet, non mea, si veri amici futuri sumus. \n\n','2016-01-26 09:15:53','2016-02-15 09:36:26',NULL,NULL,0,1,0),(4092,1,1,1,'Assets',' Invidiosum nomen est, infame, suspectum. Ita enim vivunt quidam, ut eorum vita refellatur oratio. Duo Reges: constructio interrete. Quare ad ea primum, si videtur; \n\n','2016-01-26 09:15:53','2016-02-15 09:36:26',NULL,NULL,0,1,0),(4093,1,1,1,'Assets',' At iam decimum annum in spelunca iacet. Si verbum sequimur, primum longius verbum praepositum quam bonum. Indicant pueri, in quibus ut in speculis natura cernitur. Sed erat aequius Triarium aliquid de dissensione nostra iudicare. \n\n','2016-01-26 09:15:54','2016-02-15 09:36:26',NULL,NULL,0,1,0),(4094,1,1,1,'Assets',' An ea, quae per vinitorem antea consequebatur, per se ipsa curabit? Quod si ita sit, cur opera philosophiae sit danda nescio. Qui autem de summo bono dissentit de tota philosophiae ratione dissentit. Cur igitur, cum de re conveniat, non malumus usitate loqui? \n\n','2016-01-26 09:15:54','2016-02-15 09:36:27',NULL,NULL,0,1,0),(4095,1,1,1,'Accounts','','2016-02-15 09:36:27','2016-02-15 09:36:27',NULL,NULL,0,1,0),(4096,1,1,1,'Assets',' Est enim effectrix multarum et magnarum voluptatum. Nemo nostrum istius generis asotos iucunde putat vivere. Illud non continuo, ut aeque incontentae. Si enim ita est, vide ne facinus facias, cum mori suadeas. Ea possunt paria non esse. Duo Reges: constructio interrete. Si longus, levis; Sed ad bona praeterita redeamus. \n\n','2016-01-26 09:15:54','2016-02-15 09:36:28',NULL,NULL,0,1,0),(4097,1,1,1,'Assets',' Quis animo aequo videt eum, quem inpure ac flagitiose putet vivere? Potius inflammat, ut coercendi magis quam dedocendi esse videantur. Si quicquam extra virtutem habeatur in bonis. At coluit ipse amicitias. Duo Reges: constructio interrete. Idem etiam dolorem saepe perpetiuntur, ne, si id non faciant, incidant in maiorem. Cum ageremus, inquit, vitae beatum et eundem supremum diem, scribebamus haec. Atqui iste locus est, Piso, tibi etiam atque etiam confirmandus, inquam; Ecce aliud simile dissimile. Indicant pueri, in quibus ut in speculis natura cernitur. \n\n','2016-01-26 09:15:55','2016-02-15 09:36:28',NULL,NULL,0,1,0),(4098,1,1,1,'Assets',' Sed quia studebat laudi et dignitati, multum in virtute processerat. Sed ego in hoc resisto; Immo videri fortasse. Qua tu etiam inprudens utebare non numquam. Quis suae urbis conservatorem Codrum, quis Erechthei filias non maxime laudat? ALIO MODO. Duo Reges: constructio interrete. \n\n','2016-01-26 09:15:55','2016-02-15 09:36:28',NULL,NULL,0,1,0),(4099,1,1,1,'Assets',' Sed haec omittamus; Duo Reges: constructio interrete. Non minor, inquit, voluptas percipitur ex vilissimis rebus quam ex pretiosissimis. Philosophi autem in suis lectulis plerumque moriuntur. Quid autem habent admirationis, cum prope accesseris? \n\n','2016-01-26 09:15:55','2016-02-15 09:36:29',NULL,NULL,0,1,0),(4100,1,1,1,'Assets',' Quae duo sunt, unum facit. Hic ambiguo ludimur. Innumerabilia dici possunt in hanc sententiam, sed non necesse est. Servari enim iustitia nisi a forti viro, nisi a sapiente non potest. Cum salvum esse flentes sui respondissent, rogavit essentne fusi hostes. Duo Reges: constructio interrete. Quid ergo aliud intellegetur nisi uti ne quae pars naturae neglegatur? \n\n','2016-01-26 09:15:56','2016-02-15 09:36:29',NULL,NULL,0,1,0),(4101,1,1,1,'Assets',' Quod autem satis est, eo quicquid accessit, nimium est; Isto modo ne improbos quidem, si essent boni viri. Itaque hic ipse iam pridem est reiectus; Quaerimus enim finem bonorum. Intellegi quidem, ut propter aliam quampiam rem, verbi gratia propter voluptatem, nos amemus; Inde sermone vario sex illa a Dipylo stadia confecimus. Duo Reges: constructio interrete. \n\n','2016-01-26 09:15:56','2016-02-15 09:36:29',NULL,NULL,0,1,0),(4102,1,1,1,'Assets',' Atqui reperies, inquit, in hoc quidem pertinacem; Pauca mutat vel plura sane; Itaque vides, quo modo loquantur, nova verba fingunt, deserunt usitata. Equidem e Cn. Illa videamus, quae a te de amicitia dicta sunt. Duo Reges: constructio interrete. Qui non moveatur et offensione turpitudinis et comprobatione honestatis? Illum mallem levares, quo optimum atque humanissimum virum, Cn. Sed haec omittamus; Quod eo liquidius faciet, si perspexerit rerum inter eas verborumne sit controversia. \n\n','2016-01-26 09:15:56','2016-02-15 09:36:30',NULL,NULL,0,1,0),(4103,1,1,1,'Assets',' Ita enim vivunt quidam, ut eorum vita refellatur oratio. Ut scias me intellegere, primum idem esse dico voluptatem, quod ille don. Duo Reges: constructio interrete. Quid censes in Latino fore? Quod cum accidisset ut alter alterum necopinato videremus, surrexit statim. Cur igitur, inquam, res tam dissimiles eodem nomine appellas? \n\n','2016-01-26 09:15:57','2016-02-15 09:36:30',NULL,NULL,0,1,0),(4104,1,1,1,'Assets',' Et ille ridens: Video, inquit, quid agas; Idem adhuc; Nam his libris eum malo quam reliquo ornatu villae delectari. Ea possunt paria non esse. Videmusne ut pueri ne verberibus quidem a contemplandis rebus perquirendisque deterreantur? An eum discere ea mavis, quae cum plane perdidiceriti nihil sciat? \n\n','2016-01-26 09:15:57','2016-02-15 09:36:30',NULL,NULL,0,1,0),(4105,1,1,1,'Assets',' Ex quo, id quod omnes expetunt, beate vivendi ratio inveniri et comparari potest. Duo Reges: constructio interrete. Quid iudicant sensus? Quis enim potest ea, quae probabilia videantur ei, non probare? Illis videtur, qui illud non dubitant bonum dicere -; Plane idem, inquit, et maxima quidem, qua fieri nulla maior potest. Quia dolori non voluptas contraria est, sed doloris privatio. \n\n','2016-01-26 09:15:57','2016-02-15 09:36:30',NULL,NULL,0,1,0),(4106,1,1,1,'Assets',' Sed haec quidem liberius ab eo dicuntur et saepius. Nec vero alia sunt quaerenda contra Carneadeam illam sententiam. Duo Reges: constructio interrete. Familiares nostros, credo, Sironem dicis et Philodemum, cum optimos viros, tum homines doctissimos. Praeterea sublata cognitione et scientia tollitur omnis ratio et vitae degendae et rerum gerendarum. Ita fit cum gravior, tum etiam splendidior oratio. Eadem nunc mea adversum te oratio est. \n\n','2016-01-26 09:15:58','2016-02-15 09:36:31',NULL,NULL,0,1,0),(4107,1,1,1,'Assets',' Utinam quidem dicerent alium alio beatiorem! Iam ruinas videres. Non enim, si omnia non sequebatur, idcirco non erat ortus illinc. Eam tum adesse, cum dolor omnis absit; Quarum ambarum rerum cum medicinam pollicetur, luxuriae licentiam pollicetur. Et quod est munus, quod opus sapientiae? Duo Reges: constructio interrete. Heri, inquam, ludis commissis ex urbe profectus veni ad vesperum. \n\n','2016-01-26 09:15:58','2016-02-15 09:36:32',NULL,NULL,0,1,0),(4108,1,1,1,'Assets',' Quibus ego vehementer assentior. Poterat autem inpune; Frater et T. Duo Reges: constructio interrete. Equidem etiam Epicurum, in physicis quidem, Democriteum puto. Sed quid minus probandum quam esse aliquem beatum nec satis beatum? Summum ením bonum exposuit vacuitatem doloris; \n\n','2016-01-26 09:15:58','2016-02-15 09:36:32',NULL,NULL,0,1,0),(4109,1,1,1,'Assets',' Sit enim idem caecus, debilis. Ipse Epicurus fortasse redderet, ut Sextus Peducaeus, Sex. Quis istud possit, inquit, negare? Duo Reges: constructio interrete. \n\n','2016-01-26 09:15:59','2016-02-15 09:36:32',NULL,NULL,0,1,0),(4110,1,1,1,'Assets',' Atque hoc loco similitudines eas, quibus illi uti solent, dissimillimas proferebas. Ratio enim nostra consentit, pugnat oratio. At iam decimum annum in spelunca iacet. Suo genere perveniant ad extremum; Quoniam, si dis placet, ab Epicuro loqui discimus. Sed vos squalidius, illorum vides quam niteat oratio. \n\n','2016-01-26 09:15:59','2016-02-15 09:36:33',NULL,NULL,0,1,0),(4111,1,1,1,'Assets',' Collige omnia, quae soletis: Praesidium amicorum. Nam diligi et carum esse iucundum est propterea, quia tutiorem vitam et voluptatem pleniorem efficit. At coluit ipse amicitias. Quid Zeno? Duo Reges: constructio interrete. Nam quid possumus facere melius? Quae quidem vel cum periculo est quaerenda vobis; Quae tamen a te agetur non melior, quam illae sunt, quas interdum optines. \n\n','2016-01-26 09:15:59','2016-02-15 09:36:33',NULL,NULL,0,1,0),(4112,1,1,1,'Assets',' Quo modo autem optimum, si bonum praeterea nullum est? Qui igitur convenit ab alia voluptate dicere naturam proficisci, in alia summum bonum ponere? Quia nec honesto quic quam honestius nec turpi turpius. Et quod est munus, quod opus sapientiae? Quae quo sunt excelsiores, eo dant clariora indicia naturae. Quid enim me prohiberet Epicureum esse, si probarem, quae ille diceret? Equidem soleo etiam quod uno Graeci, si aliter non possum, idem pluribus verbis exponere. \n\n','2016-01-26 09:16:00','2016-02-15 09:36:33',NULL,NULL,0,1,0),(4113,1,1,1,'Assets',' Quis enim est, qui non videat haec esse in natura rerum tria? Ita credo. Facit enim ille duo seiuncta ultima bonorum, quae ut essent vera, coniungi debuerunt; Primum quid tu dicis breve? Sed fac ista esse non inportuna; Tu autem, si tibi illa probabantur, cur non propriis verbis ea tenebas? Duo Reges: constructio interrete. \n\n','2016-01-26 09:16:00','2016-02-15 09:36:34',NULL,NULL,0,1,0),(4114,1,1,1,'Assets',' Semper enim ex eo, quod maximas partes continet latissimeque funditur, tota res appellatur. Negat enim summo bono afferre incrementum diem. Sed ad haec, nisi molestum est, habeo quae velim. An dolor longissimus quisque miserrimus, voluptatem non optabiliorem diuturnitas facit? Nihilo beatiorem esse Metellum quam Regulum. Qui est in parvis malis. Duo Reges: constructio interrete. \n\n','2016-01-26 09:16:00','2016-02-15 09:36:34',NULL,NULL,0,1,0),(4115,1,1,1,'Assets',' Solum praeterea formosum, solum liberum, solum civem, stultost; Quam illa ardentis amores excitaret sui! Cur tandem? Graece donan, Latine voluptatem vocant. Sed tu istuc dixti bene Latine, parum plane. Duo Reges: constructio interrete. Quae quo sunt excelsiores, eo dant clariora indicia naturae. \n\n','2016-01-26 09:16:01','2016-02-15 09:36:34',NULL,NULL,0,1,0),(4116,1,1,1,'Assets',' Duo Reges: constructio interrete. Si quae forte-possumus. Num igitur utiliorem tibi hunc Triarium putas esse posse, quam si tua sint Puteolis granaria? Nihil sane. At ille pellit, qui permulcet sensum voluptate. \n\n','2016-01-26 09:16:01','2016-02-15 09:36:35',NULL,NULL,0,1,0),(4117,1,1,1,'Assets',' Mihi enim satis est, ipsis non satis. Hoc etsi multimodis reprehendi potest, tamen accipio, quod dant. Aperiendum est igitur, quid sit voluptas; Cur, nisi quod turpis oratio est? Res enim se praeclare habebat, et quidem in utraque parte. Sic enim censent, oportunitatis esse beate vivere. Duo Reges: constructio interrete. Sin te auctoritas commovebat, nobisne omnibus et Platoni ipsi nescio quem illum anteponebas? Hos contra singulos dici est melius. \n\n','2016-01-26 09:16:01','2016-02-15 09:36:35',NULL,NULL,0,1,0),(4118,1,1,1,'Assets',' Et homini, qui ceteris animantibus plurimum praestat, praecipue a natura nihil datum esse dicemus? Sin kakan malitiam dixisses, ad aliud nos unum certum vitium consuetudo Latina traduceret. At cum de plurimis eadem dicit, tum certe de maximis. Intellegi quidem, ut propter aliam quampiam rem, verbi gratia propter voluptatem, nos amemus; Quae quidem vel cum periculo est quaerenda vobis; Duo Reges: constructio interrete. Erat enim Polemonis. Quacumque enim ingredimur, in aliqua historia vestigium ponimus. Fortasse id optimum, sed ubi illud: Plus semper voluptatis? \n\n','2016-01-26 09:16:02','2016-02-15 09:36:35',NULL,NULL,0,1,0),(4119,1,1,1,'Assets',' His singulis copiose responderi solet, sed quae perspicua sunt longa esse non debent. Minime vero, inquit ille, consentit. Sic, et quidem diligentius saepiusque ista loquemur inter nos agemusque communiter. Collige omnia, quae soletis: Praesidium amicorum. \n\n','2016-01-26 09:16:02','2016-02-15 09:36:36',NULL,NULL,0,1,0),(4120,1,1,1,'Assets',' At coluit ipse amicitias. Itaque vides, quo modo loquantur, nova verba fingunt, deserunt usitata. Istam voluptatem perpetuam quis potest praestare sapienti? Sed ille, ut dixi, vitiose. Similiter sensus, cum accessit ad naturam, tuetur illam quidem, sed etiam se tuetur; Duo Reges: constructio interrete. Sed tamen intellego quid velit. Sed plane dicit quod intellegit. \n\n','2016-01-26 09:16:02','2016-02-15 09:36:36',NULL,NULL,0,1,0),(4121,1,1,1,'Assets',' Utrum igitur tibi litteram videor an totas paginas commovere? Universa enim illorum ratione cum tota vestra confligendum puto. Quae cum praeponunt, ut sit aliqua rerum selectio, naturam videntur sequi; Quod autem in homine praestantissimum atque optimum est, id deseruit. Duo Reges: constructio interrete. Post enim Chrysippum eum non sane est disputatum. \n\n','2016-01-26 09:16:03','2016-02-15 09:36:36',NULL,NULL,0,1,0),(4122,1,1,1,'Assets',' Quod quidem nobis non saepe contingit. Nihil enim iam habes, quod ad corpus referas; Hoc est non dividere, sed frangere. Deque his rebus satis multa in nostris de re publica libris sunt dicta a Laelio. Cum id quoque, ut cupiebat, audivisset, evelli iussit eam, qua erat transfixus, hastam. Duo Reges: constructio interrete. Quae in controversiam veniunt, de iis, si placet, disseramus. Nunc vides, quid faciat. An potest cupiditas finiri? Ita enim vivunt quidam, ut eorum vita refellatur oratio. \n\n','2016-01-26 09:16:03','2016-02-15 09:36:36',NULL,NULL,0,1,0),(4123,1,1,1,'Assets',' Conferam avum tuum Drusum cum C. Magna laus. Varietates autem iniurasque fortunae facile veteres philosophorum praeceptis instituta vita superabat. Legimus tamen Diogenem, Antipatrum, Mnesarchum, Panaetium, multos alios in primisque familiarem nostrum Posidonium. \n\n','2016-01-26 09:16:03','2016-02-15 09:36:37',NULL,NULL,0,1,0),(4124,1,1,1,'Assets',' Morbo gravissimo affectus, exul, orbus, egens, torqueatur eculeo: quem hunc appellas, Zeno? Fortemne possumus dicere eundem illum Torquatum? Dicet pro me ipsa virtus nec dubitabit isti vestro beato M. Duo Reges: constructio interrete. Hoc ne statuam quidem dicturam pater aiebat, si loqui posset. Ut aliquid scire se gaudeant? Omnia contraria, quos etiam insanos esse vultis. At modo dixeras nihil in istis rebus esse, quod interesset. \n\n','2016-01-26 09:16:04','2016-02-15 09:36:37',NULL,NULL,0,1,0),(4125,1,1,1,'Assets',' Quodsi ipsam honestatem undique pertectam atque absolutam. Duo enim genera quae erant, fecit tria. Illi enim inter se dissentiunt. Duo Reges: constructio interrete. Ergo hoc quidem apparet, nos ad agendum esse natos. Illud dico, ea, quae dicat, praeclare inter se cohaerere. Sed ad haec, nisi molestum est, habeo quae velim. Haec para/doca illi, nos admirabilia dicamus. \n\n','2016-01-26 09:16:04','2016-02-15 09:36:37',NULL,NULL,0,1,0),(4126,1,1,1,'Accounts','','2016-02-15 09:36:38','2016-02-15 09:36:38',NULL,NULL,0,1,0),(4127,1,1,1,'Assets',' Non autem hoc: igitur ne illud quidem. Aliter homines, aliter philosophos loqui putas oportere? Ergo in utroque exercebantur, eaque disciplina effecit tantam illorum utroque in genere dicendi copiam. Est autem etiam actio quaedam corporis, quae motus et status naturae congruentis tenet; Traditur, inquit, ab Epicuro ratio neglegendi doloris. Duo Reges: constructio interrete. Dolor ergo, id est summum malum, metuetur semper, etiamsi non aderit; Quae cum praeponunt, ut sit aliqua rerum selectio, naturam videntur sequi; \n\n','2016-01-26 09:16:04','2016-02-15 09:36:38',NULL,NULL,0,1,0),(4128,1,1,1,'Assets',' Duo Reges: constructio interrete. Nullus est igitur cuiusquam dies natalis. Sed haec in pueris; An quod ita callida est, ut optime possit architectari voluptates? Aliud igitur esse censet gaudere, aliud non dolere. Quae hic rei publicae vulnera inponebat, eadem ille sanabat. Ut id aliis narrare gestiant? Multa sunt dicta ab antiquis de contemnendis ac despiciendis rebus humanis; \n\n','2016-01-26 09:16:05','2016-02-15 09:36:39',NULL,NULL,0,1,0),(4129,1,1,1,'Assets',' Tubulum fuisse, qua illum, cuius is condemnatus est rogatione, P. Nihil enim iam habes, quod ad corpus referas; Nihilo magis. Non est igitur summum malum dolor. Id quaeris, inquam, in quo, utrum respondero, verses te huc atque illuc necesse est. Quid igitur, inquit, eos responsuros putas? Duo Reges: constructio interrete. \n\n','2016-01-26 09:16:05','2016-02-15 09:36:39',NULL,NULL,0,1,0),(4130,1,1,1,'Assets',' Tollitur beneficium, tollitur gratia, quae sunt vincla concordiae. Scisse enim te quis coarguere possit? Nec tamen ullo modo summum pecudis bonum et hominis idem mihi videri potest. An est aliquid per se ipsum flagitiosum, etiamsi nulla comitetur infamia? Haec para/doca illi, nos admirabilia dicamus. Id enim volumus, id contendimus, ut officii fructus sit ipsum officium. Respondent extrema primis, media utrisque, omnia omnibus. Duo Reges: constructio interrete. Praeclarae mortes sunt imperatoriae; Hoc ne statuam quidem dicturam pater aiebat, si loqui posset. \n\n','2016-01-26 09:16:05','2016-02-15 09:36:39',NULL,NULL,0,1,0),(4131,1,1,1,'Accounts','','2016-02-15 09:36:40','2016-02-15 09:36:40',NULL,NULL,0,1,0),(4132,1,1,1,'Assets',' Omnes enim iucundum motum, quo sensus hilaretur. Quo modo autem philosophus loquitur? Duo enim genera quae erant, fecit tria. Duo Reges: constructio interrete. Quid sequatur, quid repugnet, vident. Inde sermone vario sex illa a Dipylo stadia confecimus. \n\n','2016-01-26 09:16:06','2016-02-15 09:36:40',NULL,NULL,0,1,0),(4133,1,1,1,'Assets',' Sic vester sapiens magno aliquo emolumento commotus cicuta, si opus erit, dimicabit. Duo Reges: constructio interrete. Nunc omni virtuti vitium contrario nomine opponitur. Non dolere, inquam, istud quam vim habeat postea videro; Fortasse id optimum, sed ubi illud: Plus semper voluptatis? \n\n','2016-01-26 09:16:06','2016-02-15 09:36:41',NULL,NULL,0,1,0),(4134,1,1,1,'Assets',' Et quod est munus, quod opus sapientiae? Nihil illinc huc pervenit. Iubet igitur nos Pythius Apollo noscere nosmet ipsos. Morbo gravissimo affectus, exul, orbus, egens, torqueatur eculeo: quem hunc appellas, Zeno? Explanetur igitur. Duo Reges: constructio interrete. Age nunc isti doceant, vel tu potius quis enim ista melius? Quamquam ab iis philosophiam et omnes ingenuas disciplinas habemus; \n\n','2016-01-26 09:16:06','2016-02-15 09:36:41',NULL,NULL,0,1,0),(4135,1,1,1,'Accounts','','2016-02-15 09:36:41','2016-02-15 09:36:41',NULL,NULL,0,1,0),(4136,1,1,1,'Assets',' Sin eam, quam Hieronymus, ne fecisset idem, ut voluptatem illam Aristippi in prima commendatione poneret. Idemque diviserunt naturam hominis in animum et corpus. Non enim, si omnia non sequebatur, idcirco non erat ortus illinc. Duo Reges: constructio interrete. Quae cum magnifice primo dici viderentur, considerata minus probabantur. Qui autem esse poteris, nisi te amor ipse ceperit? \n\n','2016-01-26 09:16:07','2016-02-15 09:36:42',NULL,NULL,0,1,0),(4137,1,1,1,'Assets',' Quid est enim aliud esse versutum? Animum autem reliquis rebus ita perfecit, ut corpus; Ita fit beatae vitae domina fortuna, quam Epicurus ait exiguam intervenire sapienti. Cum salvum esse flentes sui respondissent, rogavit essentne fusi hostes. Duo Reges: constructio interrete. Refert tamen, quo modo. Sic consequentibus vestris sublatis prima tolluntur. Negare non possum. \n\n','2016-01-26 09:16:07','2016-02-15 09:36:42',NULL,NULL,0,1,0),(4138,1,1,1,'Assets',' Comprehensum, quod cognitum non habet? Istic sum, inquit. Quasi vero, inquit, perpetua oratio rhetorum solum, non etiam philosophorum sit. \n\n','2016-01-26 09:16:07','2016-02-15 09:36:43',NULL,NULL,0,1,0),(4139,1,1,1,'Assets',' Ergo id est convenienter naturae vivere, a natura discedere. Consequens enim est et post oritur, ut dixi. Traditur, inquit, ab Epicuro ratio neglegendi doloris. Dic in quovis conventu te omnia facere, ne doleas. \n\n','2016-01-26 09:16:08','2016-02-15 09:36:43',NULL,NULL,0,1,0),(4140,1,1,1,'Assets',' An me, inquam, nisi te audire vellem, censes haec dicturum fuisse? Non quaeritur autem quid naturae tuae consentaneum sit, sed quid disciplinae. Refert tamen, quo modo. Tanta vis admonitionis inest in locis; Efficiens dici potest. Sedulo, inquam, faciam. Quid autem habent admirationis, cum prope accesseris? \n\n','2016-01-26 09:16:08','2016-02-15 09:36:44',NULL,NULL,0,1,0),(4141,1,1,1,'Accounts','','2016-02-15 09:36:44','2016-02-15 09:36:44',NULL,NULL,0,1,0),(4142,1,1,1,'Assets',' At enim, qua in vita est aliquid mali, ea beata esse non potest. Nihil acciderat ei, quod nollet, nisi quod anulum, quo delectabatur, in mari abiecerat. Quid, de quo nulla dissensio est? Sed ad bona praeterita redeamus. Qui ita affectus, beatum esse numquam probabis; Istic sum, inquit. Duo Reges: constructio interrete. Ergo in gubernando nihil, in officio plurimum interest, quo in genere peccetur. Qua tu etiam inprudens utebare non numquam. \n\n','2016-01-26 09:16:08','2016-02-15 09:36:44',NULL,NULL,0,1,0),(4143,1,1,1,'Assets',' Quod si ita se habeat, non possit beatam praestare vitam sapientia. An est aliquid, quod te sua sponte delectet? Multoque hoc melius nos veriusque quam Stoici. Quid censes in Latino fore? Duo Reges: constructio interrete. Quod autem meum munus dicis non equidem recuso, sed te adiungo socium. Satis est ad hoc responsum. Et harum quidem rerum facilis est et expedita distinctio. \n\n','2016-01-26 09:16:09','2016-02-15 09:36:45',NULL,NULL,0,1,0),(4144,1,1,1,'Assets',' Qui non moveatur et offensione turpitudinis et comprobatione honestatis? Bestiarum vero nullum iudicium puto. Sin laboramus, quis est, qui alienae modum statuat industriae? Quid ad utilitatem tantae pecuniae? Quid ergo hoc loco intellegit honestum? Quid est igitur, inquit, quod requiras? Negat enim summo bono afferre incrementum diem. Duo Reges: constructio interrete. \n\n','2016-01-26 09:16:09','2016-02-15 09:36:45',NULL,NULL,0,1,0),(4145,1,1,1,'Accounts','','2016-02-15 09:36:45','2016-02-15 09:36:45',NULL,NULL,0,1,0),(4146,1,1,1,'Assets',' Quae cum praeponunt, ut sit aliqua rerum selectio, naturam videntur sequi; Nunc haec primum fortasse audientis servire debemus. Sed ut iis bonis erigimur, quae expectamus, sic laetamur iis, quae recordamur. Etiam beatissimum? Ea possunt paria non esse. Duo Reges: constructio interrete. Apud ceteros autem philosophos, qui quaesivit aliquid, tacet; Cupiditates non Epicuri divisione finiebat, sed sua satietate. \n\n','2016-01-26 09:16:09','2016-02-15 09:36:46',NULL,NULL,0,1,0),(4147,1,1,1,'Assets',' Habent enim et bene longam et satis litigiosam disputationem. Quodsi ipsam honestatem undique pertectam atque absolutam. Modo etiam paulum ad dexteram de via declinavi, ut ad Pericli sepulcrum accederem. Cur, nisi quod turpis oratio est? Quam illa ardentis amores excitaret sui! Cur tandem? Non minor, inquit, voluptas percipitur ex vilissimis rebus quam ex pretiosissimis. Quamquam te quidem video minime esse deterritum. \n\n','2016-01-26 09:16:10','2016-02-15 09:36:46',NULL,NULL,0,1,0),(4148,1,1,1,'Assets',' Eiuro, inquit adridens, iniquum, hac quidem de re; Philosophi autem in suis lectulis plerumque moriuntur. Ad quorum et cognitionem et usum iam corroborati natura ipsa praeeunte deducimur. Que Manilium, ab iisque M. Plane idem, inquit, et maxima quidem, qua fieri nulla maior potest. Audeo dicere, inquit. \n\n','2016-01-26 09:16:10','2016-02-15 09:36:46',NULL,NULL,0,1,0),(4149,1,1,1,'Assets',' Etsi qui potest intellegi aut cogitari esse aliquod animal, quod se oderit? Ita relinquet duas, de quibus etiam atque etiam consideret. Sit enim idem caecus, debilis. Duo Reges: constructio interrete. Certe, nisi voluptatem tanti aestimaretis. Si enim ita est, vide ne facinus facias, cum mori suadeas. \n\n','2016-01-26 09:16:10','2016-02-15 09:36:47',NULL,NULL,0,1,0),(4150,1,1,1,'Assets',' Hoc etsi multimodis reprehendi potest, tamen accipio, quod dant. Hanc ergo intuens debet institutum illud quasi signum absolvere. Multoque hoc melius nos veriusque quam Stoici. Collatio igitur ista te nihil iuvat. Quamvis enim depravatae non sint, pravae tamen esse possunt. In quibus doctissimi illi veteres inesse quiddam caeleste et divinum putaverunt. Dic in quovis conventu te omnia facere, ne doleas. Sed quanta sit alias, nunc tantum possitne esse tanta. \n\n','2016-01-26 09:16:11','2016-02-15 09:36:47',NULL,NULL,0,1,0),(4151,1,1,1,'Assets',' Si quicquam extra virtutem habeatur in bonis. Atque haec ita iustitiae propria sunt, ut sint virtutum reliquarum communia. A quibus propter discendi cupiditatem videmus ultimas terras esse peragratas. Egone quaeris, inquit, quid sentiam? Aeque enim contingit omnibus fidibus, ut incontentae sint. Duo Reges: constructio interrete. Quid igitur dubitamus in tota eius natura quaerere quid sit effectum? Tecum optime, deinde etiam cum mediocri amico. Post enim Chrysippum eum non sane est disputatum. Quare conare, quaeso. \n\n','2016-01-26 09:16:11','2016-02-15 09:36:47',NULL,NULL,0,1,0),(4152,1,1,1,'Assets',' Duo Reges: constructio interrete. At ille pellit, qui permulcet sensum voluptate. Theophrastus mediocriterne delectat, cum tractat locos ab Aristotele ante tractatos? \n\n','2016-01-26 09:16:11','2016-02-15 09:36:48',NULL,NULL,0,1,0),(4153,1,1,1,'Assets',' Istam voluptatem, inquit, Epicurus ignorat? Gerendus est mos, modo recte sentiat. Idem iste, inquam, de voluptate quid sentit? Mihi enim erit isdem istis fortasse iam utendum. Quorum sine causa fieri nihil putandum est. Duo Reges: constructio interrete. Sed eum qui audiebant, quoad poterant, defendebant sententiam suam. Primum in nostrane potestate est, quid meminerimus? Quod cum accidisset ut alter alterum necopinato videremus, surrexit statim. Quamquam tu hanc copiosiorem etiam soles dicere. Luxuriam non reprehendit, modo sit vacua infinita cupiditate et timore. Ita nemo beato beatior. \n\n','2016-01-26 09:16:12','2016-02-15 09:36:48',NULL,NULL,0,1,0),(4154,1,1,1,'Assets',' Sit hoc ultimum bonorum, quod nunc a me defenditur; Duo Reges: constructio interrete. Isto modo, ne si avia quidem eius nata non esset. Non igitur bene. Tertium autem omnibus aut maximis rebus iis, quae secundum naturam sint, fruentem vivere. Tibi hoc incredibile, quod beatissimum. \n\n','2016-01-26 09:16:12','2016-02-15 09:36:48',NULL,NULL,0,1,0),(4155,1,1,1,'Accounts','','2016-02-15 09:36:48','2016-02-15 09:36:48',NULL,NULL,0,1,0),(4156,1,1,1,'Assets',' Varietates autem iniurasque fortunae facile veteres philosophorum praeceptis instituta vita superabat. Primum Theophrasti, Strato, physicum se voluit; Sed erat aequius Triarium aliquid de dissensione nostra iudicare. Itaque eos id agere, ut a se dolores, morbos, debilitates repellant. Si longus, levis dictata sunt. Te enim iudicem aequum puto, modo quae dicat ille bene noris. Duo Reges: constructio interrete. Placet igitur tibi, Cato, cum res sumpseris non concessas, ex illis efficere, quod velis? Nec lapathi suavitatem acupenseri Galloni Laelius anteponebat, sed suavitatem ipsam neglegebat; \n\n','2016-01-26 09:16:12','2016-02-15 09:36:49',NULL,NULL,0,1,0),(4157,1,1,1,'Accounts','','2016-02-15 09:36:49','2016-02-15 09:36:49',NULL,NULL,0,1,0),(4158,1,1,1,'Assets',' Tu enim ista lenius, hic Stoicorum more nos vexat. Non autem hoc: igitur ne illud quidem. Duo Reges: constructio interrete. Aliter enim explicari, quod quaeritur, non potest. At enim hic etiam dolore. Quid adiuvas? Ita relinquet duas, de quibus etiam atque etiam consideret. Quare obscurentur etiam haec, quae secundum naturam esse dicimus, in vita beata; \n\n','2016-01-26 09:16:13','2016-02-15 09:36:50',NULL,NULL,0,1,0),(4159,1,1,1,'Accounts','','2016-02-15 09:36:50','2016-02-15 09:36:50',NULL,NULL,0,1,0),(4160,1,1,1,'Assets',' Et harum quidem rerum facilis est et expedita distinctio. Nescio quo modo praetervolavit oratio. Polycratem Samium felicem appellabant. Et nemo nimium beatus est; Quamquam ab iis philosophiam et omnes ingenuas disciplinas habemus; Quid autem habent admirationis, cum prope accesseris? Duo Reges: constructio interrete. Primum quid tu dicis breve? \n\n','2016-01-26 09:16:13','2016-02-15 09:36:51',NULL,NULL,0,1,0),(4161,1,1,1,'Assets',' Illa argumenta propria videamus, cur omnia sint paria peccata. Eam tum adesse, cum dolor omnis absit; Cum praesertim illa perdiscere ludus esset. Duo Reges: constructio interrete. Roges enim Aristonem, bonane ei videantur haec: vacuitas doloris, divitiae, valitudo; Re mihi non aeque satisfacit, et quidem locis pluribus. Id et fieri posse et saepe esse factum et ad voluptates percipiendas maxime pertinere. Dat enim intervalla et relaxat. Sed quid sentiat, non videtis. Perge porro; \n\n','2016-01-26 09:16:13','2016-02-15 09:36:51',NULL,NULL,0,1,0),(4162,1,1,1,'Assets',' Beatus sibi videtur esse moriens. At negat Epicurus-hoc enim vestrum lumen estquemquam, qui honeste non vivat, iucunde posse vivere. Non risu potius quam oratione eiciendum? Pollicetur certe. Duo Reges: constructio interrete. \n\n','2016-01-26 09:16:14','2016-02-15 09:36:51',NULL,NULL,0,1,0),(4163,1,1,1,'Assets',' Qui non moveatur et offensione turpitudinis et comprobatione honestatis? Quae cum dixisset paulumque institisset, Quid est? Sit ista in Graecorum levitate perversitas, qui maledictis insectantur eos, a quibus de veritate dissentiunt. In quo etsi est magnus, tamen nova pleraque et perpauca de moribus. Sed quid minus probandum quam esse aliquem beatum nec satis beatum? Duo Reges: constructio interrete. Quas enim kakaw Graeci appellant, vitia malo quam malitias nominare. Quod non faceret, si in voluptate summum bonum poneret. \n\n','2016-01-26 09:16:14','2016-02-15 09:36:52',NULL,NULL,0,1,0),(4164,1,1,1,'Assets',' Ita multa dicunt, quae vix intellegam. Equidem e Cn. Indicant pueri, in quibus ut in speculis natura cernitur. \n\n','2016-01-26 09:16:14','2016-02-15 09:36:52',NULL,NULL,0,1,0),(4165,1,1,1,'Assets',' Quae similitudo in genere etiam humano apparet. Qui bonum omne in virtute ponit, is potest dicere perfici beatam vitam perfectione virtutis; Sit hoc ultimum bonorum, quod nunc a me defenditur; Sed ille, ut dixi, vitiose. \n\n','2016-01-26 09:16:15','2016-02-15 09:36:52',NULL,NULL,0,1,0),(4166,1,1,1,'Assets',' Expressa vero in iis aetatibus, quae iam confirmatae sunt. Gracchum patrem non beatiorem fuisse quam fillum, cum alter stabilire rem publicam studuerit, alter evertere. Age, inquies, ista parva sunt. Re mihi non aeque satisfacit, et quidem locis pluribus. Cur, nisi quod turpis oratio est? Dic in quovis conventu te omnia facere, ne doleas. Illis videtur, qui illud non dubitant bonum dicere -; Duo Reges: constructio interrete. Egone quaeris, inquit, quid sentiam? \n\n','2016-01-26 09:16:15','2016-02-15 09:36:52',NULL,NULL,0,1,0),(4167,1,1,1,'Assets',' Quis est, qui non oderit libidinosam, protervam adolescentiam? Claudii libidini, qui tum erat summo ne imperio, dederetur. De ingenio eius in his disputationibus, non de moribus quaeritur. Haec para/doca illi, nos admirabilia dicamus. Nihil minus, contraque illa hereditate dives ob eamque rem laetus. Tibi hoc incredibile, quod beatissimum. Duo Reges: constructio interrete. Bonum negas esse divitias, praeposìtum esse dicis? At hoc in eo M. Quamquam te quidem video minime esse deterritum. Qua igitur re ab deo vincitur, si aeternitate non vincitur? \n\n','2016-01-26 09:16:15','2016-02-15 09:36:53',NULL,NULL,0,1,0),(4168,1,1,1,'Assets',' Qua tu etiam inprudens utebare non numquam. Longum est enim ad omnia respondere, quae a te dicta sunt. Quibusnam praeteritis? Quarum ambarum rerum cum medicinam pollicetur, luxuriae licentiam pollicetur. Compensabatur, inquit, cum summis doloribus laetitia. Duo Reges: constructio interrete. Si enim ita est, vide ne facinus facias, cum mori suadeas. Non est enim vitium in oratione solum, sed etiam in moribus. Quid igitur, inquit, eos responsuros putas? Non enim solum Torquatus dixit quid sentiret, sed etiam cur. \n\n','2016-01-26 09:16:16','2016-02-15 09:36:53',NULL,NULL,0,1,0),(4169,1,1,1,'Assets',' Omnis enim est natura diligens sui. Nihil enim iam habes, quod ad corpus referas; \n\n','2016-01-26 09:16:16','2016-02-15 09:36:54',NULL,NULL,0,1,0),(4170,1,1,1,'Assets',' Ut in geometria, prima si dederis, danda sunt omnia. Quamquam te quidem video minime esse deterritum. Quae duo sunt, unum facit. Facile est hoc cernere in primis puerorum aetatulis. Si enim ad populum me vocas, eum. Hoc ne statuam quidem dicturam pater aiebat, si loqui posset. Haec quo modo conveniant, non sane intellego. Duo Reges: constructio interrete. \n\n','2016-01-26 09:16:16','2016-02-15 09:36:54',NULL,NULL,0,1,0),(4171,1,1,1,'Accounts','','2016-02-15 09:36:55','2016-02-15 09:36:55',NULL,NULL,0,1,0),(4172,1,1,1,'Assets',' Aliter enim explicari, quod quaeritur, non potest. Quid sequatur, quid repugnet, vident. Erat enim Polemonis. Multoque hoc melius nos veriusque quam Stoici. Hoc est non modo cor non habere, sed ne palatum quidem. Quid ei reliquisti, nisi te, quoquo modo loqueretur, intellegere, quid diceret? \n\n','2016-01-26 09:16:17','2016-02-15 09:36:55',NULL,NULL,0,1,0),(4173,1,1,1,'Accounts','','2016-02-15 09:36:56','2016-02-15 09:36:56',NULL,NULL,0,1,0),(4174,1,1,1,'Assets',' Longum est enim ad omnia respondere, quae a te dicta sunt. Si quicquam extra virtutem habeatur in bonis. Quam ob rem tandem, inquit, non satisfacit? Quid enim possumus hoc agere divinius? Duo Reges: constructio interrete. Quid enim est a Chrysippo praetermissum in Stoicis? \n\n','2016-01-26 09:16:17','2016-02-15 09:36:56',NULL,NULL,0,1,0),(4175,1,1,1,'Accounts','','2016-02-15 09:36:56','2016-02-15 09:36:56',NULL,NULL,0,1,0),(4176,1,1,1,'Assets',' Terram, mihi crede, ea lanx et maria deprimet. Conclusum est enim contra Cyrenaicos satis acute, nihil ad Epicurum. Longum est enim ad omnia respondere, quae a te dicta sunt. Age nunc isti doceant, vel tu potius quis enim ista melius? Transfer idem ad modestiam vel temperantiam, quae est moderatio cupiditatum rationi oboediens. \n\n','2016-01-26 09:16:17','2016-02-15 09:36:57',NULL,NULL,0,1,0),(4177,1,1,1,'Assets',' Respondent extrema primis, media utrisque, omnia omnibus. Negat esse eam, inquit, propter se expetendam. Quos quidem tibi studiose et diligenter tractandos magnopere censeo. Ita redarguitur ipse a sese, convincunturque scripta eius probitate ipsius ac moribus. Duo Reges: constructio interrete. Et quidem, inquit, vehementer errat; Si sapiens, ne tum quidem miser, cum ab Oroete, praetore Darei, in crucem actus est. \n\n','2016-01-26 09:16:18','2016-02-15 09:36:57',NULL,NULL,0,1,0),(4178,1,1,1,'Assets',' Qualis ista philosophia est, quae non interitum afferat pravitatis, sed sit contenta mediocritate vitiorum? Tollenda est atque extrahenda radicitus. Duo Reges: constructio interrete. Si stante, hoc natura videlicet vult, salvam esse se, quod concedimus; Quos quidem tibi studiose et diligenter tractandos magnopere censeo. Nec lapathi suavitatem acupenseri Galloni Laelius anteponebat, sed suavitatem ipsam neglegebat; Hoc non est positum in nostra actione. Summus dolor plures dies manere non potest? \n\n','2016-01-26 09:16:18','2016-02-15 09:36:58',NULL,NULL,0,1,0);
